import{_ as g,o as t,c as n,a,t as u,C as _,M as h,U as k,f as p,F as w,p as b,e as D,q as v}from"./chunks/framework.B1z0IdBH.js";const f={name:"PoemCard",props:{poem:{type:Object,required:!0}},methods:{handleImageError(i){i.target.src="/images/logo.svg"}}},B={class:"entry-container"},y={class:"entry"},A={class:"entry-image"},j=["src","alt"],z={class:"entry-content"},C={class:"entry-title"},E=["href"],S={class:"entry-description"};function x(i,e,s,m,o,r){return t(),n("div",B,[a("div",y,[a("div",A,[a("img",{src:s.poem.image_url,alt:s.poem.page_title,onError:e[0]||(e[0]=(...d)=>r.handleImageError&&r.handleImageError(...d))},null,40,j)]),a("div",z,[a("h2",C,[e[1]||(e[1]=a("span",{class:"title-icon"},null,-1)),a("a",{href:s.poem.page_url,target:"_blank"},u(s.poem.page_title),9,E)]),a("p",S,u(s.poem.context_page_description),1)])])])}const M=g(f,[["render",x],["__scopeId","data-v-b324ab2d"]]),P=JSON.parse(`[{"page_url":"https://de.wikipedia.org/wiki/Christian_St%C3%A4blein","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Bischof_Christian_St%C3%A4blein.jpg","page_title":"Christian Stäblein","context_page_description":"Christian Stäblein ist ein deutscher evangelisch-lutherischer Theologe und seit dem 16. November 2019 Bischof der Evangelischen Kirche Berlin-Brandenburg-schlesische Oberlausitz."},{"page_url":"https://tr.wikipedia.org/wiki/NGC_7235","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/NGC_7235.png","page_title":"NGC 7235","context_page_description":"NGC 7235, Yeni Genel Katalog'da yer alan bir açık yıldız kümesidir. Gökyüzünde Kral takımyıldızı yönünde yaklaşık olarak 9.207 ışık yılı uzaklıkta bulunur. İngiliz astronom John Herschel tarafından 1830 yılında 47,5 cm çaplı aynalı tip bir teleskopla keşfedilmiştir."},{"page_url":"https://pl.wikipedia.org/wiki/Maszutkinie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Maszutkinie%2C_powiat_suwalski%2C_2018-08-06_%2810%29.jpg","page_title":"Maszutkinie","context_page_description":"Maszutkinie – wieś w Polsce położona w województwie podlaskim, w powiecie suwalskim, w gminie Wiżajny.\\nW latach 1975–1998 miejscowość administracyjnie należała do województwa suwalskiego.\\nWieś założona w 1867–1868 r. w wyniku nadania 143 rodzinom bezrolnego chłopstwa 476 mórg na ziemiach rządowego folwarku Ejszeryszki.\\nGłaz narzutowy o obw. 10,4 m."},{"page_url":"https://nl.wikipedia.org/wiki/S%C3%A3o_Caetano_do_Sul","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/S%C3%A3o_Caetano_do_Sul_-_verticaliza%C3%A7%C3%A3o.JPG","page_title":"São Caetano do Sul","context_page_description":"São Caetano do Sul is een Braziliaanse gemeente in de deelstaat São Paulo. De stad maakt deel uit van de grootstedelijke mesoregio São Paulo. São Caetano do Sul is de Braziliaanse stad met het hoogste gemiddeld BNP en heeft een Human Development Index van 0.921. De stad telt ongeveer 152.000 inwoners en is 15,3 km² groot. De plaatselijke voetbalclub AD São Caetano speelt in de hoogste Braziliaanse voetbalreeksen.\\nSão Caetano do Sul is gelegen op een plateau dat deel uitmaakt van de Serra do Mar in het Hoogland van Brazilië."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%9A%D3%A9%D0%BD%D1%81%D1%8B%D2%93%D1%8B%D1%88%D1%81%D0%B0_%D2%A1%D3%99%D2%BB%D2%AF%D3%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/Turkishcoffee....jpg","page_title":"Көнсығышса ҡәһүә","context_page_description":"Көнсығышса ҡәһүә, көнсығышса кофе йәки төрөксә кофе — тартылған кофе бөртөктәрен махсус һауыт — туркаға һалынған һыуҙа бешереп әҙерләнгән кофе.\\n«Көнсығышса кофе» был эсемлек әҙерләү өсөн ҡулланылған кофе һәм кофе бөртөктәренең ниндәйҙер бер үҙаллы төрө тигән киң таралған яңылыш фекергә ҡарамаҫтан, был һүҙбәйләнеш менән бары тик кофе әҙерләү буйынса үҙенсәлекле рецепт ҡына аталып йөрөтөлә.\\n«Көнсығышса кофе» бар донъяла популяр булһа ла, ул тәү сиратта ҡасандыр Ғосман империяһы составына ингән Яҡын Көнсығыш, Төньяҡ Африка, Кавказ һәм Балҡан биләмәләрендә урынлашҡан илдәрҙә бигерәк тә киң таралған. Тарихи күҙлектән ҡарағанда, был тарафтарҙа ҡәһүә эсемлеген әҙерләүҙең төп ысулы нәҡ көнсығышса.\\nҺүҙбәйләнештең сығышынан һәм ҡулланылышынан ҡарағанда, көнсығышса йәки төрөксә кофе — бары тик Европа менән Америкала ғына таралыш алған. Был ысул менән әҙерләнгән эсемлекте, мәҫәлән, Яҡын Көнсығышта үҙенең «кофе» тигән ябай атамаһы менән йөрөтәләр. Ҡайһы бер илдәрҙә ҡәһүәнең урындарҙа бирелгән үҙ исеме лә бар."},{"page_url":"https://et.wikipedia.org/wiki/Bassettklarnet","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Leitner%2BKraus_Bassett-Unterteil.jpg","page_title":"Bassettklarnet","context_page_description":"Bassettklarnet on klarnetite perekonda kuuluv sopranklarnet, mille kirjutatud ulatuse alumine piir küünib nagu bassethornilgi väikse oktavi c-ni.\\nBassettklarnet on transponeeriv muusikainstrument.\\nBassettklarneti leiutajaks on Anton Stadler koostöös viini pillimeistri T. Lotziga. Bassettklarnetile in A on loodud näiteks Wolfgang Amadeus Mozarti klarnetikontsert KV 622 ja kvintett KV 581. Mozarti ooperi \\"Tituse halastus\\" numbris 9, Sextuse aarias, leidub clarinetto obbligato-partii, mis on kirjutatud bassettklarnetile in B.\\nStadleri instrumendi kohta on vähe andmeid. Üks J. G. K. Bischoffi valmistatud 16 klapiga bassettklarnet umbes aastast 1840 leidub Darmstadti kollektsioonis ning üks hilisem 19. sajandi juba tänapäevase lihtsustatud klapisüsteemiga eksemplar Bate'i kollektsioonis Oxfordis. Säilinud ajalooliste instrumentide loendi on koostanud Lawson.\\n1951. aastal ehitas tänapäevase klapisüsteemiga bassettklarneti Prahas Jiří Kratochvíl, et esitada helilooja soovidele vastavalt Mozarti klarnetikontserti. Sellest peale on näiteks Inglismaal valmistanud bassettklarneteid E. Planus. Bassettklarnetile on kirjutanud teoseid näiteks Richard Rodney Bennett ja Anthony Gilbert."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%9D%92%E5%B2%9B%E9%82%AE%E4%BE%BF%E5%B1%80%E5%A4%A7%E5%92%8C%E7%94%BA%E6%89%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/%E9%9D%92%E5%B2%9B%E8%BE%BD%E5%AE%81%E8%B7%AF%E9%82%AE%E7%94%B5%E5%B1%80_2005-10-24.jpg","page_title":"青岛邮便局大和町所","context_page_description":"青岛邮便局大和町所为青岛第一次日据时期邮政机构青岛邮便局的分支机构，其旧址位于中国青岛市市北区德平路1号，建于1922年，现为市北区政府认定的不可移动文物。"},{"page_url":"https://fr.wikipedia.org/wiki/Alexis_Sentenac","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Alexis_Sentenac_aux_Utopiales_2014_-_2.jpg","page_title":"Alexis Sentenac","context_page_description":"Alexis Sentenac, né le 15 mars 1975 au Mans, est un auteur de bande dessinée français."},{"page_url":"https://en.wikipedia.org/wiki/Wallington,_New_Jersey","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/2018-07-19_15_24_55_View_north_along_Bergen_County_Route_507_%28Locust_Avenue%29_at_Bergen_County_Route_120_%28Paterson_Avenue%29_in_Wallington%2C_Bergen_County%2C_New_Jersey.jpg","page_title":"Wallington, New Jersey","context_page_description":"Wallington is a borough in Bergen County, New Jersey, United States. As of the 2010 United States Census, the borough's population was 11,335, reflecting a decline of 248 from the 11,583 counted in the 2000 Census, which had in turn increased by 755 from the 10,828 counted in the 1990 Census.\\nWallington was created as a borough on January 2, 1895, based on a referendum held on December 31, 1894, from area taken from Bergen Township and Saddle River Township. The borough was formed during the \\"Boroughitis\\" phenomenon then sweeping through New Jersey, in which 26 boroughs were formed in Bergen County alone in 1894, with Wallington the last of the 26 to be formed by an 1894 referendum. Sections of Wallington were ceded to Garfield in 1898. The borough is said to have been named for Walling Van Winkle, who built a home in the future borough."},{"page_url":"https://en.wikipedia.org/wiki/M%C5%82awa","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Park_miejski_w_M%C5%82awie.jpg","page_title":"Mława","context_page_description":"Mława is a town in north-central Poland with 30,957 inhabitants in 2012. It is the capital of the Mława County. The town is situated in the Masovian Voivodeship, previously it was part of the Ciechanów Voivodeship.\\nDuring the invasion of Poland in 1939, the battle of Mława was fought to the north of the city."},{"page_url":"https://fr.wikipedia.org/wiki/Monts_(Indre-et-Loire)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Monts_-_monument_aux_morts.jpg","page_title":"Monts (Indre-et-Loire)","context_page_description":"Monts est une commune française située dans le département d'Indre-et-Loire en région Centre-Val de Loire.\\nL'histoire de cette commune de la vallée de l'Indre commence avec une mention latine du lieu dans une charte du IXᵉ siècle, malgré une présence humaine attestée depuis le Paléolithique. L'installation des rois de France dans la vallée de la Loire, de Charles VII à François Iᵉʳ, est l'occasion pour des membres ou des proches de la cour d'acheter des domaines dans la région. Plus d'une demi-douzaine de châteaux sont ainsi construits à Monts du milieu du XVᵉ siècle jusqu'à la Renaissance, mais sont tous réaménagés ou même intégralement reconstruits au XIXᵉ siècle. L'Indre est un sujet de préoccupation permanent pour les habitants de Monts : depuis le milieu du XVIIᵉ siècle, date à laquelle ces événements sont systématiquement consignés dans les chroniques, une crue majeure de la rivière se produit tous les cinquante ans en moyenne. Cette particularité et les contraintes topographiques expliquent que le centre-ville de cette commune en plein essor ne se développe que sur la rive gauche de l'Indre, plus élevée. En 2017, la population municipale montoise atteint 7 794 habitants."},{"page_url":"https://es.wikipedia.org/wiki/Pezuela_de_las_Torres","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/Torre_de_la_iglesia_parroquial_de_Pezuela_de_las_Torres.jpg","page_title":"Pezuela de las Torres","context_page_description":"Pezuela de las Torres es un municipio español de la Comunidad de Madrid, limítrofe con la provincia de Guadalajara, localizada en la comarca natural de la Alcarria de Alcalá.​​"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%96%A9%E6%A0%BC%E5%8B%92%E5%B8%83%E5%9C%8B%E5%AE%B6%E5%92%8C%E5%A4%A7%E5%AD%B8%E5%9C%96%E6%9B%B8%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Nsk23.jpg","page_title":"薩格勒布國家和大學圖書館","context_page_description":"萨格勒布国家和大学图书馆是克罗地亚的国家图书馆，也是萨格勒布大学的大学主图书馆。\\n该图书馆的历史可追溯至1607年，现在的大楼则是由克罗地亚建筑师韦利米尔·奈德哈特等于1978年至1984年间建成的，1995年图书馆正式搬到现址。"},{"page_url":"https://fr.wikipedia.org/wiki/Maleny","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Maleny.JPG","page_title":"Maleny","context_page_description":"Maleny est une ville de la communauté de Caloundra. Elle est située sur la Sunshine Coast, à une centaine de kilomètres au nord de Brisbane, dans le Queensland, en Australie, à l'intérieur des terres. Maleny surplombe les Glass House Moutains et est proche de Montville.\\nMaleny attire une population dite \\"écolo\\", \\"verte\\".\\nLe centre de Maleny est composée de deux rues principales : Maple St et Coral St.\\nLieux d'intérêt touristiques :\\nMary Cairncross, promenade dans la forêt subtropicale et point de vue sur les Glass House Mountains.\\nGardner Falls, à la sortie de la ville. Petites cascades, baignade possible."},{"page_url":"https://az.wikipedia.org/wiki/T%C3%BCrkiy%C9%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/TaiIDEF2015_%288%29.JPG","page_title":"Türkiyə","context_page_description":"Türkiyə və ya rəsmi adı ilə Türkiyə Respublikası — torpaqlarının əsas hissəsi Qərbi Asiya regionunun Kiçik Asiya yarımadasında, çox kiçik bir hissəsi isə Balkan yarımadasında yerləşən qitələrarası ölkə. Şimal-qərbdən Bolqarıstan, qərbdən Yunanıstan, şimal-şərqdən Gürcüstan, şərqdən Azərbaycan, İran, Ermənistan, cənubdan isə İraq və Suriya ilə həmsərhəddir. Ölkə üç tərəfdən dənizlə əhatə olunmuşdur. Qərbdən Egey dənizi, şimaldan Qara dəniz, cənubdan isə Aralıq dənizi ilə əhatələnmişdir. Bosfor boğazı, Mərmərə dənizi və Dardanel boğazı ölkənin Avropa və Asiya hissələrini bir-birindən ayırır. Paytaxt Ankara şəhəri olsa da, ölkənin əsas mədəni və iqtisadi mərkəzi, həmçinin ən böyük şəhəri İstanbuldur.\\nƏhalinin təqribən 70-80%-i özünü etnik türk hesab edir. Əhalinin 20%-ə yaxınını təşkil edən kürdlər ölkədə ən böyük etnik azlıq sayılır. Digər etnik azlıqlara adıqlar, albanlar, ərəblər, boşnaklar və lazlar daxildir. Rəsmi dil türk dilidir. Türk dili ilə yanaşı kurmanc, bosniya, ərəb, zaza, kabardin-çərkəz və digər dillərdə danışanlar da azlıq təşkil edir.\\nMüasir Türkiyə ərazisi paleolit dövründən etibarən müxtəlif xalqlar tərəfindən məskunlaşma mərkəzinə çevrilmişdir."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B7%D8%A7%D8%B1_%D8%A8%D8%A7%D9%85%D8%A7%D9%83%D9%88_%D9%85%D9%88%D8%AF%D9%8A%D8%A8%D9%88_%D9%83%D9%8A%D8%AA%D8%A7_%D8%A7%D9%84%D8%AF%D9%88%D9%84%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/A%C3%A9roport_International_Pr%C3%A9sident_Modibo_Keita.jpg","page_title":"مطار باماكو موديبو كيتا الدولي","context_page_description":"مطار باماكو موديبو كيتا الدولي، كان يسمى سابقاً بمطار باماكو سينو الدولي، إلى غاية دجنبر 2015.\\nهو المطار الرئيسي لدولة مالي ويقع في عاصمتها باماكو. ويبعد حوالي 15 كلم عن وسط مدينة باماكو، ويعتبر أيضا القاعدة الجوية الأولى للقوات الجوية المالية."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_der_Demokratischen_Republik_Kongo","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8e/Mercator_Congo_map.jpg","page_title":"Geschichte der Demokratischen Republik Kongo","context_page_description":"Die Geschichte der Demokratischen Republik Kongo beschreibt die Geschichte der Region, die später zum Territorium der Demokratischen Republik Kongo werden sollte. Ihre Grenzen wurden im Wesentlichen von der Kolonialmacht Belgien geprägt.\\nDie vorkoloniale Geschichte der Demokratischen Republik Kongo ist vor allem von mehreren Bantu-Reichen geprägt. Sie gingen nach über drei Jahrhunderten der Plünderung durch den europäischen und arabischen Sklavenhandel sämtlich in einer im Wesentlichen belgischen Kolonialherrschaft unter. Nach deren Ende 1960 und einem nachfolgenden Bürgerkrieg litt das Land ab 1965 unter einer über drei Jahrzehnte währenden Diktatur. Deren Ende 1997 war zugleich der Beginn einer Folge von Kriegen, die die ehemalige amerikanische Außenministerin Madeleine Albright den „ersten Weltkrieg in Afrika“ nannte und die – einschließlich des unmittelbar folgenden Kivu-Krieges – bis 2008 5,4 Millionen Menschen das Leben kosteten."},{"page_url":"https://en.wikipedia.org/wiki/S._Hareesh","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/S_hareesh.jpg","page_title":"S. Hareesh","context_page_description":"S. Hareesh is an Indian writer and translator of Malayalam literature and a screenwriter, best known for his short stories and his controversial debut novel, Meesha, which was the subject of a writ petition at the Supreme Court of India, seeking a ban on its publication. Considered by many as one of the major writers in the language, Hareesh is a recipient of several honours including the Kerala Sahitya Akademi Award for Novel and the Geetha Hiranyan Endowment of the Kerala Sahitya Akademi."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_ilhas_da_Para%C3%ADba","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Rio_Para%C3%ADba_do_Norte.png","page_title":"Lista de ilhas da Paraíba","context_page_description":"Esta é uma lista de ilhas do Estado da Paraíba, Brasil."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%BE%D1%8F%D1%80%D1%8B%D1%88%D0%BD%D0%B8%D1%86%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Mass_flight_of_Aporia_crataegi_and_Limenitis_populi.JPG","page_title":"Боярышница","context_page_description":"Боя́рышница — бабочка из семейства белянок. Гусеницы являются вредителями плодовых культур в Евразии и Северной Америке."},{"page_url":"https://en.wikipedia.org/wiki/Ploceus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Nelicourvi_Weaver.jpg","page_title":"Ploceus","context_page_description":"Ploceus is a genus of birds in the weaver family, Ploceidae. They are native to the Indomalayan and Afrotropical realms."},{"page_url":"https://ga.wikipedia.org/wiki/Hiiumaa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Hiiu_in_Estonia.svg","page_title":"Hiiumaa","context_page_description":"Is contae in Eastóin é Hiiumaa atá suite in iarthar na tíre. Tá sé an chontae i lú. Bhí 8,394 duine ina gcónaí i Hiiumaa i 2014."},{"page_url":"https://pl.wikipedia.org/wiki/Liszajecznik_odmienny","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Candelariella_reflexa_P34_%282%29.JPG","page_title":"Liszajecznik odmienny","context_page_description":"Liszajecznik odmienny – gatunek grzybów z rodziny Candelariaceae. Ze względu na symbiozę z glonami zaliczany jest do porostów."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%B4%D0%BC%D1%96%D0%BD%D1%96%D1%81%D1%82%D1%80%D0%B0%D1%82%D0%B8%D0%B2%D0%BD%D0%B8%D0%B9_%D0%BF%D0%BE%D0%B4%D1%96%D0%BB_%D0%BC%D1%83%D0%BD%D1%96%D1%86%D0%B8%D0%BF%D0%B0%D0%BB%D1%96%D1%82%D0%B5%D1%82%D1%83_%D0%A1%D0%B0%D0%BD-%D0%9F%D0%B0%D1%83%D0%BB%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Nova_017.jpg","page_title":"Адміністративний поділ муніципалітету Сан-Паулу","context_page_description":"Муніципалітет Сан-Паулу за законом офіційно поділяється на 31 субпрефектуру. Кожна субпрефектура ділиться на декілька округів. Субпрефектури з найбільшим числом районів — Се, в історичному і діловому центрі, Бутантан, Лапа, Пенья, Моока і Ітакера, що мають від 4 до 8 округів. Округ, де знаходиться керівництво субпрефектури, отримує ту ж назву, що і сама субпрефектура, за винятком М'Бой-Мірім.\\nРазом з адміністративним поділом, існує і географічний радіальний поділ, встановлений в 2007 році мером Жілберту Кассабом. За ним місто поділяється на десять регіонів, кожен має характерний колір автобусів і вуличних табличок. Цей поділ не має ніякого відношення до субпрефектур і районів, і, в деяких випадках, той же район може знаходитися в двох або більше географічних регіонах."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%B1%D9%8A%D8%B3%D8%AA%D9%8A%D8%A7%D9%86_%D9%85%D8%A7%D8%AA%D8%B4%D8%A7%D8%AF%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Illnino-prague3.jpeg","page_title":"كريستيان ماتشادو","context_page_description":"كريستيان ماتشادو ‏ هو مغني برازيلي، ولد في 24 يوليو 1974 في ريو دي جانيرو في البرازيل."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BC%D0%BE%D0%BB%D1%8C%D0%BA%D0%B8_(%D0%9D%D0%B8%D0%B6%D0%B5%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/68/At_the_entrance_to_village_Smol%27ki%2C_Nizhny_Novgorod_Oblast.jpg","page_title":"Смольки (Нижегородская область)","context_page_description":"Смольки — село в Городецком районе Нижегородской области, административный центр Смольковского сельсовета.\\nВ селе расположено отделение Почты России."},{"page_url":"https://et.wikipedia.org/wiki/Hillary_Clinton","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Hillary_Clinton_%2823705602384%29.jpg","page_title":"Hillary Clinton","context_page_description":"Hillary Rodham Clinton on USA poliitik. Aastatel 2009–2013 oli ta Ameerika Ühendriikide riigisekretär. Ta on Demokraatliku Partei liige alates 1968. aastast. Ta oli 2016. aasta presidendivalimistel Demokraatliku Partei kandidaat."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%82%D8%AF%D8%B1%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Wappen_Gedern.png","page_title":"قدرن","context_page_description":"قدرن آلمانین هسن ایالتینده یئر آلان بیر شهردیر و ۳۵۷ متر دنیز سوییه‌سیندن اۇجالیقی وار. بۇ شهرین ۷۵٫۲۴ کیلومتر موربّع ساحه‌سی وار."},{"page_url":"https://en.wikipedia.org/wiki/Gall","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Eikengallen_op_mannelijke_bloeiwijze.jpg","page_title":"Gall","context_page_description":"Galls or cecidia are a kind of swelling growth on the external tissues of plants, fungi, or animals. Plant galls are abnormal outgrowths of plant tissues, similar to benign tumors or warts in animals. They can be caused by various parasites, from viruses, fungi and bacteria, to other plants, insects and mites. Plant galls are often highly organized structures so that the cause of the gall can often be determined without the actual agent being identified. This applies particularly to some insect and mite plant galls. The study of plant galls is known as cecidology.\\nIn human pathology, a gall is a raised sore on the skin, usually caused by chafing or rubbing."},{"page_url":"https://it.wikipedia.org/wiki/Teatro_Coccia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Arturo_Toscanini_1908.png","page_title":"Teatro Coccia","context_page_description":"Il Teatro Coccia è il principale teatro lirico di Novara, ed è altresì il teatro \\"storico\\" più importante del Piemonte. Si affaccia lungo via fratelli Rosselli, e delimita ad ovest piazza dei Martiri e ad est piazza Giacomo Puccini."},{"page_url":"https://es.wikipedia.org/wiki/Jodra_de_Cardos","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Jodra_de_Cardos.jpg","page_title":"Jodra de Cardos","context_page_description":"Jodra de Cardos es una localidad de la provincia de Soria, partido judicial de Almazán, Comunidad Autónoma de Castilla y León, España. Pueblo de la Comarca de Arcos de Jalón que pertenece al municipio de Baraona."},{"page_url":"https://nl.wikipedia.org/wiki/Berengarius_I_van_Friuli","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6a/Berengar_I_of_Italy.jpg","page_title":"Berengarius I van Friuli","context_page_description":"Berengarius van Friuli was markgraaf van Friuli, koning van Italië en keizer vanaf 916."},{"page_url":"https://de.wikipedia.org/wiki/Naturpark_Habichtswald","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c5/Kassel-schloss-wilhelmshoehe-001i.jpg","page_title":"Naturpark Habichtswald","context_page_description":"Der Naturpark Habichtswald ist ein 474,28 km² großer Naturpark im Landkreis Kassel, im Gebiet der Kreisfreien Stadt Kassel und im Schwalm-Eder-Kreis, Nordhessen.\\nDer 1962 gegründete Naturpark erstreckt sich besonders westlich der Großstadt Kassel und enthält das Mittelgebirge Habichtswälder Bergland, dem nordöstlichsten Höhenzug des Westhessischen Berglands. Er ist international durch den darin liegenden Bergpark Wilhelmshöhe bekannt. Kulturgeschichtlich bedeutsam sind außerdem zahlreiche Burgen und Schlösser, die teilweise nur als Ruinen überkommen sind."},{"page_url":"https://br.wikipedia.org/wiki/Emgann_Stalingrad","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Stalingrad_Barrikaden_Frontbewegungen.jpg","page_title":"Emgann Stalingrad","context_page_description":"Emgann Stalingrad a zo bet un emgann drastus e-pad an Eil brezel bed adalek ar 17 a viz Gouhere 1942 betek an 2 a viz C'hwevrer 1943 etre al Lu Ruz eus un tu hag an armeoù alaman, italian, rouman ha kevredidi all, eus an tu arall.\\nEn-dro da gêr Stalingrad, e c'hoarvezas an emgann-se, unan eus ar re lazhusañ en Istor. Cheñch a reas mik doare ar brezel war Talbenn ar Reter, pa voe ar c'holl bras kentañ eus an arme alaman. Gronnet da heul enebargad ar Soviediz e rankas an Alamaned en em zaskoriñ. Un trec'h psikologel bras e voe ivez.\\nPal an emgann a oa da zigentañ da dapout buan petrol ar C'haokaz met pa voe talet nerzhioù an Trede Reich e kêr Stalingrad e teuas da vezañ ur stourm evit ar gêr."},{"page_url":"https://es.wikipedia.org/wiki/Carlos_Joaqu%C3%ADn_Gonz%C3%A1lez","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/CarlosManuelJoaquinGonzalez.jpg","page_title":"Carlos Joaquín González","context_page_description":"Carlos Manuel Joaquín González ​ es un político y contador público mexicano. Es Gobernador Constitucional del Estado de Quintana Roo desde el 25 de septiembre del 2016 después de haber alcanzado, en las elecciones correspondientes, el triunfo con el 45.6 por ciento de los votos.​ La coalición de partidos llamada UNE, que agrupó al Partido Acción Nacional y al Partido de la Revolución Democrática, ambos apoyaron su candidatura y destronaron al Partido Revolucionario Institucional tras 81 años en el gobierno del estado, resultado considerado histórico.\\nComo integrante del Partido Revolucionario Institucional, fue Subsecretario de Innovación y Desarrollo Turístico durante el sexenio del presidente Enrique Peña Nieto, ​ del 2012 al 2016. Entre el 2009 y el 2012, fue diputado federal, ​ también por el Partido Revolucionario Institucional, de la LXI Legislatura por el Distrito Electoral 3 de Quintana Roo, y Presidente Municipal de Solidaridad, ​ del 2005 al 2008. Es hijo del empresario turístico y político del estado de Quintana Roo Nassim Joaquín Ibarra."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%BE%D0%B1%D1%80%D0%BE%D0%B2%D0%BE%D1%99%D0%BD%D0%BE_%D0%B2%D0%B0%D1%82%D1%80%D0%BE%D0%B3%D0%B0%D1%81%D0%BD%D0%BE_%D0%B4%D1%80%D1%83%D1%88%D1%82%D0%B2%D0%BE_%D1%83_%D0%92%D1%80%D0%B1%D0%B0%D1%81%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Muzej_u_Vrbasu%2C_Traka_za_zastavu.jpg","page_title":"Добровољно ватрогасно друштво у Врбасу","context_page_description":"Добровољно ватрогасно друштво у Врбасу је удружење грађана, основано на њихову сопствену иницијативу, ради гашења пожара. Основано је 1904. године."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A5%BF%E5%BE%B7%E5%B0%BC%C2%B7%E8%AB%BE%E8%98%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Sidney_Nolan_Calf_Carcass.jpg","page_title":"西德尼·諾蘭","context_page_description":"西德尼·羅伯特·諾蘭爵士，OM，AC是一位澳大利亞畫家，代表作是《奈德·凱利》系列。"},{"page_url":"https://it.wikipedia.org/wiki/Armoriale_delle_famiglie_italiane_(Barom-Baz)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Coa_fam_ITA_bartolucci3_khi.jpg","page_title":"Armoriale delle famiglie italiane (Barom-Baz)","context_page_description":"Questo è l'armoriale delle famiglie italiane il cui cognome inizia con le lettere che vanno da Barom a Baz."},{"page_url":"https://tr.wikipedia.org/wiki/G%C3%BClcemal","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/SS_Germanic_%281875%29_p2.jpg","page_title":"Gülcemal","context_page_description":"Gülcemal, ilk ismi ile Germanic, 1874 yılında Belfast kentinde Harland and Wolff firması tarafından inşa edilen ve 1911 yılında Osmanlı Seyr-i Sefain İdaresi tarafından satın alınan uzun yol buharlı yolcu gemisi. Amerika'ya giden Türk bayraklı ilk gemi olarak Türk Sivil Denizcilik tarihine geçmiştir. 1950 yılında söküldüğünde 75 yıllık hizmet ömrüyle o tarihte dünyanın en uzun süre çalışan ikinci gemisi olarak da kayıtlara ayrıca geçmiştir."},{"page_url":"https://sh.wikipedia.org/wiki/Rutenijum","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Ru-TableImage.svg","page_title":"Rutenijum","context_page_description":"Rutenijum - je metal VIIIB grupe. Ime je dobio po latinskom naѕivu za Rusiju.\\nOvaj element ne poseduje bitnije minerale i obično se javlja u rudama platine."},{"page_url":"https://ca.wikipedia.org/wiki/Euryoryzomys_emmonsae","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Euryoryzomys_emmonsae_distribution.png","page_title":"Euryoryzomys emmonsae","context_page_description":"Euryoryzomys emmonsae és una espècie de rosegador del gènere Euryoryzomys i la família dels cricètids. Viu a la part brasilera de la conca de l'Amazones. Fou descrit el 1998 després de ser identificat incorrectament com a E. macconnelli i E. nitidus. El seu hàbitat natural és la selva. Pot ser que es tracti d'un animal arborícola que s'enfila als arbres, però també es mou per terra. La seva distribució és una zona petita situada al sud del riu Amazones, a l'estat de Pará. Es creu que en aquesta regió no hi ha cap altre rosegador muroïdeu que tingui la mateixa distribució."},{"page_url":"https://ca.wikipedia.org/wiki/Toni_Massan%C3%A9s_S%C3%A1nchez","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Toni_Massanes_Sanchez.jpg","page_title":"Toni Massanés Sánchez","context_page_description":"Toni Massanés Sánchez és un gastrònom català, director general de la Fundació Alícia, laboratori de l'alimentació responsable, un centre de recerca sobre cuina amb rigor científic que treballa perquè tothom mengi millor.\\nDiplomat en cuina a Barcelona i Tolosa de Llenguadoc. L'any 1991 és un dels fundadors del col·lectiu Joves Amants de la Cuina, que organitzaran tres jornades gastronòmiques al restaurant Aram amb el cuiner Pierre Gagnier de convidat especial.\\nS’ha dedicat a la docència, l’escriptura, el periodisme, i la recerca. És investigador de l’Observatori de l’Alimentació de la Universitat de Barcelona. Ha fet viatges de la mà de cuiners i cuineres locals —professionals i també casolans— per conèixer tradicions culinàries d’arreu del món. Sobretot ha estudiat la cuina catalana. A més d’elaborar estudis i receptaris de diverses comarques, ha dissenyat el mètode i dirigit l’equip de recerca que s’ha encarregat d’inventariar i catalogar el Corpus Culinari Tradicional Català. Presideix el jurat d’Écotrophélia España, el del Concurs d’escoles d’hostaleria de Catalunya i d’altres de cuina casolana..."},{"page_url":"https://en.wikipedia.org/wiki/Mass_surveillance_in_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Walt_Disney_Snow_white_1937_trailer_screenshot_%2813%29.jpg","page_title":"Mass surveillance in the United States","context_page_description":"The practice of mass surveillance in the United States dates back to World War I wartime monitoring and censorship of international communications from, to, or which passed through the United States. After the First World War and the Second World War, the surveillance continued, via programs such as the Black Chamber and Project SHAMROCK. The formation and growth of federal law-enforcement and intelligence agencies such as the FBI, CIA, and NSA institutionalized surveillance used to also silence political dissent, as evidenced by COINTELPRO projects which targeted various organizations and individuals. During the Civil Rights Movement era, many individuals put under surveillance orders were first labelled as integrationists then deemed subversive. Other targeted individuals and groups included Native American activists, African American and Chicano liberation movement activists, and anti-war protesters."},{"page_url":"https://fr.wikipedia.org/wiki/Bernard_Jabouin","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Catedral_Metropolitana_de_Santiago_04.JPG","page_title":"Bernard Jabouin","context_page_description":"Bernard Jabouin né le 7 décembre 1810 à Bordeaux et mort dans la même ville le 9 avril 1889 est un sculpteur ornemaniste français, spécialisé dans la décoration religieuse et le mobilier liturgique."},{"page_url":"https://en.wikipedia.org/wiki/Th%C3%A9odore_Deck","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Unterlinden-Th%C3%A9odore_Deck-Vase_%282%29.jpg","page_title":"Théodore Deck","context_page_description":"Joseph-Théodore Deck was a 19th-century French potter, an important figure in late 19th-century art pottery. Born in Guebwiller, Haut-Rhin, he began learning the trade in his early 20s, moving to Paris at age 24. In 1856 he established his own faience workshop, Joseph-Théodore Deck Ceramique Française, and began to experiment with styles from Islamic pottery, and in particular the Iznik style.\\nWhen Japonisme arrived in the 1870s he embraced this and other art pottery trends with enthusiasm, finally conquering the French establishment when he was made art director of Sèvres porcelain in 1887. Several important figures from the next generation were trained by Deck, including Edmond Lachenal.\\nIn the 1880s he also worked in the Chinese pottery tradition, also collaborating with Raphaël Collin, and other artists of the time. He died in Paris. In 1887 he published a treatise under the title La Faïence, which is available in facsimile online."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%96%D5%AB%D5%A6%D5%AB%D5%AF%D5%A1%D5%B5%D5%AB_%D5%86%D5%B8%D5%A2%D5%A5%D5%AC%D5%B5%D5%A1%D5%B6_%D5%B4%D6%80%D6%81%D5%A1%D5%B6%D5%A1%D5%AF%D5%AB_%D5%A4%D5%A1%D6%83%D5%B6%D5%A5%D5%AF%D5%AB%D6%80%D5%B6%D5%A5%D6%80%D5%AB_%D6%81%D5%A1%D5%B6%D5%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Wolfgang_Pauli_ETH-Bib_Portr_01042.jpg","page_title":"Ֆիզիկայի Նոբելյան մրցանակի դափնեկիրների ցանկ","context_page_description":"Ֆիզիկայի Նոբելյան մրցանակ, Շվեդիայի թագավորական գիտությունների ակադեմիայի կողմից ֆիզիկայի տարբեր ոլորտների ֆիզիկոսներին տրվող ամենամյա մրցանակ։ Ըստ Ալֆրեդ Նոբելի կտակի տրվող հինգ մրցանակներից մեկը, որը տրվում է ֆիզիկայի բնագավառում բացառիկ ներդրում ունեցած անձանց։ Ըստ Նոբելի կտակի՝ մրցանակը կառավարում է Նոբելյան հիմնադրամը և տրվում է Շվեդիայի թագավորական գիտությունների ակադեմիայի կողմից ընտրված՝ հինգ հոգուց բաղկացած հանձնաժողովի կողմից։ Մրցանակը տրվում է Ստոկհոլմում ամենամյա հանդիսավոր արարողության ժամանակ՝ Ալֆրեդ Նոբելի տարելիցին՝ դեկտեմբերի 10-ին։ Յուրաքանչյուր մրցանակ բաղկացած է մեդալից, դիպլոմից և դրամական պարգևից։"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D0%B2%D0%B5%D1%80_%D1%88%D1%82%D0%B0%D1%82%D0%B0_%D0%9C%D0%B8%D0%BD%D0%B0%D1%81-%D0%96%D0%B5%D1%80%D0%B0%D0%B9%D1%81_(%D0%BC%D0%B5%D0%B7%D0%BE%D1%80%D0%B5%D0%B3%D0%B8%D0%BE%D0%BD)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/53/MinasGerais_Meso_NortedeMinas.svg","page_title":"Север штата Минас-Жерайс (мезорегион)","context_page_description":"Север штата Минас-Жерайс — административно-статистический мезорегион в Бразилии, входит в штат Минас-Жерайс. Население составляет 1 610 413 человек. Площадь — 128 389,989 км². Плотность населения — 12,54 чел./км²."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Seesen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Rh%C3%BCden-Seesen_Stolperstein_Rudolf_Plaut.jpg","page_title":"Liste der Stolpersteine in Seesen","context_page_description":"Die Liste der Stolpersteine in Seesen enthält alle Stolpersteine, die im Rahmen des gleichnamigen Kunst-Projekts von Gunter Demnig in Seesen und im Ortsteil Rhüden verlegt wurden. Am 25. Juli 2006 wurde der erste Stein verlegt, dem folgten am 9. März 2012 weitere 12 Steine und eine Stolperschwelle. Am 3. Dezember 2012 wurden erstmals in Rhüden drei Steine an zwei Adressen und am 4. Dezember 2012 in Seesen 18 weitere Steine an fünf Adressen verlegt. Damit verfügt Seesen über 33 Stolpersteine und eine Stolperschwelle."},{"page_url":"https://en.wikipedia.org/wiki/Oklahoma%27s_at-large_congressional_seat","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Claude_Weaver%2C_Oklahoma.jpg","page_title":"Oklahoma's at-large congressional seat","context_page_description":"In 1913, Oklahoma was apportioned three additional congressional seats. For just the 63rd United States Congress, those three members represented the state at-large.\\nIn 1933, Oklahoma was apportioned one additional seat. For the 73rd through the 77th congresses, Will Rogers held the seat at-large. In 1943, the seat was eliminated."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%94%D0%B6%D0%B0%D0%BA_%D0%95%D0%BB%D0%B0%D0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Jack_Elam_in_Kansas_City_Confidential.jpg","page_title":"Джак Елам","context_page_description":"Джак Елам е американски актьор."},{"page_url":"https://cs.wikipedia.org/wiki/Kom%C3%A1rov_(okres_Beroun)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Kom%C3%A1rov%2C_Buzuluck%C3%A1_str.jpg","page_title":"Komárov (okres Beroun)","context_page_description":"Městys Komárov se nachází v okrese Beroun, kraj Středočeský, 4 km jihozápadně od města Hořovice. Žije zde přibližně 2 400 obyvatel."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%9B%E0%B8%B1%E0%B8%8D%E0%B8%8D%E0%B8%B2%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B8%94%E0%B8%B4%E0%B8%A9%E0%B8%90%E0%B9%8C%E0%B8%97%E0%B8%B1%E0%B9%88%E0%B8%A7%E0%B9%84%E0%B8%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Estimations_of_Human_Brain_Emulation_Required_Performance.svg","page_title":"ปัญญาประดิษฐ์ทั่วไป","context_page_description":"ปัญญาประดิษฐ์ทั่วไป หรือ เอจีไอ เป็นระบบเครื่องจักรฉลาดที่สามารถทำงานได้อย่างชาญฉลาดเทียบเท่ามนุษย์ เป็นเป้าหมายหลักของงานวิจัยสายปัญญาประดิษฐ์ และมักถูกกล่าวถึงบ่อยในนิยายวิทยาศาสตร์ ในบางครั้งก็ถูกเรียกว่า ปัญญาประดิษฐ์แบบเข้ม หรือ ปัญญาประดิษฐ์เต็มรูปแบบ หมายถึงการกระทำที่มีความฉลาดไม่เฉพาะเรื่องใดเรื่องหนึ่ง\\nปัญญาประดิษฐ์ทั่วไปมีความแตกต่างกับปัญญาประดิษฐ์เชิงประยุกต์ ที่บางครั้งเรียกว่า ปัญญาประดิษฐ์เชิงแคบ หรือปัญญาประดิษฐ์แบบอ่อน เป็นสาขาที่เน้นการสร้างซอฟต์แวร์เพื่อการแก้ไขปัญหาหรือทำงานบางอย่างที่เกี่ยวข้องกับเหตุและผล งานวิจัยปัญญาประดิษฐ์แบบอ่อนนั้นไม่ได้เน้นเรื่องการทำให้เครื่องจักรมีความฉลาดแบบครอบคลุมในวงกว้างแบบงานวิจัยสายปัญญาประดิษฐ์ทั่วไป"},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%A8%D7%A6%D7%93%D7%A1-%D7%91%D7%A0%D7%A5_T2","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/1984_Mercedes-Benz_%28T2%29_%284864622008%29.jpg","page_title":"מרצדס-בנץ T2","context_page_description":"מרצדס-בנץ T2 הם קשת רחבה של דגמים במספר תצורות של כלי רכב מסחריים מתוצרת יצרנית הרכב הגרמנית מרצדס-בנץ, אשר יוצרו בין השנים 1967–1996 בגרמניה.\\nבין השנים 1971–1997 יוצרו בספרד על ידי Mercedes-Benz España.\\nבנוסף, יוצרו דגמי \\"מרצדס-בנץ T2\\" בארגנטינה ווונצואלה.\\nבין השנים 1969–2000 הורכבו דגמי \\"מרצדס-בנץ L 319\\" באיראן על ידי יצרנית המכוניות האירניות \\"Iran Khodro\\" ברישיון מרצדס."},{"page_url":"https://eo.wikipedia.org/wiki/Akvobara%C4%B5o_Proserpina","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Embalse_de_Proserpina%2C_M%C3%A9rida_%282015%29.JPG","page_title":"Akvobaraĵo Proserpina","context_page_description":"La Akvobaraĵo Proserpina estas romia gravita akvobaraĵo en Badajoz, Ekstremaduro, Hispanio, date el la 1a aŭ la 2a jarcento p.K. Ĝi estis konstruita kiel parto de la infrastrukturo kiu liveris al la urbo Emerita Augusta akvon.\\nPost la falo de la Romia Imperio la akvedukto kiu kondukis al la urbo falis en ruino, sed kaj la masonmuro kaj la terdigo kun retenanta muro estas ankoraŭ uzata.\\nĜi estis deklarita Bien de Interés Cultural en 1912.\\nĜi estas ankaŭ parto de la Arkeologia Ensemblo de Mérida, nome Monda Heredo de UNESCO ekde 1993."},{"page_url":"https://sv.wikipedia.org/wiki/Pyrrharctia_isabella","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Pyrrharctia_isabella1.jpg","page_title":"Pyrrharctia isabella","context_page_description":"Pyrrharctia isabella är en fjärilsart som beskrevs av Smith 1797. Pyrrharctia isabella ingår i släktet Pyrrharctia och familjen björnspinnare. Inga underarter finns listade."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_medaljevinnere_under_Sommer-OL_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Nino_Schurter_at_the_Worlds_2011.jpg","page_title":"Liste over medaljevinnere under Sommer-OL 2012","context_page_description":"Liste over medaljevinnere under Sommer-OL 2012 inneholder alle 1780 utøvere som tok medalje under Sommer-OL 2012 som ble holdt i London, Storbritannia fra 27. juli til 12. august 2012.\\nOmtrent 10 500 utøvere deltok i 302 øvelser i totalt 26 idretter under lekene.\\nBahrain, Botswana, Kypros, Gabon, Grenada, Guatemala og Montenegro vant sin første olympiske medalje gjennom tidene, og Grenada tok også sin første gullmedalje.\\nI boksing, judo, taekwondo og bryting ble det utdelt to bronsemedaljer i hver vektklasse da det ikke arrangeres bronsefinaler. To sølvmedaljer ble utdelt på grunn av delt resultat i herrenes 200 meter freestyle og 100 meter butterfly i svømming."},{"page_url":"https://it.wikipedia.org/wiki/Museo_Gino_Tonutti","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Cisitalia_303_DF_Coup%C3%A9_1952.JPG","page_title":"Museo Gino Tonutti","context_page_description":"Il museo Gino Tonutti si trova nel comune di Remanzacco ed è nato dalla grande passione per macchinari, auto e motori dell'imprenditore Gino Tonutti, scomparso nel 2003, che ha raccolto e messo a disposizione dei visitatori circa duecento esemplari di macchine agricole, che mostrano l'evoluzione tecnologica da metà Ottocento fino ai nostri giorni. Inoltre vi è raccontata la storia del motore a scoppio applicato alle automobili e motociclette.\\nCollocato su un'area di 10.800 m², il museo è suddiviso in quattro sezioni."},{"page_url":"https://it.wikipedia.org/wiki/Re_di_Galizia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Alfons9.jpg","page_title":"Re di Galizia","context_page_description":"Il Regno di Galizia nacque quando il re delle Asturie, Alfonso III, alla sua morte, divise il proprio regno tra i tre figli maggiori e la Galizia venne data al secondogenito, Ordoño II. Nei secoli successivi il Regno di Galizia finì in unione personale con il Regno di León. Dal 1230, così come il Regno di León, divenne un regno della corona di Castiglia e tale rimase il suo status giuridico sino al 30 novembre 1833, quando fu varata una riforma amministrativa della Spagna, che cancellò i vecchi reami, con i rispettivi fueros, instituendo al loro posto le province. La Galizia, in particolare, fu divisa in quattro province: A Coruña, Ourense, Pontevedra, e Lugo.\\nIn due periodi distinti, la Galizia fu occupata dai re portoghesi, che si proclamarono re di Galizia. Ciò avvenne sotto Ferdinando I, durante la prima guerra civile castigliana, e sotto Alfonso V, durante la seconda guerra civile castigliana."},{"page_url":"https://pt.wikipedia.org/wiki/Hermes","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Lekythos_Hermes_Herse_MAN.jpg","page_title":"Hermes","context_page_description":"Hermes era, na mitologia grega, um dos deuses olímpicos, filho de Zeus e de Maia, e possuidor de vários atributos. Divindade muito antiga, já era cultuado na história pré-Grécia antiga possivelmente como um deus da fertilidade, dos rebanhos, da magia, da divinação, das estradas e viagens, entre outros atributos. Ao longo dos séculos seu mito foi extensamente ampliado, tornando-se o mensageiro dos deuses e patrono da ginástica, dos ladrões, dos diplomatas, dos comerciantes, da astronomia, da eloquência e de algumas formas de iniciação, além de ser o guia das almas dos mortos para o reino de Hades, apenas para citar-se algumas de suas funções mais conhecidas. Com o domínio da Grécia por Roma, Hermes foi assimilado ao deus Mercúrio, e através da influência egípcia, sofreu um sincretismo também com Tot, surgindo o personagem de Hermes Trismegisto. Ambas as assimilações tiveram grande importância, criando rica tradição e perpetuando sua imagem através dos séculos até a contemporaneidade, exercendo significativa influência sobre a cultura do ocidente e de certas áreas orientais em torno do Mediterrâneo, chegando até à Pérsia e à Arábia."},{"page_url":"https://tg.wikipedia.org/wiki/%D0%A7%D0%B5%D1%87%D0%B5%D0%BD%D2%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Tapa_Tchermoeff_140-190_for_collage.jpg","page_title":"Чеченҳо","context_page_description":"Чече́нҳо — халқи Қафқозӣ, ки дар шимоли Қафқоз зиндагӣ мекунанд. Халқи асосии Ҷумҳурии Чеченистон. Дар Ҷумҳурии Доғистон ҳам сокини мекунанд. Дар дини Ислом ҳастанд."},{"page_url":"https://he.wikipedia.org/wiki/%D7%95%D7%90%D7%9F_%D7%93%D7%99%D7%99%D7%A8%D7%A7%D7%A9%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/ZaynWWATchile_Cropped.jpg","page_title":"ואן דיירקשן","context_page_description":"וואן דיירקשן היא להקת בנים אנגלית-אירית הכוללת את נייל הורן, ליאם פיין, הארי סטיילס ולואי טומלינסון. זאין מאליק פרש מהלהקה ב-25 במרץ 2015. הלהקה הוקמה בשלב האחרון של מחנה האימונים בתוכנית הטלוויזיה הבריטית \\"The X Factor\\" בשנת 2010.\\nהלהקה נוסדה על ידי סיימון קאוול, אחד משופטי התוכנית. במסגרת התוכנית עבר כל אחד מחברי הלהקה אודישן והגיע לשלב הסופי של מחנה האימונים, אותו לא עבר. למרות זאת, התבשרו על איחודם כלהקה חדשה בתוכנית. כבר בזמן שידורה של התוכנית, היה ללהקה קהל מעריצים גדול בכל רחבי בריטניה ובכל רחבי העולם הוכרזו כ\\"דבר הגדול הבא\\". הלהקה הגיעה למקום השלישי בגמר התוכנית. אף על פי שלא זכו, החליט קאוול להחתימם על חוזה הקלטות בחברת ההקלטות שלו, 'Syco Music'. הלהקה הוציאה עד כה 5 אלבומים, אשר נחלו הצלחה מסחררת, ונחשבו כאלבומים המובילים של אותם שנים.\\nהלהקה זכתה במספר רב של פרסים בטקסי פרסים מכובדים מאוד, ובהם; 6 פרסים מטקס פרסי המוזיקה הבריטית, 4 פרסי VMA, אחד-עשר פרסים מטקס פרסי המוזיקה של MTV אירופה, 7 פרסים מטקס פרסי המוזיקה האמריקאית, 27 פרסים מטקס פרסי בחירת הנוער, פרס \\"האמן החדש המוביל\\" של בילבורד, ועוד פרסים רבים. לפי דברי ניק גטפילד, יושב-ראש ומנכ\\"ל חברת 'Sony Music Entertainment', הלהקה הכניסה כ-50 מיליון דולר עד ליוני 2012."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B9%BF%E8%A5%BF%E8%B7%AF_(%E9%9D%92%E5%B2%9B)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/%E9%9D%92%E5%B2%9B%E6%80%BB%E7%9D%A3%E5%BA%9C%E5%BB%BA%E8%AE%BE%E5%B1%80%E5%B1%80%E9%95%BF%E5%AE%98%E9%82%B8%E5%BB%BA%E8%AE%BE%E4%B8%AD.jpg","page_title":"广西路 (青岛)","context_page_description":"广西路是中国青岛市市南区的一条东西向道路，也是全市最早建成的一批道路之一。该路东起龙口路，与常州路、江苏路、日照路、青岛路、莒县路、安徽路、浙江路、中山路、河南路、蒙阴路等马路交汇，西抵泰安路上的铁路青岛站。\\n今广西路的1号大门以西段连同常州路的广西路口至太平路口段始建于德国租借时期，修建于1899-1901年间，以时任德国海军远东舰队司令的普鲁士亲王海因里希定名为海因里希亲王街，日本第一次统治时期改名为佐贺町。而广西路的1号大门以东段连同龙江路的黄县路口以南段及黄县路的龙江路口以东段在其始建的德租时期名为东兵营街。\\n今天街道北侧历史建筑保存相对较多，南侧的老建筑则因为1990年代的太平路大规模改造而近乎灭失殆尽。"},{"page_url":"https://ast.wikipedia.org/wiki/Afrodita","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Sousse_mosaic_Venus.JPG","page_title":"Afrodita","context_page_description":"Afrodita ye, na mitoloxía griega, la diosa de la guapura y el amor. El so equivalente romanu ye Venus.\\nAnque de cutiu alúdese a ella na cultura moderna como «la diosa del amor», ye importante señalar que d'antiguo non se refería al amor nel sentíu románticu sinón eróticu."},{"page_url":"https://es.wikipedia.org/wiki/Laja_(Chile)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/UT_440_MC_en_Hualqui.jpg","page_title":"Laja (Chile)","context_page_description":"Laja es una comuna y ciudad de Chile, ubicada en la Región del Biobío y en la provincia homónima. Está limitada al norte por el río Laja, al oeste por el río Biobío, y al sur y al este por la comuna de Los Ángeles.\\nDentro de su territorio se encuentran: La Laja, su ciudad capital; las aldeas de Las Ciénagas, Villa Laja y Las Playas; y los caseríos de Puente Perales, Cantera, Violeta Parra, Cachapoal, La Colonia, Altos del Laja, Las Ciénagas, Diuquín, Picul, Santiago Chico, Quilales, Chillancito, Las Viñas, Las Lomas, Santa Elena, La Aguada y Arenas Muertas.​\\nSu nombre se debe a la denominación que los españoles le dieron en el territorio como \\"Isla de La Laxa\\", donde la «x» es pronunciada como nuestra actual «j».\\nIntegra junto a las comunas de Alto Biobío, Antuco, Los Ángeles, Mulchén, Nacimiento, Negrete, Quilaco, Quilleco, San Rosendo, Santa Bárbara y Tucapel el distrito electoral n.º 47 y a la 13ª Circunscripción Senatorial."},{"page_url":"https://sk.wikipedia.org/wiki/D%C5%BEamolidin_Abdu%C5%BEaparov","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Djamolidine_ABDOUJAPAROV.jpg","page_title":"Džamolidin Abdužaparov","context_page_description":"Džamolidin Abdužaparov je bývalý sovietsky profesionálny cestný cyklista.\\nAbužaparov bol špecialista-šprintér, s úspechmi na najvýznamnejších pretekoch sveta. Je deväťnásobným víťazom etapy na Tour de France, trojnásobným víťazom bodovacej súťaže na týchto pretekoch. V komunistickej ére bol významným účastníkom Pretekov mieru, s víťazstvom etapy napríklad aj v Leviciach.\\nV roku 1991 sa stal známy pádom v poslednej etape Tour de France, kde pri šprinte na čele peletónu narazil dvesto metrov pred cieľom do ochrannej bariéry a stiahol so sebou aj ďalších cyklistov.\\nSpolu s Eddym Merckxom a Laurentom Jalabertom sú jediní cyklisti, ktorí získali bodovacie tričko na všetkých troch Grand tour.\\nAko 18-ročný sa dostal do sovietskej reprezentácie. Kariéru ukončil v roku 1997 po pozitívnej dopingovej skúške."},{"page_url":"https://gl.wikipedia.org/wiki/M%C3%ADchigan","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a0/DetroitSkyline.jpg","page_title":"Míchigan","context_page_description":"Míchigan é un dos 50 Estados de Estados Unidos de América, un dos líderes nacionais da industria de manufacturación. A capital nacional da industria automobilística está localizada na maior cidade do estado, Detroit e o estado é o maior produtor de coches e camións dos Estados Unidos.\\nLimita con catro dos cinco Grandes Lagos. O seu litoral posúe 5.292 km de extensión. Pode ser dividido en dúas áreas distintas: a Península Superior e a Península Inferior, conectadas entre si só por unha ponte de 8 quilómetros de lonxitude."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%9E%D7%A6%D7%95%D7%A8_%D7%A2%D7%9C_%D7%9E%D7%9C%D7%98%D7%94_(%D7%9E%D7%9C%D7%97%D7%9E%D7%AA_%D7%94%D7%A2%D7%95%D7%9C%D7%9D_%D7%94%D7%A9%D7%A0%D7%99%D7%99%D7%94)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/George_Cross_Malta_P1440218.jpg","page_title":"המצור על מלטה (מלחמת העולם השנייה)","context_page_description":"המצור על מלטה התנהל במסגרת הקרב על הים התיכון במלחמת העולם השנייה בין השנים 1940–1942. במאבק על השליטה באי מלטה, החשוב מבחינה אסטרטגית, השתתפו חיל האוויר המלכותי האיטלקי והצי המלכותי האיטלקי של איטליה הפשיסטית והלופטוואפה והקריגסמרינה של גרמניה הנאצית כנגד חיל האוויר המלכותי והצי המלכותי של בריטניה.\\nהחל מסיומו של הקרב על כרתים, ביוני 1941 ועד לקרב אל-עלמיין השני, בנובמבר 1942, היה האי הקטן מלטה השטח היחידי בשליטת בעלות הברית בכל מרחב הים התיכון שבין גיברלטר במערב למצרים וארץ ישראל במזרח.\\nפתיחתה של המערכה בצפון אפריקה באמצע שנת 1940 הגדילה את חשיבותה של מלטה. כוחות אוויר וים שהיו מוצבים באי היו בעלי יכולת לתקוף את ספינותיהן של מדינות הציר שהובילו אספקה חיונית ותגבורות מאירופה לצפון אפריקה. הפילדמרשל ארווין רומל, שפיקד על כוחות הציר בצפון אפריקה הכיר עד מהרה בחשיבותו של האי. במאי 1941 הוא התריע כי: \\"ללא מלטה יאבד הציר את השליטה בצפון אפריקה\\".\\nכוחות הציר היו נחושים להפציץ או להרעיב את מלטה עד לכניעתה, על ידי תקיפתם של הנמלים, העיירות, הערים ושל ספינות בעלות הברית שהובילו אספקה לאי. מלטה הייתה אחד מהמקומות שהופצצו בצורה האינטנסיבית ביותר במלחמה."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%B2%E0%AE%B5%E0%AF%8D%E0%AE%9F%E0%AF%87%E0%AE%B2%E0%AF%8D,_%E0%AE%87%E0%AE%A8%E0%AF%8D%E0%AE%A4%E0%AE%BF%E0%AE%AF%E0%AE%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Lovedale_Junction.Ooty.jpg","page_title":"லவ்டேல், இந்தியா","context_page_description":"லவ்டேல் என்பது இந்தியாவின் தமிழ்நாட்டிலுள்ள நீலகிரி மலையில் அமைந்திருக்கும் ஒரு சிறிய நகரமாகும். நீலகிரியில் கடல் மட்டத்திலிருந்து மிக உயரமாக அமைந்துள்ள நகரங்களில் லவ்டேல் நகரமும் ஒன்றாகும். தற்போது நீலகிரியிலுள்ள முக்கியமான சுற்றுலாத் தளங்களில் இந்நகரமும் இடம் பிடிக்கிறது."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BB%D0%B8%D1%81%D1%82%D1%8A%D1%80_%D0%9A%D0%B0%D1%80%D1%82%D1%8A%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Ali_Carter_at_Snooker_German_Masters_%28DerHexer%29_2013-02-03_17.jpg","page_title":"Алистър Картър","context_page_description":"Алистър Картър, е английски професионален състезател по снукър. Картър става професионалист през 1996 г. Живее в Челмсфорд, Великобритания. Прякорът, с който е известен сред феновете си, е „Капитанът“, заради хобито му да пилотира самолети.\\nПрез 2008 година той достига до финала на Световния шампионат по снукър, неговият първи по-голям финал. Въпреки че губи с голяма разлика от шампиона Рони О'Съливан, това негово постижение му помага да стигне до топ 8 на най-добрите снукър играчи за сезон 2008/2009."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%9D%D0%B0%D0%B2%D0%BE%D0%B4%D0%BD%D1%83%D0%B2%D0%B0%D1%9A%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/TravellingSprinkler.JPG","page_title":"Наводнување","context_page_description":"Наводнување претставува хидротехничка мерка за подобрување на физичката особина на земјиштето со додавање на вода, со што би се постигнала оптималната влага за време на вегетацијата и така да постигне оптимален придонес. Наводнувањето се прави во период од еден дел на вегетацијата или во време од целиот вегетациски период. Водата се користи од водените текови, на вештачките езера, извори или од пречистени отпадни води. Според начинот на претварање на протокот на капиларна вода во почвата, постојат три методи на наводнување: површинско, подземно и дождовни."},{"page_url":"https://pl.wikipedia.org/wiki/Nina_Andrycz","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Nina_Andrycz_Warszawska_Premiera_1950.jpg","page_title":"Nina Andrycz","context_page_description":"Nina Andrycz – polska aktorka teatralna, filmowa i telewizyjna, recytatorka oraz poetka i pisarka."},{"page_url":"https://lv.wikipedia.org/wiki/Neatkar%C4%ABbas_av%C4%93nija_(%C5%A0%C4%8Decina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Niepodleg%C5%82o%C5%9Bci_Avenue_in_Szczecin%2C_2018.jpg","page_title":"Neatkarības avēnija (Ščecina)","context_page_description":"Neatkarības avēnija ir Ščecinas avēnija, Centra administratīvajā rajonā, Centra un Jaunās pilsētas apkaimē. Neatkarības avēnija sākas krustojumā ar Polijas karavīra laukumu un beidzas krustojumā ar Partizānu, Stacijas ielām un 3. maija avēniju. Avēnijas kopējais garums ir 561,7 metri."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D1%80%D1%8D%D0%B4%D0%BB%D0%B8_(%D0%B0%D1%8D%D1%80%D0%BE%D0%BF%D0%BE%D1%80%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Bradley_Terminal_B_interior_before_renovations%2C_March_2006.jpg","page_title":"Брэдли (аэропорт)","context_page_description":"Международный аэропорт Брэдли — гражданский аэропорт, расположенный в 5 км к западу от Виндзор-Локс, Коннектикут на границе с Ист Грэнби в графстве Хартфорд, Коннектикут, США. Принадлежит штату Коннектикут.\\nАэропорт находится между городами Виндзор-Локс, Саффилд и Ист Грэнби, на полпути между Хартфордом и Спрингфилдом. Это самый загруженный коммерческий аэропорт Коннектикута, в нём совершается 390 взлётов-посадок в среднем ежедневно, а также второй по загруженности аэропорт Новой Англии после бостонского Международного аэропорта Логан. Крупнейшим авиаперевозчиком в Международном аэропорту Брэдли является Delta Air Lines.\\nВ аэропорту находится Музей авиации Новой Англии."},{"page_url":"https://vi.wikipedia.org/wiki/Chu%E1%BB%99t_nh%E1%BA%AFt_nh%C3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Mapa_Mus_musculus.png","page_title":"Chuột nhắt nhà","context_page_description":"Chuột nhắt nhà là loài gặm nhấm có kích thước nhỏ và là một trong những loài có số lượng lớn nhất của chi Mus. Chuột nhắt chủ yếu sống gần con người và gây hại mùa màng cũng như lương thực, thực phẩm bảo quản. Chuột nhắt cũng đã được thuần hóa làm chuột cảnh và cũng được dùng làm chuột thí nghiệm trong sinh học và y học. Chúng là động vật được sử dụng phổ biến nhất trong các phòng thí nghiệm kĩ thuật di truyền."},{"page_url":"https://cs.wikipedia.org/wiki/Leopold_Bauer","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Bielsko-Bia%C5%82a%2C_Cathedral_of_St_Nicholas.jpg","page_title":"Leopold Bauer","context_page_description":"Leopold Bauer byl rakouský a především slezský architekt. Podobně jako u Josepha Maria Olbricha se v jeho životě a díle spojovala kultura tehdejšího hlavního města monarchie Vídně s německou kulturou Horního Slezska. Bauerovy plány i realizace procházely funkcionalismem, secesí, klasicismem, neobiedermeierem a řadou historismů, přičemž často prvky jednotlivých směrů organicky kombinovaly."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8F%A4%E4%BA%AD%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/GT_07.JPG","page_title":"古亭駅","context_page_description":"古亭駅は、中華民国台北市中正区と大安区に跨って位置する、台北捷運の捷運駅。\\n本項では、かつて当駅付近にあった台湾総督府鉄道新店線の古亭駅についても記述する。"},{"page_url":"https://nn.wikipedia.org/wiki/Gr%C3%B8nlandsm%C3%A5se","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Larus-glaucoides-002.jpg","page_title":"Grønlandsmåse","context_page_description":"Grønlandsmåse, Larus glaucoides, er ein fugleart i måsefamilien."},{"page_url":"https://fr.wikipedia.org/wiki/Maison_de_Choiseul","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/H%C3%B4tel_de_Choiseul-Praslin.jpg","page_title":"Maison de Choiseul","context_page_description":"La Maison de Choiseul est une famille noble d'extraction chevaleresque citée en 1060. Originaire de Champagne et de Lorraine, son berceau est le village de Choiseul en Bassigny."},{"page_url":"https://it.wikipedia.org/wiki/Wilma","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Lady-Halle.jpg","page_title":"Wilma","context_page_description":"Wilma è un nome proprio di persona italiano femminile."},{"page_url":"https://de.wikipedia.org/wiki/Carnuntum_(Zivilstadt)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Carnuntum%2C_Therme%2C_Becken.JPG","page_title":"Carnuntum (Zivilstadt)","context_page_description":"Die Zivilstadt Carnuntum oder Karnuntum lag direkt am pannonischen Limes, entwickelte sich parallel zum Legionslager und war seit Beginn des 2. Jahrhunderts n. Chr. Verwaltungszentrum der römischen Provinz Pannonien. Sie zählt zu den bedeutendsten und am umfangreichsten erforschten antiken Ausgrabungsstätten in Österreich und liegt auf den Gemeindegebieten von Petronell-Carnuntum und Bad Deutsch-Altenburg, Bundesland Niederösterreich.\\nDie Region um ein noch nicht lokalisiertes keltisches Siedlungs- und Machtzentrum, das der Historiker Velleius Paterculus als „Carnunto, qui locus regni Norici“ bezeichnete, wurde ab dem 1. Jahrhundert n. Chr. zu einem der zentralen Sammelpunkte für die Expansion der Römer ins freie Germanien. An den Ausläufern der Kleinen Karpaten entwickelte sich bald einer der wichtigsten Siedlungs- und Verteidigungsschwerpunkte in den nördlichen Provinzen des Reiches. Ihren rasanten Aufstieg verdankte die Stadt unter anderem ihrer günstigen Lage am Kreuzungspunkt zweier transkontinentaler Handelsrouten sowie an den beiden Militärlagern, in denen zeitweise bis zu 6500 Mann stationiert waren."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%98%D8%B1%D8%AA%D8%B4%DB%8C%D8%AA%D8%B3%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/%C5%BDer%C4%8Dice_vlajka.jpg","page_title":"ژرتشیتسه","context_page_description":"ژرتشیتسه یک منطقهٔ مسکونی در جمهوری چک است که در شهرستان ملادا بولسلاو واقع شده‌است. ژرتشیتسه ۷٫۷۸ کیلومتر مربع مساحت و ۳۷۴ نفر جمعیت دارد و ۲۴۱ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://en.wikipedia.org/wiki/Arkansas_in_the_American_Civil_War","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Governor_Harris_Flanigin.jpg","page_title":"Arkansas in the American Civil War","context_page_description":"During the American Civil War, Arkansas was a Confederate state, though it had initially voted to remain in the Union. Following the capture of Fort Sumter in April 1861, Abraham Lincoln called for troops from every Union state to put down the rebellion, and Arkansas and several other states seceded. For the rest of the war, Arkansas played a major role in controlling the Mississippi River, a major military highway.\\nIt raised 48 infantry regiments, 20 artillery batteries, and over 20 cavalry regiments for the Confederacy, mostly serving in the Western Theater, though the Third Arkansas served with distinction in the Army of Northern Virginia. Major General Patrick Cleburne was the state's most notable military leader. The state also supplied four infantry regiments, four cavalry regiments and one artillery battery of white troops for the Union and six infantry regiments and one artillery battery of \\"United States Colored Troops.\\"\\nNumerous skirmishes as well as several significant battles were fought in Arkansas, including the Battle of Pea Ridge in March 1862, a decisive one for the Trans-Mississippi Theater which ensured Union control of northern Arkansas."},{"page_url":"https://ceb.wikipedia.org/wiki/Yarrawonga_Airport","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/YarrawongaAirport.JPG","page_title":"Yarrawonga Airport","context_page_description":"Tugpahanan ang Yarrawonga Airport sa Ostralya. Nahimutang ni sa rehiyon sa Moira ug estado sa State of Victoria, sa habagatan-sidlakang bahin sa nasod, 290 km sa kasadpan sa Canberra ang ulohan sa nasod. 129 metros ibabaw sa dagat kahaboga ang nahimutangan sa Yarrawonga Airport.\\nAng yuta palibot sa Yarrawonga Airport kay daghan kaayong patag. Ang kinahabogang dapit sa palibot dunay gihabogon nga 137 ka metro ug 1.1 km sa amihanan sa Yarrawonga Airport. Dunay mga 5 ka tawo kada kilometro kwadrado sa palibot sa Yarrawonga Airport may kaayo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Yarrawonga, 2.9 km sa kasadpan sa Yarrawonga Airport. Sa rehiyon palibot sa Yarrawonga Airport, mga lapyahan talagsaon komon.\\nHapit nalukop sa kaumahan ang palibot sa Yarrawonga Airport. Ang klima umogon ug subtropikal. Ang kasarangang giiniton 17 °C. Ang kinainitan nga bulan Enero, sa 29 °C, ug ang kinabugnawan Hulyo, sa 6 °C. Ang kasarangang pag-ulan 1,060 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 135 milimetro nga ulan, ug ang kinaugahan Nobiyembre, sa 44 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/New_Shute_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/NewShuteHouseDevonEastPavillion.jpg","page_title":"New Shute House","context_page_description":"New Shute House is a late Palladian country house built between 1785 and 1789 by Sir John de la Pole, 6th Baronet and is situated within the grounds of Old Shute House, in the parish of Shute, near Axminster, East Devon. It was given Grade II* listing on 8 May 1967. It was vacated by the Pole family in 1926 and was let between 1933 and 1974 to a girls' school. In 1974 it was sold by the family to a developer who converted it, together with stables and outbuildings, into 8 freehold apartments. It remains in private ownership and the main block has now been converted back into a single residence from the two vertically divided apartments created in 1974."},{"page_url":"https://en.wikipedia.org/wiki/Tamna_Tamna","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Texas%2C_Prinalini_and_Edwin.jpg","page_title":"Tamna Tamna","context_page_description":"\\"Tamna Tamna\\" is a song by Imphal-based alternative rock/indie rock band Solace Her. The song was released on 19 March 2019, as the band's debut single. Tamna Tamna is the most covered Meitei song on YouTube."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%B5_%D0%9B%D0%B0%D0%BB%D0%B0%D0%BD%D0%B4_(%D0%BA%D1%80%D0%B0%D1%82%D0%B5%D1%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/De_Lalande_crater_on_Venus.jpg","page_title":"Де Лаланд (кратер)","context_page_description":"Кратер де Лаланд је ударни метеорски кратер на површини планете Венере. Налази се на координатама 20,5° северно и 5,0° западно и са пречником од 21,3 км један је од мањих кратера на овој планети.\\nКратер је име добио у част француске математичарке и астрономкиње Мари-Жан де Лаланд, а име кратера је 1991. усвојила Међународна астрономска унија.\\nЧини га неколико прстенова и специфичан је по томе што нема централно узвишење. Ширина обода је око 6,5 км."},{"page_url":"https://pl.wikipedia.org/wiki/Mariampol_(Ukraina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/DnisterFromMariyampol.jpg","page_title":"Mariampol (Ukraina)","context_page_description":"Mariampol – wieś na Ukrainie, w obwodzie iwanofrankiwskim, w rejonie halickim, na lewym brzegu rzeki Dniestr.\\nW II Rzeczypospolitej miejscowość była siedzibą gminy wiejskiej Mariampol Miasto w powiecie stanisławowskim, w województwie stanisławowskim.\\nW 2001 roku liczyła 1015 mieszkańców.\\nPocząwszy od czasów radzieckich do 5 lutego 2004 miejscowość nosiła nazwę Marynopil."},{"page_url":"https://pl.wikipedia.org/wiki/Rzeki_na_Bia%C5%82orusi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Belarus-Svislach_River-1.jpg","page_title":"Rzeki na Białorusi","context_page_description":"Rzeki Białorusi mają charakter nizinny i reżim śnieżno-deszczowy. Ich łączna długość wynosi około 51 tys. km. Zamarzają od grudnia do końca marca. Dział wodny stanowi Grzęda Białoruska. Białoruskie rzeki należą do zlewisk:\\nMorza Bałtyckiego – 42%\\nDorzecze Wisły\\nDorzecze Niemna\\nDorzecze Dźwiny\\nMorza Czarnego – 58%\\nDorzecze Dniepru\\nNiektóre z większych rzek Białorusi wymienione w porządku hydrograficznym w kolejności od ujścia do źródeł. Litery P lub L oznaczają dopływ prawy lub lewy."},{"page_url":"https://sv.wikipedia.org/wiki/Maiden_Newton","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Maiden_Newton%2C_parish_church_of_St._Mary_-_geograph.org.uk_-_517651.jpg","page_title":"Maiden Newton","context_page_description":"Maiden Newton är en by och parish i West Dorset i Dorset i England, i den södra delen av landet, 190 km väster om huvudstaden London. Orten har 1 119 invånare. Byn nämndes i Domedagsboken år 1086, och kallades då Newetone.\\nKustklimat råder i trakten. Årsmedeltemperaturen i trakten är 9 °C. Den varmaste månaden är augusti, då medeltemperaturen är 17 °C, och den kallaste är januari, med 1 °C."},{"page_url":"https://arz.wikipedia.org/wiki/NGC_3367_(%D9%85%D8%AC%D8%B1%D9%87)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/NGC_3367_-_Sn1992c_a.jpg","page_title":"NGC 3367 (مجره)","context_page_description":"NGC 3367 هى مجره بتتبع كوكبه الاسد و اللى اكتشفها ويليام هيرشل و الاكتشاف كان بتاريخ 19 مارس 1784."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8F%88%EB%B6%80%EB%A6%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Gyuu-don_011.jpg","page_title":"돈부리","context_page_description":"일본 꺼져\\n돈부리 혹은 돈부리모노는 밥과 그에 곁들여 먹는 오카즈를 돈부리바치라는 그릇에 담아낸 일본 음식이며, 돈부리는 돈부리바치와 돈부리모노를 줄여서 부르는 말이다. 밥 위에는 소고기, 돼지고기 등 육류나 생선, 채소 등 다양한 식재료를 함께 얹어 먹으며, 무엇이 얹어져있는가에 따라 그 재료 이름 뒤에 동이 붙어 요리의 이름이 형성된다.\\n돈부리 요리에는 별도의 소스가 들어가는데, 소스를 만드는 방법과 맛은 얹은 재료나 먹는 계절, 지역에 따라 각양각색이다. 기본적으로는 다싯물에 간장과 미림으로 맛을 낸다."},{"page_url":"https://es.wikipedia.org/wiki/Thomas_Doherty","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Thomas_Doherty_2019_by_Glenn_Francis.jpg","page_title":"Thomas Doherty","context_page_description":"Thomas Doherty es un actor y bailarín escocés, más conocido por sus papeles como Sean Matthews en The Lodge y Harry Hook en Descendants 2 y Descendants 3.​"},{"page_url":"https://fr.wikipedia.org/wiki/Minist%C3%A8re_des_Affaires_%C3%A9trang%C3%A8res_(Espagne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Palacio_de_Santa_Cruz%2C_Madrid.jpg","page_title":"Ministère des Affaires étrangères (Espagne)","context_page_description":"Le ministère des Affaires étrangères, de l'Union européenne et de la Coopération est le département ministériel chargé des relations internationales en Espagne.\\nIl est dirigé, depuis le 13 janvier 2020, par l'indépendante Arancha González.\\nSon siège est situé au Palacio de Santa Cruz, à Madrid."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkmale_in_Bassum","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Bassum_25100700081_Nordwohlde_H%C3%B6genhausen_2.jpg","page_title":"Liste der Baudenkmale in Bassum","context_page_description":"Die Liste der Baudenkmale in Bassum enthält die denkmalgeschützten Baudenkmale auf dem Gebiet der Stadt Bassum im Landkreis Diepholz, Niedersachsen. Diese Baudenkmale sind in der Denkmalliste eingetragen, Grundlage für die Aufnahme ist das Denkmalschutzgesetz Niedersachsen."},{"page_url":"https://br.wikipedia.org/wiki/Landtag","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Landtag_RLP_2009.JPG","page_title":"Landtag","context_page_description":"Landtag a reer eus parlamantoù al Länder en Alamagn.\\nAr voterezh kenfeurel eo an doare ma vez dilennet an dud el Landtage. Ar strolladoù tizhet ganto ouzhpenn 5 % eus ar votoù a c'hall kaout dileuridi, nemet e Land Bremen m'eo trawalc'h tizhout 5 % eus ar mouezhioù en unan eus an div gêr.\\nPeurliesañ e pad pemp bloaz amzeriad ul landtag nemet e Länder Bremen, Hamburg Mecklenburg-Pomerania ar C'hornaoueg ma pad pevar bloaz.\\nLandtag Berlin a zo anvet Abgeordnetenhaus, Landtage Bremen ha Hamburg a zo anvet Bürgerschaft.\\nE kement Land a zo ez eus ul lezenn votiñ disheñvel."},{"page_url":"https://en.wikipedia.org/wiki/Podao","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Chinese-Pudao-01.jpg","page_title":"Podao","context_page_description":"Podao or pudao is a Chinese single-edged infantry weapon which is still used primarily for training in various Chinese martial arts. The blade of the weapon is shaped like a Chinese broadsword, but the weapon has a longer handle, usually around one to two meters which is circular in cross section. It looks somewhat similar to the guandao.\\nThe pudao is sometimes called a \\"horse-cutter sword\\" since it is speculated to have been used to slice the legs out from under a horse during battle. It is somewhat analogous to the Japanese nagamaki, although the nagamaki sword may have been developed independently. The pudao also resembles the Korean hyeopdo."},{"page_url":"https://en.wikipedia.org/wiki/Tamazula_de_Gordiano","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Tamazula_de_Gordiano.png","page_title":"Tamazula de Gordiano","context_page_description":"Tamazula de Gordiano is a city in the Mexican state of Jalisco. The word \\"tamazula\\" comes from the Nahuatl word tamazullan, which means \\"place or lagoon of toads.\\""},{"page_url":"https://hu.wikipedia.org/wiki/Murakereszt%C3%BAr","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Hat%C3%A1rh%C3%ADd_a_Mura_foly%C3%B3n_-_panoramio.jpg","page_title":"Murakeresztúr","context_page_description":"Murakeresztúr község Zala megyében, a Nagykanizsai járásban. A településen polgárőrség működik."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%83%D8%A7%D8%B1%D8%B3%D9%88%D9%86_%D8%B3%D9%8A%D8%AA%D9%8A_(%D9%86%D9%8A%D9%81%D8%A7%D8%AF%D8%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Nevada_State_Museum.jpg","page_title":"كارسون سيتي (نيفادا)","context_page_description":"كارسن سيتي هي عاصمة ولاية نيفادا الأمريكية. في عام 2005 قدر عدد سكانها بحوالي 57104 نسمة. كارسن سيتي هي الآن مدينة مستقلة، ليست جزء من أيّ مقاطعة. مثل العديد من المدن في نيفادا، كارسن سيتي تأسّست في أيام ازدهار التعدين. كمركز لتعدين الفضة، كانت كارسن سيتي حاضرة إقليم مقاطعة أورمسبي سابقاً، وقد سمّيت بهذا الاسم تيمناً بالمستكشف كيت كارسون.\\nتبلغ مساحة المدينة 403.2 كم². أكبر المدن القريبة لكارسن سيتي هي رينو، التي تبعد عنها بحوالي 30 ميل شمالاً."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8B%98%ED%8E%9C%EB%B6%80%EB%A5%B4%ED%81%AC%EA%B6%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Ludwig_I.%2C_K%C3%B6nig_von_Bayern_Arround_1860.jpg","page_title":"님펜부르크궁","context_page_description":"님펜부르크 궁전[Schloss Nymphenburg]은 독일의 바이에른주의 주도 뮌헨에 위치하고 있는, 옛 바이에른 왕국의 통치자였던 비텔스바흐 가문의 여름 별궁이다. 이름은 님프, 즉 그리스 신화에 나오는 \\"요정\\"에서 유래하였는데, 궁전 내부의 \\"요정들을 거느린 여신의 그림\\"에서 모티브를 얻었다.\\n바이에른의 선제후 페르디난트 마리아가 그의 아들 막시밀리안 2세 에마누엘의 탄생을 기념하여 짓도록 한 건물로 처음에 지어질 때는 궁전이 아닌 이탈리아 식의 저택이었다. 18세기 초에 막시밀리안 2세 에마누엘은 지금 궁전의 중앙에 해당되는 5층 저택 주변에 네 개의 파빌리온을 더 짓고, 여러 개의 아케이드로 이들을 중앙의 저택과 연결시켰다. 이 후 점차 궁전으로 개조되었다. 본궁인 레지덴츠 궁전과 함께 비텔스바흐 왕가의 대표적인 궁전이다."},{"page_url":"https://en.wikipedia.org/wiki/Shitadan_Station","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Shitadan_Station.jpg","page_title":"Shitadan Station","context_page_description":"Shitadan Station is a railway station in the town of Tateyama, Toyama, Japan, operated by the private railway operator Toyama Chihō Railway."},{"page_url":"https://es.wikipedia.org/wiki/Ius_imaginum","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Louvre%2C_canopo_da_chiusi_0.JPG","page_title":"Ius imaginum","context_page_description":"Ius imaginum era el derecho reconocido a los nobiles romanos de mantener en el atrium de su casa las maiorum imagines, \\"imágenes\\" o retratos de sus ancestros, que también eran objeto de exhibición durante los funerales, ​ en los que representaban un papel importante para la demostración de la continuidad de las virtudes dentro de la familia romana. Durante el funeral, los antepasados eran representados por actores que se vestían de forma correspondiente a su rango y cubrían su rostro con la imago. Si la máscara cubría más que el rostro era denominada personae, término que terminó designando al rol de los actores.​ Eran inicialmente máscaras de cera coloreada, que mantenían los rasgos reales del rostro del difunto, ​ y posteriormente se realizaron como esculturas en materiales duros: bronce y mármol. Se conservaban en lugares cerrados, que sólo se abrían en circunstancias particulares. Para su disposición se trazaban líneas pintadas al modo de un árbol genealógico; y las imágenes se dotaban de carteles con su nombre."},{"page_url":"https://fr.wikipedia.org/wiki/Ernest_Coquebert_de_Montbret","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Montbretie-Blossom-Stack-16-20190821-RM-105231.jpg","page_title":"Ernest Coquebert de Montbret","context_page_description":"Antoine François Ernest Coquebert de Montbret, né à Hambourg le 31 janvier 1780 et mort au Caire le 7 avril 1801, est un botaniste français."},{"page_url":"https://an.wikipedia.org/wiki/Variella","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Gray176.png","page_title":"Variella","context_page_description":"A variella u maxilar inferior ye un d'os uesos d'a cara, plan, impar, central, simetrico y en forma de ferradura. Ye situato en a parti inferior y anterior d'a cara. A estomatolochía ye a especialidat que s'encarga d'estudear a suya anatomía, estructura y procesos patolochicos.\\nPresenta un cuerpo horizontal y dos brancas ascendents verticals, situatas a os dos cantos d'o cuerpo. Ye o ueso más denso y prominent d'a cara."},{"page_url":"https://af.wikipedia.org/wiki/George_Reinholt","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/74/George_Reinholt_1971.jpg","page_title":"George Reinholt","context_page_description":"George Reinholt was 'n Amerikaanse akteur. Hy was bekend vir sy rolle in die rolprent Looking Up en in die televisiereekse The Secret Storm, Another World, en One Life to Live."},{"page_url":"https://en.wikipedia.org/wiki/Gould,_Arkansas","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/GouldARKWater.jpg","page_title":"Gould, Arkansas","context_page_description":"Gould is a city in Lincoln County, Arkansas, United States. Its population was 837 at the 2010 census, down from 1,305 at the 2000 census. It is included in the Pine Bluff, Arkansas Metropolitan Statistical Area. Gould is a farming community. It was named after the American railroad magnate Jay Gould."},{"page_url":"https://sk.wikipedia.org/wiki/Patra","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Apollon_theatre.JPG","page_title":"Patra","context_page_description":"Patra, gr. Πάτρα, starogrécky Πάτραι, je mesto v Grécku, je hlavným mestom Peloponézu a kraju Achaia. Žije tu približne 213 984 obyvateľov. Periféria Patrasu zahŕňa aj menšie mestá Rio, Paralia, Vrachneika, Arachovitika a Messatida. Z hľadiska dopravy a priemyslu je Patra dôležitým prístavným mestom."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%84%E0%B8%A7%E0%B8%B4%E0%B8%99_%E0%B8%84%E0%B8%B5%E0%B9%81%E0%B8%81%E0%B8%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Kevin_Keegan.jpg","page_title":"เควิน คีแกน","context_page_description":"โจเซฟ เควิน คีแกน หรือที่คนส่วนใหญ่รู้จักในชื่อ เควิน คีแกน เป็นอดีตนักฟุตบอลและผู้จัดการทีมฟุตบอลชาวอังกฤษ\\nเขาเริ่มค้าแข้งกับสคันธอร์ปยูไนเต็ดใน ค.ศ. 1968 ก่อนที่จะย้ายไปร่วมทีมลิเวอร์พูลใน ค.ศ. 1971 โดยสวมเสื้อเบอร์ 7 ในขณะที่ค้าแข้งอยู่กับลิเวอร์พูลนั้น คีแกนสามารถคว้าแชมป์รายการสำคัญต่างๆมากมาย ได้แก่ ดิวิชันหนึ่ง 3 สมัย, ยูฟ่าคัพ 2 สมัย, เอฟเอคัพ 2 สมัย และยูโรเปียนคัพอีก 1 สมัย เขาติดทีมชาติอังกฤษเป็นครั้งแรกใน ค.ศ. 1972 ต่อมาใน ค.ศ. 1977 เขาตัดสินใจย้ายไปร่วมทีมฮัมบวร์ค ในการค้าแข้งกับฮัมบวร์คเขาได้รับรางวัลนักฟุตบอลยอดเยี่ยมแห่งปีของทวีปยุโรป 2 สมัยติดต่อกัน คือ 1978 และ 1979 ในฤดูกาลเดียวกันเขาได้เป็นกำลังสำคัญในการพาทีมคว้าแชมป์บุนเดิสลีกา ฤดูกาล 1978-79 และสามารถคว้าแชมป์ยูโรเปียนคัพในปีถัดมาอีกด้วย หลังจากนั้นเขาก็ได้ย้ายไปร่วมทีมเซาแธมป์ตันเป็นเวลา 2 ฤดูกาล ก่อนที่จะย้ายไปค้าแข้งกับนิวคาสเซิลใน ค.ศ. 1984 และสามารถพาทีมเลื่อนชั้นได้สำเร็จ ก่อนที่จะประกาศเลิกเล่นฟุตบอลในอีก 2 ปีถัดมา ในขณะที่ติดทีมชาติอังกฤษทั้งหมด 63 นัด และยิงได้ 21 ประตู\\nใน ค.ศ."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%AC%CF%87%CE%B7_%CF%83%CF%84%CE%BF_%CE%A5%CE%AD%CE%BB%CE%B9%CE%BF%CE%BD_%CE%BA%CE%B1%CE%B9_%CE%9B%CE%B5%CE%B9%CE%BC%CF%8C%CF%87%CE%B5%CE%B9%CF%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Byzantyne_attack_Preslav.jpg","page_title":"Μάχη στο Υέλιον και Λειμόχειρ","context_page_description":"H Μάχη στο Υέλιον και Λειμόχειρ είχε ως αποτέλεσμα τη σχεδόν πλήρη καταστροφή ενός μεγάλου στρατού των Σελτζούκων από τους Βυζαντινούς. Ο Σελτζουκικός στρατός επέδραμε σε εδάφη της Βυζαντινής Αυτοκρατορίας στην κοιλάδα του Μαιάνδρου, στη Μ. Ασία, και είχε λεηλατήσει έναν αριθμό πόλεων. Το Βυζαντινό στράτευμα με τρεις στρατηγούς έστησε ενέδρα στους Σελτζούκους σε μία διάβαση του ποταμού και τους αποδεκάτησε."},{"page_url":"https://fr.wikipedia.org/wiki/H%C3%B4tel_Ponsardin","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Rampe_d%27appui_PM51000835_013.JPG","page_title":"Hôtel Ponsardin","context_page_description":"L'Hôtel Ponsardin, hôtel particulier de Nicolas Ponsardin construit en 1780, actuellement le siège de la Chambre de commerce et d'industrie de Reims et d'Epernay."},{"page_url":"https://fr.wikipedia.org/wiki/Histoire_des_Juifs_en_Iran","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Jewish-Bazar_in_Saqqez-Iran.jpg","page_title":"Histoire des Juifs en Iran","context_page_description":"La communauté juive en Iran est parmi les plus anciennes du monde ; ses membres descendent des Juifs qui sont restés dans la région après l'exil en Babylone, quand les souverains achéménides du Premier Empire perse ont permis aux Juifs de retourner à Jérusalem.\\nAvant 1948, les Juifs Iraniens étaient partiellement des descendants de Juifs ethniques originaires de la terre d'Israël, et pour une autre partie, ils étaient les descendants de Perses convertis, ou d'autres membres de groupes ethniques présents en Iran. En 1948, la majorité des Juifs iraniens parlaient le persan en langue maternelle."},{"page_url":"https://en.wikipedia.org/wiki/Jersey_cattle","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Jersey_cow_sculpture_by_John_McKenna%2C_St_Helier.JPG","page_title":"Jersey cattle","context_page_description":"The Jersey is a British breed of small dairy cattle from Jersey, in the British Channel Islands. It is one of three Channel Island cattle breeds, the others being the Alderney – now extinct – and the Guernsey. It is highly productive – cows may give over 10 times their own weight in milk per lactation; the milk is high in butterfat and has a characteristic yellowish tinge.\\nThe Jersey adapts well to various climates and environments, and unlike many breeds originating in temperate climates, these cows can tolerate heat very well. It has been exported to many countries of the world; in some of them, including Denmark, France, New Zealand, and the United States, it has developed into an independent breed. In Nepal, it is used as a draught animal."},{"page_url":"https://vi.wikipedia.org/wiki/Erythrodiplax_umbrata","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Female_Erythrodiplax_umbrata_%282%29.JPG","page_title":"Erythrodiplax umbrata","context_page_description":"Erythrodiplax umbrata là loài chuồn chuồn trong họ Libellulidae. Loài này được Linnaeus mô tả khoa học đầu tiên năm 1758."},{"page_url":"https://en.wikipedia.org/wiki/Galayet_bandora","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/%D9%82%D9%84%D8%A7%D9%8A%D8%A9_%D8%A8%D9%86%D8%AF%D9%88%D8%B1%D8%A9.jpg","page_title":"Galayet bandora","context_page_description":"Galayet bandora is a simple Jordanian and Palestinian dish of tomatoes, onions, hot peppers, olive oil, and salt. It is popular across the Levant, but especially in Jordan on account of its easy preparation and healthy ingredients. To make the dish, the olive oil is heated in a large frying pan. The onions and peppers are diced and the tomatoes are cubed and optionally peeled. The onions are then added and cooked until translucent, at which point the rest of the ingredients are added and the mixture is sautéed until it is thick but not dry. Galayet bandora is usually eaten with warm pita bread, which is used to scoop it up, though galayet bandora can also be served over rice and eaten with utensils. When served in a restaurant or at a formal event, it is often garnished with toasted pine nuts.\\nMany varieties of the dish exist, including ones with meat, fried eggs or garlic.\\nIt is believed to originate in the Ghor al-Safi and Ghor al Mazraa, the rural regions surrounding the Dead Sea that make up the \\"breadbasket\\" of Jordan. The hot climate in these regions of the Jordan Valley is ideal for growing tomatoes."},{"page_url":"https://de.wikipedia.org/wiki/Drehgestell","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Bogie_Y25_m%C3%A9canosoud%C3%A9.jpg","page_title":"Drehgestell","context_page_description":"Ein Drehgestell ist ein Laufwerk eines Schienenfahrzeuges, bei dem Radsätze in einem gegenüber dem Wagenkasten drehbaren Rahmen gelagert werden. Fahrzeuge mit Drehgestellen können im Vergleich zu solchen mit starr am Wagenkasten angebrachten Achsen engere Bögen durchfahren, weil sich der Rahmen gegenüber dem Wagenkasten ausdrehen kann und dadurch die Räder in einem kleineren Winkel an der Schiene anlaufen. Außerdem verbessern Drehgestelle die Laufruhe, da sie Stöße in Hoch- und Querrichtung nur halbiert auf den Wagenkasten weitergeben.\\nDrehgestelle werden in verschiedenen Bauformen und Ausführungen gebaut. Neben der Achsanzahl kann auch nach dem Einsatz zwischen Drehgestellen für Lokomotiven, Güter- und Reisezugwagen unterschieden werden, die bezüglich Tragkraft, Geschwindigkeit und Komfort unterschiedliche Anforderungen an die Konstruktion stellen."},{"page_url":"https://fr.wikipedia.org/wiki/Drapeau_de_l%27Afrique_du_Sud","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Pm_cricket_shots09_6058.jpg","page_title":"Drapeau de l'Afrique du Sud","context_page_description":"Le drapeau de l'Afrique du Sud est l'emblème national de la République d'Afrique du Sud. Le drapeau actuel est en vigueur depuis le 27 avril 1994, date des premières élections nationales non raciales que connaît alors ce pays en 342 années d'histoire et en 84 ans de démocratie parlementaire. Image d'un État-nation reconstitué, il marque la fin de la symbolique blanche en Afrique du Sud et l'avènement d'une Afrique du Sud mélangée."},{"page_url":"https://da.wikipedia.org/wiki/Peninsula-kampagnen","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/McClellan%2BJohnston.jpg","page_title":"Peninsula-kampagnen","context_page_description":"Peninsula-kampagnen i den amerikanske borgerkrig var en stor operation som blev igangsat i det sydøstlige Virginia og løb fra marts til juli 1862. Det var den første offensiv i stor skala i det østlige operationsområde. Operationen, som blev ledet af generalmajor George B. McClellan, var en amfibieoperation som var planlagt til at skulle erobre hovedstaden i konføderationen – Richmond – ved at omgå konføderationens hær i det nordlige Virginia. McClellan havde succes i starten mod den lige så forsigtige sydstatsgeneral Joseph E. Johnston, men da han blev såret og udskiftet med Robert E. Lee ændrede kampagnen karakter, og blev til et ydmygende nederlag for Unionen.\\nMcClellan landsatte sin hær ved Fort Monroe og rykkede mod nordvest op gennemVirginiahalvøen. Den konfødererede brigadegeneral John B. Magruder havde bygget tre forsvarslinier over den smalle halvø. Den første større linje, Warwick Line gik fra Yorktown til Mulberry Island, og var en overraskelse for McClellan. Hans håb om en hurtig fremrykning var gået i vasken. McClellan beordrede sin hær til at forberede en Belejring af Yorktown."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B5%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Barrage_de_la_Rance.jpg","page_title":"海","context_page_description":"海是由大量鹹水組成的水體，其受陸地全部或局部地圍繞。廣義上的海則是指由地球海洋鹹水水域組成的互聯系統，一般把它看待為一整個世界洋，或是由幾個分開的大洋組合而成。大海對地球的氣候起到緩衝作用，且在水循環、 碳循環，以及氮循環中扮演著重要的角色。雖然人類從史前時代就開始在大海中旅行並探索未知的海域，不過現代海洋學研究從19世紀70年代英國的挑戰者號遠征才開始。一般而言，它最多分為五個大洋，當中包含國際海道測量組織的四個指定大洋，以及南冰洋；較小的次要海區，比如地中海，則一般以「海」命名。與大洋相比，海並沒有獨立的潮汐以及海流。\\n由於大陸漂移，北半球現在的陸地和海洋之間的比例較為平均，但南半球絕大多數的地方都受海洋所覆蓋。開放水域的鹽度則一般在3.5％左右，儘管此一數值可在較為接近內陸的水域、大河口附近，以及深海中發生更大的變化。開放水域的溶解物質中，以氯化鈉為最多，約佔全部溶解物質的85％。由於海洋中各區域鹽分及溫度有差異，因而產生溫鹽環流。海流的形成歸因於受風和潮汐蘊藏的能量所推動的海浪，局部海平面的變化則是因月球和太陽的引力所致：這些的方向都會受到地球表面和海底的大陸塊，以及地球的自轉所影響。\\n陸地向海平面下延伸形成大陸架，為海洋接近陸地的淺海區域，大陸架海域富含養分，為多樣海洋生物之棲息地，並供給人類大量食物—主要為魚類，並有甲殼類水生動物、海洋哺乳動物及海藻—透過野生捕撈及水產養殖獲取。大型熱帶珊瑚礁的生物多樣性相當高，深海海域捕鯨業曾相當發達，隨著鯨的數量大幅減少促使國際上簽署條約限制捕撈，國際捕鯨委員會於1986年起禁止大多數商業捕撈。海洋中的生物並非僅生長在陽光照射的到的水域，即使在海底深處，壓力很大的超深淵帶也有生物，其營養來源來自深海熱泉，形成獨特的生態系統，這類生物稱為嗜極生物。在無生源論中，生命起源可能是來是海洋，海洋微生物墊符合地球大氣的大氧化事件，而動物及植物的起源也都來自海上。\\n海洋對人類貿易、旅遊、礦物開採、能源生產等方面均相當重要，亦為戰爭的場域。位於海岸的城市可能受地震或火山活動造成的海嘯影響，熱帶海域為熱帶氣旋、颱風及氣旋的活躍區域。海洋對於人類文化產生重要影響，從早期神話裡的水神到荷馬史詩，再到哥倫布大交換引發的巨大轉變，從海葬到松尾芭蕉的俳句再到超現實主義的海洋藝術；以及《蘇格蘭的牢騷》中船夫號子激勵人心的音樂到尼古拉·安德烈耶維奇·里姆斯基-科薩科夫的《舍赫拉查達》再到張惠妹的《聽海》。海上的休閒活動包括游泳、潛水、衝浪及帆船運動等。但隨著人口增加、工業化及集約農業造成現今的海洋污染，海洋因吸收大氣中增加的二氧化碳，導致PH值下降，即海洋酸化；海洋資源共享造成過度捕魚的問題仍在增加。"},{"page_url":"https://de.wikipedia.org/wiki/Weisshornweg","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/RoyLindmanMattertalValley.JPG","page_title":"Weisshornweg","context_page_description":"Der Weisshornweg ist ein Höhenweg in der Weisshorngruppe des Kantons Wallis in der Schweiz und führt von Jungen über das Jungtal und die Wasulicke zur Topalihütte und dann über den Guggiberg nach Randa. Er ist 22,54 km lang und eröffnet wunderbare Aussichtspunkte auf die Mischabel. Der höchste Punkt ist die Wasulicke mit 3114 m ü. M., die das Jungtal mit dem Wasmutälli verbindet. Der Höhenweg wurde am 24. August 2003 eröffnet. Er ist allerdings seit 2019 geschlossen, da er steinschlaggefährdet ist und die Sommerbrücken, die über die Tobel zwischen Topalihütte und Randa führen sollen, nicht mehr eingerichtet werden."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%98%9F%E7%9B%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Spherical_astrolabe.jpg","page_title":"星盘","context_page_description":"星盤 是古代天文學家、占星師和航海家用來進行天文測量的一項重要的天文儀器，用途非常廣泛，包括定位和預測太陽、月亮、金星、火星相關天體在宇宙中的位置，確定本地時間和經緯度，三角測距等。"},{"page_url":"https://la.wikipedia.org/wiki/S%C3%A9bazac-Concour%C3%A8s","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f6/Map_commune_FR_insee_code_12264.png","page_title":"Sébazac-Concourès","context_page_description":"Sébazac-Concourès est commune Francicum 3'060 incolarum praefecturae Avarionis in provincia australi Meridiano et Pyrenaeo."},{"page_url":"https://vi.wikipedia.org/wiki/Dammfleth","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/Dammfleth_in_IZ.png","page_title":"Dammfleth","context_page_description":"Dammfleth là một đô thị ở huyện Steinburg, bang Schleswig-Holstein, Đức. Đô thị này có diện tích 16,11 km², dân số thời điểm 31 tháng 12 năm 2006 là 330 người."},{"page_url":"https://de.wikipedia.org/wiki/Derby_de_Lisboa","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/D%C3%A9rbi_de_Lisboa.jpg","page_title":"Derby de Lisboa","context_page_description":"Derby de Lisboa ist die Bezeichnung für das Stadtderby in der portugiesischen Hauptstadt zwischen dem SL Benfica und dem Sporting CP. Mit einer Unterstützungsquote von rund 45 % der einheimischen Fußballfans ist Benfica der populärste Verein Portugals. Er gilt seit jeher als Liebling der Massen, während Sporting in dem Ruf steht, seine Anhänger vor allem aus den höheren Kreisen zu rekrutieren."},{"page_url":"https://hu.wikipedia.org/wiki/Rastu%C5%A1je","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Rastu%C5%A1je_%28ulaz_u_selo%29.jpg","page_title":"Rastušje","context_page_description":"Rastušje falu Horvátországban, Bród-Szávamente megyében. Közigazgatásilag Podcrkavljéhoz tartozik."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%8A%80%E5%BA%A7_(%E5%88%88%E8%B0%B7%E5%B8%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Kariya_Syosyu-ji_ac_%281%29.jpg","page_title":"銀座 (刈谷市)","context_page_description":"銀座は、愛知県刈谷市の町名。現行行政地名は銀座1丁目から銀座6丁目。"},{"page_url":"https://de.wikipedia.org/wiki/Parkway","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Natchez-Trace-Parkway-Highsmith.jpeg","page_title":"Parkway","context_page_description":"In den Vereinigten Staaten steht der Begriff Parkway für:\\nEinen Straßentyp\\nEine breit angelegte Straße, auf der LKW und andere schwere Fahrzeuge verboten sind.\\nEine Straße durch einen Park: Eine Straße die Parks verbindet.\\nEine autobahnähnliche Straße, die über das Gelände eines öffentlichen Parks verläuft und auf der deshalb schwere Fahrzeuge verboten sind.\\nEinen Landstreifen zwischen einer Durchgangsstraße und deren Bürgersteig oder auf dem Mittelstreifen einer Durchgangsstraße.\\nSeit dem späten 20. Jahrhundert haben viele Orte Busse, Taxis und Mietwagen in die Liste der zugelassenen Fahrzeuge aufgenommen, um den öffentlichen Nahverkehr zu fördern. Durch diese Änderung wurde der Unterschied zwischen Parkway und Freeways aufgeweicht."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/La_Haye-Aubr%C3%A9e","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1c/LaHayeAubr%C3%A9eEglise.JPG","page_title":"La Haye-Aubrée","context_page_description":"La Haye-Aubrée sī ūi-tī Hoat-kok Haute-Normandie tōa-khu Eure séng ê chi̍t-ê commune."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%92%D0%BE%D1%80%D0%BE%D0%BD%D1%86%D0%BE%D0%B2%D0%BA%D0%B0_(%D0%97%D0%BD%D0%B0%D0%BC%D0%B5%D0%BD%D0%BA%D0%B0%D0%BD_%D0%BA%D3%80%D0%BE%D1%88%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/%D0%92%D0%BE%D1%80%D0%BE%D0%BD%D1%86%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B0%D1%80%D0%BA_-_4.jpg","page_title":"Воронцовка (Знаменкан кӀошт)","context_page_description":"Воронцовка — Российн Федерацин Тамбовн областан Знаменкан кӀоштан юкъа йогӀу эвла."},{"page_url":"https://en.wikipedia.org/wiki/Isocytosine","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Isoguanine-Isocytosine-Base_pair_V2.svg","page_title":"Isocytosine","context_page_description":"Isocytosine or 2-aminouracil is a pyrimidine base that is an isomer of cytosine. It is used in combination with isoguanine in studies of unnatural nucleic acid analogues of the normal base pairs in DNA. In particular, it is used as a nucleobase of hachimoji RNA.\\nIt can be synthesized from guanidine and malic acid.\\nIt is also used in physical chemical studies involving metal complex binding, hydrogen bonding, and tautomerism and proton transfer effects in nucleobases."},{"page_url":"https://fr.wikipedia.org/wiki/Robert_Seaman_Granger","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/RSGranger.jpg","page_title":"Robert Seaman Granger","context_page_description":"Robert Seaman Granger est un officier de carrière de l'armée des États-Unis, terminant major-général breveté dans l'armée de l'Union pendant la guerre de Sécession."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%92%E3%82%A8%E3%83%A9%E3%83%9D%E3%83%AA%E3%82%B9-%E3%83%91%E3%83%A0%E3%83%83%E3%82%AB%E3%83%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Amphitheater-_%283%29.jpg","page_title":"ヒエラポリス-パムッカレ","context_page_description":"ヒエラポリス-パムッカレはトルコ西部・デニズリ県にあるユネスコの世界遺産の登録名。パムッカレは石灰華段丘からなる丘陵地の名前であり、2世紀頃、ヒエラポリスというローマ帝国の都市が存在した。現在は遺跡が残る。"},{"page_url":"https://da.wikipedia.org/wiki/Drag%C3%B8r_Kirke","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Drag%C3%B8r.4.jpg","page_title":"Dragør Kirke","context_page_description":"Dragør Kirke indviet den 26. april 1885. ligger på Kirkevej 170 i Dragør. Kirken der er tegnet af arkitekt J.H. Wessel er opført i en tidstypisk, nygotisk stil med et klart forbillede i Taarbæk Kirke."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%BE%B3%E7%B4%90%E8%BB%8D%E5%9C%98%E6%88%B0%E7%88%AD%E7%B4%80%E5%BF%B5%E5%A0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/ANZAC_War_Memorial_Bronze_Relief_2.jpg","page_title":"澳紐軍團戰爭紀念堂","context_page_description":"澳紐軍團戰爭紀念堂位於澳洲雪梨市中心海德公園南端，1934年建成，紀念在第一次世界大戰中陣亡的澳洲軍人。其外部人物浮雕和雕塑由雷納·霍夫創作。\\n澳紐軍團戰爭紀念堂是澳新軍團日、停戰紀念日等重要場合紀念儀式的焦點。\\n1916年4月25日，澳新軍團為加里波利之戰在安扎克灣登陸一周年，開始為興建紀念堂集資。1934年11月24日，亨利王子 殿下為其揭幕。"},{"page_url":"https://cv.wikipedia.org/wiki/%D0%A4%D1%80%D0%B0%D0%BD%D0%BA%D1%84%D1%83%D1%80%D1%82_%D0%BF%D0%B0%D1%80%D0%BB%D0%B0%D0%BC%D0%B5%D0%BD%D1%87%C4%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Zeitgen%C3%B6ssige_Lithografie_der_Nationalversammlung_in_der_Paulskirche.jpg","page_title":"Франкфурт парламенчĕ","context_page_description":"Франкфурт наци пухăвĕ — пĕрремĕш пĕрлехи герман парламенчĕ, франкфуртри Таса Павăл чиркĕвĕнче 1848 çулхи 18-мĕшĕнчен пуçласа 1849 çулхи çăвăн 31-мĕшĕччен ĕçленĕ. Вăл Герман пĕрлешĕвĕн патшалăхĕсенчи Март революцийĕ хыççăн пуçтарăнать."},{"page_url":"https://en.wikipedia.org/wiki/Landing_Craft_Support","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/aa/Commercial_Iron_Works_progress_photo_-_LCSL-26.jpg","page_title":"Landing Craft Support","context_page_description":"The Landing Craft, Support were two distinct classes of amphibious warfare vessels were used by the United States Navy in Pacific and the Royal Navy in World War II. The USN versions which were later reclassified Landing Ship Support, Large also performed radar picket duty and fire fighting."},{"page_url":"https://fr.wikipedia.org/wiki/Locm%C3%A9lar","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Locm%C3%A9lar_%2829%29_Mairie.JPG","page_title":"Locmélar","context_page_description":"Locmélar [lɔkmelaʁ] est une commune du département du Finistère, dans la région Bretagne, en France."},{"page_url":"https://ro.wikipedia.org/wiki/Wahroonga,_New_South_Wales","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/%281%29Marian_Clarke_Building_Abbotsleigh_School.jpg","page_title":"Wahroonga, New South Wales","context_page_description":"Wahroonga este o suburbie în Sydney, Australia."},{"page_url":"https://pl.wikipedia.org/wiki/%C5%BDlabor","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Zlabor-dreta.JPG","page_title":"Žlabor","context_page_description":"Žlabor – wieś w Słowenii, w gminie Nazarje. W 2018 roku liczyła 121 mieszkańców."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E5%8F%B0%E9%90%B5EMU600%E5%9E%8B%E9%9B%BB%E8%81%AF%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/EMU600%E5%9E%8B%E8%B3%87%E8%A8%8A%E9%A1%AF%E7%A4%BA%E5%99%A8_%E4%B8%89%E4%BB%A3%E7%89%88%E6%9C%AC.jpg","page_title":"台鐵EMU600型電聯車","context_page_description":"台铁EMU600型电力动车组是一款属于台湾铁路管理局的交流电用通勤型电力动车组，目前本型车于纵贯线、屏东线、宜兰线、六家线及沙仑线均可见其运用。"},{"page_url":"https://et.wikipedia.org/wiki/Zermezeele","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Zermezeele_-_Mairie.JPG","page_title":"Zermezeele","context_page_description":"Zermezeele on vald Põhja-Prantsusmaal Nordi departemangus Wormhouti kantonis.\\nPõhjapiiril voolab Peene Becque jõgi."},{"page_url":"https://nn.wikipedia.org/wiki/Nordstillehavsstraumen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/KuroshioOyashio.jpg","page_title":"Nordstillehavsstraumen","context_page_description":"Nordstillehavsstraumen er ein langsam, varm havstraum som renn austover mellom 40 ºN og 50 ºN i Stillehavet. Straumen utgjer den sørlege delen av den subarktiske virvelen i Nord-Stillehavet. Straumen oppstår når Kuroshiostraumen som går nordover utanfor kysten av Japan, og Oyashiostraumen, som er ein kald straum som renn sørover. Nordstillehavsstraumen utgjer òg den nordlege delen av den subtropiske havvirvelen i Nord-Stillehavet. I det austlege Nord-Stillehavet deler han seg i den sørlege Californiastraumen og den nordlege Alaskastraumen."},{"page_url":"https://fr.wikipedia.org/wiki/Telgruc-sur-Mer","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/129_Telgruc.jpg","page_title":"Telgruc-sur-Mer","context_page_description":"Telgruc-sur-Mer [tɛlgʁyk syʁ mɛʁ] est une commune du département du Finistère, dans la région Bretagne, en France."},{"page_url":"https://en.wikipedia.org/wiki/Reisekort","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Flexus_validator.jpg","page_title":"Reisekort","context_page_description":"Elektronisk reisekort is an electronic ticket system that was introduced on all public transport in Greater Oslo, in 2009 using Thales technology. The system may eventually replace all paper tickets on trips with Ruter and commuter trains around Oslo operated by the Norwegian State Railways. By the end of 2010, there were 340,000 active cards used by Ruter's customer, an increase from 82,000 in January same year. In 2011, the two companies using the Flexus cards decided to stop using the Flexus name and design, instead using different cards, but still with common technology and equal opportunity to buy the same tickets as before these changes in name and design. The cards are from that year named either NSB-kort for cards produced by NSB or Ruter Reisekortet for cards produced by Ruter.\\nThe goal of the system is to ease and quicken the process of purchasing ticket, create better information about actual travel and reduce non-paying passengers. The system utilises RFID technology on smart cards and allows an electronic payment to be made via contactless communication between the card and a verifier. There is also devoped a system of one-time tickets called Impuls."},{"page_url":"https://eu.wikipedia.org/wiki/Elvira_chionura","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/MonographTrochi5Goul_0076.jpg","page_title":"Elvira chionura","context_page_description":"Elvira chionura Elvira generoko animalia da. Hegaztien barruko Trochilidae familian sailkatua dago."},{"page_url":"https://en.wikipedia.org/wiki/List_of_reptiles_of_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Eumeces_laticeps_%28male%29.jpg","page_title":"List of reptiles of Texas","context_page_description":"This is a list of Texas reptiles, including all snakes, lizards, crocodilians, and turtles native to the state of Texas.\\nThe state of Texas has a large variety of habitats, from swamps, coastal marshes and pine forests in the east, rocky hills and limestone karst in the center, desert in the south and west, mountains in the far west, and grassland prairie in the north. This vast contrast in biomes makes Texas home to an extremely wide variety of herpetofauna. Its central position in the United States means that species found primarily in either the western or eastern reaches of the country often have their ranges meeting in the state. Its proximity to Mexico is such that many species found there and into Central America range as far north as Texas. The abundance of reptiles makes the state a prime area for research, and most species found in Texas have been well studied.\\nTexas state law protects several reptile species; threatened species denoted as and endangered species denoted as. The moderate climate of Texas has also led to some species being introduced to the state and establishing a permanent population, denoted as (I)."},{"page_url":"https://it.wikipedia.org/wiki/Dipartimenti_dell%27Uruguay","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Coat_of_arms_of_Paysand%C3%BA_Department.png","page_title":"Dipartimenti dell'Uruguay","context_page_description":"I dipartimenti dell'Uruguay costituiscono la suddivisione territoriale di primo livello del Paese e sono pari a 19; ciascuno di essi comprende a sua volta più comuni."},{"page_url":"https://en.wikipedia.org/wiki/Main_Library_of_Cardinal_Stefan_Wyszynski_University_in_Warsaw","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Biblioteka_G%C5%82%C3%B3wna_Uniwersytetu_Kardyna%C5%82a_Stefana_Wyszy%C5%84skiego_w_Warszawie_05.jpg","page_title":"Main Library of Cardinal Stefan Wyszynski University in Warsaw","context_page_description":"The Main Library of Cardinal Stefan Wyszyński University in Warsaw is the central research library of the Cardinal Stefan Wyszyński University in Warsaw.\\nIt is located in Bielanski Forest Nature Reserve, next to the historic Camaldolese Church and hermitage buildings, which date back to the 17th and 18th century.\\nThe library was founded in 1954 with a 30,000-volume donation by the Theological Faculty of Warsaw and Jagiellionian Universities. Today, it is associated with the four other faculty libraries the University Library System, operating on two university campuses—Dewajtis and Wóycickiego, headed by the director of the University Library.\\nThe University Library holds nearly 500,000 printed items, with literary collections concerning theology, philosophy, history, psychology, and social sciences. It is also well known for having the largest ecclesiastical sciences book collection in Poland.\\nThe UKSW library is a member and the co-founder of the Federation of Church Libraries, also known as \\"Fides\\"."},{"page_url":"https://de.wikipedia.org/wiki/Altewiekring_70","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Altewiekring_70_vor1970.jpg","page_title":"Altewiekring 70","context_page_description":"Das Gebäude Altewiekring 70 an der Ecke Altewiekring und Helmstedter Straße in Braunschweig ist ein 1892 errichtetes Wohn- und Geschäftshaus, in dem ab 1917 der Politiker und spätere Präsident der „Sozialistischen Republik Braunschweig“, August Merges, mit seiner Familie lebte."},{"page_url":"https://de.wikipedia.org/wiki/Dresdner_Zeughaus","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Das_Zeughaus_im_Jahr_1800_Dresden.jpg","page_title":"Dresdner Zeughaus","context_page_description":"Das Dresdner Zeughaus war ein Waffenarsenal am Standort des heutigen Museums Albertinum zwischen Jungfernbastei, Georg-Treu-Platz, Tzschirnerplatz und Salzgasse in Dresden."},{"page_url":"https://sl.wikipedia.org/wiki/Schmidtov_daljnogled","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Alfred-Jensch-Teleskop.jpg","page_title":"Schmidtov daljnogled","context_page_description":"Schmidtov daljnogled je astronomski daljnogled, ki omogoča široko vidno polje z majhnimi aberacijami. Podobni konstrukciji sta Wrightov daljnogled in Lurie-Hougtonov daljnogled.\\nTo vrsto daljnogleda je izdelal estonsko-nemški optik Bernhard Schmidt. Sestavlja ga krogelno glavno zrcalo in nekrogelne korekcijske leče, znane kot korekcijska plošča. Korekcijska plošča je nameščena v središču ukrivljenosti glavnega zrcala. Objektiv ali film ležita znotraj daljnogleda v gorišču glavnega zrcala. Konstrukcija omogoča zelo hitra žariščna razmerja in sočasno nadziranje kome in astigmatizma."},{"page_url":"https://es.wikipedia.org/wiki/Tudela_de_Duero","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Bosque_de_ribera.jpg","page_title":"Tudela de Duero","context_page_description":"Tudela de Duero es una localidad y municipio español de la provincia de Valladolid. El municipio cuenta con una población de 8551 habitantes. La localidad se encuentra situada a 16 km al sudeste de Valladolid sobre un meandro del río Duero, a una altitud de 700 m sobre el nivel del mar. A 6 km se encuentra el barrio o pedanía de Herrera de Duero."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%BE%8E%E5%9B%BD%E6%9C%80%E5%96%9C%E7%88%B1%E5%BB%BA%E7%AD%91%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Phila_City_Hall_Twilight.jpg","page_title":"美国最喜爱建筑列表","context_page_description":"2007年，美国建筑师学会为了纪念其成立150周年，依民意调查选出美国最受喜爱的150栋建筑。民意调查分为两阶段，第一阶段由2,448位美国建筑师学会成员每人从15类建筑各提出20栋建筑，"},{"page_url":"https://de.wikipedia.org/wiki/Stadtwerke_Bayreuth","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Schnelllader-am-sendelbach.jpg","page_title":"Stadtwerke Bayreuth","context_page_description":"Die Stadtwerke Bayreuth Holding GmbH ist ein kommunales Versorgungs- und Dienstleistungsunternehmen, zu hundert Prozent im Besitz der Stadt Bayreuth. Mit ihren Tochterunternehmen Stadtwerke Bayreuth Energie und Wasser GmbH und Stadtwerke Bayreuth Verkehr und Bäder GmbH sind die Stadtwerke Bayreuth zuständig für die Strom-, Erdgas-, Fernwärme- und Trinkwasserversorgung, den öffentlichen Nahverkehr, für mehrere Parkeinrichtungen und für den Betrieb von Bädern in Bayreuth. Außerdem bieten die Stadtwerke Bayreuth Telekommunikations- und Contracting-Dienstleistungen an."},{"page_url":"https://pl.wikipedia.org/wiki/P%C3%A9tange_(stacja_kolejowa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Gare_P%C3%A9iteng_vu_vir.jpg","page_title":"Pétange (stacja kolejowa)","context_page_description":"Pétange – stacja kolejowa w Pétange, w dystrykcie Luksemburg, w Luksemburgu.\\nJest to stacja Chemins de Fer Luxembourgeois."},{"page_url":"https://en.wikipedia.org/wiki/Sidon_Sea_Castle","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Sidon_Sea_Castle%2C_Sidon%2C_Lebanon.jpg","page_title":"Sidon Sea Castle","context_page_description":"Sidon's Sea Castle was built by the crusaders in the thirteenth century as a fortress of the holy land. It is one of the most prominent historical sites in the port city of Sidon, Lebanon."},{"page_url":"https://en.wikipedia.org/wiki/San_Gimignano","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Una_torre_-_panoramio.jpg","page_title":"San Gimignano","context_page_description":"San Gimignano is a small walled medieval hill town in the province of Siena, Tuscany, north-central Italy. Known as the Town of Fine Towers, San Gimignano is famous for its medieval architecture, unique in the preservation of about a dozen of its tower houses, which, with its hilltop setting and encircling walls, form \\"an unforgettable skyline\\". Within the walls, the well-preserved buildings include notable examples of both Romanesque and Gothic architecture, with outstanding examples of secular buildings as well as churches. The Palazzo Comunale, the Collegiate Church and Church of Sant' Agostino contain frescos, including cycles dating from the 14th and 15th centuries. The \\"Historic Centre of San Gimignano\\" is a UNESCO World Heritage Site.\\nThe town also is known for saffron, the Golden Ham, and its white wine, Vernaccia di San Gimignano, produced from the ancient variety of Vernaccia grape which is grown on the sandstone hillsides of the area."},{"page_url":"https://en.wikipedia.org/wiki/Passau_Hauptbahnhof","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Hauptbahnhof_Passau.jpg","page_title":"Passau Hauptbahnhof","context_page_description":"Passau Hauptbahnhof is the main railway station at Passau in Bavaria, Germany. Built in 1860, it has eight platforms, of which three are bay platforms and three are through tracks. The ca. 130 m long station building is built in the classic style."},{"page_url":"https://eu.wikipedia.org/wiki/Mil%C3%AD%C5%99e","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Mil%C3%AD%C5%99e_%28okres_Tachov%29_znak.jpg","page_title":"Milíře","context_page_description":"Milíře Txekiar Errepublikako udalerri bat da. 252 biztanle ditu eta 14,89 kilometro koadroko azalera. Tachoveko barrutian dago."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%87%8C%E5%BF%97%E6%85%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Lisa_ling_2007-03-29.jpg","page_title":"凌志慧","context_page_description":"凌志慧是一名华裔美籍记者。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A6%D1%80%D0%BA%D0%B2%D0%B0_%D0%A1%D0%B2%D0%B5%D1%82%D0%BE%D0%B3_%D0%92%D0%B5%D0%BB%D0%B8%D0%BA%D0%BE%D0%BC%D1%83%D1%87%D0%B5%D0%BD%D0%B8%D0%BA%D0%B0_%D0%94%D0%B8%D0%BC%D0%B8%D1%82%D1%80%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Wiki_%C5%A0umadija_VI_Crkva_Sv._Dimitrija_%28Leskovac%29_151.jpg","page_title":"Црква Светог Великомученика Димитрија","context_page_description":"Црква Светог Великомученика Димитрија у Лесковцу, насељеном месту у градској општини Лазаревац, подигнута је 1892. године на месту првобитне цркве-брвнаре из 17. века.\\nЦрква посвећена Светом Великомученику Димитрији, подигнута је, како се сматра по пројекту Светозара Ивачковића, у духу српско-византијском стилу, са основом у облику слободног крста. Обрада фасада је спроведена наизменичним полихромним ређањем појасева опеке и ломљеног камена, по угледу на примере српске средњовековне архитектуре. Прегледним унутрашњим простором доминира класицистички обликован иконостас, са иконама које су рад познатог српског сликара Живка Југовића. Истовремено са црквом подигнути су кула-звонара и парохијски дом, који чине јединствену просторну, архитектонску и културно-историјску целину.\\nУ црквеној ризници чувају се архивски предмети од изузетне вредности: старе црквене књиге, уметничка и документарна грађа, као и записи и цртежи архимандрита манастира Боговађе Хаџи Рувима Нешковића.\\nУ црквеној порти налази се костурница српских ратника 1914—1918. године."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Hor%C5%A1ovsk%C3%BD_T%C3%BDn","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/HorsovMarterl.JPG","page_title":"Liste der denkmalgeschützten Objekte in Horšovský Týn","context_page_description":"Grundlage dieser Liste der denkmalgeschützten Objekte in Horšovský Týn ist die ÚSKP-Liste, die von der tschechischen Denkmalschutzbehörde NPÚ seit 1987 geführt wird und an die seit dem Jahre 1850 geschaffenen Listen anschließt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B2%D0%BE%D0%BE%D1%80%D1%83%D0%B6%D0%B5%D0%BD%D0%B8%D1%8F_%D0%B8_%D0%B2%D0%BE%D0%B5%D0%BD%D0%BD%D0%BE%D0%B9_%D1%82%D0%B5%D1%85%D0%BD%D0%B8%D0%BA%D0%B8_%D0%A1%D1%83%D1%85%D0%BE%D0%BF%D1%83%D1%82%D0%BD%D1%8B%D1%85_%D0%B2%D0%BE%D0%B9%D1%81%D0%BA_%D0%90%D0%B7%D0%B5%D1%80%D0%B1%D0%B0%D0%B9%D0%B4%D0%B6%D0%B0%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Abir2.jpg","page_title":"Список вооружения и военной техники Сухопутных войск Азербайджана","context_page_description":"В статье представлены техника Сухопутных войск Азербайджанской Республики."},{"page_url":"https://de.wikipedia.org/wiki/Kurt_Sch%C3%BCtte","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Kurt_Schuette.jpg","page_title":"Kurt Schütte","context_page_description":"Kurt Schütte war ein deutscher Mathematiker und Hochschullehrer."},{"page_url":"https://he.wikipedia.org/wiki/%D7%A0%D7%91%D7%97%D7%A8%D7%AA_%D7%90%D7%A8%D7%92%D7%A0%D7%98%D7%99%D7%A0%D7%94_%D7%91%D7%A8%D7%95%D7%92%D7%91%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Placage_RWC2007_-_Fr_Ar.jpg","page_title":"נבחרת ארגנטינה ברוגבי","context_page_description":"נבחרת ארגנטינה ברוגבי, המכונה \\"לוס פומאס\\" מייצגת את ארגנטינה בתחרויות בינלאומיות של רוגבי יוניון, בהן גביע העולם ברוגבי ואליפות דרום אמריקה ברוגבי. הישג השיא של הנבחרת הוא המקום השלישי בו סיימה בגביע העולם ב-2007. ארגנטינה זכתה בכל אליפויות דרום אמריקה שבהן השתתפה."},{"page_url":"https://no.wikipedia.org/wiki/Romanos_I","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e5/Byzantines_repel_the_Russian_attack_of_941.jpg","page_title":"Romanos I","context_page_description":"Romanos I Lekapenos eller Lakapenos, født ca 870, død 15. juni 948 var en armener som ble bysantinsk marinekommandør, medkeiser og regjerte som østromersk keiser fra 920 til han ble avsatt av sine sønner 16. desember 944."},{"page_url":"https://hu.wikipedia.org/wiki/2019%E2%80%932020-as_magyar_n%C5%91i_k%C3%A9zilabda-bajnoks%C3%A1g_(els%C5%91_oszt%C3%A1ly)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/600px_Verde_e_Bianco_in_diagonale.png","page_title":"2019–2020-as magyar női kézilabda-bajnokság (első osztály)","context_page_description":"A 2019–2020-as magyar női kézilabda-bajnokság a bajnokság 69. kiírása volt. A szezon 2019. augusztus 29-én kezdődött, a címvédő a Győri Audi ETO volt.\\nA bajnokság ezen kiírásában is a 2016-ban bevezetett rendszer szerint 14 csapat vett részt a szezon küzdelmeiben. A 26 fordulósra tervezett alapszakaszban oda-visszavágós rendszerben játszott minden csapat egymással, majd a tabella első helyén végző csapat nyerte volna a bajnoki címet, míg az utolsó két helyezett csapat kiesett volna a másodosztályba.\\nA koronavírus-járvány miatt a bajnokságot 2020 áprilisában félbeszakították. Bajnokot nem avattak.\\nA bajnokság két újonca a Szent István SE és a Szombathelyi KKA volt."},{"page_url":"https://es.wikipedia.org/wiki/Villamoratiel_de_las_Matas","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Bandera_de_Villamoratiel_de_las_Matas_%28Le%C3%B3n%29.svg","page_title":"Villamoratiel de las Matas","context_page_description":"Villamoratiel de las Matas es un municipio y lugar español de la provincia de León, partido judicial de Sahagún, comunidad autónoma de Castilla y León. Está formado por los pueblos de Villamoratiel de las Matas y Grajalejo de las Matas."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%BD%E3%83%96%E3%83%A9%E3%83%AA%E3%82%A2%E3%83%BB%E3%82%AB%E3%83%AD%E3%82%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Sobralia_callosa001.jpg","page_title":"ソブラリア・カロサ","context_page_description":"ソブラリア・カロサ Sobralia callosa はラン科植物の1つ。1mを超える背丈になるものも多いソブラリア属の中では比較的小型の種である。"},{"page_url":"https://it.wikipedia.org/wiki/Riviera_del_Corallo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Plaja_Alghero.jpg","page_title":"Riviera del Corallo","context_page_description":"La Riviera del Corallo è un tratto costiero della Sardegna nord-occidentale a sud della pianura della Nurra, dove è situata la città di Alghero, fino ad arrivare alla città di Bosa. Così chiamata per la grande importanza del corallo rosso che nelle sue acque viene pescato e lavorato per farne gioielli ed ornamenti fin dai tempi dell'antica Roma.\\nSi tratta di una regione turistica compresa tra il comune di Alghero e il comune di Bosa, i quali si affacciano sul mar di Sardegna: uno dei mari più puliti del Mar Mediterraneo, sempre al primo posto nella classifica Legambiente.\\nSono presenti alcune frazioni, tra le quali ricordiamo Fertilia, Maristella, Tramariglio, Villanova Monteleone località tranquille che si popolano soprattutto nei mesi estivi. Nel territorio sorge inoltre l'aeroporto di Alghero-Fertilia, che ha sempre svolto un ruolo trainante nello sviluppo della Riviera, attirando in città numerosi flussi turistici sia italiani che stranieri grazie alla sempre maggiore offerta di destinazioni nazionali ed europee."},{"page_url":"https://is.wikipedia.org/wiki/Landmannalaugar","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7d/Landmannalaugar_%28Finn%29.jpg","page_title":"Landmannalaugar","context_page_description":"Landmannalaugar er íslensk laug og vinsæll ferðamannastaður á Fjallabaksleið nyrðri austur af Heklu; í Friðlandi að fjallabaki. Vegur þangað er aðeins fær að sumarlagi. Mikill jarðhiti er í Landmannalaugum og vinsæl náttúruböð. Jarðhitinn tengist einu mesta háhitasvæði landsins, Torfajökulssvæðinu. Landmannalaugar eru rómaðar fyrir náttúrufegurð og litríkt berg, þar er mikið um líparít og líparíthraun, hrafntinnu o. fl. Vinsæl gönguleið Laugavegurinn liggur milli Landmannalauga og Þórsmerkur. Vanalegt er að ganga þá leið á fjórum dögum en stundum er bætt við ferð allt til Skóga yfir Fimmvörðuháls milli Eyjafjallajökuls og Mýrdalsjökuls.\\nFerðafélag Íslands rekur skála í Landmannalaugum og þar er skálavörður að sumri.\\nFerðafélagið reisti fyrst sæluhús í Landmannalaugum árið 1951 en núverandi hús er að stofni til frá 1969. Það stendur í um 600 metra hæð við jaðar Laugahrauns og þar nálægt eru heitar uppsprettur sem vinsælar eru til baða.\\nSkálar eru á þessum stöðum leiðinni milli Landmannalauga og Skóga:\\nÁlftavatn\\nBotnar í Emstrum\\nFimmvörðuháls\\nHrafntinnusker\\nHvanngil\\nÞórsmörk"},{"page_url":"https://en.wikipedia.org/wiki/Richmond_Green","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Richmond_20931.JPG","page_title":"Richmond Green","context_page_description":"Richmond Green is a recreation area located near the centre of Richmond, a town of about 20,000 inhabitants situated in south west London. Owned by the Crown Estate, it is leased to the London Borough of Richmond upon Thames. The Green, which has been described as \\"one of the most beautiful urban greens surviving anywhere in England\\", is essentially square in shape and its open grassland, framed with broadleaf trees, extends to roughly twelve acres. On the north-east side there is also a smaller open space called Little Green. Richmond Green and Little Green are overlooked by a mixture of period townhouses, historic buildings and municipal and commercial establishments including the Richmond Lending Library and Richmond Theatre. On summer weekends and public holidays the Green attracts many residents and visitors. It has a long history of hosting sporting events; from the 16th century onwards tournaments and archery contests have taken place on the Green, while cricket matches have occurred since the mid 18th century, continuing to the present day."},{"page_url":"https://fr.wikipedia.org/wiki/Jardin_%C3%A9cologique_de_Lille","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Lathraea_clandestina_03.jpg","page_title":"Jardin écologique de Lille","context_page_description":"Le Jardin écologique de Lille est situé sur les fortifications de Vauban entre Lille et Saint-André-lez-Lille et conserve un patrimoine historique, environnemental et culturel caractéristique. L'association Lisière est gestionnaire du lieu depuis l'appel à projets de la Ville de Lille en 2015.\\nSur la Plaine de la Poterne du Vieux-Lille, il s'agit d'une ancienne réserve naturelle volontaire de la région Nord-Pas-de-Calais. Elle était l'une des rares réserves françaises qui soit véritablement « urbaine ». Déclassée à la suite de la loi « Démocratie de proximité », elle a perdu son statut de réserve naturelle."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B2%D0%B0%D0%BA%D0%B8%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Kawakita_town_office.jpg","page_title":"Кавакита","context_page_description":"Кавакита — посёлок в Японии, находящийся в уезде Номи префектуры Исикава. Площадь посёлка составляет 14,76 км², население — 6321 человек, плотность населения — 428,25 чел./км²."},{"page_url":"https://en.wikipedia.org/wiki/Austin,_Texas","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/State_and_Paramount_Theaters_-_Austin%2C_Texas_-_DSC08305.jpg","page_title":"Austin, Texas","context_page_description":"Austin is the capital city of the U.S. state of Texas, as well as the seat and largest city of Travis County, with portions extending into Hays and Williamson counties. Incorporated on December 27, 1839, it is the 11th-most populous city in the United States, the fourth-most-populous city in Texas, and the second-most-populous state capital city. It was also the fastest growing large city in the United States in 2015 and 2016. It is the southernmost state capital in the contiguous United States.\\nAs of the U.S. Census Bureau's July 1, 2019, estimate, Austin had a population of 978,908, up from 790,491 at the 2010 census. The city is the cultural and economic center of the Austin–Round Rock metropolitan statistical area, which had an estimated population of 2,227,083 as of July 1, 2019, nearly an 80% increase from the year 2000. Located in Central Texas within the greater Texas Hill Country, it is home to numerous lakes, rivers, and waterways, including Lady Bird Lake and Lake Travis on the Colorado River, Barton Springs, McKinney Falls, and Lake Walter E. Long.\\nResidents of Austin are known as Austinites."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E5%A4%A7%E5%90%8C%E6%9B%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Litiefu1904.jpg","page_title":"大同書","context_page_description":"《大同書》是中國近代著名思想家康有為的著作，寫成於1901年，主要闡述了作者的大同思想。\\n在著《大同書》的十幾年前，康有為就已初步形成了他的大同思想。1882年，康有為北京鄉試未中，南歸時經上海，接觸了大量西方書籍及相關思想，後經遊歷香港，所見所聞，1884年「悟大小齊同之理」，1885年著《幾何公理》，1886年著《康子內外篇》、《公理書》，1887年著《人類公理》，初步奠定了他的思想基礎。1895年公車上書，1898年戊戌變法，康有為欲將其政治思想運用於實踐中。變法失敗後，康有為經香港、日本、歐美諸國，對西方的政治制度有了進一步的認識。1901年旅居印度時著《大同書》，表明他的大同思想已趨於成熟。《大同書》全書分為甲、乙、丙、丁、戊、已、庚、辛、壬、癸十部。甲部為總論，提出人類的九界之苦：國界之苦、級界之苦、種界之苦、形界之苦、家界之苦、產界之苦、亂界之苦、類界之苦、苦界之苦；其它九部，分別描寫克服九界之苦的大同世界。在書中，康有為系統設計了一個人類大同社會，涉及政治、經濟、社會多個方面：政治民主，人人平等；經濟公有，人無私產；社會和諧，無家無國。\\n在人民公社化運動開始後，中國共產黨中央委員會主席毛澤東曾公開說「《大同書》所寫就是我們共產主義者要建立的理想社會」，而且指示中共中央宣傳部印了一本有關空想社會主義的資料，資料裡面包含《大同書》的內容。"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A4%D1%83%D0%BC%D0%B0%D1%80%D0%BE%D0%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Kamakura-021_hg.jpg","page_title":"Фумарола","context_page_description":"Фумаролите са струи от вулканични газове и пари, изхвърляни от пукнатини в земната кора, много често в близост, по склоновете, и в кратерите на вулкани. Наличието им е признак за активен вулканизъм. Могат да се появят от малки пукнатини или от дълги и големи фисури, хаотично разпилени или концентрирани в определена зона. Наблюдават се както по повърхността на лавови потоци, така и при дебели отлагания на пирокластични потоци. Ако се намират над постоянен източник на топлина, какъвто е активната магмена камера, те могат да продължат да съществуват десетилетия или векове. Ако обаче са образувани върху пресен вулканичен депозит, който бързо се охлажда, животът им се съкращава до седмици или максимум месеци. Фумаролите често се образуват при активните вулкани по време на периоди на относително затишие между две изригвания.\\nГазовите емисии обикновено се състоят от хлор, въглероден диоксид, серен диоксид, солна киселина, сероводород и други газове, които са били разтворени в магмата. Въглеродният и серният диоксид, както и сероводородът, най-често се отделят директно от магмата."},{"page_url":"https://en.wikipedia.org/wiki/Libercourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Libercourt_-_%C3%89glise_Saint-Henri_%2801%29.JPG","page_title":"Libercourt","context_page_description":"Libercourt is a commune in the Pas-de-Calais department in the Hauts-de-France region of France."},{"page_url":"https://en.wikipedia.org/wiki/Gransee","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Wentow_Gutshaus.jpg","page_title":"Gransee","context_page_description":"Gransee is a town in the Oberhavel district, in Brandenburg, Germany. It is situated 20 km south of Fürstenberg/Havel, and 55 km northwest of Berlin.\\nAn important monument in the centre of town is the cast-iron and stone Memorial to Queen Luise, which was designed by the German architect Karl Friedrich Schinkel in the neo-gothic style.\\nA sport airfield is situated in the eastern part of the town. It is one of the major drop zones in the vicinity of Berlin."},{"page_url":"https://de.wikipedia.org/wiki/C._A._Herpich_S%C3%B6hne","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Ozelotjacke%2C_Modell_Herpich%2C_1934.jpg","page_title":"C. A. Herpich Söhne","context_page_description":"Das Berliner Modehaus C. A. Herpich Söhne galt für einige Jahrzehnte als das bedeutendste Unternehmen der deutschen Pelzbranche. Ursprünglich eine Kürschnerei mit einem kleinen Pelzgeschäft, entwickelte sich Herpich zu einem Modehaus „in einer großartigen und vornehmen Aufmachung“ und einem der angesehensten Anbieter hochwertiger Pelze und zu einem Großhandelsunternehmen für Pelzkonfektion und Felle."},{"page_url":"https://sw.wikipedia.org/wiki/Sarektj%C3%A5kk%C3%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Sarektj%C3%A5kko-25.jpg","page_title":"Sarektjåkkå","context_page_description":"sarektjåkko-25.jpg\\nSarektjåkkå ni mlima ulioko katika nchi ya Uswidi, wenye kimo cha mita 2,089."},{"page_url":"https://sq.wikipedia.org/wiki/Gramshi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Gramsh_%28Albania%29.jpg","page_title":"Gramshi","context_page_description":"Gramshi është qytet në Shqipëri. Shtrihet në pjesën juglindore të Shqipërisë. Mund të shkohet me çdo lloj mjeti me anë të rrugës së asfaltuar Elbasan-Cerrik-Gramsh."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%95%E3%83%AC%E3%83%83%E3%83%89%E3%83%BB%E3%83%9B%E3%83%93%E3%83%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Fred_Hovey.jpg","page_title":"フレッド・ホビー","context_page_description":"フレッド・ホビーは、アメリカ・マサチューセッツ州ニュートン・センター出身の男子テニス選手。本名は Frederick Howard Hovey といい、愛称の「フレッド」で呼ばれた。ハーバード大学卒業。1890年代前半の全米選手権で活躍し、男子シングルスで1895年、男子ダブルスで1893年・1894年の2度優勝した。右利きの選手で、体格は身長173cm、体重77kgほどであった。\\n彼の姓“Hovey”の読みは、検索サイトの「日本語のページを検索」オプションで探すと、はっきりした検索結果が出づらい。著名なデザイナーブランドの名前で「ホビー・リー・デザインズ」が出たり、軍艦の名前で「ホーヴェイ」が出たりする。 テニス選手の日本語読み紹介サイトでは「フレッド・ハビー」と書いたものが2つあるが、この読みは他文献では全くヒットしない。"},{"page_url":"https://fr.wikipedia.org/wiki/Anna_Banana","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Anna_Banana_at_the_Ex_Postal_Facto_mail_art_conference.jpg","page_title":"Anna Banana","context_page_description":"Anna Banana est une artiste canadienne connue pour ses performances, ses écrits et son travail d'éditrice. Elle est la première artiste à utiliser le « timbre artistique », des œuvres créées dans un format de timbre-poste. Depuis le début des années 1970, elle participe au mouvement de l'art postal. En tant qu'éditrice, Anna Banana a lancé le magazine Vile et le bulletin Banana Rag devenu Artistamp News en 1996."},{"page_url":"https://ro.wikipedia.org/wiki/Villes%C3%A8que-des-Corbi%C3%A8res","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/Map_commune_FR_insee_code_11436.png","page_title":"Villesèque-des-Corbières","context_page_description":"Villesèque-des-Corbières este o comună în departamentul Aude din sudul Franței. În 2009 avea o populație de 392 de locuitori."},{"page_url":"https://ceb.wikipedia.org/wiki/New_Holland_(lungsod_sa_Hiniusang_Gingharian,_Inglatera,_North_Lincolnshire,_lat_53,70,_long_-0,36)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Christ_Church%2C_New_Holland_-_geograph.org.uk_-_153533.jpg","page_title":"New Holland (lungsod sa Hiniusang Gingharian, Inglatera, North Lincolnshire, lat 53,70, long -0,36)","context_page_description":"Lungsod ang New Holland sa Hiniusang Gingharian. Nahimutang ni sa kondado sa North Lincolnshire ug apil sa nasod sa Inglatera, sa habagatan-sidlakang bahin sa nasod, 240 km sa amihanan sa London ang ulohan sa nasod. 4 metros ibabaw sa dagat kahaboga ang nahimutangan sa New Holland, ug adunay 955 ka molupyo.\\nAng yuta palibot sa New Holland kay patag. Sa amihang-sidlakan, dagat ang pinakaduol sa New Holland. Ang kinahabogang dapit sa palibot dunay gihabogon nga 154 ka metro ug 14.5 km sa amihanan-kasadpan sa New Holland. Dunay mga 139 ka tawo kada kilometro kwadrado sa palibot sa New Holland medyo hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Kingston upon Hull, 5.2 km sa amihanan sa New Holland. Hapit nalukop sa kaumahan ang palibot sa New Holland.\\nAng klima kasarangan. Ang kasarangang giiniton 8 °C. Ang kinainitan nga bulan Hulyo, sa 16 °C, ug ang kinabugnawan Disyembre, sa 0 °C."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%93%D0%B5%D0%BA%D0%B0%D1%82%D0%B5_(%D0%BF%D1%80%D0%BE%D1%82%D0%BE%D0%BA%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Hecate_Strait%2C_BC_-b.jpg","page_title":"Гекате (протока)","context_page_description":"Протока Гекате — морська протока між островами Королеви Шарлотти та тихоокеанською провінцією Канади, Британською Колумбією, що сполучає протоку Діксон-Ентранс із затокою Королеви Шарлотти.\\nШирина протоки 140 км в південній частині та 48 км в північній. Довжина становить приблизно 260 км."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B0%D1%82%D0%BE%D1%81,_%D0%A3%D0%B1%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Huber_Matos_Benitez.jpg","page_title":"Матос, Убер","context_page_description":"Убер Матос Бенитес — кубинский государственный и общественный деятель, участник Кубинской революции, позднее политзаключенный, диссидент, эмигрант."},{"page_url":"https://fr.wikipedia.org/wiki/Pont_des_Baisers","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/PotseluevBridgePostcard1914.jpg","page_title":"Pont des Baisers","context_page_description":"Le pont des Baisers est un pont célèbre de Saint-Pétersbourg qui traverse la Moïka et prolonge la rue Glinka. Il est l'objet de beaucoup d'anecdotes littéraires à cause de son nom, et de peintures, car l'on y voit en fond la coupole de la cathédrale Saint-Isaac. Il mesure 41,5 m de long et 23,5 m de large."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BC%D5%AB_%D5%8D%D5%B8_%D4%BF%D5%B5%D5%B8%D6%82%D5%B6%D5%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/190515_%EC%98%81%ED%99%94_%27%EA%B8%B0%EB%AC%98%ED%95%9C_%EA%B0%80%EC%A1%B1%27_%EC%A0%9C%EC%9E%91%EB%B3%B4%EA%B3%A0%ED%9A%8C_%EC%9D%B4%EC%88%98%EA%B2%BD.jpg","page_title":"Լի Սո Կյունգ","context_page_description":"Լի Սո Կյունգ, հարավկորեացի դերասանուհի։ Առավել հայտնի է դարձել Յոնգսուն ֆիլմում խաղացած իր դերով։"},{"page_url":"https://fr.wikipedia.org/wiki/Art_du_Moyen_Empire_%C3%A9gyptien","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/AncientEgyptianFigurines-DraftAnimals-ROM.png","page_title":"Art du Moyen Empire égyptien","context_page_description":"L'art du Moyen empire correspond à la période du Moyen Empire de l'Égypte antique, entre 2030 et 1710 ou 1650 avant l'ère commune.\\nSi l'art égyptien donne l'impression d'une étonnante continuité sur des millénaires, l'étude d'une période comme celle du Moyen Empire prouve qu'avec une certaine flexibilité sur une trame permanente, de nouveaux principes, de nouvelles idées se sont greffées sur la trame qui persiste au fil du temps, produisant une société d'une complexité croissante.\\nAprès les désordres de la Première Période intermédiaire, si l'on se réfère aux textes qui subsistent datant du Moyen Empire, la peur des forces chaotiques était plus prononcée qu'avant et l'accent était mis sur l'unité au sein du pays. Dans le même temps, le souvenir des bouleversements qui ont souvent traversés le pays peut avoir inspiré les anciens Égyptiens, car il leur a montré qu'ils pouvaient se remettre de périodes de désordre. C'est peut-être au moins en partie la raison pour laquelle le Moyen Empire a été considéré dans les époques ultérieures comme une époque idéale."},{"page_url":"https://it.wikipedia.org/wiki/Kareem_Hunt","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Kareem_Hunt_2019.jpg","page_title":"Kareem Hunt","context_page_description":"Kareem AJ Hunt è un giocatore di football americano statunitense che milita nel ruolo di running back per i Cleveland Browns della National Football League. Nelle prime due stagioni aveva giocato con i Kansas City Chiefs, da cui venne svincolato il 30 novembre 2018 a causa delle accuse di violenza su una donna in un hotel."},{"page_url":"https://tr.wikipedia.org/wiki/Park_Jin-hee","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Park_Jin-Hee.jpg","page_title":"Park Jin-hee","context_page_description":"Park Jin-hee Güney Koreli oyuncu. Daha çok Please Come Back, Soon-ae, War of Money, ve Giant dizilerinde oynadığı roller ile tanınır.En bilindik filmi Shadows in the Palace dir."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BD%D0%BE%D0%BD%D1%81%D0%BA%D0%BE%D1%80%D1%83%D1%81%D0%B8%D0%BD%D1%81%D0%BA%D0%B8_%D1%98%D0%B5%D0%B7%D0%B8%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Coat_of_arms_of_Vojvodina.png","page_title":"Панонскорусински језик","context_page_description":"Панонскорусински или само русински језик, је језик којим се говори у северној Србији и источној Хрватској. Русинским језиком говоре етнички Русини, док у Аутономној Покрајини Војводини овај језик представља један од шест службених језика.\\nОснове граматике русинског језика је поставио Хавријил Костељник још 1923, али их је потпуно уредио лингвиста и писац Микола Кочиш у свом Правопису издатој 1971. године у Новом Саду, а три године касније је издао и прву граматику русинског у Војводини.\\nПрема извештају Уједињених нација, русински језик, одн. језик панонских Русина, је један од ретких микројезика, како у Европи, тако и у свету, који има прилику да се развија захваљујући томе што се поред живе употребе, гаји и књижевност на овом језику, а такође и постоје сви степени образовања на русинском, уз активну Катедру за русински језик на Филозофском факултету у Новом Саду. Поред редовног недељника Руске слово чији је издавач Извршно Веће АПВ, постоји и богато издаваштво у русинским заједницама у Војводини.\\nУ русинском језику нагласак је увек на претпоследњем слогу."},{"page_url":"https://ceb.wikipedia.org/wiki/Vierer_See","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Kreis-Ploen_-_Vierer_See.JPG","page_title":"Vierer See","context_page_description":"Lanaw ang Vierer See sa Alemanya. Nahimutang ni sa estado pederal sa Schleswig-Holstein, sa amihanang bahin sa nasod, 260 km sa amihanan-kasadpan sa Berlin ang ulohan sa nasod. 19 metros ibabaw sa dagat kahaboga ang nahimutangan sa Vierer See. Naglangkob kin og 0.52 ka kilometro kwadrado. Vierer See nga nahimutang sa lanaw sa Großer Plöner See. Ang kinahabogang dapit sa palibot dunay gihabogon nga 53 ka metro ug 1.0 km sa habagatan sa Vierer See. Naglukop ni og 1.3 km gikan sa amihanan ngadto sa habagatan ug 1.4 km gikan sa sidlakan ngadto sa kasadpan.\\nSa mosunod nga mga natural nga mga bahin makita sa Vierer See:\\nHeidensee\\nHöftsee\\nHapit nalukop sa kaumahan ang palibot sa Vierer See. Dunay mga 179 ka tawo kada kilometro kwadrado sa palibot sa Vierer See medyo hilabihan populasyon. Ang klima hemiboreal. Ang kasarangang giiniton 7 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Enero, sa -4 °C."},{"page_url":"https://en.wikipedia.org/wiki/Alamo_Square_Park,_Colorado_Springs","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Downtown_Colorado_Springs_Outside_Pioneers_Museum.jpg","page_title":"Alamo Square Park, Colorado Springs","context_page_description":"Alamo Square Park, located at 215 South Tejon Street, is the site of the Colorado Springs Pioneers Museum, which has fine art and historical exhibits and a museum store. A fountain, sculptures and gazebo are located in the park.\\nIt was previously the El Paso County Courthouse from 1903 to 1973. The square was previously known as South Park."},{"page_url":"https://de.wikipedia.org/wiki/Fran%C3%A7ois_Li%C3%A9nard_de_la_Mivoye","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Phelsuma_gigas_-_Giant_Rodrigues_Gecko_-_extinct_2.jpg","page_title":"François Liénard de la Mivoye","context_page_description":"François Liénard de la Mivoye war ein französisch-mauritischer Naturforscher, Ichthyologe, Zoologe und Seefahrer."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%88%D8%A7%D9%84%DA%86%D8%AF%D8%B1%D8%A7%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Valchedram-Church-Iankov-IFB.JPG","page_title":"والچدرام","context_page_description":"والچدرام - بولغاریستانین مونتانا اوستانیندا یئرلشیب ۲۰۰۱ جی ایلینین نۆفوس ساییمی اساسیندا بۇ شهرین ۴۱۷۶ نفر و ۲۰۱۱-جی ایلین نۆفوس ساییمی اساسیندا ۳۶۹۶ نفر جمیعتی واریمیش. بۇ باخیم‌دان اۆلکه‌نین ۱۶۶- اینجی شهری سایاگلیر."},{"page_url":"https://fr.wikipedia.org/wiki/H%C3%B4tels_particuliers_de_Toulouse","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Immeuble-cariatides_%282%29.jpg","page_title":"Hôtels particuliers de Toulouse","context_page_description":"Toulouse, à la tête d'un vaste comté au Moyen Âge, puis capitale de la province de Languedoc jusqu'à la Révolution, a tout au long de son histoire compté parmi les principales villes de France. Centre de pouvoir, la ville a conservé jusqu'à nos jours de nombreux hôtels particuliers édifiés par ses élites : capitouls, marchands fortunés et noblesse de robe liée au Parlement de Toulouse notamment.\\nSi l'historiographie toulousaine met volontiers en avant un « siècle d'or » coïncidant avec la Renaissance et la fortune brassée par quelques grands négociants du pastel, ce sont cependant quelque deux cents hôtels particuliers ou vestiges d'hôtels particuliers qui rendent compte de l'évolution de l'architecture civile au fil des siècles dans une capitale provinciale qui ne suivit pas toujours les modèles nationaux.\\nCette page n'a pas pour objet de lister tous les hôtels particuliers de Toulouse, mais de répertorier les plus remarquables pouvant être intégrés dans une lecture de l'évolution de l'architecture privée toulousaine."},{"page_url":"https://fr.wikipedia.org/wiki/Championnat_de_France_de_rugby_%C3%A0_XV_2014-2015","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Toby_Flood_2014.jpg","page_title":"Championnat de France de rugby à XV 2014-2015","context_page_description":"Le championnat de France de rugby à XV 2014-2015 ou Top 14 2014-2015 est la cent-seizième édition du championnat de France de rugby à XV. Elle oppose les quatorze meilleures équipes de rugby à XV françaises. Le championnat se déroule un an avant la Coupe du monde de rugby à XV 2015 qui aura lieu en Angleterre.\\nCette saison, le Lyon OU et le Stade rochelais sont promus en championnat et remplacent l'USA Perpignan et le Biarritz olympique. Le RC Toulon est tenant du titre et double champion d'Europe en titre.\\nLe championnat voit le Stade français sacré champion de France de rugby à XV le samedi 13 juin 2015 en remportant la finale face à l'ASM Clermont Auvergne sur le score de 12 à 6, soulevant ainsi son premier bouclier de Brennus depuis 2007."},{"page_url":"https://en.wikipedia.org/wiki/National_Peasants%27_Party","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/St%C4%83_ascuns_la_B%C4%83d%C4%83cin.png","page_title":"National Peasants' Party","context_page_description":"The National Peasants' Party was an agrarian political party in the Kingdom of Romania. It was formed in 1926 through the fusion of the Romanian National Party, a conservative-regionalist group centered on Transylvania, and the Peasants' Party, which had coalesced the left-leaning agrarian movement in the Old Kingdom and Bessarabia. The definitive PNR–PȚ merger came after a decade-long rapprochement, producing a credible contender to the dominant National Liberal Party. National Peasantists agreed on the concept of a \\"peasant state\\", which defended smallholding against state capitalism or state socialism, proposing voluntary cooperative farming as the basis for economic policy. Peasants were seen as the first defense of Romanian nationalism and of the country's monarchic system, sometimes within a system of social corporatism. Regionally, the party expressed sympathy for Balkan federalism and rallied with the International Agrarian Bureau; internally, it championed administrative decentralization and respect for minority rights, as well as, briefly, republicanism. It remained factionalized on mainly ideological grounds, leading to a series of defections."},{"page_url":"https://it.wikipedia.org/wiki/Chiesa_della_Beata_Vergine_del_Monte_Carmelo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Chiesa_Carmine_26.jpg","page_title":"Chiesa della Beata Vergine del Monte Carmelo","context_page_description":"La chiesa della Beata Vergine del Monte Carmelo di Cerignola è un edificio religioso, in stile barocco, risalente al XVI secolo costruito ad opera dei frati carmelitani trasferitisi in città."},{"page_url":"https://en.wikipedia.org/wiki/Divisions_of_the_Carpathians","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Mapcarpat2.png","page_title":"Divisions of the Carpathians","context_page_description":"Divisions of the Carpathians are categorization of the Carpathian mountains system.\\nBelow is a detailed overview of the major subdivisions and ranges of the Carpathian Mountains. The Carpathians are a \\"subsystem\\" of a bigger Alps-Himalaya System that stretches from the western Europe all the way to southern Asia, and are further divided into \\"provinces\\" and \\"subprovinces\\". The last level of the division, i.e. the actual mountain ranges and basins, is usually classified as \\"units\\". The main divisions are shown in the map on the right.\\nTo generalize, there are three major provinces: Western Carpathians, Eastern Carpathians, and Southern Carpathians."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%91%E1%83%90%E1%83%98%E1%83%99%E1%83%90%E1%83%9A%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/%D0%91%D0%B0%D0%B9%D0%BA%D0%B0%D0%BB_2008_%D0%B2%D0%B8%D0%B4_%D1%81_%D1%81%D0%BE%D0%BF%D0%BA%D0%B8.jpg","page_title":"ბაიკალი","context_page_description":"ბაიკალი — მსოფლიოს ერთ-ერთი უდიდესი ტექტონიკური წარმოშობის ტბა რუსეთში, აღმოსავლეთ ციმბირში, ირკუტსკის ოლქისა და ბურიატეთის ტერიტორიაზე. მსოფლიოში ყველაზე ღრმა ტბა, მტკნარი წყლის უდიდესი რეზერვუარი. მდებარეობს ზღვის დონიდან 455,5 მ სიმაღლეზე, ქედებით გარშემორტყმულ ღრმა ტექტონიკურ ქვაბულში, რომელიც წარმოიქმნა და წყლით ამოივსო პალეოგენის ბოლოსა და ქვედა ნეოგენში. წელიწადის ნახევარზე მეტი ხნით ბაიკალი იყინება. ტბის ქვაბული დაახლოებით 25 მლნ. წლის წინ წარმოიქმნა.\\nტბა და ირგვლივ მდებარე სანაპირო გამოირჩევა ფლორისა და ფაუნის უნიკალური მრავალფეროვნებით, რომელთაგან უმეტესობა ენდემურია. 1956 წლიდან მდინარე ანგარაზე ირკუტსკის ჰესის კაშხლის აშენების შედეგად, ბაიკალი გახდა ირკუტსკის წყალსაცავის აკვატორიის ნაწილი, რის გამოც ტბის საშუალო დონემ სხვადასხვა ცნობებით აიწია 0,8–1,4 მ-ით. ადგილობრივები და საერთოდ, რუსეთის მოსახლეობის დიდი ნაწილი ბაიკალს „ზღვას“ უწოდებს.\\nბაიკალი მსოფლიოში ტბებს შორის ფართობით მე-6 ადგილზეა. კუნძულების გარეშე მისი ფართობია 31 722 კმ². ჩრდილო-აღმოსავლეთიდან სამხრეთ-დასავლეთისაკენ გადაჭიმულია 620 კილომეტრზე. სიგანე მერყეობს 24-იდან 79 კმ-მდე. სანაპირო ხაზის სიგრძეა 2100 კმ. ტბის დასავლეთი სანაპირო კლდოვანია და ციცაბო, ხოლო აღმოსავლეთი — შედარებით ბრტყელი."},{"page_url":"https://ast.wikipedia.org/wiki/Alice_Austen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Alice_Austen%2C_Trude_%26_I_Masked.jpg","page_title":"Alice Austen","context_page_description":"Elizabeth Alice Austen foi una fotógrafa d'Estaos Xuníos."},{"page_url":"https://ia.wikipedia.org/wiki/Stanislas_de_Guaita","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Guaitasd.jpg","page_title":"Stanislas de Guaita","context_page_description":"Stanislas de Guaita esseva un occultista francese.\\nLibros:\\nI. Au seuil du Mystère - 1886\\nII. Le serpent de la Genèse - 1891/97\\nOiseaux de passage: rimes fantastiques, rimes d'ébène -1881\\nLa Muse noire - 1883\\nRosa mystica - 1885"},{"page_url":"https://hu.wikipedia.org/wiki/T%C3%B6r%C3%B6k_Nagy_Nemzetgy%C5%B1l%C3%A9s","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Building_of_the_Grand_National_Assembly_of_Turkey.jpg","page_title":"Török Nagy Nemzetgyűlés","context_page_description":"A Török Nagy Nemzetgyűlés vagy egyszerűen a török parlament Törökország egykamarás parlamentje, melyet a törökök röviden TBMM-nek vagy Meclis-nek hívnak. A parlament törvényhozói hatalmát a török alkotmány biztosítja. Az első országgyűlés Ankarában jött létre 1920. április 23-án a török függetlenségi háború ideje alatt. Atatürk elképzelései szerint az országgyűlés volt az egyik biztosítéka annak, hogy az Oszmán Birodalom romjaiból felépülhessen a Török Köztársaság.\\nA parlamentnek 550 tagja van, akiket 85 választókörzetből ötévente választanak az arányos képviselet elvén alapuló D'Hondt-módszer segítségével. A 85 választókerület képviseli Törökország 81 tartományát; Isztambul három, Ankara és İzmir pedig kettő-kettő választókörzettel rendelkezik lakosságának nagy száma miatt. A parlamentbe való bekerüléshez a pártoknak el kell érniük a 10%-os parlamenti küszöböt a választások során. 2002-ben kettő, 2007-ben pedig három párt delegálhatott képviselőket az országgyűlésbe. Független képviselők is indulhatnak a választásokon, ám rájuk is érvényes a 10%-os küszöb saját választókerületükre vetítve."},{"page_url":"https://ro.wikipedia.org/wiki/List%C4%83_de_recorduri_mondiale","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Sarawak_state_locator.PNG","page_title":"Listă de recorduri mondiale","context_page_description":"Aceasta este o listă de recorduri mondiale ordonate pe categorii."},{"page_url":"https://it.wikipedia.org/wiki/Wintersingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Wintersingen.jpg","page_title":"Wintersingen","context_page_description":"Wintersingen è un comune svizzero di 609 abitanti del Canton Basilea Campagna, nel distretto di Sissach."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_das_pontes_suspensas_mais_extensas_do_mundo","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/78/George_Washington_Bridge_NY.JPG","page_title":"Lista das pontes suspensas mais extensas do mundo","context_page_description":"As pontes suspensas mais extensas do mundo são listadas de acordo com a extensão de seu vão principal. A extensão do vão principal é o método amplamente utilizada no que se refere à medidas de pontes suspensas, eventualmente correlacionando-se com a altura das torres e a complexidade estrutural envolvida em sua construção. O fato de determinada ponte possuir um vão maior do que outra não significa necessariamente que tal ponte é mais extensa de encontro a encontro.\\nConsiderando a extensão do vão, as pontes suspensas são maiores do que qualquer outro tipo de ponte. Pontes estaiadas, por sua vez, são também de grande complexidade estrutural, sendo comumente consideradas para extensões de até um quilômetro. Entretanto, as 17 primeiras pontes listadas abaixo possuem igualmente os 17 maiores vãos de ponte veicular no mundo."},{"page_url":"https://hr.wikipedia.org/wiki/Erodium_acaule","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Erodium_acaule_3.JPG","page_title":"Erodium acaule","context_page_description":"Erodium acaule, biljna vrsta iz roda čapljana raširena po zemljama Sredozemlja. U Hrvatskoj je nova vrsta, koja se pojavila pred kraj 1990–tih godina na jugu Istre i otoku Krku."},{"page_url":"https://ca.wikipedia.org/wiki/Castell_d%27Alsamora","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Castell_d%27Alsamora.JPG","page_title":"Castell d'Alsamora","context_page_description":"El Castell d'Alsamora fou una fortificació medieval de la qual en resta la torre. Està situat en el poble d'Alsamora dins del municipi de Sant Esteve de la Sarga, al Pallars Jussà. Guaita de la Baixa Ribagorça, és la segona en alçada de Catalunya."},{"page_url":"https://eu.wikipedia.org/wiki/Lednice-Valticeko_paisaia_kulturala","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/60/Hlohovec_cz_01.jpg","page_title":"Lednice-Valticeko paisaia kulturala","context_page_description":"Lednice–Valticeko paisaia kulturala Hego Moraviako Lednice eta Valtice udalerrietako eremua da, 283.09 km²-ko azalera duena.1996an UNESCOk Břeclavetik gertu dagoen eremu hau Gizateriaren Ondare izendatu zuen."},{"page_url":"https://de.wikipedia.org/wiki/Dagmar_Schmidt_(K%C3%BCnstlerin)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/12_Refugium_001.jpg","page_title":"Dagmar Schmidt (Künstlerin)","context_page_description":"Dagmar Schmidt ist eine deutsche Künstlerin."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%BA%D1%81%D0%B8%D0%BC-%D0%93%D0%B5%D0%B7%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/%C4%B0stanbul_-_Taksim_Gezi_Park%C4%B1_-_Mart_2013_-_r4.JPG","page_title":"Таксим-Гези","context_page_description":"Парк Такси́м-Гези́ — городской парк на площади Таксим в районе Бейоглу в центре Стамбула, один из самых маленьких парков города. Разбитый на месте казарм, в 2013 году парк стал местом столкновений турецкой полиции с демонстрантами, протестующими против намерения правительства восстановить казармы и вырубить парк, построив на его месте торговый центр."},{"page_url":"https://id.wikipedia.org/wiki/Danika_Yarosh","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Danika_Yarosh_by_Gage_Skidmore.jpg","page_title":"Danika Yarosh","context_page_description":"Danika Ann Yarosh, lebih dikenal sebagai Danika Yarosh, adalah aktris asal Amerika Serikat. Ia adalah adik dari aktris Mani Yarosh yang berperan sebagai Ingrid di film Project Almanac."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%86%D8%A7%D9%83%D8%A7%D8%A8%D8%B1%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Villa_Damecuta_Anacapri.jpg","page_title":"أناكابري","context_page_description":"أناكابري، ‏، هي في جزيرة كابري، في مدينة نابولي الحضرية بإيطاليا. تعني البادئة اليونانية القديمة \\"أعلى\\" أو \\"أعلاه\\"، مما يدل على أن أناكابري تقع على ارتفاع أعلى في الجزيرة من كابري. إداريا، لديه وضع منفصل عن مدينة كابري. الموقع الأكثر أهمية في القرية هو فيلا سان ميشيل."},{"page_url":"https://tr.wikipedia.org/wiki/Kore_giyim_listesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Korean_traditional_shoes-01.jpg","page_title":"Kore giyim listesi","context_page_description":"Hanbok Korenin geleneksel kıyafetidir.\\nAşağıda Kore de giyilen kıyafetlerin listesi verilmiştir."},{"page_url":"https://es.wikipedia.org/wiki/Convallaria_majalis","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/2013-05-17_19-48-44-muguet-122f.jpg","page_title":"Convallaria majalis","context_page_description":"Convallaria majalis es una especie herbácea y perenne, nativa de las zonas templadas del hemisferio norte, y perteneciente a la familia Asparagaceae."},{"page_url":"https://sl.wikipedia.org/wiki/Trajnostnost","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Jan_Brueghel_the_Elder-Great_Fish_market.jpg","page_title":"Trajnostnost","context_page_description":"Trajnostnost je sposobnost vzdrževanja ravnotežja določenih sistemov ali stanj v nekem procesu. Danes se najpogosteje koristi v zvezi z biološkimi in človeški sistemi. V ekološkem smislu se trajnostnost lahko definira kot način, po katerem biološki sistemi ostajajo raznoliki in produktivni tekom celega časa. Za ljudi je potencial za dolgoročno vzdrževanje blaginje, ki je odvisna od naravnega sveta in odgovorni uporabi naravnih virov.\\nV slovenščini izraz trajnostnost pomensko ustreza angleškemu izrazu sustainability. Ob njem se v tem pomenu večkrat uporablja tudi pomensko širši izraz trajnost. Izraz sustainability se poleg tega v slovenščino večkrat prevaja tudi z izrazom trajnostni razvoj.\\nTrajnostnost je postal širok spekter, ki ga je mogoče opaziti pri skoraj vseh oblikah življenja na Zemlji, od lokalne do globalne razine in skozi različne vremenske pojave. Dolgoživeča in zdrava močvirja ter gozdovi so primeri uspešnih bioloških sistemov. Nevidni kemijski ciklusi so prerazporedili vodo, kisik, dušik in ogljik znotraj živih in neživih sistemov v svetu ter vzdrževali življenje že milijone let."},{"page_url":"https://da.wikipedia.org/wiki/Sayouba_Mand%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Mande_Sayouba.JPG","page_title":"Sayouba Mandé","context_page_description":"Sayouba Mandé er en ivoriansk fodboldmålmand, der i øjeblikket spiller for det danske Superligahold OB."},{"page_url":"https://sh.wikipedia.org/wiki/Krnjevo_(Makedonija)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/%D0%9A%D1%83%D1%9C%D0%B8_%D0%B2%D0%BE_%D0%9A%D1%80%D1%9A%D0%B5%D0%B2%D0%BE.jpg","page_title":"Krnjevo (Makedonija)","context_page_description":"Krnjevo je naselje u Republici Makedoniji, u južnom delu države. Krnjevo je naselje u okviru opštine Kavadarci."},{"page_url":"https://hu.wikipedia.org/wiki/Az_USA_114._kongresszusa_k%C3%A9pvisel%C5%91h%C3%A1zi_tagjainak_list%C3%A1ja","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Yvetteclarke.jpg","page_title":"Az USA 114. kongresszusa képviselőházi tagjainak listája","context_page_description":"Az Amerikai Egyesült Államok Kongresszusának képviselőháza 435 szavazati joggal rendelkező képviselőből, valamint 6 szavazati joggal nem rendelkező delegáltból áll. Az egyes államok képviselőinek számát a tíz évenként lebonyolított népszámlálás adatai, valamint az állam kiterjedése alapján határozzák meg. Ennek megfelelően a 114. kongresszusban Kaliforniának van a legtöbb, 53 képviselője, és mindössze egy képviselővel rendelkezik Alaszka, Delaware, Montana, Dél-Dakota, Észak-Dakota, Vermont, valamint Wyoming állam. A képviselőház tagjait minden páros év novemberében választják meg, mandátumukat a megválasztott képviselők január 3-án kezdik meg. A 114. kongresszus tagjait 2014. november 4-én választották meg, a következő kongresszus tagjainak megválasztására 2016. november 8-án, az elnökválasztással egy időben került sor.\\nA 114. kongresszus 2015. január 3-a 12:00-tól 2017. január 3-án 12:00-ig ülésezett. A képviselőház többségét ebben az időszakban a republikánusok adták. A képviselőház elnöke a republikánus Paul Ryan, aki John Boehnert 2015. október 29-én váltotta a házelnöki székben."},{"page_url":"https://de.wikipedia.org/wiki/Mitte_(Stadtbezirk_in_Hannover)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/dc/House_Gretchenstrasse_Rambergstrasse_westside_Oststadt_Hannover_Germany.jpg","page_title":"Mitte (Stadtbezirk in Hannover)","context_page_description":"Mitte ist der 1. Stadtbezirk in Hannover. Er hat 36.354 Einwohner und besteht aus den Stadtteilen Mitte, Calenberger Neustadt, Oststadt und Zoo."},{"page_url":"https://fr.wikipedia.org/wiki/Petar_Karpoch","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Spomenik_na_Karpo%C5%A1_vo_Skopje.JPG","page_title":"Petar Karpoch","context_page_description":"Petar Karpoch, mort en 1689, est un haïdouk, un héros bulgare et serbe qui a conduit une révolte contre les autorités ottomanes lors de la guerre austro-turque, qui a eu lieu de 1683 à 1699. Sa date de naissance et ses origines sont obscures même si certains auteurs voient en lui un Serbe de Bulgarie. En son honneur, son nom a été donné à de nombreuses places et rues en république de Bulgarie, ainsi qu'à une municipalité de Skopje, la capitale du pays."},{"page_url":"https://es.wikipedia.org/wiki/Myobatrachidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Paracrinia_haswelli.jpg","page_title":"Myobatrachidae","context_page_description":"Las ranitas australianas son un clado de anfibios anuros, cuyas especies habitan zonas tanto pantanosas como semiáridas, siendo no arbóreos. Son endémicas de Australia y Nueva Guinea y la isla de Tasmania. Se originaron a comienzos del período Cretácico, hace aproximadamente 100 millones de años. Son anuros generalmente pequeños con osificaciones reducidas, presentando, en la mayoría de las especies, algún tipo de cuidado parental.​ A su vez, gran parte de las especies de esta familia son terrestres o se asocian a hábitats húmedos. Myobatrachidae es el grupo hermano del grupo Limnodynastidae y Calyptocephalellidae."},{"page_url":"https://fr.wikipedia.org/wiki/Usines_de_La_Renaissance","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/ZA-La-Renaissance_-_plan.jpg","page_title":"Usines de La Renaissance","context_page_description":"Les Usines de La Renaissance sont des usines de fabrication pour l'agglomération de fines de houille pour les besoins du chemin de fer et la marine à vapeur situées aux limites de Abscon, Aniche et Somain. Créées en 1839 autour de trois nouvelles fosses, puis de logements, l'ensemble crée le hameau de La Renaissance.\\nAu XXᵉ siècle les usines sont déconstruites pour laisser place à la Zone d'Activité de La Renaissance et au XXIᵉ siècle au projet Cœur d'Europe."},{"page_url":"https://nl.wikipedia.org/wiki/Sicyopterus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Sicyopterus_japonicus.jpg","page_title":"Sicyopterus","context_page_description":"Sicyopterus is een geslacht van straalvinnige vissen uit de familie van grondels."},{"page_url":"https://sv.wikipedia.org/wiki/Turbinsn%C3%A4ckor","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Turbo_imperialis_01.jpg","page_title":"Turbinsnäckor","context_page_description":"Turbinsnäckor är en familj skalbärande och havslevande snäckor. Familjen är särskilt artrik i tropiska och varma tempererade grunda vatten. Många arter lever kring korallrev eller klipprev eller i intertidalzonen vid klippiga stränder. Typsläktet för familjen är Turbo."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%B8%D0%BB%D1%8C%D0%B4%D0%BE%D1%80%D1%84,_%D0%90%D0%B2%D0%B3%D1%83%D1%81%D1%82_%D0%AD%D0%BC%D0%B8%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Emil_Fieldorf_Nil_MBP_1950.jpg","page_title":"Фильдорф, Август Эмиль","context_page_description":"Август Эмиль Фильдорф — бригадный генерал Войска Польского."},{"page_url":"https://en.wikipedia.org/wiki/Miguel_Rodr%C3%ADguez_(table_tennis)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/RODRIGUEZ_Miguel_%28ESP%29.jpg","page_title":"Miguel Rodríguez (table tennis)","context_page_description":"Miguel Rodriguez is a Spanish table tennis player who competes in a wheelchair. He has been the Spanish national champion in the men's single championship in 2011, 2012 and 2012, and has been internationally ranked. He has represented Spain at the 2012 Summer Paralympics."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D0%B0%D1%8F_%D1%83%D1%82%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Gadwall_drake.jpg","page_title":"Серая утка","context_page_description":"Серая утка — широко распространённый вид семейства утиных. Гнездится в степных, лесостепных, отчасти лесных районах Евразии и Северной Америки. Обыватели довольно часто принимают этот вид за самку кряквы, шилохвости и других обычных северных уток, поскольку у самцов отсутствуют яркие, бросающиеся в глаза детали оперения. Между тем селезень в брачном наряде имеет характерные черты, по которым его нетрудно отличить от других видов.\\nВ гнездовой период селится вблизи небольших спокойных водоёмов, где держится на мелководье в тени надводной растительности. После появления на свет потомства перебирается на более крупные водоёмы с пространствами открытой воды. Зимой мигрирует на морские побережья к западу и югу от гнездового ареала. Преимущественно растительноядная утка, объём животных кормов незначителен и присутствует лишь в период размножения. Гнездится один раз в год, в кладке 6—10 яиц.\\nСерая утка — один из тех видов, на которые хозяйственная деятельность человека оказала благоприятное воздействие. В XIX—XX веках её ареал значительно расширился в северном направлении. Птицы также стали обычными в Западной Европе, где раньше о них известно не было."},{"page_url":"https://en.wikipedia.org/wiki/American_Treasure_Tour","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/1922_Stanley_Steamer.JPG","page_title":"American Treasure Tour","context_page_description":"The American Treasure Tour is a tourist attraction established in 2010 and opened to the public for guided tours. Visitors travel through a large private collection that encompasses an eclectic variety of smaller collections. Included is one of the world's largest private collections of automatic music machines: nickelodeons, band organs, calliopes, photoplayers and music boxes. There are also classic cars, circus art, dolls and dollhouses, and a large assortment of popular culture miscellania. It is located in the 422 Business Center in the community of Oaks, Pennsylvania, west of Valley Forge National Historical Park just off of U.S. Route 422."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Velp_(Noord-Brabant)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Velp_Rijksmonument_515536_De_Bonskazerne_keukengebouw.JPG","page_title":"Lijst van rijksmonumenten in Velp (Noord-Brabant)","context_page_description":"De plaats Velp (Noord-Brabant) telt 25 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://sl.wikipedia.org/wiki/Mehi%C5%A1ka_revolucija","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Pr%C3%A4sident_Victoriano_Huerta_von_Mexiko%2C_c._1914.png","page_title":"Mehiška revolucija","context_page_description":"Mehiška revolucija je bil oborožen spopad, ki se je začel v Mehiki 20. novembra 1910. Predhodnik konflikta je diktatura, znana pod imenom Porfiriato. Porfirio Díaz je v državi izvajal oblast na diktatorski način od 1876 do 1911. Med 35 leti je Mehika doživela izjemno gospodarsko rast in imela veliko politično stabilnost, vendar pa so bili ti dosežki doseženi z visokimi gospodarskimi in socialnimi stroški, ki so jih plačevali nižji sloje družbe in politični nasprotniki Díaza. V prvem desetletju dvajsetega stoletja je izbruhnilo več kriz na različnih področjih nacionalnega življenja, kar odraža naraščajoče nezadovoljstvo nekaterih sektorjev z Díazovo diktaturo.\\nKo je Díaz v intervjuju dejal, da se bo ob izteku mandata upokojil, so se politične razmere začele korenito spreminjati. Nasprotovanje vladi je postalo pomembno za stališče, ki ga je izrazil Díaz. V tem kontekstu je Francisco I. Madero izvedel več političnih turnej po državi, da bi oblikoval stranko, ki bi izvolila svoje kandidate na državnem zboru in bi sodelovala na volitvah. Díaz je kot odgovor sprožil novo kandidaturo za predsedstvo, Madero pa je bil aretiran v San Luis Potosí zaradi upora."},{"page_url":"https://fi.wikipedia.org/wiki/Ingvild_Stensland","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Ingvild_Stensland.jpg","page_title":"Ingvild Stensland","context_page_description":"Ingvild Stensland on norjalainen jalkapalloilija, pelipaikaltaan keskikenttäpelaaja. Hän on pelannut Norjan maajoukkueessa vuoden 2014 loppuun mennessä 137 maaottelua ja tehnyt niissä kymmenen maalia. Ensimmäisen naisten maaottelunsa hän pelasi tammikuussa 2003.\\nStensland on edustanut Norjaa MM-kilpailuissa 2007 ja 2011, olympialaisissa 2008 sekä EM-kilpailuissa 2005, 2009 ja 2013. Vuosien 2005 ja 2013 EM-kisoissa hän saavutti hopeamitalin.\\nSeuratasolla Stensland edustaa Stabækia."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%94%D0%B0%D1%80%D0%BB%D0%B8%D0%BD%D0%B3%D0%B5%D1%80%D0%BE%D0%B4%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/Wappen_Darlingerode.png","page_title":"Дарлингероде","context_page_description":"Дарлингероде — Германия Федеративтік Республикасының Саксония-Анхальт жерінде орналасқан муниципалитет. Вернигероде ауданының құрамына енеді.\\nМуниципалитеттің тұрақты тұрғындарының саны 2368 адамды құрайды. Алып жатқан жер аумағы 6,47 км² шамасында. Мемлекет ішінде бекітілген ресми коды — 15 0 85 080. Муниципалитеттің басшысы — Дитмар Бар."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%B8%E0%A7%81%E0%A6%B2%E0%A6%BE%E0%A6%87%E0%A6%AE%E0%A6%BE%E0%A6%A8_%E0%A6%86%E0%A6%AC%E0%A6%A6%E0%A7%81%E0%A6%B2_%E0%A6%86%E0%A6%9C%E0%A6%BF%E0%A6%9C_%E0%A6%86%E0%A6%B2_%E0%A6%B0%E0%A6%BE%E0%A6%9C%E0%A7%87%E0%A6%B9%E0%A7%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Sheikh_Sulaiman_AlRajhi.jpg","page_title":"সুলাইমান আবদুল আজিজ আল রাজেহী","context_page_description":"alt=Sulaiman Abdul Aziz Al Rajhi|থাম্ব| সুলায়মান আবদুল আজিজ আল রাজিশেখ সুলাইমান বিন আব্দুলাজিজ আল রাজেহী একজন সৌদি আরব শিল্পোদ্যাক্ত ও বিলিয়নিয়ার। ২০১১ সালের হিসাবে, তার সম্পদ ফোর্বস ম্যাগাজিন অনুমান করা হয়েছিল $ ৫.৯ বিলিয়ন, । তাকে বিশ্বের ১৬৯ তম ধনী ব্যক্তি হিসাবে বলা হয়েছে।\\nতিনি তার অর্ধেক সম্পাদক দানে উত্সর্গ, ইসলামী ব্যাংক শুরু, দাতব্য কাজের সমর্থন এবং কার্যকর জাতীয় প্রকল্পগুলি বাস্তবায়নের জন্য ২০১২ সালের কিং ফয়সাল আন্তর্জাতিক পুরস্কার পেয়েছিলেন।"},{"page_url":"https://en.wikipedia.org/wiki/St_Andrew%27s_Church,_Whitestaunton","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Whitestaunton_-_St_Andrews_church_-_geograph.org.uk_-_223373.jpg","page_title":"St Andrew's Church, Whitestaunton","context_page_description":"The Church of St Andrew in Whitestaunton, Somerset, England dates from the 13th century and has been designated as a Grade I listed building.\\nThe Perpendicular church is built of Hamstone. It contains a nave and porch which were added in the late 14th century and in the late 15th century it was refenestrated and the north and south chapels added. In the early 16th century the tower and chancel arch were rebuilt, the south chapel widened and the west door added. Further restoration followed in 1882-3 and 1913.\\nThe interior includes a Norman font.\\nIn 2012 an appeal was launched to repair the bellframe in the tower."},{"page_url":"https://pt.wikipedia.org/wiki/Mosteiro_de_Monfero","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/56/Festa3.JPG","page_title":"Mosteiro de Monfero","context_page_description":"O Mosteiro de Monfero é um mosteiro medieval localizado nas Fragas do Eume, a noroeste da Galiza, do qual se conserva ainda em bom estado a igreja, enquanto as dependências monacais estão em estado ruinoso."},{"page_url":"https://ceb.wikipedia.org/wiki/Galveston_Bay","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Galveston_Bay_Landsat.jpg","page_title":"Galveston Bay","context_page_description":"Luuk ang Galveston Bay sa Tinipong Bansa. Ang Galveston Bay nahimutang sa kondado sa Chambers County ug estado sa Texas, sa habagatan-sidlakang bahin sa nasod, 1,900 km sa habagatan-kasadpan sa ulohang dakbayan Washington, D.C. Naglangkob kin og 1,600 ka kilometro kwadrado.\\nAng klima kasarangan. Ang kasarangang giiniton 21 °C. Ang kinainitan nga bulan Hulyo, sa 28 °C, ug ang kinabugnawan Enero, sa 10 °C. Ang kasarangang pag-ulan 1,572 milimetro matag tuig. Ang kinabasaan nga bulan Septiyembre, sa 186 milimetro nga ulan, ug ang kinaugahan Nobiyembre, sa 94 milimetro."},{"page_url":"https://fr.wikipedia.org/wiki/Montescourt-Lizerolles","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Montescourt40.jpg","page_title":"Montescourt-Lizerolles","context_page_description":"Montescourt-Lizerolles est une commune française située dans le département de l'Aisne, en région Hauts-de-France.\\nMontescourt est un petit bourg qui a attiré habitants et commerces des alentours, dont poissonnerie, épicerie, droguerie et services."},{"page_url":"https://it.wikipedia.org/wiki/Armada_de_la_Rep%C3%BAblica_Argentina","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/AL-ARA.png","page_title":"Armada de la República Argentina","context_page_description":"La Armada de la República Argentina è la marina militare della Repubblica Argentina. Essa è una forza aeronavale dotata anche di contingenti di fanteria di marina, distribuita lungo la costa dell'Argentina, con importanti basi nel sud come quella di Puerto Belgrano e Ushuaia.\\nL'evento bellico più importante che ha visto coinvolta questa marina in tempi recenti è senz'altro la guerra delle Falkland, isole chiamate dagli argentini Malvine; le navi dell'Armada non poterono svolgere un ruolo di rilievo, ma i piloti dell'Aviación Naval diedero prova di preparazione e coraggio infliggendo sensibili perdite alla squadra navale britannica.\\nLa Armada si rese partecipe, durante il regime militare argentino del 1976-1983 di gravi crimini contro civili e presunti oppositori; l'ammiraglio Emilio Massera svolse un ruolo decisivo nella politica di annientamento e repressione di ogni opposizione reale o presunta perseguita dalla giunta al potere, mentre alcune strutture della marina, come l'ESMA, divennero centri di detenzione segreta, tortura ed eliminazione."},{"page_url":"https://en.wikipedia.org/wiki/List_of_cathedrals_in_Scotland","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Aberdeen%2C_St._Andrew%27s_Cathedral_-_geograph.org.uk_-_598057.jpg","page_title":"List of cathedrals in Scotland","context_page_description":"This is a list of cathedrals in Scotland.\\nA cathedral church is a Christian place of worship that is the chief, or 'mother' church of a diocese. The distinction of cathedral refers to that church being the location of the cathedra, the seat of the bishop. In the strictest sense, only Christian denominations with an episcopal hierarchy — those that are led by bishops — possess cathedrals. However in common parlance, the title cathedral is often still used to refer to former Scottish cathedrals, which are now within the Church of Scotland.\\nBecause of Scotland's religious history, cathedrals of several different Christian denominations are found around the country. Before the Scottish Reformation, the Christian church in Scotland was Catholic. Its thirteen dioceses were each governed by a bishop whose Episcopal see was centred on a cathedral. In 1560, the Scottish church broke communion with Rome and became Protestant. After years of dispute, the post-Reformation Church of Scotland finally abolished the Episcopacy in 1689 and adopted the Presbyterian system of governance."},{"page_url":"https://fr.wikipedia.org/wiki/Gianni_Moscon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Oudenaarde_-_Ronde_van_Vlaanderen_Beloften%2C_11_april_2015_%28E19%29.JPG","page_title":"Gianni Moscon","context_page_description":"Gianni Moscon, né le 20 avril 1994 à Trente, est un coureur cycliste italien, membre de l'équipe Ineos. Coureur complet, il est notamment champion d'Italie du contre-la-montre en 2017."},{"page_url":"https://my.wikipedia.org/wiki/%E1%80%A1%E1%80%AE%E1%80%9B%E1%80%94%E1%80%BA%E1%80%94%E1%80%AD%E1%80%AF%E1%80%84%E1%80%BA%E1%80%84%E1%80%B6%E1%80%9B%E1%80%BE%E1%80%AD_%E1%80%86%E1%80%80%E1%80%BA%E1%80%9E%E1%80%BD%E1%80%9A%E1%80%BA%E1%80%9B%E1%80%B1%E1%80%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Iran_internet_users_per_100_person.png","page_title":"အီရန်နိုင်ငံရှိ ဆက်သွယ်ရေး","context_page_description":"အီရန်ဆက်သွယ်ရေးစက်မှုလုပ်ငန်း အားလုံးနီးပါးသည် အစိုးရပိုင်များဖြစ်ပြီး အီရန်တယ်လီကွန်မြူနီကေး ကုပ္ပဏီမှကြီးစိုးထားလေသည်။ ၂၀၀၄ခုနှစ်တွင် တယ်လီဖုန်းလိုင်းပုံသေလိုင်း ဒေသစံချိန်စံညွှန်းများနှင့် ညီလျှော်စွာ အလွန်အမင်းတိုးတက်လာခဲ့သည်။ လူဦးရေ၁၀၀ တွင် ၂၂ ဦး တယ်လီဖုန်းလိုင်းပိုင်ဆိုင်ထားခဲ့သည်။ ထိုအချိန်ကာလတွင် အီဂျီစ်၌ လူ၁၀၀ဦးတွင် ဖုန်းပိုင်သူ၁၄ ဦးနှင့် ဆော်ဒီအာရေဗျတွင် လူ ၁၀၀ တွင် ဖုန်းပိုင်သူ ၁၅ ဦးသာရှိခဲ့သည်။သို့သော် ယူအေအီးနိုင်ငံများအတွင်း လူဦးရေ၁၀၀တွင် ၂၇ ဦးဖြစ်ပြီး အီရန်သည် ယူအေအီးနိုင်ငံများအနောက်တွင်ရှိခဲ့သည်။အီရန်သည် ၂၀၁၂ ခုနှစ်ထိ လူတိုင်း မိုဘိုင်းဖုန်းတစ်လုံးစီရှိထားခဲ့ကြသည်။.\\nအီရန်လူဦးရေသည် သန်း၈၀ နီးပါးရှိနေပြီး အီရန်ပြည်သူများအကြား ၅၆ ရာခိုင်နှုန်းသည် အသက်၂၅ နှစ်အရွယ် လူတန်းစားများဖြစ်ကြသည်။ ၂၀၀၈ ခုနှစ်တွင် အီရန်သည် ကျေးလက်ဒေသများအတွင်း ဝန်ဆောင်မှုပြုလုပ်ပေးသော ဌာနခွဲပေါင်း ၅၂၀၀၀ ကို ဖွင့်လှစ်ပေးခဲ့သည် ။ ကြိုးဖုန်း တယ်လီဖုန်းလိုင်း ၂၄ သန်းကျော်ရှိခဲ့ပြီး ၎င်းထိုးဖေါက်နိုင်မှုနှုန်းသည် ၃၃.၆၆ ရာခိုင်နှုန်းထိဖြစ်ခဲ့သည်။ ၂၀၁၂ ခုနှစ်တွင် အီရန်တွင် ၄၃ သန်း အင်တာနက်အသုံးပြုသူရှိခဲ့ပြီး အရှေ့အလယ်ပိုင်းနိုင်ငံများအတွင်း အီရန်သည် အင်တာနက်သုံးမှုအမြင့်ဆုံးနိုင်ငံဖြစ်ခဲ့သည်။"},{"page_url":"https://es.wikipedia.org/wiki/Esfera_de_Bernal","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Bernal_Sphere_3.jpeg","page_title":"Esfera de Bernal","context_page_description":"La esfera de Bernal es un tipo de hábitat en el espacio, previsto como hogar a largo plazo para residentes permanentes.\\nFue propuesto en 1929 por el científico John Desmond Bernal. Describió una esfera hueca de 16 kilómetros de diámetro, que podría albergar una población aproximada de 25.000 personas. En una serie de estudios, Gerard Kitchen O'Neill sostuvo en la Universidad Stanford, en 1975 y 1976, la defensa de los diseños para las colonias futuras del espacio.​\\nGerard Kitchen O'Neill propuso una esfera modificada de Bernal, con un diámetro de 500 m, que rotaría a 1,9 RPM para producir una gravedad como la de la Tierra en el ecuador de la esfera. El resultado sería un paisaje interior que se asemejaría a un valle grande que funcionaría alrededor del ecuador de la esfera. La luz del Sol entraría al interior de la esfera usando espejos externos para dirigirla a través de ventanas grandes cerca de los postes. La forma de una esfera fue elegida para obtener una presión de aire óptima y para que la masa proporcionase una defensa adecuada de la radiación exterior."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%AF%9B%E7%9B%96%E7%8C%AA%E7%AC%BC%E8%8D%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Nep_rajah_hybrid.jpg","page_title":"毛盖猪笼草","context_page_description":"毛蓋豬籠草是一種分布於蘇拉威西和婆羅洲的熱帶食蟲植物。其生長於海拔400公尺至2550公尺的地區。\\n其種加詞「tentaculata」來源於拉丁文「tentacula」，意為「觸鬚」，指其籠蓋上表面的附屬物。"},{"page_url":"https://en.wikipedia.org/wiki/Mors_(automobile)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fa/Mors_1925.jpg","page_title":"Mors (automobile)","context_page_description":"The Mors automobile factory was an early French car manufacturer. It was one of the first to take part in automobile racing, beginning in 1897, due to the belief of the company founder, Émile Mors, in racing's technical and promotional benefits. By the turn of the century, automobile racing had become largely a contest between Mors and Panhard et Levassor."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Tampere","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Tampere_railway_station2.jpg","page_title":"Gare de Tampere","context_page_description":"La gare de Tampere est une gare ferroviaire située dans le quartier de Kyttälä à Tampere en Finlande."},{"page_url":"https://hr.wikipedia.org/wiki/Urartski_jezik","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Urartian_inscription_in_Erebuni.jpg","page_title":"Urartski jezik","context_page_description":"Urartski jezik je uvriježen naziv za jezik koji se govorio na području drevne kraljevine Urartu oko jezera Van u danjašnoj Turskoj.\\nPrvi put je zabilježen u 9. stoljeću pr. Kr., a smanjuje se nakon pada države Urartu 585 pr. Kr. Nakon 500. pr. Kr. govorio ga je samo uzak krug ljudi."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Hanhofen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Hanhofen_-_Bildstock_Flur_Kerns%C3%A4cker.JPG","page_title":"Liste der Kulturdenkmäler in Hanhofen","context_page_description":"In der Liste der Kulturdenkmäler in Hanhofen sind alle Kulturdenkmäler der rheinland-pfälzischen Ortsgemeinde Hanhofen aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://hu.wikipedia.org/wiki/Annob%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Annobon_Island_Equatorial_Guinea.jpg","page_title":"Annobón","context_page_description":"Annobón vagy Pagalú egy Egyenlítői-Guineához tartozó kis vulkanikus sziget az Atlanti-óceán déli részén, egyben az ország hét tartományának egyike is. A tartomány fővárosa San Antonio de Palé."},{"page_url":"https://hu.wikipedia.org/wiki/Robi_(robot)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Robi_by_DeAGOSTINI.JPG","page_title":"Robi (robot)","context_page_description":"A Robi kétlábú emberszerű robot, amit Takahasi Tomotaka, a Robo-Garage elnök-vezérigazgatója tervezett. Robi alkatrészei a De Agostini kiadóvállalat Súkan Robi című magazinjában jelentek meg 2012. október 30. és 2014. július 29. között, hetven lapszámon keresztül. A robot átalakított változata, Kirobo Vakata Kóicsi japán űrhajóssal 2013. augusztus 4-én a Nemzetközi Űrállomásra utazott, ahol két Guinness-rekordot is felállított.\\nA robot népszerűsége miatt a magazinsorozatot kétszer újrakiadták, illetve Robit mintázó plüssfigurákat, malacperselyeket, kapszulajátékokat, műanyag játékfigurákat, illetve Robi jr. néven egy kisebb változatát is megjelentettek, illetve Ginzában még egy Robi témájú kávézót is nyitottak."},{"page_url":"https://vec.wikipedia.org/wiki/Pat%C3%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Pat%C3%B9.jpg","page_title":"Patù","context_page_description":"Patù el xe on comun n'te la provincia de Lece chel fa parte de la rejon Puja"},{"page_url":"https://pt.wikipedia.org/wiki/Fitoparasitismo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Viscum_minimum2_ies.jpg","page_title":"Fitoparasitismo","context_page_description":"Fitoparasitismo é um tipo de parasitismo no qual uma planta parasita obtém parte ou a totalidade das substâncias nutritivas de que necessita para o seu desenvolvimento parasitando uma ou mais plantas hospedeiras. Conhecem-se cerca de 4100 espécies com estas características, distribuídas por aproximadamente 270 géneros e 19 famílias de angiospermas. As plantas parasitas apresentam um tipo de raiz modificada, designada por haustório, que penetra nos tecidos da planta hospedeira e se liga com o seu xilema ou floema, ou com ambos. Nem todas as plantas desprovidas de clorofila são plantas parasitas, pois as plantas que parasitam fungos são designadas por micotróficas e as que se alimentam de matéria orgânica em decomposição são designadas por saprófitas. Em algumas situações o fitoparasitismo têm impacte sobre a flora local e pode conduzir a perdas económicas significativas em silvicultura e, menos frequentemente, em algumas culturas herbáceas."},{"page_url":"https://sv.wikipedia.org/wiki/The_Legend_of_Zelda:_The_Minish_Cap","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/The_Legend_of_Zelda_The_Minish_Cap.png","page_title":"The Legend of Zelda: The Minish Cap","context_page_description":"The Legend of Zelda: The Minish Cap är ett äventyrsspel till Game Boy Advance. Link, lever med sin farfar, som bara kallas farfar eller \\"The Great Blacksmith\\" av andra och ska gå till den årliga Picorifestivalen i Hyrule Town. Link får också ett svärd av sin farfar som han ska ge till kungen då den är priset i en svärdfäktningstävling. Vinnaren får även vidröra det heliga Picori-svärdet som är fäst i en kista fylld med ondska, som man skulle kunna likna vid Pandoras ask. Spelet hamnade på plats 20 i IGN:s lista Top 25 Game Boy Advance Games of All Time.Spelet var ett samarbete mellan Nintendo och Capcom. Dessa företag hade samarbetat tidigare med spel som The legend of Zelda Oracle of Seasons och The legend of Zelda Oracle of Ages på Game boy color"},{"page_url":"https://nl.wikipedia.org/wiki/Rizal_(Kalinga)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Ph_locator_kalinga_rizal.png","page_title":"Rizal (Kalinga)","context_page_description":"Rizal is een gemeente in de Filipijnse provincie Kalinga in het noordoosten van het eiland Luzon. Bij de laatste census in 2007 had de gemeente bijna 15 duizend inwoners."},{"page_url":"https://ceb.wikipedia.org/wiki/Calliana_pieridoides","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/CapilaPieridoidesSeitz.png","page_title":"Calliana pieridoides","context_page_description":"Espesye sa alibangbang ang Calliana pieridoides. Una ning gihulagway ni Moore ni adtong 1878. Ang Calliana pieridoides sakop sa kahenera nga Calliana sa kabanay nga Hesperiidae. Pagka karon wala pay siak nga nalista ubos niini niya."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%B7%D0%B0%D1%85%D1%81%D0%BA%D0%BE%D0%B5_%D1%88%D0%B5%D0%B6%D0%B8%D1%80%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/ru/2/2e/Shezhire.jpg","page_title":"Казахское шежире","context_page_description":"Казахское шежире — генеалогическая родословная у казахов. Как правило, представляет собой письменное или устное перечисление предков по прямой мужской линии.\\nБольшинство казахов может восстановить 10-25 колен предков в зависимости от рода. У чингизидов и ходжа возможна родословная, содержащая более 40 колен.\\nТакже распространён синонимический вариант шежире — Жети-Ата. Считается, что знание шежире является обязательным для каждого казаха. Знание казахами своего происхождения до седьмого поколения позволяет избегать близкородственных браков."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Schrotholzkirchen_in_Oberschlesien","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Ko%C5%9Bci%C3%B3%C5%82_Wniebowzi%C4%99cia_Naj%C5%9Bwi%C4%99tszej_Maryi_Panny_w_Uszycach_01.jpg","page_title":"Liste der Schrotholzkirchen in Oberschlesien","context_page_description":"Diese Liste führt die Schrotholzkirchen in Oberschlesien auf. Die meisten Schrotholzkirchen sind durch die Holzarchitekturroute – Szlak Architektury Drewnianej touristisch erschlossen. Diese Objekte sind in der Liste mit dem Link zur SAD-Nr. versehen."},{"page_url":"https://es.wikipedia.org/wiki/Belgrado","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Beogradjanka%2C_Belgrade%2C_Serbia.jpg","page_title":"Belgrado","context_page_description":"Belgrado es la capital de la República de Serbia, además de la ciudad más grande y poblada del territorio de la antigua Yugoslavia.\\nSituada en la confluencia del río Sava con el Danubio y en el límite de la Llanura Panónica con la península balcánica, Belgrado se extiende sobre una superficie de 3222,68 km², que ocupan el 3,6 % del territorio de la República. El área metropolitana alberga a una población de 1 756 534 habitantes​ que representa el 21 % de la población serbia, ​​ siendo por ello también la cuarta ciudad más poblada del sureste de Europa, después de Estambul, Atenas y Bucarest.\\nBelgrado dispone, de acuerdo a la Constitución serbia, de un estatus especial dentro de la organización territorial del país, por el que se articula la representación ciudadana mediante un sistema de gobierno autónomo dividido en varios cuerpos​ que son la Asamblea de la Ciudad, la Alcaldía y el Consejo, siendo cada uno de los 17 municipios en los que se divide administrado por un consejo propio.​\\nComo capital de Serbia, Belgrado es sede de los principales organismos e instituciones del Estado, así como de las universidades y establecimientos de investigación más importantes."},{"page_url":"https://en.wikipedia.org/wiki/Fort_Lane_(Oregon)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Fort_Lane_sketch.jpg","page_title":"Fort Lane (Oregon)","context_page_description":"Fort Lane Military Post was a U.S. Army fort in Jackson County in southern Oregon built in the fall of 1853. The Fort was occupied by several companies of the 1st Regiment of U.S. Dragoons during the Rogue River War. Its site was listed on the National Register of Historic Places in 1988."},{"page_url":"https://en.wikipedia.org/wiki/Pythia_cecillei","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Okihirashiinomi0903.jpg","page_title":"Pythia cecillei","context_page_description":"Pythia cecillei is a species of small air-breathing salt marsh snail, a pulmonate gastropod mollusk in the family Ellobiidae.\\nThe specific name cecillei is in honor of the French admiral Jean-Baptiste Cécille."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Innenstadt_(G%C3%B6rlitz),_L%E2%80%93Q","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/G%C3%B6rlitz_-_Lutherplatz_03_ies.jpg","page_title":"Liste der Kulturdenkmale in Innenstadt (Görlitz), L–Q","context_page_description":"In der Liste der Kulturdenkmale in Innenstadt (Görlitz), L–Q sind sämtliche Kulturdenkmale der Görlitzer Innenstadt verzeichnet, die bis Oktober 2017 vom Landesamt für Denkmalpflege Sachsen erfasst wurden und deren Straßenname mit den entsprechenden Anfangsbuchstaben beginnt. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Görlitz."},{"page_url":"https://ca.wikipedia.org/wiki/Campionat_Mundial_de_Ral%C2%B7lis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Mikko_Hirvonen_-_2007_Rally_Catalunya.jpg","page_title":"Campionat Mundial de Ral·lis","context_page_description":"El Campionat Mundial de Ral·lis és una competició de ral·lis organitzada per la Federació Internacional d'Automobilisme que acaba amb el nomenament d'un conductor i d'un constructor campions. Els campionats de conductors i constructors són campionats separats, però tenen el mateix sistema de puntuació. Això significa que, per exemple, un conductor pot guanyar el campionat de conductors mentre que el constructor del seu automòbil pot no fer-ho.\\nLa competició va rebre el nom de Campionat Mundial de Ral·lis el 1973. Des del 1982 fins al 1986, el campionat va estar protagonitzat per la categoria Grup B, la qual va acabar essent cancel·lada a causa dels greus accidents que s'hi produïen."},{"page_url":"https://pl.wikipedia.org/wiki/Martew","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Our_Lady_of_the_Rosary_church_in_Martew_%282%29.jpg","page_title":"Martew","context_page_description":"Martew – wieś w Polsce położona w województwie zachodniopomorskim, w powiecie wałeckim, w gminie Tuczno.\\nOk. 1 km na północny wschód od wsi znajduje się jezioro Tuczno.\\nW latach 1975–1998 miejscowość administracyjnie należała do województwa pilskiego."},{"page_url":"https://eo.wikipedia.org/wiki/Ulvenhout","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/P1010724De_Korenbloem_Ulvenhout.JPG","page_title":"Ulvenhout","context_page_description":"Ulvenhout estas vilaĝo en la municipoj Breda kaj Alphen-Chaam, en la nederlanda provinco Nord-Brabanto. Ĝi situas unu kilometro sudoriente de la urbo Breda, limante je la aŭtovojo A58. Ulvenhout havis en 2017 4 790 loĝantojn en la municipo Breda kaj 430 en la municipo Alphen-Chaam. La centro de Ulvenhout apartenas al la municipo Breda.\\nLa centro konsistas el la ĉefstrato kun diversaj butikoj. Ĵaŭdoposttagmeze estas foiro sur la vilaĝoplaco."},{"page_url":"https://fr.wikipedia.org/wiki/M%C3%A9rouville","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/M%C3%A9rouville_mairie_Eure-et-Loir_France.jpg","page_title":"Mérouville","context_page_description":"Mérouville est une commune française située dans le département d'Eure-et-Loir en région Centre-Val de Loire."},{"page_url":"https://eo.wikipedia.org/wiki/Kastelo_de_Sereg%C3%A9lyes","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Kast%C3%A9lyerd%C5%91%2C_Sereg%C3%A9lyes_01.jpg","page_title":"Kastelo de Seregélyes","context_page_description":"La Kastelo de Seregélyes estas impona historia monumento en Hungario, en Seregélyes."},{"page_url":"https://de.wikipedia.org/wiki/Roxburgh_Dam","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Roxburgh_spillway.jpg","page_title":"Roxburgh Dam","context_page_description":"Der Roxburgh Dam ist ein Staudamm in der Region Otago auf der Südinsel von Neuseeland, der den Clutha River in der Nähe der Gemeinde Roxburgh zum Lake Roxburgh aufstaut. Der Damm, zusammen mit dem Wasserkraftwerk zur Stromerzeugung errichtet, wurde 1956 fertiggestellt und war das größte Bauprojekt, das Neuseeland bis dahin bewältigt hatte."},{"page_url":"https://en.wikipedia.org/wiki/Snub_tetraheptagonal_tiling","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Spherical_tetragonal_trapezohedron.png","page_title":"Snub tetraheptagonal tiling","context_page_description":"In geometry, the snub tetraheptagonal tiling is a uniform tiling of the hyperbolic plane. It has Schläfli symbol of sr{7,4}."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%AF%B8%EB%8B%88%EC%8A%A4%ED%86%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/MINISTOP_Ibaraki-Masago.JPG","page_title":"미니스톱","context_page_description":"미니스톱은 일본의 유통업 기업인 AEON 그룹의 체인형 편의점 브랜드이다. 대한민국에서는 1990년 11월 대한민국 미니스톱 1호점을 열었다. 이외에도 중국, 필리핀, 베트남 등지에 미니스톱 점포가 있다."},{"page_url":"https://fr.wikipedia.org/wiki/La_Vieille-Loye","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Verrerie_Vieille-Loye_Souffleur_et_four_%C3%A0_recuite.jpg","page_title":"La Vieille-Loye","context_page_description":"La Vieille-Loye est une commune française située dans le département du Jura en région Bourgogne-Franche-Comté.\\nElle fait partie de la communauté de communes du Val d'Amour. Les citoyens de La Vieille-Loye sont nommés les Vieilogiens et les Vieilogiennes."},{"page_url":"https://de.wikipedia.org/wiki/Patchwork","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Patchwork.jpg","page_title":"Patchwork","context_page_description":"Patchwork bzw. Flickwerk ist eine Form der Textiltechnik, bei der Reste verschiedener Materialien verwendet werden, um neue Textilien anzufertigen."},{"page_url":"https://de.wikipedia.org/wiki/Kirche_Handewitt","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Handewitt_1105.jpg","page_title":"Kirche Handewitt","context_page_description":"Die Kirche Handewitt ist eine evangelisch-lutherische Kirche in Handewitt. Der Kirchenbau aus dem Jahr 1884, mit Bestandteilen eines älteren Vorgängerbaus, ist eines der Kulturdenkmale Handewitts. Teile der Kirchenausstattung sowie des umliegenden Kirchhofes wurden als Bestandteil des Kulturdenkmales mit eingetragen."},{"page_url":"https://de.wikipedia.org/wiki/T-43","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Tank_T-43.jpg","page_title":"T-43","context_page_description":"Der T-43 war ein Prototyp eines mittleren Panzers der Roten Armee aus den Jahren 1942/43."},{"page_url":"https://en.wikipedia.org/wiki/Biola_University","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Biola_University_Lecture_Hall.JPG","page_title":"Biola University","context_page_description":"Biola University is a private evangelical Christian university in La Mirada, California. Founded in 1908 in Los Angeles, the university has over 150 programs of study in nine schools."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%B8%8A%E3%83%8A%E3%82%A4%E3%83%AB%E5%B7%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Flag_of_Upper_Nile_State.png","page_title":"上ナイル州","context_page_description":"上ナイル州は、南スーダンの州。州都はマラカル。"},{"page_url":"https://de.wikipedia.org/wiki/Frederick_George_Donnan","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Donnan_FG.jpg","page_title":"Frederick George Donnan","context_page_description":"Frederick George Donnan war ein britischer Chemiker.\\nEr studierte ab 1889 Chemie und Physik am Queen's College in Belfast. 1893 ging er zu einem Arbeitsaufenthalt bei Johannes Wislicenus an der Universität Leipzig. 1896 wurde er bei Wilhelm Ostwald mit dem Thema Versuche über die Beziehung zwischen der elektrolytischen Dissociation und der Lichtabsorption in Lösungen zum Dr. phil. promoviert. 1896 bis 1897 war er Mitarbeiter von Jacobus Henricus van ’t Hoff in Berlin, ab 1898 bei William Ramsay am University College London.\\nDonnan wurde 1903 Dozent für organische Chemie am Royal College of Science in Dublin; ab 1904 war er Professor für physikalische Chemie an der University of Liverpool. Von 1906 bis 1913 war er Direktor des dortigen Muspratt-Laboratoriums, von 1913 bis 1937 war er Professor für Chemie am University College London.\\nEr gilt als Mitbegründer der physikalischen Chemie in England und lieferte bedeutende Beiträge zur Kolloidchemie, über osmotische Vorgänge und die Theorie der Lösungen.\\n1911 beschrieb er das Donnan-Gleichgewicht."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%84%B8%EB%B0%94%EC%8A%A4%ED%8B%B0%EC%95%B5_%EB%93%9C_%EB%A7%88%EC%9D%B4%EC%98%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Rostov-Anderleht_%289%29.jpg","page_title":"세바스티앵 드 마이오","context_page_description":"세바스티앵 드 마이오는 현재 세리에 A 우디네세에서 중앙 수비수로 뛰는 이탈리아계 프랑스의 축구선수이다."},{"page_url":"https://nl.wikipedia.org/wiki/Tibetaanse_cultuur","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Tibetan_censer_Asian_Art_Museum_SF.JPG","page_title":"Tibetaanse cultuur","context_page_description":"Tibetaanse cultuur verwijst naar cultuur die voortkomt uit de regio Tibet, inclusief omliggende streken in het Himalayagebergte. Deze blijft sinds de jaren vijftig van de 20e eeuw ook bewaard in de Tibetaanse diaspora.\\nDe Tibetaanse cultuur heeft zich ontwikkeld binnen de specifieke geografische en klimatologische omstandigheden van Tibet, zoals de grote hoogte, korte vegetatieperiode en koude temperatuur.\\nHoewel de cultuur in Tibet invloeden heeft ondergaan van de omliggende regio's in India, China en Mongolië, heeft er zich door de afgelegenheid en ontoegankelijkheid een duidelijk onderscheiden lokale cultuur opgebouwd. Van grote invloed is de introductie van het Tibetaans boeddhisme geweest aan het eind van het 1e millennium, dat doorwerkt in de kunst, literatuur en muziek. Een andere belangrijke factor van invloed was de traditionele bönreligie. Verder is er in Tibet altijd sprake geweest van een omvangrijke nomadencultuur."},{"page_url":"https://pl.wikipedia.org/wiki/Desnes","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/DesnesUrbodomo.JPG","page_title":"Desnes","context_page_description":"Desnes – miejscowość i gmina we Francji, w regionie Burgundia-Franche-Comté, w departamencie Jura.\\nWedług danych na rok 1990 gminę zamieszkiwało 367 osób, a gęstość zaludnienia wynosiła 41 osób/km²."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%AF%CE%BB%CE%BF%CF%81%CE%B1%CE%BD%CF%84_%CE%9D%CF%84%CF%8C%CE%BD%CF%84%CE%B9%CE%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Milorad_Dodik_mod_cropped.jpg","page_title":"Μίλοραντ Ντόντικ","context_page_description":"Ο Μίλοραντ Ντόντικ είναι Σερβοβόσνιος πολιτικός. Υπηρέτησε από το 2010 ως το 2018 ως πρόεδρος της Σερβικής Δημοκρατίας, της μίας από τις δύο οντότητες που απαρτίζουν τη Βοσνία και Ερζεγοβίνη και πρόεδρος του κόμματος Συμμαχία των Ανεξάρτητων Σοσιαλιστών Δημοκρατών. Ο Ντόντικ αποφοίτησε από το τμήμα Πολιτικών Επιστημών του Πανεπιστημίου του Βελιγραδίου. Είναι παντρεμένος και έχει δύο παιδιά. Στις εκλογές του 2018 εξελέγη το μέλος από τη Σερβία στην Προεδρία της Βοσνίας και Ερζεγοβίνης, επικρατώντας του απερχόμενου προέδρου Μλάντεν Ιβάνιτς. Ορκίστηκε πρόεδρος στις 20 Νοεμβρίου 2018."},{"page_url":"https://jv.wikipedia.org/wiki/Pasisir_Bama","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Pesisir_Bama.jpg","page_title":"Pasisir Bama","context_page_description":"Pesisir Bama kuwi salah siji jujugan plesiran ing kawasan Taman Nasional Baluran ing Situbondo, Banyuwangi, Jawa Timur. Pesisir Bama duwé pasir putih lan ombak sing relatif kalem lan ing tlatah pasisir sing ora banget rame diubengi akèh wit rerimbuan. Pesisir Bama duwé tlatah sing isih alami. Ing Pesisir Bama akèh kéwan alasan kaya ta cecak, kethèk lan warna-warna jinis manuk."},{"page_url":"https://es.wikipedia.org/wiki/Calle_La_Estaci%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Miranda_de_Ebro_-_Caja_Circulo.jpg","page_title":"Calle La Estación","context_page_description":"La calle La Estación es una de las principales calles de la ciudad de Miranda de Ebro, en España. Es el centro comercial y financiero de la localidad, sede de numerosos comercios, instituciones públicas y entidades bancarias."},{"page_url":"https://eu.wikipedia.org/wiki/A%C3%B1anako_Gatz_Harana","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Fundacion_Valle_Salado509.JPG","page_title":"Añanako Gatz Harana","context_page_description":"Añanako Gatz Harana Arabako Añana udalerrian dagoen haran txiki irregular bat da, goragune txikiak dituena, ondare-balioa duten hainbat elementu biltzen dituena; bereziki, gatzaga bat. Elementu horiek guztiak gatzarekin lotuta daude, eta gatz-iturburuei eta ondorengo gatz-ustiaketari esker sortu dira. Barnealdeko gatzaga da, plano triangeluarreko haran estu baten hondoko 120.000 m² hartzen dituena. Haranaren alderik garaienean dauden lau iturburutako ur gazia erabiltzen da gatza ekoizteko. Horretarako, gatzuna larrainetaraino garraiatzen da. Plataforma horietan, jalkitzen uzten da, eguzkiaren eta haizearen eraginez ura lurrundu dadin eta, hala, gatza atera dadin.\\nGatz-ustiaketa IX. mendetik dokumentatua dago, eta, XX. mendearen erdialdean gainbehera-prozesu azkar bat izan ondoren, 2000. urtean erakundeek sustatutako plan zuzentzaile bat abiarazi zen, gatzaga modu integralean berreskuratzeko xedez. Hala, gatz-fabrika zaharra produktu turistiko eta gastronomiko garrantzitsu bihurtu da, 2010etik aurrera gatza komertzializatzen hasi baita, irabazi-asmorik gabe."},{"page_url":"https://vi.wikipedia.org/wiki/Cellana_eucosmia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Cellana_eucosmia_01.JPG","page_title":"Cellana eucosmia","context_page_description":"Cellana eucosmia là một loài ốc biển săn mồi, là động vật thân mềm chân bụng sống ở biển trong họ Naticidae, họ ốc mặt trăng."},{"page_url":"https://fr.wikipedia.org/wiki/Pabu","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Chateau_Runevarec_Pabu.jpg","page_title":"Pabu","context_page_description":"Pabu [paby] est une commune française située dans le département des Côtes-d'Armor, en région Bretagne."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B3%A2%E8%98%AD%E6%B5%B7%E8%BB%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Gen._T._Ko%C5%9Bciuszko.jpg","page_title":"波蘭海軍","context_page_description":"波兰海军是波兰共和国的海上力量，波文写法是ORP 。目前有94艘舰只，主要武力为：五艘潜舰：其中一艘基洛级、四艘柯本级，两艘美国赠予的派里级巡防舰， 三艘轻型巡防舰，一艘卡兹布级和两艘毒蜘蛛级，三艘奥坎级高速战斗艇，另外波兰海军曾提出建造MEKO级为基础的加夫龙级巡防舰，但只建成一艘的船壳，最后改成了巡逻舰。下属组织为第三舰队、第八岸防舰队和第一海军航空旅。定员为一万四千人。"},{"page_url":"https://sv.wikipedia.org/wiki/Nordahl_Grieg","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Nordahl_Grieg.jpg","page_title":"Nordahl Grieg","context_page_description":"Johan Nordahl Brun Grieg, född 1 november 1902 i Bergen i Norge, död 2 december 1943 i Berlin i Tyskland, var en norsk författare, dramatiker, journalist och politisk aktivist. Han dog genom att hans flygplan sköts ner över Berlin."},{"page_url":"https://gl.wikipedia.org/wiki/Fagocitose","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Phagocytosis_in_three_steps.png","page_title":"Fagocitose","context_page_description":"A fagocitose é o proceso celular consistente en englobar e incorporar partículas sólidas realizado por fagocitos e certos protistas, formando un vacúolo interno chamado fagosoma. A fagocitose é unha forma específica de endocitose, que implica a internalización en vesículas de partículas sólidas, como, por exemplo, bacterias. A fagocitose está implicada na adquisición de nutrientes por algunhas células, e, no sistema inmunitario, é o principal mecanismo para eliminar patóxenos e refugallos celulares. As bacterias, células mortas dos tecidos, e pequenas partículas minerais son exemplos de obxectos que poden ser fagocitados.\\nO proceso só é homólogo con alimentarse para certos organismos unicelulares; nos animais pluricelulares, o proceso utilízase para a eliminación de refugallos e patóxenos, xa que neses organismos o alimento chégalle ás células en forma de moléculas pequenas disoltas."},{"page_url":"https://fr.wikipedia.org/wiki/Rue_Bleue_(Paris)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Paris_rue_bleue.jpg","page_title":"Rue Bleue (Paris)","context_page_description":"La rue Bleue est une voie du quartier du Faubourg-Montmartre, un des quatre quartiers administratifs du 9ᵉ arrondissement de Paris, en France."},{"page_url":"https://arz.wikipedia.org/wiki/%DA%86%D8%A7%DA%A4%D9%8A%D8%B1_%D8%B3%D8%A7%D9%86%D8%AA%D8%B4%D9%8A%D8%B2_%D8%B3%D9%8A%D8%B1%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Javier_S%C3%A1nchez_2018_%28cropped%29.jpeg","page_title":"چاڤير سانتشيز سيرنا","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nچاڤير سانتشيز سيرنا سياسى من اسبانيا."},{"page_url":"https://es.wikipedia.org/wiki/Estado_de_Potos%C3%AD_de_Tarapac%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Potosi_de_Tarapaca_Provincias.png","page_title":"Estado de Potosí de Tarapacá","context_page_description":"El Estado de Potosí de Tarapacá o Estado de Tarapotosí fue un proyecto de Estado Federal, conformado por el Departamento de Potosí y el Departamento de Tarapacá, dentro del proyecto unionista de los Estados Unidos Perú-Bolivianos que llegó a la etapa legislativa durante la Guerra del Pacífico pero que no se logró concretar."},{"page_url":"https://en.wikipedia.org/wiki/CDR2_(gene)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/PBB_GE_CDR2_209501_at_fs.png","page_title":"CDR2 (gene)","context_page_description":"Cerebellar degeneration-related protein 2 is a protein that in humans is encoded by the CDR2 gene."},{"page_url":"https://et.wikipedia.org/wiki/Rados%C5%82aw_Wojtaszek","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Wojtaszek_Radoslaw.jpg","page_title":"Radosław Wojtaszek","context_page_description":"Radosław Wojtaszek on poola maletaja, rahvusvaheline suurmeister.\\nWojtaszek sai suurmeistriks 18-aastaselt 2005. aastal. Kaks aastat varem oli ta FIDE-lt saanud rahvusvahelise meistri nimetuse. Ta on tulnud kolmel korral Poola malemeistriks.\\nTa on mänginud Poola võistkonna koosseisus viiel maleolümpial.\\n2015. aastal abiellus Wojtaszek naiste malesuurmeistri Alina Kašlinskajaga."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%85%B3%E4%BA%8E%E6%B0%94%E5%80%99%E5%8F%98%E5%8C%96%E7%9A%84%E7%A7%91%E5%AD%A6%E8%A7%82%E7%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/97%25_of_Climate_Scientists_Confirm_Anthroprogenic_Global_Warming.svg","page_title":"关于气候变化的科学观点","context_page_description":"关于气候变化的科学观点是科学家们对关于“全球变暖与气候变迁是否正在发生，如果发生，其原因和可能的后果”等议题的总体看法。这种科学的意见是通过国家性或国际性科学机构的综合报告和对气候科学家的意见调查来体现的。科学家个人，大学和实验室通过同行评审的出版物来贡献于这个整体的科学意见，达成共识和相对确定的部分被总结在高层次的综合报告和调查中。\\n当前的科学共识认为，地球气候系统是明确地变暖，而且“极有可能的”是，人类活动增加了大气中温室气体的浓度，从而导致大部分的变暖。此外，有可能的是，增加的气溶胶已经抵消了一些潜在的更进一步的温室气体造成的变暖。\\n国家性和国际性的科学院和科学协会已评估了当前有关全球变暖的科学意见。这些评估与政府间气候变化专门委员会的结论基本一致。IPCC第四次评估报告总结如下：\\n气候系统变暖是明确的。全球平均气温和海洋温度上升，冰雪大面积融化，全球平均海平面不断上升，这些都是证据。\\n大多数自20世纪中期以来的大部分全球变暖很可能是人类活动造成的。\\n气候变化对人类社会的成本和效益将随地点和范围的不同而变化很大。一些温带和极地地区的影响将是积极的，在其他地方的影响则将是负面的。总体而言，强烈或快速的升温的净效果更可能是十分负面的。\\n已发表的证据的广度表明，气候变化的净损害成本可能是显著的并随着时间增加。\\n在21世纪，一种前所未有的综合变化将可能超过许多生态系统的恢复能力。这种综合变化包括了气候变化，及其相关扰动和其它全球变化驱动力。\\n一些科研团体已经向政府建议了一些具体政策。他们还建议，科学可以为有效应对气候变化提供信息。但政策决定可能需要价值判断，因此不包括在科学意见中。\\n没有国家性或国际性科学团体持有不同于上面这些主流观点的正式意见。最后一个撤销不同于主流的观点的国家性或国际性的科学团体是美国石油地质学家协会。 他们在2007年更新了对气候变化的声明，改变了原先对气候变化不置可否的意见。其他一些组织也曾经持有这种不置可否的意见。"},{"page_url":"https://it.wikipedia.org/wiki/St._Albans_(town)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/StATownHall.JPG","page_title":"St. Albans (town)","context_page_description":"St. Albans è un comune degli Stati Uniti d'America, situato nello Stato del Vermont e in particolare nella contea di Franklin."},{"page_url":"https://en.wikipedia.org/wiki/Papago_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Tempe-Sandra_Day_O%27Connor%27s_House-1959.jpg","page_title":"Papago Park","context_page_description":"Papago Park is a municipal park of the cities of Phoenix and Tempe, Arizona, United States. It has been designated as a Phoenix Point of Pride.\\nIt includes Hunt's Tomb, which is listed on the National Register of Historic Places."},{"page_url":"https://en.wikipedia.org/wiki/Lieutenant_general","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/21_-_Tenente-general.png","page_title":"Lieutenant general","context_page_description":"Lieutenant general or lieutenant-general is a three-star military rank used in many countries. The rank traces its origins to the Middle Ages, where the title of lieutenant general was held by the second in command on the battlefield, who was normally subordinate to a captain general.\\nIn modern armies, lieutenant general normally ranks immediately below general and above major general; it is equivalent to the navy rank of vice admiral, and in air forces with a separate rank structure, it is equivalent to air marshal. A lieutenant general commands an army corps, made up of typically three army divisions, and consisting of around 60,000–70,000 soldiers.\\nThe seeming incongruity that a lieutenant general outranks a major general is due to the derivation of the former rank from sergeant major general, which was also subordinate to lieutenant general. In some countries, the ranks of corps general or lieutenant colonel general are used instead of lieutenant general, in an attempt to solve this apparent anomaly – these ranks are often translated into English as lieutenant general."},{"page_url":"https://vi.wikipedia.org/wiki/Draco_quadrasi","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Draco_quadrasi_distribution.png","page_title":"Draco quadrasi","context_page_description":"Draco quadrasi là một loài thằn lằn trong họ Agamidae. Loài này được Boettger mô tả khoa học đầu tiên năm 1893."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%98%D1%81%D1%82%D0%BE%D1%80%D0%B8%D1%98%D0%B0_%D0%9D%D0%BE%D0%B2%D0%BE%D0%B3_%D0%91%D0%B5%D0%BE%D0%B3%D1%80%D0%B0%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Predsedni%C5%A1tvo_Vlade_-_druga_polovina_1948.jpg","page_title":"Историја Новог Београда","context_page_description":"У Крушевском поменику од 1713. године записано је да је село Бежанија постојало још за време турске владавине. Најстарији документи бележе да је у то време садашња Бежанија, односно територија општине Нови Београд, имала 32 дома, да би 1810. године имала 115 домова. у XVIII веку насеље је било искључиво српско, а после одласка Турака, за време Аустроугарске, насељавају се и друге националности: Немци, Мађари и Хрвати. Док су Турци још увек били у Београду, на левој страни Саве је била подигнута караула, зграда на спрат названа \\"Мртва стража\\", а незванично \\"Бурма\\", срушена крајем XIX века. Између два светска рата, територија садашње општине Нови Београд, се све више насељавала, тако да поред села Бежаније, ничу Ново насеље и Старо сајмиште. Пошто су ова насеља била углавном радничка, мења се и национални састав на овом подручју."},{"page_url":"https://it.wikipedia.org/wiki/Nus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/L%27%C3%A9glise_de_Messign%C3%A9_Nus_AO.JPG","page_title":"Nus","context_page_description":"Nus è un comune italiano di 2 964 abitanti della Valle d'Aosta."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%BE%D0%B1%D1%96%D1%82%D0%B0%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Bobital_%2822%29_Mairie.JPG","page_title":"Бобіталь","context_page_description":"Бобіта́ль — муніципалітет у Франції, у регіоні Бретань, департамент Кот-д'Армор. Населення — 1048 осіб.\\nМуніципалітет розташований на відстані близько 340 км на захід від Парижа, 50 км на північний захід від Ренна, 55 км на схід від Сен-Бріє."},{"page_url":"https://en.wikipedia.org/wiki/Parliament_Hill_Rehabilitation","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/West_Block_North_Towers.JPG","page_title":"Parliament Hill Rehabilitation","context_page_description":"The Parliament Hill Rehabilitation is a series of ongoing rehabilitation and preservation projects at the complex on Parliament Hill, in Ottawa, Ontario. The $3-billion project aims to preserve and rehabilitate the Parliament of Canada and various buildings within the Parliamentary Precinct.\\nA series of interior renovations began in 2002 by the Public Works and Government Services Canada at the direction of the National Capital Commission, and is concentrated on the Centre Block, West Block, and East Block, Library of Parliament, Confederation Building, and the Justice Building."},{"page_url":"https://en.wikipedia.org/wiki/South_African_type_SK_tender","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Type_SK_drawing.jpg","page_title":"South African type SK tender","context_page_description":"The South African type SK tender was a steam locomotive tender.\\nType SK tenders were rebuilt from Type SH tenders which had entered service in 1904 and 1905. The rebuilding resulted in a tender with a larger water tank and larger coal bunker."},{"page_url":"https://en.wikipedia.org/wiki/2007_Formula_One_World_Championship","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Nick_Heidfeld_2007_Britain_2.jpg","page_title":"2007 Formula One World Championship","context_page_description":"The 2007 FIA Formula One World Championship was the 61st season of FIA Formula One motor racing. It featured the 2007 FIA Formula One World Championship, which began on 18 March and ended on 21 October after seventeen events. The Drivers' Championship was won by Ferrari driver Kimi Räikkönen by one point at the final race of the season, making Räikkönen the third Finnish driver to take the title. An appeal by McLaren regarding the legality of some cars in the final race could have altered the championship standings, but on 16 November, the appeal was rejected by the International Court of Appeal, confirming the championship results. Räikkönen entered the final race in third position in the drivers' standings, but emerged as champion after the chequered flag, a feat first accomplished by Giuseppe Farina in 1950. It has since been accomplished again, by Sebastian Vettel, in 2010.\\nA major talking point of the season had been an espionage controversy involving Ferrari and McLaren, which led to McLaren being excluded from the Constructors' Championship. As a result, Ferrari clinched the championship at the Belgian Grand Prix."},{"page_url":"https://bs.wikipedia.org/wiki/Evropsko_prvenstvo_u_nogometu_1988.","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Volksparkstadion_Panorama.jpg","page_title":"Evropsko prvenstvo u nogometu 1988.","context_page_description":"Evropsko prvenstvo u nogometu 1988. je bilo osmo po redu Evropsko prvenstvo u nogometu koje se održalo u Zapadnoj Njemačkoj. Finalni turnir se odigrao između 10. i 25. juna na kojem je učestvovalo osam reprezentacija. Holandija je u finalnoj utakmici bila uspješnija od Sovjetskog saveza rezultatom 2-0 te prvi put u svojoj historiji osvojila šampionsku titulu. Golove u finalu su postigli Ruud Gullit u 32. i Marco van Basten u 54. minuti utakmice. Utakmica je odigrana pred 72.308 gledalaca na Olimpijskom stadionu u Münchenu. Glavni sudija utakmice je bio Michel Vautrot. Najbolji strijelac prvenstva je bio Marco van Basten sa pet postignutih golova."},{"page_url":"https://it.wikipedia.org/wiki/Settimana_santa_di_Piana_degli_Albanesi","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Pasqua_Bandiere_Comune_Piana_degli_Albanesi.jpg","page_title":"Settimana santa di Piana degli Albanesi","context_page_description":"La Settimana Santa di Piana degli Albanesi, anche Java e Madhe dhe e Shejte, ovvero la Grande e Santa Settimana, comprende una serie di celebrazioni che si svolgono nella cittadina omonima - in modo particolare nella cattedrale di San Demetrio Megalomartire - durante la Settimana Santa, secondo il rito bizantino degli italo-albanesi.\\nLa Pasqua Albanese di Sicilia e i Riti della Grande e Santa Settimana di Piana degli Albanesi, per la complessità dei riti, la sontuosità e la raffinatezza dei paramenti sacri e degli abiti femminili, le manifestazioni folcloristiche, costituisce la ricorrenza centrale della comunità albanese dell'isola, dalla cui data dipendono le altre feste; occasione in cui ogni arbëreshë ritrova le proprie radici, consapevole del valore del patrimonio religioso e culturale della comunità d'appartenenza. Rappresenta la festa delle feste, i quali riti della Passione, della morte e della Resurrezione di Gesù vengono vissuti secondo la ricca simbologia orientale."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Reit_im_Winkl","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Reit_im_Winkl%2C_Brunnenstra%C3%9Fe_1_und_Kuhstall.jpg","page_title":"Liste der Baudenkmäler in Reit im Winkl","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberbayerischen Gemeinde Reit im Winkl zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://uz.wikipedia.org/wiki/Bellegarde_(Loiret)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Map_commune_FR_insee_code_45031.png","page_title":"Bellegarde (Loiret)","context_page_description":"Bellegarde Fransiyaning Centre mintaqasida joylashgan kommunadir. Loiret departamenti Montargis tumani tarkibiga kiradi."},{"page_url":"https://es.wikipedia.org/wiki/Alfonso_Gatto","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Alfonso_Gatto.jpg","page_title":"Alfonso Gatto","context_page_description":"Alfonso Gatto\\nfue un poeta italiano."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%B9%99%E9%85%B8%E9%93%85","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/23/PbAc2_%28jonowo%29.png","page_title":"乙酸铅","context_page_description":"乙酸鉛，又稱醋酸鉛，是一種白色晶體狀化合物，帶甜味。將鉛黃和乙酸反應可以製備乙酸鉛。和其他鉛化合物一樣，乙酸鉛也有很大毒性。乙酸鉛能溶於水或甘油。和水中形成三水合物，Pb(CH₃COO)₂·3H₂O，是一種無色或白色花狀單斜晶體。\\n低濃度的乙酸鉛在漸進式染髮產品中的主要有效成份。"},{"page_url":"https://de.wikipedia.org/wiki/Teichrosen","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/182_Nuphar_luteum.jpg","page_title":"Teichrosen","context_page_description":"Teichrosen ist die einzige Gattung der Unterfamilie der Nupharoideae innerhalb der Pflanzenfamilie der Seerosengewächse. Die etwa acht Arten sind auf der Nordhalbkugel weitverbreitet."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D0%B8%D1%98%D0%B5%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Kyjiv_sofienkathedrale.jpg","page_title":"Кијев","context_page_description":"Кијев главни је и највећи град Украјине. Налази се на северу државе на обали реке Дњепар. Према процени из 2012. у граду је живело 2.814.258 становника., Сматра се да би тај број у реалности прешао три милиона када би се бројали сви имигранти који непријављено бораве у граду. Простире се на површини од око 839 km².\\nОснован је у 5. веку а статус града добија 1487. По легенди, основала су га тројица браће: Хорив, Киј и Шцек. Универзитет у Кијеву основан је 1834. У граду постоји 99 високих школа, 25 музеја, планетаријум, позориште, ботанички и зоолошки вртови. Због великог броја цркава и манастира и значаја за православни свет, од средњег века град носи надимак „Јерусалим севера“. Због своје историјске улоге, као престоница Кијевске Русије, Кијев је познат и као „Мајка руских градова“."},{"page_url":"https://he.wikipedia.org/wiki/%D7%AA%D7%9E%D7%A8%D7%95%D7%A8%D7%99%D7%9D_%D7%91%D7%99%D7%A9%D7%A8%D7%90%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/MotorwaySignM8Athlone.JPG","page_title":"תמרורים בישראל","context_page_description":"התמרורים בישראל נקבעים על ידי משרד התחבורה. קביעה קודמת של התמרורים פורסמה בקובץ התקנות, בהודעת התעבורה, התש\\"ל-1970. הגרסה הנוכחית של קביעה זו נכנסה לתוקף ב-26 ביוני 2011, ומאז תוקנה פעמים אחדות.\\nתמרורי הדרך והשלטים במדינת ישראל מצייתים ונסמכים ברובם על התקן הבין-לאומי כפי שנקבע בוועדת וינה לתקנון תמרורים עם זאת חלק מהתמרורים במדינת ישראל שונים במידה מהתקן.\\nבהתאם לתקנות התעבורה, התשכ\\"א-1961, הצבתם של תמרורים היא בסמכותן של רשות תמרור מרכזית ורשות תמרור מקומית. לקצין משטרה נתונה סמכות להציב בדרך תמרור זמני הנושא עליו סימן מטעם משטרת ישראל. בתקנות אלה נקבעה גם חובת הציות לתמרורים על ידי עוברי דרך."},{"page_url":"https://fr.wikipedia.org/wiki/R%C3%ADo_Tinto_(fleuve)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Rio_Tinto.png","page_title":"Río Tinto (fleuve)","context_page_description":"Le Río Tinto est un fleuve du sud-ouest de l'Espagne, provenant de la Sierra Morena en Andalousie."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B9%80%E0%B8%AD%E0%B8%9F-22_%E0%B9%81%E0%B8%A3%E0%B9%87%E0%B8%9E%E0%B9%80%E0%B8%95%E0%B8%AD%E0%B8%A3%E0%B9%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/F-22-raptor-16.jpg","page_title":"เอฟ-22 แร็พเตอร์","context_page_description":"เอฟ-22 แร็ปเตอร์ เครื่องบินเอฟ-22 เป็นเครื่องบินเจ็ทขับไล่ที่มีแผนจะนำมาใช้ปฏิบัติการครองอากาศทดแทนเครื่องบินเอฟ-15 เดือนตุลาคม พ.ศ. 2528 กองทัพอากาศสหรัฐอเมริกาได้กำหนดความต้องการเครื่องบินขับไล่ยุทธวิธีขั้นก้าวหน้า ต่อมาเมื่อเดือนตุลาคม พ.ศ 2529 จึงได้คัดเลือกเครื่องบินต้นแบบจากสองกลุ่มบริษัทได้แก่ กลุ่มเจนเนอรัล ไดนามิกส์/ล็อกฮีด/โบอิง ที่สร้างเครื่องต้นแบบวายเอฟ-22 กับกลุ่มแมคดอนเนลล์ ดักลาส/นอร์ทธอป ที่สร้างเครื่องต้นแบบวายเอฟ-23 เพื่อดำเนินการสาธิตและรับรองเครื่องต้นแบบ วันที่ 23 เมษายน พ.ศ. 2534 กองทัพอากาศสหรัฐฯตัดสินใจเลือกเครื่องต้นแบบวายเอฟ-22 ในการดำเนินการ"},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%8C%97%E6%A5%B5%E6%98%9F%E7%9B%B4%E5%8D%87%E6%A9%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Sarang.JPG","page_title":"北極星直升機","context_page_description":"北极星直升机是印度斯坦航空有限公司截至2019年为止唯一量产的直升机，属于军民两用型。\\n80年代印度决定自制军用直升机，印度斯坦航空公司在原德国MBB公司的协助下研制北极星计划，1989年第一架样本机ALH 产出，1992年试飞而1991年印度经济危机发生让军方一度取消购买计划，之后十年进行了大量图纸改动并改用美国CTS800发动机，放弃自制发动机。21世纪初期军方重新决定量产后2002年开始服役，但由于美国因核武问题经济制裁印度而改用法国TM333-2B2发动机。\\n北极星直升机的飞安纪录非常恶劣，印度自身已出现20起以上空难都是非战斗损失，其外销厄瓜多尔的七架军用有四架坠机其中一架是在阅兵式上当众坠毁，厄国决定封存剩余三架打算转卖但无人购买。哥伦比亚、巴西和智利等国也取消购买计划。"},{"page_url":"https://en.wikipedia.org/wiki/Sunningdale_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/Lodge_at_Northcote_House_-_geograph.org.uk_-_137280.jpg","page_title":"Sunningdale Park","context_page_description":"Sunningdale Park is a country estate centred around a property known as Northcote House in Sunningdale, Berkshire."},{"page_url":"https://de.wikipedia.org/wiki/Frauenhagen_(Angerm%C3%BCnde)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Dorfkirche_Frauenhagen_2018_SSW.jpg","page_title":"Frauenhagen (Angermünde)","context_page_description":"Frauenhagen ist ein Ortsteil der Stadt Angermünde im Landkreis Uckermark im Nordosten des Landes Brandenburg. Der Ort wurde am 26. Oktober 2003 eingemeindet und war vorher eine eigenständige Gemeinde."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%86%D8%B7%D9%88%D9%86%D9%8A%D9%88_%D9%85%D8%A7%D8%B1%D9%8A%D8%A7_%D9%81%D8%A7%D9%84%D8%B3%D8%A7%D9%84%D9%81%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Valsalva_by_Ceracchi.jpg","page_title":"أنطونيو ماريا فالسالفا","context_page_description":"أنطونيو ماريا فالسالفا، طبيب وعالم تشريح إيطالي، نشر مجموعة من الأبحاث والكتب التي تركت تأثيراً كبيراً في تطور علم التشريح، بالإضافة لذلك اكتشف العديد من البنى والأعضاء التشريحية التي مازالت تُنسب إليه حتى الآن مثل عضلة فالسالفا Valsalva’s muscle وشريطة فالسالفا taeniae Valsalva، ركَّز فالسالفا في أبحاثه على تشريح الأذن وهو أول من صاغ مصطلح \\"قناة أوستاش\\" واصفاً القناة التي تصل بين البلعوم والأذن الوسطى، ووصف الجيوب الأبهرية \\"جيوب فالسالفا\\" في كتاباته التي نُشرت عام 1740 بعد وفاته، ويرتبط اسمه أيضاً بمناورة فالسالفا التي تستخدم كاختبار لوظيفة الدورة الدموية وكطريقة لمعادلة الضغط على جانبي غشاء الطبل في الأذن."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9A%D0%BB%D0%B0%D1%81%D0%B8%D1%84%D0%B8%D0%BA%D0%B0%D1%86%D0%B8%D1%8F_%D0%BD%D0%B0_%D1%85%D0%B8%D1%89%D0%BD%D0%B8%D1%86%D0%B8%D1%82%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Genetta_genetta_felina_%28Wroclaw_zoo%29.JPG","page_title":"Класификация на хищниците","context_page_description":"Класификацията на хищниците включва всички представители на разред Хищници."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%A5%BF%E6%89%80%E6%BE%A4%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/SeibuIkebukuro.svg","page_title":"西所澤站","context_page_description":"西所澤站是一個位於埼玉縣所澤市西所澤一丁目，屬於西武鐵道的鐵路車站。車站編號是SI18。\\n此站有池袋線與狹山線停靠。狹山線以此站為起點。"},{"page_url":"https://fr.wikipedia.org/wiki/Panne_flamande","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/W%C3%A9ris_%28Belgique%29_-_vieil_appentis_b%C3%A2ti_en_moellons_de_calcaire_gris.jpg","page_title":"Panne flamande","context_page_description":"La panne flamande est une tuile traditionnelle dans les pays allant de la Flandre à la Baltique. Sa section transversale est en S et son côté convexe recouvre la rive du côté concave de sa voisine. Elle résume ainsi en une pièce la tegula et l'imbrex des couvertures romaines. Sa sous-face est munie en tête d'un relief qui la retient au lattis. C'est, dans sa forme la plus classique, une tuile de grand moule dont il faut environ quinze unités pour couvrir un mètre carré. Elle est apparue au XVᵉ siècle pour couvrir des toits de pente moyenne ou forte dans les régions pluvieuses de la mer du Nord et son usage perdure au XXIᵉ siècle dans une aire très élargie."},{"page_url":"https://fr.wikipedia.org/wiki/Gibberulus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Gibberulus_gibbosus_01.JPG","page_title":"Gibberulus","context_page_description":"Gibberulus est un genre de mollusques gastéropodes de la famille des Strombidae."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%B4%D0%BD%D0%BE%D0%BF%D1%91%D1%80%D1%8B%D0%B9_%D1%81%D0%BA%D0%B0%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Arhynchobatis_asperrimus.jpg","page_title":"Однопёрый скат","context_page_description":"Однопёрый скат — вид хрящевых рыб из подсемейства однопёрых скатов, единственный в одноимённом роде. Обитают в юго-западной части Тихого океана. Встречаются на глубине до 1070 м. Их крупные, уплощённые грудные плавники образуют округлый диск со слегка выступающим рылом. Максимальная зарегистрированная длина 75 см. Яйцекладущий вид. Не являются объектом целевого промысла."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_okrese_Doma%C5%BElice","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Osvra%C4%8D%C3%ADn_-_p%C5%AFdorys_%28V._Kr%C3%A1l%2C_1983%29.png","page_title":"Seznam kulturních památek v okrese Domažlice","context_page_description":"Tento seznam nemovitých kulturních památek v okrese Domažlice vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu.\\nSeznam kulturních památek v Bělé nad Radbuzou včetně části Újezd Svatého Kříže\\nSeznam kulturních památek v Domažlicích\\nSeznam kulturních památek v Horšovském Týně včetně částí obce Borovice, Horšov, Podražnice, Semošice a Tasnovice\\nSeznam kulturních památek v Hostouni včetně částí obce Holubeč, Mělnice a Štítary\\nSeznam kulturních památek v Kanicích\\nSeznam kulturních památek v Kdyni včetně částí obce Modlín, Podzámčí a Prapořiště\\nSeznam kulturních památek v Klenčí pod Čerchovem včetně části obce Capartice\\nSeznam kulturních památek v Kolovči včetně části obce Zichov"},{"page_url":"https://eo.wikipedia.org/wiki/Scienca_Universitato_de_Szeged","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Hungary_szeged_university_2.jpg","page_title":"Scienca Universitato de Szeged","context_page_description":"Scienca Universitato de Szeged estas signifa universitato en Hungario. En 2012 instruis tie 6 000 pedagogoj 24 834 studentojn."},{"page_url":"https://pl.wikipedia.org/wiki/Pasy_inwazyjne","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/GeoffreyPageSpitfire.jpg","page_title":"Pasy inwazyjne","context_page_description":"Pasy inwazyjne – naprzemienne czarno-białe pasy malowane na kadłubach i skrzydłach alianckich samolotów podczas II wojny światowej, aby zmniejszyć prawdopodobieństwo, że zostaną zaatakowane przez własne siły, głównie podczas lądowania w Normandii i bezpośrednio po nim. Trzy białe i dwa czarne pasy malowano wokół tylnej części kadłuba tuż przed ogonem i od przodu do tyłu wokół górnej oraz dolnej powierzchni skrzydła. Sporadycznie pasy inwazyjne były używane także w innych wojnach i konfliktach."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D9%88%D8%B2%D9%8A%D8%A8%D9%89_%D9%81%D8%B1%D9%8A%D9%84%D9%8A%D9%86%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Sudan_Meroe_Pyramids_30sep2005_3.jpg","page_title":"جوزيبى فريلينى","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nجوزيبى فريلينى كان عالم اثار من مملكه ايطاليا."},{"page_url":"https://nl.wikipedia.org/wiki/Zaachila","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/04/ValleyZaachila1.JPG","page_title":"Zaachila","context_page_description":"Villa de Zaachila is een stad in de Mexicaanse staat Oaxaca. De plaats heeft 13.721 inwoners en is de hoofdplaats van de gemeente Villa de Zaachila.\\nZaachila was in de postklassieke periode, na de val van Monte Albán, een van de voornaamste Zapoteekse centra. In 1962 werden twee tombes ontdekt met vele Mixteekse en Zapoteekse artefacten maar verder is de plaats nog nauwelijks uitgegraven."},{"page_url":"https://sv.wikipedia.org/wiki/Abbamuseet","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/ABBA_Museum_2014e.jpg","page_title":"Abbamuseet","context_page_description":"Abbamuseet är en privatägd permanent utställning om den svenska musikgruppen Abba belägen i kvarteret Konsthallen vid Djurgårdsvägen 68 på Djurgården i Stockholm. Abbamuseet är beläget inom Kungliga Nationalstadsparken. Fram till 2017 delade det även byggnad och entré med museet för musikinitiativet Swedish Music Hall of Fame.\\nByggnaden, som till sin största del upptas av Pop House Hotell, ritades av Johan Celsing Arkitektkontor och öppnades våren 2013."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%87%91%E5%AD%90%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Kaneko_Station_20150309.jpg","page_title":"金子站","context_page_description":"金子站是一個位於埼玉縣入間市大字南峯，屬於東日本旅客鐵道八高線的鐵路車站。"},{"page_url":"https://sl.wikipedia.org/wiki/Gruzijska_umetnost","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f0/Georgia_Hodegetria_from_Zhilkani.jpg","page_title":"Gruzijska umetnost","context_page_description":"Najstarejši artefakti iz dediščine ljudstev, ki so naselili današnje ozemlje Gruzije, segajo v prazgodovino. Najdeni so predmeti materialne kulture iz obdobja paleolitika in neolitika. Dela iz bronaste dobe pričajo o visoki kulturi nekdanjih prebivalcev Gruzije. V grobnicah so našli bogato okrašeno posodo iz srebra. Slog nakazuje na vplive kulture Urartu.\\nIz helenističnega obdobja prihajajo umetnine z bogatim pletenim okrasjem s stiliziranimi živalskimi figurami. Zaklad iz zlata iz Ačalgorija je iz 5. stoletja našega štetja.\\nKrščanstvo je bilo v prvi polovici 4. stoletja razglašeno za državno vero. Prve cerkve so bile zgrajene kot osrednje kupolaste zgradbe ali podolgovate bazilike s tremi ladjami s kupolo nad križiščem, in so bile podobne zgodnjim romanskim cerkvam v zahodni Evropi. Figurativni bas reliefi in okrašeni kamniti elementi dokazujejo spretnost nekdanjih kamnosekov. Mozaiki so se pojavljali v apsidah polkupol.\\nV 10. stoletju postane viden vpliv arabske in perzijske kulture, zlasti v stilistiki miniaturnega pisanja v rokopisih. Slikanje fresk se je razvilo pod vplivom bizantinske umetnosti in se je pojavilo v 12."},{"page_url":"https://en.wikipedia.org/wiki/Ch%C5%ABbu_region","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/%E5%96%84%E5%85%89%E5%AF%BA%E5%8F%A3%E3%83%90%E3%82%B9%E4%B9%97%E3%82%8A%E5%A0%B4.JPG","page_title":"Chūbu region","context_page_description":"The Chūbu region, Central region, or Central Japan is a region in the middle of Honshū, Japan's main island. In a wide, classical definition, it encompasses nine prefectures: Aichi, Fukui, Gifu, Ishikawa, Nagano, Niigata, Shizuoka, Toyama, and Yamanashi.\\nIt is located directly between the Kantō region and the Kansai region and includes the major city of Nagoya as well as Pacific Ocean and Sea of Japan coastlines, extensive mountain resorts, and Mount Fuji.\\nThe region is the widest part of Honshū and the central part is characterized by high, rugged mountains. The Japanese Alps divide the country into the Pacific side, sunny in winter, and the Sea of Japan side, snowy in winter.\\nAlthough Mie is part of Kinki/Kansai/Western Japan in traditional geographical regional divisions, Northern Mie is part of the metropolitan area around Nagoya, and Mie is in many practical contexts considered to be part of Tōkai/Chūbu/Central Japan. Including Mie, Chūbu has a population of 23,010,276 as of 1 June 2019."},{"page_url":"https://az.wikipedia.org/wiki/BPM-97","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/KAMAZ-43269_Vystrel_%28BMP-97%29_REA-2009.jpg","page_title":"BPM-97","context_page_description":"BPM-97 və ya Vıstrel — KAMAZ 43269 Vıstrel 4×4 təkərli minaya davamlı, pusquya qorumalı vasitə üçün Rusiya hərbi təyinatı. BTR-80A kimi bir neçə müxtəlif taret ilə istehsal olunur. Avtomobil KAMAZ-43269 modelinə əsaslanaraq, adı Rusiya Sərhəd Mühafizəsi üçün nəzərdə tutulmuşdur. Ən yeni modeldə güllədeşilməz yan pəncərələr və silah taretləri yoxdur. Qazaxıstan və Rusiya DİN-in Daxili Əsgərləri, Federal Həbsxana Xidməti və Rusiya FHN tərəfindən sifariş edilmişdir."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%86%D1%83%D0%B4%D0%B0_%D0%9C%D1%96%D1%82%D1%96%D1%8E%D0%BA%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/uk/4/4e/Matsuda_Michiyuki_1.jpg","page_title":"Мацуда Мітіюкі","context_page_description":"Мацу́да Мітію́кі — японський політичний і державний діяч. Службовець Міністерства внутрішніх справ Японії. Перший голова префектури Шіґа. Відіграв центральну роль в анексії Рюкю."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%AD%D1%80%D0%BC%D0%B8%D1%82%D0%B0%D0%B6-%D0%92%D1%8B%D0%B1%D0%BE%D1%80%D0%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/%D0%92%D1%8B%D0%B1%D0%BE%D1%80%D0%B3._%D0%9C%D1%83%D0%B7%D0%B5%D0%B9_%D0%B8_%D1%88%D0%BA%D0%BE%D0%BB%D0%B0_%D0%B8%D0%B7%D1%8F%D1%89%D0%BD%D1%8B%D1%85_%D0%B8%D1%81%D0%BA%D1%83%D1%81%D1%81%D1%82%D0%B2._1930%D0%B3.JPG","page_title":"Эрмитаж-Выборг","context_page_description":"Эрмитаж-Выборг — филиал Государственного Эрмитажа и выставочный центр в Выборге, открывшийся в июне 2010 года."},{"page_url":"https://es.wikipedia.org/wiki/Fraport","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/87/Fraport_Konzernzentrale_bei_Nacht_2013.jpg","page_title":"Fraport","context_page_description":"Fraport AG es una compañía de transporte alemana que opera en el aeropuerto de Fráncfort y tiene intereses en otros aeropuertos del mundo.​ Cotiza en el índice Xetra y en la bolsa de valores de Fráncfort. El jefe actual de la compañía es Stefan Schulte. La compañía tiene 20 000 empleados aproximadamente, 17 500 de ellos en Fráncfort.\\nEn el año 2014 Fraport Group generó unas ventas de 2400 millones de euros y unos beneficios de unos 252 millones de euros. Más de 108,5 millones de pasajeros usaron sus aeropuertos en todo el mundo.​"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BA%D1%80%D0%B0%D0%BC%D0%B5%D0%BD%D1%82%D0%B0%D1%80%D0%B8%D0%B9_%D0%B5%D0%BF%D0%B8%D1%81%D0%BA%D0%BE%D0%BF%D0%B0_%D0%94%D1%80%D0%BE%D0%B3%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Entr%C3%A9e_messianique%2C_sacramentaire_de_Drogon.jpg","page_title":"Сакраментарий епископа Дрого","context_page_description":"Сакраментарий Дрого — иллюминированный сакраментарий, созданный приблизительно в 845—855 годах и являющийся значимым образцом каролингского искусства украшения рукописей."},{"page_url":"https://no.wikipedia.org/wiki/%C3%89amon_de_Valera","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/%C3%89amon_de_Valera_02.jpg","page_title":"Éamon de Valera","context_page_description":"Eamon de Valera var president i Irland fra 1959 til 1973.\\nDe Valera var mest kjent som en av lederne for Irlands kamp for uavhengighet fra Det forente kongeriket Storbritannia og Irland tidlig på 1900-tallet. Han var taoiseach i landet tre ganger, var hovedforfatter av Irlands grunnlov og avsluttet sin politiske karriere som president, og anses som en av de mest innflytelsesrike personene i Irland på 1900-tallet."},{"page_url":"https://en.wikipedia.org/wiki/Stadhuis_metro_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/IMGP1822_metrostation_Stadhuis_%28Medium%29.JPG","page_title":"Stadhuis metro station","context_page_description":"Stadhuis is an underground subway station in the city of Rotterdam, and is located on Rotterdam Metro lines D and E. The station opened on 9 February 1968, the same date that the North-South Line, of which it is a part, was opened.\\nThe station is located in the center of Rotterdam, underneath the Coolsingel, a major street through the center."},{"page_url":"https://pt.wikipedia.org/wiki/Club_Atl%C3%A9tico_San_Lorenzo_de_Almagro","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/CONMEBOL_Sudamericana_%282002-%29.png","page_title":"Club Atlético San Lorenzo de Almagro","context_page_description":"O Club Atlético San Lorenzo de Almagro, ou San Lorenzo, é um clube de futebol argentino, que localiza-se na cidade de Buenos Aires, com a sede oficial no bairro de Boedo, que na época da fundação do clube fazia parte do bairro de Almagro, mas o seu estádio atual, El Nuevo Gasómetro, localiza-se no bairro de Bajo Flores.\\nO regresso a Boedo e a construção de um novo estádio no mesmo sítio onde existiu o histórico Gasómetro está em marcha, após a aprovação de uma lei de restituição do terreno ao San Lorenzo."},{"page_url":"https://it.wikipedia.org/wiki/Giugliano_in_Campania","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/DSCN0133.JPG","page_title":"Giugliano in Campania","context_page_description":"Giugliano in Campania è un comune italiano di 125 058 abitanti della città metropolitana di Napoli in Campania. È il terzo comune della regione per popolazione ed è il comune non capoluogo di provincia più popoloso d'Italia.\\nLa città ha assunto nel tempo alcune denominazioni, come \\"La città della mela annurca\\" e \\"La città della Fiaba\\". La prima denominazione deriva dal nome di una tipologia di mela locale nata e diffusa in queste zone, la cosiddetta \\"melannurca\\" considerata la \\"regina delle mele\\". L'altro soprannome, \\"Città della Fiaba\\", è in onore al grande favolista Giambattista Basile, una delle figure più note legate alla città e autore della celebre fiaba La gatta Cenerentola."},{"page_url":"https://en.wikipedia.org/wiki/Soyuz_TMA-12","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Soyuz_TMA-12_Crew.jpg","page_title":"Soyuz TMA-12","context_page_description":"Soyuz TMA-12 was a Soyuz mission to the International Space Station which was launched by a Soyuz FG rocket at 11:16 UTC on 8 April 2008. It docked to the Pirs module of the station on 10 April 2008. Landing occurred at 03:37 on 24 October. It was the first nominal landing in three missions, following separation failures on the Soyuz TMA-10 and 11 spacecraft."},{"page_url":"https://en.wikipedia.org/wiki/List_of_works_by_Claude_Monet","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Monet_-_the-banks-of-the-seine-in-autumn.jpg","page_title":"List of works by Claude Monet","context_page_description":"This is an incomplete list of works, including nearly all the finished paintings but excluding preparatory black and white sketches, by Claude Monet, who was a founder of French impressionist painting, and the most consistent and prolific practitioner of the movement's philosophy of expressing one's perceptions before nature, especially as applied to plein-air landscape painting. The term Impressionism is derived from the title of his painting Impression, Sunrise.\\nWhat made Monet different from the other Impressionist painters was his innovative idea of creating Series paintings devoted to paintings of a single theme or subject. With the repetitious study of the subject at different times of day Monet's paintings show the effects of sunlight, time and weather through color and contrast. Monet's \\"Series paintings\\" are well known and notable, and include Haystacks, Water Lilies, Rouen Cathedrals, Houses of Parliament, Charing Cross Bridge, and Poplar Trees. His prodigious output of nearly 2000 paintings was catalogued by Daniel Wildenstein in the Monet: Catalogue Raisonné."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Velp_(Gelderland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Velp-biljoen-184239.jpg","page_title":"Lijst van rijksmonumenten in Velp (Gelderland)","context_page_description":"De plaats Velp (Gelderland) telt 61 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://vi.wikipedia.org/wiki/V838_Monocerotis","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/V838_Monocerotis_expansion.jpg","page_title":"V838 Monocerotis","context_page_description":"V838 Monocerotis là một ngôi sao đỏ trong chòm sao Monoceros cách Mặt trời khoảng 20.000 năm ánh sáng. Ngôi sao chưa được biết đến trước đó đã được quan sát vào đầu năm 2002 trải qua một vụ nổ lớn, và có thể là một trong những ngôi sao lớn nhất được biết đến trong một thời gian ngắn sau vụ nổ. Ban đầu được cho là một vụ phun trào nova điển hình, sau đó nó được xác định là một cái gì đó hoàn toàn khác. Lý do cho sự bùng nổ vẫn chưa chắc chắn, nhưng một số phỏng đoán đã được đưa ra, bao gồm một vụ phun trào liên quan đến quá trình chết sao và sự hợp nhất của một ngôi sao nhị phân hoặc các hành tinh.\\nPhần còn lại đang phát triển nhanh chóng. Đến năm 2009, nhiệt độ của nó đã tăng một chút lên 3.270 K và độ sáng của nó là 15.000 lần năng lượng mặt trời, nhưng bán kính của nó đã giảm xuống 380 lần so với Mặt trời mặc dù ejecta tiếp tục mở rộng. Đám mây bụi bị đẩy ra mờ đục đã nhấn chìm hoàn toàn một người bạn đồng hành loại B."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%A9%AC%E8%AF%BA%E8%AF%BA%E5%B2%9B","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Manono.JPG","page_title":"马诺诺岛","context_page_description":"馬諾諾島是大洋洲薩摩亞的一個島嶼，位於薩瓦伊島與烏波盧島之間的阿波利馬海峽中。該島面積3 km²，距烏波盧島最西端 3.4公里。它是艾加伊勒泰區的一部分。\\n該島人口773，分為4個村：\\nApai, 西部\\nFaleu, 南部\\nLepuia'i, 西南部\\nSalua, 北部\\n馬諾諾島是薩摩亞人口在該國全部島嶼中列第三位。該島不允許養狗，也沒有汽車。"},{"page_url":"https://fr.wikipedia.org/wiki/Volcan_Club_de_Moroni","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Stade_de_moroni_ancien.jpg","page_title":"Volcan Club de Moroni","context_page_description":"Le Volcan Club de Moroni, plus couramment abrégé en Volcan Club, est un club comorien de football fondé en 1971 et basé à Iroungoudjani, quartier de Moroni, la capitale du pays.\\nDétenu par l'homme d'affaire et grand investisseur comorien Shemir Kamoula, le club, surnommé Veri Piya, évolue au Stade de Moroni depuis 1971."},{"page_url":"https://ga.wikipedia.org/wiki/Bang_Bang","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/OLD_CIE_BUS_R389_ZH4538_%28PHOTOGRAPHED_ON_CLONTARF_ROAD_IN_MAY_2018%29-139374_-_Flickr_-_infomatique.jpg","page_title":"Bang Bang","context_page_description":"Duine de na carachtair ab iomráití i mBaile Átha Cliath ba ea Bang Bang nó Thomas Dudley nó fiú An Tiarna Dudley.\\nChuir daoine aithne air sna 1950í agus 1960í agus iad ag taisteal ar bhusanna agus ar thramanna Bhaile Átha Cliath, áit ar lig sé air daoine a lámhachainn, a lámha agus méaracha aige mar ‘ghunna’. Ag an am sin ní raibh doras ar an mbus agus bhí Bang Bang in ann seasamh ar an ardán ar chúl an bhus. Bhíodh sé ag bualadh a chromáin lena lámh chlé, faoi mar a bheadh sé ar chapall. Sa lámh dheas bhíodh an eochair airgid. Ghlaodh sé ‘Bang bang, you’re dead’ amach agus é ag scaoileadh urchair leo, agus as sin a tháinig an t-ainm sin air."},{"page_url":"https://ast.wikipedia.org/wiki/Mentha_arvensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Mentha_arvensis_2005.08.28_09.49.00.jpg","page_title":"Mentha arvensis","context_page_description":"Mentha arvensis ye una especie de planta fanerógama perteneciente a la familia Lamiaceae, ye nativa de les rexones templaes d'Europa y Asia central y occidental, esti del Himalaya y de Siberia."},{"page_url":"https://vi.wikipedia.org/wiki/Suchinda_Kraprayoon","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/%E0%B8%A5%E0%B8%B2%E0%B8%A2%E0%B9%80%E0%B8%8B%E0%B9%87%E0%B8%99_%E0%B8%AA%E0%B8%B8%E0%B8%88%E0%B8%B4%E0%B8%99%E0%B8%94%E0%B8%B2_%E0%B8%84%E0%B8%A3%E0%B8%B2%E0%B8%9B%E0%B8%A3%E0%B8%B0%E0%B8%A2%E0%B8%B9%E0%B8%A3.png","page_title":"Suchinda Kraprayoon","context_page_description":"Đại tướng Suchinda Kraprayoon là chính trị gia và sĩ quan quân đội người Thái Lan. Ông từng giữ chức thủ tướng Thái Lan từ ngày 7 tháng 4 năm 1992 đến ngày 24 tháng 5 năm 1992.\\nSuchinda từ chức từ chức Thủ tướng vào ngày 24 tháng 5 năm 1992. Phó thủ tướng Meechai Ruchuphan trở thành thủ tướng tạm quyền trong một thời gian ngắn cho đến khi chính phủ mới được thành lập."},{"page_url":"https://en.wikipedia.org/wiki/National_Register_of_Historic_Places_listings_in_Darlington_County,_South_Carolina","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/First_Baptist_Church%2C_Darlington%2C_SC%2C_US.jpg","page_title":"National Register of Historic Places listings in Darlington County, South Carolina","context_page_description":"This is a list of items on the National Register of Historic Places listings in Darlington County, South Carolina.\\nThis is intended to be a complete list of the properties and districts on the National Register of Historic Places in Darlington County, South Carolina, United States. The locations of National Register properties and districts for which the latitude and longitude coordinates are included below, may be seen in a map.\\nThere are 52 properties and districts listed on the National Register in the county, including one National Historic Landmark.\\nThis National Park Service list is complete through NPS recent listings posted March 6, 2020."},{"page_url":"https://fr.wikipedia.org/wiki/Histadrout","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Histadrut_member5.jpg","page_title":"Histadrout","context_page_description":"La Histadrout est le principal syndicat de travailleurs israéliens. Elle est affiliée à la Confédération syndicale internationale.\\nCe syndicat est considéré comme un des éléments fondateurs de la nation d'Israël, comme précurseur de l'État. Il a un double visage, de défense des travailleurs et d'organisation du travail en Israël. Après avoir investi tous les secteurs de la société, économie en possédant de nombreuses entreprises et coopératives de production et de consommation, arts, sports, loisirs, et joué un rôle important dans la gauche israélienne, Histadrout a décliné avec le recul de l'idéologie communautaire et le succès des idées libérales dans les gouvernements successifs des années 1990 à nos jours."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%BB%D0%B8%D1%86%D0%B0_%D0%9C%D0%B0%D1%80%D1%88%D0%B0%D0%BB%D0%B0_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B5%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_(%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0%2C_%D1%83%D0%BB._%D0%9C%D0%B0%D1%80%D1%88%D0%B0%D0%BB%D0%B0_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B5%D0%B2%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%2801%29.jpg","page_title":"Улица Маршала Василевского (Москва)","context_page_description":"Улица Ма́ршала Василе́вского — улица на северо-западе Москвы в районе Щукино Северо-Западного административного округа между площадью Академика Курчатова и Авиационной улицей. На пересечении с Щукинской и Новощукинской улицами находится станция метро «Щукинская»."},{"page_url":"https://de.wikipedia.org/wiki/Alte_Brennerei_Schwake","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Alte_Brennerei_Schwake_mit_Infotafel.jpg","page_title":"Alte Brennerei Schwake","context_page_description":"Die Alte Brennerei Schwake in Ennigerloh ist eine ehemalige Schnapsbrennerei.\\nAufgrund der gut erhaltenen Bausubstanz wurde das Gebäude in den 1980er Jahren für seine heutige Bestimmung umgebaut und mit einem Wohnhaus ergänzt. Nur in der Eingangshalle erinnern heute noch eine Destillierbatterie sowie Transmissionswellen und -räder an die ehemalige Nutzung.\\nHeute befinden sich im zweiten Stock der ehemaligen Brennerei zwei Kinos mit einem kleinen Vorführraum. Ferner ist die Alte Brennerei heute regionales Kultur- und Begegnungszentrum. Das Gebäude verfügt über eine Kleinkunstbühne für Theater- und Kabarettaufführungen. Ebenso dient es als Ausstellungsort, zum Beispiel für Kunstausstellungen.\\nSeit 2003 findet hier alljährlich der Ennigerloher Dichtungsring statt, ein Wettstreit um Worte für alle Hobbypoeten aus der Region."},{"page_url":"https://sk.wikipedia.org/wiki/Nemecko","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/VW_Wolfsburg.JPG","page_title":"Nemecko","context_page_description":"Nemecko, dlhý tvar – Nemecká spolková republika, skr. – NSR je spolkový stredoeurópsky štát. Na severe susedí s Dánskom, obmýva ho Severné more a Baltské more, na východe susedí s Poľskom a Českom, na juhu s Rakúskom a Švajčiarskom a na západe s Francúzskom, Luxemburskom, Belgickom a Holandskom. Rozloha Nemecka je 357 021 km², pričom územie štátu sa nachádza v miernom podnebnom pásme. Úmerne k výsledkom sčítania ľudu v roku 2011 malo Nemecko k 30. septembru 2014 81,084 miliónov obyvateľov, čo z neho robí najľudnatejší štát Európskej únie. Jeho populácia už v rokoch 2003 až 2010 klesla kvôli dlhodobej veľmi nízkej pôrodnosti o skoro 800 000 obyvateľov, čo z neho robí jednu z mála západoeurópskych krajín s negatívnym prírastkom obyvateľstva. Tento vývoj prebieha napriek tomu, že Nemecko je zároveň domovom tretej najväčšej populácie imigrantov na svete. Výsledok sčítania ľudu 2011 znamenal zníženie úradného odhadu stavu obyvateľstva o zhruba 1,1 milióna ľudí.\\nPodľa známych dokumentov bolo územie s názvom Germánia osídlené niekoľkými germánskymi kmeňmi už pred rokom 100 n. l. Od 10. storočia tvorilo nemecké územie jadro Rímsko-nemeckej ríše, ktorá existovala až do roku 1806."},{"page_url":"https://no.wikipedia.org/wiki/Anne_av_Storbritannia_(1950)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Princess_Anne_October_2015.jpg","page_title":"Anne av Storbritannia (1950)","context_page_description":"Anne av Storbritannia er en britisk prinsesse. Hun er dronning Elizabeth II og prins Philips andre barn og eneste datter. Hun er per november 2019 nummer 14 i arvefølgen til den britiske tronen. I 1987 fikk hun tittelen Princess Royal.\\nPrinsesse Anne har vært gift to ganger, første gang i 1973 med Mark Phillips. De har to barn, Peter Mark Andrew Phillips og Zara Anne Elizabeth Phillips. I 1992 giftet hun seg med Timothy Laurence."},{"page_url":"https://de.wikipedia.org/wiki/Jakub_Navr%C3%A1til","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Jakub_Navratil.JPG","page_title":"Jakub Navrátil","context_page_description":"Jakub Navrátil ist ein tschechischer Fußballspieler."},{"page_url":"https://bg.wikipedia.org/wiki/Dendrocygna_guttata","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Spotted_whistling-duck_lockhart08.JPG","page_title":"Dendrocygna guttata","context_page_description":"Dendrocygna guttata е вид птица от семейство Патицови."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BB%D5%A2%D5%B6_%D4%BD%D5%A1%D5%AC%D5%A4%D5%B8%D6%82%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/TCCKhaldun.jpg","page_title":"Իբն Խալդուն","context_page_description":"Իբն Խալդուն, արաբ մուսուլման պատմագիր և պատմաբան, ժամանակակից պատմագրության, սոցիոլոգիայի և տնտեսագիտության հիմնադիրներից մեկը։\\nՆրա գրքերից հատկապես հայտնի է ալ-Մուկադդիմա ։ Գիրքն իր ազդեցությունն է ունեցել Օսմանյան կայսրության 17-րդ դարի պատմաբանների վրա, ինչպիսիք են Հաջի Խալիֆան և Մուստաֆա Նաիման, ովքեր գործածել են գրքում առկա տեսությունները Օսմանյան կայսրության թուլացումը և ծաղկումը վերլուծելու համար: Թեև Իբն Խալդունը համարվում էր մուսուլմանական աշխարհի մեծագույն փիլիսոփաներից մեկը, 17-րդ դարի եվրոպացի սքոլարները ևս կրթվում էին այս գրքով։"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A3_%D0%BF%D0%BE%D0%BB%D1%8F%D1%85_%D0%A4%D0%BB%D0%B0%D0%BD%D0%B4%D1%80%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Johnmccraememorialbookcloseup02.JPG","page_title":"У полях Фландрії","context_page_description":"«У поля́х Фла́ндрії» — вірш у формі рондо, написаний під час Першої світової війни канадським лікарем, підполковником Джоном Мак-Креєм. Натхнення написати цей вірш прийшло до нього 3 травня 1915 року, після того, як він був розпорядником на похоронах свого друга Алекса Гелмера, забитого під час другої битви при Іпрі. Згідно з легендою, товариші по зброї відновили вірш після того, як Мак-Крей, незадоволений своєю роботою, викинув її. Вперше вірш було опубліковано 8 грудня 1915 року у лондонському журналі Панч.\\n«У полях Фландрії» — один з найпопулярніших та найцитованіших віршів про війну. Через цю популярність уривки з вірша використовувалися з пропагандистською метою у закликах до призову на військову службу та при зборі коштів від продажу військових облігацій. Згадані у вірші червоні маки, що росли на могилах загиблих, стали маками пам'яті — одним з найупізнаванніших символів пам'яті жертв озброєних конфліктів. Вірш та квітка маку стали відомими символами Дня пам'яті у всій Співдружності націй, зокрема, у Канаді, де «У полях Фландрії» є одним з найвідоміших літературних творів країни. Цей вірш також широко відомий у США, де він пов'язаний із Днем пам'яті."},{"page_url":"https://nl.wikipedia.org/wiki/Mirebeau","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Map_commune_FR_insee_code_86160.png","page_title":"Mirebeau","context_page_description":"Mirebeau is een gemeente in het Franse departement Vienne en telt 2226 inwoners. De plaats maakt deel uit van het arrondissement Poitiers."},{"page_url":"https://de.wikipedia.org/wiki/Werner_Schroeter","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Werner_Schroeter.jpg","page_title":"Werner Schroeter","context_page_description":"Werner Schroeter war ein deutscher Film-, Opern- und Theater-Regisseur."},{"page_url":"https://eu.wikipedia.org/wiki/Androm%C3%A8da-Lic%C3%A8u_(Tolosa_Okzitaniako_tranbia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Tramway_Androm%C3%A8de_Lyc%C3%A9e_2.jpg","page_title":"Andromèda-Licèu (Tolosa Okzitaniako tranbia)","context_page_description":"Andròmeda-Licèu Tolosa Okzitaniako tranbiaren geltokia da, Blanhac udalerrian kokatuta dagoena, boulevard Alain Savary eta boulevard de l'Europe artean hain zuzen.\\nGeltokia 2010ko abenduaren 11an ireki zen, Tolosa Okzitaniako tranbiaren linea Arenas eta Aeroconstellacion arteko luzapenarekin."},{"page_url":"https://en.wikipedia.org/wiki/Idris_Murshidul_Azzam_Shah_of_Perak","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/CO_1069-505-07_%287893293158%29.jpg","page_title":"Idris Murshidul Azzam Shah of Perak","context_page_description":"Sultan Idris Murshidul Azzam Shah Ibni Almarhum Raja Bendahara Alang Iskandar Marhum Teja GCMG GCVO was the 28th Sultan of Perak. Perak at that time was part of the British-administered Federated Malay States.\\nThe Sultan's rule was marked by Perak joining the Federated Malay States, a Federation of four protected states in the Malay Peninsula, including Selangor, Negeri Sembilan and Pahang, established by the British government in 1895, which lasted until 1946."},{"page_url":"https://sk.wikipedia.org/wiki/Warcq_(Meuse)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ed/Map_commune_FR_insee_code_55578.png","page_title":"Warcq (Meuse)","context_page_description":"Warcq je francúzska obec, ktorá sa nachádza v departemente Meuse, v regióne Lotrinsko."},{"page_url":"https://hu.wikipedia.org/wiki/Jap%C3%A1n_%C3%A9p%C3%ADt%C3%A9szete","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Ujigami_jinja01_2816.jpg","page_title":"Japán építészete","context_page_description":"A japán építészet több ezer éves hagyományokkal rendelkezik, és ősileg a talajszinttől némileg elemelkedő favázas, zsúpfedeles vagy cseréptetős épületek jellemzik, melyeknek vékony, elcsúsztatható falpaneljeik vannak, lehetővé téve a belső tér tetszőleges elrendezését a különféle igények tükrében. Az ilyen típusú házakban az emberek – párnával vagy anélkül – a padlón ültek, a székek és a hozzájuk tartozó, magas asztalok egészen a 20. századig ismeretlenek voltak Japánban. Azonban a 19. század óta a szigetország folyamatosan veszi át és alkalmazza a nyugati modern és posztmodern építészet megoldásait. Manapság Japán vezető országnak számít a modern építészei technológiák és az épülettervezés terén.\\nA japán építészet legkorábbi megtestesülései egyszerű veremházak és raktárak voltak az őskorban, melyek az akkori vadászó-gyűjtögető életmód igényei szerint lettek kialakítva. Később koreai közvetítéssel a kínai Han-dinasztia által használt bonyolultabb jellegű épületek, így többek közt összetettebb magtárak és vallásos temetkezési kamrák jelentek meg.\\nA hatodik században betörő buddhizmus a katalizátora lett a bonyolult faépítészeti technikákkal épült templomok elterjedésének."},{"page_url":"https://lb.wikipedia.org/wiki/Malakoff-Tuerm_(F%C3%ABrdertuerm)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/62108-CLT-0013-01_Steenkolenmijn_Hasard_Cheratte.jpg","page_title":"Malakoff-Tuerm (Fërdertuerm)","context_page_description":"Als Malakoff-Tuerm bezeechent ee Fërdertierm am Biergbau mat enger charakteristescher Bauform, déi haaptsächlech an den 1850er bis 1870er Joren a Kontinentaleuropa fir d'Schachtfërderung gebaut goufen.\\nEt si massiv gemauert Schachttierm mat enger festungsähnlecher Architektur. Déi stabil Bauweis aus bis zu 3 m décken zille Maueren an enger versteifter Konstruktioun bannenan huet et erméiglecht, déi schwéier Seelscheiwen ze halen an déi enorm Zuchkräfte vun de Fërdermaschinnen opzefänken. Et huet ee se virun allem am Steekuelen-, Eisenäerz- an am Kalisalz-Biergbau fonnt.\\nDe Volleksmond huet dës Tierm nom Malakoff-Tuerm zu Sewastopol benannt, deen an där Zäit wou déi Schachttierm entstane sinn en haart ëmkämpften Tuerm am Krimkrich war, well déi Referenz d'Widerstandsfäegkeet vun de bis zu 30 m héije Fërderariichtunge betount huet. Baulech gläiche sech de Festungstuerm an d'Fërdertierm bis op déi robust wuchteg Form awer guer a glat net. Déi biergbautechnesch Bezeechnung fir déi Fërdertierm war dowéinst och ganz einfach \\"Mauerwierk\\", bis datt 1928 de Carl Koschwitz den ëmgangssproochlechen Terme an d'Technikgeschichtsschreiwung agefouert huet."},{"page_url":"https://es.wikipedia.org/wiki/Alfonso_V_de_Arag%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Alfons_Da_Fiesole_Louvre_RF1611.jpg","page_title":"Alfonso V de Aragón","context_page_description":"Alfonso V de Aragón, llamado también el Magnánimo y el Sabio, ​ entre 1416 y 1458 fue rey de Aragón, de Valencia, de Mallorca, de Sicilia, de Cerdeña y conde de Barcelona; y entre 1442 - 1458 rey de Nápoles.\\nEra el hijo primogénito del regente de Castilla Fernando de Antequera y posteriormente rey de Aragón con el nombre de Fernando I, y de la condesa Leonor de Alburquerque. Pertenecía, por tanto, a la Casa de Aragón​ por ser nieto de Leonor de Aragón ​ y al linaje Trastámara por ser nieto de Juan I de Castilla.\\nEl 28 de junio de 1412 se convierte en heredero al trono de la Corona de Aragón cuando su padre fue proclamado rey tras el llamado Compromiso de Caspe y tres años más tarde, el 12 de junio de 1415, en la catedral de Valencia, contrae matrimonio con su prima la infanta María hija de Enrique III de Castilla y de Catalina de Lancáster.\\nEl 2 de abril de 1416, tras el fallecimiento de su padre le sucede como rey de Aragón y de los demás reinos de los que era titular.​"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%A4%D8%B3%D8%B3%D8%A9_%D8%AD%D9%8A%D8%AF%D8%B1_%D8%B9%D9%84%D9%8A%D9%8A%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Heyd%C9%99r_%C6%8Fliyev_Fondu_il%C9%99_BMT-nin_%C4%B0nki%C5%9Faf_Proqram%C4%B1_aras%C4%B1nda_memorandum_imzalanmas%C4%B1_m%C9%99rasimi.jpg","page_title":"مؤسسة حيدر علييف","context_page_description":"مؤسسة حيدر علييف هي منظمة غير ربحية.تأسست المؤسسة في 10 مايو 2004 تحت قيادة مهربان علييفا.مقر المؤسسة في باكو.منذ تأسيسها، ولد رئيس مؤسسة مهريبان علييفا ونائبة الرئيس ليلى علييفا."},{"page_url":"https://fi.wikipedia.org/wiki/El%C3%A4v%C3%A4n_Sanan_Yhteys","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/ESY_Church.jpg","page_title":"Elävän Sanan Yhteys","context_page_description":"Elävän Sanan Yhteys ry eli Elävä Sana -seurakunta sijaitsee Helsingissä Pasilassa ja lukeutuu tunnustuskuntiin sitoutumattomaksi uuskarismaattiseksi seurakunnaksi. Jäseniä on 300. Pastorina toimii Peter Hackzell."},{"page_url":"https://en.wikipedia.org/wiki/Nellie_Rodr%C3%ADguez","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Nellie_Rodriguez_%2841400350212%29_%28cropped%29.jpg","page_title":"Nellie Rodríguez","context_page_description":"Nelson Rodríguez is an American professional baseball first baseman for the York Revolution of the Atlantic League of Professional Baseball."},{"page_url":"https://es.wikipedia.org/wiki/Katie_Leung","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Katie_Leungpremiere2008.jpg","page_title":"Katie Leung","context_page_description":"Katie Liu Leung es una actriz escocesa de ascendencia china. Su interpretación más conocida es la de Cho Chang, el primer amor de Harry Potter, en la versión cinematográfica de Harry Potter y el Cáliz de Fuego y Harry Potter y la Orden del Fénix."},{"page_url":"https://da.wikipedia.org/wiki/Giambologna","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Firenze-piazza_signoria_statue01.jpg","page_title":"Giambologna","context_page_description":"Giovanni da Bologna, også kendt som Giambologna, født Jean Boulogne. Han var senmanierismens betydligste billedhugger."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%97%A5%E5%86%95%E7%89%A9%E8%B3%AA%E6%8A%9B%E5%B0%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Coronal_Mass_Ejection.gif","page_title":"日冕物質抛射","context_page_description":"日冕質量拋射是伴隨著日冕從太陽釋放物質的明顯事件。它們通常出現在日珥的噴發期間，並經常伴隨著太陽的閃焰出現。被釋放至太陽風中的電漿可以在日冕的影像中觀察到。\\n日冕物質拋射通常與其他形式的太陽活動有關，對這些關係的理論已被廣泛接受。日冕物質拋射通常來自太陽的活躍區域，例如與閃焰關係頻繁的太陽黑子群。在極大期，太陽每天大約發生三次日冕物質拋射，而在極小期，大約每五天產生一次日冕物質拋射。"},{"page_url":"https://ca.wikipedia.org/wiki/Pedro_de_Meneses","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/D._Pedro_de_Menezes%2C_conde_de_Vianna.jpg","page_title":"Pedro de Meneses","context_page_description":"Don Pedro de Meneses, 3 Senyor i 1 Comte de Vila Real i 2 Comte de Viana de l'Alentejo va ser un militar i noble portuguès, fill de D. João Afonso Telo de Meneses, 1º Comte de Viana de l'Alentejo, i de la seva dona Major Portocarrero, 2a Senyora de Vila Real, i nét de D. João Afonso Telo de Meneses, Comte de Ourém. Va ser fet Comte de Vila Real per Don Joan I de Portugal en 1424. Era cosí de Elieonor Teles de Meneses, reina de Portugal. Va ser el primer governador de Ceuta, de 1415 a 1430 i de 1434 a 1437 i el 7 Almirant de Portugal juri uxoris per les seves quartes noces."},{"page_url":"https://cs.wikipedia.org/wiki/Tren%C4%8Dianske_Teplice","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Turkish_spa_Sina_%28Hammam%29.jpg","page_title":"Trenčianske Teplice","context_page_description":"Trenčianske Teplice jsou lázeňské město na severozápadním Slovensku, v Trenčínském kraji."},{"page_url":"https://hu.wikipedia.org/wiki/La_Mal%C3%A8ne","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/France_Lozere_La_Malene.jpg","page_title":"La Malène","context_page_description":"La Malène község Franciaország déli részén, Lozère megyében. 2011-ben 162 lakosa volt."},{"page_url":"https://ast.wikipedia.org/wiki/Abog%C3%A1u","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Advokat%2C_Engelsk_advokatdr%C3%A4kt%2C_Nordisk_familjebok.svg","page_title":"Abogáu","context_page_description":"Abogáu o abogada ye aquella persona qu'exerz profesionalmente la defensa xurídica d'una de les partes en xuiciu, según los procesos xudiciales y alministrativos causaos por ella. Amás, asesora y da conseyu en materies xurídiques. Na mayoría de los ordenamientos de los diversos países, pal exerciciu d'esti oficiu ríquese tar inscritu nun Colexu d'Abogaos, o bien tener una autorización del Estáu pa exercer. Cuando realicen nuevos aportes orixinales a les Ciencies Xurídiques, llogren el doctoráu."},{"page_url":"https://en.wikipedia.org/wiki/University_of_Calgary","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Kristina_groves.jpg","page_title":"University of Calgary","context_page_description":"The University of Calgary is a public research university located in Calgary, Alberta, Canada. The University of Calgary started in 1944 as the Calgary branch of the University of Alberta, founded in 1908, prior to being instituted into a separate, autonomous university in 1966. It is composed of 14 faculties and over 85 research institutes and centres. The main campus is located in the northwest quadrant of the city near the Bow River and a smaller south campus is located in the city centre. The main campus houses most of the research facilities and works with provincial and federal research and regulatory agencies, several of which are housed next to the campus such as the Geological Survey of Canada. The main campus covers approximately 200 hectares.\\nA member of the U15, the University of Calgary is also one of Canada's top research universities. The university has a sponsored research revenue of $380.4 million, with total revenues exceeding $1.2 billion. The university maintains close ties to the petroleum and geoscience industry through the Department of Geosciences and the Schulich School of Engineering."},{"page_url":"https://en.wikipedia.org/wiki/List_of_windmills_in_Norfolk","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Here%27s_how_Mill_Farm_got_its_name_-_geograph.org.uk_-_537999.jpg","page_title":"List of windmills in Norfolk","context_page_description":"A list of windmills and windmill sites which lie in the current ceremonial county of Norfolk. This list covers those windmills that had a function other than drainage. Drainage mills are covered by the List of drainage windmills in Norfolk. Mills used for drainage and another function appear on both lists."},{"page_url":"https://arz.wikipedia.org/wiki/%D9%85%D8%A7%D8%AA_%D9%83%D8%A7%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Matt_Cain_%28British_Writer%29.jpg","page_title":"مات كاين","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nمات كاين صحفى من المملكه المتحده."},{"page_url":"https://eo.wikipedia.org/wiki/Kultiva_eruko","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Eruca_sativa_2_IP0604037.jpg","page_title":"Kultiva eruko","context_page_description":"Kultiva eruko estas foliaj legomoj kaj apartenas al la familio de la kruciferacoj. Eruko precipe en la itala kuirarto estas uzata kiel spico sur picoj kaj en salatoj."},{"page_url":"https://pnb.wikipedia.org/wiki/%DA%A9%DA%BE%DA%91%DB%8C_%D8%B4%D8%B1%DB%8C%D9%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Khari_Shareef.jpg","page_title":"کھڑی شریف","context_page_description":"کھڑی شریف پاکستان ازاد کشمیر دے ضلع میرپور دا اک نگر اے ۔ ایتھے پنجابی زبان دے بہت وڈے شاعر میاں محمد بخش دا مزار اے ۔"},{"page_url":"https://en.wikipedia.org/wiki/Transit_of_Venus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Halley_1716_proposal_of_determining_the_parallax_of_the_sun.jpg","page_title":"Transit of Venus","context_page_description":"A transit of Venus across the Sun takes place when the planet Venus passes directly between the Sun and a superior planet, becoming visible against the solar disk. During a transit, Venus can be seen from Earth as a small black dot moving across the face of the Sun. The duration of such transits is usually several hours. A transit is similar to a solar eclipse by the Moon. While the diameter of Venus is more than three times that of the Moon, Venus appears smaller, and travels more slowly across the face of the Sun, because it is much farther away from Earth.\\nTransits of Venus are among the rarest of predictable astronomical phenomena. They occur in a pattern that generally repeats every 243 years, with pairs of transits eight years apart separated by long gaps of 121.5 years and 105.5 years. The periodicity is a reflection of the fact that the orbital periods of Earth and Venus are close to 8:13 and 243:395 commensurabilities.\\nThe last transit of Venus was on 5 and 6 June 2012, and was the last Venus transit of the 21st century; the prior transit took place on 8 June 2004. The previous pair of transits were in December 1874 and December 1882."},{"page_url":"https://en.wikipedia.org/wiki/Hugo_Conwentz","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Conwentzstein.JPG","page_title":"Hugo Conwentz","context_page_description":"Hugo Wilhelm Conwentz was a German botanist. He is best known for his paleobotany studies of Baltic amber.\\nHe studied in Wrocław and Göttingen. Beginning in 1876 he conducted paleobotanical studies as an assistant to Heinrich Göppert in Breslau. In 1879 he was appointed director of the Westpreußischen Provinzialmuseums in Danzig, a position he held for thirty years. In 1906 he became state commissioner of the newly founded Staatliche Stelle für Naturdenkmalpflege in Preußen, a regulatory body for natural heritage conservation in Prussia."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_lieux_patrimoniaux_de_Kingston","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Bellvue_House.JPG","page_title":"Liste des lieux patrimoniaux de Kingston","context_page_description":"Cet article recense les lieux patrimoniaux de Kingston inscrits au répertoire des lieux patrimoniaux du Canada, qu'ils soient de niveau provincial, fédéral ou municipal."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B2%D1%8F%D1%89%D0%B5%D0%BD%D0%BD%D0%B0%D1%8F_%D1%80%D0%BE%D1%89%D0%B0_%D0%91%D0%B0%D0%BB%D1%82%D0%B0-%D0%A2%D0%B8%D0%B9%D0%BC%D0%B5%D0%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/%D0%9A%D0%B0%D1%80%D0%B0%D0%B8%D0%BC%D1%81%D0%BA%D0%BE%D0%B5_%D1%80%D0%BE%D0%B4%D0%BE%D0%B2%D0%BE%D0%B5_%D0%BA%D0%BB%D0%B0%D0%B4%D0%B1%D0%B8%D1%89%D0%B5_%D0%91%D0%B0%D0%BB%D1%82%D0%B0-%D0%A2%D0%B8%D0%B9%D0%BC%D0%B5%D0%B7.jpg","page_title":"Священная роща Балта-Тиймез","context_page_description":"Священная роща Балта́-Тийме́з — ботанический памятник природы в Бахчисарайском районе, Республика Крым. Расположен на территории старого караимского кладбища в Иосафатовой долине в окрестностях пещерного города Чуфут-Кале. Роща состоит из 29 экземпляров дуба черешчатого. Согласно заключению дендрохронологической экспертизы лаборатории Института археологии НАН Украины от 11.11.1998 г., древнейшие из сохранившихся экземпляров дуба скалистого в Иосафатовой долине датируются 1780—1785 годами.\\nДеревья на высоте 1,3 м имеют в обхвате 2—4 м, их высота 20—30 м."},{"page_url":"https://pl.wikipedia.org/wiki/Breddin","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Damelack_church_2016_SW.JPG","page_title":"Breddin","context_page_description":"Breddin – gmina w Niemczech w kraju związkowym Brandenburgia, w powiecie Ostprignitz-Ruppin, wchodzi w skład urzędu Neustadt."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BE%90%E6%96%B0%E5%85%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Xu_Xinliu.jpg","page_title":"徐新六","context_page_description":"徐新六，字振飞，祖籍浙江余杭，生于杭州。中华民国企业家。"},{"page_url":"https://pt.wikipedia.org/wiki/Esp%C3%A9cie_bandeira","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Staghorn-coral-1.jpg","page_title":"Espécie bandeira","context_page_description":"Uma espécie bandeira é uma espécie, geralmente um animal vertebrado, escolhida para representar uma causa ambiental, que pode ser desde a conservação da própria ou até a conservação de seu ecossistema inteiro. Essas espécies tornam-se então embaixadoras da causa, sendo consideradas ícones ou símbolos de uma determinada campanha de defesa ambiental.\\nAs espécies são escolhidas pela sua vulnerabilidade, atratividade e principalmente pelo seu carisma junto ao público, de forma a conseguir apoio e conhecimento de grande parte da população, engajando-a na conservação do meio ambiente.\\nAssim, o conceito de espécie bandeira se sustenta em que, trazendo à população devida atenção à situação de perigo de determinada espécie mais carismática, todo seu ecossistema e demais espécies menos empáticas do mesmo têm mais chances de serem preservadas."},{"page_url":"https://pl.wikipedia.org/wiki/Awaceratops","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Avaceratops_dinosaur.png","page_title":"Awaceratops","context_page_description":"Awaceratops − średniej wielkości dinozaur rogaty.\\nAwaceratops został nazwany od imienia żony odkrywcy, Avy. Słowo ceratops oznacza rogatą twarz. Całą nazwę rodzajową można, więc tłumaczyć jako rogatą twarz Avy."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1993","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Patrick_Bamford.jpg","page_title":"Lijst van personen geboren in 1993","context_page_description":"Dit is een lijst van personen die geboren zijn in 1993.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://ca.wikipedia.org/wiki/Premis_Oscar_de_1964","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Audrey_Hepburn_My_Fair_Lady_Dress.jpg","page_title":"Premis Oscar de 1964","context_page_description":"Els Premis Oscar de 1964 foren presentats el 5 d'abril de 1965 en una cerimònia realitzada al Santa Monica Civic Auditorium de Los Angeles.\\nLa cerimònia fou presentada per l'actor i comediant Bob Hope."},{"page_url":"https://zh.wikipedia.org/zh-cn/2016%E5%B9%B43%E6%9C%889%E6%97%A5%E6%97%A5%E9%A3%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Totality%21_Tanjung_Pandan%2C_Indonesia_%2833183668031%29.jpg","page_title":"2016年3月9日日食","context_page_description":"2016年3月9日日食是一次日全食，发生于2016年3月9日。新月当天，地球上观测到月球和太阳的角距离极小，此时月球如果恰好在月球交点附近，穿过太阳和地球之间，与地球、太阳接近一直线，则会出现日食。月球本影接触地表而使该区域完全得不到阳光，就会形成日全食，同时在本影两侧数千公里的半影范围内遮挡部分阳光，形成日偏食。此次日全食经过了印度尼西亚和密克罗尼西亚联邦两国的部分岛屿，日偏食则覆盖了亚洲东南部、大洋洲大部和北美洲西北部地区。"},{"page_url":"https://es.wikipedia.org/wiki/Historia_del_cristianismo_en_Francia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Religion_importance_%282002%29.png","page_title":"Historia del cristianismo en Francia","context_page_description":"Historia del cristianismo en Francia es la presencia del cristianismo en la historia de Francia. Comienza probablemente en el siglo II. Se caracterizó principalmente por el papel preponderante de la Iglesia católica en Francia en todos los aspectos de la vida, no únicamente en las cuestiones espirituales; de forma inequívoca durante toda la Edad Media, manteniéndose relativamente durante la Edad Moderna, y enfrentándose a la descristianización durante la Edad Contemporánea, a partir de la Revolución francesa."},{"page_url":"https://it.wikipedia.org/wiki/Canela_(Cile)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fc/Canela_baja.jpg","page_title":"Canela (Cile)","context_page_description":"Canela è un comune del Cile della provincia di Choapa nella Regione di Coquimbo. Al censimento del 2002 possedeva una popolazione di 9.379 abitanti."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%98adov%C3%BD_d%C5%AFm","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Dvouletky_105_-_57%2C_zahr%C3%A1dky.jpg","page_title":"Řadový dům","context_page_description":"Řadové domy či řadovky je způsob bytové výstavby, kdy se jedno- až třípodlažní rodinné domy, často stavěné podle téhož plánu, řadí těsně vedle sebe a sdílejí nosné zdi se sousedním domem. Ve srovnání s činžovními domy nabízejí větší soukromí, případně i zahrádku, ve srovnání se samostatnými rodinnými domy jsou energeticky úspornější, zaberou méně místa a tím umožňují vyšší hustotu osídlení. Díky tomu se zlevňuje stavba inženýrských sítí a usnadňuje obsluha veřejnou dopravou."},{"page_url":"https://en.wikipedia.org/wiki/Anti-Russian_sentiment","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Museum_of_communism_in_prague_2008-08-06.jpg","page_title":"Anti-Russian sentiment","context_page_description":"Anti-Russian sentiment is a fear and/or dislike for Russia, Russians and/or Russian culture. A variety of mass culture clichés about Russia and Russians exist. Many of these stereotypes were originally developed in the Western world during the Cold War, and were primarily used as elements of political war against the Soviet Union. Some of these prejudices are still observed in the discussions of the relations with Russia. Negative representation of Russia and Russian people in modern popular culture is also often described as functional, as stereotypes about Russia may be used for framing reality, like creating an image of an enemy, or an excuse, or an explanation for compensatory reasons, and Russians are sometimes used as scapegoats. State run propaganda may also invoke 'Russophobia' for political reasons, and some countries, such as the U.S, the Baltic States, Ukraine, Hungary, Finland, or the U.K, may have predigious or dislike of and for Russians due to history, racism, propaganda, or ingrained stereotypes and hatred. Hollywood has been sometimes criticised for its excessive and continuous use of Russians as the villains. Media bias is also often times unfair towards Russia."},{"page_url":"https://de.wikipedia.org/wiki/Keramischer_Faserverbundwerkstoff","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/06/Flammrohr_nach_15000h.jpg","page_title":"Keramischer Faserverbundwerkstoff","context_page_description":"Keramische Faserverbundwerkstoffe sind eine Werkstoffklasse innerhalb der Gruppe der Verbundwerkstoffe oder auch der technischen Keramiken. Sie sind charakterisiert durch eine zwischen Langfasern eingebettete Matrix aus normaler Keramik, die durch keramische Fasern verstärkt wird und so zur faserverstärkten Keramik, Verbundkeramik oder auch einfach Faserkeramik wird. In der deutschen Fachliteratur wird die Werkstoffklasse häufig auch auf Englisch als Ceramic Matrix Composites bezeichnet und mit CMC abgekürzt. Matrix und Fasern können im Prinzip aus allen bekannten keramischen Werkstoffen bestehen, wobei in diesem Zusammenhang auch Kohlenstoff als keramischer Werkstoff behandelt wird.\\nDer Artikel beschreibt die zurzeit industriell verfügbaren Verbundkeramiken mit ihren wichtigsten Herstellungsverfahren, wesentlichen Eigenschaften sowie einige Entwicklungs- und erfolgreiche Anwendungsbeispiele dieser relativ jungen Gruppe von Werkstoffen."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%93%AC%E8%8E%B1%E3%83%80%E3%83%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/IinoEntei3.jpg","page_title":"蓬莱ダム","context_page_description":"蓬莱ダムは、福島県二本松市下川崎と福島市飯野町との境、一級河川・阿武隈川水系阿武隈川に建設されたダム。飯野堰堤、飯野ダムともいう。高さ21.5メートルの重力式コンクリートダムで、東北電力の発電用ダムである。同社の水力発電所・蓬莱発電所・飯野発電所に送水し、合計最大3万8,730キロワットの電力を発生する。日本の近代土木遺産。"},{"page_url":"https://eo.wikipedia.org/wiki/Orleanio","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Carte_de_l%27Orl%C3%A9anais.svg","page_title":"Orleanio","context_page_description":"Orleanio estas franca historia kaj kultura regiono, respondanta al malnova provinco kaj kies ĉefurbo Orléans. Orleanio konsistigis ankaŭ graflandon poste duklandon.\\nLa provinco arigis multajn malsamajn regionojn, kiaj Beauce, Puisaye, Solonjo, Gâtinais, Blois-lando kaj Vendomio, kaj nun ĝi estas disigita sur pluraj departementoj. Ĝi konsistigis granda parton de regiono Centro-Valo de Luaro, sed ankaŭ parton de Burgonjo, Francilio kaj Luarlandoj.\\nOrleanio enhavas multajn urbojn: Orléans, ties historia ĉefurbo, sed ankaŭ Blois, Étampes, Chartres, Rambouillet, Romorantin-Lanthenay, Montargis, Vendôme, Gien aŭ Châteaudun.\\nOrleanio aperis en la 9-a jc kaj Hugo Kapeto estis la lasta hereda grafo de Orléans. Poste, la titolo estis donita kiel apanaĝo al malpli aĝaj filoj de reĝoj de Francio. Altigita al duklando en 1344, la provinco eniris la reĝan domenon en 1498. Ĝi fine estis dispecigita en 1790 okaze de la kreo de departementoj."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BC%D1%8B%D0%B5_%D0%BA%D1%80%D0%B0%D1%81%D0%B8%D0%B2%D1%8B%D0%B5_%D0%B4%D0%B5%D1%80%D0%B5%D0%B2%D0%BD%D0%B8_%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Minerve_3.jpg","page_title":"Самые красивые деревни Франции","context_page_description":"«Самые красивые деревни Франции» — французская ассоциация, созданная в 1982 году с целью развития туризма в маленьких и живописных французских коммунах с богатым культурным наследием. По состоянию на 1 марта 2015 года знаком «Самые красивые деревни Франции» были отмечены 156 французских деревень.\\nСуществует несколько критериев вступления в ассоциацию: население деревни не должно превышать 2000 жителей, в деревне должны быть как минимум две защищённые области или объекта, и запрос о принятии должен быть утверждён муниципальным советом. Также принимается во внимание существование политики по сохранению ландшафта, устанавливающей особенности землепользования, ограничивающей строительство зданий и сооружений и призванной сохранять эстетический вид деревни. Эта политика может сдерживать экономическое развитие, однако гарантирует поселению важный и непрерывный туристический поток.\\nПохожие ассоциации были созданы в Валлонии, Квебеке, Италии и Испании."},{"page_url":"https://es.wikipedia.org/wiki/Kosice_(Hradec_Kr%C3%A1lov%C3%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Kosice_%C4%8Dp._140.JPG","page_title":"Kosice (Hradec Králové)","context_page_description":"Kosice es una localidad del distrito de Hradec Králové en la región de Hradec Králové, República Checa, con una población estimada a principio del año 2018 de 347 habitantes.\\nSe encuentra ubicada al sur de la región, a unos 100 km al este de Praga, cerca de la orilla de los ríos Elba y Orlice —un afluente del anterior—, y de la frontera con las regiones de Bohemia Central y Pardubice.​"},{"page_url":"https://hu.wikipedia.org/wiki/TER_Pays_de_la_Loire","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/S%C3%A9es_-_Train_station_-_1.JPG","page_title":"TER Pays de la Loire","context_page_description":"A TER Pays de la Loire egy regionális vasúthálózat Franciaországban, a Pays de la Loire régióban."},{"page_url":"https://et.wikipedia.org/wiki/L%C3%B5una-Itaalia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Napoli_Castel_Nuovo_Maschio_Angioino%2C_a_seat_of_medieval_kings_of_Naples_and_Aragon_2013-05-16_14-05-42.jpg","page_title":"Lõuna-Itaalia","context_page_description":"Lõuna-Itaalia on traditsiooniline nimi Itaalia lõunapoolsele osale, mis hõlmab Apenniini poolsaare lõunaosa ning kaks suurt saart – Sitsiilia ja Sardiinia. See langeb kokku administratiivsete regioonide Basilicata, Campania, Calabria, Apuulia, Molise, Abruzzo, Sitsiilia ja viimaks Sardiiniaga, mida peetakse Lõuna-Itaalia osaks rohkem majanduslikel kui kultuurilistel, ajaloolistel või geograafilistel põhjustel. Mõnikord lisatakse Mezzogiornole ka kõige lõuna- ja idapoolsemad Lazio osad, kuna need territooriumid olid koos kõigi juba loetletud regioonidega ajaloolise Mõlema Sitsiilia kuningriigi osad.\\nLõuna-Itaalia kannab omapärase looduse, arheoloogia ja kultuuri ainulaadset pärandit. See pakub palju suuri turismiatraktsioone, nagu Palazzo Reale di Caserta, Amalfi rannik, Pompei, Herculaneum ja muud arheoloogilised paigad. Mitmed rannikud, metsad ja mäed on paljudes rahvusparkides kaitse all. Lõuna-Itaalias leidub mitu keskajast pärit linna. Lõuna-Itaalia ajalugu on kirev arvukate kuningate, kuningannade, vürstide, paavstide, kirjanike, poeetide, filosoofide, rüütlite, kunstnike, arhitektide, meistrite, muusikute, õpetlaste, teadlaste, poliitikute ja farmerite poolest."},{"page_url":"https://cs.wikipedia.org/wiki/Dornier_Do_18","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Dornier_Do18_engine_installation.PNG","page_title":"Dornier Do 18","context_page_description":"Dornier Do 18 byl německý jednoplošný dvoumotorový létající člun s dlouhým doletem užívaný od 30. let 20. století a během druhé světové války."},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_ewangelicki_Zmartwychwstania_Pa%C5%84skiego_w_Czeskim_Cieszynie","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/2016_C._Tesin_Kostelik_Zmrtvychvstani.jpg","page_title":"Kościół ewangelicki Zmartwychwstania Pańskiego w Czeskim Cieszynie","context_page_description":"Kościół ewangelicki Zmartwychwstania Pańskiego w Czeskim Cieszynie – luterański kościół, użytkowany przez zbór Luterańskiego Ewangelickiego Kościoła Augsburskiego Wyznania w Czeskim Cieszynie.\\nKościół powstał na przełomie lat 2010-2011 w wyniku adaptacji dawnego domu przedpogrzebowego gminy wyznaniowej żydowskiej, powstałego w 1928 roku. Znajduje się on przy ulicy Hřbitovní, we frontowej części cmentarza żydowskiego i sąsiaduje z cmentarzem komunalnym. Obiekt, służący do tej pory za magazyn trumien cmentarza komunalnego, odkupił od miasta Luterański Ewangelicki Kościół Augsburskiego Wyznania. We wnętrzu umieszczono dużych rozmiarów krucyfiks, którego korpus stworzył Artur Szoldra z Ustronia. Pierwsze nabożeństwo odbyło się tutaj 31 października 2011 roku. Budynek wpisany jest na listę zabytków."},{"page_url":"https://vi.wikipedia.org/wiki/Caryota_obtusa","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Caryota_obtusa_AK.jpg","page_title":"Caryota obtusa","context_page_description":"Caryota obtusa là loài thực vật có hoa thuộc họ Arecaceae. Loài này được Griff. mô tả khoa học đầu tiên năm 1845."},{"page_url":"https://cy.wikipedia.org/wiki/Pamela_L._Gay","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Pamela_Gay.JPG","page_title":"Pamela L. Gay","context_page_description":"Gwyddonydd Americanaidd yw Pamela L. Gay, a gaiff ei hadnabod yn bennaf fel seryddwr a phodcastiwr."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%A8%D9%84_%D9%87%D8%A7%D9%88%D8%A8%D8%AA","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Picswiss_OW-27-01.jpg","page_title":"جبل هاوبت","context_page_description":"هاوبت هوا جبل فى سويسرا."},{"page_url":"https://ca.wikipedia.org/wiki/Cosqueville","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Cosqueville_Hameau_de_l%27%C3%89glise_2013_09_01.jpg","page_title":"Cosqueville","context_page_description":"Cosqueville és un municipi francès, situat al departament de la Manche i a la regió de Normandia. L'any 2007 tenia 570 habitants."},{"page_url":"https://fr.wikipedia.org/wiki/Temple_de_Romulus","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/06_tempio_di_romolo_dentro_ss_cosma_e_damiano.JPG","page_title":"Temple de Romulus","context_page_description":"Le temple de Romulus est un monument romain situé le long de la Voie sacrée, à l'entrée sud-est du Forum Romain, et attenant à la Basilique Santi Cosma e Damiano."},{"page_url":"https://ca.wikipedia.org/wiki/Regia_Aeronautica","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/IT-Airforce-OF-4.png","page_title":"Regia Aeronautica","context_page_description":"La Regia Aeronautica era la força aèria del Regne d'Itàlia. Va ser establerta com a un servei independent del Regio Esercito des del 1923 i fins al 1946. El 1946 la monarquia va abolir-se i el Regne d'Itàlia esdevingué la República Italiana, i el nom de la força aèria va passar a ser el de Aeronautica Militare Italiana."},{"page_url":"https://es.wikipedia.org/wiki/Valle_de_los_Dinosaurios_(Para%C3%ADba)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Vale_dos_Dinossauros.jpg","page_title":"Valle de los Dinosaurios (Paraíba)","context_page_description":"El Valle de los Dinosaurios es un área en el estado de Paraíba, Brasil, que contiene muchas huellas de dinosaurios fosilizados. Contiene el Área del Valle de los Dinosaurios de Interés Ecológico Relevante, un área de uso sostenible de interés ecológico relevante. Esto a su vez contiene el Monumento Natural del Valle de los Dinosaurios, más pequeño y totalmente protegido. En 2015-16 hubo preocupación de que las renovaciones a la atracción turística, que se habían retrasado por falta de fondos, podrían no estar respetando la integridad del sitio."},{"page_url":"https://it.wikipedia.org/wiki/Cucina_di_La_Rioja","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Pochas_a_la_riojana.jpg","page_title":"Cucina di La Rioja","context_page_description":"La cucina di La Rioja è la cucina della regione settentrionale spagnola di La Rioja, simile alla cucina dei Paesi Baschi, della Navarra e di Aragona."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1937","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Ned_Beatty_cropped.jpg","page_title":"Lijst van personen geboren in 1937","context_page_description":"Dit is een lijst van personen die geboren zijn in 1937.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://en.wikipedia.org/wiki/List_of_butterflies_of_Sri_Lanka_(Nymphalidae)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Rohana_parisatis_Westwood%2C_1850_%E2%80%93_Black_Prince_newly_eclosed_male_from_Peraiya_%2816%29.jpg","page_title":"List of butterflies of Sri Lanka (Nymphalidae)","context_page_description":"This is a list of the butterflies of family Nymphalidae which are found in Sri Lanka. It is part of List of the butterflies of Sri Lanka."},{"page_url":"https://war.wikipedia.org/wiki/Rhinolophus_luctus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Rhinolophus_luctus_ras.jpg","page_title":"Rhinolophus luctus","context_page_description":"An Rhinolophus luctus in uska species han Chiroptera nga ginhulagway ni Temminck hadton 1835. An Rhinolophus luctus in nahilalakip ha genus nga Rhinolophus, ngan familia nga Rhinolophidae. Ginklasipika han IUCN an species komo diri gud kababarak-an. Waray hini subspecies nga nakalista."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Unzmarkt-Frauenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Unzmarkt_-_Nepomuk.jpg","page_title":"Liste der denkmalgeschützten Objekte in Unzmarkt-Frauenburg","context_page_description":"Die Liste der denkmalgeschützten Objekte in Unzmarkt-Frauenburg enthält die 14 denkmalgeschützten, unbeweglichen Objekte der Gemeinde Unzmarkt-Frauenburg im steirischen Bezirk Murtal."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%B9%9D%E9%BE%8D%E5%B7%B4%E5%A3%AB82K%E7%B7%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/KMB_PJ9763_82B.jpg","page_title":"九龍巴士82K線","context_page_description":"九龍巴士82K線是由九巴營運的一條香港新界巴士路線，屬沙田新市鎮區內路線，來往美林及黃泥頭。\\n九龍巴士82B線則為本線的輔助路線，於星期一至五上午開出4班，由美田邨單向開往大圍站，每日08:30後由大圍站循環往返美松苑，依次行經美田邨、美松苑、美林邨及美城苑。"},{"page_url":"https://sk.wikipedia.org/wiki/J%C3%A1n_Tibensk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Tibensk%C3%BD_J%C3%A1n.jpg","page_title":"Ján Tibenský","context_page_description":"PhDr. Ján Tibenský, DrSc. bol slovenský historik, pracovník Historického ústavu Slovenskej akadémie vied od 1. januára 1951.\\nZabezpečoval vydanie diela D. Rapanta, Slovenské povstanie roku 1848 – 49 a tri zväzky Sedliackeho povstania. Vytvoril originálnu koncepciu národného obrodenia. Od 60. rokov 20. storočia sa venoval aj problematike vývoja vedy a techniky na území Slovenska."},{"page_url":"https://en.wikipedia.org/wiki/Scott_Moir","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/2016_GPF_-_Tessa_Virtue_and_Scott_Moir_-_03.jpg","page_title":"Scott Moir","context_page_description":"Scott Patrick Moir is a retired Canadian ice dancer. With ice dance partner Tessa Virtue, he is the 2010 and 2018 Olympic champion, the 2014 Olympic silver medalist, a three-time World champion, a three-time Four Continents champion, the 2016–17 Grand Prix Final champion, an eight-time Canadian national champion, and the 2006 World Junior champion. Moir and Virtue are also the 2018 Olympic gold medalists in the team event and the 2014 Olympic silver medalists in the team event. They are the most decorated Canadian ice dance team of all time and the most decorated Olympic figure skaters of all time.\\nVirtue and Moir were paired in 1997, at the ages of seven and nine. They are the 2004 Canadian junior champions and became Canada's top ice dance team in 2007. They are the 2008 World silver medalists and the 2009 World bronze medalists and became the first ice dance team to receive a 10.0 for a program component score under the new ISU Judging System. In 2010, they became the first ice dancers from North America to win an Olympic gold medal, ending the 34-year streak of the Europeans. They are the youngest ice dance team ever to win an Olympic title."},{"page_url":"https://ms.wikipedia.org/wiki/Kevin_Woo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Kevin_U-Kiss_Dream_Concert_2013_Source-K-Soul_Magazine_%28cropped%29.jpg","page_title":"Kevin Woo","context_page_description":"Woo Sunghyun, juga dikenali sebagai Kevin Woo ialah penyanyi Korea-Amerika yang juga salah seorang ahli kumpulan lelaki Korea Selatan, U-KISS."},{"page_url":"https://ceb.wikipedia.org/wiki/Okres_N%C3%A1chod","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Nachod_square_castle.jpg","page_title":"Okres Náchod","context_page_description":"Munisipyo ang Okres Náchod sa Nasod nga Czech. Nahimutang ni sa lalawigan sa Královéhradecký kraj, sa amihanan-sidlakang bahin sa nasod, 130 km sa sidlakan sa Prague ang ulohan sa nasod. Adunay 112,359 ka molupyo. Naglangkob kin og 852 ka kilometro kwadrado.\\nAng yuta sa Okres Náchod kay kasagaran kabungtoran, apan sa habagatang-kasadpan nga kini mao ang patag.\\nOkres Náchod may sa mosunod nga mga subdibisyon:\\nZaloňov\\nČervený Kostelec\\nBrzice\\nZábrodí\\nTeplice nad Metují\\nČernčice\\nČervená Hora\\nČeská Metuje\\nČeská Skalice\\nČeská Čermná\\nAdršpach\\nŘikov\\nŠestajovice\\nŠonov\\nŽernov\\nŽďár nad Metují\\nŽďárky\\nPolice nad Metují\\nHeřmánkovice\\nNáchod\\nDolany\\nStárkov\\nMezilesí\\nVysoká Srbská\\nBezděkov nad Metují\\nBohuslavice\\nBorová\\nBožanov\\nRychnovek\\nVelichovky\\nSlatina nad Úpou\\nVlkov\\nBroumov\\nJaroměř\\nBukovice\\nHynčice\\nHronov\\nNové Město nad Metují\\nChvalkovice\\nMeziměstí\\nHořičky\\nHořenice\\nVelký Třebešov\\nLitoboř\\nHejtmánkovice\\nHeřmanice\\nHorní Radechová\\nVysokov\\nVestec\\nJasenná\\nJestřebí\\nJetřichov\\nSendraž\\nRožnov\\nKramolna\\nSlavětín nad Metuji\\nKřinice\\nLhota pod Hořičkami\\nMachov\\nMartínkovice\\nMezilečí\\nVelké Petrovice\\nSuchý Důl\\nNahořany\\nNový Hrádek\\nNový Ples\\nVernéřovice\\nOtovice\\nVršovka\\nRasošky\\nPřibyslav\\nVelká Jesenice"},{"page_url":"https://hr.wikipedia.org/wiki/Tra%C4%8Danska_grobnica_u_Kazanl%C4%83ku","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Kazanlak-tomb_4.jpg","page_title":"Tračanska grobnica u Kazanlăku","context_page_description":"Tračanska grobnica u Kazanlku je tračanska grobnica od opeke nadsvođena u obliku košnice.\\nNalazila se pored tračanske prijestolnice Seuthopolisa, a sastoji se od uskog prolaza i okrugle grobne komore, koje su oslikane zidnim slikama iz helenističkog razdoblja. U središnjoj komori prikazan je tračanski par na pogrobnoj gozbi koji se hvata za ruke u prisnoj gesti. Pored toga tu je sjajan prikaz konja i skupine koja se oprašta. To su najbolje sačuvane slike naroda Tračana. Od 1979. godine upisana je na UNESCO-v popis mjesta svjetske baštine u Europi.\\nU ljeto 2004. godine pronađen je i veliki tračanski mauzolej iz 5. st. pr. Kr. u susjednom gradu Šipki, tzv. Golema Kosmatka."},{"page_url":"https://fr.wikipedia.org/wiki/Belcaire","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Coucher_de_soleil_au_lac_de_Belcaire.jpg","page_title":"Belcaire","context_page_description":"Belcaire est une commune française, située dans le département de l'Aude en région Occitanie. Ses habitants sont appelés les Belcairois. Le village était le chef lieu de l'ancien canton du même nom."},{"page_url":"https://en.wikipedia.org/wiki/Sustainable_living","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Ganjiaxiang_-_edible_landscaping_-_P1070640.JPG","page_title":"Sustainable living","context_page_description":"Sustainable living describes a lifestyle that attempts to reduce an individual's or society's use of the Earth's natural resources, and one's personal resources. It is often called as \\"earth harmony living\\" or \\"net zero living\\". Its practitioners often attempt to reduce their ecological footprint by altering their methods of transportation, energy consumption, and/or diet. Its proponents aim to conduct their lives in ways that are consistent with sustainability, naturally balanced, and respectful of humanity's symbiotic relationship with the Earth's natural ecology. The practice and general philosophy of ecological living closely follows the overall principles of sustainable development.\\nLester R. Brown, a prominent environmentalist and founder of the Worldwatch Institute and Earth Policy Institute, describes sustainable living in the twenty-first century as \\"shifting to a renewable energy-based, reuse/recycle economy with a diversified transport system.\\" Derrick Jensen, a celebrated American author, radical environmentalist and prominent critic of mainstream environmentalism argues that \\"industrial civilization is not and can never be sustainable\\"."},{"page_url":"https://en.wikipedia.org/wiki/School_integration_in_the_United_States","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/NAEP-longterm-Black-reading-ss07-13.gif","page_title":"School integration in the United States","context_page_description":"School integration in the United States is the process of ending race-based segregation within American public and private schools. Racial segregation in schools existed throughout most of American history and remains an issue in contemporary education. During the Civil Rights Movement school integration became a priority, but since then de facto segregation has again become prevalent.\\nSchool segregation declined rapidly during the late 1960s and early 1970s. Segregation appears to have increased since 1990. The disparity in the average poverty rate in the schools whites attend and blacks attend is the single most important factor in the educational achievement gap between white and black students."},{"page_url":"https://no.wikipedia.org/wiki/Messepromenaden_(Oslo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Messepromenaden.jpg","page_title":"Messepromenaden (Oslo)","context_page_description":"Messepromenaden er en gangvei på Skøyen i Oslo. Den går sørover fra Karenslyst allé og over Bygdøylokket mot Bestumkilen.\\nNavnet ble vedtatt i 2005 og henspiller på Norges Varemesse, som tidligere lå på sørsiden av Messeveien. Nå er det i stedet boligblokker i området, som går under navnet Sjølyststranda."},{"page_url":"https://pt.wikipedia.org/wiki/Ossen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Ossen.JPG","page_title":"Ossen","context_page_description":"Ossen é uma comuna francesa na região administrativa de Occitânia, no departamento dos Altos Pirenéus. Estende-se por uma área de 6,91 km². Em 2010 a comuna tinha 191 habitantes."},{"page_url":"https://fr.wikipedia.org/wiki/Walter_Kistler","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Walter_Kistler.jpg","page_title":"Walter Kistler","context_page_description":"Walter P. Kistler est un physicien, inventeur et philanthrope suisse. Kistler est membre permanent de la société suisse de physique et un membre de l'AIAA et de l'ISA, qui lui ont remis en 2000 un prix pour l'ensemble de son œuvre. Il fait partie de la liste du Who's Who en aviation, en finance et dans le monde parmi les hommes de sciences. Il possède les brevets de plus de 50 inventions dans le domaine des instruments scientifiques et industriels, et a publié un bon nombre d'articles dans des journaux de références en sciences et commerce."},{"page_url":"https://hr.wikipedia.org/wiki/Francuska_knji%C5%BEevnost","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Louis-Michel_van_Loo_001.jpg","page_title":"Francuska književnost","context_page_description":"Francuska književnost smatra se jednom od najbogatijih i najraznolikijih književnosti, najznačajnija zbog svog istraživanja ljudskog društva i pozicija individualca u društvu. Francuska književnost ne obuhvaća frankofonijsku književnost – djela pisana na francuskom, no u drugim zemljama kao što su Kanada i Senegal.\\nFrancuska književnost reflektira kulturnu i političku povijest Francuske. Do Francuske revolucije 1789., Francuska je imala društveno uređenje prema klasnom statusu, s pravilima koja su određivala kako se pripadnici jedne klase trebaju odnositi prema članovima druge klase. Pogled kulture i društva slijedio je hijerarhijsku strukturu društva, uključujući i književne žanrove i stilove. Hijerarhija žanrova imala je epiku na vrhu, a prozne žanrove, kao romane, na dnu.\\nFrancuska revolucija, koja je trajala od 1789. do 1799., bila je ključni period u francuskoj povijesti, a označila je i temeljitu promjenu u francuskoj književnosti. Povedena u ime jednakosti i slobode, donijela je demokratski duh koji je izjednačio klase, privilegije i hijerarhijsku podjelu u vladi i svim drugim područjima društva."},{"page_url":"https://en.wikipedia.org/wiki/T%C5%8Dten_Miyazaki","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Miyazaki_Toten.jpg","page_title":"Tōten Miyazaki","context_page_description":"Tōten Miyazaki or Torazō Miyazaki was a Japanese philosopher who aided and supported Sun Yat-sen during the Xinhai Revolution. While Sun was in Japan, he assisted Sun in his travels as he was wanted by Qing dynasty authorities."},{"page_url":"https://en.wikipedia.org/wiki/1917_in_art","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/HGM_H%C3%B6ger_Nach_dem_Vorsto%C3%9F.jpg","page_title":"1917 in art","context_page_description":"The year 1917 in art involved some significant events and new works."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A0%E3%83%BC%E3%82%A2%E3%83%98%E3%83%83%E3%83%89_(%E3%83%9F%E3%83%8D%E3%82%BD%E3%82%BF%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/MoorheadMN_Downtown.jpg","page_title":"ムーアヘッド (ミネソタ州)","context_page_description":"ムーアヘッドは、アメリカ合衆国ミネソタ州北西部に位置する都市。ノースダコタ州との州境になっている北のレッド川東岸、ファーゴの対岸に位置し、同市と共に都市圏を形成している。人口は38,065人で、州北西部では最大、ミネアポリス・セントポール都市圏外の都市としてはロチェスター、ダルース、セントクラウド、マンケイトに次ぐ規模である。ファーゴに郡庁を置くノースダコタ州カス郡、およびムーアヘッドに郡庁を置くクレイ郡の2郡から成る都市圏は人口208,777人を数える。この都市圏にワーペトン小都市圏を加えた広域都市圏は231,674人の人口を抱えている。"},{"page_url":"https://cs.wikipedia.org/wiki/Bulgar","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/%D0%91%D0%BE%D0%BB%D0%B3%D0%B0%D1%80_%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%89%D0%B5_013.JPG","page_title":"Bulgar","context_page_description":"Bulgar je zaniklé město někdejšího Volžského Bulharska, později jedno z největších měst Kazaňského knížectví Zlaté hordy. Hradiště se nachází v blízkosti nynějšího města Bolgar v ruské republice Tatarstán.\\nBulgar byl založen volžskými Bulhary v 10. století, roku 1361 vypleněn vojsky Zlaté hordy. Potom byl opět obnoven, ale roku 1431 jej zničil ruský vévoda Fjodor Pjostryj, načež byl Bulgar opuštěn a již nikdy nebyl obnoven.\\nRoku 2014 byl bulgarský historický a archeologický komplex zanesen na seznam světového dědictví UNESCO. Zahrnuje pozůstatky opevnění města, mešity, lázní, hrobek a jiných středověkých staveb povolžských muslimů."},{"page_url":"https://sv.wikipedia.org/wiki/Theodor_Weissman","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Tettu_Weissman.jpg","page_title":"Theodor Weissman","context_page_description":"Theodor \\"Tettu\\" Mauritz Jacob Weissman, ursprungligen Weissmann, född 1 januari 1891 i Tavastehus, död 29 mars 1966 i Helsingfors, var en finländsk kuplett- och schlagersångare, sångtextförfattare och operettskådespelare. Weissman skrev sig även som Teddy Weissman, Theo Weissman och Th. Weissmann.\\nWeissman var på 1920-talet en av Finlands mest kända kuplettsångare och var en mycket aktiv skådespelare inom både operetter och lustspel. Hans skådespelarkarriär inleddes omkring 1913 och varade fram till 1930-talet och därunder var han verksam vid flera teatrar och skådespelarensembler. Som kuplettsångare uppträdde han både på biografer, kaféer och restauranger runt om i Finland. På 1910- och 1920-talen gjorde han en större mängd skivinspelningar och var en av de aktiva grammofonsångarna under den stora grammofonfebern. När kupletterna blev omoderna på slutet av 1920-talet försökte Weissman anpassa sig till schlagermusiken, men övergav inom kort den konstnärliga banan för att ägna sig åt affärsverksamhet."},{"page_url":"https://simple.wikipedia.org/wiki/Morona-Santiago_Province","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Escudo_de_la_Provincia_de_Morona_Santiago.png","page_title":"Morona-Santiago Province","context_page_description":"Morona Santiago is a province in Ecuador. The province was created on February 24, 1954. The capital is Macas.\\nSangay National Park is in the province."},{"page_url":"https://fr.wikipedia.org/wiki/Chapelle_Notre-Dame-de-la-Course-Landaise","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/NDDLCL_Saint_Luc.JPG","page_title":"Chapelle Notre-Dame-de-la-Course-Landaise","context_page_description":"La chapelle Notre-Dame-de-la-Course-Landaise, datant probablement du XVᵉ siècle, se situe à Bascons, dans le département français des Landes. Établie en rase campagne, à 1 km au sud-ouest des arènes du quartier de Bostens, cette chapelle, rénovée par l'abbé Xavier Tapie, est la seule du genre, entièrement dédiée à la course landaise."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%82%B9%E3%83%88%E3%83%99%E3%83%BC%E3%83%B4%E3%82%A7%E3%83%AB%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Ostbevern%2C_St.-Ambrosius-Kirche_--_2014_--_8513_--_Ausschnitt.jpg","page_title":"オストベーヴェルン","context_page_description":"オストベーヴェルン は、ドイツ連邦共和国ノルトライン＝ヴェストファーレン州ミュンスターラントに属すヴァーレンドルフ郡の町村である。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_L%C3%B6btau","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/B%C3%BCnaustr26_dresden1_mosaik.JPG","page_title":"Liste der Kulturdenkmale in Löbtau","context_page_description":"Die Liste der Kulturdenkmale in Löbtau umfasst sämtliche Kulturdenkmale der Dresdner Gemarkung Löbtau. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Dresden.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%90%95%E5%BD%A6%E7%9B%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Tianyanlun.jpg","page_title":"吕彦直","context_page_description":"呂彥直，字仲宜，別號古愚，生於天津，祖籍山東東平縣彭集鎮呂家廟村。中國著名建築師，曾設計南京中山陵、廣州中山紀念堂及中山紀念碑等建築。在《建築五宗師》書中與劉敦楨、童寯、梁思成、楊廷寶合稱「建築五宗師」。"},{"page_url":"https://en.wikipedia.org/wiki/CDC25B","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/PDB_1cwt_EBI.jpg","page_title":"CDC25B","context_page_description":"M-phase inducer phosphatase 2 is an enzyme that in humans is encoded by the CDC25B gene.\\nCDC25B is a member of the CDC25 family of phosphatases. CDC25B activates the cyclin dependent kinase CDC2 by removing two phosphate groups and it is required for entry into mitosis. CDC25B shuttles between the nucleus and the cytoplasm due to nuclear localization and nuclear export signals. The protein is nuclear in the M and G1 phases of the cell cycle and moves to the cytoplasm during S and G2. CDC25B has oncogenic properties, although its role in tumor formation has not been determined. Multiple transcript variants for this gene exist."},{"page_url":"https://en.wikipedia.org/wiki/Cake","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Chocolate_fudge_cake_%288768339071%29.jpg","page_title":"Cake","context_page_description":"Cake is a form of sweet food made from flour, sugar, and other ingredients, that is usually baked. In their oldest forms, cakes were modifications of bread, but cakes now cover a wide range of preparations that can be simple or elaborate, and that share features with other desserts such as pastries, meringues, custards, and pies.\\nThe most commonly used cake ingredients include flour, sugar, eggs, butter or oil or margarine, a liquid, and leavening agents, such as baking soda or baking powder. Common additional ingredients and flavourings include dried, candied, or fresh fruit, nuts, cocoa, and extracts such as vanilla, with numerous substitutions for the primary ingredients. Cakes can also be filled with fruit preserves, nuts or dessert sauces, iced with buttercream or other icings, and decorated with marzipan, piped borders, or candied fruit.\\nCake is often served as a celebratory dish on ceremonial occasions, such as weddings, anniversaries, and birthdays. There are countless cake recipes; some are bread-like, some are rich and elaborate, and many are centuries old."},{"page_url":"https://simple.wikipedia.org/wiki/Salzlandkreis","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1e/Saxony_anhalt_slk.png","page_title":"Salzlandkreis","context_page_description":"Salzland is a district in the middle of Saxony-Anhalt, Germany."},{"page_url":"https://en.wikipedia.org/wiki/Pat_Zachry","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Pat_Zachry_%28coach%29_-_San_Antonio_Missions_-_1988.jpg","page_title":"Pat Zachry","context_page_description":"Patrick Paul Zachry is a former professional baseball pitcher. He pitched in Major League Baseball from 1976 to 1985, and is likely best remembered as one of the players the Cincinnati Reds sent to the New York Mets in the infamous \\"Midnight Massacre\\"."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%83%91%E5%B7%9E%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Pagoda_Forest%2C_Shaolin_Temple_-_September_2011_%286169489040%29.jpg","page_title":"郑州市","context_page_description":"鄭州市，簡稱「鄭」，古稱商都，今為綠城，是河南省的省會，國家歷史文化名城，國家中心城市，中國特大城市，重要的綜合交通樞紐。鄭州市是全省重要的鐵路、航空、高速公路、電力、郵政電信主樞紐城市，擁有中國首個國家級航空港經濟綜合實驗區-鄭州航空港經濟綜合試驗區。鄭州市是中國普通鐵路和高速鐵路網中唯一的「雙十字」中心，也是中國大陸首批跨境電子貿易試點城市和國家級網際網路骨幹直聯點城市。\\n鄭州位於河南省中部偏北，黃河下游。現轄6個市轄區，代管5個縣級市和1個縣，全市總面積7,567.18平方公里，其中市區面積1,078.07平方公里。2018年，全市常住人口1012萬，其中市區常住人口近600萬。居民以漢族為主，母語為中原官話的鄭州方言。\\n鄭州地級市轄區曾是包括出生於新鄭的中華人文始祖軒轅氏所領的有熊國以及夏朝、商朝、管國、鄭國和韓國在內的這些部落聯盟或國家部分時期建政或建都所在地，因此被列為中國八大古都區之一。\\n鄭州市核心區也有悠久的歷史。如采納從鄭州商城遺址算起，鄭州已經有3600多年的城建史。考古人員於1995年在鄭州北郊邙嶺余脈發現的西山古城遺址又把鄭州地區城市出現時間提前到距今約5300年的仰韶文化晚期，被視為中國城市文明的源頭。清末大臣盛宣懷奉旨勘察蘆漢鐵路時來到鄭州，將鄭州站闢為甲等火車站，直接影響了鄭州近代發展進程。\\n鄭州古代為「豫州」和「中州」的一部分，自古至今均為交通要塞，有「九州之中，十省通衢」之稱，如今鄭州北站仍是中國最大的鐵路編組站之一。因為商朝早期的都城在如今的鄭州境內，鄭州有「商都」的雅號。同時，鄭州被認為是中國商業的發源地之一，又是中國國務院確立的商貿中心試點城市之一，因此「商都」也具有了「商業之都」的含義。鄭州以打造都市區，建設國家中心城市為目標，遠景規劃到2020年，市區總人口達到1500萬以上，建成區面積達到800平方公里。"},{"page_url":"https://zh.wikipedia.org/zh-cn/%E7%BE%8E%E5%9B%BD%E6%B5%B7%E5%86%9B%E9%83%A8%E9%95%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Francis_P._Matthews.jpg","page_title":"美国海军部长","context_page_description":"美国海军部长是美国海军部的文职首长。\\n该职位在1947年之前是美国总统内阁阁员，之后因为美国国防部取代海军、陆军和空军部，因此海军部长成为国防部长的下属职位。美国海军部长根据国家安全法必须为美国公民，退离现役军职至少5年以上同时由美国总统提名参议院多数票选举追认。美国海军部长自其设立的1789年直到1949年一直是美国总统内阁的成员之一。根据1947年美国国家安全法修正案，海军部与陆军部空军部于1949年合并为国防部，同时海军部长成为国防部长的隶属职位之一。海军部长没有特定的任期，其任免解职由总统和国防部长决定。"},{"page_url":"https://zh.wikipedia.org/wiki/%E8%AF%BA%E8%B4%9D%E5%B0%94%E7%BB%8F%E6%B5%8E%E5%AD%A6%E5%A5%96%E5%BE%97%E4%B8%BB%E5%88%97%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/James_Meade_Nobel.jpg","page_title":"诺贝尔经济学奖得主列表","context_page_description":"诺贝尔经济学奖，正式名称为“瑞典中央银行纪念阿尔弗雷德·诺贝尔经济学奖”，是由瑞典皇家科学院每年颁发给经济学领域研究人员的奖项。首次颁奖是在1969年，得奖人有两位，分别是朗纳·弗里施和扬·廷贝亨。每位获奖者将得到一枚奖牌，一份证书和奖金，奖金的数额已经有过多次调整。1969年时弗里施和廷贝亨一共获得了37万5000瑞典克朗，相当于2007年12月的287万1041瑞典克朗。这个奖项于每年的12月10日，诺贝尔的忌日在斯德哥尔摩举行的仪式上颁发。\\n截止至2019年10月，诺贝尔经济学奖一共颁发了51次，共有84人获奖。获奖者研究领域包含宏观经济学的占9次，比其它任何领域都要多。其中，有32位经济学奖得主与芝加哥大学有关，超过其他任何一个机构。"},{"page_url":"https://ca.wikipedia.org/wiki/Stephanie_Swift","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f4/Stephanie_Swift_at_Sexxxpose_Party_1.jpg","page_title":"Stephanie Swift","context_page_description":"Stephanie Swift és una actriu porno nord-americana. Ha rodat més de 350 pel·lícules i forma part dels Salons de la Fama d'AVN i XRCO."},{"page_url":"https://de.wikipedia.org/wiki/Dingdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/St._Josef_%28Dingdorf%29_03.jpg","page_title":"Dingdorf","context_page_description":"Dingdorf ist eine Ortsgemeinde im Eifelkreis Bitburg-Prüm in Rheinland-Pfalz. Sie gehört der Verbandsgemeinde Prüm an."},{"page_url":"https://no.wikipedia.org/wiki/Kristiansand_domkirke","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Kristiansand_domkyrkje_orgelet..jpg","page_title":"Kristiansand domkirke","context_page_description":"Kristiansand domkirke er hovedkirke for Agder og Telemark bispedømme og menighetskirke for Domkirken menighet i Kristiansand. Den nåværende kirken er den tredje domkirken i byen og den fjerde kirken på Torvet i Kristiansand."},{"page_url":"https://es.wikipedia.org/wiki/Gran_Hotel_Bali","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/6e/Gran_bali.jpg","page_title":"Gran Hotel Bali","context_page_description":"El Gran Hotel Bali es un rascacielos destinado a hotel de 186 metros y 45 plantas situado en Benidorm. Fue inaugurado el 17 de mayo del año 2002 y es el segundo hotel más alto de Europa y fue el edificio más alto de España desde que sobrepasó a la Torre Picasso hasta noviembre de 2006 tras ser superado por la Torre Espacio.\\nTiene un total de 186 metros, a pesar de que el plan parcial de construcción preveía una altura de 210 metros. La instalación es de cuatro estrellas, y cuenta con 45 plantas —cuatro de ellas técnicas— y 776 habitaciones.​ Tuvo un coste de 90 millones de euros.​\\nTras la construcción del Intempo, ha pasado a ser el segundo edificio más alto de la localidad."},{"page_url":"https://en.wikipedia.org/wiki/Demegestone","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Demegestone_3D_ball.png","page_title":"Demegestone","context_page_description":"Demegestone, sold under the brand name Lutionex, is a progestin medication which was previously used to treat luteal insufficiency but is now no longer marketed. It is taken by mouth.\\nDemegestone is a progestin, or a synthetic progestogen, and hence is an agonist of the progesterone receptor, the biological target of progestogens like progesterone. It has no androgenic activity.\\nDemegestone was first described in 1966 and was introduced for medical use in France in 1974. It has only been marketed in France, and has since been discontinued in this country."},{"page_url":"https://pl.wikipedia.org/wiki/Worek_grzyba","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Morelasci.jpg","page_title":"Worek grzyba","context_page_description":"Worek – specjalna komórka o charakterze zarodni, w której w wyniku rozmnażania płciowego zwanego askogamią powstają haploidalne zarodniki – askospory. Worki wytwarzane są przez grzyby z gromady workowców. Liczba zarodników w worku jest stała; najczęściej jest to 8 zarodników, rzadziej 4 lub 6. Zdarzają się jednak również inne liczby zarodników, np. u wielosporka brunatnego w jednym worku powstaje ponad 100 zarodników.\\nU niektórych grzybów o prostej budowie, jak np. u szpetczaków, worki ustawione są gęsto obok siebie, nie tworząc żadnej struktury. U większości gatunków grzybów jednak worki tworzą bardziej złożone struktury zwane owocnikami. W owocnikach tych oprócz worków znajdują się różne inne strzępki określane nazwą hamatecjum.\\nKształt worka\\nWorki najczęściej mają kształt cylindryczny, ale u różnych grup grzybów mają też inne kształty: kulisty, jajowaty, odwrotnie jajowaty, gruszkowaty, maczugowaty. Kuliste lub niemal kuliste worki przeważnie występują w owocnikach typu klejstotecjum i są w nich ułożone bezładnie. Worki o wydłużonym kształcie występują w owocnikach typu apotecjum, perytecjum, pseudotecjum i zazwyczaj są w nich ułożone regularnie."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Bad_Staffelstein","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Unterzettlitz-Bildstock-283.jpg","page_title":"Liste der Baudenkmäler in Bad Staffelstein","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberfränkischen Stadt Bad Staffelstein zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://pl.wikipedia.org/wiki/Guepinia","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/R%C3%B6tliche_Gallerttrichter_Tremiscus_helvelloides.jpg","page_title":"Guepinia","context_page_description":"Guepinia Fr. – rodzaj grzybów z rzędu uszakowców. W Polsce występuje jeden gatunek."},{"page_url":"https://hu.wikipedia.org/wiki/Nicea_ostroma_(1097)","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/Nik%C3%A1ja3.jpg","page_title":"Nicea ostroma (1097)","context_page_description":"Nicea ostroma az első keresztes hadjárat első összecsapása volt 1097. május 14. és június 19. között a bizánci segédcsapatokkal megerősített keresztesek és az Ikóniumi Szultánság csapatai közt. Az összecsapás a szeldzsuk csapatok vereségével ért véget, a bizánciak azonban rögtön birtokukba vették a várost annak eleste után, kivívva ezzel a keresztesek ellenszenvét, mely hosszabb távon káros következményekkel járt a két fél kapcsolatára nézve."},{"page_url":"https://cy.wikipedia.org/wiki/Alpine_County,_Califfornia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Alpine_county_sign.jpg","page_title":"Alpine County, Califfornia","context_page_description":"Sir yn nhalaith Califfornia, Unol Daleithiau America yw Alpine County. Cafodd ei henwi ar ôl Alpau. Sefydlwyd Alpine County, Califfornia ym 1864 a sedd weinyddol y sir yw Markleeville.\\nMae ganddi arwynebedd o 1,925 cilometr sgwâr. Allan o'r arwynebedd hwn, y canran o ffurfiau dyfrol, megis llynnoedd ac afonydd, yw 0.54%. Yn ôl cyfrifiad y wlad, poblogaeth y sir yw: 1,129. Mewn cymhariaeth, yn 2016 roedd poblogaeth Caerdydd yn 361,462 a Rhyl tua 26,000.\\nMae'n ffinio gyda Mono County, Tuolumne County, Calaveras County, Amador County, El Dorado County, Douglas County. Ceir 9 cylchfa amser yn UDA, ac mae'r sir hon yn perthyn i'r cylchfa amser a elwir yn Cylchfa Amser y Cefnfor Tawel. Cedwir rhestr swyddogol o henebion ac adeiladau cofrestredig y sir yn: National Register of Historic Places listings in Alpine County, California."},{"page_url":"https://de.wikipedia.org/wiki/Liste_von_Burgen_und_Schl%C3%B6ssern_in_Oberfranken","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Forsthaus_Oberwaiz.JPG","page_title":"Liste von Burgen und Schlössern in Oberfranken","context_page_description":"Die Liste von Burgen und Schlössern in Oberfranken ist ein Verzeichnis von historischen Orten, wie Burgen, Schlössern, Herrensitzen, Festungen, Motten, Burgställen und Wehrkirchen auf dem Territorium des heutigen Regierungsbezirks Oberfranken, aufgeteilt in kreisfreie Städte und Landkreise. Es gibt weitere Listen für die Regierungsbezirke Oberbayern, Niederbayern, Oberpfalz, Mittelfranken, Unterfranken und Schwaben. Nicht aufgeführt sind Zier- und Nachbauten, die nie als Wohngebäude oder zur Verteidigung genutzt wurden."},{"page_url":"https://de.wikipedia.org/wiki/%C5%A0koda_Auto","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/%C5%A0koda_Auto_Mlad%C3%A1_Boleslav.jpg","page_title":"Škoda Auto","context_page_description":"Škoda Auto a.s. ist ein tschechischer Automobil- und Motorenhersteller, der 1895 als Fahrradhersteller Laurin & Klement von Václav Laurin und Václav Klement gegründet wurde und 1905 das erste Automobil fertigte. 2020 feiert Škoda seinen 125. Geburtstag und gehört damit zu den ältesten Unternehmen dieser Branche.\\nDer Maschinenbaukonzern Škoda kaufte 1925 die durch den Ersten Weltkrieg geschwächte Gesellschaft auf. Dadurch erhielten Fahrzeuge das Emblem Laurin & Klement – Škoda, neue Modelle kamen ab 1925 nur noch als Škoda auf den Markt. Namensgeber war der Industrielle und Ingenieur Emil von Škoda. 1930 erhielt der Automobilhersteller innerhalb des Konzerns den Namen Akciová společnost pro automobilový průmysl mit der Abkürzung ASAP. Nach der Zerschlagung der Tschechoslowakei im Jahr 1939 durch Einmarsch deutscher Truppen im Zweiten Weltkrieg wurde der Automobilhersteller Teil der deutschen Reichswerke Hermann Göring. Nach dem Zweiten Weltkrieg wurden die Automobilwerke im Jahr 1945 verstaatlicht, die Automobilsparte ASAP als Automobilové závody, národní podnik mit der Abkürzung AZNP aus dem Mischkonzern ausgegliedert und seither planwirtschaftlich betrieben."},{"page_url":"https://de.wikipedia.org/wiki/Volvo","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Powerhouse_Coach_-_luxury_motor_coach_based_on_Volvo_NH12.jpg","page_title":"Volvo","context_page_description":"Die Volvo Group ist ein börsennotierter diversifizierter schwedischer Hersteller von Nutzfahrzeugen, der Omnibusse und Fahrwerke unter den Marken Volvo, Prevost, Nova Bus und MASA, Lastkraftwagen der Marken Volvo, Renault, Mack und Nissan sowie Baumaschinen und Bootsmotoren herstellt.\\nVolvo wurde 1927 ursprünglich als Pkw-Hersteller gegründet, verkaufte den Geschäftsbereich Volvo Car Corporation jedoch 1999 an Ford, das diesen 2010 wiederum an die chinesische Geely-Gruppe verkaufte. Die Marke Volvo und das Markenzeichen wurden 1999 auf die Volvo Trade Mark Holding übertragen; sie werden von der Volvo Group und der Volvo Car Corporation gemeinsam genutzt. Im Dezember 2017 wurde bekannt, dass der Eigner von Volvo Cars, der chinesische Fahrzeugkonzern Zhejiang Geely Holding Group Co. Ltd., mit 8,2 % größter Anteilseigner der Nutzfahrzeugsparte Volvo Group geworden ist."},{"page_url":"https://en.wikipedia.org/wiki/Ukrspetsexport","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/%D0%A3%D0%BA%D1%80%D1%81%D0%BF%D0%B5%D1%86%D1%8D%D0%BA%D1%81%D0%BF%D0%BE%D1%80%D1%82.jpg","page_title":"Ukrspetsexport","context_page_description":"Ukrspecexport is a Ukrainian state-owned arms trading company and part of the state conglomerate Ukrainian Defense Industry. UKRSPECEXPORT was formed in November 1996 by merging Ukroboronservice and Ukrinmash.\\nUKRSPECEXPORT SC not only sells the products of the Ukrainian arms industry, but also the excess weapons of the Armed Forces of Ukraine inherited from the Soviet Armed Forces. Since February 2011 the company also produces non-military firearms and ammunition for them.\\nIn documents uncovered during the United States diplomatic cables leak U.S.-diplomats complained the U.S. is fighting a constant battle to stop the flow of arms from Ukraine and Ukrspecexport to terrorist in the Middle East and South Sudan."},{"page_url":"https://ca.wikipedia.org/wiki/Amblyeleotris","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Goby_fish_with_shrimp.jpg","page_title":"Amblyeleotris","context_page_description":"Amblyeleotris és un gènere de peixos de la família dels gòbids i de l'ordre dels perciformes."},{"page_url":"https://it.wikipedia.org/wiki/Compagnia_aerea_cargo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Beluga_Airbus.jpg","page_title":"Compagnia aerea cargo","context_page_description":"Una compagnia aerea cargo è una compagnia aerea dedicata al trasporto merci. Alcune compagnie aeree cargo sono divisioni o filiali di compagnie aeree passeggeri più grandi."},{"page_url":"https://cs.wikipedia.org/wiki/Brand%C3%BDs_nad_Orlic%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Brand%C3%BDs_nad_Orlic%C3%AD%2C_kostel.jpg","page_title":"Brandýs nad Orlicí","context_page_description":"Brandýs nad Orlicí je město v okrese Ústí nad Orlicí v Pardubickém kraji. Rozkládá na obou březích řeky Tiché Orlice na spojnici okresního města Ústí nad Orlicí, vzdáleného 11 km východním směrem, a Chocně, ležící 5 km západně od Brandýsa. Má přibližně 1 300 obyvatel a rozlohu 434 ha. Městem prochází železniční tah Pardubice – Česká Třebová. Historické jádro města je od roku 1995 městskou památkovou zónou."},{"page_url":"https://ja.wikipedia.org/wiki/XLR%E3%82%BF%E3%82%A4%E3%83%97%E3%82%B3%E3%83%8D%E3%82%AF%E3%82%BF%E3%83%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/81/XLR_pinouts.svg","page_title":"XLRタイプコネクター","context_page_description":"XLRタイプコネクターとは、米キャノン社が開発したXLR型オーディオコネクター及びその互換品を指す。一般にキャノンコネクターとも呼ばれる。米キャノン社は光学機器製造企業のキヤノンとは無関係である。本製品を得意とするリヒテンシュタインNEUTRIK社の社名をとってノイトリックコネクターとも呼ばれる。IEC規格になっている。"},{"page_url":"https://de.wikipedia.org/wiki/Persic","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/PERSIC_on_left_and_CERAMIC_on_right%2C_both_of_the_White_Star_Line._%283308338040%29.jpg","page_title":"Persic","context_page_description":"Die Persic war ein 1899 in Dienst gestelltes Passagierschiff der britischen Reederei White Star Line, das im Passagier- und Frachtverkehr von Großbritannien über Kapstadt nach Australien eingesetzt wurde. Es wurde 1927 abgewrackt."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%BE%D0%BB%D0%B4%D0%B0%D0%B2%D0%B0%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D1%81%D0%B5%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5_%D0%BF%D0%BE%D1%81%D0%B5%D0%BB%D0%B5%D0%BD%D0%B8%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c7/Flag_of_Moldavanskoe_%28Krasnodar_krai%29.png","page_title":"Молдаванское сельское поселение","context_page_description":"Молдаванское сельское поселение — муниципальное образование в составе Крымского района Краснодарского края России.\\nАдминистративный центр — село Молдаванское."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D1%83%D0%B4%D0%B8%D1%82%D0%BE%D1%80%D0%B8%D0%BE_%D0%B4%D0%B5_%D0%A2%D0%B5%D0%BD%D0%B5%D1%80%D0%B8%D1%84%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Auditorio_de_Tenerife%2C_Santa_Cruz_de_Tenerife%2C_Espa%C3%B1a%2C_2012-12-15%2C_DD_20.jpg","page_title":"Аудиторио де Тенерифе","context_page_description":"„Аудиторио де Тенерифе Адан Мартин“ е конгресно-концертна зала в град Санта Крус де Тенерифе на остров Тенерифе – столицата на автономна област Канарски острови, Испания. Тя се намира край пристанището на града в непосредствена близост до морето."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%80%D5%A1%D5%B5%D5%A1%D5%BD%D5%BF%D5%A1%D5%B6%D5%AB_%D5%A1%D5%BE%D5%BF%D5%B8%D5%B4%D5%B8%D5%A2%D5%AB%D5%AC%D5%A1%D5%B5%D5%AB%D5%B6_%D5%B3%D5%A1%D5%B6%D5%A1%D5%BA%D5%A1%D6%80%D5%B0%D5%B6%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/H83_road_%28Armenia%29.png","page_title":"Հայաստանի ավտոմոբիլային ճանապարհներ","context_page_description":"Հայաստանի ավտոմոբիլային ճանապարհներ, ավտոմոբիլային տրանսպորտային ճանապարհների ցանց, որը հանդիսանում է Հայաստանի տրանսպորտային ցանցի հիմնական ու գլխավոր հատվածը։ Քանի որ Հայաստանը ունի թշնամական հարաբերություններ իր արևելյան ու արևմտյան հարևաններ՝ Թուրքիայի Հանրապետության ու Ադրբեջանի Հանրապետության հետ, ինչպես նաև չունի ելք դեպի ծով, ավտոմոբիլային ճանապարհները դարձել են Հայաստանի կենսունակության ապահովման հիմնական միջոցը։\\nՀայաստանի տարածքում գործում են մի քանի մակարդակի ավտոմոբիլային ճանապարհներ՝ միջպետական, հանրապետական, տեղական ավտոճանապարհներ։ Ավտոմոբիլային ճանապարհների ցանցը կազմված է տարբեր բարդության ճանապարհներից, վերջիններս իրար կապող կամուրջներից և թունելներից։"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B4%D8%A7%D8%B1%D9%84_%D8%B3%D8%A8%D9%88%D8%B1%D8%BA","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/ParcDesMoulins-Qu%C3%A9bec.jpg","page_title":"شارل سبورغ","context_page_description":"شارل سبورغ هي واحدة من ثماني دوائر في مدينة كيبك. وهي تقع شمال دائرة ليموالو، إلى الغرب من دائرة بوبور، وإلى الشرق من دائرتي البحيرات و سانت شارل العالية."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%A7%D9%88%DA%A9%D8%B3%DB%8C%D8%AF_%D9%88%D8%A7%D9%86%D8%A7%D8%AF%DB%8C%D9%88%D9%85_(III)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ee/Kristallstruktur_Aluminiumoxid.png","page_title":"اوکسید وانادیوم (III)","context_page_description":"اوکسید وانادیوم (III) بیر شیمیایی ماده. قارا رنگ‌لی تۇز حالتینده تاپیلار."},{"page_url":"https://de.wikipedia.org/wiki/Olympische_Sommerspiele_2016/Leichtathletik_%E2%80%93_Marathon_(M%C3%A4nner)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Scott_Westcott_Rio_2016.jpg","page_title":"Olympische Sommerspiele 2016/Leichtathletik – Marathon (Männer)","context_page_description":"Der Marathonlauf der Männer bei den Olympischen Spielen 2016 in Rio de Janeiro fand am 21. August 2016 statt. Start und Ziel befanden sich am Sambódromo im Zentrum Rio de Janeiros. 155 Athleten gingen an den Start, 140 konnten das Rennen beenden.\\nOlympiasieger wurde der Kenianer Eliud Kipchoge, der vor dem Äthiopier Feyisa Lilesa gewann. Galen Rupp aus den USA errang die Bronzemedaille.\\nDer Deutsche Philipp Pflieger kam als 55. ins Ziel, Julian Flügel als 71.\\nDer Schweizer Tadesse Abraham belegte Rang 7, Christian Kreienbühl Rang 76.\\nLäufer aus Österreich und Liechtenstein nahmen nicht teil.\\nDer aus Äthiopien stammende Yonas Kinde nahm als Flüchtling aus seinem Heimatland unter der olympischen Flagge und dem Kürzel ROT teil.\\nDie IAAF hatte im April 2015 2:17:00 h als Qualifikationszeit festgelegt, zu erbringen in einem Wettkampf zwischen dem 1. Januar 2015 und dem 11. Juli 2016. Im November 2015 wurde diese Zeit auf 2:19:00 h korrigiert."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%B1%D9%88%D9%86%D9%88_%D9%85%D9%8A%D8%B3%D9%8A%D8%B1%D9%84%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Bruno_Messerli.jpg","page_title":"برونو ميسيرلي","context_page_description":"برونو ميسيرلي ‏ جغرافي، وأستاذ جامعي من سويسرا."},{"page_url":"https://ceb.wikipedia.org/wiki/Comer%C3%ADo","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b5/Comerio.jpg","page_title":"Comerío","context_page_description":"Kapital sa munisipyo ang Comerío sa Purtoriko. Nahimutang ni sa baranggay sa Comerío Barrio-Pueblo ug munisipyo sa Comerío Municipio, sa sentro nga bahin sa nasod, 30 km sa habagatan sa San Juan ang ulohan sa nasod. 196 metros ibabaw sa dagat kahaboga ang nahimutangan sa Comerío, ug adunay 4,649 ka molupyo. Ang Comerío nahimutang sa pulo sa Purtoriko.\\nAng yuta palibot sa Comerío kay kasagaran medyo bungtoron. Comerío nahimutang sa usa ka walog. Dunay mga 591 ka tawo kada kilometro kwadrado sa palibot sa Comerío nga hilabihan populasyon. Ang kinadul-ang mas dakong lungsod mao ang Caguas, 18.8 km sa sidlakan sa Comerío. Hapit nalukop sa kaumahan ang palibot sa Comerío. Sa rehiyon palibot sa Comerío, mga walog talagsaon komon.\\nAng klima nga savanna. Ang kasarangang giiniton 22 °C. Ang kinainitan nga bulan Hunyo, sa 23 °C, ug ang kinabugnawan Enero, sa 20 °C. Ang kasarangang pag-ulan 1,329 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 187 milimetro nga ulan, ug ang kinaugahan Enero, sa 32 milimetro."},{"page_url":"https://en.wikipedia.org/wiki/South_Dakota_Highway_19","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/SD_19_and_44_Parker.jpg","page_title":"South Dakota Highway 19","context_page_description":"South Dakota Highway 19 is a 86.974-mile state highway in southeastern South Dakota, United States. It connects the Nebraska state line, south of Vermillion, with the southeastern part of the Madison area, via Viborg, Hurley, Parker, and Humboldt. SD 19 formerly entered Centerville, but was shifted to the south. Its former path was redesignated as SD 19A. Its former southern terminus was at Vermillion, but was extended when a new bridge from Nebraska opened."},{"page_url":"https://it.wikipedia.org/wiki/Elezioni_generali_in_Irlanda_del_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Miche%C3%A1l_Martin.jpg","page_title":"Elezioni generali in Irlanda del 2016","context_page_description":"Le elezioni generali in Irlanda del 2016 si sono tenute il 26 febbraio per eleggere i membri del Dáil Éireann, la camera bassa dell'Oireachtas della Repubblica d'Irlanda.\\nNonostante il Fine Gael del primo ministro Enda Kenny abbia mantenuto la maggioranza relativa dei seggi, la coalizione di governo formata da Fine Gael e Partito Laburista ha perso la maggioranza assoluta dei seggi in Parlamento."},{"page_url":"https://de.wikipedia.org/wiki/Bruno_Valencony","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Bruno_valencony.JPG","page_title":"Bruno Valencony","context_page_description":"Bruno Valencony ist ein ehemaliger französischer Fußballtorwart."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8F%A4%E5%B7%B4%E4%BA%BA%E5%8F%A3","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Cuba_Panorama_de_L%27Habana.jpg","page_title":"古巴人口","context_page_description":"古巴最早只有印第安原住民居住。在西班牙人殖民時期，古巴本地的印第安原住民被西班牙殖民者全部屠殺。而後，西屬古巴大量引進非洲黑奴從事勞役，進行奴隸買賣，使得古巴成為整個美洲的黑奴集散地。來自非洲的黑人因此幾乎占上古巴總人口的很大一部分，其它大多是西班牙人後裔。\\n古巴曾經有一些華僑，尤其在首都哈瓦那，但是大部分在菲德爾·卡斯楚1961年宣布古巴實行社會主義之後移居美國或其它國家。\\n古巴最普遍的宗教是天主教，其中包括一種非洲部落的信仰和天主教混合的分支。但是在卡斯楚之下的古巴，官方長期宣布古巴遵守無神論。1962年卡斯楚政府曾經強力關閉400多所天主教學校，聲稱這些學校散布威脅安全的信仰。1991年，古巴共產黨撤除宗教禁令。次年，憲法更改，宣布政府為非宗教性機關，但是不再反對宗教信仰。\\n雖然古巴不再禁止宗教，而且天主教發展為古巴最大的私人團體，其宗教自由卻並不完全。教堂不准自行出版書本，不准開學校，也沒有不受限制的與媒體聯絡。\\n1996年11月，古巴國務委員會主席、部長會議主席卡斯楚邀請教宗約翰·保羅二世訪問古巴。"},{"page_url":"https://fr.wikipedia.org/wiki/Lola_Voronina","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Lola_Voronina.jpg","page_title":"Lola Voronina","context_page_description":"Lola Voronina est une politicienne russe. Elle est membre du Parti Pirate de Russie."},{"page_url":"https://fr.wikipedia.org/wiki/Jomsborg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/The_Curmsun_Disc_-_Obverse.png","page_title":"Jomsborg","context_page_description":"Jomsborg ou Jómsborg est un comptoir viking semi-légendaire du littoral des Wendes, actif des années 960 à 1043. Ses habitants étaient appelés Jomsvikings. On ne sait pratiquement rien de l'emplacement exact de Jomsborg : quelques auteurs la plaçaient parmi les îles de l'estuaire de l’Oder ; mais L. Weibull a établi la fausseté de cette hypothèse."},{"page_url":"https://ast.wikipedia.org/wiki/Sambucus_nigra","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Sambuci_flos_dried.jpg","page_title":"Sambucus nigra","context_page_description":"Sambucus nigra, el sabugu negru, benitu o, a cencielles, sabugu, ye una especie del xéneru Sambucus, perteneciente a la familia de les adoxacees."},{"page_url":"https://en.wikipedia.org/wiki/Diet_of_Bosnia","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Berliner_kongress.jpg","page_title":"Diet of Bosnia","context_page_description":"The Diet of Bosnia and Herzegovina was a representative assembly with competence over the Austro-Hungarian Condominium of Bosnia and Herzegovina. The parliament established in 1910 had a certain legislative authority, however, its resolutions were subject to approval by the Austrian and Hungarian government. It ceased its operation in July 1914 and was legally abolished in 1915."},{"page_url":"https://az.wikipedia.org/wiki/K%C9%99r%C9%99c_%C5%9F%C9%99hristan%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Karaj_County.PNG","page_title":"Kərəc şəhristanı","context_page_description":"Kərəc şəhristanı — İranın Əlburz ostanının 5 şəhristanından biri və bu ostanda inzibati ərazi vahidi. İnzibati mərkəzi Kərəc şəhəridir."},{"page_url":"https://ko.wikipedia.org/wiki/%EA%B0%9C%EB%A6%BF_A._%ED%98%B8%EB%B0%94%ED%8A%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Garret_Augustus_Hobart.jpg","page_title":"개릿 A. 호바트","context_page_description":"개릿 어거스터스 호바트는 미국의 제24대 부통령이었다.그는 1897년부터 1899년까지 미국의 부통령이었다. 재임 중인 1899년 11월 21일 병사하여 1900년 미국 대통령 선거에서 당시 뉴욕 주 주지사였던 시어도어 루스벨트가 윌리엄 매킨리의 러닝메이트가 되었다."},{"page_url":"https://ro.wikipedia.org/wiki/%C8%98tefan_cel_Mare","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Biserica_Manastirii_Neamt.jpg","page_title":"Ștefan cel Mare","context_page_description":"Ștefan al III-lea, supranumit Ștefan cel Mare sau, după canonizarea sa de către Biserica Ortodoxă Română, Ștefan cel Mare și Sfânt, a fost domnul Moldovei între anii 1457 și 1504. A fost fiul lui Bogdan al II-lea, domnind timp de 47 de ani, cea mai lungă domnie din epoca medievală din Țările Române.\\nȘtefan cel Mare este considerat o personalitate marcantă a istoriei României, înzestrată cu mari calități de om de stat, diplomat și conducător militar. Aceste calități i-au permis să treacă cu bine peste momentele de criză majoră, generate fie de intervențiile militare ale statelor vecine fie de încercări, din interior sau sprijinite din exteriorul țării, de îndepărtare a sa de la domnie. În timpul domniei sale Moldova atinge apogeul dezvoltării sale statale, cunoscând o perioadă îndelungată de stabilitate internă, prosperitate economică și liniște socială.\\nPe plan intern și-a bazat regimul pe o nouă clasă conducătoare formată din oameni proveniți preponderent din mica boierime, ridicați la demnități pe baza meritelor militare, loialității față de domn sau a înrudirii apropiate cu acesta."},{"page_url":"https://it.wikipedia.org/wiki/Peter_Brewis","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Short_Shaiman.jpg","page_title":"Peter Brewis","context_page_description":"Peter Brewis è un compositore britannico, autore di colonne sonore cinematografiche."},{"page_url":"https://uk.wikipedia.org/wiki/Markthal_(%D0%A0%D0%BE%D1%82%D1%82%D0%B5%D1%80%D0%B4%D0%B0%D0%BC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Library_of_Rotterdam_%28from_Markthal%29.jpg","page_title":"Markthal (Роттердам)","context_page_description":"Markthal — критий ринок в Роттердамі, розташований між вулицями Binnenrotte, Hoogstraat та Blaak. Відкритий 1 жовтня 2014 в присутності королеви нідерландів Ма́ксими. Markthal цікавий тим, що в самому накритті розміщені 228 житлові квартири, а також комерційні площі, під ринком знаходиться найбільший в місті підземний паркінг на понад тисячу автомобілів."},{"page_url":"https://ro.wikipedia.org/wiki/Radiohead","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Radiohead.jpg","page_title":"Radiohead","context_page_description":"Radiohead este o trupă engleză din Oxfordshire, Marea Britanie. Încadrată uneori în genul rockului alternativ, trupa a fost influențată de o varietate de genuri muzicale.\\nRadiohead a fost lăudată ca fiind una din cele mai creative trupe ale erei sale, fiind cunoscută pentru cântecele sale complexe și evoluția artistică de la un album la altul.\\nUnii consideră că membrii trupei și-au menținut independența muzicală și politică\\nîn ciuda contractului cu EMI, o casă de discuri majoră. Cu toate acestea, momentan, trupa lucrează fără un contract de înregistrări, mergând în turnee, unde prezintă cântece noi.\\nFormată de câțiva colegi de școală în 1986, Radiohead a lansat primul single abia în 1992. Melodia Creep, de pe albumul lor de debut, Pablo Honey, a devenit un hit internațional, fiind lansat la apogeul popularității genului grunge. Trupa a fost inițial etichetată drept un „one-hit wonder” la nivel internațional, dar au avut priză la publicul britanic mulțumită celui de-al doilea album, The Bends, cucerind publicul prin atmosfera densă de chitară a cântecelor și interpretarea expresivă a vocalistului Thom Yorke."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8B%B9%EC%A0%95%EC%B4%88%EB%93%B1%ED%95%99%EA%B5%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/%EB%8B%B9%EC%A0%95%EC%B4%883.jpg","page_title":"당정초등학교","context_page_description":"당정초등학교는 경기도 군포시에 있는 공립 초등학교이다."},{"page_url":"https://hr.wikipedia.org/wiki/Hrvatska_pod_Habsburzima","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Zara_-_porta_della_citt%C3%A0.jpg","page_title":"Hrvatska pod Habsburzima","context_page_description":"Iako već od kraja 14. stoljeća počinju pripajati neke dijelove hrvatskih zemalja svome lenu, a 1438. hrvatsku krunu prvi puta nosi jedan Habsburgovac, Albert II., te potom njegov sin, Ladislav V. Radi obrane, plemstvo u Hrvatskoj 1. siječnja 1527. bira za kralja Ferdinanda Habsburškog, a ono u Slavoniji 6. siječnja 1527. odlučuje se za Ivana Zapolju. Umjesto da se zajednički bori protiv turske opasnosti, hrvatsko se plemstvo međusobno razračunava. Od osvojenih područja Turci osnivaju Kliški, Požeški, Začazmanski, te Lički sandžak koji 1580. ulaze u sastav Bosanskoga pašaluka. Godine 1573. žalosne »ostatke ostataka« Hrvatske zahvatila je velika seljačka buna. Od poraza Turaka pod Siskom 1593. počinje postupno oslobađanje Hrvatske, ali to ne isključuje duboke razlike između dvora i hrvatskih velikaša, zbog kojih 30. travnja 1671. stradavaju Petar Zrinski i Fran Krsto Frankapan. Politika Marije Terezije i Josipa II. dovodi Hrvatsku u 18. stoljeću u upravnu ovisnost o Ugarskoj. Kratko vrijeme Istra, Dalmacija, Dubrovačka Republika i Boka kotorska priznali su vlast Napoleona I., a nakon 1813. pripali su Austriji."},{"page_url":"https://de.wikipedia.org/wiki/Burg_Schwarzenfels","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Burg_Schwarzenfels%2C_6.jpg","page_title":"Burg Schwarzenfels","context_page_description":"Die Burg Schwarzenfels ist die Ruine einer Höhenburg auf einer 427 m ü. NN hohen Anhöhe im Ortsteil Schwarzenfels in der Gemeinde Sinntal im Main-Kinzig-Kreis in Hessen. Ihren Namen soll sie von dem schwarzen Dolerit tragen, aus dem sie gebaut ist."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%81%D9%87%D8%B1%D8%B3%D8%AA_%D8%B3%D9%81%D8%A7%D8%B1%D8%AA%E2%80%8C%D9%87%D8%A7%DB%8C_%D8%A8%D8%B1%D8%B2%DB%8C%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Image-Be_Brazilian_Embassy_04.jpg","page_title":"فهرست سفارت‌های برزیل","context_page_description":"فهرست سفارت‌های برزیل، فهرستی از مراکز سفارتخانه و کنسولگری کشور برزیل در سراسر جهان است. برزیل دارای روابط دیپلماتیک گسترده در بیش از ۱۲۵ کشور جهان است."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%92%D1%8A%D0%BE%D1%80%D1%8A%D0%B6%D0%B5%D0%BD%D0%B8_%D1%81%D0%B8%D0%BB%D0%B8_%D0%BD%D0%B0_%D0%9D%D0%BE%D1%80%D0%B2%D0%B5%D0%B3%D0%B8%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/de/Norwegian_CV9030N_in_snow.jpg","page_title":"Въоръжени сили на Норвегия","context_page_description":"Въоръжените сили на Кралство Норвегия са държавната структура, натоварена с отбраната и териториалната цялост на кралството. Поставени са под контрола на министерството или Департамента на отбраната. Начело на въоръжените сили стои Началника на отбраната, от януари 2016 г. адмирал Хокон Брюун-Хансен. Според Конституцията кралят на Норвегия е върховен главнокомандващ с чин генерал от СВ, от ВВС и адмирал от ВМС.\\nТой изпълнява тези си функции чрез Държавния съвет, но де-факто ги делегира на правителството в мирно време.\\nСредно Кралство Норвегия отделя за бюджета за отбрана средства, съответстващи на около 1,4% от брутния вътрешен продукт на страната, което е под изискваните от НАТО 2%, но над средното за западно-европейските страни.\\nВ мирно време въоръжените сили са с численост около 25 500 души, което включва професионални военни, наборни военнослужещи и граждански лица. Например през 2014 г. бройката е била съответно 17 442 професионални военни и граждански лица и 16 966 наборници с едногодишен срок на службата. Предвиденият състав след мобилизация е около 83 000."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%A7%91%E7%A7%91%E6%96%AF%E6%9D%BF%E5%9D%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/CocosPlate.png","page_title":"科科斯板块","context_page_description":"科科斯板块，或译科克斯板块、科科板块，以位于其中的科科岛命名，是位于中美洲西岸外的太平洋中的一个大洋板块。在1968年勒皮雄首次提出的六大板块中，它是南极洲板块的一部分。\\n科科斯板块是由沿着东太平洋海隆发生的海底扩张形成的，位于被地质学家叫做科科斯-纳斯卡扩张系的复杂区域内。科科斯板块从海隆处开始被向东推动，在其东部则受到位于其上的低密度的加勒比板块的推挤或拉动，而消减于其下。这一消减带造就了从哥斯达黎加到危地马拉的具有火山的山脉，以及向北延伸直达墨西哥的一条地震带。\\n科科斯板块的东北界和东界为会聚边界，消减于北美洲板块、加勒比板块和南美洲板块之下。其南界和西界则以离散边界分别与纳斯卡板块和太平洋板块相接。\\n科科斯板块和纳斯卡板块都是古法拉龙板块的残遗，二者在大约2300万年前分裂。这两个板块的边界以位于加拉帕戈斯群岛之下的热点为标志。\\n科科斯板块之北尚有一个名为里维拉板块的正在消减中的小板块，它被认为是在500万-1000万年前从科科斯板块分离出来的。\\n灾难性的1985年墨西哥城大地震即是由科科斯板块内部的地震活动造成的。"},{"page_url":"https://hu.wikipedia.org/wiki/Hvo%C5%BE%C4%8Fany_(P%C5%99%C3%ADbrami_j%C3%A1r%C3%A1s)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Kostel_sv._Prokopa_a_Nav%C5%A1t%C3%ADv%C4%9Bn%C3%AD_Panny_Marie_01.JPG","page_title":"Hvožďany (Příbrami járás)","context_page_description":"Hvožďany település Csehországban, a Příbrami járásban. Hvožďany Březí, Mladý Smolivec, Čížkov, Bělčice, Předmíř, Rožmitál pod Třemšínem, Vševily, Hudčice és Volenice településekkel határos. Lakosainak száma 777 fő."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B5%D0%BB%D0%B8%D0%B3%D0%B8%D1%8F_%D0%B2_%D0%AD%D1%80%D0%B8%D1%82%D1%80%D0%B5%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Asmara%2C_Eritrea_-_St_George%27s_Episcopal_Church.jpg","page_title":"Религия в Эритрее","context_page_description":"Две преобладающие религии в Эритрее — это христианство и ислам. Точный процент представителей этих религий не установлен. Эритрея и соседствующая с ней Эфиопия были одними из первых христианских стран мира, официально принявших христианство в качестве государственной религии. Также Эритрея была территорий в Африке, через которую мусульмане переселялись в Эфиопию."},{"page_url":"https://en.wikipedia.org/wiki/Sulby,_Isle_of_Man","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/95/Sulby_Church_IOM.jpg","page_title":"Sulby, Isle of Man","context_page_description":"Sulby Manx: Sulby is a village in the parish of Kirk Christ Lezayre is located on the A3 Castletown to Ramsey in the Isle of Man."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8C%D5%A1%D5%A3%D5%B8%D5%BE_%D5%84%D5%A5%D6%80%D6%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Feldsteinkirche_Merz_1.JPG","page_title":"Ռագով Մերց","context_page_description":"Ռագով Մերց, քաղաք Գերմանիայում, Բրանդենբուրգի տարածքում։\\nՄտնում է Օդեր Շպրե շրջանի կազմի մեջ։ Բնակչությունը 478 մարդ է ։ Զբաղեցնում է 43,54 կմ² տարածք։ Պաշտոնական կոդը՝ 12 0 67 397։\\nԿոմունան բայանված է 2 գյուղական համայնքների։"},{"page_url":"https://nl.wikipedia.org/wiki/Scheepslift_Henrichenburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Altes_Schiffshebewerk_Henrichenburg_-_Ansicht_2.jpg","page_title":"Scheepslift Henrichenburg","context_page_description":"De Scheepslift Henrichenburg ligt in het Dortmund-Eemskanaal in Waltrop. Het maakt onderdeel uit van het Waltrop Schleusenpark. Op het terrein van het park liggen de oude Henrichenburg scheepslift gebouwd in 1899, een in onbruik geraakte schutsluis uit 1912, een nieuwe scheepslift uit 1962 en een moderne schutsluis uit 1989."},{"page_url":"https://zh.wikipedia.org/wiki/2009%E5%B9%B4%E7%BE%8E%E6%B4%B2%E9%87%91%E7%9B%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Mount_Davis.jpg","page_title":"2009年美洲金盃","context_page_description":"2009年美洲金盃是中北美洲及加勒比海足球協會舉辦的第十屆美洲金盃，決賽周於2009年7月3日至7月26日在美國舉行。是屆賽事並無邀請其他洲份球隊參與。決賽當日，墨西哥以 5–0 擊敗美國，第五度捧走美洲金盃，並自1963年來第八次成為中北美洲及加勒比海冠軍。"},{"page_url":"https://zh.wikipedia.org/wiki/%E6%97%A5%E6%9C%AC%E5%8D%8A%E9%92%B1%E9%93%9C%E5%B8%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Half-sen-M6-obv.jpg","page_title":"日本半钱铜币","context_page_description":"半钱铜币是日本明治年间铸造发行的一种面额为“半钱”的铜币，每两枚价值一钱，每二百枚价值一日元。该币为按照1871年《新货条例》发行的辅助货币，自明治六年开始发行，其后直至明治二十一年，除明治十一年外均有发行。1953年，日本通过《小额通货整理法》，面额低于1日元的货币被废止，半钱铜币退出流通\\n该铜币是日本自明治十七年一厘铜币因不便流通停铸后至大正五厘铜币发行前发行的面额最小的货币。"},{"page_url":"https://fr.wikipedia.org/wiki/Johann_Anton_Ramboux","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Adam-Eve-Ramboux.jpg","page_title":"Johann Anton Ramboux","context_page_description":"Johann Anton von Ramboux est un peintre allemand d'histoire et de portrait, né à Trèves le 5 octobre 1790 et mort à Cologne le 2 octobre 1866.\\nIl apprit les éléments de son art à Florenville, chez Abraham Gilson, et poursuivit sa formation pendant trois ans dans l'atelier de David à Paris. En 1815, il étudia dans l'académie des beaux arts de Munich. En 1816, il se rendit à Rome avec son ami le graveur Samuel Amsler et y resta jusqu'en 1822. Il sera finalement conservateur du Musée Wallraf-Richartz de Cologne."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D8%A7%D9%88_%D8%A3%D9%88%D8%AF%D9%88%D8%A7%D8%B1%D8%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Audouard-pavelloAudouardExpo1888.jpg","page_title":"باو أودوارد","context_page_description":"باو أودوارد ‏: هو مصور فوتوغرافي نشط في برشلونة بأسبانيا في نهايات القرن التاسع عشر."},{"page_url":"https://en.wikipedia.org/wiki/Darevskia_praticola","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Lacerta_praticola.jpg","page_title":"Darevskia praticola","context_page_description":"Darevskia praticola, the meadow lizard, is a lizard species in the genus Darevskia. It is found in Georgia, Russia, Iran, Serbia, Bulgaria, Greece, Azerbaijan, Armenia, and Turkey."},{"page_url":"https://de.wikipedia.org/wiki/Mutinus_borneensis","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Mutinus_borneensis_62460.jpg","page_title":"Mutinus borneensis","context_page_description":"Mutinus borneensis, in Neuseeland auch als \\"Yellow Stinkhorn\\" bekannt, ist eine Pilzart aus der Gattung der Hundsruten, die zur Familie der Stinkmorchelverwandten gehört. Sie wurde erstmals im Jahre 1879 von dem italienischen Botaniker Vincenzo de Cesati beschrieben."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B4%D5%B8%D6%82_(%D5%A4%D5%A5%D5%BA%D5%A1%D6%80%D5%BF%D5%A1%D5%B4%D5%A5%D5%B6%D5%BF)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Besancon2m.jpg","page_title":"Դու (դեպարտամենտ)","context_page_description":"Դու, դեպարտամենտ Ֆրանսիայի կենտրոնական մասում։ 1999 թվականի տվյալներով բնակչությունը կազմել է 499 062 մարդ, ինչը 51-րդ ցուցանիշն է։"},{"page_url":"https://en.wikipedia.org/wiki/Roads_and_freeways_in_metropolitan_Detroit","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Southfield_Town_Center.jpg","page_title":"Roads and freeways in metropolitan Detroit","context_page_description":"The roads and freeways in metropolitan Detroit comprise the main thoroughfares in the region. The freeways consist of an advanced network of interconnecting freeways which include Interstate highways. The Metro Detroit region's extensive toll-free freeway system, together with its status as a major port city, provide advantages to its location as a global business center. There are no toll roads in Michigan.\\nDetroiters may refer to freeways by the formal name more often where one has been designated rather than route number. Other freeways without formal names are known by the number such as I‑275 and M‑59. M‑53, while not officially designated may be locally referred to by its name \\"Van Dyke\\". Detroit area freeways are typically sunken below ground level to permit local traffic to pass over the freeway and for appearance.\\nFollowing a historic fire in 1805, Judge Augustus B. Woodward devised a plan similar to Pierre Charles L'Enfant's design for Washington, D.C.."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%98%AA%E6%9D%B1%E6%A9%8B%E9%A7%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Bandobashi-Sta-Gate.jpg","page_title":"阪東橋駅","context_page_description":"阪東橋駅は、神奈川県横浜市中区弥生町5丁目にある、横浜市営地下鉄ブルーラインの駅である。駅番号はB15。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%88%D0%BE%D0%B2%D0%B0%D0%BD%D0%BA%D0%B0_%D0%91%D1%80%D0%BE%D0%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/JovankaBroz1971.png","page_title":"Јованка Броз","context_page_description":"Јованка Будисављевић Броз била је учесница Народноослободилачке борбе и супруга председника СФРЈ Јосипа Броза Тита.\\nПотиче из угледне личке породице Будисављевић. Након окупације Југославије, 1941. примљена је у чланство Савеза комунистичке омладине и почела да ради за Народноослободилачки покрет. У лето 1942. ступила је партизане, у тада формирану Прву личку женску чету, која је потом укључена у састав Друге личке бригаде. Заједно са Шестом личком дивизијом прошла је ратни пут од Лике до Дрвара, где је била политички комесар партизанске болнице, а потом до Београда и Сремског фронта. У току рата је два пута рањавана и одликована са два Ордена за храброст.\\nКрајем 1945. прекомандована је у Београд, где је примила дужност Титове секретарице, са задатком да се брине о домаћичким пословима у резиденцији у Ужичкој 15 и Белом двору. Након Титове операције 1947. почела је да се зближава са њим, након чега су отпочели везу. Венчали су се 15. априла 1952, а јавности је као његова супруга представљена септембра исте године. Ванредно је завршила гимназију и започела студије књижевности, али је због бројних обавеза била принуђена да их прекине."},{"page_url":"https://nl.wikipedia.org/wiki/Bursa_lamarckii","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Bursa_lamarckii.jpg","page_title":"Bursa lamarckii","context_page_description":"Bursa lamarckii is een slakkensoort uit de familie van de Bursidae. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1853 door Deshayes."},{"page_url":"https://pl.wikipedia.org/wiki/Powiat_pabianicki","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Tramwaj34.jpg","page_title":"Powiat pabianicki","context_page_description":"Powiat pabianicki – powiat w Polsce, utworzony w 1999 roku w ramach reformy administracyjnej. Jego siedzibą jest miasto Pabianice.\\nWedług danych z 31 grudnia 2019 roku powiat zamieszkiwało 119 291 osób."},{"page_url":"https://nn.wikipedia.org/wiki/Allyson_Felix","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/AllysonFelixRio2016.jpg","page_title":"Allyson Felix","context_page_description":"Allyson Michelle Felix er ein USA-amerikansk sprintar som har blitt både verdsmeister, verdsrekordhaldar og olympisk meister. Felix har vunne i alt sytten medaljar frå OL og VM, og av desse er tretten gull på 100 meter, 200 meter og stafett. Hennar personlege beste tider per november 2013 er: 100 meter på 10,89, 200 meter på 21,69 og 400 meter på 49,59."},{"page_url":"https://es.wikipedia.org/wiki/De_Roy_(cr%C3%A1ter)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/De_Roy_sattelite_craters_map.jpg","page_title":"De Roy (cráter)","context_page_description":"De Roy es un cráter de impacto que se encuentra en la cara oculta de la Luna, justo detrás de la extremidad sudoeste. Esta parte de la superficie lunar se hace visible desde la Tierra durante libraciones favorables, lo que permite la observación de esta formación, aunque con pequeño detalle dado el elevado escorzo que presenta. De Roy se encuentra al oeste del cráter Arrhenius y al este de Boltzmann, de mayor tamaño.\\nEste cráter tiene un brocal desgastado y redondeado, formando un círculo ligeramente irregular. Un par de pequeños cráteres se encuentran a lo largo del borde suroriental, y presenta una estrecha hendidura en la pared norte. El suelo interior está prácticamente a nivel y casi carece de rasgos distintivos, con sólo unas pocas huellas de pequeños cráteres que marcan su superficie.\\nEste cráter se encuentra dentro de la Cuenca Mendel-Rydberg, una amplia depresión de impacto con unos 630 km de anchura, perteneciente al Período Nectárico."},{"page_url":"https://sv.wikipedia.org/wiki/Opo%C4%8Dno_(ort_i_Tjeckien,_%C3%9Ast%C3%AD_nad_Labem)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Opo%C4%8Dno_vlajka.jpg","page_title":"Opočno (ort i Tjeckien, Ústí nad Labem)","context_page_description":"Opočno är en ort i Tjeckien. Den ligger i länet Ústí nad Labem, i den nordvästra delen av landet, 50 km nordväst om huvudstaden Prag. Opočno ligger 253 meter över havet och antalet invånare är 134.\\nTerrängen runt Opočno är platt åt nordväst, men åt sydost är den kuperad. Terrängen runt Opočno sluttar norrut. Den högsta punkten i närheten är 425 meter över havet, 2,9 km söder om Opočno. Runt Opočno är det ganska glesbefolkat, med 34 invånare per kvadratkilometer. Närmaste större samhälle är Žatec, 13,5 km väster om Opočno. Trakten runt Opočno består till största delen av jordbruksmark.\\nTrakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 8 °C. Den varmaste månaden är augusti, då medeltemperaturen är 20 °C, och den kallaste är december, med -6 °C."},{"page_url":"https://de.wikipedia.org/wiki/Gerobatrachus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Gerobatrachus_NT.jpg","page_title":"Gerobatrachus","context_page_description":"Gerobatrachus ist eine Gattung kleiner ausgestorbener Landwirbeltiere aus der Gruppe der Temnospondylen, die vor rund 290 Millionen Jahren im Sakmarium von Nordamerika lebte. Die einzige, im Jahr 2008 beschriebene Art ist die elf Zentimeter lange Typusart G. hottoni.\\nDer Gattungsname des Fossils ist abgeleitet vom griechischen geros und batrachus. Das Art-Epitheton ehrt Nicholas Hotton, einen verstorbenen Wirbeltierpaläontologen des Naturhistorischen Museums.\\nDie anatomischen Merkmale von Gerobatrachus deuten der Erstbeschreibung einer Forschergruppe der University of Calgary zufolge darauf hin, dass dieses Tier dem gemeinsamen Vorfahren der Froschlurche und der Schwanzlurche nahestand. Vor allem an Schädel, Wirbeln und Zähnen fand sich eine Mischung von Frosch- und Salamandermerkmalen. Anhand der anatomischen Befunde wird die Trennung der Entwicklungslinien beider Gruppen auf die Zeit vor 275 bis 240 Millionen Jahren bestimmt. Mit Hilfe der sogenannten molekularen Uhr war der letzte gemeinsame Vorfahr der beiden Linien bislang auf die Zeit vor 300 Millionen Jahren datiert worden."},{"page_url":"https://pt.wikipedia.org/wiki/Windischleuba","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Wappen_Windischleuba.png","page_title":"Windischleuba","context_page_description":"Windischleuba é um município da Alemanha localizado no distrito de Altenburger Land, estado da Turíngia. Pertence ao Verwaltungsgemeinschaft de Pleißenaue."},{"page_url":"https://la.wikipedia.org/wiki/Albertus_II_(princeps_Monoecensis)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Signature_of_Albert_II%2C_Prince_of_Monaco.png","page_title":"Albertus II (princeps Monoecensis)","context_page_description":"Vide etiam paginam discretivam: Albertus II\\nAlbertus II est Princeps Monoeci et paterfamilias Grimaldorum.\\nUnicus Rainerii III Monaci principis et Graciae Kelly filius est. Quamquam secundus natus est, ei cum natus erat titulus principis primi Monoeci datus est. Alberti sorores sunt Carolina Hannoverae Principissa et Stephania Monaci Principissa.\\nAlbertus in Foederatis Americae Civitatibus arti politicae studuit, Collegii Amherstiani discipulus. Non modo Francogallice et Anglice, sed etiam Theodisce loquitur.\\nAntequam regnum pervenit, Olympiis repraesentavit Monoecum, sclodia gubernabili vectus.\\nDie 6 Aprilis 2005 post mortem Rainerii III principis patris sui ipse princeps Monoeci successit.\\nPrinceps Albertus II die 1 Iulii anno 2011 Carolam Wittstock caerimonia civili in matrimonium duxit, matrimonium ecclesiasticum die 2 Iulii anno 2011 contractum est. Die 23 Iunii anno 2010 se sponsaverant.\\nFilium spurium, qui Alexander, et filiam spuriam, qui Jasmina Gratia vocatur, habet. Die 10 mensis Decembris filii gemini nati sunt, Gabriella principissa Monoecensis et Iacobus Honoratus Rainerius princeps et heres designatus."},{"page_url":"https://de.wikipedia.org/wiki/Argentinien-Krise","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Aktienindex_Merval_01_01_1998_bis_05_10_2004.png","page_title":"Argentinien-Krise","context_page_description":"Der Ausdruck Argentinien-Krise bezeichnet die letzte große Wirtschaftskrise in Argentinien zwischen 1998 und 2002, deren Auswirkungen bis in das Jahr 2005 zu spüren waren.\\nDie beiden Höhepunkte der Krise waren eine starke Rezession 1998/99 und der Zusammenbruch des Finanzsystems 2001/02, der am 21. Dezember 2001 zum Rücktritt des Präsidenten Fernando de la Rúa führte, dem eine Periode von großer politischer Instabilität folgte. In der Zeit der Krise sank das Bruttoinlandsprodukt Argentiniens um insgesamt 21 %. Die sozialen Folgen waren verheerend: Am Höhepunkt der Krise betrug die Armutsrate 57 % und die Arbeitslosenquote 23 %. Seit Mitte 2002 erholt sich die Wirtschaft des Landes wieder. Sie wächst seit 2003 wieder.\\nDer Anteil der Staatsverschuldung in Devisen machte im Jahr 2002 92 % des BIP aus, im Jahr 2011 nur noch 9,6 %."},{"page_url":"https://de.wikipedia.org/wiki/Rostiger_Schildk%C3%A4fer","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/20140516_172947_8499M.JPG","page_title":"Rostiger Schildkäfer","context_page_description":"Der Rostige Schildkäfer ist ein Käfer aus der Familie der Blattkäfer. Er gehört zur Unterfamilie der Schildkäfer, von denen in Europa etwa 60 Arten vertreten sind. In Mitteleuropa kommen etwa 30 schwer voneinander zu unterscheidende Arten vor."},{"page_url":"https://it.wikipedia.org/wiki/Red_Arrows","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Red_Arrows_Pass_By%2C_Radom_Airshow_2005.jpg","page_title":"Red Arrows","context_page_description":"Le Red Arrows ufficialmente note come Royal Air Force Aerobatic Team sono la squadriglia acrobatica della Royal Air Force con sede a Scampton, in Lincolnshire, Inghilterra. Le Red Arrows sono state fondate nel 1964 ed hanno partecipato a più di 4000 manifestazioni in 53 nazioni differenti. Le Red Arrows hanno i dotazione nove BAE Hawk.\\nLe Red Arrows sono riconosciute a livello mondiale come una delle migliori pattuglie acrobatiche."},{"page_url":"https://pt.wikipedia.org/wiki/Insul","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Insul_Ahrtal_Fachwerk_20611.jpg","page_title":"Insul","context_page_description":"Insul é um município da Alemanha localizada no distrito de Ahrweiler, na associação municipal de Verbandsgemeinde Adenau, no estado da Renânia-Palatinado."},{"page_url":"https://ca.wikipedia.org/wiki/Barbudet_verd","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Green_Tinkerbird%2C_Arabuko-Sokoke_Forest%2C_Kenya_CD5A4273.jpg","page_title":"Barbudet verd","context_page_description":"El barbudet verd és un ocell de la família dels líbids.\\nHabita el boscos d'Uganda, sud-est de Kenya, cap al sud, a través de l'est i sud de Tanzània i sud de Malawi fins al sud de Moçambic."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Torsch%C3%BCtzenk%C3%B6nige_der_DDR-Oberliga","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/R%C3%BCdiger_Schnuphase_World_Cup_1974.jpg","page_title":"Liste der Torschützenkönige der DDR-Oberliga","context_page_description":"Die Liste der Torschützenkönige der DDR-Oberliga führt alle Torschützenkönige der Fußball-Oberliga der DDR auf. Im weiteren Teil werden die erfolgreichsten Spieler und erfolgreichsten Vereine genannt. Torschützenkönig wird derjenige Spieler, der im Verlauf einer Oberligasaison die meisten Tore erzielt. In 42 Spielzeiten wurden 31 Spieler Torschützenkönig der DDR-Oberliga. Dabei reichten im Schnitt 19,5 Tore.\\nDie erfolgreichsten Spieler waren Hans-Jürgen Kreische und Joachim Streich mit jeweils vier Titeln. Jeweils dreimal Torschützenkönig wurden Bernd Bauchspieß und Torsten Gütschow. Johannes Schöne erzielte in der Saison 1950/51 in 34 Spielen mit 38 Toren die meisten Tore in einer Saison. In dem seit 1954/55 gültigen Modus mit 14 Mannschaften erreichte Hans-Jürgen Kreische in der Saison 1972/73 mit 26 Treffern in 26 Spielen den höchsten Wert. Alle Torschützenkönige waren Staatsbürger der DDR.\\nErfolgreichster Verein war Dynamo Dresden mit sieben Torschützenkönigen vor dem BFC Dynamo und dem 1. FC Magdeburg, die jeweils viermal den erfolgreichsten Torjäger einer Saison stellten. Neunmal wurde der Torschützenkönig der DDR-Oberliga auch DDR-Meister."},{"page_url":"https://ro.wikipedia.org/wiki/Hell%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Hellin_-_021_%2833797703196%29.jpg","page_title":"Hellín","context_page_description":"Hellín este un oraș din Spania, situat în provincia Albacete din comunitatea autonomă Castilia-La Mancha. Are o populație de 28.123 de locuitori."},{"page_url":"https://en.wikipedia.org/wiki/Mostaganem_Province","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/DZ-27_%282019%29.svg","page_title":"Mostaganem Province","context_page_description":"Mostaganem is a province of Algeria. The capital is Mostaganem. Other localities include Ain Nouissi, Ain Tadles, Tazgait, Mezghrane, and Stidia."},{"page_url":"https://es.wikipedia.org/wiki/Vila_do_Porto","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/VPT1.png","page_title":"Vila do Porto","context_page_description":"Vila do Porto es una ciudad en la isla de Santa María en las Azores, cuya población es de 5,578 habitantes. En sus cercanías se encuentra el aeropuerto de Santa María.\\nLas 5 parroquias de Vila do Porto incluyen:"},{"page_url":"https://en.wikipedia.org/wiki/Matins_Gospel","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/98/ResurrectionYaroslavlSchool.jpg","page_title":"Matins Gospel","context_page_description":"The Matins Gospel is the solemn chanting of a lection from one of the Four Gospels during Matins in the Orthodox Church and those Eastern Catholic churches which follow the Byzantine Rite.\\nThe reading of the Gospel is the highpoint of the service, and takes place near the end of the festive portion of the service known as the Polyeleos. During the Divine Liturgy the Gospel is usually read by the deacon, but the Matins Gospel is read by the priest. However, if the bishop is present, he will usually be the one who reads the Matins Gospel."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stolpersteine_in_Berlin-Wilmersdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Stolperstein_Fasanenstr_49_%28Wilmd%29_Saul_Rudermann.jpg","page_title":"Liste der Stolpersteine in Berlin-Wilmersdorf","context_page_description":"Die Liste der Stolpersteine in Berlin-Wilmersdorf enthält die Stolpersteine im Berliner Ortsteil Wilmersdorf im Bezirk Charlottenburg-Wilmersdorf, die an das Schicksal der Menschen erinnern, die im Nationalsozialismus ermordet, deportiert, vertrieben oder in den Suizid getrieben wurden. Die Spalten der Tabelle sind selbsterklärend. Die Tabelle erfasst insgesamt 1335 Stolpersteine und ist teilweise sortierbar; die Grundsortierung erfolgt alphabetisch nach dem Familiennamen."},{"page_url":"https://uk.wikipedia.org/wiki/BCAR1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/PBB_GE_BCAR1_gnf1h00170_at_fs.png","page_title":"BCAR1","context_page_description":"BCAR1 – білок, який кодується однойменним геном, розташованим у людей на короткому плечі 16-ї хромосоми. Довжина поліпептидного ланцюга білка становить 870 амінокислот, а молекулярна маса — 93 372.\\nКодований геном білок за функцією належить до фосфопротеїнів.\\nЗадіяний у таких біологічних процесах, як клітинна адгезія, ацетилювання, альтернативний сплайсинг.\\nЛокалізований у цитоплазмі, клітинних контактах."},{"page_url":"https://en.wikipedia.org/wiki/List_of_butterflies_of_Kerala","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Pi_Common_Jezebel_07_September_2007_N_%281344882481%29.jpg","page_title":"List of butterflies of Kerala","context_page_description":"This is a list of butterfly species found in the Kerala, India."},{"page_url":"https://it.wikipedia.org/wiki/Consorti_dei_sovrani_di_Savoia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Sibyla_Baug%C3%A9.png","page_title":"Consorti dei sovrani di Savoia","context_page_description":"Quella che segue è una lista di tutte le consorti dei sovrani che regnarono sulla Savoia, dal 1000 al 1713.\\nLe varie consorti sono suddivise in due gruppi:\\nle Contesse di Savoia;\\nle Duchesse di Savoia."},{"page_url":"https://it.wikipedia.org/wiki/Victor_Cavendish,_IX_duca_di_Devonshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Victor_Christian_William_Cavendish%2C_9th_Duke_of_Devonshire_as_an_Ambassador_after_Holbein%27s_picture_in_the_National_Gallery.jpg","page_title":"Victor Cavendish, IX duca di Devonshire","context_page_description":"Victor Cavendish, IX duca di Devonshire, è stato un politico britannico appartenente al partito Liberale."},{"page_url":"https://fi.wikipedia.org/wiki/Gerhard_Domagk","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/df/Gerhard_Domagk_nobel.jpg","page_title":"Gerhard Domagk","context_page_description":"Gerhard Domagk oli saksalainen lääkäri.\\nHän toimi saksalaisen väritehtaan tieteellisenä johtajana ja huomasi vuonna 1932, että väriaineeksi kehitetty prontosiili tehosi hiirien streptokokki-infektioihin. Tehoaine ei kuitenkaan ollut värimolekyyli, vaan sen aktiivinen hajoamistuote, sulfaniiliamidi. Siitä kehitettiin satoja johdannaisia. Se tehosi erityisesti streptokokkitulehduksiin, kuten lapsivuodekuumeeseen ja reumakuumeeseen. Hänelle myönnettiin tästä keksinnöstä Nobelin lääketieteen palkinto vuonna 1939."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9B%D0%B8%D0%BD%D0%B5%D0%B0%D1%80%D0%BD%D0%BE_%D0%BA%D0%BE%D0%B4%D0%B8%D1%80%D0%B0%D1%9A%D0%B5_%D0%BC%D1%80%D0%B5%D0%B6%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Butterfly_network.svg","page_title":"Линеарно кодирање мрежа","context_page_description":"Линеарно кодирање мрежа је математичка техника која се може користити за побољшање пропусности, ефикасности и скалабилности мреже, као и отпорности на нападе и прислушкивања. Уместо једноставног преноса пакета информација, чворови мреже узимају неколико пакета и комбинују их заједно за пренос. Ово се може користити за постизање максималног могућег протока информација у мрежи. Линеарна кодирање мрежа је изумео професор Роберт Ли, претходно професор на Кинеском Универзитету у Хонг Конгу, а сада угледни професор на Универзитету за електронске науке и технологију Кине.\\nМатематички је доказано да теорији линеарног кодирања је довољна да се постигне горња граница у проблемима дељења већем броју корисника са једним извором. Међутим, линеарно кодирање није довољно уопштено, чак и за општије верзије линеарности као што су сверливно кодирање и кодирање филтер-банке. Проналажење оптималних решења за кодирање општих мрежних проблема са произвољним захтевима остаје отворени проблем."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_1993/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Vergadering_sectie_betaald_voetbal_KNVB_in_Zeist_Tripels_aan_het_woord_%28over_vr%2C_Bestanddeelnr_928-2723.jpg","page_title":"Lijst van personen overleden in 1993/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 1993.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://de.wikipedia.org/wiki/Haley_Skarupa","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/HaleySkarupa.jpg","page_title":"Haley Skarupa","context_page_description":"Haley Skarupa ist eine US-amerikanische Eishockeyspielerin, die seit der Saison 2017/18 bei den Boston Pride aus der National Women’s Hockey League auf der Position des Stürmers spielt. Skarupa gehört seit dem Jahr 2010 der Frauen-Eishockeynationalmannschaft der Vereinigten Staaten an und ist mehrfache Weltmeisterin sowie Olympiasiegerin."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%87%D8%B1%D8%AC%D8%A7%D9%86_%D8%A7%D9%84%D9%82%D8%B5%D8%B1_%D8%A7%D9%84%D8%AF%D9%88%D9%84%D9%8A_%D9%84%D9%84%D9%85%D8%B3%D8%B1%D8%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/%D8%B1%D8%B6%D9%88%D8%A7%D9%86_%D8%A7%D8%AD%D8%AF%D8%A7%D8%AF%D9%88_%D8%A7%D8%AB%D9%86%D8%A7%D8%A1_%D8%A7%D9%84%D9%86%D8%AF%D9%88%D8%A9_%D8%A7%D9%84%D9%81%D9%83%D8%B1%D9%8A%D8%A9.jpg","page_title":"مهرجان القصر الدولي للمسرح","context_page_description":"انطلق مهرجان القصر الدولي للمسرح منذ سنة 2014 بمبادرة من جمعية النوارس للتنمية والإبداع ثم تحول إلى مؤسسة خاصة به ليتضمن على جملة من الفعاليات المسرحية والإبداعية في شتى الحقول الفنية. وتشتمل الفعاليات التي تقام عروضها في قاعة دار الثقافة بمدينة القصر الكبير شمال المغرب على عروض مسرحية من المغرب ودول عربية وأجنبية، بالإضافة إلى معرض التشكيل والكتاب والورشات التكوينية والندوات\\nالتي يشارك فيهما العديد من ابرز النقاد والكتاب والباحثين والأكاديميين المغاربة والعرب في حقل الفنون المسرحية.\\nتقوم بتنظيمه مؤسسة مهرجان القصر الدولي للمسرح لمدة غير محدودة وهي تتمتع بالاستقلال المالي والأدبي والإداري ولا تتخذ أي طابعي نقابي أو سياسي أو ديني."},{"page_url":"https://nl.wikipedia.org/wiki/Processiestaf","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Schatkamer_St-Servaasbasiliek%2C_ceremoniestaf_%26_4_roedes_Broederschap_St-Servaas_-_2.jpg","page_title":"Processiestaf","context_page_description":"Een processiestaf of processieroede is een versierde staf die tijdens een processie of bedevaartstocht wordt meegedragen, enerzijds als ereteken voor een heilige, anderzijds als herkenningsteken van de vereniging waartoe de roededrager behoort. Een processiestaf die door leden van een broederschap wordt gedragen heet een broederschapsstaf.\\nDe versiering van de bovenkant van de staf, de processiestafbekroning, kan vele vormen aannemen. Meestal wordt de maagd Maria of een heilige afgebeeld. Vooral in Zuid-Duitsland, Oostenrijk en delen van Frankrijk en de Zuidelijke Nederlanden werd daar in het verleden veel werk van gemaakt, waarbij complete barokke beeldhouwwerkjes ontstonden. Vaak is de bekroning van zilver, bij voorbeeld in de vorm van een plaquette of beeldje. Meestal wordt de maagd Maria of een heilige afgebeeld. Soms is boven de processiestafbekroning nog een kaarsenhouder geplaatst. Ook zijn combinaties met flambouwen bekend; feitelijk zijn dit flambouwen met broederschapsplaquettes. Soms hebben processiestaven een praktisch doel. Ze zijn dan voorzien van een U-vormige uiteinde, waarmee het heiligenbeeld dat meegedragen wordt, recht kan worden gehouden."},{"page_url":"https://nl.wikipedia.org/wiki/Iridiumflits","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Flare_Simulation.gif","page_title":"Iridiumflits","context_page_description":"Een iridiumflits is een fenomeen dat ontstaat wanneer zonlicht via een kunstmatige satelliet naar de Aarde wordt gereflecteerd. Dit resulteert in een heldere flits, waarvan sommige flitsen wel 20 keer feller dan Venus zijn. Iridium is de naam van een netwerk van enkele tientallen communicatiesatellieten voor telefonie en verwijst hier dus niet naar het chemisch element iridium.\\nDe meeste Iridiumsatellieten bevinden zich in een gecontroleerde baan, waardoor de flitsen kunnen worden voorspeld. Computerprogramma's kunnen met de baaninformatie de zichtbaarheid van een flits op een gekozen locatie voorspellen. Een iridiumsatelliet heeft drie antennes met de grootte van een deur, die geregeld licht spiegelen naar de Aarde. Die reflecties kunnen zo fel zijn dat ze zelfs overdag te zien zijn. De flitsen kunnen astronomen hinderen in hun observaties."},{"page_url":"https://nl.wikipedia.org/wiki/Arnoldus_Montanus","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Montanus-page-161-Rich-carriage-of-a-Taikosama-lady-in-waiting.png","page_title":"Arnoldus Montanus","context_page_description":"Arnoldus Montanus was een Nederlandse theoloog en historicus. Hij was predikant van de Gereformeerde kerk in achtereenvolgens Schellingwoude en Schoonhoven. Hij publiceerde boeken over verschillende onderwerpen, vaak gerelateerd aan geschiedenis, religie of geografie. Zijn boek De Nieuwe en Onbekende Weereld uit 1671 gold indertijd als standaardwerk in Europa."},{"page_url":"https://an.wikipedia.org/wiki/Elefant","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Aire-%C3%A9l%C3%A9phant.png","page_title":"Elefant","context_page_description":"Os elefants son grans mamifers terrestres de l'orden d'os proboscidios. Bi'n ha tres especies vivients: o elefant africán de sabana, l'elefant africán de selva y o elefant asiatico. Atras especies de proboscidios s'han extinguiu dende a zaguera edat glacial. Os mamuts, as formas nanas d'os qualos podrían haber sobreviviu dica o 2000 aC, son as mas conoixidas. D'antis mas se'n clasificaba, chuntament con atros animals de piel gorda, adintro de l'orden actualment descartau d'os paquidermos.\\nOs elefants son os animals terrestres mas grans que existen en l'actualidat, encara que en o pasau existioron dinosaurios y mesmo atros mamifers que los superaban en peso y mida. O periodo de chestación d'os elefants ye de 22 meses, o mas luengo de totz os animals terrestres. Ye habitual que as crias d'elefant pesen bells 120 kilogramos en naixer. Gosan vivir entre cinquanta y setanta anyos, pero l'animal mas viello conoixiu vivió 82 anyos. O elefant mas gran nunca no conoixiu morió d'un tiro en Angola en 1956. Yera un masclo que pesaba bellas 12 toneladas, con una altaria en a esquena de 4,2 metros, un metro mas gran que o elefant africán meyano."},{"page_url":"https://en.wikipedia.org/wiki/List_of_birds_of_Uganda","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Yellowbill.jpg","page_title":"List of birds of Uganda","context_page_description":"This is a list of the bird species recorded in Uganda. The avifauna of Uganda included a total of 1066 confirmed species as of May 2020. Of them, one is endemic, 66 are accidental, and three have been introduced by humans. Three additional species are hypothetical as defined below and are not included in the counts. Unless otherwise noted, the list is that of iGoTerra.\\nThis list's taxonomic treatment and nomenclature are those of The Clements Checklist of Birds of the World, 2019 edition.\\nThe following tags highlight several categories of occurrence other than regular migrants and residents.\\nAccidental - a species that rarely or accidentally occurs in Uganda\\nEndemic - a species endemic to Uganda\\n(I) Introduced - a species introduced to Uganda as a consequence, direct or indirect, of human actions\\nHypothetical - a species possibly present but which has not been documented"},{"page_url":"https://ro.wikipedia.org/wiki/List%C4%83_de_localit%C4%83%C8%9Bi_din_jude%C8%9Bul_Hunedoara","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cf/Vadu_dobrii.jpg","page_title":"Listă de localități din județul Hunedoara","context_page_description":"Lista de mai jos cuprinde toate localitățile din județ în ordine alfabetică.\\nAceastă listă este generată cu date din Wikidata și este actualizată periodic de un robot.\\nEditările făcute în listă vor fi șterse la următoarea actualizare!\\nSfârșitul listei autogenerate."},{"page_url":"https://es.wikipedia.org/wiki/Geograf%C3%ADa_de_Ecuador","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Volcan_Papallacta.jpg","page_title":"Geografía de Ecuador","context_page_description":"Ecuador es un país situado en la parte noroeste de América del Sur. Ecuador limita al norte con Colombia, al sur y al este con Perú y al oeste con el océano Pacífico. El país tiene una extensión de 283.561 km². Además del territorio continental, Ecuador está formada por el archipiélago de Colón, aparte de otras cercanas al continente, como Puná, Santay, y la Isla de la Plata.\\nEcuador se encuentra sobre la línea ecuatorial terrestre por lo cual su territorio se encuentra en ambos hemisferios.​ Comprende dos espacios distantes entre sí: el territorio continental al noroeste de América del Sur con algunas islas adyacentes a la costa y, el archipiélago o provincia insular de Galápagos, que se encuentra a 1000 kilómetros de distancia del litoral ecuatoriano en el Océano Pacífico."},{"page_url":"https://de.wikipedia.org/wiki/Ngiwal","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Flag_of_Ngiwal_State.png","page_title":"Ngiwal","context_page_description":"Ngival ist ein administrativer Staat der pazifischen Inselrepublik Palau. Der aus den Dörfern Ngelau, dem Hauptort Ngercheluuk und Ngermechau bestehende 26 km² große Teilstaat liegt im Osten der Hauptinsel Babeldaob. 2015 lebten dort 282 Menschen."},{"page_url":"https://lt.wikipedia.org/wiki/Chod%C5%BEavendas","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Martuni%2C_Artsakh.JPG","page_title":"Chodžavendas","context_page_description":"Chodžavendas arba Martunis – miestas rytinėje Kalnų Karabacho dalyje, buvusiame vakarų Azerbaidžane, 41 km į rytus nuo Stepanakerto. Maisto pramonė."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B2%D8%A8%D8%A7%D9%86_%D9%85%D8%A7%D9%84%D8%A7%DB%8C%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Malay_language_Spoken_Area_Map_v1.png","page_title":"زبان مالایی","context_page_description":"زبان مالایی زبانی آسترونزیایی است که توسط ۲۹۰ میلیون نفر جمعیت که عمدتاً از مردم مالایی هستند در کشورهای مالزی، اندونزی، برونئی، سنگاپور و بخش‌هایی از تایلند صحبت می‌شود.\\nمالایی دارای نام‌های رسمی متعددی است. در مالزی بدان Bahasa Melayu یا Bahasa Malaysia، در برونئی و سنگاپور بدان Bahasa Melayu و در اندونزی بدان Bahasa Indonesia گفته می‌شود که آخری به عنوان زبان میانجی مالایی‌تباران نیز کاربرد دارد و دلیل آن وجود انبوه فیلم‌ها و برنامه‌های تلویزیونی و رادیویی و منابع مالایی به این گویش است."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%B4%D5%B6%D5%B8%D5%BE%D5%BD%D5%AF%D5%AB_%D5%B7%D6%80%D5%BB%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Coat_of_Arms_of_Dno_%28Pskov_oblast%29.png","page_title":"Դնովսկի շրջան","context_page_description":"Դնովսկի շրջան, մունիցիպալ շրջան Ռուսաստանի Դաշնության Պսկովի մարզում։\\nՍտեղծվել է 1927 թվականին։ Վարչական կենտրոնը՝ Դնո։"},{"page_url":"https://pt.wikipedia.org/wiki/Elei%C3%A7%C3%A3o_para_o_Senado_federal_pela_Luisiana_em_2010","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/DVitterOfficial.jpg","page_title":"Eleição para o Senado federal pela Luisiana em 2010","context_page_description":"A eleição para o senado do estado americano da Luisiana em 2010 aconteceu em 2 de novembro de 2010. O senador republicano David Vitter foi reeleito para um segundo mandato."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BF%D0%B8%D1%82_%D1%96_%D0%BF%D1%80%D0%BE%D0%BF%D0%BE%D0%B7%D0%B8%D1%86%D1%96%D1%8F","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Supply.gif","page_title":"Попит і пропозиція","context_page_description":"По́пит і пропози́ція — економічна модель, що описує процес ціноутворення на ринку. Ця модель вводить поняття попиту та пропозиції як універсальні характеристики ринку та доводить, що за певних умов ці характеристики урівноважуються та приводять до встановлення певної ціни на цей товар. При цьому попит — представлена на ринку потреба в товарах, а пропозиція — кількість товару, який є на ринку або може бути доставлений на нього. Висновок моделі про урівноваження добре відповідає поведінці великого числа ринків та вважається важливим економічним законом.\\nВперше термін «попит і пропозиція» використав Джеймс Стюарт у своїй праці «Принципи політичної економії», опублікованій 1767 року. Цей термін також був застосований такими економістами-класиками, як Адам Сміт та Давид Рікардо, в їхніх працях «Причини багатства народів» та «Принципи політичної економії та оподаткування», відповідно. В 1870-х роках модель істотно розвинув та популяризував Альфред Маршалл в своїй праці «Принципи економіки».\\nВзаємодія попиту і пропозиції через ціновий механізм на вільних ринках є проявом «невидимої руки ринку», призводить до встановлення спонтанного порядку в економіці."},{"page_url":"https://ca.wikipedia.org/wiki/Rajola_de_Val%C3%A8ncia","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Azulejo_facade_of_the_Capela_das_Almas_in_Porto_%284%29.jpg","page_title":"Rajola de València","context_page_description":"Un taulell, rajola de València, manisa o rajola vidriada és una peça de ceràmica de poc gruix, generalment quadrada, en la qual una de les dues cares és vidriada, resultat de la cocció d'una substància a base d'esmalt, que esdevé impermeable i lluenta. Aquesta cara pot ser monocromàtica o policromàtica, llisa o en relleu. El taulell és generalment usat com a element lligat a l'arquitectura en revestiment de superfícies interiors o exteriors o com a element decoratiu aïllat. Avui dia, el taulell es fabrica de manera industrial a gran escala, i el nom comercial que sol rebre és de paviment ceràmic, si fa referència a un taulell per al terra, i de revestiment ceràmic, si es refereix al de paret."},{"page_url":"https://en.wikipedia.org/wiki/Thirteen_Years%27_War_(1454%E2%80%931466)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/ErichII.Pommern.JPG","page_title":"Thirteen Years' War (1454–1466)","context_page_description":"The Thirteen Years' War, also called the War of the Cities, was a conflict fought in 1454–1466 between the Prussian Confederation, allied with the Crown of the Kingdom of Poland, and the State of the Teutonic Order.\\nThe war began as an uprising by Prussian cities and local nobility to win independence from the Teutonic Knights. In 1454 Casimir IV married Elisabeth of Habsburg and the Prussian Confederation asked Poland's King Casimir IV Jagiellon for help and offered to accept the king as protector instead of the Teutonic Order. When the King assented, war broke out between supporters of the Prussian Confederation, backed by Poland, and backers of government by the Teutonic Knights.\\nThe Thirteen Years' War ended in the victory of the Prussian Confederation and Poland and in the Second Peace of Thorn. This was soon followed by the War of the Priests, a drawn-out dispute over the independence of the Prussian Prince-Bishopric of Warmia, in which the Knights also sought revision of the Peace of Thorn."},{"page_url":"https://ru.wikipedia.org/wiki/Symfony","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Symfony_project.png","page_title":"Symfony","context_page_description":"Symfony — свободный фреймворк, написанный на PHP.\\nSymfony предлагает быструю разработку и управление веб-приложениями, позволяет легко решать рутинные задачи веб-программиста. Работает только с PHP 5 и выше. Имеет поддержку множества баз данных. Информация о реляционной базе данных в проекте должна быть связана с объектной моделью. Это можно сделать при помощи ORM инструмента. Symfony поставляется с двумя из них: Propel и Doctrine.\\nSymfony бесплатен и публикуется под лицензией MIT.\\nПроект спонсируется французской компанией SensioLabs."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A8%D0%B0%D0%BD%D1%86%D1%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Shangqiu_mcp.png","page_title":"Шанцю","context_page_description":"Шанцю́ — міський округ у провінції Хенань Китай. Назва означає «шанський пагорб» та пов'язана з тим, що з тієї місцевості походили «шанські люди», які в подальшому заснували династію Шан."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Arnsdorf","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Arnsdorf_-_Blick_auf_die_Gemeindeverwaltung_-_geo-en.hlipp.de_-_12612.jpg","page_title":"Liste der Kulturdenkmale in Arnsdorf","context_page_description":"In der Liste der Kulturdenkmale in Arnsdorf sind die Kulturdenkmale der sächsischen Gemeinde Arnsdorf verzeichnet, die bis Juni 2017 vom Landesamt für Denkmalpflege Sachsen erfasst wurden. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale im Landkreis Bautzen."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E8%81%96%E9%87%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Sh%C3%ABngjin.jpg","page_title":"聖金","context_page_description":"聖金是阿爾巴尼亞的城鎮，位於該國西北部，由列澤州負責管轄，距離萊什7公里，面積138平方公里，處於海拔水平面，2012年人口11,076，人口密度每平方公里80人。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%B1%D1%8A%D0%B5%D0%BA%D1%82%D1%8B_%D0%BA%D1%83%D0%BB%D1%8C%D1%82%D1%83%D1%80%D0%BD%D0%BE%D0%B3%D0%BE_%D0%BD%D0%B0%D1%81%D0%BB%D0%B5%D0%B4%D0%B8%D1%8F_%D1%84%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%B3%D0%BE_%D0%B7%D0%BD%D0%B0%D1%87%D0%B5%D0%BD%D0%B8%D1%8F_%D0%93%D0%B0%D1%82%D1%87%D0%B8%D0%BD%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Gatchina_Palace_IMG_7116_1280.jpg","page_title":"Объекты культурного наследия федерального значения Гатчины","context_page_description":"Объект культурного наследия России федерального значения на территории города Гатчина."},{"page_url":"https://en.wikipedia.org/wiki/The_Orion_Experience","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/The_Orion_Experience_at_The_Break.jpg","page_title":"The Orion Experience","context_page_description":"The Orion Experience is a New York City-based pop rock band led by singer Orion Simprini. The band's music has appeared on MTV's soundtrack to Laguna Beach and several tracks from their 2007 release, Cosmicandy, were included in Zoey 101: Chasing Zoey. Their track \\"Obsessed with You\\" will also be featured in the upcoming thriller The Honeymoon Phase.\\nThe band performed at Fearless Music in early 2007. Perez Hilton says the band's biggest single, \\"Obsessed with You\\", is a \\"double yum ... indie pop gem\\".\\nTheir 2008 EP release, Heartbreaker, was produced by Maroon 5 producer Jon Kaplan.\\nNYC Girl, a five-track EP containing the tracks \\"Vampire\\" and \\"NYC Girl\\", was released on April 19, 2011. USA Today describes the string-infused disco-pop title track as reminiscent of 1970s-era Electric Light Orchestra.\\nAfter the production of their single \\"Rich Man's Holiday\\" in 2014, the band split. Beginning in 2016, lead singer Orion Simprini began to produce his own original music, uploaded to the band's YouTube channel as well as to Spotify and iTunes under the name Orion. Though recently, due to a rise in popularity they have reformed."},{"page_url":"https://lv.wikipedia.org/wiki/Metrs_(grupa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Metrs.jpg","page_title":"Metrs (grupa)","context_page_description":"Metrs ir 1993. gadā Daugavpilī tā laika Daugavpils Universitātes studentu Ulda Ruļuka, Edmunda Tamaņa, Guntara Šembela un Tāļa Lukjanska dibināta Latvijas rokgrupa, līdz šim brīdim pirmajiem trīs dalībniekiem paliekot grupā no pašiem pirmsākumiem.\\nGrupa ir izdevusi trīs studijas albumus. Plašākai auditorijai ir pieejami pēdējie divi — 2014.gada albums ar nosaukumu \\"Labākā diena\\" un 2018.gada \\"Ēnas\\". Pazīstamākās un lielāko atzinību guvušās dziesmas ir \\"Labākā diena\\", kurai ir izveidota arī videoversija, \\"Koncerts beidzies\\", \\"Slāpes\\", \\"Pelēkais\\", \\"Predestinācija\\", \\"Ēnas\\". Pēdējā albuma singls \\"Pelēkais\\" guvis ievērojamu atzinību radio klausītāju vidū."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%83%D0%BB%D1%8C%D1%82%D1%83%D1%80%D0%B0_XX_%D1%81%D1%82%D0%BE%D0%BB%D1%96%D1%82%D1%82%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Eniac.jpg","page_title":"Культура XX століття","context_page_description":"Багато чого в культурі XX ст. робить її зовсім іншою в порівнянні з усією попередньою історією людства. З небаченою силою проявилася закономірність прискорення історичного процесу. Перестають відігравати попередню роль простори і відстані, а протягом життя лише одного покоління відбуваються зміни такої глибини і значущості, що вони змінюють і образ світу, і спосіб мислення. Якщо останні 50 тисяч років існування людства виміряти числом поколінь, то всього одержимо близько 800 таких поколінь. З них 650 провели своє життя у печерах. Тільки протягом 70 останніх поколінь став можливим тісніший зв'язок між людьми завдяки писемності. Лише протягом життя останніх шести поколінь ми познайомилися з друкованим словом, а при чотирьох — навчилися досить точно вимірювати час. Лише останні два користуємося електромотором. А переважна більшість всіх матеріальних цінностей, з якими ми маємо справу у повсякденному житті, була вперше створена протягом життя сучасного покоління. Відзначимо, що при збереженні нинішніх глобальних демографічних тенденцій років через 40—50 кількість людей, які живуть на землі, вперше в історії перевищить кількість усіх померлих разом взятих."},{"page_url":"https://es.wikipedia.org/wiki/Alaska","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Iditarod_Ceremonial_start_in_Anchorage%2C_Alaska.jpg","page_title":"Alaska","context_page_description":"Alaska es uno de los cincuenta estados que forman los Estados Unidos de América. Su capital es Juneau y su ciudad más poblada es Anchorage. Está ubicado en el extremo noroeste de América del Norte, en la región Oeste del país, división Pacífico. Limita al norte con el océano Ártico, al este con Canadá, al sur con el océano Pacífico y al oeste con el mar de Bering. Con 1 717 856 km² es el estado más extenso del país y la séptima entidad subnacional más grande del mundo, por detrás de la república de Sajá, Australia Occidental, Krai de Krasnoyarsk, Groenlandia, Nunavut y Queensland; con 710 231 habs. en 2010, el cuarto menos poblado —por delante de Dakota del Norte, Vermont y Wyoming, el menos poblado— y con 0,41 hab/km², el menos densamente poblado. Fue el penúltimo en ser admitido en la Unión, el 3 de enero de 1959, como el estado número 49, solo antes que Hawái. Es el estado con mayor proporción de empleados públicos respecto de la población.​\\nAlaska recibe el nombre del vocablo aleutiano alyeska o alaxsxaq, que significa «tierra grande», o más literalmente, «el objeto contra el que la acción del mar es dirigida».​"},{"page_url":"https://el.wikipedia.org/wiki/%CE%96%CE%B1%CE%BD_%CE%9C%CF%80%CE%B1%CF%84%CE%AF%CF%83%CF%84_%CE%9B%CF%85%CE%BB%CE%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Jean-Baptiste_Lully.jpeg","page_title":"Ζαν Μπατίστ Λυλί","context_page_description":"Ο Ζαν Μπατίστ Λυλί ήταν Γάλλος συνθέτης ιταλικής καταγωγής, ο οποίος πέρασε το μεγαλύτερο μέρος της ζωής του εργαζόμενος στην αυλή του Λουδοβίκου ΙΔ΄ της Γαλλίας. Θεωρείται ο πατέρας του γαλλικού ύφους της Μπαρόκ μουσικής, αποκηρύσσοντας κάθε ιταλική επιρροή στη γαλλική μουσική του 18ου αιώνα."},{"page_url":"https://fr.wikipedia.org/wiki/Robot_(L%C3%A9onard_de_Vinci)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Leonardo-Robot3.jpg","page_title":"Robot (Léonard de Vinci)","context_page_description":"Le Robot est un automate humanoïde imaginé par Léonard de Vinci et peut-être construit par lui. Ce robot aurait été conçu à l'occasion de festivités organisées en 1495 à la cour ducale de Milan par Ludovic Sforza, le commanditaire de La Cène."},{"page_url":"https://fr.wikipedia.org/wiki/East-West_Airlines","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Douglas_C-47-DL_VH-EWE_East-West_Mascot_21.09.70_edited-3.jpg","page_title":"East-West Airlines","context_page_description":"East-West Airlines était une compagnie aérienne régionale australienne fondée à Tamworth, en Nouvelle-Galles du Sud, en 1947. Elle opérait dans les principaux centres urbains régionaux et les reliait à différentes capitales, et dans les années 1980, elle était la troisième plus grande compagnie aérienne domestique d'Australie. Elle a également effectué sa propre maintenance lourde à Tamworth et exploité un réseau de centres de voyages."},{"page_url":"https://zh.wikipedia.org/zh-tw/2016%E5%B9%B4%E4%BA%8C%E5%8D%81%E5%9B%BD%E9%9B%86%E5%9B%A2%E6%9D%AD%E5%B7%9E%E5%B3%B0%E4%BC%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Francois_Hollande_2015.jpeg","page_title":"2016年二十国集团杭州峰会","context_page_description":"2016年二十國集團杭州峰會是二十國集團第十一次領導人峰會。2016年9月4日至5日在浙江省杭州市舉行。這是中國首次舉辦二十國集團領導人峰會，也是繼韓國舉辦2010年二十國集團首爾峰會之後第二次在亞洲國家舉辦這項峰會。\\n中國把2016年峰會主題確為「構建創新、活力、聯動、包容的世界經濟」。中方從創新增長方式、完善全球經濟金融治理、促進國際貿易和投資、推動包容聯動式發展4個領域進行峰會籌備工作。"},{"page_url":"https://id.wikipedia.org/wiki/Reaksi_Diels-Alder","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/FMO_of_Diels-Alder_reaction.png","page_title":"Reaksi Diels-Alder","context_page_description":"Reaksi Diels-Alder adalah reaksi kimia organik antara diena terkonjugasi dengan alkena tersubstitusi, umumnya dinamakan sebagai dienofil, membentuk sikloheksena tersubstitusi. Reaksi ini dapat berjalan bahkan jika beberapa atom dari cincin yang terbentuk bukanlah karbon. Beberapa reaksi Diels-Alder adalah reversibel; reaksi dekomposisi dari sistem siklik dinamakan reaksi Retro-Diels-Alder. Reaksi retro ini umumnya terlihat pada saat analisis produk reaksi Diels-Alder menggunakan spektrometri massa.\\nOtto Paul Hermann Diels dan Kurt Alder pertama kali mendokumentasikan reaksi ini pada tahun 1928. Pada tahun 1950 mereka diberikan penghargaan Nobel di bidang kimia atas hasil kerja mereka.\\nReaksi Diels-Alder secara umum dianggap sebagai \\"Mona Lisa\\" reaksi di kimia organik karena ia hanya memerlukan energi yang sangat sedikit untuk membentuk cincin sikloheksena yang sangat berguna."},{"page_url":"https://ast.wikipedia.org/wiki/Macchiaioli","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Caff%C3%A8_Michelangiolo_by_Adriano_Cecioni_1861.jpg","page_title":"Macchiaioli","context_page_description":"Los macchiaioli conformaron un movimientu pictóricu que se desenvolvió na ciudá italiana de Florencia na segunda metá del SIEGLU|XIX||s}}. El términu foi acuñáu en 1862 por un columnista anónimu del periódicu Gazzeta del Popolo, que con esa espresión despreciativa definió al grupu de pintores qu'en redol a 1855 aniciara una renovación antiacadémica de la pintura italiana. Estos mozos artistes axuntar nel Caffè Michelangiolo, onde bullíen les nueves idees con que queríen contribuyir a la pintura de la so dómina.\\nEl movimientu proponíase anovar la cultura pictórica nacional. Los macchiaioli oponer al romanticismu y al academicismu, y afirmaben que la imaxe de la realidá ye un contraste de llurdios de colores y de clarescuru. Esti movimientu ye l'únicu que nel panorama artísticu de la so dómina merez realmente'l nome d'escuela, tantu pola comunidá d'intereses qu'amestaba a tolos componentes del grupu, provenientes de distintes rexones d'Italia, como pola alta calidá de los resultaos artístiques llograos."},{"page_url":"https://it.wikipedia.org/wiki/Fobos_(mitologia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/4th_century_AD_Mosaic_with_mask_of_Phobos_%28Fear%29_within_a_radiating_petal_design%2C_from_Halicanassus_%28Asia_Minor%29%2C_British_Museum_%2814256569991%29.jpg","page_title":"Fobos (mitologia)","context_page_description":"Fobos, o Fobo, era una figura della mitologia greca.\\nFiglio di Ares, dio della guerra, e di Afrodite, dea della bellezza, era la divinizzazione della paura e fratello di Deimos, il terrore causato dalla guerra. Tuttavia queste personificazioni malvagie avevano anche fratelli e sorelle buone, come Armonia, la sposa di Cadmo.\\nIl suo tempio maggiore si trovava a Sparta: i Lacedemoni pregavano nel luogo religioso prima di scendere in battaglia. Inoltre, sugli scudi dei guerrieri erano talvolta raffigurate le \\"immagini\\" di Fobos e quelle della Gorgone. Plutarco riferisce, nella Vita di Alessandro, che anche Alessandro Magno, alla vigilia della battaglia di Gaugamela contro il re persiano Dario, fece sacrifici a questo dio."},{"page_url":"https://pl.wikipedia.org/wiki/Areal","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Igreja_Nossa_Senhora_das_Dores_%28Areal%29.JPG","page_title":"Areal","context_page_description":"Areal – miasto i gmina w Brazylii, w stanie Rio de Janeiro. Znajduje się w mezoregionie Centro Fluminense i mikroregionie Três Rios."},{"page_url":"https://en.wikipedia.org/wiki/Changan_BenBen","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/2018_Chang%27an_Ben_Ben_EV%2C_rear_8.16.18.jpg","page_title":"Changan BenBen","context_page_description":"The Changan BenBen or sometimes Changan Benni is a 5-door city car hatchback produced by Changan Automobile."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E6%B2%99%E7%94%B0%E7%AC%AC%E4%B8%80%E5%9F%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/City_One_Shatin_Ex_Fountain_with_pavilion_201810.jpg","page_title":"沙田第一城","context_page_description":"沙田第一城是香港新界沙田区至今最大型的住宅项目，由52幢住宅楼宇组成。屋苑内设有两座购物商场、休憩花园、球场及游泳池等设施供住客使用。在附近设有几间学校。\\n住宅部分由富城集圑旗下的“百得物业管理有限公司”负责物业管理。"},{"page_url":"https://id.wikipedia.org/wiki/Gerard_van_Honthorst","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Amalia_van_Solms_%28Gerard_van_Honthorst%2C_1650%29.jpg","page_title":"Gerard van Honthorst","context_page_description":"Gerard van Honthorst adalah seorang pelukis Zaman Keemasan Belanda.\\nHonthorst lahir di Utrecht, sebagai putra dari seorang pelukis dekoratif, dan diajarkan di bawah pengarahan ayahnya, dan kemudian di bawah pengarahan Abraham Bloemaert."},{"page_url":"https://it.wikipedia.org/wiki/Eliud_Kiptanui","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Berlin_marathon_2012_buelowstrasse_between_kilometers_36_and_37_30.09.2012_10-55-054.jpg","page_title":"Eliud Kiptanui","context_page_description":"Eliud Kiptanui è un maratoneta keniota, vincitore della maratona di Praga 2010 con il tempo di 2h05'39\\".\\nInizia la sua carriera sulla distanza nel dicembre 2009, conquistando la Safaricom Marathon, disputata a Kisumu, in Kenya, in 2h12'17\\", con un vantaggio di diversi minuti sul secondo classificato.\\nNel 2010, oltre alla vittoria a Praga con record della corsa, ottiene anche un quinto posto alla maratona di Berlino, vinta dal connazionale Patrick Makau. È giunto quinto alla maratona di Rotterdam 2011, alcuni minuti dietro al trionfatore Wilson Chebet."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8D%A1%E5%BB%B7%E5%A4%A7%E5%B1%A0%E6%AE%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Katyn_-_decision_of_massacre_p4.jpg","page_title":"卡廷大屠殺","context_page_description":"卡廷大屠殺，又稱「卡廷森林大屠殺」、「卡廷事件」或「卡廷慘案」，是蘇聯秘密警察機關內務人民委員部在蘇聯共產黨中央政治局的批准下，於1940年4月至5月間對蘇軍入侵波蘭時被俘的波蘭戰俘、知識分子、警察及其他公務員進行的有組織的大屠殺。此次屠殺起源於拉夫連季·貝利亞的關於處決所有波蘭軍官成員的提議，正式文檔於1940年3月5日由包括總書記約瑟夫·史達林在內的蘇共中央政治局簽署批准。遇害人數估計約為22,000人，最常見的數字為21,768人。\\n屠殺發生在卡廷森林、加里寧、卡爾可夫等地。受害者中約8,000人是1939年蘇聯入侵波蘭的戰俘，其餘則是被指控為「情報人員、憲兵、破壞者、地主、工廠主、牧師及官員」而遭逮捕的平民。由于波蘭的徵兵制度規定除非獲得當局豁免，所有大學畢業生必須服兵役，接受後備軍官培訓，蘇聯得以捕獲大批波蘭知識分子，其中還包括波蘭籍的猶太人、俄羅斯人、烏克蘭人、喬治亞人、韃靼人、白俄羅斯人以及基督教徒和穆斯林。\\n卡廷大屠殺具體發生在位於卡廷森林的科澤利斯克戰俘營。在蘇共中央總書記史達林的命令下，除在卡廷森林外，同時發生的屠殺還有在斯塔洛柏斯克和奧斯塔什科夫戰俘營的處決戰俘行動 以及發生在西白俄羅斯和西烏克蘭的處決政治犯行動。處決地點包括設於斯摩棱斯克的內務人民委員部總部、當地一個屠場，以及加里寧、卡爾可夫、莫斯科等蘇聯城市的監獄。在這些屠殺之中，卡廷大屠殺規模最大。現代波蘭對卡廷大屠殺的調查覆蓋上述所有的屠殺。\\n1941年，德軍入侵蘇聯並推進占領卡廷森林，蘇聯人的暴行才被軸心國發現。1943年，納粹德國宣布在卡廷森林發現集體墓地。德國的揭發，致使設於倫敦的波蘭流亡政府與蘇聯斷絕外交關係。蘇聯官方一直否認卡廷大屠殺，直到1990年，時任波蘭總統雅魯澤爾斯基訪問蘇聯時，蘇聯官方才承認：內務人民委員部實施並隱瞞了卡廷大屠殺。俄羅斯聯邦檢察總長的一項調查證實蘇聯需要為卡廷大屠殺負責，其中確認了1,803名波蘭公民的死亡，但是拒絕將其承認為戰爭罪行或種族屠殺，並以屠殺參與者已經去世為由終止了調查。俄羅斯政府拒絕承認遇難者是史達林壓迫的受害者，使他們不能得到正式死後平反。俄羅斯人權組織「紀念碑」發表聲明稱調查結果不可信，認為「至少」有14500人遇害，而一定不是俄羅斯官方表示的1803人。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8A%A0%E5%A4%A7%E5%88%A9%E7%B4%8D%C2%B7%E7%B6%AD%E9%87%8C%E5%A5%A7%E5%B0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/YangzhouKatarinaVilioniTomb1342.jpg","page_title":"加大利納·維里奧尼","context_page_description":"加大利納·維里奧尼是一名十四世紀居於揚州的義大利女性，家族以營商為生。維里奧尼之所以為人所悉，全因一塊於1951年在揚州拆城築路時於舊城南門發現的石碑。碑上的文字以舊哥德體的拉丁文寫成，指出維里奧尼於1342年逝世，其父為多明我·維里奧尼；另刻了基督宗教殉道聖人亞歷山大的加大肋納的殉道圖，中央則刻有聖母抱著耶穌的圖案。"},{"page_url":"https://de.wikipedia.org/wiki/Lateranbasilika","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Baptist%C3%A8re_du_Latran.JPG","page_title":"Lateranbasilika","context_page_description":"Die Lateranbasilika, italienisch Basilica San Giovanni in Laterano, ist die Kathedrale des Bistums Rom, eine der sieben Pilgerkirchen und eine der fünf Papstbasiliken Roms. Ihre lateinische Bezeichnung lautet Archibasilica Sanctissimi Salvatoris et Sanctorum Iohannis Baptistae et Evangelistae in Laterano. Die Basilika gehört zum Gebäudekomplex des Lateran im Stadtteil Monti im Zentrum Roms, der seit der Zeit Konstantins I. der offizielle Sitz der Päpste ist. Zur Lateranbasilika gehört ein antikes Baptisterium.\\nAls Bischofskirche von Rom ist die Lateranbasilika die ranghöchste der vier Basilicae maiores Roms. Gegenwärtiger Erzpriester ist Kardinal Angelo De Donatis. Das Amt des Ehrenkanonikers von San Giovanni in Laterano kommt dem Präsidenten Frankreichs zu."},{"page_url":"https://no.wikipedia.org/wiki/Pan%C4%8Devo","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Serbia_Pan%C4%8Devo.png","page_title":"Pančevo","context_page_description":"Pančevo er en by og en kommune i det nordøstlige Serbia, kun 15 kilometer unna Beograd. Kommunen har 127 162 innbyggere og byen har 77 087 innbyggere. Kommunens areal er på 759 km²\\nByen er det administrative sentrum for fylket Nedre Banat, og havnen der, er en av de viktigste havnene langs elven Timiş, som renner like ved.\\nNesten 80% av innbyggerne i Pančevo er serbere."},{"page_url":"https://de.wikipedia.org/wiki/Fahrgastwechselzeit","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Mezzi_in_servizio_04m.jpg","page_title":"Fahrgastwechselzeit","context_page_description":"Als Fahrgastwechselzeit oder Haltezeit mit offenen Türen wird die Zeit bezeichnet, in der Fahrgäste an einer Haltestelle oder einem Bahnhof ein- und aussteigen. Meist wird der Begriff in Zusammenhang mit dem öffentlichen Personennahverkehr verwendet. Auf die Länge der Fahrgastwechselzeit hat vor allem das Fahrgastaufkommen, also die Anzahl und die örtliche Verteilung der Ein- und Aussteiger einen wesentlichen Einfluss. Darüber hinaus ist die Fahrgastwechselzeit sowohl für die Konstruktion von Fahrzeugen als auch für den pünktlichen Betrieb sowie die Reisezeit eines Verkehrsmittels von Bedeutung. Anhand der, beispielsweise durch Fahrgastzählungen ermittelten, Zahl der an einer Station ein- und aussteigenden Fahrgäste lässt sich die Haltezeit bestimmen und in den Fahrplan einarbeiten."},{"page_url":"https://ceb.wikipedia.org/wiki/Prov%C3%ADncia_do_U%C3%ADge","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Estrada_Caxito-U%C3%ADge.jpg","page_title":"Província do Uíge","context_page_description":"Lalawigan ang Província do Uíge sa Anggola. Nahimutang ni sa amihanan-kasadpang bahin sa nasod, 300 km sa amihanan-sidlakan sa Luanda ang ulohan sa nasod. Adunay 1,426,354 ka molupyo. Naglangkob kin og 58,698 ka kilometro kwadrado. Província do Uíge mopakigbahin sa usa ka utlanan sa Malanje Province, Cuanza Norte Province, Bengo Province, ug Zaire.\\nAng yuta sa Província do Uíge kay medyo kabukiran.\\nProvíncia do Uíge may sa mosunod nga mga subdibisyon:\\nUige Municipality\\nMunicípio Songo\\nMunicípio Sanza Pombo\\nMunicípio Santa Cruz\\nQuitexe Municipality\\nMunicípio Quimbele\\nMunicípio Puri\\nNegage Municipality\\nMunicípio Mucaba\\nMuniípio Maquela do Zombo\\nMunicípio Damba\\nMunicípio Bungo\\nMunicípio Buengas\\nMunicípio Bembe\\nConcelho do Bembe\\nAmbuila Municipality\\nMunicípio Alto Cauale\\nMga lungsod sa Província do Uíge:\\nUíge\\nSa mosunod nga mga natural nga mga bahin makita sa Província do Uíge:\\nMga kalapukan:\\nLagoa Olela\\nLagoa Quessa\\nLagoa Quita\\nLagoa Sengue\\nMga suba:\\nAmboche\\nAnvo\\nAqueca\\nAssassa\\nAtuca\\nBá\\nBá\\nBabala\\nBábala\\nBabalo\\nBabalo\\nBabalo\\nBabata\\nBaca\\nBaca\\nBache\\nBadindeji\\nBago\\nBala\\nBala\\nBala\\nBalage\\nBalata\\nBalumbo\\nBamba\\nBamba\\nBâmbala\\nBambi\\nBambi\\nBambi Primeiro\\nBambi Segundo\\nBambo\\nBanda\\nBandanga\\nBanga"},{"page_url":"https://tr.wikipedia.org/wiki/%C4%B0spanya_tarihi","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c8/Ethnographic_Iberia_200_BCE.PNG","page_title":"İspanya tarihi","context_page_description":"İspanya tarihi, İspanya'da tarih öncesi dönemlerden günümüze kadar uzanan dönem boyunca yaşanan olayları kapsar.\\nİnsan uygarlığının İber yarımadasındaki tarihi günümüzden 35.000 yıl öncesine kadar uzanmaktadır. Bu dönem boyunca İber yarımadası Keltler, Kartacalılar, Fenikeliler, Yunanlar dahil birçok kavim tarafından istilaya uğramıştır. MÖ 2. yüzyılda İspanya Roma Cumhuriyeti'nin bir parçası haline geldi. 410 yılında İspanya bir Cermen ırkı olan Vizigotların eline geçti. Orta Çağ boyunca süren anlaşmazlıklara rağmen, İspanya Avrupa'daki en eski millî devletlerden biridir. İspanya'nın bugünkü sınırları on beşinci yüzyılın sonlarında çizilmiş ve Aragonlu II. Fernando ile Kastiyalı I. Isabel'in evlenmesiyle tek bir taht altında birleştirilmişti. 16. ve 17. yüzyıllarda Portekiz de bir süreliğine bu İber birliğinin bir parçasıydı.\\nİspanya 16. yüzyılda Avrupa'daki en büyük güç haline gelmiş ve bu dönemden 18. yüzyıla kadar Avrupa'daki meselelerle oldukça yakından ilgilenmiştir. İspanya'nın kralları Avrupa'nın birçok yerine yayılmış eyaletlere hükmediyordu."},{"page_url":"https://pl.wikipedia.org/wiki/Tur%C3%B3wka_le%C5%9Bna","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Hierochloe_australis_-_Botanical_Garden_in_Kaisaniemi%2C_Helsinki_-_DSC03546.JPG","page_title":"Turówka leśna","context_page_description":"Turówka leśna – gatunek trawy z rodziny wiechlinowatych. Występuje w Europie, w Polsce objęty ochroną."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_milliardaires_du_monde_en_2016","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Amancio_Ortega_Gaona_signature.png","page_title":"Liste des milliardaires du monde en 2016","context_page_description":"Ceci est la liste des milliardaires du monde telle que publiée par le magazine américain Forbes pour l'année 2016. Ce magazine recense les milliardaires de la planète, à l'exception des têtes couronnées, et exprime leur fortune en milliards de dollars américains.\\nLe classement en 2016 dénombre au total 1 810 milliardaires, en légère diminution face aux 1 826 de l'année dernière. Leur patrimoine s'élève à un peu plus de 6 480 milliards de dollars, soit une diminution en un an de 570 milliards de dollars.\\nPour la première fois depuis 2010, la fortune moyenne de ces milliardaires a baissé, s'établissant cette année à 3,6 milliards, 300 millions de moins que l'an dernier. Forbes explique ce recul relatif par différents facteurs tels que la baisse du prix du pétrole, l'instabilité de la bourse ainsi qu'un dollar fort, qui a redistribué les richesses dans le monde.\\nLes États-Unis ont le plus grand nombre de milliardaires suivis de la Chine continentale et de l'Allemagne. Bill Gates, est pour la troisième année consécutive, l'homme le plus riche au monde avec une fortune s’établissant à 79.3 milliards de dollars, en baisse cependant de 4,2 milliards par rapport à l'an dernier."},{"page_url":"https://pt.wikipedia.org/wiki/Vale_do_Sil%C3%ADcio","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/28/Stanford_Campus_Aerial_Photo.JPG","page_title":"Vale do Silício","context_page_description":"O Vale do Silício, na Califórnia, Estados Unidos, é um apelido da região da baía de São Francisco onde estão situadas várias empresas de alta tecnologia, destacando-se na produção de circuitos eletrônicos, na eletrônica e informática. O vale abrange várias cidades do estado da Califórnia, como Palo Alto, São Francisco e Santa Clara, estendendo-se até os subúrbios de São José.\\nA palavra \\"silício\\" vem das empresas de pesquisa e manufatura de circuitos integrados de silício, como a Fairchild Semiconductor e a Intel, mas hoje a região é sede para várias empresas de alta tecnologia, muitas incluídas no na Lista 500 da Fortune, além de empresas Startup.\\nFora dos Estados Unidos, destaca-se em Israel o Silicon Wadi, a segunda maior aglomeração de indústrias de tecnologia de ponta, atrás apenas do Vale do Silício da Califórnia."},{"page_url":"https://tr.wikipedia.org/wiki/Sapa_Inca","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Atahualpa.jpg","page_title":"Sapa Inca","context_page_description":"Sapa Inca, İnkaların \\"tanrı imparator\\" anlamında kullandıkları isim. Apu olarak da bilinir. Cusco Krallığı ve ardılı İnka İmparatorluğu'nda kullanılmıştır."},{"page_url":"https://en.wikipedia.org/wiki/A._H._Vedel","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/British_Admiral_Holt_and_Danish_Admiral_Vedel_reveiw_Danish_Flotilla_sailors.jpg","page_title":"A. H. Vedel","context_page_description":"Aage Helgesen Vedel was a Danish vice admiral and commander-in-chief of the Royal Danish Navy from 1941 until 1958."},{"page_url":"https://fr.wikipedia.org/wiki/Art_bouddhique","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Prajnaparamita_Java.jpg","page_title":"Art bouddhique","context_page_description":"L’art bouddhique naît dans le sous-continent indien, probablement durant les siècles suivant la mort du Bouddha historique ou Gautama Bouddha, bien que ses premières manifestations attestées par des découvertes archéologiques semblent dater du règne d'Ashoka. Une première phase, essentiellement indienne, appelée « phase aniconique », durant laquelle la personne du Bouddha est évoquée par des symboles, est suivie vers le Iᵉʳ siècle d'une « phase iconique » durant laquelle apparaissent des représentations anthropomorphiques du Bouddha. Cette seconde phase apparait simultanément en Inde et dans un autre foyer artistique important, né aux environs du début de l'ère chrétienne sur le territoire du royaume indo-grec puis de l'empire Kouchan, dont la production la plus remarquable est l'art gréco-bouddhique du Gandhara. À partir de cette époque, l'art bouddhique se diversifie, absorbant les influences culturelles rencontrées dans les contrées où la doctrine de Gautama se diffuse : en Asie centrale et orientale ; à Sri Lanka et en Asie du Sud-Est."},{"page_url":"https://pl.wikipedia.org/wiki/Jura_Szwabska","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Donautal_vom_Knopfmacherfelsen.jpg","page_title":"Jura Szwabska","context_page_description":"Jura Szwabska – pasmo górskie w Badenii-Wirtembergii w Niemczech o długości około 220 kilometrów i szerokości od 40 do 70 kilometrów. Najwyższe wzniesienie – Lemberg. W 2009 roku wpisane na listę rezerwatów biosfery UNESCO. Na zachodzie graniczy ze Schwarzwaldem."},{"page_url":"https://en.wikipedia.org/wiki/Ladywell","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Ladywell_Police_Station.jpg","page_title":"Ladywell","context_page_description":"Ladywell is a locale in Lewisham in South East London, England, and a ward in the London Borough of Lewisham between Brockley, Crofton Park and Lewisham proper. It has ample green space including Ladywell Fields and Hilly Fields which borders Brockley. Ladywell Village, the main shopping area along Ladywell Road, was given a face lift in 2013 with £800,000 of Transport for London funding. The pavements were widened, short stay bays created to help local businesses and shoppers, and trees were added. Ladywell Village has a range of retail outlets including a number of cafes, a patisserie and a delicatessen."},{"page_url":"https://de.wikipedia.org/wiki/1354","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Blason_Charles_de_la_Cerda_%28selon_Gelre%29.svg","page_title":"1354","context_page_description":"Boemund II. von Saarbrücken wird als Nachfolger des am 21. Januar verstorbenen Balduin von Luxemburg einstimmig zum Erzbischof und Kurfürsten von Trier gewählt. Erst nach mehrwöchigen Bedenken nimmt er die Wahl an. Am 2. Mai erhält er die Bestätigung von Papst Innozenz VI.\\n13. März: Die Grafschaft Luxemburg wird zum Herzogtum erhoben. Wenzel I. wird erster Herzog Luxemburgs.\\n28. September: Konrad von Megenberg veröffentlicht den Tractatus contra Wilhelmum Occam, in dem er sich gegen die Unterwerfungsformel von Clemens VI. wendet, die die Anerkennung Karls IV. als rechtmäßigen Herrscher und den Verzicht auf die Meinung verlangt, der Kaiser könne den Papst ein- und absetzen.\\nKönig Karl IV. zieht im September mit dreihundert Rittern nach Italien.\\n5. Oktober: Giovanni Visconti, Stadtherr und Erzbischof von Mailand sowie Doge von Genua, stirbt. Die Herrschaft in seinem Machtbereich wird unter seinen Neffen Matteo II., Galeazzo II. und Bernabò, aufgeteilt. Auch im Amt des Erzbischofs von Mailand folgt ein Mitglied der Familie Visconti.\\nNach zwei Rügischen Erbfolgekriegen fällt das ehemalige Fürstentum endgültig an das Herzogtum Pommern-Wolgast."},{"page_url":"https://en.wikipedia.org/wiki/Birmingham_Walk_of_Stars","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Birmingham_Walk_of_Stars_Julie_Walters.jpg","page_title":"Birmingham Walk of Stars","context_page_description":"The Broad Street Walk of Stars is a walk of fame-style installation on the pedestrian pavement of Broad Street, Birmingham, England, which honours notable people from the Birmingham area or with significant connections with it. The scheme is organised and funded by the Broad Street Business Improvement District."},{"page_url":"https://nl.wikipedia.org/wiki/Bocula_horus","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/27/36-%28Athetis%29_Bocula_horus_%28Fawcett%2C_1916%29.JPG","page_title":"Bocula horus","context_page_description":"Bocula horus is een vlinder uit de familie spinneruilen. De wetenschappelijke naam is voor het eerst geldig gepubliceerd in 1916 door Fawcett.\\nDe soort komt voor in tropisch Afrika."},{"page_url":"https://en.wikipedia.org/wiki/Hiroatsu_Takata","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/18%E6%96%B0%E6%B8%A1%E6%88%B8%E7%A8%B2%E9%80%A0_R.jpg","page_title":"Hiroatsu Takata","context_page_description":"Hiroatsu Takata was a Japanese sculptor and essayist, who lived for many years in Paris. He had a wide circle of friends in the literary world, and his daughter was once married to Ryūichi Tamura."},{"page_url":"https://it.wikipedia.org/wiki/Gazella_dorcas","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Leptocerosvsdorcas.png","page_title":"Gazella dorcas","context_page_description":"La gazzella dorcade, nota anche come gazzella del deserto, è una piccola specie di gazzella piuttosto comune. Le sue numerose sottospecie vivono pascolando e brucando nelle praterie, nelle steppe, negli uadi, nei deserti rocciosi e nei semideserti del Nordafrica e del Medio Oriente. In natura ne rimangono 35 000-40 000 capi. In passato anche la gazzella saudita, una specie scomparsa originaria della Penisola Arabica, era ritenuta una sua sottospecie."},{"page_url":"https://zh.wikipedia.org/zh-my/%E8%90%AC%E5%B7%92%E5%BA%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/%E8%90%AC%E5%B7%92%E5%BA%84%E7%AE%A1%E5%85%A7%E7%95%A5%E5%9C%96.jpg","page_title":"萬巒庄","context_page_description":"万峦庄，为1920年~1945年间存在之行政区，辖属高雄州潮州郡。今屏东县万峦乡。清朝旧称恋恋庄、蛮蛮庄、万蛮庄。"},{"page_url":"https://vi.wikipedia.org/wiki/Eureka_Springs,_Arkansas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Eureka_Springs_collage.png","page_title":"Eureka Springs, Arkansas","context_page_description":"Eureka Springs là một thành phố thuộc quận Carroll, tiểu bang Arkansas, Hoa Kỳ. Năm 2010, dân số của thành phố này là 2073 người."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AB%E3%82%B9%E9%83%A1_(%E3%82%A2%E3%82%A4%E3%82%AA%E3%83%AF%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Cass_Co_IA_Court_House.jpg","page_title":"カス郡 (アイオワ州)","context_page_description":"カス郡は、アメリカ合衆国アイオワ州の南西部に位置する郡である。2010年国勢調査での人口は13,956人であり、2000年の14,684人から5.0％減少した。郡庁所在地はアトランティック市であり、同郡で人口最大の都市でもある。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Bamberg/B%C3%BCrgerliche_Bergstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Bamberg%2C_Untere_Sandstra%C3%9Fe_37%2C_20150911%2C_001.jpg","page_title":"Liste der Baudenkmäler in Bamberg/Bürgerliche Bergstadt","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberfränkischen kreisfreien Stadt Bamberg zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Teilliste enthält die Denkmäler der Bürgerlichen Bergstadt gemäß der Aufteilung der Buchreihe Die Kunstdenkmäler von Bayern. Die Bürgerliche Bergstadt umfasst folgende Plätze und Straßen: Am Leintritt, Balthasargäßchen, Concordiastraße, Dominikanerstraße, Eisgrube, Elisabethenstraße, Frauenplatz, Geyerswörthplatz, Grünhundsbrunnen, Herrenstraße, Hinterer Bach,"},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%86%E0%A6%AB%E0%A7%8D%E0%A6%B0%E0%A6%BF%E0%A6%95%E0%A6%BE%E0%A6%A8_%E0%A6%B0%E0%A6%BF%E0%A6%AD%E0%A6%BE%E0%A6%B0_%E0%A6%AE%E0%A6%BE%E0%A6%B0%E0%A7%8D%E0%A6%9F%E0%A6%BF%E0%A6%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/African_River_Martin_Hartlaub.jpg","page_title":"আফ্রিকান রিভার মার্টিন","context_page_description":"আফ্রিকান রিভার মার্টিন হচ্ছে প্যাসারিন জাতের পাখি। তবে কোন কোন রিভার মার্টিন শ্যালো পরিবার এর উপ পরিবারের সদস্য। প্রথম যখন আফ্রিকান রিভার মার্টিন আবিষ্কার করা হয় তখন এদেরকে শ্যালো পাখি হিসেবে সনাক্ত করা হয়। আফ্রিকান রিভার মার্টিন বড় আকারের শ্যালো পাখি যারা প্রধানত কালো রঙের হয়, মাথার দিকে নীলচে-সবুজ আভা থাকে।"},{"page_url":"https://eo.wikipedia.org/wiki/Zamboanga","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/42/Calle_Climaco_ZC_2010.JPG","page_title":"Zamboanga","context_page_description":"Zamboanga estas metropolo, grava havenurbo kaj universitata urbo en Filipinoj, en insulo Mindanao. La loknomo signifas: ĝardeno. Ĝi estas la sesa plej granda urbo de la lando kaj ĉefepiskopejo de 1958."},{"page_url":"https://az.wikipedia.org/wiki/Uilyam_%C5%9Eokli","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Bardeen_Shockley_Brattain_1948.JPG","page_title":"Uilyam Şokli","context_page_description":"Uilyam Bredford Şokli —Amerikalı fizik, tranzistorun müəlliflərindən biri, Fizika üzrə Nobel mükafatı laureatı."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%81%E0%B8%AD%E0%B8%87%E0%B8%97%E0%B8%B1%E0%B8%9E%E0%B9%80%E0%B8%A3%E0%B8%B7%E0%B8%AD%E0%B9%84%E0%B8%97%E0%B8%A2","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/39/Chakri_Naruebet_2001.JPEG","page_title":"กองทัพเรือไทย","context_page_description":"กองทัพเรือไทย หรือ ราชนาวีไทย เป็นหน่วยงานที่รับผิดชอบต่อการปฏิบัติการทางทหารในทะเล ลำน้ำ และพื้นที่บริเวณชายฝั่งของประเทศไทย กองทัพเรือมีจำนวนกำลังพลประจำการเป็นลำดับ 2 ซึ่งมีเรือปฏิบัติการด้วยเรือรบกว่า 74 ลำ อากาศยานกว่า 90 เครื่อง และกำลังรบทางบกอีก 2 กองพล นับเป็นกองทัพเรือที่มีความสำคัญในลำดับต้นของภูมิภาคเอเชีย กองทัพเรือมีผู้บัญชาการทหารเรือเป็นผู้บังคับบัญชาสูงสุด โดยเป็นหน่วยงานในสังกัดของกองบัญชาการกองทัพไทย ที่มีผู้บัญชาการทหารสูงสุดเป็นผู้บังคับบัญชา และอยู่ในสังกัดของกระทรวงกลาโหม\\nกองทัพเรือมีพื้นที่ปฏิบัติการหลักทั้งในอ่าวไทย และทะเลอันดามัน ตามแนวเขตแดนระหว่างประเทศในทะเลความยาวกว่า 1,680 ไมล์ และตามแนวชายฝั่งความยาวกว่า 1,500 ไมล์ หน่วยต่าง ๆ ในสังกัดกองทัพเรือมีลักษณะการจัดโครงสร้างหน่วยที่คล้ายกับกองทัพเรือสหรัฐอเมริกามาก โดยเฉพาะในหน่วยกำลังรบ คือ กองการบินทหารเรือ กองเรือยุทธการ หน่วยบัญชาการสงครามพิเศษทางเรือ กองเรือยุทธการ และหน่วยบัญชาการนาวิกโยธิน"},{"page_url":"https://ko.wikipedia.org/wiki/%EC%95%8C%ED%94%84%EB%A0%88%EB%93%9C_%EA%B0%80%EB%A5%B4%EC%8B%9C%EC%95%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Amaia_y_Alfred.jpg","page_title":"알프레드 가르시아","context_page_description":"알프레드 가르시아는 스페인의 가수이다. 유로비전 송 콘테스트 2018에서 아마이아 로메로와 함께 스페인 대표로 참가했다."},{"page_url":"https://sv.wikipedia.org/wiki/Fu_Shou","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/EmperorXianEmpressFuShou.jpg","page_title":"Fu Shou","context_page_description":"Fu Shou, född okänt år, död 214, var en kinesisk kejsarinna, gift med kejsar Han Xiandi.\\nRelationen mellan henne och kejsaren beskrivs som lycklig, men de utsattes båda för förödmjukelser under den tid när kejsarhovet behärskades av krigsherrar. Hon kom att stå i opposition till krigsherren Cao Cao, som hade tagit makten över hovet och höll kejsarparet som gisslan. I ett brev till sin far anklagade hon Cau Cao för att ha avrättat en konkubin, Dong, och bad honom om råd om hur Cao Cao skulle kunna avsättas från makten. Fadern vågade inte svara, men hennes brev upptäcktes av Cao Cao, som lät arrestera henne i den maktlösa kejsarens åsyn, varefter han fängslade och dödade henne."},{"page_url":"https://en.wikipedia.org/wiki/The_Marshall_Mathers_LP","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Eminem_Up_in_Smoke_Tour.jpg","page_title":"The Marshall Mathers LP","context_page_description":"The Marshall Mathers LP is the third studio album by American rapper Eminem, released on May 23, 2000, by Aftermath Entertainment and Interscope Records. The album was produced mostly by Dr. Dre and Eminem, along with The 45 King, the Bass Brothers, and Mel-Man. Recorded over a two-month period in several studios around Detroit, the album features more introspective lyricism, including Eminem's thoughts on his rise from rags to riches, the criticism of his music, and his estrangement from his family and wife. A transgressive work, it incorporates horrorcore and hardcore hip hop, while also featuring satirical songs. Featured appearances include Dido, RBX, Sticky Fingaz, Bizarre, Snoop Dogg, Xzibit, Nate Dogg, and D12.\\nLike its predecessor, The Marshall Mathers LP was surrounded by significant controversy upon its release, while also propelling Eminem to the forefront of American pop culture. Criticism centered on lyrics that were considered violent, homophobic, misogynistic, as well as the reference to the Columbine High School massacre."},{"page_url":"https://hu.wikipedia.org/wiki/Agent_327","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Agent327.png","page_title":"Agent 327","context_page_description":"Az Agent 327 egy népszerű holland képregénysorozat, melyet Martin Lodewijk ír és rajzol. Hollandiában az Eppo magazinban, Magyarországon pedig a Kockás képregényújságban jelent meg először."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%BA%D8%B1%D9%86%D9%88%D9%82%D9%8A_%D8%A3%D8%B1%D8%AC%D9%88%D8%A7%D9%86%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Geranium_purpureum_3.jpg","page_title":"غرنوقي أرجواني","context_page_description":"غرنوقي أرجواني هو نوع من النباتات يتبع جنس الغرنوقي من الفصيلة الغرنوقية."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A1%94%E6%96%BD%E6%8F%90%E5%85%8B%E6%96%87%E5%8C%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Tashtyk_culture01.jpg","page_title":"塔施提克文化","context_page_description":"塔施提克文化是分布在西伯利亞地區葉尼塞河中游的米努辛斯克盆地，即今克拉斯諾亞爾斯克和科麥羅沃州東部一帶，年代約為前5世紀至前1世紀，屬於早期鐵器時代文化。有人說葉尼塞吉爾吉斯人是他們後人。一般認為就是司馬遷《史記》中的鬲昆，其後臣服於匈奴近300餘年。"},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%DA%A9%D9%87_%D8%A8%D9%87%D8%A7%D8%B1_%D8%A2%D8%B2%D8%A7%D8%AF%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Azadi_Gold_Coin_1370.jpg","page_title":"سکه بهار آزادی","context_page_description":"سکّهٔ بهار آزادی یکی از مسکوکات طلای قانونی در جمهوری اسلامی ایران است. از سال ۱۳۵۸ خورشیدی، به مناسبت و یادبود پیروزی انقلاب ۱۳۵۷ ایران، انواع سکه‌های بهار آزادی در قطع‌های مختلف ضرب شده‌است. عیار طلای این سکه‌ها ۹۰۰ در ۱۰۰۰ است. معمولاً در هر سال ضرابخانهٔ بانک مرکزی ایران، سکه‌ها را ضرب کرده و از طریق بانک‌های عامل یا صرافی‌های مجاز به بازار عرضه می‌کند. این سکه‌ها به صورت خرد یا عمده و به قیمت روز خرید و فروش می‌شوند."},{"page_url":"https://de.wikipedia.org/wiki/Johann_Michael_Wagner","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Vesser_Dorfkirche_03.jpg","page_title":"Johann Michael Wagner","context_page_description":"Johann Michael Wagner war ein thüringischer Orgelbauer."},{"page_url":"https://en.wikipedia.org/wiki/Formula_One_sponsorship_liveries","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Arrows_A1_at_Silverstone_Classic_2012_%281%29.jpg","page_title":"Formula One sponsorship liveries","context_page_description":"Formula One sponsorship liveries have been used since the late 1960s, replacing the previously used national colours. With sponsors becoming more important with the rising costs in Formula One, many teams wanted to be able to display the logos of their sponsors as clearly as possible.\\nThe liveries are usually changed for every season in the sport, marking the marketing ideas of the sponsors. Many teams keep some consistency over the years however, like the red colour of Ferrari, which has its origin in a shade of red known as rosso corsa being the national racing colour of Italy. Tobacco and alcohol advertising was common in motorsport, however as bans spread throughout the world teams used an alternate livery which alluded to the tobacco or alcohol sponsor, or entirely eliminated their name when in nations with a ban – this is now only seen on Ferrari's Marlboro sponsored vehicles – where the sponsor is technically banned from advertising in all host nations. At historical events, cars are allowed to use the livery which was used when the car was actively competing."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%A8%D7%91%D7%95%D7%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Amaranthus_viridis_Inflorescens_Closeup_TorreLaMata.jpg","page_title":"ירבוז","context_page_description":"יַרְבּוּז הוא סוג של צמח עשבוני בעל תפרחות דמויות שיבולת, הנפוץ בכל רחבי הגלובוס. רבים ממיני הירבוז נחשבים לעשבים שוטים, אך מינים רבים משמשים כצמחי תועלת, כמקורות למזון, כצמחי מרפא, להפקת צבע ולנוי."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%90%D1%98%D0%B7%D0%B5%D0%BD%D1%88%D1%82%D0%B0%D1%82","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0d/Eisenstadt_Haydngasse.JPG","page_title":"Ајзенштат","context_page_description":"Ајзенштат или Жељезно је важан град у Аустрији, смештен у источном делу државе. Ајзенштат је главни и највећи град покрајине Градишће, где чини засебан градски округ."},{"page_url":"https://fr.wikipedia.org/wiki/Ch%C3%A2teau_de_la_Renaudie_(Saint-Front-la-Rivi%C3%A8re)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Saint-Front-la-Rivi%C3%A8re_ruines_la_Renaudie_%2829%29.JPG","page_title":"Château de la Renaudie (Saint-Front-la-Rivière)","context_page_description":"Le château de la Renaudie se situe sur la commune de Saint-Front-la-Rivière, dans le département français de la Dordogne, en région Nouvelle-Aquitaine."},{"page_url":"https://pt.wikipedia.org/wiki/Chevrolet_Spark","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/2007_Chevrolet_Matiz_SE_1.0_Front.jpg","page_title":"Chevrolet Spark","context_page_description":"Spark é um hatchback de porte mini da Chevrolet.\\nNa Coreia do Sul, onde o modelo foi concebido, o modelo é conhecido como a segunda geração do Daewoo Matiz, que foi inspirada no modelo conceitual Chevrolet Beat.\\nUm dos grandes destaques da General Motors no Salão de Detroit - um claro sinal dos tempos - é o novo Chevrolet Spark, que está sendo comercializado nos Estados Unidos desde 2011. O grande destaque do modelo é a eficiência do seu motor, cujo consumo, segundo a fábrica, fica me torno dos 17 quilômetros por litro em ciclo urbano.\\nO modelo é baseado no conceito Beat apresentado no Salão de Nova York de 2007 e será vendido como um carro voltado para o público jovem. Não foram divulgados mais informações - a versão final de produção foi mostrada no Salão de Genebra, em finais do mês de Março de 2011.\\nAs linhas do modelo são bastante angulosas. A frente incorpora a grade atual da marca, com faróis alongados que invadem os paralamas e chegam quase até a coluna A, com capô bastante inclinado."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Amsterdam-Zuid","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Gemeentearchief2.jpg","page_title":"Lijst van rijksmonumenten in Amsterdam-Zuid","context_page_description":"Een overzicht van rijksmonumenten in de stad Amsterdam. Van de 7324 inschrijvingen in Amsterdam liggen er 305 in stadsdeel Zuid."},{"page_url":"https://bs.wikipedia.org/wiki/Dvorac_Fe%C5%A1teti%C4%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Dvorac_Fe%C5%A1teti%C4%87%2C_Pribislavec_%282011%29_-_jugoistok.JPG","page_title":"Dvorac Feštetić","context_page_description":"Feštetić, dvorac, nalazi se u naselju Pribislavec kraj Čakovca, Međimurska županija, Republika Hrvatska.\\nKroz vijekove bio je u posjedu više gospodara, među kojima su bili članovi plemićkih porodica Zrinski, te Feštetići, po kojima je dobio i ime.\\nU vrijeme Zrinskih ovaj je zamak bio okružen baštom i avlijom. Kasnije se u historijskim izvorima pominje da je u sklopu imanja postojala kapela te dvije pokrajnje zgrade. Današnji izgled dvorac je dobio sredinom 19. vijeka, kada ga je u neogotičkom stilu renovirao grof Juraj Feštetić. Izgrađen je od klesanog kamena, s bogato ukrašenim neogotičkim arhitektonskim elementima, posebno vijencima i dovratnicima.\\nDo 1923. godine u dvorcu je boravio grof Eugen Feštetić, a onda ga je, zajedno s cijelim imanjem, odlučio prodati. Od tada je objekt služio za smještaj raznih državnih funkcionara, oficira, pa čak i djece ratnih izbjeglica. Nakon drugog svjetskog rata u njega se smjestila lokalna osnovna škola, koja ga koristi i danas.\\nIako je više puta stradao u ratnim vihorima, bio opljačkan i devastiran, pa čak i zapaljen, dvorac Feštetić uvijek je obnavljan."},{"page_url":"https://pl.wikipedia.org/wiki/Pius_VIII","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Pope_Pius_VIII.PNG","page_title":"Pius VIII","context_page_description":"Pius VIII – włoski duchowny katolicki, 253. papież od 31 marca 1829 do 30 listopada 1830."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%A8%81%E5%BB%89%C2%B7%E6%9D%B0%E6%96%90%E9%80%8A%C2%B7%E5%85%8B%E6%9E%97%E9%A1%BF%E8%81%94%E9%82%A6%E5%A4%A7%E5%8E%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Country-Post-Ariel-Rios.jpg","page_title":"威廉·杰斐逊·克林顿联邦大厦","context_page_description":"威廉·傑斐遜·柯林頓聯邦大廈位於華盛頓哥倫比亞特區的聯邦三角，舊郵政局大廈的12街對面。\\n建築原名新郵政局，設有美國環境保護署，直到1971年交給美國郵政部。現在是美國環境保護署，於1985年2月5日更名為艾莉兒·里奧斯聯邦大廈，以紀念在1982年12月2日執行任務時被殺的美國菸酒槍炮及爆裂物管理局臥底艾莉兒·里奧斯。2013年5月13日美國聯邦政府宣布，該建築將再次更名，以前總統比爾·柯林頓命名， 2013年7月17日舉行儀式，大樓正式改為現名。"},{"page_url":"https://nl.wikipedia.org/wiki/Eista_Werf","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Gijbeland_Doerak_700_%2802%29.JPG","page_title":"Eista Werf","context_page_description":"De Eista Werf in Nederhemert Zuid was een scheepswerf, actief in de jaren 1959-1981. De naam is een samentrekking van Eiland Staal."},{"page_url":"https://pl.wikipedia.org/wiki/Vaala","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Vaala_municipality.JPG","page_title":"Vaala","context_page_description":"Vaala – gmina w Finlandii, położona w centralnej części kraju, należąca od 2016 roku do regionu Ostrobotnia Północna. Wcześniej należała do regionu Kainuu. Zamieszkana przez 2997 osób. Jej powierzchnia wynosi 1764,03 km², z czego 461,92 km² stanowi woda.\\nCentrum gminy położone jest w miejscu, gdzie Oulujoki wypływa z jeziora Oulujärvi. Przez gminę przebiega droga krajowa 22, łącząca Oulu z drogą krajową 5 w pobliżu Kajaani, oraz linia kolejowa Oulu – Kontiomäki. W gminie znajduje się stacja kolejowa."},{"page_url":"https://be.wikipedia.org/wiki/%D0%90%D0%BC%D0%B5%D0%BD%D1%85%D0%B0%D1%82%D1%8D%D0%BF_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/AmenhotepI-StatueHead_MuseumOfFineArtsBoston.png","page_title":"Аменхатэп I","context_page_description":"Аменхатэп I — фараон Старажытнага Егіпта, які кіраваў прыблізна ў 1525—1504 гадах да н.э., з XVIII дынастыі. Сын фараона Яхмаса I і царыцы Яхмес-Нефертары. Прыйшоў да ўлады пасля смерці Яхмаса I у 1527 да н.э., непаўналетнім, таму рэгентам была абвешчана маці Аменхатэпа I Яхмес-Нефертары. Аменхатэпп працягнуў заваявальную палітыку свайго бацькі. Ён здзейсніў буйны паход у Нубію з мэтай «пашырыць межы Егіпта». Нубійскае войска было знішчана, камандуючы ім правадыр узяты ў палон, а воіны захопленыя ці перабіты. Аменхатэп дасягнуў вобласці другога нільскага парога, пра што сведчыць надпіс ад 8-га года праўлення Аменхатэпа на скале каля вострава Уранарты."},{"page_url":"https://eo.wikipedia.org/wiki/Episkopa_kastelo_de_Fert%C5%91r%C3%A1kos","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Fertorakos_Episcopal_palace-06.jpg","page_title":"Episkopa kastelo de Fertőrákos","context_page_description":"La episkopa kastelo de Fertőrákos estas impona historia monumento en Hungario, en vilaĝo Fertőrákos. La kastelo longe estis someruma rezidejo de la ĉiama episkopo de Győr, sed dum turka erao de Győr la konstruaĵo estis mem departementa domo."},{"page_url":"https://hu.wikipedia.org/wiki/Harag_Gy%C3%B6rgy","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Palatul_Culturii_%28Targu_Mures%29.jpg","page_title":"Harag György","context_page_description":"Harag György erdélyi magyar színházrendező, színész."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BB%D0%B4%D0%B5,_%D0%93%D0%B0%D0%BD%D1%81","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f9/Wintersonne_01.jpg","page_title":"Олде, Ганс","context_page_description":"Иоханнес Вильгельм Ольде, или Ганс Ольде — немецкий художник и график."},{"page_url":"https://fa.wikipedia.org/wiki/%DB%8C%D9%87%D9%88%D8%AF%DB%8C%D8%A7%D9%86_%D8%A8%D9%88%DA%A9%D8%A7%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/Jerusalem_Museum-Bukan.jpg","page_title":"یهودیان بوکان","context_page_description":"تاریخ دقیق آغاز سکونت یهودیان در بوکان نامعلوم است ولی در برخی منابع انگلیسی و عبری دست کم از زمان شروع دوره قاجار یعنی از سال ۱۷۹۶ میلادی / ۱۱۷۴ خورشیدی این اقلیت مذهبی به صورت پراکنده در بوکان و حومه آن سکونت داشته‌اند. وضعیت و نقش اجتماعی، فرهنگی و اقتصادی یهودیان این منطقه، بخش تفکیک‌ناپذیر و مهمی در تدوین تاریخ این شهر به‌شمار می‌آید.\\nدر بوکان و حومهٔ آن یکصد خانوار یهودی زندگی می‌کردند که طبق گزارش‌های سازمان اسناد ملی ایران ۸۰ خانواده یهودی در سطح شهر در سال ۱۹۴۸ م/ ۱۳۲۶ خورشیدی در میان چهارصد خانوار بوکان بودند. بیشتر آن‌ها در این شهر مغازه‌دار و در کنار مسلمانان به امرارمعاش می‌پرداختند. تعدادی از آن‌ها در توسعه این شهر و کمک به مسلمانان نقش به سزایی ایفا کرده‌اند. اشخاصی مانند فریدریش و همسرش ارویر آلمانی توسط آن‌ها اولین درمانگاه بوکان در سال ۱۳۲۶ دایر شد.\\nکلیمی‌های بوکان به زبان فارسی کاملاً مسلط و به زبان‌های کردی سورانی و ترکی آذربایجانی نیز آشنایی کامل داشتند. بیشتر آن‌ها دارای سواد بوده و در میان خود نماینده‌ای جهت بررسی مشکلات هم کیشان داشته‌اند. آن‌ها در اسفند سال ۱۳۲۸ و اوایل ۱۳۲۹ از بوکان خارج شده و به تهران رفتند سپس در تیرماه ۱۳۲۹ به اسرائیل مهاجرت کردند. در حالت فعلی کنیسه این اقلیت مذهبی در خیابان استاد هیمن قرار دارد که ساختمان آن تخریب شده‌است."},{"page_url":"https://es.wikipedia.org/wiki/Accidente_ferroviario_de_Gris%C3%A9n","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Gris%C3%A9n_45.jpg","page_title":"Accidente ferroviario de Grisén","context_page_description":"La madrugada del 10 de febrero de 1965, un tren correo de RENFE sufrió un incendio en la localidad zaragozana de Grisén, cuyas causas siguen siendo desconocidas.​ El número oficial de muertos se cifró en los 30 fallecidos, aunque en investigaciones más detalladas indican que puede haber sobre 60, también hay bastante gente sin identificar ya que había bastantes andaluces que emigraban al norte de Europa."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%89glise_Sainte-Croix_(Rostov-sur-le-Don)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/%D0%9B%D0%B5%D1%81%D1%82%D0%BD%D0%B8%D1%86%D0%B0_%D0%BE%D1%82_%D1%80%D0%BE%D0%B4%D0%BD%D0%B8%D0%BA%D0%B0_%D0%BA_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B8.jpg","page_title":"Église Sainte-Croix (Rostov-sur-le-Don)","context_page_description":"L’église Sainte-Croix ou Sourb Khatch est une église arménienne de Rostov-sur-le-Don. Construite de 1786 à 1792 c’est un des bâtiments survivants du monastère Sainte-Croix."},{"page_url":"https://de.wikipedia.org/wiki/Marcel_Gotlieb","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Marcel_Gotlib_2011_a.jpg","page_title":"Marcel Gotlieb","context_page_description":"Marcel Gotlieb, bekannt als Gotlib, war ein französischer Comiczeichner."},{"page_url":"https://ur.wikipedia.org/wiki/%DB%81%D9%88%D9%85%D8%A7_%DA%A9%D8%A7%D8%A4%D9%86%D9%B9%DB%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3d/Location_of_Huma_within_Heilongjiang_%28China%29.png","page_title":"ہوما کاؤنٹی","context_page_description":"ہوما کاؤنٹی چین کا ایک عوامی جمہوریہ چین کی کاؤنٹیاں جو داشینگآنلینگ پریفیکچر میں واقع ہے۔"},{"page_url":"https://fr.wikipedia.org/wiki/Juan_Vernet","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Josep_Maria_Mill%C3%A0s_Vallicrosa.jpg","page_title":"Juan Vernet","context_page_description":"Juan Vernet est un historien des sciences et arabisant espagnol, né en 1923 et mort en 2011, professeur à l'université de Barcelone pendant plus de trente ans.\\nIl est l'élève et l'héritier intellectuel du grand orientaliste Maria Millàs Vallicrosa. La rigueur et l'étendue de son œuvre savante lui confèrent une autorité internationale dans le domaine de l'histoire des sciences et des transferts culturels entre l'Orient et l'Occident.\\nAuteur du livre Ce que la culture doit aux Arabes d'Espagne, il est aussi traducteur du Coran et des Mille et Une Nuits en langue espagnole."},{"page_url":"https://sv.wikipedia.org/wiki/2000-talet","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Kibativillagers.jpg","page_title":"2000-talet","context_page_description":"2000-talet är ett sekel som startade 1 januari 2000 och kommer att sluta 31 december 2099."},{"page_url":"https://en.wikipedia.org/wiki/Sasha_(DJ)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Sashaspooky.jpg","page_title":"Sasha (DJ)","context_page_description":"Alexander Paul Coe, known mononymously as Sasha, is a Welsh DJ and record producer. He is best known for his live events and electronic music as a solo artist, as well as his collaborations with British DJ John Digweed as Sasha & John Digweed. He was voted as World No.⁠ ⁠1 DJ in 2000 in a poll conducted by DJ Magazine. He is a four-time International Dance Music Awards winner, four-time DJ Awards winner and Grammy Award nominee.\\nSasha began his career playing acid house dance music in the late 1980s. He partnered with John Digweed in 1993, touring internationally and producing a series of mix albums.\\nSasha has remixed tracks for artists such as D-Ream, Madonna, Moby, The Chemical Brothers and Hot Chip. Sasha's remixing and production often combine electronic music genres, making it difficult for critics to pinpoint his musical style. As well as remixes and compilation albums, Sasha has produced three albums of original works: The Qat Collection in 1994, Airdrawndagger in 2002, and Scene Delete in 2016.\\nAfter achieving success as a producer and DJ, Sasha worked with younger DJs and producers such as BT and James Zabiela."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Bassenheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Bassenheim_Schloss1.jpg","page_title":"Liste der Kulturdenkmäler in Bassenheim","context_page_description":"In der Liste der Kulturdenkmäler in Bassenheim sind alle Kulturdenkmäler der rheinland-pfälzischen Ortsgemeinde Bassenheim aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://id.wikipedia.org/wiki/British_Rail_Research_Division","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Apt-front.jpg","page_title":"British Rail Research Division","context_page_description":"British Rail Research Division pertama kali ada tahun 1964 di bawah pengawasan langsung British Railways Board, pindah ke lokasi yang khusus dibuat di Railway Technical Centre di Derby. Tujuannya adalah untuk meningkatkan kehandalan dan efisiensi kereta api, sambil mengurangi biaya dan meningkatkan pendapatan. Dengan demikian diakui sebagai pusat percontohan yang pada waktunya telah memberikan konsultasi untuk perusahaan kereta api lainnya di seluruh dunia. Kemudian menjadi terkenal untuk Advanced Passenger Train, kegiatannya berkembang ke semua bagian pengoperasian kereta api."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%A3%B8%E9%BD%92%E9%9A%86%E9%A0%AD%E9%AD%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Decodon_puellaris.jpg","page_title":"裸齒隆頭魚","context_page_description":"裸齒隆頭魚，為輻鰭魚綱鱸形目隆頭魚亞目隆頭魚科的其中一種，分布於西大西洋區，從美國佛羅里達州南部至蘇利南海域，棲息深度18-275公尺，本魚身體淡紅色，背面顏色較深，腹面灰白，唇黃色，黃色的斑紋從鼻孔經過眼睛到鰓蓋邊緣。背鰭與臀鰭不覆有鱗片，成魚有凸出在前面的齒，體長可達30公分，棲息在岩石底質海域，生活習性不明，可作為觀賞魚。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BB%D0%B3%D0%B0%D1%80%D0%B8_(%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Calgary-Dawn-Szmurlo.jpg","page_title":"Калгари (область)","context_page_description":"О́бласть Ка́лгари — область, сложившаяся вокруг Калгари. Она состоит из города Калгари и графства Роки-Вью с округом Футхилс № 31 с муниципалитетами внутри них. Область Калгари и агломерация Калгари — различные понятия. Некоторые муниципалитеты в составе области, слабо связаны или совсем не связаны с агломерацией с точки зрения ежедневной трудовой миграции или торговли.\\nОбласть является крупным транспортным узлом для Южной Альберты, Саскачевана, востока Британской Колумбии и частично для северных Соединённых Штатов. Она обслуживается международным аэропортом Калгари — третьим крупнейшим аэропортом Канады."},{"page_url":"https://en.wikipedia.org/wiki/Von_guten_M%C3%A4chten","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Von_guten_M%C3%A4chten_%28Schreibmaschinenabschrift%29.jpg","page_title":"Von guten Mächten","context_page_description":"\\"Von guten Mächten\\" is a Christian poem which Dietrich Bonhoeffer wrote in 1944 when he was in a Gestapo prison because of his resistance to the Nazis. It is his last theological text before he was executed on 9 April 1945. It became a frequently sung hymn, with different melodies, which has appeared in current German hymnals. The incipit is Von guten Mächten treu und still umgeben. The seventh and last stanza, Von guten Mächten wunderbar geborgen, has been used as a refrain in a popular version."},{"page_url":"https://bg.wikipedia.org/wiki/Pteropus_gilliardorum","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Gilliard%27s_Flying_Fox_area.png","page_title":"Pteropus gilliardorum","context_page_description":"Pteropus gilliardorum е вид бозайник от семейство Плодоядни прилепи."},{"page_url":"https://en.wikipedia.org/wiki/Nature_Studies_(manuscript)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Hans_Verhagen_den_Stommen_-_Drawing_of_a_peacock.png","page_title":"Nature Studies (manuscript)","context_page_description":"Nature Studies is an illustrated manuscript of the 16th century, which represents nature scenes. It was part of the collection of the Holy Roman Emperor Rudolph II."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E6%B2%83%E6%B4%9B%E5%AD%A3%E7%B1%B3%E9%87%8C%E5%A4%AB%E5%8D%A1_(%E5%8D%A1%E8%B4%8A%E5%8D%A1%E5%8D%80)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/%D0%92%D0%B5%D1%87%D1%96%D1%80%D0%BD%D1%8F_%D0%92%D0%BE%D0%BB%D0%BE%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D1%96%D0%B2%D0%BA%D0%B0.jpg","page_title":"沃洛季米里夫卡 (卡贊卡區)","context_page_description":"沃洛季米里夫卡，是烏克蘭的村落，位於該國南部尼古拉耶夫州，由卡贊卡區負責管轄，始建於1810年，面積4.19平方公里，海拔高度49米，2001年人口2,793，人口密度每平方公里666.6人。"},{"page_url":"https://te.wikipedia.org/wiki/2013_%E0%B0%95%E0%B1%81%E0%B0%82%E0%B0%AD%E0%B0%AE%E0%B1%87%E0%B0%B3%E0%B0%BE_%E0%B0%A4%E0%B1%8A%E0%B0%95%E0%B1%8D%E0%B0%95%E0%B0%BF%E0%B0%B8%E0%B0%B2%E0%B0%BE%E0%B0%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/NorthIndiaCircuit_250.jpg","page_title":"2013 కుంభమేళా తొక్కిసలాట","context_page_description":"2013 కుంభమేళా తొక్కిసలాట ఫిబ్రవరి 10 2013 న అలహాబాదులో జరిగిన కుంభమేళా సందర్భంగా జరిగింది. అలహాబాద్ రైల్వేస్టేషన్ లో జరిగిన తొక్కిసలాటలో కనీసం 36 మంది మరణించారు. 39 మంది గాయపడ్డారు."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9B%D1%83%D1%81%D0%BA%D0%B0%D1%82%D0%BA%D0%B0_%D0%B7%D0%BE%D0%BB%D0%BE%D1%82%D0%B8%D1%81%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Agaricus_aurivellus_%E2%80%94_Flora_Batava_%E2%80%94_Volume_v19.jpg","page_title":"Лускатка золотиста","context_page_description":"Лускатка золотиста, Опеньок золоторунний — вид грибів роду Фоліота."},{"page_url":"https://war.wikipedia.org/wiki/Gorsachius_magnificus","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/NycticoraxMagnificaGronvold.jpg","page_title":"Gorsachius magnificus","context_page_description":"An Gorsachius magnificus in uska species han Aves nga syahan ginhulagway ni Ogilvie-grant hadton 1899. An Gorsachius magnificus in nahilalakip ha genus nga Gorsachius, ngan familia nga Ardeidae. Ginklasipika han IUCN an species komo nangangarat-an. Waray hini subspecies nga nakalista."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%B0%D0%BD%D0%BA%D0%B5%D1%82%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Akce_Cihelna_2014_F04._HlavniUkazka_AlternativniScenar.jpg","page_title":"Танкетка","context_page_description":"Танке́тка — лёгкая боевая одно- или двухместная броневая машина 20—30-х годов XX века на гусеничном ходу, массой до 4 тонн, предназначавшаяся для подразделений моторизованной пехоты вооружённых сил, к повышению тактической подвижности пехоты — обеспечению непрерывной поддержки её движения огнём, путём быстрого перехода станковых пулемётов во время боя, с одной огневой позиции на другую, а также и для снабжения боевыми припасами во время боя.\\nВ некоторых случаях использовались, несмотря на большой недостаток — недостаточную огневую мощь, для задач разведки, боевого охранения и связи."},{"page_url":"https://pl.wikipedia.org/wiki/Abreu_e_Lima","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Abreu_e_Lima_Flag.png","page_title":"Abreu e Lima","context_page_description":"Abreu e Lima – miasto i gmina w Brazylii, w stanie Pernambuco, w mezoregionie Agreste Pernambucano, w mikroregionie Valle del Ipanema. Według Brazylijskiego Instytutu Geograficzno-Statystycznego, 2016 roku miejscowość liczyła 98 990 mieszkańców."},{"page_url":"https://la.wikipedia.org/wiki/%C3%89pehy","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2c/Map_commune_FR_insee_code_80271.png","page_title":"Épehy","context_page_description":"Épehy est commune Francicum 1176 incolarum praefecturae Samara in regione Altis Franciae situm."},{"page_url":"https://vec.wikipedia.org/wiki/Canapville_(Orne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/FranceNormandieCanapvilleEglise.jpg","page_title":"Canapville (Orne)","context_page_description":"Canapville el xé on comun de 206 abitanti del departemento de Orne che el fa parte del rejon Normandia in Fransa."},{"page_url":"https://cs.wikipedia.org/wiki/%C5%BDelezni%C4%8Dn%C3%AD_tra%C5%A5_Cheb_%E2%80%93_Tr%C5%A1nice_%E2%80%93_Luby_u_Chebu","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Velk%C3%BD_Luh_2008-06-14.jpg","page_title":"Železniční trať Cheb – Tršnice – Luby u Chebu","context_page_description":"Železniční trať 146 Cheb – Tršnice – Luby u Chebu, přezdívaná jako Halštrovská dráha, je jednokolejná neelektrifikovaná regionální dráha v okrese Cheb. Délka této tratě je 26,8 km. Celkové převýšení je 110 metrů. Ve stanici Cheb navazuje mj. na železniční trať Plzeň–Cheb."},{"page_url":"https://fi.wikipedia.org/wiki/Raakkutunkio","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Whaleback_Shell_Midden_oyster_shell_closeup_-_20070722_07982.JPG","page_title":"Raakkutunkio","context_page_description":"Raakkutunkio on erityisesti tanskalainen käsite, jolla tarkoitetaan esihistoriallista raakku- tai ateriatunkiota. Ne ovat olleet tyypillisiä mesoliittisen kivikauden Ertebøllen kulttuurin asukkaille Tanskan länsiosissa ja saaristossa noin 5 800−3 800 eaa. Tunkiot eivät ole olleet varsinaisia asuinpaikkoja ja arvellaankin, että tunkiot ovat olleet vain ravinnon esikäsittelyyn tarkoitettuja kohteita ja että varsinainen leiri on sijainnut kauempana. Raakkutunkiot ovat maailmanlaajuinen ilmiö, koska samanlaisia ihmisen toiminnan seurauksena syntyneitä muodostelmia on löytetty muistakin maanosista."},{"page_url":"https://tr.wikipedia.org/wiki/Natalie_Portman","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/Natalie_Portman_%2848470988352%29_%28cropped%29.jpg","page_title":"Natalie Portman","context_page_description":"Natalie Portman, İsrailli-Amerikalı oyuncu. 14 yaşında, Luc Besson'un Léon adlı filminde oynadığı rolle dünya çapında üne kavuşan Portman, 2005 yılında Closer filmindeki rolüyle En İyi Yardımcı Kadın Oyuncu Oscarına aday gösterildi ve aynı dalda Altın Küre ödülünü aldı. 2011 yılında Siyah Kuğu filmindeki rolüyle En İyi Kadın Oyuncu Oscarına ve Altın Küre'ye aday gösterildi. Altın Küre'yi ve Oscar'ı kazandı."},{"page_url":"https://sv.wikipedia.org/wiki/Hilda_K%C3%A4kikoski","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Hilda-Kakikoski-1897.jpg","page_title":"Hilda Käkikoski","context_page_description":"Hilda Maria Käkikoski, född 3 januari 1864 i Lappträsk, död 14 november 1912 i Helsingfors, var en finländsk lärare och politiker.\\nKäkikoski, som var dotter till smeden och mjölnaren Johannes Mattsson Sjöström och Lisa Johannesdotter Muikkula, sändes till en svenskspråkig skola i Liljendal, där läraren såg finskheten som barbarisk, vilket lade grunden till hennes finskhetsiver, 1877 överflyttade hon till en nygrundad finsk folkskola i Porlom i Lappträsk och 1878 antogs hon till Helsingfors finska flickskolas tredje klass. Hon studerade därefter vid Helsingfors finska fortbildningsinstitut, där bland andra Julius Krohn undervisade, och där hon 1888 utexaminerades som lärare i finska och i historia. Under denna tid väcktes även hennes intresse för kvinnofrågor och 1889 anslöt hon sig till Finsk kvinnoförening. År 1898 höll hon sitt första tal om kvinnornas rösträtt, men kom att hålla en försiktigare ton under ofärdsåren, då hon reste runt ilandet och föreläste om kvinnosaken som en livsfråga för fosterlandet. I dessa föreläsningar krävde hon inte rösträtt, utan kvinnorna uppmanades att verka till fromma för hem och fosterland."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AC%DB%8C%D9%86_%D9%85%D9%88%D8%B1%D9%81%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Janemurfin1922withdog.jpg","page_title":"جین مورفین","context_page_description":"جین مورفین یک فیلم‌نامه‌نویس و کارگردان اهل ایالات متحده آمریکا بود.\\nاو در سال ۱۹۳۴ که تعداد زیادی از نمایشنامه‌های \\"برادوی\\" را نوشته بود بعنوان اولین زن ناظر استودیو در \\"آر. ک. او\\" شروع به کار کرد."},{"page_url":"https://lb.wikipedia.org/wiki/Jean-Claude_Hollerich","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Coat_of_arms_of_Jean-Claude_Hollerich_%28cardinal%29.svg","page_title":"Jean-Claude Hollerich","context_page_description":"De Jean-Claude Hollerich SJ, gebuer den 9. August 1958 zu Déifferdeng, ass e lëtzebuergesche Jesuitepater an Äerzbëschof vu Lëtzebuerg, an zanter dem 5. Oktober 2019 Kardinol."},{"page_url":"https://cs.wikipedia.org/wiki/D%C4%9Bjiny_Litvy","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/%C5%BBeligowski_Lucjan.jpg","page_title":"Dějiny Litvy","context_page_description":"Dějiny Litvy počínají příchodem Baltů asi 3000–2000 př. n. l. První písemné zmínky o Litevcích, patřících do skupiny baltských národů, se datují do roku 1009 n. l. Litevci později dobyli sousední země a ve 13. století založili Litevské velkoknížectví. Velkoknížectví bylo úspěšným a dlouho trvajícím válečnickým státem. Střežilo si svou nezávislost a křesťanství přijalo teprve ve 14. století, jako jedna z posledních zemí v Evropě. V 15. století se tato obávaná mocnost stala největším státem Evropy díky dobytí rozsáhlých oblastí Rusi, obývaných velkými skupinami Východních Slovanů. Krewskou unií, ustanovenou roku 1385, se velkoknížectví osobou panovníka spojilo s Polskem. Pozdější Lublinská unie, uzavřená roku 1569 dala vzniknout unii reálné, tzv. Republice obou národů. Ta přetrvala až do roku 1795, kdy posledním dělením Polska zaniklo jak Polsko, tak i Litva. Pod nadvládou Ruského impéria Litevci následně žili až do 20. století.\\nDne 16. února 1918 se zrodila obnovená Litva jako demokratický stát. Zůstala nezávislá až do roku 1940, kdy ji okupoval Sovětský svaz podle ujednání paktu Ribbentrop-Molotov."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%91%D1%8D%D0%B9%D1%81%D0%B8%D0%BD%D0%B3%D1%81%D1%82%D0%BE%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Uk-basingstoke.jpg","page_title":"Бэйсингсток","context_page_description":"Бэйсингсток — Хэмпширдегі Ұлыбритания қаласы. Ол Саутгемптоннан 30 миль шығыста және Лондоннан 48 миль оңтүстік-шығысқа қарай орналасқан."},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%95%D7%A1%D7%A7%D7%91%D7%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Zhivopisny_Bridge1.jpg","page_title":"מוסקבה","context_page_description":"מוסקבה היא בירת רוסיה, עיר בעלת מעמד פדרלי, המרכז המינהלי של המחוז הפדרלי המרכזי ומרכז מחוז מוסקבה שאינה כלולה בו, העיר הגדולה ביותר ברוסיה והסובייקט הכי גדול שלה. נכון לשנת 2020, מתגוררים בה 12,692,466 תושבים. העיר המאוכלסת ביותר באירופה.\\nמוסקבה הייתה בירתן ההיסטורית של נסיכות מוסקבה, רוסיה הצארית, האימפריה הרוסית, רוסיה הסובייטית וברית המועצות. מוסקבה היא המרכז הפוליטי, התרבותי, הכלכלי, התעשייתי, הדתי, החינוכי והתעבורתי ברוסיה. רשויות השלטון של המדינה נמצאים בעיר, שגרירויות של מדינות זרות, מטה מרבית הארגונים המסחריים הגדולים ברוסיה ועמותות ציבוריות. שטח העיר עמד עד להרחבתו במהלך קיץ 2012 על כ-1,081 קילומטר רבוע ומאז יולי 2012 הוא כ-2,561 קמ\\"ר.\\nמוסקבה היא אחת משלוש הערים הפדרליות של רוסיה והיא העיר המאוכלסת ביותר ברוסיה ובאירופה. העיר שוכנת על נהר מוסקבה במרכז המישור המזרח אירופי, בין נהרות וולגה ואוקה. כסובייקט פדרלי מוסקבה גובלת במחוזות מוסקבה וקלוגה.\\nמוסקבה היא מרכז התיירות הפופולרי ביותר ברוסיה. הקרמלין, הכיכר האדומה, מנזר נובודוויצ'י וכנסיית העלייה לשמים בקולומנסקויה כלולים ברשימת אתרי המורשת העולמית של אונסק\\"ו."},{"page_url":"https://de.wikipedia.org/wiki/Fran%C3%A7ois_Lafranca","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/ALFAZETA_Tempera_2008_64_x_80_cm_-_1.jpg","page_title":"François Lafranca","context_page_description":"François Lafranca ist ein Künstler in den Bereichen Malerei, Fotografie, Bildhauerei und Grafik."},{"page_url":"https://war.wikipedia.org/wiki/Rhabdophis_nigrocinctus","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Rhabdophis_nigrocinctus%2C_Black-banded_keelback_-_Khao_Soi_Dao_Wildlife_Sanctuary_%2840300840843%29.jpg","page_title":"Rhabdophis nigrocinctus","context_page_description":"An Rhabdophis nigrocinctus in uska species han Colubridae nga ginhulagway ni Edward Blyth hadton 1856. An Rhabdophis nigrocinctus in nahilalakip ha genus nga Rhabdophis, ngan familia nga Colubridae. Ginklasipika han IUCN an species komo diri gud kababarak-an. Waray hini subspecies nga nakalista."},{"page_url":"https://en.wikipedia.org/wiki/Tsentralny_City_District,_Barnaul","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Barnaul_letters.JPG","page_title":"Tsentralny City District, Barnaul","context_page_description":"Tsentralny City District is a district of the city of Barnaul, Altai Krai, Russia. Its area is ca. 145 square kilometers. Population: 91,445; 86,816; 86,842."},{"page_url":"https://es.wikipedia.org/wiki/Variedades_de_calabazas_y_zapallos_en_Estados_Unidos","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Courges_buttercup.JPG","page_title":"Variedades de calabazas y zapallos en Estados Unidos","context_page_description":"En Estados Unidos existen variedades tradicionales de calabazas y zapallos, muchas de ellas precolombinas, que revisten importancia en el mundo de habla hispana porque suelen ser encontradas en los catálogos de semillas o bien variedades locales pueden ser nombradas como \\"de tipo...\\" alguna variedad estadounidense. La variabilidad de nombres a lo largo de tan extenso territorio es muy amplia, encontrándose consensos en trabajos de taxónomos que fueron muy utilizados para facilitar la comunicación, como los de HS Paris para Cucurbita pepo y de Castetter para Cucurbita maxima. Estos trabajos suelen intentar aplicarse también fuera del territorio estadounidense."},{"page_url":"https://en.wikipedia.org/wiki/Belliss_and_Morcom","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Belliss_and_Morcom_Works%2C_Ladywood_-_geograph.org.uk_-_703230.jpg","page_title":"Belliss and Morcom","context_page_description":"Belliss and Morcom are a manufacturer and supplier of oil-free reciprocating compressors, technologies and services. Founded in 1852 in Birmingham, West Midlands, they are now a division of Ingersoll Rand, and is based in Redditch, Worcestershire, England."},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_%C5%9Bw._Piotra_i_Paw%C5%82a_oraz_klasztor_Jezuit%C3%B3w_we_Lwowie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/%D0%84%D0%B7%D1%83%D1%97%D1%82%D0%B8%2C_%D0%9B%D1%8C%D0%B2%D1%96%D0%B2.JPG","page_title":"Kościół św. Piotra i Pawła oraz klasztor Jezuitów we Lwowie","context_page_description":"Greckokatolicka świątynia garnizonowa, dawniej Kościół św. św. Piotra i Pawła i klasztor Jezuitów we Lwowie, popularnie zwany kościołem jezuitów – jest położony przy ul. Teatralnej 11, przed 1945 – ul. Rutowskiego, na Starym Mieście. Po 1945 zamknięty i przeznaczony na magazyn książek. Od 2011 kościół katolicki obrządku bizantyjsko-ukraińskiego pod wezwaniem św. św. Piotra i Pawła - kościół garnizonowy Sił Zbrojnych Ukrainy garnizonu lwowskiego."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B0%D8%B1%D9%88%D8%A9_%D8%A7%D9%84%D9%86%D9%81%D8%B7","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/OPEC_declared_reserves_1980-now_EIA.svg","page_title":"ذروة النفط","context_page_description":"ذروة النفط أو قمة إنتاج النفط في العالم هو أقصى معدل لإنتاج النفط في العالم، ويسمى \\"قمة هوبرت \\" صاحب نظرية قمة هوبرت. وهو الوقت الذي يبلغ فيه الإنتاج العالمي للنفط حد أقصى ويبدأ بعده في الانخفاض.\\nتعود نظرية قمة انتاج النفط العالمية إلى أعمال عالم الجيولوجيا \\"ماريون كينج هوبرت\\" في الخمسينات من القرن الماضي. وتصل تلك القمة الإنتاجية العالمية بين عامي 2007 إلى 2037 بحسب تقديرات مصادر الطاقة الأولية ومعدل استغلالها، ثم تهبط إلى مادون ثلث معدلاتها في زمن القمة وتؤدي إلى صراعات دولية كبيرة."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E8%91%89%E8%8A%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Yeats_Boughton.jpg","page_title":"葉芝","context_page_description":"葉芝（William Butler Yeats，1865年6月13號—1939年1月28號），又譯作「葉慈」、「耶茨」，愛爾蘭詩人、劇作家，神秘主義者。葉芝係「愛爾蘭文藝復興運動」嘅領袖，幫手創辦阿貝劇院。\\n葉芝早年嘅創作仍然具有浪漫主義風格，善於營造夢幻氛圍，例如佢喺1893年出版嘅散文集《凱爾特曙光》便屬於呢隻風格。然而進入不惑之年後，喺現代主義詩人龐德呢啲人嘅影響之下，尤其是佢加入愛爾蘭民族主義政治運動之後，葉芝嘅創作風格變曬，更加貼近現代主義。\\n葉芝唔只做艾比劇院嘅決策，重做埋愛爾蘭國會參議員一職。佢好重視自己嘅社會職務，係愛爾蘭參議院中出名勤力。喺1923年得諾貝爾文學獎，獲獎嘅理由係「用高度藝術化且靈感滿瀉嘅詩去表達成個民族嘅靈魂」。1934年，佢同埋吉卜林獲得歌德堡詩歌獎。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AD%E3%82%B7%E3%82%A2%E3%83%BB%E3%82%AB%E3%82%B6%E3%83%B3%E6%88%A6%E4%BA%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Kazan_Khanate_military.jpg","page_title":"ロシア・カザン戦争","context_page_description":"ロシア・カザン戦争は1437年から1552年にかけてモスクワ大公国とカザン・ハン国との間で起きた一連の戦争である。\\n今日に至るまでカザン・ハン国自身の一次資料は殆ど残っておらず、汗国の歴史は基本的には、大部分はロシアの歴史家自身による外国の資料に依拠して研究されている。 ロシア人が、ロシアとの関係を持つカザン・ハン国、これをより正しく言うならばロシア・カザン相関関係及び戦争に関心がある以上、ロシア・カザン戦争はカザンの歴史で最も研究されている分野である。"},{"page_url":"https://bs.wikipedia.org/wiki/Vandali","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Heinrich_Leutemann%2C_Pl%C3%BCnderung_Roms_durch_die_Vandalen_%28c._1860%E2%80%931880%29.jpg","page_title":"Vandali","context_page_description":"Vandali su istočnogermansko pleme, ili grupa plemena, koji se prvi put u historiji spominje za vrijeme kasnog perioda Rimsko carstvo, tokom 5. vijeka. U početku su nastanjavali južni dio današnje Poljske prije nego su vršili seobe i osnivali svoja kraljevstva na teritoriji današnje Španije i Sjeverne Afrike. Vjeruje se da su Vandali dobili svoje ime po imenu regije Andaluzija, koja se orginalno zvala Vandalusia, kasnije arapska Al-Andalus, na jugu Španije, gdje su se privremeno naselili prije nego su nastavili svoj put prema Africi.\\nGotski vladar Teodorik Veliki, kralj Ostrogota i vladar Vizigota, je bio u savezu po braku sa Vandalima, kao i sa Burgundima i Francima tokom Clovisa I."},{"page_url":"https://gl.wikipedia.org/wiki/Cartograf%C3%ADa","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Kepler-world.jpg","page_title":"Cartografía","context_page_description":"A cartografía é a rama da xeografía que se ocupa da representación da Terra sobre unha superficie, o que se denomina mapa. Ao ser a Terra esférica ha de valerse dun sistema de proxección para pasar da esfera ao plano. No fondo este é o problema da cadratura do círculo.\\nPero ademais de representar os contornos das cousas, as superficies e os ángulos ocúpase, tamén de representar outra información que aparece sobre o mapa, segundo se considere que é relevante ou non. Isto, normalmente, depende do que se queira representar no mapa e da escala deste.\\nO método da cartografía baséase na fotogrametría: as fotos aéreas son combinadas, axuntadas, interpretadas e convencionalizadas antes de obter un resultado final.\\nPara unha correcta interpretación da cartografía, debe recorrerse aos fundamentos da xeografía matemática. O tipo de proxección xeodésica utilizada debe considerarse no reprantexamento cartográfico."},{"page_url":"https://en.wikipedia.org/wiki/Toktar_Aubakirov","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/ToktarAwbakirov.jpg","page_title":"Toktar Aubakirov","context_page_description":"Toktar Ongarbayuly Aubakirov is a retired Kazakh Air Force officer and a former cosmonaut. He is the first person from Kazakhstan to go to space."},{"page_url":"https://sh.wikipedia.org/wiki/Unitarna_dr%C5%BEava","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Map_of_unitary_states.svg","page_title":"Unitarna država","context_page_description":"Jednostavna ili unitarna država je izraz koji se koristi za svaku onu državu koja u državnopravnom, odnosno ustavnopravnom smislu predstavlja nedjeljivu cjelinu, odnosno u kojoj postoji samo jedna vlast koja je nositelj državnog suvereniteta.\\nUnitarne države kroz proces devolucije mogu svojim određenim dijelovima dati autonomiju na lokalnoj i regionalnoj razini, ali tako stvoreni entiteti se, bez obzira na eventualan sadržaj njihovih ovlasti, ne smatraju državama, pa se ni takve države ne smatraju federacijama.\\nVećina država u današnjem svijetu, uključujući Evropu, su unitarne države, što se objašnjava činjenicom da je većina njih relativno malena po površini i broju stanovnika, te stoga nema potrebe za pretjeranom decentralizacijom. S druge strane, velike države su u pravilu federacije, pri čemu NR Kina predstavlja izuzetak."},{"page_url":"https://de.wikipedia.org/wiki/Campbell_Hill","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Campbell_Hill.jpg","page_title":"Campbell Hill","context_page_description":"Der Campbell Hill ist mit seinen 472 Metern die höchste Erhebung des Logan County und des US-Bundesstaates Ohio. Er befindet sich noch im Stadtgebiet von Bellefontaine. Der Berg ist nach Charles D. Campbell benannt, einem früheren Besitzer des Gebiets.\\nDer höchste Punkt ist über eine Straße erreichbar."},{"page_url":"https://vo.wikipedia.org/wiki/Payne_(Ohio)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/OHMap-doton-Payne.png","page_title":"Payne (Ohio)","context_page_description":"Payne binon zif in komot: Paulding, in tat: Ohio, in Lamerikän."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%BE%D1%83%D1%87,_%D0%9A%D0%B5%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Ken_Loach_Cannes_2014.jpg","page_title":"Лоуч, Кен","context_page_description":"Кен Ло́уч — британский кинорежиссёр, классик европейского остросоциального кино. Двукратный обладатель «Золотой пальмовой ветви» Каннского кинофестиваля за фильмы «Ветер, который качает вереск» и «Я, Дэниел Блейк»."},{"page_url":"https://nl.wikipedia.org/wiki/Bevolkingsuitwisseling_tussen_Turkije_en_Griekenland","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Proportions_des_populations_en_Asie_Mineure_statistique_officielle_d1914.png","page_title":"Bevolkingsuitwisseling tussen Turkije en Griekenland","context_page_description":"De bevolkingsuitwisseling tussen Griekenland en Turkije van 1923 was de uitwijzing van Grieks-Orthodoxen uit Turkije en moslims uit Griekenland, overeengekomen apart van het Verdrag van Lausanne na de Grieks-Turkse Oorlog. In totaal werden zo'n twee miljoen mensen gedwongen te verhuizen, ongeveer 1,5 miljoen Grieken en 0,5 miljoen Turken. De uitwisseling was puur op religieuze grond gebaseerd; onder de gedeporteerden waren ook Turkse christenen uit Centraal-Anatolië, en islamitische Grieken van Kreta. Al voor de inwerkingstelling van de overeenkomst was het grootste deel van de betrokkenen uit eigen beweging vertrokken, vrezend voor gewelddadige confrontaties bij een gedwongen deportatie."},{"page_url":"https://it.wikipedia.org/wiki/Sicilia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Steri_PA_06_04_2019_08.jpg","page_title":"Sicilia","context_page_description":"La Sicilia, ufficialmente denominata Regione Siciliana, è una regione autonoma a statuto speciale di 4 969 147 abitanti, con capoluogo Palermo.\\nIl territorio della regione è costituito quasi interamente dall'isola omonima, la più grande isola dell'Italia e del Mediterraneo, nonché la 45ª isola più estesa nel mondo, bagnata a nord dal Mar Tirreno, a ovest dal Canale di Sicilia, a sud-ovest dal Mar di Sicilia, a sud-est dal canale di Malta, a est dal Mar Ionio e a nord-est dallo stretto di Messina che la separa dalla Calabria, con la parte rimanente che è costituita dagli arcipelaghi delle Eolie, delle Egadi e delle Pelagie e dalle isole di Ustica e Pantelleria. È la regione più estesa d'Italia, la quarta per popolazione, e il suo territorio è ripartito in 390 comuni a loro volta costituiti in tre città metropolitane e sei liberi Consorzi comunali.\\nLe più antiche tracce umane nell'isola risalgono al 20.000 a.C. circa. In era preistorica fiorirono le culture dette di Stentinello, di Castelluccio, di Thapsos, e da qualche decennio è stata indiziata anche una \\"cultura\\" dei dolmen."},{"page_url":"https://it.wikipedia.org/wiki/Concattedrale_di_Troia","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/Puglia_Troia3_tango7174.jpg","page_title":"Concattedrale di Troia","context_page_description":"La concattedrale della Beata Vergine Maria Assunta in Cielo, già cattedrale, è il principale luogo di culto cattolico di Troia, in provincia di Foggia, concattedrale della diocesi di Lucera-Troia.\\nLa chiesa è un edificio a croce latina dalle importanti peculiarità e dall'indubbio interesse architettonico sito a Troia, in provincia di Foggia, e costruito tra il 1093 e il 1125. L'edificio è dedicato alla Beata Maria Vergine Assunta in Cielo ed è costruita secondo lo stile romanico pugliese. È uno dei capolavori dell'architettura romanica in Capitanata, non tanto per le proporzioni quanto per l'armonia della costruzione.\\nLa facciata è larga 19 metri ed è alta 28,5 metri. Dalla soglia all'abside la concattedrale è lunga 54 metri. In totale la costruzione occupa una superficie di circa 1325 m².\\nNel marzo del 1958 papa Pio XII l'ha elevata alla dignità di basilica minore."},{"page_url":"https://en.wikipedia.org/wiki/GFH_Capital","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/GFH_Capital_Logo.jpg","page_title":"GFH Capital","context_page_description":"GFH Capital, formerly known as Injazat Capital, is a firm of private equity investors, advisors and fund managers, providing capital and strategic support for growth companies. GFH Capital is among the region’s oldest private equity firms, and is licensed by the Dubai Financial Services Authority. Established by the Islamic Corporation for the Development of the Private Sector, an affiliate of the Islamic Development Bank Group and GFH Financial Group, GFH Capital introduced structured private equity investing and Islamic finance to the Gulf Cooperation Council. GFH Capital has structured investments exceeding USD 8bn in over 40 companies across 25 countries.\\nGFH Capital established and manages the Middle East’s first Sharia-compliant VC TMT fund: Injazat Technology Fund BSC. ITF I has to date completed the full life cycle of the investment process with Internal rate of returns of up to 75% including sales to blue chip companies. The International Chamber of Commerce commended GFH Capital in regard to the principles of corporate governance."},{"page_url":"https://pl.wikipedia.org/wiki/Karlowe_Wary","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Karlovy_Vary_0098.JPG","page_title":"Karlowe Wary","context_page_description":"Karlowe Wary – miasto statutarne w zachodnich Czechach, stolica kraju karlowarskiego. Leży w Zagłębiu Sokołowskim, u podnóża szczytów Lasu Sławkowskiego, u zbiegu rzek Ohrzy i Teplej.\\nJest największym czeskim uzdrowiskiem i największym z miast tworzących tzw. zachodnioczeski trójkąt uzdrowiskowy. Według danych z 1 stycznia 2017 Karlowe Wary zamieszkuje 49 046 osób, a powierzchnia miasta wynosi 59,10 km²."},{"page_url":"https://ca.wikipedia.org/wiki/DTS_(sistema_de_so)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/DTS_X_B%26W.png","page_title":"DTS (sistema de so)","context_page_description":"DTS és una sèrie de tecnologies d'audio multicanal propietat de DTS, Inc., una empresa nord-americana especialitzada en formats de so envoltant digital que s'utilitzen tant per aplicacions comercials/teatrals com per a consumidors.Va ser conegut com The Digital Experience fins a 1995. DTS llicencia les seves tecnologies als fabricants d'electrònica de consum.\\nAl desembre de 2016, DTS va ser adquirida per Tessera, ara anomenada Xperi."},{"page_url":"https://hu.wikipedia.org/wiki/Liez_(Aisne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Liez_%28Aisne%29_%C3%A9glise_%2802%29.JPG","page_title":"Liez (Aisne)","context_page_description":"Liez település Franciaországban, Aisne megyében. Lakosainak száma 422 fő. Liez Mennessis, Remigny, Tergnier és Travecy községekkel határos."},{"page_url":"https://es.wikipedia.org/wiki/Mirko_Bortolotti","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bc/Bortolotti_Mirko.JPG","page_title":"Mirko Bortolotti","context_page_description":"Mirko Bortolotti es un piloto de automovilismo italiano. Fue campeón del Campeonato de Fórmula Dos de la FIA en 2011."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_monuments_historiques_de_Lille","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Lille_49_rue_de_gand.jpg","page_title":"Liste des monuments historiques de Lille","context_page_description":"Cet article recense les monuments historiques de Lille, en France."},{"page_url":"https://es.wikipedia.org/wiki/Paul_Bouche","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Paul_Bouche_at_Mega_TV%27s_Party.jpg","page_title":"Paul Bouche","context_page_description":"Paul Bouche es un comunicador, productor y empresario de medios de comunicación ganador de el premio Emmy por su trabajo en televisión.​\\nDesde 1995 Bouche ha creado y producido diversos programas de televisión y radio en español e inglés. Mejor conocido como el creador y conductor del programa de televisión \\"A oscuras pero encendidos\\" y \\"La Boca Loca de Paul\\" desde el año 2007​ Paul ha trabajado como animador y comediante en televisión y radio, así como en espectáculos teatrales de Stand Up Comedy en los Estados Unidos y Latinoamérica. \\"La Boca Loca de Paul\\" continua transmitiéndose en sindicación en Estados Unidos, Puerto Rico y República Dominicana.​\\nReconocido por su espontaneidad y humor afilado, ha entretenido al público hispano profesionalmente desde 1995. En el 2009 fue convocado por la Cadena TeleFutura para ayudar con el lanzamiento del programa \\"La Tijera\\" como copresentador. Antes de fundar su empresa productora Astracanada Productions, Paul adquirió experiencia en los Estados Unidos en compañías como NBC, ABC y MTV."},{"page_url":"https://tr.wikipedia.org/wiki/Connor_Pain","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Connor_Pain_2013.jpg","page_title":"Connor Pain","context_page_description":"Connor Thomas Pain, Avustralyalı futbolcudur. Melbourne Victory FC'de forma giymektedir."},{"page_url":"https://eu.wikipedia.org/wiki/Pont%C3%B3s","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/Pontos.jpg","page_title":"Pontós","context_page_description":"Pontós Kataluniako udalerria da, Alt Empordà eskualdean eta Gironako probintzian dagoena. 2009ko urtarrilaren 1eko erroldaren arabera 238 biztanle zituen. 13,62 km²-ko azalera du."},{"page_url":"https://pt.wikipedia.org/wiki/Complexo_mineiro_de_Cassinga","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Aufbereitungsanlage_vom_Verladebunker.jpg","page_title":"Complexo mineiro de Cassinga","context_page_description":"O Complexo mineiro de Cassinga, é um conjunto de minas de ferro e ouro em operação desde 1967. Está localizada na província de Huíla em Angola. Suas minas são exploradas pela estatal angolana Ferrangol.\\nAs principais jazidas formadoras estão em Jamba, em Cassinga Norte, e Chamutete, em Cassinga Sul, havendo ainda as minas de Cateruca.\\nSeus acessos se dão pela EN-120 e pelo Caminho de Ferro de Moçâmedes, com o Ramal de Jamba-Chamutete.\\nFoi nestas minas que ocorreu a batalha de Cassinga, um dos maiores episódios da guerra sul-africana na fronteira."},{"page_url":"https://sv.wikipedia.org/wiki/%C3%85s%C3%B6gatan","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Stalands_%C3%85s%C3%B6gatan%2C_2017a.jpg","page_title":"Åsögatan","context_page_description":"Åsögatan är en gata på Södermalm i Stockholm. Gatan börjar i väst som en parallellgata till Magnus Ladulåsgatan, korsar Götgatan och sträcker sig sedan österut till Kvastmakartrappan på Åsöberget, en distans på cirka 1,6 kilometer."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BC%D5%A1_%D4%BA%D5%A1%D5%BE%D5%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Clue_peroure_zoom.jpg","page_title":"Լա Ժավի","context_page_description":"Լա Ժավի, համայնք Ֆրանսիայի Պրովանս-Ալպեր-Լազուր ափ մարզի Վերին Պրովանսի Ալպեր գավառում։ Մտնում է Լա Ժավի կանտոնի կազմի մեջ։ Համայնքի շրջանը՝ Ֆորկալկե:\\nՀամայնքի INSEE կոդ՝ 04097։"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%96%D0%B3%D0%B0%D1%80%D1%94%D0%B2_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D1%8C_%D0%92%D0%BE%D0%BB%D0%BE%D0%B4%D0%B8%D0%BC%D0%B8%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B8%D0%B9_%D0%A1%D0%B8%D0%B3%D0%B0%D1%80%D0%B5%D0%B2.jpg","page_title":"Сігарєв Василь Володимирович","context_page_description":"Василь Володимирович Сігарєв — російський кінорежисер, сценарист, продюсер, оператор, монтажер і драматург. Лауреат премій «Дебют», «Антибукер», «Еврика», «Новий стиль», «Evening Standard Awards»."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BB%D1%8C%D1%86%D0%B5%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/%D0%90%D0%BB%D1%8C%D1%86%D0%B5%D0%BA_%D0%BF%D0%B0%D0%BC.jpg","page_title":"Альцек","context_page_description":"Альцек — пятый сын хана Кубрата, правителя Великой Болгарии."},{"page_url":"https://pl.wikipedia.org/wiki/Sowi_Potok","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Sowi_Potok.JPG","page_title":"Sowi Potok","context_page_description":"Sowi Potok – potok górski, lewy dopływ Włodzicy o długości 7,78 km."},{"page_url":"https://fr.wikipedia.org/wiki/Monestier-de-Clermont","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Detail_Carte_du_Dauphin%C3%A9_1654_de_Beins_1.jpg","page_title":"Monestier-de-Clermont","context_page_description":"Monestier-de-Clermont est une commune française située dans le sud du département de l'Isère, en région Auvergne-Rhône-Alpes et autrefois rattachée à l'ancienne province du Dauphiné.\\nLe village appartient à un territoire de moyenne montagne dont l'altitude se situe entre 500 m et 1 200 m d'altitude et qui se trouve entre des massifs montagneux qui l'entourent de trois côtés : à l'ouest, on peut découvrir le massif du Vercors, au sud et à l'est se détache le chaînon de l'Obiou appartenant au massif du Dévoluy).\\nAncien chef-lieu de canton du département de l'Isère jusqu'en 2015, la petite ville est désormais rattachée au canton de Matheysine-Trièves dont le bureau centralisateur est situé à La Mure depuis le nouveau découpage territorial. La commune est le siège administratif de la communauté de communes du Trièves qui regroupe vingt-huit communes."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D0%B2%D0%B5%D0%BD%D0%BA%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Road_in_Evenkiysky_District.jpg","page_title":"Евенкійський район","context_page_description":"Евенкійський район — адміністративно-територіальна одиниця з особливим статусом та муніципальний район в центрально-східній частині Красноярського краю.\\nАдміністративний центр — селище Тура.\\nУтворений 14 жовтня 2005 року на території скасованого Евенкійського автономного округу."},{"page_url":"https://hu.wikipedia.org/wiki/Szitty%C3%B3f%C3%A9l%C3%A9k","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d2/Luzula_spadicea_a4.jpg","page_title":"Szittyófélék","context_page_description":"A szittyófélék a perjevirágúak rendjébe tartozó növénycsalád. Nyolc nemzetség kb. 400 faja tartozik ide."},{"page_url":"https://pt.wikipedia.org/wiki/Mark_Knopfler","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Mark_Knopfler_and_Emmylou_Harris.jpg","page_title":"Mark Knopfler","context_page_description":"Mark Freuder Knopfler, é um guitarrista, cantor e compositor britânico da banda de rock Dire Straits. Considerado por muitos um gênio da guitarra, é bastante conhecido principalmente pelo seu estilo peculiar de tocar o instrumento. É mais reconhecido pelo seu trabalho com a banda Dire Straits, que liderou de 1977 até 1994, do que pela sua carreira solo, embora continue a dar concertos por todo o mundo e esgote consecutivamente salas de espetáculos históricas como o Royal Albert Hall, de Londres. Paralelamente, lançou álbuns solo. O seu primeiro foi Golden Heart, de 1996. Porém, poucas cópias dele em CD foram produzidas, sendo, hoje, raríssimas. Escreveu também algumas trilhas sonoras e teve ainda uma outra banda, chamada The Notting Hillbillies. Participou também no trabalho de outros artistas, como Bob Dylan, Eric Clapton e B. B. King, e produziu álbuns para Tina Turner, Randy Newman e, novamente, Dylan. Ao longo da sua carreira, fez mais de quatrocentos concertos em mais de trinta países. Mark é considerado um dos melhores guitarristas e compositores de todos os tempos."},{"page_url":"https://hu.wikipedia.org/wiki/Lepus_habessinicus","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Abyssinian_Hare_area.png","page_title":"Lepus habessinicus","context_page_description":"A Lepus habessinicus az emlősök osztályának a nyúlalakúak rendjéhez, ezen belül a nyúlfélék családjához tartozó faj."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%BE%D0%B1%D0%B5%D1%80%D1%82_%D0%93%D0%B2%D0%B8%D1%81%D0%BA%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Investiturstreit.jpg","page_title":"Роберт Гвискар","context_page_description":"Роберт Отви́ль по прозвищу Гвиска́р — четвёртый граф и первый герцог Апулии из дома Отвилей. Окончательно изгнал из Италии византийцев, захватил княжество Салерно и, тем самым, завершил завоевание нормандцами Южной Италии. Совместно с младшим братом Рожером I начал завоевание Сицилии. Оказывая помощь папе Григорию VII, овладел Римом и сжёг город. В конце жизни предпринял попытку завоевать Византию. Был прозван Гвискаром, что переводится со старофранцузского как «Хитрец»."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%99%D0%BE%D0%B7%D0%B5%D1%84_%D0%9F%D1%96%D1%87%D0%BC%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/J%C3%B3zef_Pitschmann.jpg","page_title":"Йозеф Пічман","context_page_description":"Йозеф Францишек Пічман — польсько-український художник-педагог, портретист."},{"page_url":"https://es.wikipedia.org/wiki/H%C3%A9l%C3%A8ne_Bertaux","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Le_Petit_Palais_-_H%C3%A9l%C3%A8ne_Bertaux_-_Psych%C3%A9_sous_l%27empire_du_myst%C3%A8re_-_002.jpg","page_title":"Hélène Bertaux","context_page_description":"Hélène Bertaux, nacida Joséphine Charlotte Hélène Pilate en París en 1825 y fallecida en Saint-Michel-de-Chavaignes el 20 de abril de 1909 fue una escultora y militante de los derechos de la mujer de la segunda mitad del siglo XIX."},{"page_url":"https://nn.wikipedia.org/wiki/Kald%C3%A5ga_kraftverk","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Kald%C3%A5ga_kraftverk.jpg","page_title":"Kaldåga kraftverk","context_page_description":"Kaldåga kraftverk er eit kraftverk i Drevjavassdraget. Det er bygd i 1958, med ein kombinasjon av fjelltunnelar og røyrgater. Det utnyttar energien i fallet på 565 meter frå Kaldåvatnan på Toven. Kraftverket ligg i øvre Drevja i Vefsn kommune.\\nKraftverket har nedslagsfelt på 19 km². Kaldåvatnan vert bruka som vassmagasin. Desse vatnan har òg namn etter talrekka, frå ein til ti. Nivatnet er det største av desse, og det er leidd til Einvatnet gjennom en 2300 meter lang tunnel. Fra Einvatnet renn vatnet ned til kraftstasjonen gjennom eit 1800 meter langt stålrøyr.\\nKraftverket har ein installert effekt på 15 MW og ein middels årsproduksjon på 68 GWh. Anlegget er eigd av Helgelandskraft."},{"page_url":"https://id.wikipedia.org/wiki/Museum_of_Modern_Art","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/MoMa_NY_USA_1.jpg","page_title":"Museum of Modern Art","context_page_description":"Museum of Modern Art adalah sebuah museum seni yang terletak di Midtown Manhattan, New York City, Amerika Serikat. Dianggap sebagai salah satu museum seni modern paling terkemuka dan berpengaruh di dunia, koleksinya menampilkan tinjauan seni modern dan kontemporer yang tak tertandingi di dunia, termasuk karya arsitektur dan desain, lukisan, pahatan, fotografi, screen print, ilustrasi, film, dan media elektronik. Perpustakaannya memiliki lebih dari 300.000 buku dan majalah mengenai sejarah seni modern dan kontemporer, serta berkas individual tentang lebih dari 70.000 seniman.\\nIde untuk mendirikan Museum of Modern Art dicetuskan pada 1928 terutama oleh Abby Aldrich Rockefeller dan dua temannya, Lillie P. Bliss dan Mrs Cornelius J. Sullivan. Mereka membuka museum tersebut pada 7 November 1929. Abby mengundang A. Conger Goodyear, mantan presiden Albright Art Gallery di Buffalo, New York, untuk menjadi presiden museum yang baru itu.\\nGoodyear mengajak Paul J. Sachs dan Frank Crowninshield untuk bergabung dengannya. Sachs adalah kurator Fogg Art Museum di Harvard University, dan ia mengajak Alfred H. Barr Jr. Pada mulanya museum ini bertempat di lantai 12 Heckscher Building."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%97%E0%B1%8C%E0%B0%A4%E0%B0%AE%E0%B0%BE%E0%B0%B2%E0%B0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Guatemala_Real_1847_Silver_Coin_Fonrobert_7236.jpg","page_title":"గౌతమాలా","context_page_description":"గౌతమాలా, అధికారనామం రిపబ్లిక్ ఆఫ్ గౌతమాలా, మద్య అమెరికా దేశాలలో ఒకటి. దేశానికి ఉత్తర, పశ్చిమ సరిహద్దులో మెక్సికో దేశం, నైరుతీ సరిహద్దులో పసిఫిక్ మహాసముద్రం. గౌతమాలా జనసంఖ్య 15.8 మిలియన్లు. మద్యఅమెరికా దేశాలలో అధికజంసంఖ్య కలిగిన దేశంగా ఇది గుర్తించబడుతుంది. గౌతమాలా \\" రిప్రెజెంటేటివ్ డెమాక్రసీ \\" కలిగిన దేశంగా గుర్తించబడుతుంది. గౌతమాలా నగరం దేశానికి రాజధాని నగరంగానే కాక అతిపెద్ద నగరంగా కూడా గుర్తించబడుతుంది.\\nఆధునిక గౌతమాలా భూభాగం ఒకప్పుడు మాయా నాగరికత విలసిల్లిన ప్రాంతం. మాయా నాగరికత మెసోమెరికా వరకు విస్తరించబడి ఉంది. దేశంలోని అత్యధిక భూభాగం 16 వ శతాబ్దంలో స్పానిష్ ఆక్రమితప్రాంతంగా ఉండేది. ఇది న్యూ స్పెయిన్ వైశ్రాయి పాలనలో ఉండేది. గౌతమాలా 1821లో స్వతంత్రదేశం అయింది. ఇది \\" ఫెడరల్ రిపబ్లిక్ ఆఫ్ అమెరికా \\"లో భాగంగా ఉండేది. 1841లో ఇది విడివడింది.\\n19 వ శతాబ్దం మద్య నుండి గౌతమాలా అస్థిరత, అంతఃకలహలు వంటి సమస్యలను ఎదుర్కొన్నది. 20 వ శతాబ్దంలో గౌతమాలాను వరుసగా నియంతలు పాలించారు. వీరికి యునైటెడ్ ఫ్రూట్ కంపెనీ, యునైటెడ్ స్టేట్స్ మద్దతు ఉండేది. 1944లో అథోరిటారియన్ నాయకుడు జార్జ్ ఉబికో ప్రభుత్వాన్ని ప్రొ - డెమొక్రటిక్ మిలటరీ పడగొట్టి \\" గౌతమాలా రివల్యూషన్ \\" స్థాపితమైంది. అది సాంఘిక, ఆర్థిక సంస్కరణలను చేపట్టింది.1954లో గౌతమాలా తిరుగుబాటు"},{"page_url":"https://ca.wikipedia.org/wiki/Nissan_GT-R","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Nissan_GT-R_2005_TMS_1.jpg","page_title":"Nissan GT-R","context_page_description":"El Nissan GT-R és un automòbil esportiu creat pel fabricant japonès Nissan, llançat al Japó el 6 de desembre de 2007, als Estats Units el 7 de juliol de 2008, i en la resta del món al març de 2009.\\nDos prototips van ser exhibits en fires d'automòbils abans que fos presentat el model de producció. El primer prototip va ser presentat en el Saló de l'Automòbil de Tòquio en 2001, mostrant com es veuria un GT-R del segle XXI. En el Saló de l'Automòbil de Tòquio de 2005, Nissan va donar a conèixer un nou prototip del GT-R, indicant que el GT-R de producció es basaria en un 80 o 90% en aquest prototip.\\nCom és llegat dels seus antecessors, el Nissan GT-R R35 nombrosos videojocs, com Forza Motorsport, Gran Turisme, Need for Speed i Pel·lícules de la Saga Fast and Furious.\\nLa versió de producció del GT-R es va estrenar en el Saló de l'Automòbil de Tòquio el 6 de desembre de 2007, sent el seu llançament al mercat japonès. El llançament oficial als EUA va ser 7 mesos més tard, el 7 de juliol de 2008. El llançament a Canadà també va anar al juliol d'aquest mateix any. Europa es va convertir al tercer mercat de consum."},{"page_url":"https://cy.wikipedia.org/wiki/Mount_Vernon,_Illinois","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Albert_Watson_II.JPG","page_title":"Mount Vernon, Illinois","context_page_description":"Dinas yn Jefferson County, yn nhalaith Illinois, Unol Daleithiau America yw Mount Vernon, Illinois. ac fe'i sefydlwyd ym 1817."},{"page_url":"https://sv.wikipedia.org/wiki/Vit_herdehund","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Zwitserse_witte_herder.jpg","page_title":"Vit herdehund","context_page_description":"Vit herdehund är en hundras från Schweiz. Den är av samma ursprung som schäfern. Vit herdehund erkändes som egen ras av den internationella hundorganisationen FCI 2003. Den skall inte förväxlas med vita tyska schäferhundar som varken godkänns av Svenska Kennelklubben eller FCI."},{"page_url":"https://uk.wikipedia.org/wiki/Comique_Film_Corporation","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/The_Bell_Boy-925333683-large.jpg","page_title":"Comique Film Corporation","context_page_description":"Comique Film Corporation — американська кінокомпанія, створена в 1916 році Роско Арбаклом і Джозефом М. Шенком, проіснувала до 1920 року. Кінокомпанія була створена для виробництва кінокомедій Роско Арбакла і йх поширення через Paramount Pictures. Пізніше компанія виробляла короткометражні фільми з Бастером Кітоном в головній ролі."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D0%BE%D0%B9_%D0%BA%D1%83%D0%B1%D0%BE%D0%BA_%D0%9A%D0%9E%D0%9D%D0%9A%D0%90%D0%9A%D0%90%D0%A4_2011","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Raymondjames2005.JPG","page_title":"Золотой кубок КОНКАКАФ 2011","context_page_description":"Золотой кубок КОНКАКАФ 2011 — 21-й розыгрыш футбольного турнира для стран Северной, Центральной Америки и Карибского бассейна, проходивший с 5 по 25 июня 2011 года в США.\\nФинальный матч прошёл на стадионе «Роуз Боул» в Пасадине, Калифорния в присутствии 93 420 зрителей. Сборная Мексики стала победителем турнира и заработала право представлять КОНКАКАФ на Кубке конфедераций 2013 в Бразилии."},{"page_url":"https://en.wikipedia.org/wiki/Arthur_Meinig","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Portr%C3%A4t_Arthur_Meinig_von_Franz_W%C3%BCrbel%2C_um_1883.jpg","page_title":"Arthur Meinig","context_page_description":"Arthur Meinig was a German-born Hungarian architect. He was born in Waldheim, Saxony on 7 November 1853 and died in Budapest on 14 September 1904. After studying in Dresden, he worked for architects Fellner and Helmer in Vienna. In 1883 he moved to Budapest and soon became the favorite architect of Hungarian aristocracy. He created buildings in the styles of Neo-Gothic, Neo-Renaissance, and especially in Neobaroque."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BB%D0%B0%D0%B3_%D0%A7%D0%B0%D0%B3%D0%BE%D0%B4%D0%BE%D1%89%D0%B5%D0%BD%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Flag_of_Chagodoshchensky_rayon_%28Vologda_oblast%29.png","page_title":"Флаг Чагодощенского района","context_page_description":"Флаг муниципального образования Чагодо́щенский муниципальный район Вологодской области Российской Федерации — опознавательно-правовой знак, служащий официальным символом муниципального образования.\\nНыне действующий флаг утверждён 26 октября 2006 года и внесён в Государственный геральдический регистр Российской Федерации с присвоением регистрационного номера 2689."},{"page_url":"https://pt.wikipedia.org/wiki/Nova_Zel%C3%A2ndia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Rugby_world_cup_2011_NEW_ZEALAND_ARGENTINA_%287309677416%29.jpg","page_title":"Nova Zelândia","context_page_description":"Nova Zelândia é um país insular, oficialmente pertencente à Oceania, no sudoeste do Oceano Pacífico, formado por duas massas de terra principais e por numerosas ilhas menores, sendo as mais notáveis as ilhas Stewart e Chatham. O nome indígena na língua maori para a Nova Zelândia é Aotearoa, normalmente traduzido como \\"A Terra da Grande Nuvem Branca\\". Os domínios da Nova Zelândia também incluem as Ilhas Cook e Niue; Tokelau; e a Dependência de Ross. Recebeu este nome em homenagem a uma província dos Países Baixos chamada Zelândia, que era a terra natal de seus colonizadores.\\nA Nova Zelândia é notável por seu isolamento geográfico: está situada a cerca de 2 000 km a sudeste da Austrália, separados através do mar da Tasmânia e os seus vizinhos mais próximos ao norte são a Nova Caledônia, Fiji e Tonga. Devido ao seu isolamento, o país desenvolveu uma fauna distinta dominada por pássaros, alguns dos quais foram extintos após a chegada dos seres humanos e dos mamíferos introduzidos por eles. A maioria da população da Nova Zelândia é de ascendência europeia, sobretudo britânica, enquanto os nativos maoris, ou seus descendentes, são minoria."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A9%E3%83%B3%E3%83%87%E3%82%A3%E3%83%BB%E3%82%A6%E3%82%A7%E3%82%B9%E3%83%88%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Randy_Weston.jpg","page_title":"ランディ・ウェストン","context_page_description":"ランドルフ・エドワード・「ランディ・」ウェストンは、アメリカ合衆国のジャズピアニスト、作曲家である。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B3%E3%83%B3%E3%82%B3%E3%83%AB%E3%83%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dc/Concorde_1_94-9-5_kix.jpg","page_title":"コンコルド","context_page_description":"コンコルドは、イギリスのBACやフランスのシュド・アビアシオンなどが共同で開発した超音速旅客機。コンコルドという名前は「調和」「協調」等を意味する。1969年3月1日に試験飛行として初飛行後、1970年11月にマッハ2を超す速度を記録し、1975年に就航、1976年1月21日に運用開始となった。"},{"page_url":"https://de.wikipedia.org/wiki/19._April","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Eliotness.jpg","page_title":"19. April","context_page_description":"Der 19. April ist der 109. Tag des gregorianischen Kalenders, somit verbleiben noch 256 Tage bis zum Jahresende."},{"page_url":"https://no.wikipedia.org/wiki/Det_tysk-romerske_rike","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Augsburger-Reichstag.jpg","page_title":"Det tysk-romerske rike","context_page_description":"Det tysk-romerske rike, var riket og statsdannelsen som oppsto som en følge av at det karolingiske Øst-Frankerriket ble dannet gjennom traktaten i Verdun i 843. Det tysk-romerske rike eksisterte i nesten et årtusen frem til det ble oppløst etter Napoleons initiativ i 1806. Den siste tysk-romerske keiseren var Frans II som abdiserte og avskaffet riket i 1806 under Napoleonskrigene.\\nI Tyskland kalles det tysk-romerske rike oftest som «det gamle riket». Før oppløsningen av riket omfattet det mesteparten av dagens Tyskland, Tsjekkia, Østerrike, Liechtenstein, Slovenia, Belgia og Luxembourg. Også store områder av dagens Polen og deler av Nederland og Kroatia, samt deler av Frankrike og Nord-Italia var en del av riket.\\nRiket forstod seg som en etterfølger etter det antikke Romerriket og tok i bruk flere av dets symboler. Det hadde en særstilling overfor paven, som hadde sine røtter i samarbeidet mellom pavedømmet og karolingerne, og bidro, til tross for et tidvis anstrengt forhold til pavestolen, til å sikre eksistensen av kirkestaten som omfattet selve byen Roma som riket tok sitt navn etter."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%9B%D0%B0%D0%B2%D1%80%D0%B0%D1%81-%D0%B4%D1%83-%D0%A1%D1%83%D0%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Cidade_de_Lavras_do_Sul%2C_Brasil.jpg","page_title":"Лаврас-ду-Сул","context_page_description":"Лаврас-ду-Сул — Бразилиядағы муниципалитет, Риу-Гранди-ду-Сул штатында орналасқан. Оңтүстік-батыс Риу-Гранди-ду-Сул мезорегионының құрамдас бөлігі болып табылатын Кампанья-Меридиунал экономика-статистикалық микрорегионының құрамына кіреді.\\n2006 жылғы мәліметтер бойынша тұрғындарының саны 8 025 адамды құрайды. Алып жатқан жер аумағы 2 599,81 км² шамасында. Халық тығыздығы — 2,9 адам/км²."},{"page_url":"https://ca.wikipedia.org/wiki/Palav%C3%A0s","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/27/Map_commune_FR_insee_code_34192.png","page_title":"Palavàs","context_page_description":"Palavàs és un municipi occità del Llenguadoc, situat al departament de l'Erau, a la regió d'Occitània."},{"page_url":"https://nn.wikipedia.org/wiki/Marina_Kiehl","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/2013-09-30_DoSB_131.JPG","page_title":"Marina Kiehl","context_page_description":"Marina Kiehl er ein tysk tidlegare alpin skirennar frå München som vart olympisk meister i utfor under vinterleikane 1988 i Calgary."},{"page_url":"https://ro.wikipedia.org/wiki/Comuna_S%C3%A2nm%C4%83rtin,_Cluj","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/RO_CJ_Samboieni_1.jpg","page_title":"Comuna Sânmărtin, Cluj","context_page_description":"Sânmărtin este o comună în județul Cluj, Transilvania, România, formată din satele Ceaba, Cutca, Diviciorii Mari, Diviciorii Mici, Măhal, Sâmboieni, Sânmărtin și Târgușor."},{"page_url":"https://en.wikipedia.org/wiki/Franklin%27s_bumblebee","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Bombus_franklini.jpg","page_title":"Franklin's bumblebee","context_page_description":"Franklin's bumblebee is known to be one of the most narrowly distributed bumblebee species, making it a critically endangered bee of the western United States. It is known only from a 190-by-70-mile area in southern Oregon and northern California, between the Coast and Sierra-Cascade mountain ranges. It was last seen in 2006. Franklin's bumblebee is known to collect nectar and pollen from several wildflowers, such as lupine, California poppy, and horsemint, which causes it to be classified as a generalist forager."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%B2%99%E8%8C%A8%E8%B2%9D%E6%A0%BC%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Schatzberg_S.JPG","page_title":"沙茨貝格山","context_page_description":"沙茨貝格山，是奧地利的山峰，位於該國西部，由蒂羅爾州負責管轄，屬於基茨比爾阿爾卑斯山脈的一部分，海拔高度1,898米，每年平均降雨量1,971毫米。"},{"page_url":"https://es.wikipedia.org/wiki/Premio_Municipal_de_Literatura_de_Santiago","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Montealegre%2C_Jorge_-FILSA_2015_10_24_fRF02.jpg","page_title":"Premio Municipal de Literatura de Santiago","context_page_description":"El Premio Municipal de Literatura de Santiago es una de las distinciones literarias más importantes de Chile. Creado el 5 de febrero de 1934 por la municipalidad capitalina, en un principio se otorgaban premios en los géneros de novela, poesía y teatro;​ en 1941 se agregó el ensayo; en 1954, el cuento; a este se le sumó el literatura infantil y juvenil y en 2013 otros tres: referencial, ​ investigación periodística y edición; al año siguiente se resolvió ampliar el reconocimiento de las obras dirigidas a los menores y premiar separadamente la literatura infantil y la juvenil, llegando así a 10 el total de las categorías en concurso.\\nEl premio literario más antiguo de Chile​ consiste en la entrega de una suma de dinero, que en 2016 fue de 2 000 000 de pesos chilenos, para cada género y del diploma correspondiente.​ Pueden presentarse al concurso las obras publicadas en primera edición el año anterior a la convocatoria; en cada género, su jurado selecciona tres finalistas de entre los cuales elige posteriormente al ganador.​\\nEste antiguo galardón ha sufrido algunas interrupciones durante su historia."},{"page_url":"https://en.wikipedia.org/wiki/Grisolles_station","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a5/Gare_de_Grisolles_%282011%29.JPG","page_title":"Grisolles station","context_page_description":"Grisolles is a railway station in Grisolles, Occitanie, France. The station is on the Bordeaux–Sète railway. The station is served by TER services operated by SNCF."},{"page_url":"https://hu.wikipedia.org/wiki/Magyar_Demokrata_F%C3%B3rum","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/D%C3%A1vid_Ibolya_%282%29.jpg","page_title":"Magyar Demokrata Fórum","context_page_description":"A Magyar Demokrata Fórum magyarországi politikai párt volt, a rendszerváltás egyik meghatározó politikai szervezete. 1990-ben az első szabad választáson a legtöbb szavazatot szerezve négy évig a kormánykoalíció vezető pártjaként két miniszterelnököt adott az országnak. Eredetileg markánsan jobboldali, de több ideológiai áramlatot magába fogadó párt volt.\\nA Dávid Ibolya vezette MDF 1998 és 2002 között részt vett az első Orbán-kormányban, a pártelnök az igazságügyi tárcát vezette. 2002 után azonban a magyar politikát meghatározó szimbolikus és ideológiai kérdésekben nem igazodott a Fidesz által vitt jobboldali irányzathoz, így egyes politikai elemzők szerint mintegy baloldali párttá vált. Ehhez járult az is, hogy a 2009-es európai parlamenti választáson Bokros Lajost tette vezető jelöltjévé, gazdaságpolitikai kérdésekben a liberális irányvonal felé fordult. Szavazótábora ennek megfelelően kicserélődött."},{"page_url":"https://fr.wikipedia.org/wiki/Bioussac","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Bioussac_mairie.JPG","page_title":"Bioussac","context_page_description":"Bioussac est une commune du sud-ouest de la France située dans le département de la Charente.\\nSes habitants sont appelés les Bioussacois ou les Bioussacais."},{"page_url":"https://af.wikipedia.org/wiki/Japan_Nasionale_Roete_44","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/R44R272.JPG","page_title":"Japan Nasionale Roete 44","context_page_description":"Nasionale Roete 44 is 'n nasionale snelweg van Japan."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%8D%E3%82%88%E3%81%99%E3%81%82%E3%81%97%E3%81%8C%E3%82%8B%E3%83%90%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e6/%E3%82%B5%E3%82%AF%E3%83%A9%E3%83%AB%E3%83%BC%E3%83%88.jpg","page_title":"きよすあしがるバス","context_page_description":"きよすあしがるバスは、愛知県清須市がつばめ自動車に運行を委託しているコミュニティバスである。"},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D8%B1%D8%A4%D8%B3%D8%A7%D8%A1_%D8%A7%D9%84%D8%AF%D9%88%D9%84_%D9%88%D8%A7%D9%84%D8%AD%D9%83%D9%88%D9%85%D8%A7%D8%AA_%D8%A7%D9%84%D8%AD%D8%A7%D8%B5%D9%84%D9%8A%D9%86_%D8%B9%D9%84%D9%89_%D8%AC%D8%A7%D8%A6%D8%B2%D8%A9_%D9%86%D9%88%D8%A8%D9%84","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Hjalmar_branting_stor_bild.jpg","page_title":"قائمة رؤساء الدول والحكومات الحاصلين على جائزة نوبل","context_page_description":"هذه قائمة رؤساء الدول والحكومات الذين حصلوا على جائزة نوبل."},{"page_url":"https://nl.wikipedia.org/wiki/Abelen-iepenbos","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Ranunculus_ficaria2.jpg","page_title":"Abelen-iepenbos","context_page_description":"Het abelen-iepenbos is een associatie uit de klasse van de eiken- en beukenbossen op voedselrijke grond, een bosplantengemeenschap die onder meer voorkomt op regelmatig overstroomde oeverwallen langs grote rivieren en in oude landgoederen langs de binnenduinrand.\\nZe wordt gekenmerkt door een goed ontwikkelde en soortenrijke struik- en kruidlaag waarin dikwijls stinsenplanten worden aangetroffen, vooral bol- en knolgewassen.\\nDe bosvegetaties van deze associatie worden ook wel hardhoutooibossen genoemd, in tegenstelling tot die van het verbond van de wilgenvloedbossen en -struwelen, die bekendstaan als zachthoutooibossen.\\nDeze associatie is in Vlaanderen zeldzaam en in Nederland vrij zeldzaam en bestaat vooral uit kleine fragmenten. Ze omvat drie sub-associaties."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%91%AA%E9%BA%97%E7%9A%87%E5%90%8E%E4%BA%8C%E8%99%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Queen_Mary_2_a.JPG","page_title":"瑪麗皇后二號","context_page_description":"瑪麗皇后2號是一艘橫渡大西洋的英國皇家郵輪。由Carnival Corporation & PLC所持有，由卡納德郵輪營運。瑪麗皇后二號是當前唯一一艘作為遠洋定期客輪運營的大型客輪。\\n瑪麗皇后二號是由伊麗莎白二世以特克的瑪麗的名字來命名，名稱的來源與瑪麗皇后號一樣。在2003年建造的時候，瑪麗皇后II號被公認為世界上最長、最寬和最高的客船。她亦曾是總噸位最大的客輪，達到148,528英噸。2006年4月這個紀錄被由皇家加勒比國際公司建造，總噸位數達154,407噸的郵輪海洋自由號取代。即使已經不是世上最大的客船，但仍是目前全球體積最大的遠洋郵輪。瑪麗皇后II號有15個餐廳和酒吧、5個游泳池、1個賭場、1個舞池、1個舞台和1個天象館。"},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%A4%E0%A4%AE%E0%A4%BF%E0%A4%B3%E0%A4%A8%E0%A4%BE%E0%A4%A1%E0%A5%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/Starr_080716-9320_Gloriosa_superba.jpg","page_title":"तमिळनाडू","context_page_description":"तमिळनाडू तमिळ्नाडु अर्थ: \\"तमिळ् लोकांचे राष्ट्र\\" हे भारतातील २८ राज्यांपैकी एक राज्य आहे. चेन्नई हे सर्वात मोठे शहर तसेच राज्याची राजधानी आहे. तमिळनाडू भारताच्या सर्वात दक्षिणटोकावरील द्वीपकल्पावर वसले आहे. पश्चिमेस केरळ, वायव्येला कर्नाटक, दक्षिणेस भारतीय महासागर व श्रीलंका, पूर्वेस बंगालचा उपसागर, तसेच केंद्रशासित प्रदेश पॉन्डिचरी आणि उत्तरेस आंध्र प्रदेश अशा त्याच्या चतु:सीमा आहेत. राज्याच्या वायव्येस निलगिरी पर्वतरांगा, अण्णामालै टेकड्या, पश्चिमेस पालक्काड, तर उत्तरेस पूर्वेघाट आणि पूर्वदिशेला असलेला बंगालचा उपसागर दक्षिणेस पाल्कची समुद्रधुनी ओलांडून भारतीय महासागरात मिसळतो. दक्षिणेकडील टोकावर असणाऱ्या कन्याकुमारी ह्या प्रसिद्ध पर्यटनक्षेत्री तीन समुद्र एकमेकांत मिसळतानाचे दृश्य पहावयास मिळते.\\nक्षेत्रफळाच्या दृष्टीने तमिळनाडूचा भारतात अकरावा क्रमांक लागतो तर लोकसंख्येनुसार सातवा क्रमांक लागतो. तमिळनाडू हे भारतातील सर्वात मोठे शहरीकरण झालेले राज्य आहे, तसेच भारताच्या औद्योगिक विकास दरात त्याचे पाचव्या क्रमांकाचे स्थान आहे. भारतातील सर्वाधिक उद्योगधंदे व त्यांची कार्यालयेअसणारे राज्य म्हणून तमिळनाडूचा प्रथम क्रमांक लागतो. सुत, साखर व सिमेंट हे येथील प्रमुख उद्योगधंदे आहेत. पण त्यामानाने देशाच्या एकूण लोकसंख्येपैकी फक्त ६ टक्के लोक तमिळनाडूत राहतात."},{"page_url":"https://en.wikipedia.org/wiki/Valeriu_Pantazi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Valeriu_Pantazi_02.jpg","page_title":"Valeriu Pantazi","context_page_description":"Valeriu Pantazi was a Romanian poet, writer and painter.\\nHe was born in Urechești, Vrancea County. He was a close associate of Nichita Stănescu, Sorin Dumitrescu, Ștefan Agopian, Valentin Popa and the painter Radu Darânga. His great friend was Gheorghe Pantelie of Pitești. He died in Bucharest."},{"page_url":"https://nn.wikipedia.org/wiki/Akss%C3%B8yleblom","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Liatris_spicata_MHNT.BOT.2012.10.32.jpg","page_title":"Akssøyleblom","context_page_description":"Akssøyleblom er ein art i korgplantefamilien. Arten veks naturleg i den austre delen av Nord-Amerika og har blitt introdusert som hageplante i Europa. Akssøyleblom er ein fleiårig urt som til vanleg blir 40-100 cm høg, men kan under gunstige tilhøve bli så høg som 180 cm. Rothalsen er rund og knollaktig."},{"page_url":"https://cs.wikipedia.org/wiki/Prague_Pride","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Praha%2C_Na_P%C5%99%C3%ADkop%C4%9B%2C_Pride_2017%2C_Homo_Lobby.jpg","page_title":"Prague Pride","context_page_description":"Prague Pride je festival LGBTQ hrdosti, pořádaný v Praze od roku 2011, a to každoročně vždy v polovině srpna, po dobu asi jednoho týdne. Kromě tradičního sobotního průvodu Prahou, který je vrcholem celého festivalu, pravidelně představuje množství veřejných diskusí a debat, workshopů, sportovních a kulturních akcí i duchovních setkání."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D0%B0%D1%94%D1%82%D0%BE%D0%BA_%D0%93%D0%B0%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D1%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Estate_of_Ganski2.JPG","page_title":"Маєток Ганських","context_page_description":"Маєток Ганських — пам'ятка історії, архітектури та садово-паркової культури кінця 18 — початку 19 століть. Розташований в селі Верхівня Ружинського району Житомирської області. Занесений до реєстру національних святинь України."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E6%A9%A1%E7%9A%AE%E6%93%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Office-pink-erasers.jpg","page_title":"橡皮擦","context_page_description":"橡皮擦，又称胶擦布、擦纸胶、擦字胶、擦布、擦子等，为拭去铅笔于纸上墨迹的文具。它们多呈现白色、棕色或粉红色，但随着新的原料出现，现在的橡皮擦可以是任何颜色。橡皮擦的主要构成物料是橡胶。一些售价较高的橡皮擦则含有塑胶成分。\\n擦拭粉笔或白板笔迹的用具一般称为粉刷或板擦。"},{"page_url":"https://en.wikipedia.org/wiki/Formula_One_drivers_from_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Charles_Pic_Moscow_2013.jpg","page_title":"Formula One drivers from France","context_page_description":"There have been 75 Formula One drivers from France, the most successful of them being Alain Prost who won the World Drivers' Championship four times."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%D9%86%D8%AA%D9%88_%D8%A7%D8%B3%D8%AA%D9%81%D8%A7%D9%86%D9%88_%D8%AF%DB%8C_%D8%B3%D8%B3%D8%A7%D9%86%DB%8C%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Torre_Medicea_-_Santo_Stefano_di_Sessanio.jpg","page_title":"سنتو استفانو دی سسانیو","context_page_description":"سنتو استفانو دی سسانیو ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. دنیز سوُلاری سَویه‌سیندن ۱۲۵۰ متر یۇکسک‏لیکده یئر آلیب. سوْن نۆفوس ساییمی اساسيندا 117 نفر ایمیش."},{"page_url":"https://la.wikipedia.org/wiki/Saignon","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Saignon_wiki4.jpg","page_title":"Saignon","context_page_description":"Saignon est commune 1031 incolarum praefecturae Vallis Clausae in Franciae australis regione Provincia et Alpibus."},{"page_url":"https://es.wikipedia.org/wiki/Shirley_Ross","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Shirley_Ross_CM238.jpg","page_title":"Shirley Ross","context_page_description":"Shirley Ross fue una actriz y cantante estadounidense, recordada principalmente por haber cantado la canción Thanks for the Memory en la película de 1938 The Big Broadcast of 1938 junto a Bob Hope. Dicha canción ganó el premio Óscar a la mejor canción original de dicho año.\\nOtra de sus apariciones cinematográficas célebres es en el filme Waikiki Wedding donde canta junto a Bing Crosby la canción Blue Hawaii."},{"page_url":"https://sk.wikipedia.org/wiki/Dia%C4%BEnica_A4_(Belgicko)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Autoroute_A4_%28BE%29.svg","page_title":"Diaľnica A4 (Belgicko)","context_page_description":"Diaľnica A4 predstavuje hlavné prepojenie medzi Bruselom a Luxemburskom, ako aj ďalej do južnej Európy. Je to najvýznamnejšia diaľnica na juhu krajiny. Najmä v lete ju využíva veľa turistov, smerujúcich na juh. Nazýva sa preto aj Autoroute du Soleil v úseku od Neufchâteau k luxemburským hraniciam.\\nV rokoch 2004 až 2006 prešla väčšia časť A4 generálnou rekonštrukciou. Celková dĺžka úseku je 188 km."},{"page_url":"https://it.wikipedia.org/wiki/Dassault-Dornier_Alpha_Jet","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Patrouille-de-france-alpha-jet-profil.jpg","page_title":"Dassault-Dornier Alpha Jet","context_page_description":"Il Dassault-Dornier Alpha Jet è un aereo da addestramento avanzato e da attacco al suolo leggero bireattore, di concezione franco-tedesca e prodotto dalla Dassault Aviation e dalla Dornier-Werke GmbH tra gli anni settanta e gli anni ottanta.\\nCaratterizzato dall'aspetto compatto e dall'adozione di un'ala a freccia, soluzione tecnica che garantisce elevate prestazioni, l'Alpha Jet viene tuttora utilizzato nelle versioni più recenti da un buon numero di aeronautiche militari e principalmente dalla francese Armée de l'air e dalla sua pattuglia acrobatica nazionale, la Patrouille de France, e dalla tedesca Luftwaffe nella versione d'attacco al suolo."},{"page_url":"https://fr.wikipedia.org/wiki/Maggy_Nagel","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Maggy_Nagel%2C_Oktober_2015-102.jpg","page_title":"Maggy Nagel","context_page_description":"Maggy Nagel, née le 25 août 1957 à Luxembourg, est une personnalité politique luxembourgeoise affiliée au Parti démocratique.\\nEn 1994, Maggy Nagel obtint le poste de première échevine de la commune de Mondorf-les-Bains. De 1996 à 2013, elle exerça même les fonctions de bourgmestre de cette même commune.\\nEn 1999, elle fut élue une première fois à la Chambre des Députés. En 2004 et 2009, toutefois, elle ne fut pas reconduite à la représentation nationale. Ce n'est qu'à l'occasion des élections législatives anticipées de 2013 qu'elle retrouva son siège de députée.\\nLe 4 décembre 2013, elle fut nommée ministre de la Culture et ministre du Logement au sein du gouvernement Bettel-Schneider.\\nElle a toutefois été amenée à démissionner de son poste du gouvernement Bettel-Schneider dès le 18 décembre 2015. Mais moins d'une année plus tard, elle a été consolée - avec le statut de premier conseiller de gouvernement - par sa nomination comme commissaire chargé du pavillon luxembourgeois à l'exposition universelle de Dubaï en 2020."},{"page_url":"https://sv.wikipedia.org/wiki/Matchbollar_f%C3%B6r_v%C3%A4rldsm%C3%A4sterskapet_i_fotboll_f%C3%B6r_herrar","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/1930_World_Cup_Final_ball_Argentina.jpg","page_title":"Matchbollar för världsmästerskapet i fotboll för herrar","context_page_description":"Olika officiella matchbollar för världsmästerskapet i fotboll för herrar har skapats för varje turnering sedan 1934. Bollarna har oftast olika symboler eller nationella mönster starkt förknippade med respektive värdnation."},{"page_url":"https://fi.wikipedia.org/wiki/Tom_Ford","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Tom_Ford_cropped_2009.jpg","page_title":"Tom Ford","context_page_description":"Tom Ford on yhdysvaltalainen muotisuunnittelija ja elokuvaohjaaja.\\nHän syntyi Texasissa 1961, ja muutti nuorena New Yorkiin opiskelemaan taidehistoriaa, kunnes vaihtoi arkkitehtuuriin Parsonin suunnittelukoulussa New Yorkissa.\\nVuonna 1986 Ford liittyi amerikkalaisen suunnittelijan Cathy Hardwickin suunnittelutiimiin, ja kaksi vuotta myöhemmin hänestä tuli suunnittelupäällikko Perry Ellisillä. Vuoteen 1990 mennessä Ford oli muuttanut Milanoon ja liittynyt Guccin tiimiin, ja kahdessa vuodessa hän kipusi Guccin luovan suunnittelun johtoon.\\nKun Gucci osti osake-enemmistön Yves Saint-Laurentista, Ford nimettiin johtavaksi suunnittelijaksi. Ford on sanonut että hänen menestyksensä salaisuus piilee hänen energiassaan, ja että hän nukkuu öisin vain noin kolme tuntia. Hänen julkkisfaneihin kuuluvat muun muassa Madonna, Bianca Jagger ja Trudie Styler.\\nTom aiheutti pienen hämmennyksen mainostaessaan M7-tuoksuaan. Kampanjassa oli malli Samuel de Cubber täysin alastomana. Ford puolusti kampaanjaansa sanoen \\"Parfyymia käytetään iholla, joten miksi piilottaa vartaloa? M7-kampanja on todella aito, se on erittäin akateemisesti alaston."},{"page_url":"https://id.wikipedia.org/wiki/Makam_S%C3%BCleyman_%C5%9Eah","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/08/Tomb_of_Suleyman_Shah.jpg","page_title":"Makam Süleyman Şah","context_page_description":"Makam Suleyman Shah adalah wilayah berdaulat Turki yang terkurung di Kegubernuran Aleppo, Suriah. Suleyman Shah, kakek Osman I, pendiri Kesultanan Utsmaniyah, dimakamkan di sini. Ia diduga wafat akibat tenggelam di sungai Eufrat, Suriah. Sebuah makam Utsmani di seputaran Qal'at Ja'bar telah dikait-kaitkan dengan Suleyman Shah.\\nMenurut Pasal 9 Perjanjian Ankara yang ditandatangani oleh Prancis dan Turki tahun 1921, makam ini \\"secara utuh milik Turki yang boleh menunjuk sendiri penjaganya dan mengibarkan bendera Turki di sana\\". Perjanjian itu tidak menentukan status tanah di bawah makam.\\nPada tahun 1973, makam ini dilanda banjir setelah Bendungan Tabqa selesai dibangun dan menciptakan Danau Assad. Waktu itu, wilayah Turki beserta makamnya dipindahkan ke tempat baru 80 km di sebelah utara Qal'at Ja'bar, namun tetap berada di pinggir sungai Eufrat yang tidak jauh dari kota Sarrin, 35 km dari perbatasan Turki. Sampai Februari 2015, Turki menempatkan pasukan kehormatan kecil di wilayah tersebut."},{"page_url":"https://cs.wikipedia.org/wiki/Vladislav_Petkovi%C4%87_Dis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Vladislav_Petkovi%C4%87_Dis.jpg","page_title":"Vladislav Petković Dis","context_page_description":"Vladislav Petković Dis byl srbský básník přelomu 19. a 20. století. DIS byla jeho přezdívka, která byla původem z tří prostředních písmen v jeho křestním jméně.\\nNebyl velmi dobrým studentem a měl neustále problémy završit svá studia. Běhems svého života pracoval jako učitel a také jako válečný dopisovatel během Balkánských válek. Účastnil se také pochodu srbské armády na ostrov Korfu, kam se vojsko poraženého státu stáhlo. Do dějin srbské literatury se zapsal několika pozoruhodnými básněmi, jako např. Možda spava, či Nirvana. V předválečném období vydal dvě sbírky básní: Utopené duše a My čekáme cara"},{"page_url":"https://ja.wikipedia.org/wiki/%E5%9F%8E%E5%B1%B1_(%E5%BE%B3%E5%B3%B6%E5%B8%82)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4e/Tokushima_castle_10.JPG","page_title":"城山 (徳島市)","context_page_description":"城山は、徳島県徳島市徳島町城内の徳島中央公園内にある山である。古くは渭山・猪山とも。"},{"page_url":"https://en.wikipedia.org/wiki/October_7_(Eastern_Orthodox_liturgics)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Saint_Jean_l%27Ermite_Jeremiah_Palladas.JPG","page_title":"October 7 (Eastern Orthodox liturgics)","context_page_description":"October 6 - Eastern Orthodox liturgical calendar - October 8\\nAll fixed commemorations below celebrated on October 20 by Orthodox Churches on the Old Calendar.\\nFor October 7th, Orthodox Churches on the Old Calendar commemorate the Saints listed on September 24."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D9%85%D8%AC%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Lechfeld1457.jpg","page_title":"المجر","context_page_description":"المَجَر أو هِنْغاريا و رسمياً الجُمْهُورِيَّة المَجَريَّة هي دولة أوروبية تقع في حوض الكاربات في وسط أوروبا. تحدها شمالاً سلوفاكيا ويبلغ طول الحدود حوالي 515 كم، وتحد أوكرانيا بـ 103 كم في الشمال الشرقي، وتحد رومانيا بـ 443 كم من الشرق، ومن الجنوب تحد كرواتيا بـ 329 كم صربيا وسلوفينيا بـ 102 كم، كما تحد النمسا بـ 336 كم من الغرب.\\nالمجر دولة محصورة لا تملك منفذا على البحر، وتحيط بها اليابسة من كل الجهات. تغطي الأراضي المجرية مساحة 93,030 كم²، وتتأثر بمناخ قاري، مما يجعلها تحل في المرتبة 109 الأكبر مساحة في العالم. طبيعة المجر تتكون بشكل عام من سهول منبسطة إلى سهول منحدرة من حوض الكاربات، مع وجود هضاب وجبال منخفضة في الشمال على طول الحدود السلوفاكية. حسب إحصاء عام 2018 فإن عدد سكان المجر حوالي 9,778,371 نسمة. فتحل المجر في المرتبة 83 الأكثر تعدادًا سكانيًا في العالم. تبلغ الكثافة السكانية في المجر حوالي 107.7/كم² مما يجعلها في المرتبة 94 الأعلى كثافة سكانية في العالم.\\nتعاقبت العديد من الدول والممالك على الأراضي المعروفة اليوم باسم المجر مثل الكلت والرومان، وحتى بودابست عاصمة المجر كانت مستوطنة كلتية، كما أصبحت عاصمة ومركزاً للمحافظة الرومانية المعروفة باسم بانونيا السفلى."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BE%D0%BD%D1%82%D0%B5%D0%B9%D0%BD,_%D0%9D%D1%83%D1%88%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Nouchka_Fontijn_at_the_awarding_ceremony_of_the_2015_European_Games.jpg","page_title":"Фонтейн, Нушка","context_page_description":"Нушка Фонтейн — нидерландская спортсменка-боксёр, серебряный призёр Олимпийских игр 2016 года, чемпионка Европы, а также Европейских игр, призёр чемпионатов мира."},{"page_url":"https://ceb.wikipedia.org/wiki/Punta_de_sa_Pattada","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Cuglieri_-_panoramio.jpg","page_title":"Punta de sa Pattada","context_page_description":"Bukid ang Punta de sa Pattada sa Italya. Nahimutang ni sa lalawigan sa Provincia di Oristano ug rehiyon sa Sardegna, sa habagatan-kasadpang bahin sa nasod, 400 km sa habagatan-kasadpan sa Rome ang ulohan sa nasod. 948 metros ibabaw sa dagat kahaboga ang nahimutangan sa Punta de sa Pattada.\\nAng yuta palibot sa Punta de sa Pattada kay kasagaran kabungtoran, apan sa amihang-sidlakan nga kini mao ang patag. Kinahabogang dapit sa palibot ang Monte Urtigu, 1,050 ka metros ni kahaboga ibabaw sa dagat, 3.6 km sa habagatan sa Punta de sa Pattada. Dunay mga 29 ka tawo kada kilometro kwadrado sa palibot sa Punta de sa Pattada medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Macomer, 15.8 km sa amihanan-sidlakan sa Punta de sa Pattada. Hapit nalukop sa lasang nga sagolsagol ang palibot sa Punta de sa Pattada. Sa rehiyon palibot sa Punta de sa Pattada, kabukiran talagsaon komon.\\nAng klima kasarangan. Ang kasarangang giiniton 14 °C. Ang kinainitan nga bulan Hulyo, sa 26 °C, ug ang kinabugnawan Pebrero, sa 4 °C. Ang kasarangang pag-ulan 825 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 147 milimetro nga ulan, ug ang kinaugahan Hulyo, sa 13 milimetro."},{"page_url":"https://ceb.wikipedia.org/wiki/Scanno_(munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Veduta_Scanno.jpg","page_title":"Scanno (munisipyo)","context_page_description":"Munisipyo ang Scanno sa Italya. Nahimutang ni sa lalawigan sa Provincia dell' Aquila ug rehiyon sa Abruzzo, sa sentro nga bahin sa nasod, 110 km sa sidlakan sa Rome ang ulohan sa nasod. Adunay 1,948 ka molupyo. Naglangkob kin og 134 ka kilometro kwadrado. Scanno mopakigbahin sa usa ka utlanan sa Anversa degli Abruzzi, Barrea, Bisegna, Bugnara, Civitella Alfedena, Introdacqua, Opi, Pescasseroli, Pettorano sul Gizio, Rivisondoli, Rocca Pia, Villalago, ug Villetta Barrea.\\nAng yuta sa Scanno kay kabungtoran sa habagatang-sidlakan, apan sa amihang-kasadpan nga kini mao ang kabukiran.\\nAng klima mediteranyo. Ang kasarangang giiniton 6 °C. Ang kinainitan nga bulan Hulyo, sa 18 °C, ug ang kinabugnawan Pebrero, sa -6 °C. Ang kasarangang pag-ulan 1,361 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 182 milimetro nga ulan, ug ang kinaugahan Agosto, sa 43 milimetro."},{"page_url":"https://de.wikipedia.org/wiki/Science_Park_JKU_Linz","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Science_Park_1_%283%29.jpg","page_title":"Science Park JKU Linz","context_page_description":"Der Science Park der JKU Linz wurde im Jahr 2007 in Linz in Oberösterreich von der Bundesimmobiliengesellschaft erbaut und 2012 zum Großteil fertiggestellt. Das Gebäude umfasst mehrere Bauteile und wird als hoch-modernes und architektonisch spektakuläres Campus-Zentrum beschrieben. Insgesamt besteht der Science Park aus 5 Bauteilen, wobei die Bauteile 1 bis 3 bereits fertiggestellt sind. Die Bauteile 4 und 5 befinden sich zur Zeit im Bau.\\nDer Science Park erreichte den Ersten Preis beim archip award 2010 – international architecture award."},{"page_url":"https://hu.wikipedia.org/wiki/D%C3%A1nia_k%C3%B6zigazgat%C3%A1sa","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Map_DK_Regions2.png","page_title":"Dánia közigazgatása","context_page_description":"Dániában 2007. január 1-jén közigazgatási reformot hajtottak végre. A reform előtt az ország regionális szinten 13 megyére és 3 megyei jogokkal bíró községre oszlott, helyi szinten pedig – az utóbbiakat is beleértve – 270 község volt. A reform eredményeként a megyéket 5 régió váltotta fel, a községek száma pedig 98-ra csökkent."},{"page_url":"https://da.wikipedia.org/wiki/Haderslev_Amts_Jernbaner","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Haderslev_-_R%C3%B8dding_railway.png","page_title":"Haderslev Amts Jernbaner","context_page_description":"Haderslev Amts Jernbaner blev anlagt, mens Sønderjylland var tysk, og hed Die Kleinbahnen des Kreises Hadersleben eller Haderslebener Kreisbahn indtil genforeningen i 1920. Banerne kom i folkemunde til at hedde \\"Perle\\" eller \\"e lillebahn\\"."},{"page_url":"https://fr.wikipedia.org/wiki/%C4%B0dil_Biret","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/%C4%B0dil_Biret_%286946834070%29.jpg","page_title":"İdil Biret","context_page_description":"İdil Biret, née le 21 novembre 1941 à Ankara, est une pianiste turque."},{"page_url":"https://en.wikipedia.org/wiki/Grinnell_College","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/40/Grinnell_002.JPG","page_title":"Grinnell College","context_page_description":"Grinnell College is a private liberal arts college in Grinnell, Iowa. It was founded in 1846 when a group of New England Congregationalists established the Trustees of Iowa College. Grinnell is known for its rigorous academics, innovative pedagogy, and commitment to social justice.\\nGrinnell has the sixth highest endowment-to-student ratio of liberal arts colleges, enabling need-blind admissions and substantial academic merit scholarships to boost socioeconomic diversity. Students receive funding for unpaid or underpaid summer internships and professional development. Grinnell participates in a 3–2 engineering dual degree program with Columbia University, Washington University in St. Louis, and California Institute of Technology, a 2–1–1–1 engineering program with Dartmouth College and a Master of Public Health cooperative degree program with University of Iowa.\\nNearly half of enrolled Grinnellians self-identify as international students or students of color. Among Grinnell alumni are 14 Rhodes Scholars, 5 Marshall Scholars, 119 Fulbright Scholars, 79 Watson Fellows, 13 Goldwater Scholars, and one Nobel laureate."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D1%82%D0%BE%D0%BB%D0%B8%D1%86%D1%8C%D0%BA%D0%B0_%D1%86%D0%B5%D1%80%D0%BA%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Saint_Peter%27s_Basilica_facade%2C_Rome%2C_Italy.jpg","page_title":"Католицька церква","context_page_description":"Като́лицька це́рква — найбільша християнська церква. Нараховує 1,3 мільярд вірних. Назва походить від терміна «католичність», одного з атрибутів Церкви Христової. Згідно з вченням, Голова церкви — Ісус Христос, видимий земний голова — Папа Римський, вікарій Христа. Папа очолює Святий Престол і державу-місто Ватикан у Римі; вважається наступником апостола Петра, якому згідно з Євангелієм, було заповідано очолити Церкву. В 1054 році у світовому християнстві стався остаточний розкол на дві окремі християнські спільноти або церкви — на західну і східну. У XVI столітті відбувся інший розкол всередині західної церкви, що дав початок різним течіям протестантизму. Сучасна Католицька церква має в своєму складі як церкви латинського обряду, так і церкви східних обрядів; найбільшою серед останніх є Українська греко-католицька церква. Католицьке вчення більшою частиною розділяють також традиціоналістські, старокатолицькі та незалежні католицькі спільноти. До віровчення католицької церкви вживають назви католици́зм, като́лицтво."},{"page_url":"https://bg.wikipedia.org/wiki/Thelenota_anax","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Thelenota_anax.jpg","page_title":"Thelenota anax","context_page_description":"Thelenota anax е вид морска краставица от семейство Stichopodidae."},{"page_url":"https://fr.wikipedia.org/wiki/Kabupaten_de_Sukabumi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Locator_kabupaten_sukabumi.png","page_title":"Kabupaten de Sukabumi","context_page_description":"Le kabupaten de Sukabumi, en indonésien Kabupaten Sukabumi, est un kabupaten qui entoure la ville de Sukabumi dans la province indonésienne de Java occidental. Son chef-lieu est Pelabuhan Ratu."},{"page_url":"https://en.wikipedia.org/wiki/Faiyum_Light_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Anglo-Belgian_Company_of_Egypt.jpg","page_title":"Faiyum Light Railway","context_page_description":"The Fayoum Light Railway was a 750 mm gauge Egyptian light railway. Founded by a group of Egyptian Coptic investors, it operated in the first half of the twentieth century."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B4%D0%B5%D0%BF%D1%83%D1%82%D0%B0%D1%82%D0%BE%D0%B2_%D0%92%D0%B5%D1%80%D1%85%D0%BE%D0%B2%D0%BD%D0%BE%D0%B3%D0%BE_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D0%B0_%D0%A1%D0%A1%D0%A1%D0%A0_1-%D0%B3%D0%BE_%D1%81%D0%BE%D0%B7%D1%8B%D0%B2%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Muriy_IA.jpg","page_title":"Список депутатов Верховного Совета СССР 1-го созыва","context_page_description":"Ниже приведён список депутатов I созыва Верховного Совета СССР, избранных 12 декабря 1937 года, а также доизбранных позднее с 24 марта 1940 года по 22 июня 1941 года и 29 апреля 1945 года."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%AF%D8%A7%D9%86%D8%A8%D8%A7%D9%88%D8%B1%D8%8C_%D9%88%DB%8C%DA%A9%D8%AA%D9%88%D8%B1%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/GunbowerHotel.JPG","page_title":"گانباور، ویکتوریا","context_page_description":"گانباور یک شهرک در استرالیا است که در ویکتوریا واقع شده‌است."},{"page_url":"https://ro.wikipedia.org/wiki/Transportul_public_%C3%AEn_municipiul_Gala%C8%9Bi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/KarsanJestGalati.jpg","page_title":"Transportul public în municipiul Galați","context_page_description":"Transportul public din Galați reprezintă totalitatea liniilor și infrastructurii de transport în comun de călători de pe raza municipiului Galați, fiind operat în prezent de către SC Transurb SA. Această societate este subordonată Consiliului Local al Municipiului Galați și are în administrare toate traseele de tramvai, troleibuz și autobuz, fiind, începând cu data de 9 mai 2016, unicul operator de transport public din Municipiul Galați. Din data de 6.1.2020, în Galați circulă patru trasee de troleibuz, un traseu de tramvai și 30 de trasee de autobuz, datorită lucrărilor de reabilitare a rețelei de tramvai."},{"page_url":"https://es.wikipedia.org/wiki/Juan_de_la_Pole,_II_duque_de_Suffolk","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Iffley_StMary_DeLaPole.jpg","page_title":"Juan de la Pole, II duque de Suffolk","context_page_description":"John de la Pole, II Duque de Suffolk, KG fue un importante magnate en la Inglaterra del siglo XV. Era hijo de William de la Pole, Duque de Suffolk, y Alice Chaucer, hija de Thomas Chaucer. Su juventud se vio truncada, en 1450, por la caída política y muerte subsiguiente de su padre, que había sido un favorito del rey, Enrique VI, pero del que la nobleza recelaba cada vez más. Pese a que el primer duque de Suffolk se había hecho rico a través del comercio y –particularmente- de las concesiones reales, esta fuente de ingresos se secó tras su muerte, así que a su ascensión en 1463 John de la Pole figuraba entre los duques ingleses más pobres. Dicha circunstancia afectaba profundamente a John, quien en más de una ocasión rechazó venir a Londres porque su pobreza era tal que no podía afrontar los costes de mantener un séquito.\\nEn su juventud, John de la Pole se casó dos veces; su primer matrimonio fue anulado, pero su segundo matrimonio, con Elizabeth de York, le hizo cuñado de dos reyes, Eduardo IV y Ricardo III. Tuvieron once niños, del que John, el mayor, sería finalmente nombrado heredero de Ricardo III en 1484 y moriría luchando por la causa yorkista."},{"page_url":"https://es.wikipedia.org/wiki/Llan%C3%A1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Escut_de_Llanars.svg","page_title":"Llanás","context_page_description":"Llanás​​ es un municipio de la comarca catalana del Ripollés, provincia de Gerona, España. Está situado en el Valle de Camprodon."},{"page_url":"https://eu.wikipedia.org/wiki/Barbus_callipterus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Barbus_callipterus.jpg","page_title":"Barbus callipterus","context_page_description":"Barbus callipterus Barbus generoko animalia da. Arrainen barruko Actinopterygii klasean sailkatzen da, Cyprinidae familian."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%BF%E0%AE%B0%E0%AE%BE%E0%AE%99%E0%AF%8D%E0%AE%95%E0%AE%BF%E0%AE%B3%E0%AE%BF%E0%AE%A9%E0%AF%8D_%E0%AE%AE%E0%AE%A3%E0%AE%BF%E0%AE%95%E0%AE%B3%E0%AF%8D","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/20/Franklinbells.jpg","page_title":"பிராங்கிளின் மணிகள்","context_page_description":"பிராங்கிளின் மணிகள் ஆரம்ப காலங்களில் மின்னூட்டத்தை செயல் விளக்கம் செய்துகாட்ட லேய்டின் கொள்கலனுடன் இணைத்து பயன்படுத்தப்பட்டது.\\nபிராங்ளின் மணிகள் மின்னூட்டத்தை செயல் விளக்கம் செய்துகாட்டவே பயன்பட்டதேயன்றி, எந்தவித ஆராய்ச்சிக்கும் உதவவில்லை. இக் கருவி மின்னாற்றலை தொடர்ந்து இயக்க ஆற்றலாக மாற்ற உதவியது. இரண்டு எதிரெதிர் மின்னூட்டம் பெற்ற மணிகளுக்கிடையே மணியின் நா ஒன்று முன்னும் பின்னும் அசைந்து ஒலி எழுப்புகிறது."},{"page_url":"https://en.wikipedia.org/wiki/St_Michael%27s_Preparatory_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/St_Michael%27s_Preparatory_School%2C_Jersey.JPG","page_title":"St Michael's Preparatory School","context_page_description":"St Michael's Preparatory School is the largest private preparatory school in Jersey, situated in the parish of St. Saviour. The school acts as a feeder to many British public schools in the United Kingdom. It has a strong academic record, and is also noted for strength in music and sport. St Michaels recently changed its headmaster.\\nThe school celebrated its 60th anniversary in 2008. It has a Pre-prep department, and a senior school which goes up to age 13. The vast majority of pupils are prepared to take the Common Entrance Examination at 13, although some choose to go to secondary school in Jersey."},{"page_url":"https://fy.wikipedia.org/wiki/Fokker_C.I","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Fokker_C-III_%285380765260%29.jpg","page_title":"Fokker C.I","context_page_description":"De Fokker C.I wie in Dútsk ferkenningsfleantúch, in twadekker dy't oan de ein fan de Earste Wrâldkriich ûntwurpen waard. It wie feitlik in fergrutte Fokker D.VII-jager mei in 138 kW BMW III-motor. De C.I waard ûntwurpen foar it Dútske leger, mar waard net ynset yn de oarloch. It slagge Anthony Fokker en smokkelje ûnderdielen út Dútslân wei nei Nederlân yn de tiid fan de wapenstilstân."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%84%D5%B8%D6%80%D5%A1%D5%BE%D5%B6%D5%A5%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Hanacky-kroj-part.jpg","page_title":"Մորավներ","context_page_description":"Մորավներ, հարավսլավոնական ժողովուրդ, որ ապրում է Մորավիայում ։ Գիրը լատինական այբուբենի հիմքի վրա է։ Անվանումը հավանաբար ծագել է Դանուբի վերին վտակ Մորավայի անունից։ Կենտրոնը Օլոմոուց քաղաքն է։ Չեխական պաշտոնական պատմագրությունը մորավներին համարում է էթնիկ չեխեր, սակայն մորավներն ունեն իրենց ազգային ինքնագիտակցությունը։"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A0%D0%B0%D0%B7%D0%BE%D1%80%D1%83%D0%B6%D0%B5%D0%BD%D0%B8%D0%B5_%D0%BF%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%B8%D1%85_%D0%BA%D0%BE%D1%80%D0%BF%D1%83%D1%81%D0%BE%D0%B2_%D0%BD%D0%B0_%D0%A3%D0%BA%D1%80%D0%B0%D0%B8%D0%BD%D0%B5_(1918)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4d/Kani%C3%B3w_1918.PNG","page_title":"Разоружение польских корпусов на Украине (1918)","context_page_description":"Разоружение польских корпусов на Украине — процесс, происходивший на Украине с апреля по май 1918 года согласно решению правительства Украинской Народной Республики при поддержке войск Германии и Австро-Венгрии, сопровождался боевыми действиями."},{"page_url":"https://pl.wikipedia.org/wiki/Tramwaje_w_Halle","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/2011-06_Halle_29.jpg","page_title":"Tramwaje w Halle","context_page_description":"Tramwaje w Halle − system komunikacji tramwajowej działający w niemieckim Halle."},{"page_url":"https://nl.wikipedia.org/wiki/Hauterive_(Neuch%C3%A2tel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Karte_Gemeinde_Hauterive_NE.png","page_title":"Hauterive (Neuchâtel)","context_page_description":"Hauterive is een gemeente en plaats in het Zwitserse kanton Neuchâtel, en maakt deel uit van het district Neuchâtel. Hauterive telt 2516 inwoners. In Hauterive bevindt zich het Laténium, een groot archeologisch park en museum."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B6%E3%83%90%E3%83%BC%E3%83%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/The_Barb.jpg","page_title":"ザバーブ","context_page_description":"ザバーブとは1866年のメルボルンカップに勝った有名なオーストラリアのサラブレッド競走馬である。"},{"page_url":"https://pl.wikipedia.org/wiki/Stedham","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b1/Stedham3.JPG","page_title":"Stedham","context_page_description":"Stedham – wieś w Anglii, w hrabstwie West Sussex, w dystrykcie Chichester. Leży 18 km na północ od miasta Chichester i 73 km na południowy zachód od Londynu."},{"page_url":"https://he.wikipedia.org/wiki/SARS-CoV-2","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Novel_Coronavirus_SARS-CoV-2_%2849597020718%29.jpg","page_title":"SARS-CoV-2","context_page_description":"SARS-CoV-2, הוא זן של נגיף RNA חד-גדילי חיובי מתת-משפחת נגיפי קורונה.\\nהנגיף מידבק באדם ועשוי לגרום למחלה נשימתית, מחלת נגיף קורונה 2019.\\nהנגיף, שתועד לראשונה בסין בדצמבר 2019, התפשט במהירות ברחבי העולם וחולל את מגפת הקורונה העולמית."},{"page_url":"https://it.wikipedia.org/wiki/Crawford_(Texas)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/TXMap-doton-Crawford.PNG","page_title":"Crawford (Texas)","context_page_description":"Crawford è un centro abitato degli Stati Uniti d'America situato nella contea di McLennan dello Stato del Texas.\\nLa popolazione era di 717 persone al censimento del 2010. Fa parte dell'area metropolitana di Waco.\\nÈ conosciuta per essere il luogo in cui vive l'ex presidente degli Stati Uniti George W. Bush. Dopo la fine del periodo presidenziale, Bush si è trasferito al Prairie Chapel Ranch che si trova appena fuori Crawford."},{"page_url":"https://bs.wikipedia.org/wiki/NGC_214","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/NGC214_-_SDSS_DR14.jpg","page_title":"NGC 214","context_page_description":"NGC 214 je prečkasta spiralna galaksija koja je udaljena oko 208 miliona sg od Zemlje i nalazi se u sazviježđu Andromeda. Najveći prečnik je 1,90 a najmanji 1,5 uglovnih minuta. Prvo otkriće je napravio John Frederick William Herschel 10. septembra 1784. godine."},{"page_url":"https://es.wikipedia.org/wiki/Performance","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Le_pavillon_de_la_Roumanie_%2855%C3%A8me_Biennale_de_Venise%29_%2810168263944%29.jpg","page_title":"Performance","context_page_description":"Una performance es una obra de arte o muestra artística creada a través de acciones realizadas por el artista u otros participantes, pudiendo ser en vivo, documentadas, espontáneas o escritas, presentada a un público dentro de un contexto de bellas artes, tradicionalmente interdisciplinario.​ La performance, también conocida como acción artística, se ha desarrollado a lo largo de los años como un género propio en el que el arte se presenta en vivo, teniendo un papel importante y fundamental en el arte de vanguardia a lo largo del siglo XX.​​\\nInvolucra cuatro elementos básicos: el tiempo, el espacio, el cuerpo o la presencia del artista en un medio, y la relación entre el creador y el público. Las acciones, generalmente desarrolladas en galerías de arte y museos, pueden tener lugar en la calle, cualquier tipo de escenario o espacio y durante cualquier período de tiempo.​ Su objetivo es generar una reacción, en ocasiones con la ayuda de la improvisación y el sentido de la estética. La temática suele estar ligada a procesos vitales del propio artista, a la necesidad de denuncia o crítica social y con un espíritu de transformación.​"},{"page_url":"https://de.wikipedia.org/wiki/7,5-cm-KwK_37","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/PzKpfwIVD.Aberdeen.000a0gpe.jpeg","page_title":"7,5-cm-KwK 37","context_page_description":"Die 7,5-cm-KwK 37 und 7,5 cm K 51 waren Kampfwagenkanonen mit einer Kaliberlänge von L/24 die als Hauptbewaffnung/Turmkanone vornehmlich in frühen Ausführungen des Panzers IV, Sturmgeschützes III sowie in weiteren Sonderkraftfahrzeugen im Zweiten Weltkrieg zum Einsatz gebracht wurden.\\nDie Waffe war zur unmittelbaren Unterstützung der Infanterie und Panzergrenadiere konzipiert, wofür das kurze Kanonenrohr und die verfügbaren Splitter/Spreng-Granaten ausreichend waren. Die Panzerkanone erwies sich jedoch auch effizient gegen Kampfpanzer zu Kriegsbeginn. Bereits Anfang 1942 kamen verbesserte Panzer IV und Sturmgeschütze III mit der kampfwertgesteigerten 7,5-cm-KwK 40 an die Front. Die ältere kurzrohrige L/24-Version wurde zur Kampfwertsteigerung unter anderem für den Panzer III und diverse Schützenpanzerwagen verwendet."},{"page_url":"https://es.wikipedia.org/wiki/Adam_McGurk","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Adam_McGurk_2013_IJA_01.png","page_title":"Adam McGurk","context_page_description":"Adam McGurk, futbolista norirlandés. Juega de delantero y su actual equipo es el Tranmere Rovers de Inglaterra."},{"page_url":"https://fr.wikipedia.org/wiki/Biblioth%C3%A8que_municipale_de_Novi_Sad","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Kuca_u_Dunavskoj_ulici_br_1_u_Novom_Sadu.jpg","page_title":"Bibliothèque municipale de Novi Sad","context_page_description":"La bibliothèque municipale de Novi Sad est une bibliothèque publique située à Novi Sad, la capitale de la province autonome de Voïvodine, en Serbie. Elle a été créée le 23 septembre 1845 sous le nom de « Salle de lecture serbe de Novi Sad » et est actuellement dirigée par Dragan Kojić. En raison de sa valeur patrimoniale, le bâtiment dans lequel est installée la bibliothèque centrale est inscrit sur la liste des monuments culturels protégés de la République de Serbie."},{"page_url":"https://pa.wikipedia.org/wiki/30_%E0%A8%A8%E0%A8%B5%E0%A9%B0%E0%A8%AC%E0%A8%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/J.C.Bose.JPG","page_title":"30 ਨਵੰਬਰ","context_page_description":"30 ਨਵੰਬਰ ਗ੍ਰੈਗਰੀ ਕਲੰਡਰ ਦੇ ਮੁਤਾਬਕ ਇਹ ਸਾਲ ਦਾ 334ਵਾਂ ਦਿਨ ਹੁੰਦਾ ਹੈ। ਇਸ ਦਿਨ ਤੋਂ ਸਾਲ ਦੇ 31 ਦਿਨ ਬਾਕੀ ਹਨ। ਦੇਸੀ ਕਲੰਡਰ ਮੁਤਾਬਕ ਇਹ ਦਿਨ 16 ਮੱਘਰ ਬਣਦਾ ਹੈ।"},{"page_url":"https://es.wikipedia.org/wiki/Estrella_de_Puebla","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Fuente_Ecofenix_de_d%C3%ADa.jpg","page_title":"Estrella de Puebla","context_page_description":"La Estrella de Puebla es una noria turística ubicada en la ciudad de Puebla de Zaragoza, en Puebla, México. Fue inaugurada el 22 de julio de 2013 por el gobernador Rafael Moreno Valle Rosas.​ La rueda recibió la acreditación del récord Guinness como la rueda de observación portátil más grande del mundo, con un diámetro de 69.8 metros y una altura de 80 metros.\\nLa Estrella de Puebla forma parte de un complejo en la zona que incluye al Parque Lineal, el Jardín del Arte, el Ecoparque Metropolitano, el Paseo del Río Atoyac, así como el Museo Internacional del Barroco.​\\nEl gobernador Miguel Barbosa Huerta de Morena mencionó que no descarta retirar la Estrella de Puebla por ser la “insignia morenovallista del derroche”. Sin embargo, según medios locales se ha demostrado que es autosustentable económicamente"},{"page_url":"https://de.wikipedia.org/wiki/Abteikirche_Saint-Gilles","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Abteikirche_St-Gilles_Rekonstruktion_Fassade.JPG","page_title":"Abteikirche Saint-Gilles","context_page_description":"Die ehemalige Abteikirche Saint-Gilles liegt inmitten der gleichnamigen Ortschaft St-Gilles am nördlichen Rand der Camargue im Département Gard, Frankreich. Sie trägt auch die Bezeichnung Abteikirche St. Ägidius in Saint-Gilles oder Abteikirche des Hl. Ägidius in Saint-Gilles.\\nBekannt ist die ehemalige Abteikirche besonders durch ihre reich und kunstvoll gestaltete Fassade mit drei Portalen. Weitere Sehenswürdigkeiten sind die steinerne Spindeltreppe Vis de St-Gilles und die Krypta, mit dem Grab ihres Patrons, des heiligen Ägidius.\\nSt-Gilles gehörte einst zu den vier großen Wallfahrtszielen der Christenheit. Bis heute bildet sie eine bedeutende Etappe auf der Via Tolosana, einem der vier französischen Hauptabschnitte des Jakobswegs nach Santiago de Compostela.\\nSeit 1998 ist die Kirche als zum Jakobsweg in Frankreich gehörig ausgezeichnet und damit UNESCO-Welterbe."},{"page_url":"https://de.wikipedia.org/wiki/Grenzbefestigungen_der_Schweiz","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/Festungsmuseum_Furggels_2010.JPG","page_title":"Grenzbefestigungen der Schweiz","context_page_description":"Die Grenzbefestigungen der Schweiz waren militärische Verteidigungslinien der Schweizer Armee zur Wahrung der Unabhängigkeit im Sinne der bewaffneten Neutralität und des Haager Neutralitätsabkommens. Angesichts der rasanten Weiterentwicklung der Kriegstechnik beschloss die Schweizer Regierung, die Grenzfestigungen während des Zweiten Weltkriegs mit gestaffelten Verteidigungslinien und dem Reduit zu ergänzen bzw. zu verstärken."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Saturnin_(Puy-de-D%C3%B4me)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Saint-Saturnin_%2863%29_Village.jpg","page_title":"Saint-Saturnin (Puy-de-Dôme)","context_page_description":"Saint-Saturnin est une commune française, située dans le département du Puy-de-Dôme, en région d'Auvergne-Rhône-Alpes. Elle fait partie de l'aire urbaine de Clermont-Ferrand."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Br%C3%BChl_(Rheinland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Br%C3%BChl-Schwadorf_Alte_Schule.JPG","page_title":"Liste der Baudenkmäler in Brühl (Rheinland)","context_page_description":"Die Liste der Baudenkmäler in Brühl (Rheinland) enthält die denkmalgeschützten Bauwerke auf dem Gebiet der Stadt Brühl im Rhein-Erft-Kreis in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Brühl eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://en.wikipedia.org/wiki/Bitsa_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Bitsevsky-park.jpg","page_title":"Bitsa Park","context_page_description":"Bitsevski Park is one of the largest natural parks in Moscow, Russia. The park, traversed by the Chertanovka River and the Bitsa River, sprawls for some 10 km from north to south and covers the area of 18 square kilometres. The park is elongated from the north to the south and is bounded by Balaklavsky Avenue from the north."},{"page_url":"https://vi.wikipedia.org/wiki/Tremosine","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2a/Tremosine-Villa%26Vesio.jpg","page_title":"Tremosine","context_page_description":"Tremosine là một đô thị thuộc tỉnh Brescia trong vùng Lombardia ở Ý. Đô thị này có diện tích 72 km², dân số 1922 người.\\nĐô thị này có các làng sau: Arias, Bazzanega, Cadignano, Campione, Castone, Mezzema, Musio, Pieve, Pregasio, Priezzo, Secastello, Sermerio, Sompriezzo, Ustecchio, Vesio, Villa, Voiandes, Voltino.\\nĐô thị này giáp với các đô thị sau: Brenzone, Limone sul Garda, Magasa, Malcesine, Molina di Ledro, Tiarno di Sopra, Tignale."},{"page_url":"https://mk.wikipedia.org/wiki/Rolls-Royce_Phantom_(2003)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Rolls_Royce_Phantom_interior.jpg","page_title":"Rolls-Royce Phantom (2003)","context_page_description":"Ролс-Ројс Фантом Предлошка:Lang-xx — ултралуксузен автомобил од Rolls-Royce, подружница на БМВ, во Велика Британија. Пуштен е во продажба во 2003 г. и е првиот модел на Ролс-Ројс во сопственост на БМВ."},{"page_url":"https://en.wikipedia.org/wiki/Ramanathapuram_district","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Ervadidargah.jpg","page_title":"Ramanathapuram district","context_page_description":"Ramanathapuram District is one of the 38 districts an administrative district) of Tamil Nadu state in southern India. The town of Ramanathapuram is the district headquarters. Ramanthapuram District has an area of 4123 km². It is bounded on the north by Sivaganga District, on the northeast by Pudukkottai District, on the east by the Palk Strait, on the south by the Gulf of Mannar, on the west by Thoothukudi District, and on the northwest by Virudhunagar District. The district contains the Pamban Bridge, an east-west chain of low islands and shallow reefs that extend between India and the island nation of Sri Lanka, and separate the Palk Strait from the Gulf of Mannar. The Palk Strait is navigable only by shallow-draft vessels. As of 2011, Ramanathapuram district had a population of 1,353,445 with a sex-ratio of 983 females for every 1,000 males."},{"page_url":"https://it.wikipedia.org/wiki/Smilovice_(Mlad%C3%A1_Boleslav)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Smilovice%2C_west_view.jpg","page_title":"Smilovice (Mladá Boleslav)","context_page_description":"Smilovice è un comune della Repubblica Ceca facente parte del distretto di Mladá Boleslav, in Boemia Centrale."},{"page_url":"https://pl.wikipedia.org/wiki/Awionetka","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Cessna.fa152.aerobat.oo-lvj.arp.jpg","page_title":"Awionetka","context_page_description":"Awionetka – potoczne, przez purystów uznane za niefachowe, określenie małego samolotu turystycznego, sportowego lub dyspozycyjnego, stosowane obecnie na ogół przez ludzi niezwiązanych z lotnictwem, spotykane zwłaszcza w mediach. Przed II wojną światową było używane bardziej oficjalnie i powszechnie, obecnie jest już rzadsze. Termin awionetka nie ma dokładnie sprecyzowanego zakresu - nazywane są tak głównie małe 2-4 miejscowe, jednosilnikowe, rzadziej dwusilnikowe samoloty, napędzane silnikami tłokowymi o małej lub średniej mocy. Małe samoloty, odpowiadające temu określeniu, są oficjalnie klasyfikowane przez polskie prawo jako samoloty lekkie, samoloty bardzo lekkie lub samoloty ultralekkie. Jednakże, termin awionetka najczęściej jest stosowany do samolotów bardzo lekkich i lekkich o masie startowej nie przekraczającej ok. 1000 kg, rzadziej do samolotów ultralekkich, natomiast w zasadzie nie jest stosowany do większych samolotów lekkich, o masie startowej przekraczającej ok. 2300 kg.\\nSamoloty te są wykorzystywane do szkolenia, latania rekreacyjnego lub turystycznego, świadczenia usług taksówki powietrznej, czy holu szybowców. Są to maszyny o masie samolotu poniżej 5700 kg."},{"page_url":"https://de.wikipedia.org/wiki/Europastra%C3%9Fe_41","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f2/E41_route.jpg","page_title":"Europastraße 41","context_page_description":"Die Europastraße 41 ist eine 788 km lange Europastraße, die sich von Nordwesten nach Südosten durch Deutschland und die Schweiz erstreckt."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_Sydkoreas_premi%C3%A4rministrar","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Yun_Bo-seon.jpg","page_title":"Lista över Sydkoreas premiärministrar","context_page_description":"Sydkoreas premiärminister är landets regeringschef, och presidentens första ställföreträdare. Ämbetet inrättade vid nationens grundande 1948, men titeln premiärminister fanns även i Kejsardömet Korea och periodvis i Joseondynastins Korea.\\nPremiärministern utses av presidenten. Nuvarande premiärminister är Lee Wan-koo."},{"page_url":"https://en.wikipedia.org/wiki/1946_St._Louis_Cardinals_season","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/1946_St._Louis_Cardinals.png","page_title":"1946 St. Louis Cardinals season","context_page_description":"The 1946 St. Louis Cardinals season was a season in American baseball. It was the team's 65th season in St. Louis, Missouri and the 55th season in the National League. The Cardinals went 96–58 during the championship season and finished tied with the Brooklyn Dodgers for first in the National League. St. Louis then won a best-of-three playoff for the pennant, 2 games to none. In the World Series, they won in 7 games over the Boston Red Sox. They won on Enos Slaughter's \\"mad dash\\" that gave them a 4–3 lead in the 8th inning of game 7."},{"page_url":"https://no.wikipedia.org/wiki/S%C3%B8r-Afrika","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Garden_Route%2C_Eastern_Cape%2C_South_Africa_%2820324139450%29.jpg","page_title":"Sør-Afrika","context_page_description":"Republikken Sør-Afrika er et land i det sørlige Afrika som grenser til Botswana, Lesotho, Mosambik, Namibia, Eswatini og Zimbabwe. Teknologisk og økonomisk er landet et av de mest utviklede i Afrika, og politisk et av de mest innflytelsesrike.\\nSør-Afrika er kjent for store innbyrdes motsetninger, både innen natur, økonomi, politikk og i forhold mellom folkegrupper. Mest kom motsetningene til syne i apartheid, som var det hvite mindretallstyrets offisielle rasepolitikk gjennom nesten femti år, hvor det hvite mindretallet undertrykket det svarte flertallet. Samtidig er Sør-Afrika kjent for å løse disse problemene. Nelson Mandelas pragmatiske holdning bidro til å avslutte apartheid på en fredelig måte.\\nLandet arrangerte verdensmesterskapet i fotball 2010."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Stra%C3%9Fen_und_Pl%C3%A4tze_in_Berlin-Grunewald","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b6/GrunewaldSchwedlerStra%C3%9Fe.JPG","page_title":"Liste der Straßen und Plätze in Berlin-Grunewald","context_page_description":"Die Liste der Straßen und Plätze in Berlin-Grunewald beschreibt das Straßensystem im Berliner Ortsteil Grunewald mit den entsprechenden historischen Bezügen. Gleichzeitig ist diese Zusammenstellung ein Teil der Listen aller Berliner Straßen und Plätze."},{"page_url":"https://de.wikipedia.org/wiki/T%C3%BCrkheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/T%C3%BCrkheim_R%C3%B6ssle.JPG","page_title":"Türkheim","context_page_description":"Türkheim ist ein Markt im schwäbischen Landkreis Unterallgäu und der Sitz der Verwaltungsgemeinschaft Türkheim. Mit 7329 Einwohnern ist es die viertgrößte Gemeinde im Landkreis Unterallgäu. An der Südspitze des Naturparks Augsburg-Westliche Wälder gelegen, markiert Türkheim die landschaftliche Grenze von Augsburg-Schwaben zu Mittelschwaben."},{"page_url":"https://et.wikipedia.org/wiki/Noblessneri_laevatehas","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Noblessner.jpg","page_title":"Noblessneri laevatehas","context_page_description":"Noblessneri laevatehas omaaegse nimega \\"Noblessneri\\" Aktsia Seltsi Laevatehas Tallinnas oli 1913. aastal Tallinnas Kalamajas Tööstuse tänava ja mere vahelisel alal asutatud tööstusettevõte, mille põhitegevus oli allveelaevade ehitus ja hooldus.\\nAja jooksul on laevaehitustehas kandnud ka nimesid AS Peetri Laevaehitustehas, Peetri tehas, Sõjalaevastiku tehas nr 7, 7. tehas, Meretehas nr 7 ja pärast Eesti iseseisvuse taastamist Tallinna Meretehas."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Munchhausen_(Bas-Rhin)","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f3/Map_commune_FR_insee_code_67308.png","page_title":"Munchhausen (Bas-Rhin)","context_page_description":"Munchhausen sī ūi-tī Hoat-kok Alsace toā-khu Bas-Rhin koān ê chi̍t ê commune."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%AC%E0%A5%8D%E0%A4%B0%E0%A4%B9%E0%A5%8D%E0%A4%AE%E0%A4%BE_%E0%A4%AE%E0%A4%A8%E0%A5%8D%E0%A4%A6%E0%A4%BF%E0%A4%B0,_%E0%A4%AA%E0%A5%81%E0%A4%B7%E0%A5%8D%E0%A4%95%E0%A4%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Brahma_Temple%2C_Pushkar.jpg","page_title":"ब्रह्मा मन्दिर, पुष्कर","context_page_description":"ब्रह्मा मन्दिर एक भारतीय हिन्दू मन्दिर है जो भारत के राजस्थान राज्य के अजमेर ज़िले में पवित्र स्थल पुष्कर में स्थित है। इस मन्दिर में जगत पिता ब्रह्माजी की मूर्ति स्थापित है।\\nइस मन्दिर का निर्माण लगभग १४वीं शताब्दी में हुआ था जो कि लगभग ७०० वर्ष पुराना है।\\nयह मन्दिर मुख्य रूप से संगमरमर के पत्थरों से निर्मित है।कार्तिक पूर्णिमा त्योहार के दौरान यहां मन्दिर में हज़ारों की संख्या में भक्तजन आते रहते हैं।"},{"page_url":"https://en.wikipedia.org/wiki/Velizhsky_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/Velizh-centre.JPG","page_title":"Velizhsky District","context_page_description":"Velizhsky District is an administrative and municipal district, one of the twenty-five in Smolensk Oblast, Russia. It is located in the northwest of the oblast and borders with Vitebsk District, Vitebsk Region of Belarus in the west, Usvyatsky and Kunyinsky Districts of Pskov Oblast in the northwest, Zapadnodvinsky and Zharkovsky Districts of Tver Oblast in the northeast, Demidovsky District in the east, and with Rudnyansky District in the south. The area of the district is 1,473.19 square kilometers. Its administrative center is the town of Velizh. Population: 12,248; 14,329; 17,239. The population of Velizh accounts for 62.2% of the district's total population."},{"page_url":"https://da.wikipedia.org/wiki/Elis_(Gr%C3%A6kenland)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3f/Olympie_Temple_Zeus.JPG","page_title":"Elis (Grækenland)","context_page_description":"Elis var hovedstaden i antikke landskab en by der tidligere var en provins i det sydlige Grækenland i den nordvestlige del af halvøen Peloponnes. Provinsen er især kendt for Olympia, hvor de Olympiske Lege i det antikke Grækenland blev afholdt. Elis blev i 2006 en by fra at være en provins."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%8E%98%EB%84%A5%EC%97%AC%EC%9A%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Dogs%2C_jackals%2C_wolves%2C_and_foxes_%28Plate_XLI%29.jpg","page_title":"페넥여우","context_page_description":"페넥여우 또는 사막여우는 북부 아프리카에 서식하는 여우속의 한 종이다."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D1%96%D0%B2%D0%BA%D0%B0_(%D0%A5%D0%BC%D0%B5%D0%BB%D1%8C%D0%BD%D0%B8%D1%86%D1%8C%D0%BA%D0%B8%D0%B9_%D1%80%D0%B0%D0%B9%D0%BE%D0%BD)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/%D0%9F%D0%B0%D0%BC%27%D1%8F%D1%82%D0%BD%D0%B8%D0%B9_%D0%B7%D0%BD%D0%B0%D0%BA_%D0%BD%D0%B0_%D1%87%D0%B5%D1%81%D1%82%D1%8C_%D0%B2%D0%BE%D1%97%D0%BD%D1%96%D0%B2-%D0%BE%D0%B4%D0%BD%D0%BE%D1%81%D0%B5%D0%BB%D1%8C%D1%86%D1%96%D0%B2%2C_%D1%81%D0%B5%D0%BB%D0%BE_%D0%9A%D0%B0%D1%82%D0%B5%D1%80%D0%B8%D0%BD%D1%96%D0%B2%D0%BA%D0%B0.jpg","page_title":"Катеринівка (Хмельницький район)","context_page_description":"Катери́нівка — село в Україні, у Чорноострівській селищній територіальній громаді Хмельницького району Хмельницької області. Населення становить 344 особи. Через село проходить Дуга Струве."},{"page_url":"https://de.wikipedia.org/wiki/Grach_(Weingutsbesitzer)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Franz_Wei%C3%9Febach.jpg","page_title":"Grach (Weingutsbesitzer)","context_page_description":"Grach ist der Name einer Trierer Familie, deren mit Emmerich Grach beginnender Hauptast seit dem Anfang des 19. Jahrhunderts eine Anzahl namhafter Weingüter im Weinbaugebiet Mosel-Saar-Ruwer besessen und im großen Stil Weinhandel über Saar, Mosel und Rhein betrieben hat. Die Familie gehört zu den Begründern der Mosel-Dampfschiffahrts-Gesellschaft. Der hier behandelte Ast der Familie ist ausgestorben. Einige der Weingüter befinden sich bis heute in den Händen der Nachfahren, darunter das Weingut von Othegraven und der Wawerner Herrenberg im Besitz von Günther Jauch."},{"page_url":"https://fr.wikipedia.org/wiki/God%C3%A9tch","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/Godech-Bridge-over-Nishava-River.jpg","page_title":"Godétch","context_page_description":"Godétch est une ville de l'ouest de la Bulgarie."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Br%C3%BCcken_%C3%BCber_die_Alte_Lorze","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Durchlass_Langacher_Alte_Lorze_Baar_ZG_20190323-jag9889.jpg","page_title":"Liste der Brücken über die Alte Lorze","context_page_description":"Die Liste der Brücken über die Alte Lorze enthält die Brücken und Bachdurchlässe vom Autobahnanschluss westlich von Baar bis zur Mündung in den Zugersee beim Naturschutzgebiet Choller in der Stadt Zug.\\n14 Überführungen überspannen den Fluss: Sieben Fussgängerstege, vier Strassenbrücken, zwei Feldwegbrücken und eine Eisenbahnbrücke."},{"page_url":"https://he.wikipedia.org/wiki/%D7%90%D7%97%D7%9E%D7%93_%D7%A9%D7%95%D7%A7%D7%99%D7%99%D7%A8%D7%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Istiqlal.jpg","page_title":"אחמד שוקיירי","context_page_description":"אחמד שוקיירי היה ממייסדי מפלגת אל-איסתקלאל, חבר הוועד הערבי העליון, יושב הראש הראשון של אש\\"ף, ומחבר האמנה הפלסטינית. היה ידוע כתועמלן קיצוני של העניין הפלסטיני."},{"page_url":"https://no.wikipedia.org/wiki/Tommaso_Pasquale_Gizzi","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/ae/Pasquale_Gizzi.jpg","page_title":"Tommaso Pasquale Gizzi","context_page_description":"Tommaso Pasquale Gizzi var en av den katolske kirkes kardinaler. Han var tilknyttet det pavelige diplomati og Den romerske kurie, og var blant annet nuntius i Sveits og på Sardinia, og senere Statssekretær fra 1846.\\nHan ble utnevnt in pectore til kardinal i juni 1841 av pave Gregor XVI, og utnevnelsen ble offentliggjort i 1844.\\nHan deltok ved konklavet 1846 som valgte pave Pius IX."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Rastrick","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Rastrick_Library_-_geograph.org.uk_-_77189.jpg","page_title":"Listed buildings in Rastrick","context_page_description":"Rastrick is a village and an unparished area in the metropolitan borough of Calderdale, West Yorkshire, England. Rastrick Ward contains 30 listed buildings that are recorded in the National Heritage List for England. Of these, two are listed at Grade II*, the middle of the three grades, and the others are at Grade II, the lowest grade. The listed buildings include houses and associated structures including lodges, cottages, a farmhouse, a church and a cross base in the churchyard, a lock on the Calder and Hebble Navigation, a guide post and two milestones, a carved stone set into a wall, a library, and a war memorial."},{"page_url":"https://it.wikipedia.org/wiki/Melittis_melissophyllum","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Melittis_melissophyllum_Sturm_DESC.JPG","page_title":"Melittis melissophyllum","context_page_description":"L'Erba limona comune è una piccola pianta erbacea perenne dai graziosi fiori labiati appartenente alla famiglia delle Lamiaceae."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D1%81%D1%8F%D0%B7%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9_%D0%B8%D0%BD%D1%82%D0%B5%D1%80%D1%84%D0%B5%D0%B9%D1%81_%D0%BF%D0%BE%D0%BB%D1%8C%D0%B7%D0%BE%D0%B2%D0%B0%D1%82%D0%B5%D0%BB%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/SandScape.jpg","page_title":"Осязательный интерфейс пользователя","context_page_description":"Осяза́тельный интерфе́йс по́льзователя — это разновидность интерфейса пользователя, в котором взаимодействие человека с электронными устройствами происходит при помощи материальных предметов и конструкций.\\nПрофессор Хироси Исии из Массачусетского технологического института — один из первопроходцев осязательных интерфейсов пользователя и глава группы разработчиков осязательных систем. Его особое видение ОИП, т. н. материальные биты — попытка придать цифровой информации физическое обличье, делая биты осязаемыми и потому доступными напрямую. При этом преследуется цель неразрывно связать такие разные сущности, как миры битов и атомов."},{"page_url":"https://sk.wikipedia.org/wiki/Andolsheim","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/db/Map_commune_FR_insee_code_68007.png","page_title":"Andolsheim","context_page_description":"Andolsheim je francúzska obec, ktorá sa nachádza v departemente Haut-Rhin, v regióne Alsasko."},{"page_url":"https://en.wikipedia.org/wiki/Burnham_Martin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Burnham_Martin_2.jpg","page_title":"Burnham Martin","context_page_description":"Burnham Martin was a Vermont lawyer, farmer and politician who served as Lieutenant Governor for two years."},{"page_url":"https://en.wikipedia.org/wiki/Dymchurch","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Dymchurch_beach_looking_towards_Hythe.jpg","page_title":"Dymchurch","context_page_description":"Dymchurch is a village and civil parish in the Folkestone and Hythe district of Kent, England. The village is located on the coast five miles south-west of Hythe, and on the Romney Marsh."},{"page_url":"https://hu.wikipedia.org/wiki/Kair%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/View_over_Cairo_from_Citadel.jpg","page_title":"Kairó","context_page_description":"Kairó az Egyiptomi Arab Köztársaság fővárosa. Elsőszámú politikai, gazdasági és kulturális központja az országnak, az arab világnak és az egész Közel-Keletnek, emellett az egész iszlám egyik legfontosabb kulturális csomópontja is. Itt ülésezik az Egyiptomi Népgyűlés és a kormány, itt található minden állami és vallási központi hivatal és számos diplomáciai képviselet, illetve az Arab Liga székhelye. Míg a város hivatalos neve al-Káhirah, a köznyelvben általában csak az ország nevével illetik, amit a helyi nyelvjárásban „maszr”-nak ejtenek.\\nIgazi megapolisz: területe hatalmas, több mint 3000 négyzetkilométer, népessége több mint 20 millió fő, ezzel Afrika és a tágabb értelemben vett Közel-Kelet legnépesebb városa, a nigériai Lagos régiója mellett Afrika legnagyobb agglomerációja.\\nA Nílus folyó két partján és szigetein fekszik, Egyiptom északi részén, délre attól a ponttól, ahol a folyó kilép sivatagi völgyéből és három részre ágazik, a hatalmas Nílus-deltát kialakítva. A várost kormányzó irányítja, akit közvetlenül az elnök nevez ki erre a posztra."},{"page_url":"https://ca.wikipedia.org/wiki/Serra_de_Rubi%C3%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Serra_de_Rubi%C3%B3_nevada.JPG","page_title":"Serra de Rubió","context_page_description":"La serra de Rubió és una serralada calcària situada al municipi de Rubió i d'Òdena, a la comarca de l'Anoia i al municipi de Castellfollit del Boix a la comarca del Bages, tots tres pertanyent a la comarca natural de l'Alta Segarra. Forma part de la unitat morfoestructural de la Depressió Central.\\nEl punt més elevat de la serra es troba a 846 metres d'altura, però la muntanya més destacada és la Còpia de Palomes, de 837 metres. A la serra hi ha un refugi de mitja muntanya, el refugi Mas del Tronc.\\nEl Parc Eòlic de Rubió està situat a la serra, a la zona nord-oest."},{"page_url":"https://en.wikipedia.org/wiki/New_Bullards_Bar_Dam","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Bullards_Bar_Dam_-_face.jpg","page_title":"New Bullards Bar Dam","context_page_description":"New Bullards Bar Dam is a variable radius concrete arch dam constructed in the early 1960s in California on the North Yuba River. Located near the town of Dobbins in Yuba County, the dam forms the New Bullards Bar Reservoir, which can hold about 969,600 acre⋅ft of water. The dam serves for irrigation, drinking water and hydroelectric power generation."},{"page_url":"https://sk.wikipedia.org/wiki/Nekupuj_rusk%C3%A9!","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/%D0%90%D0%BA%D1%86%D1%96%D1%8F_%D0%B1%D0%BE%D0%B9%D0%BA%D0%BE%D1%82_%D1%80%D0%BE%D1%81%D1%96%D0%B9%D1%81%D1%8C%D0%BA%D0%B8%D1%85_%D1%82%D0%BE%D0%B2%D0%B0%D1%80%D1%96%D0%B2.jpg","page_title":"Nekupuj ruské!","context_page_description":"Nekupuj ruské! je názov ukrajinského bojkotu ruského tovaru, ktorý je výsledkom dovoznej blokády ukrajinského tovaru na ruské trhy.\\nKampaň bola spustená 14. augusta 2013 a získala odozvu na sociálnych sieťach a následne sa rozšírila internetom. Rôzni aktivisti šírili túto kampaň prostredníctvom letákov a plagátov na verejných priestranstvách. Hoci kampaň, ktorá trvala počas roka 2013 stratila na popularite počas začiatkov protestov euromajdanu, dňa 2. marca 2014 bola v súvislosti s krymskou krízou opätovne zahájená. Organizátorom tejto akcie bolo hnutie Vidsič.\\nKampaň má podporu predovšetkým v západných častiach Ukrajiny."},{"page_url":"https://en.wikipedia.org/wiki/Campus_Agrippae","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7c/Plan_Rome-_Campus_Aggrippae.png","page_title":"Campus Agrippae","context_page_description":"The Campus Agrippae is the area within the boundaries of ancient Rome named after Marcus Vipsanius Agrippa. A number of construction projects were developed within its perimeters, including the Porticus Vipsania, built by his sister, Vipsania Polla, and finished by Augustus, which ran along the western perimeter, against the Via Lata. There was also a race course. In 7 BCE, Augustus declared the Campus open to the public."},{"page_url":"https://da.wikipedia.org/wiki/Josephine_Hull","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Studio_publicity_Josephine_Hull.jpg","page_title":"Josephine Hull","context_page_description":"Marie Josephine Hull var en amerikansk teater- og filmskuespiller. Hun havde en succesrig 50 år lang karriere på scenen og indspillede også flere af sine store roller på film. Hun vandt en Oscar for bedste kvindelige birolle for filmen Harvey, en rolle hun oprindeligt spillede på Broadway."},{"page_url":"https://en.wikipedia.org/wiki/Carnegie_Library_of_Valdosta","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Carnegie_Library_of_Valdosta%2C_GA%2C_US_%2802%29.jpg","page_title":"Carnegie Library of Valdosta","context_page_description":"The Carnegie Library of Valdosta is a Carnegie library building in Valdosta, Georgia. It was constructed in 1913 for $40,000, with help from a $15,000 Carnegie grant. It was the first building designed by local architect Lloyd V. Greer. It opened in 1914. Decades later it became a branch library and then the base for the Lowndes County Historical Society. It was added to the National Register of Historic Places on January 12, 1984. It is located at 305 West Central Avenue. Originally part of the South Georgia Regional Library, the library building is now home to the Lowndes County Historical Society and Museum."},{"page_url":"https://de.wikipedia.org/wiki/Gutshaus_Friedenfelde","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Friedenfelde_Gutshaus.JPG","page_title":"Gutshaus Friedenfelde","context_page_description":"Das Gutshaus Friedenfelde ist ein denkmalgeschütztes Gutshaus im zur Gemeinde Gerswalde gehörenden Dorf Friedenfelde in Brandenburg."},{"page_url":"https://en.wikipedia.org/wiki/Johnny_Carson","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Jack_Benny_Johnny_Carson_Benny_Show_1955.JPG","page_title":"Johnny Carson","context_page_description":"John William Carson was an American television host, comedian, writer, and producer. He is best known as the host of The Tonight Show Starring Johnny Carson. Carson received six Emmy Awards, the Television Academy's 1980 Governor's Award, and a 1985 Peabody Award. He was inducted into the Television Academy Hall of Fame in 1987. Carson was awarded the Presidential Medal of Freedom in 1992 and received a Kennedy Center Honor in 1993.\\nDuring World War II, Carson served in the Navy. After the war, Carson started a career in radio. He moved from radio to TV and followed Jack Paar as the host of the late night talk show, Tonight. Although his show was already successful by the end of the 1960s, during the 1970s, Carson became an American icon and remained so even after his retirement in 1992. He adopted a casual, conversational approach with extensive interaction with guests, an approach pioneered by Arthur Godfrey and previous Tonight Show hosts Steve Allen and Jack Paar. Former late-night host and friend David Letterman has cited Carson's influence."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Z%C3%BCrich/Kreis_2","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Rieterpark_-_Park-Villa_Rieter_2011-08-15_16-46-16_ShiftN.jpg","page_title":"Liste der Kulturgüter in Zürich/Kreis 2","context_page_description":"Die Liste der Kulturgüter in Zürich/Kreis 2 enthält alle Objekte im Kreis 2 der Stadt Zürich, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit. Unter übrige Baudenkmäler sind weitere geschützte Objekte zu finden, die im Verzeichnis der Objekte von überkommunaler Bedeutung der kantonalen Denkmalpflege zu finden und nicht bereits in der Liste der Kulturgüter enthalten sind."},{"page_url":"https://es.wikipedia.org/wiki/Ivan_Vladislavovich_Zholtovsky","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/52/Ivan_zholtovsky.jpg","page_title":"Ivan Vladislavovich Zholtovsky","context_page_description":"Iván Vladislávovich Zholtovski fue un arquitecto y educador ruso-soviético. Trabajó principalmente en Moscú desde 1898 hasta su muerte. Un maestro consumado de la Renovación del Renacimiento antes de la Revolución rusa de 1917, más tarde se convirtió en una figura clave de la arquitectura estalinista.\\nIván Zholtovski nació en Pinsk, en la actual Bielorrusia el 27 de noviembre de 1867. Se unió a la Academia de Artes de San Petersburgo a la edad de 20 años. Los estudios de licenciatura duraron 11 años hasta 1898; Trabajó como aprendiz para las firmas de arquitectos de San Petersburgo. En el momento de la graduación, Zholtovsky tenía una experiencia práctica de primer nivel en diseño, tecnología y gestión de proyectos. Mantuvo este enfoque práctico durante el resto de su carrera, siendo un gerente de construcción en el sentido original de la profesión arquitectónica. Zholtovsky planeaba mudarse a Tomsk después de graduarse, pero finalmente recibió y aceptó una oferta de trabajo rápida de la Escuela de Arte Stróganov en Moscú."},{"page_url":"https://en.wikipedia.org/wiki/Kriegsspiel","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Kriegsspiel_1824.jpg","page_title":"Kriegsspiel","context_page_description":"Kriegsspiel is a genre of wargaming developed by the Prussian army in the 19th century to teach battlefield tactics to officers. The word Kriegsspiel literally means \\"wargame\\" in German, but in the context of the English language it refers specifically to the wargames developed by the Prussian army in the 19th century. Kriegsspiel was the first wargaming system to have been adopted by a military organization as a serious tool for training and research. After Prussia's impressive victory over France in the Franco-Prussian War, other countries swiftly began designing Kriegsspiel-like wargames for their own armies.\\nMost forms of Kriegsspiel involve at least two teams of players and one umpire gathered around a map. The map represents a battlefield. Each team is given command of an imaginary army, which is represented on the map using little painted blocks. Each block represents some kind of troop formation, such as an artillery battery or a cavalry squadron. The players command their troops by writing their orders on paper and giving them to the umpire."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B0%D1%82%D0%BE,_%D0%9D%D0%B0%D0%BE%D1%82%D0%B0%D0%BA%D1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Naotake_Sat%C5%8D.jpg","page_title":"Сато, Наотакэ","context_page_description":"Наотакэ Сато — японский дипломат и политический деятель. В период до Второй мировой войны был на дипломатической работе во многих европейских государствах, а также на протяжении четырёх лет представлял Японию в Лиге наций. В 1937 году в течение трёх месяцев был министром иностранных дел Японии. С марта 1942 года и до вступления СССР в войну против Японии был послом в Советском Союзе. После завершения войны трижды избирался в верхнюю палату японского парламента — Палату советников. С 1949 по 1953 год был председателем Палаты советников."},{"page_url":"https://sv.wikipedia.org/wiki/Zeitgeistr%C3%B6relsen","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Fresco_automated_construction.jpg","page_title":"Zeitgeiströrelsen","context_page_description":"Zeitgeiströrelsen är en gräsrotsrörelse och nätgemenskap. Den beskriver sig själv som en organisation för opinionsbildning kring hållbarhet, och var den officiella aktivistgrenen till Venusprojektet, startat av industridesignern och samhällsingenjören Jacque Fresco, fram till 2011. Zeitgeiströrelsen har inspirerats av det gensvar som Peter Josephs filmer Zeitgeist: The Movie och Zeitgeist: Addendum fick från folk. Det var dock Zeitgeist: Addendum som först presenterade Venusprojektet. En tredje film, Zeitgeist: Moving Forward, hade premiär den 15 januari 2011 och blev tillgänglig på internet den 26:e. Filmen inriktas på mänskligt beteende, teknik och rationalitet. Rörelsens hemsida säger att det görs en åtskillnad mellan arbetet i rörelsen och de frågor som tas upp i Peter Josephs filmer, d.v.s. att rörelsen inte nödvändigtvis förespråkar alla frågor som behandlas i filmerna, utan existerar på egen hand."},{"page_url":"https://de.wikipedia.org/wiki/Arznei-Engelwurz","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Angelica_archangelica_-_K%C3%B6hler%E2%80%93s_Medizinal-Pflanzen-158.jpg","page_title":"Arznei-Engelwurz","context_page_description":"Die Arznei-Engelwurz oder Echte Engelwurz ist eine Pflanzenart innerhalb der Familie der Doldenblütler. Sie ist in den kühl-gemäßigten bis subarktischen Breiten auf der Nordhalbkugel weitverbreitet und wird in der Heilkunde verwendet und sollte nicht mit dem Riesen-Bärenklau verwechselt werden."},{"page_url":"https://es.wikipedia.org/wiki/Quito","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Mitad_del_Mundo%2C_Quito%2C_Ecuador%2C_2015-07-22%2C_DD_03.JPG","page_title":"Quito","context_page_description":"Quito, oficialmente San Francisco de Quito, es la capital de la República del Ecuador, capital de la Provincia de Pichincha y la capital más antigua de Sudamérica. Es la ciudad más poblada del Ecuador, ​​​ con 2 millones de habitantes en el Área metropolitana, y aproximadamente 2,8 millones en todo el cantón. Además, es la cabecera cantonal del Distrito Metropolitano de Quito​. Está ubicada sobre la hoya de Guayllabamba, en las laderas occidentales del estratovolcán activo Pichincha, en la parte oriental de los Andes y su altitud es de 2850 msnm. La ciudad está dividida en 32 parroquias urbanas, ​ las cuales se subdividen en barrios. El área metropolitana de Quito, formada por la ciudad capital junto a las ciudades vecinas de Sangolquí, Machachi, Tabacundo y Cayambe; Quito es el centro político e cultural de la República del Ecuador, alberga los principales organismos gubernamentales, administrativos e culturales, Además, la mayoría de empresas transnacionales que trabajan en Ecuador tienen su matriz en la urbe.\\nLa fecha de su primera fundación es incierta; los registros más antiguos se hallan en la hacienda del Inga alrededor del año 1030 a.C."},{"page_url":"https://it.wikipedia.org/wiki/Rigny-Saint-Martin","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Entree-Agglo-Rigny-StMartin.jpg","page_title":"Rigny-Saint-Martin","context_page_description":"Rigny-Saint-Martin è un comune francese di 58 abitanti situato nel dipartimento della Mosa nella regione del Grand Est."},{"page_url":"https://fr.wikipedia.org/wiki/Plateau_de_Millevaches","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Bois_haute-vienne.JPG","page_title":"Plateau de Millevaches","context_page_description":"Le plateau de Millevaches, parfois appelé « Montagne limousine », est un grand plateau granitique français situé en Nouvelle-Aquitaine, dans l'historique Limousin, dont il constitue la partie la plus élevée. Il s'étend pour sa majeure partie sur un large quart nord-est du département de la Corrèze, occupe aussi le quart sud de la Creuse et déborde sur l'extrême sud-est de la Haute-Vienne.\\nFormant la bordure nord-occidentale du Massif central, il occupe la partie orientale des monts du Limousin et domine les plateaux et monts de la Marche au nord, le plateau de la Courtine et les Combrailles à l'est, la vallée de la Dordogne et le haut plateau corrézien au sud et les bas plateaux du Limousin à l'ouest. D'une altitude globalement comprise entre 500 et 900 mètres, il culmine à 976 m au mont Bessou. Il est parfois surnommé « le château d'eau de la France » en raison de ses lacs et tourbières et des nombreux cours d'eau qui y prennent leur source, dont notamment la Vézère, la Vienne, la Corrèze et la Creuse.\\nCréé en 2004, le parc naturel régional de Millevaches en Limousin s'étend sur la totalité du plateau et plusieurs territoires voisins."},{"page_url":"https://nds.wikipedia.org/wiki/Anselm_Feuerbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Titanensturz_Anselm_Feuerbach_Akademie_Wien.jpg","page_title":"Anselm Feuerbach","context_page_description":"Anselm Feuerbach weer en düütsch Maler. He hörrt to de bedüüdenst düütsch Malers vun de tweet Hälft vun dat 19. Johrhunnert."},{"page_url":"https://fr.wikipedia.org/wiki/Panique_dans_la_rue","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Kazan%27s_Panic_in_the_Street_trailer_screenshot_%2824%29.jpg","page_title":"Panique dans la rue","context_page_description":"Panique dans la rue est un film américain réalisé par Elia Kazan, sorti en 1950."},{"page_url":"https://ro.wikipedia.org/wiki/Lag%C4%83rul_de_exterminare_Sobibor","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Wikipedia-sobibor-1.jpg","page_title":"Lagărul de exterminare Sobibor","context_page_description":"Lagărul de exterminare Sobibor a fost un lagăr de exterminare german care a reprezentat un element din planul de exterminare a evreilor din Polonia ocupată, plan denumit „Operațiunea Reinhard”. A fost construit la începutul anului 1942, în timpul ocupației naziste. Numele german oficial a fost SS-Sonderkommando Sobibor. Acesta este și numele germanizat al satului Sobibór lângă care a fost construit lagărul și care face parte astăzi din voievodatul Lublin din sud-estul Poloniei. Comandantul lagărului a fost inițial ofițerul SS german Franz Stangl, urmat de Franz Reichleitner. Lagărul era localizat într-o pădure la 12 km sud de satul Sobibór într-o mică localitate numită Stare Kolonia Sobibór.\\nEvrei, prizonieri de război sovietici și romi au fost aduși la Sobibór cu trenul și uciși în camere de gazare. Cel puțin 250.000 de oameni au fost uciși în acest lagăr. Astăzi pe acel loc se află un monument ridicat de statul polonez în anul 1961 și un muzeu din 1993.\\nLa Sobibor s-a produs o evadare miraculoasă despre care s-a realizat un film de succes intitulat Evadare din Sobibor."},{"page_url":"https://sl.wikipedia.org/wiki/Ch%C3%A2teau_de_Coucy","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Modell_Donjon_von_Coucy.jpg","page_title":"Château de Coucy","context_page_description":"Grad Coucy v Coucy-le-Château-Auffrique so ruševine enega najpomembnejših srednjeveških fevdalnih gradov v Evropi. Grad in mesto Coucy sta v departmaju Aisne med Laonom in Soissonsom. Mogočna zgradba na hribu je bila med prvo svetovno vojno leta 1917 močno poškodovana s strani nemških vojakov, ki so porušili velik okrogel donžona, ki je bil do takrat z višino 54 metrov najvišji donžon v Franciji."},{"page_url":"https://pl.wikipedia.org/wiki/Bonosus_(uzurpator)","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Bonosus.jpg","page_title":"Bonosus (uzurpator)","context_page_description":"Bonosus – oficer rzymskiej floty Renu. W 280 roku n.e., kiedy Germanie spalili rzymskie statki ulokowane na Renie, wywołał bunt i w obawie przed spodziewaną karą mianował się cesarzem rzymskim. Walczył z prawowitym cesarzem - Probusem. Przegrawszy powiesił się. Cesarz Probus darował życie jego synowi i żonie."},{"page_url":"https://fr.wikipedia.org/wiki/Saint-Symphorien_(Gironde)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/FR-33-Saint-Symphorien1.JPG","page_title":"Saint-Symphorien (Gironde)","context_page_description":"Saint-Symphorien est une commune du Sud-Ouest de la France, située dans le département de la Gironde, en région Nouvelle-Aquitaine.\\nSes habitants sont appelés les Paroupians."},{"page_url":"https://de.wikipedia.org/wiki/Canal_Grande","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Ca%27_Polacco_%28Venice%29.jpg","page_title":"Canal Grande","context_page_description":"Der Canal Grande, im Venezianischen Canałazzo, ist eine knapp vier Kilometer lange, zwischen 30 und 70 Meter breite und bis zu fünf Meter tiefe Hauptwasserstraße in der Lagunenstadt Venedig. Die erste Biegung des S-förmigen Kanals wird als Volta di Canal bezeichnet.\\nEr ist das letzte Stück des nördlichen Armes des Flusses Brenta, der durch die Lagune zieht, weshalb das Wasser hier im Gegensatz zu den übrigen venezianischen Kanälen immer fließt. Rund 45 kleinere Kanäle münden in den Canal Grande ein."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%A1%D1%83%D0%BA%D0%BA%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Anapsky_District%2C_Krasnodar_Krai%2C_Russia_-_panoramio_%2820%29.jpg","page_title":"Сукко","context_page_description":"Сукко — Российн Федерацин Краснодаран мехкан Анапан муниципалан кхолламан юкъа йогӀу эвла."},{"page_url":"https://nl.wikipedia.org/wiki/Robert_Wickens","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Robert_Wickens_2007_%28cropped%29.jpg","page_title":"Robert Wickens","context_page_description":"Robert Wickens is een Canadees autocoureur."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9A%E1%83%95%E1%83%9D%E1%83%95%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/6_Market_Square%2C_Lviv_%2801%29.jpg","page_title":"ლვოვი","context_page_description":"ლვოვი — უდიდესი ქალაქი დასავლეთ უკრაინაში, ლვოვის ოლქის ადმინისტრაციული, კულტურული და საგანმანათლებლო-სამეცნიერო ცენტრი, ასევე ცალკეული რაიონი ამავე ოლქში. მსხვილი სამრეწველო ცენტრი და სატრანსპორტო კვანძი. მოსახლეობაში უწოდებენ გალიციისა და დასავლეთ უკრაინის დედაქალაქს. 2014 წლისათვის ცხოვრობდა 729 038 ადამიანი, რომელთაგან 88% უკრაინელი, 9% რუსი და 1% პოლონელი იყო, დამატებით 200 000 ადამიანი ყოველდღიურად შემოდიოდა გარეუბნებიდან. მოსახლეობის მიხედვით იგი არის ქვეყნის მეშვიდე ქალაქი.\\nლვოვი, ერთ-ერთი ვერსიის მიხედვით დააარსა კიევის რუსეთის დიდმა მთავარმა დანიელ გალიციელმა XIII საუკუნეში. 1272 წელს ქალაქი გახდა გალიჩ-ვოლინის სამთავროს დედაქალაქი. 1349-1772 წლებში იყო პოლონეთისა და რეჩ-პოსპოლიტას შემადგენლობაში. 1772-1918 წლებში ჰაბსბურგთა მონარქიის შემადგენლობაშია, როგორც გალიციისა და ლოდომერიის სამეფოს ნაწილი, 1918 წელს იყო დასავლეთ უკრაინის სახალხო რესპუბლიკის შემადგენლობაში, 1919-1939 წლებში კვლავ პოლონეთის რესპუბლიკის შემადგენლობაშია. 1939-1941 და 1944-1991 წლებში უკრაინის სსრ-ის ნაწილია.\\nქალაქის დღეს აღნიშნავენ მაისის პირველ შაბათს.\\nლვოვის მთავარი საგანმანათლებლო კერებია ლვოვის უნივერსიტეტი და ლვოვის პოლიტექნიკური უნივერსიტეტი."},{"page_url":"https://en.wikipedia.org/wiki/Elin_Nordegren","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Elin_Nordegren.jpg","page_title":"Elin Nordegren","context_page_description":"Elin Maria Pernilla Nordegren is the Swedish-born ex-wife of professional golfer Tiger Woods. Nordegren has worked as a model and nanny."},{"page_url":"https://fr.wikipedia.org/wiki/Metz-Centre","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/Metz_Le_Met%27_Van_Hool_Exquicity_24_n%C2%B01326_MB_Centre_Pompidou_Metz.JPG","page_title":"Metz-Centre","context_page_description":"Metz-Centre est un quartier administratif du centre-ville de Metz. Ce quartier, avec celui de l’Ancienne Ville plus au nord, est le centre historique de la ville."},{"page_url":"https://zh.wikipedia.org/wiki/%E9%AF%89%E9%AD%9A%E9%96%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Tcitp_d163_chinese_residences_ly_ee_mun_hong_kong.jpg","page_title":"鯉魚門","context_page_description":"鯉魚門，古稱鹽江口，是香港海峽之一，為香港維多利亞港東面入口，與西面的汲水門相對，分隔香港島筲箕灣和九龍東部油塘。鯉魚門已有逾150年歷史，過去大部分村民都是農夫、漁民和礦工；至60年代，漁村才開始出現菜館，並逐漸發展成為海鮮美食區。\\n鯉魚門的名稱除用於海峽本身，但海峽兩岸亦有以「鯉魚門」為名的地方，分別為九龍的魔鬼山及酒灣一帶，以及香港島的阿公岩一帶。但是，儘管仍有人對阿公岩一帶稱為鯉魚門，但香港島的鯉魚門知名度遠遠不及位於九龍東、以海鮮聞名的鯉魚門。\\n鯉魚門海峽兩岸也是整個維多利亞港當中唯一仍未有進行填海的地方。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Eintr%C3%A4ge_im_National_Register_of_Historic_Places_im_Motley_County","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/TraweekHouse_%281_of_1%29.jpg","page_title":"Liste der Einträge im National Register of Historic Places im Motley County","context_page_description":"Die Liste der Registered Historic Places im Motley County führt alle Bauwerke und historischen Stätten im texanischen Motley County auf, die in das National Register of Historic Places aufgenommen wurden."},{"page_url":"https://uk.wikipedia.org/wiki/Dodge_Caliber","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Dodge_Caliber_Interior.jpg","page_title":"Dodge Caliber","context_page_description":"Dodge Caliber — компактний автомобіль виробництва Dodge корпорації Chrysler, що вироблявся з 2007 по 2012 рік включно."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%87%E3%83%88%E3%83%AD%E3%82%A4%E3%83%88%E6%B5%B7%E5%B1%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/EmperorSeamounts.jpg","page_title":"デトロイト海山","context_page_description":"デトロイト海山は、北太平洋、アリューシャン列島南方沖にある海山。天皇海山群に属する。およそ7600万年前に形成されたと考えられる海山で、天皇海山群の中では、もっとも古い海山の一つ。海山最頂部は、海面下1550m付近に存在する。"},{"page_url":"https://fr.wikipedia.org/wiki/Mike_Thibault","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Mike_Thibault-20170914.jpg","page_title":"Mike Thibault","context_page_description":"Mike Thibault, né le 28 septembre 1951, est un entraîneur américain de basket-ball."},{"page_url":"https://simple.wikipedia.org/wiki/A.K._Fazlul_Huq","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/All_India_Muslim_League_Working_Committee_Lahore_1940.jpg","page_title":"A.K. Fazlul Huq","context_page_description":"Abul Kashem Fazlul Huq, often called Sher-e-Bangla was a well-known Bengali statesman in the first half of the 20th century. He held different political posts including General Secretary of the Indian National Congress, Education Minister, the first Muslim Mayor of Calcutta, Chief Minister of undivided Bengal and East Pakistan, Home Minister of Pakistan, Governor of East Pakistan, Food and Agriculture Minister of Pakistan"},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%A8%E0%AE%BF%E0%AE%B0%E0%AF%81%E0%AE%A4%E0%AF%8D%E0%AE%A4%E0%AE%BF%E0%AE%AF_%E0%AE%95%E0%AE%BF%E0%AE%B0%E0%AE%BE%E0%AE%AE%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Buildings_in_the_Nrityagram_Dance_Community.jpg","page_title":"நிருத்திய கிராமம்","context_page_description":"நிருத்திய கிராமம் என்பது 1990 ஆம் ஆண்டில் ஒடிசி நடனக் கலைஞர் புரோதிமா கௌரி பேடி அவர்களால் அமைக்கப்பட்ட ஒரு நடன கிராமத்தின் வடிவத்தில் இந்திய பாரம்பரிய நடனங்களுக்கான இந்தியாவின் முதல் நவீன குருகுலம் மற்றும் ஒரு திட்ட சமூகமாகும். பண்டைய குரு-சீடர் பாரம்பரியத்தை பின்பற்றி, ஒடிசி, மோகினியாட்டம், கதக், பரதநாட்டியம், குச்சிபுடி, கதகளி மற்றும் மணிப்பூரி போன்ற நடனங்களை ஒரு நாளைக்கு எட்டு மணிநேரம், வாரத்தில் ஆறு நாட்கள் என ஏழு வருடங்களுக்கு பயிற்சி அளிக்கிறது. பிரபல இந்திய கட்டிடக் கலைஞர் ஜெரார்ட் டா குன்ஹாவால் வடிவமைக்கப்பட்ட இந்த சமூகம் பெங்களூரிலிருந்து 30 கி.மீ தொலைவில் உள்ள ஹெசராகட்டா ஏரிக்கு அருகில் அமைந்துள்ளது இன்று நிருத்யாகிராமம் நடனக் குழு இந்தியா முழுவதும் மற்றும் வெளிநாடுகளில் பல நாடுகளில் நிகழ்ச்சிகளை நிகழ்த்தியுள்ளது."},{"page_url":"https://ca.wikipedia.org/wiki/Matthias_Gr%C3%BCnewald","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Grunewald_Isenheim1.jpg","page_title":"Matthias Grünewald","context_page_description":"Matthias Grünewald, nascut probablement a Würzburg, Baviera, vers 1475–1480 i mort a Halle, Saxònia-Anhalt, l'any 1528, va ser un pintor i enginyer hidràulic alemany del Renaixement, coetani d'Albrecht Dürer."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D1%82%D1%80%D0%B8%D0%B2_(%D0%94%D1%80%D0%BE%D0%BC)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/Palais_ideal_-_Hauterives.JPEG","page_title":"Отрив (Дром)","context_page_description":"Отри́в, Отрів — муніципалітет у Франції, у регіоні Рона-Альпи, департамент Дром. Населення — 1720 осіб.\\nМуніципалітет розташований на відстані близько 450 км на південний схід від Парижа, 60 км на південь від Ліона, 38 км на північ від Валанса."},{"page_url":"https://ms.wikipedia.org/wiki/Universiti_Humboldt_Berlin","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Humbold_Universit%C3%A4t_Logo.png","page_title":"Universiti Humboldt Berlin","context_page_description":"Universiti Humboldt Berlin ialah sebuah universiti di pusat bandar Mitte di Berlin, Jerman. Ia ditubuhkan oleh Frederick William III atas inisiatif Wilhelm von Humboldt sebagai Universiti Berlin pada tahun 1809, dan dibuka pada tahun 1810, menjadikannya empat universiti tertua di Berlin. Dari 1828 sehingga penutupannya pada tahun 1945, ia dinamakan Universiti Friedrich Wilhelm. Pada 1949, di bawah pemerintahan Blok Komunis, ia dibuka semula dan untuk kali ini dinamakan semula sebagai \\"Universiti Humboldt Berlin\\".\\nUniversiti ini dibahagikan kepada sembilan fakulti, termasuk sekolah perubatan yang dikongsi bersama dengan Universiti Bebas Berlin, mempunyai pendaftaran pelajar sekitar 32,000 pelajar, dan menawarkan program ijazah dalam kira-kira 189 disiplin dari peringkat sarjana hingga tahap pascakedoktoran. Kampus utamanya terletak di bulevad Unter den Linden di pusat Berlin. Universiti ini dikenali di seluruh dunia untuk mempelopori model pendidikan tinggi Humboldtian, yang telah memengaruhi universiti-universiti Eropah dan Barat yang lain, dan universiti itu telah dipanggil \\"ibu segala universiti moden\\"."},{"page_url":"https://fr.wikipedia.org/wiki/Wild_Oats_XI","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Wild_Oats_XI_about_to_finish_2011_Sydney_to_Hobart.jpg","page_title":"Wild Oats XI","context_page_description":"Wild Oats XI est un maxi yacht de jauge IRC appartenant à Robert Oatley et skippé par Mark Richards. Il est principalement connu pour avoir remporté huit fois la course Sydney-Hobart en temps réel.\\nWild Oats XI remporta Sydney-Hobart dès sa première saison, en temps réel comme en temps compensé, et établit un nouveau record, lors de l’édition 2005. En 2007, il égala le record de trois victoires consécutives détenu par Morna depuis 59 ans. L’année suivante, il battit ce record en remportant sa quatrième course d’affilée."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%A6%84%E8%8E%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Braunschweig_Brunswick_Rollei_%282006%29.jpg","page_title":"禄莱","context_page_description":"禄莱是一间制造光学产品的德国公司，以双反相机禄莱福莱著称，该照相机在胶卷照相机中拥有前驱的地位。\\n该公司于1920年在不伦瑞克创立，一开始的名字是Werkstatt für Feinmechanik und Optik, Franke & Heidecke，经过多次改名和更改公司形式后1962年称为Rollei-Werke Franke & Heidecke、1979年Rollei-Werke Franke & Heidecke GmbH & Co. KG、2004年Rollei GmbH。2006年公司大本营前往柏林，而生产则依然留在不论瑞克。2007年它被分成三个公司。Franke & Heidecke GmbH位于柏林，主要负责专业产品，RCP-Technik GmbH & Co KG主要负责欧洲的消费者产品，Rollei Metric GmbH则负责摄影测量法。\\n1960年代末当时已经过时的禄莱福莱销售量下降，因此公司决定扩大产量和产品种类。但是这个措施却是当时还相当小的禄莱公司无法实现的。1970年公司在新加坡创办了自己的生产线，在相机工业中此举有领先意义，但是却使得公司为德国精良产家的声誉遭到打击。1982年公司在多次改组后决定局限于中片幅相机和少数其它产品。1986年添加了测量系统，从1991年开始公司也生产数码和现代傻瓜相机。"},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_Creus_de_Sant_Jordi","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/84/Florensa-laietana31-0231.jpg","page_title":"Llista de Creus de Sant Jordi","context_page_description":"Llista de persones i institucions premiades amb la Creu de Sant Jordi."},{"page_url":"https://ru.wikipedia.org/wiki/PZL.43_Czajka","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/PZL.43.jpg","page_title":"PZL.43 Czajka","context_page_description":"PZL.43 Czajka, известный также как P.43 — польский одномоторный самолёт-бомбардировщик, состоявший на вооружении ВВС Польши, Болгарии и Германии. Выпускался под индексами P-42 и P-43."},{"page_url":"https://en.wikipedia.org/wiki/Marco,_Cear%C3%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Brasao_de_Marco.jpg","page_title":"Marco, Ceará","context_page_description":"Marco, Ceará is a municipality in the state of Ceará in the Northeast region of Brazil."},{"page_url":"https://fr.wikipedia.org/wiki/Leonardo_Basso","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/Fourmies_-_Grand_Prix_de_Fourmies%2C_6_septembre_2015_%28B153%29.JPG","page_title":"Leonardo Basso","context_page_description":"Leonardo Basso est un coureur cycliste italien, membre de l'équipe Ineos."},{"page_url":"https://en.wikipedia.org/wiki/Silk_in_the_Indian_subcontinent","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Silk_Sari_Weaving_at_Kanchipuram%2C_Tamil_Nadu.jpg","page_title":"Silk in the Indian subcontinent","context_page_description":"Silk in the Indian subcontinent is a luxury good. In India, about 97% of the raw mulberry silk is produced in the five Indian states of Karnataka, Andhra Pradesh, Tamil Nadu, West Bengal and Jammu and Kashmir. Mysore and North Bangalore, the upcoming site of a US$20 million \\"Silk City\\", contribute to a majority of silk production. Another emerging silk producer is Tamil Nadu where mulberry cultivation is concentrated in Salem, Erode and Dharmapuri districts. Hyderabad, Andhra Pradesh and Gobichettipalayam, Tamil Nadu were the first locations to have automated silk reeling units."},{"page_url":"https://ko.wikipedia.org/wiki/2017%EB%85%84_%ED%83%9C%ED%92%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Guchol_2017_track.png","page_title":"2017년 태풍","context_page_description":"이 문서에서는 2017년에 발생한 태풍들의 활동에 대해 기록하였다. 2017년에는 1호 태풍 무이파를 시작으로 27개의 태풍이 발생하였다.\\n평균적으로 1년 동안 태풍 발생 개수가 25.6개인 것과 비교하면 높은 수치이다."},{"page_url":"https://uz.wikipedia.org/wiki/Kobenz","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/AUT_Kobenz_COA.jpg","page_title":"Kobenz","context_page_description":"Kobenz Avstriyaning Shtiriya yerida joylashgan kommunadir. Murtal okrugi tarkibiga kiradi. Maydoni – 17.64 km². 1840 nafar aholi istiqomat qiladi."},{"page_url":"https://es.wikipedia.org/wiki/Th%C3%A9zan-l%C3%A8s-B%C3%A9ziers","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Th%C3%A9zan-l%C3%A8s-B%C3%A9ziers_aug_2011.jpg","page_title":"Thézan-lès-Béziers","context_page_description":"Thézan-lès-Béziers es una población y comuna francesa, situada en la región de Occitania, departamento de Hérault, en el distrito de Béziers y cantón de Cazouls-lès-Béziers."},{"page_url":"https://ca.wikipedia.org/wiki/Duino-Aurisina","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8c/Castello_di_Duino-DSCF1405.JPG","page_title":"Duino-Aurisina","context_page_description":"Duino-Aurisina és un municipi dispers de 8.698 habitants a la província de Trieste, regió de Friül – Venècia Júlia, al nord-est d'Itàlia. La població s'escampa per una dotzena de poblets, els més importants dels quals són: Duino, Sistiana i Aurisina. Limita amb els municipis de Monfalcone, Doberdò del Lago, Sežana i Komen, Sgonico i Trieste.\\nA Duino hi ha dos castells, el més antic està en ruïnes, mentre en el castell nou encara hi viu el Princip i és obert al públic com a museu. Sota les runes del castell vell, un esperó de roca blanca cau a plom sobre el mar, és la \\"Dama Bianca\\", per què sembla una dona embolcallada en un vel blanc, i que va ser l'origen de llegendes gòtiques.\\nEl poble és conegut arreu per ser el lloc on es va inspirar el poeta Rainer Maria Rilke per a escriure les Elegies de Duino mentre visitava a la princesa Maria von Thorn und Taxis.\\nEl castell nou es va començar a construir el 1389 per substituir l'antic castell."},{"page_url":"https://en.wikipedia.org/wiki/Dallas%E2%80%93Fort_Worth_Film_Critics_Association_Awards_2009","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Mo%27Nique_attending_the_82nd_Academy_Awards_2010.jpg","page_title":"Dallas–Fort Worth Film Critics Association Awards 2009","context_page_description":"The 15th Dallas-Fort Worth Film Critics Association Awards honoring the best in film for 2009 were announced on December 16, 2009. These awards \\"recognizing extraordinary accomplishment in film\\" are presented annually by the Dallas-Fort Worth Film Critics Association, based in the Dallas–Fort Worth metroplex region of Texas. The organization, founded in 1990, includes 33 film critics for print, radio, television, and internet publications based in north Texas. The Dallas-Fort Worth Film Critics Association began presenting its annual awards list in 1991.\\nUp in the Air was the DFWFCA's most awarded film of 2009 taking top honors in the Best Picture, Best Director, Best Actor, and Best Screenplay categories. This was the only film to win more than one category for 2009 although Precious garnered a Best Actress honor as well as the Russell Smith Award from the critics association.\\nAlong with the 11 \\"best of\\" category awards, the group also presented the Russell Smith Award to Precious as the \\"best low-budget or cutting-edge independent film\\" of the year. The award is named in honor of late Dallas Morning News film critic Russell Smith."},{"page_url":"https://nl.wikipedia.org/wiki/Hanko","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Hanko%2C_Hotel_Regatta_C_IMG_9142.jpg","page_title":"Hanko","context_page_description":"Hanko is een gemeente en stad in de Finse provincie Zuid-Finland en in de Finse regio Uusimaa. De gemeente heeft een totale oppervlakte van 114 km² en telde 8509 inwoners in 2018.\\nDeze plaats heeft een haven met verschillende faciliteiten voor het toerisme. Hanko is een tweetalige gemeente met Fins als meerderheidstaal en Zweeds als minderheidstaal."},{"page_url":"https://sv.wikipedia.org/wiki/Anua_finifascia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Anua_finifascia.JPG","page_title":"Anua finifascia","context_page_description":"Anua finifascia är en fjärilsart som beskrevs av Walker 1858. Anua finifascia ingår i släktet Anua och familjen nattflyn. Inga underarter finns listade i Catalogue of Life."},{"page_url":"https://pt.wikipedia.org/wiki/Kia_Cerato","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/2019_Kia_Forte_EX%2C_front_5.19.20.jpg","page_title":"Kia Cerato","context_page_description":"O Kia Cerato ou Kia Forte é um carro de classe C produzido pela montadora coreana de automóveis Kia Motors desde 2000, originalmente vendido como um hatchback. Quando o carro foi redesenhado em 2004/05 mais tarde tornou-se o carro mais vendido da Kia nos Estados Unidos."},{"page_url":"https://no.wikipedia.org/wiki/Vestmarka_(Larvik)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Vestmarka_Larvik.JPG","page_title":"Vestmarka (Larvik)","context_page_description":"Vestmarka er et friluftsområde nord-vest for Larvik. Her begynner de store skogsområdene eid av Treschow-Fritzøe. Området har flotte skogsbilveger som blir brukt av syklister og fotgjengere. På vinteren er det oppkjørte skiløyper i området. I vest er Vestmarka avgrensa av Farrisvannet og i øst av E18.\\nPopulære utfartsmål i Vestmarka er Gopledal, Dammen, Fossane, Ono og Lauvesetra. Svært mange larviksfolk har gjennom årene fått sine første \\"villmarksopplevelser\\" gjennom overnattingsturer til speiderhytter på Fossane og Onoøya. Lauvbuvannet er et ørretvann ved turveien til Lauvesetra."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%94%D0%BE%D2%BB%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Modern_Doha.jpg","page_title":"Доһа","context_page_description":"До́һа — Фарсы ҡултығының яр буйында урынлашҡан Катар дәүләтенең баш ҡалаһы. Халҡы — 521 283 кеше. Катарҙың иң ҙур ҡалаһы, бында ил халҡының 50%-ты йәшәй"},{"page_url":"https://fr.wikipedia.org/wiki/Ayaz_Ishaki","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/%C4%9Eayaz_Ishaqi%2C_1911.jpg","page_title":"Ayaz Ishaki","context_page_description":"Ğayaz İsxaqıy ou Ayaz İshaki est un leader du mouvement nationaliste tatar, auteur, journaliste, éditeur et homme politique."},{"page_url":"https://vi.wikipedia.org/wiki/Ninh_B%C3%ACnh_(th%C3%A0nh_ph%E1%BB%91)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Cong_Trang_An_11.JPG","page_title":"Ninh Bình (thành phố)","context_page_description":"Ninh Bình là thành phố tỉnh lỵ, trung tâm của tỉnh Ninh Bình, Việt Nam. Thành phố Ninh Bình cách thủ đô Hà Nội 93 km về phía nam, tại đầu mối giao thông của 3 tuyến đường cao tốc Cầu Giẽ - Ninh Bình, Ninh Bình - Thanh Hóa - Vinh và Ninh Bình - Hải Phòng - Hạ Long. Thành phố này cũng nằm ở vị trí giao điểm của quốc lộ 1A với 2 quốc lộ 10 và Quốc lộ 38B đi qua các tỉnh vùng duyên hải Bắc Bộ."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%90%D0%BB%D1%84%D0%BE%D0%BD%D1%81%D0%BE_VII_(%D0%9A%D0%B0%D1%81%D1%82%D0%B8%D0%BB%D0%B8%D1%8F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Alfonso_VII_of_Castile%2C_13th_c.jpg","page_title":"Алфонсо VII (Кастилия)","context_page_description":"Алфонсо VII Император – крал на Галисия от 1111 година, крал на Леон от 1126 година, крал на Кастилия от 1127 година. Син на Урака I, кралица на Кастилия, и Раймунд Бургундски. Първият кастилски крал от Бургундската династия."},{"page_url":"https://en.wikipedia.org/wiki/Jantar_Mantar,_New_Delhi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Jantar_Mantar_-_Shastansh_Yantra_-_West_view.jpg","page_title":"Jantar Mantar, New Delhi","context_page_description":"Jantar Mantar is located in the modern city of New Delhi. It consists of 13 architectural astronomy instruments. The site is one of five built by Maharaja Jai Singh II of Jaipur, from 1723 onwards, revising the calendar and astronomical tables. There is a plaque fixed on one of the structures in the Jantar Mantar observatory in New Delhi that was placed there in 1910 mistakenly dating the construction of the complex to the year 1710. Later research, though, suggests 1724 as the actual year of construction. Its height is 723 feet.\\nThe primary purpose of the observatory was to compile astronomical tables, and to predict the times and movements of the sun, moon and planets. Some of these purposes nowadays would be classified as astronomy.\\nCompleted in 1724, the Delhi Jantar Mantar had decayed considerably by 1867. The Ram Yantra, the Samrat Yantra, the Jai Prakash Yantra and the Misra Yantra are the distinct instruments of Jantar Mantar."},{"page_url":"https://nv.wikipedia.org/wiki/Tsineeshb%C3%ADzhii_dib%C3%A9%C5%82ch%C3%AD%CA%BC%C3%ADg%C3%AD%C3%AD","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Certhia_nipalensis%2C_Neora_Valley_NP%2C_India.jpg","page_title":"Tsineeshbízhii dibéłchíʼígíí","context_page_description":"Tsineeshbízhii dibéłchíʼígíí éí tsídii tsídígíí dah yikahjí atah yisdzoh, áádóó éí Náhookǫsjí Naakaii Dootłʼizhii Bikédaayahdi hólǫ́. Ndaʼałkaahí dóó ééʼdeetįįhii éí \\"Certhia nipalensis\\" deiłníigo dayózhí."},{"page_url":"https://hr.wikipedia.org/wiki/Heraklo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Mosaico_Trabajos_H%C3%A9rcules_%28M.A.N._Madrid%29_06.jpg","page_title":"Heraklo","context_page_description":"Heraklo u grčkoj mitologiji bio je polubog, sin vrhovnog boga Zeusa i smrtnice Alkmene. U rimskoj mitologiji zvao se Herkul."},{"page_url":"https://ro.wikipedia.org/wiki/Saint-Brice-sous-R%C3%A2nes","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/FranceNormandieSaintBriceSousRanesEglise.jpg","page_title":"Saint-Brice-sous-Rânes","context_page_description":"Saint-Brice-sous-Rânes este o comună în departamentul Orne, Franța. În 2009 avea o populație de 168 de locuitori."},{"page_url":"https://en.wikipedia.org/wiki/List_of_mountains_of_Canada","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Lewis_Hills%2C_Long_Range_Mountains%2C_Newfoundland%2C_Canada_-_200707.jpg","page_title":"List of mountains of Canada","context_page_description":"The vast majority of mountains in Canada lie in the western provinces of British Columbia, Alberta, and the Yukon Territory. Mountains can be found all over British Columbia while those in Alberta are mainly situated on the eastern side of the Canadian Rockies. The Saint Elias Mountains in the Yukon hold some of country's highest mountains, including the highest, Mount Logan at 5,959 metres."},{"page_url":"https://en.wikipedia.org/wiki/War_in_Afghanistan_order_of_battle,_2012","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Flag_of_the_International_Security_Assistance_Force.svg","page_title":"War in Afghanistan order of battle, 2012","context_page_description":"Below is the disposition and structure of international military forces that were participating in the War in Afghanistan in November 2012, listing deployed units under the command of the International Security Assistance Force, which controlled both combat and reconstruction operations. During its existence from 2001 to 2014, ISAF comprised units from many countries. In this article, units are assumed to be from the United States unless otherwise stated. This list is a rough and unofficial listing of units and formations."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9C%E1%83%9D%E1%83%91%E1%83%94%E1%83%9A%E1%83%98%E1%83%A1_%E1%83%9E%E1%83%A0%E1%83%94%E1%83%9B%E1%83%98%E1%83%98%E1%83%A1_%E1%83%9A%E1%83%90%E1%83%A3%E1%83%A0%E1%83%94%E1%83%90%E1%83%A2%E1%83%94%E1%83%91%E1%83%98_%E1%83%A4%E1%83%98%E1%83%96%E1%83%98%E1%83%99%E1%83%90%E1%83%A8%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Owen_Chamberlain.jpg","page_title":"ნობელის პრემიის ლაურეატები ფიზიკაში","context_page_description":"ნობელის პრემის ლაურეატები ფიზიკის დარგში:"},{"page_url":"https://en.wikipedia.org/wiki/Clayton_%26_Black","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Montefiore_House%2C_Montefiore_Road%2C_Hove_-_geograph.org.uk_-_621493.jpg","page_title":"Clayton & Black","context_page_description":"Clayton & Black were a firm of architects and surveyors from Brighton, part of the English city of Brighton and Hove. In a career spanning the Victorian, Edwardian and interwar eras, they were responsible for designing and constructing an eclectic range of buildings in the growing town of Brighton and its neighbour Hove. Their work encompassed new residential, commercial, industrial and civic buildings, shopping arcades, churches, schools, cinemas and pubs, and alterations to hotels and other buildings. Later reconstituted as Clayton, Black & Daviel, the company designed some churches in the postwar period.\\nCharles E. Clayton and Ernest Black, their sons Charles L. Clayton and Kenneth Black, and other architects articled to the firm, worked in a range of styles. The \\"architectural pantomime\\" of their Tudor Revival King and Queen pub and the elaborate Classical façade of the First Church of Christ, Scientist contrast with their plain Neo-Georgian Barclays Bank branch and the Gothic Revival St Thomas the Apostle's Church. Elsewhere in Brighton and Hove, they designed buildings in the Flemish Renaissance, Arts and Crafts, Art Deco and François Premier Revival styles."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%80%D1%83%D1%87%D0%B0_%D0%93%D0%B5%D0%BD%D1%80%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/Central-Eastern-Livingston-Map.png","page_title":"Круча Генрі","context_page_description":"Круча Генрі — точка на південно-західній стороні входу в Аргентинську бухту і на північній стороні входу в бухту Лас-Пальмас на півострові Херд, острів Лівінгстон на Південних Шетландських островах, Антарктида.\\nУ цій точці переважає значна монолітна формація, що піднімається до 163 м і названа Ель Пеньоном особовим складом сусідньої іспанської Антарктичної бази. Вперше цю область відвідали на початку XIX століття мисливці на тюленів.\\nМісцевість названа на честь американської китобійної шхуни «Генрі» під командуванням капітана Бенджаміна Бруноу, що відвідала Південні Шетландські острови в 1820—1821 роках."},{"page_url":"https://pt.wikipedia.org/wiki/Uganda","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/KampalaSkyline.jpg","page_title":"Uganda","context_page_description":"Uganda, oficialmente República de Uganda ou do Uganda, é um país sem ligação com o mar no leste da África. Faz fronteira a leste com o Quénia, a norte com o Sudão do Sul, a oeste com a República Democrática do Congo, a sudoeste com Ruanda e a sul com a Tanzânia. Uganda é o segundo país sem litoral mais populoso no continente africano. A parte sul do país inclui uma parcela substancial do Lago Vitória, compartilhado com o Quênia e Tanzânia, situando o país na região dos Grandes Lagos Africanos. Uganda também se encontra dentro da bacia do Nilo e tem um clima variado, mas geralmente clima de savana.\\nO nome Uganda deriva do reino do Buganda, que ainda hoje é considerado administrativamente como uma entidade semiautónoma, compreendendo toda a região central do país, incluindo a capital, Kampala. Os túmulos dos Reis do Buganda em Kasubi são considerados património da humanidade. Os primeiros habitantes da região eram caçadores-coletores até 1.700 a 2.300 anos atrás, quando populações de língua bantas migraram para as regiões do sul do país.\\nA partir de 1800, a área foi governada como uma colônia pelos britânicos, que estabeleceram o direito administrativo em todo o território."},{"page_url":"https://en.wikipedia.org/wiki/Louisville,_Ohio","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Map_of_Stark_County_Ohio_Highlighting_Louisville_City.png","page_title":"Louisville, Ohio","context_page_description":"Louisville is a city in Stark County in the U.S. state of Ohio. The population was 9,186 at the 2010 census. It is part of the Canton-Massillon, OH Metropolitan Statistical Area."},{"page_url":"https://zh.wikipedia.org/zh-my/%E4%B8%89%E5%B4%8E%E5%8F%A3%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/KeikyuMisakiguchiStation1.JPG","page_title":"三崎口站","context_page_description":"三崎口站是一个位于神奈川县三浦市初声町下宫田，属于京滨急行电铁久里滨线的铁路车站。是此线的终点站。车站编号是KK72。"},{"page_url":"https://es.wikipedia.org/wiki/Finntroll","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Wacken2005_139_finntroll.jpg","page_title":"Finntroll","context_page_description":"Finntroll es un grupo finlandés de folk metal formado en Helsinki en 1997. Su música combina elementos del black metal y el estilo de polka finlandesa conocido como humppa. Aunque las raíces del grupo sean finesas, las letras están en sueco, pues este «suena mucho más troll»​ según Katla, el primer cantante de la banda, que tiene este idioma como lengua materna."},{"page_url":"https://tr.wikipedia.org/wiki/Florian_Trinks","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/2018-08-17_1._FC_Schweinfurt_05_vs._FC_Schalke_04_%28DFB-Pokal%29_by_Sandro_Halank%E2%80%93046.jpg","page_title":"Florian Trinks","context_page_description":"Florian Trinks, Bundesliga Greuther Fürth takımında orta sahada oynayan, Alman futbolcudur."},{"page_url":"https://es.wikipedia.org/wiki/Kyn%C5%A1perk_nad_Oh%C5%99%C3%AD","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8f/Kynsperk_nad_Ohri_SO_CZ.png","page_title":"Kynšperk nad Ohří","context_page_description":"Kynšperk nad Ohří es una localidad del distrito de Sokolov en la región de Karlovy Vary, República Checa, con una población estimada a principio del año 2018 de 4804 habitantes.\\nSe encuentra ubicada al norte de la región, cerca de la orilla del río Ohře —un afluente izquierdo del río Elba—, y a poca distancia al sur de la parte occidental de los montes Metálicos y de la frontera con Alemania.​"},{"page_url":"https://la.wikipedia.org/wiki/1930","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Giuliano_Montaldo_-_2012.jpg","page_title":"1930","context_page_description":"Annus 1930 e serie paginarum brevium de annis.\\n1930 = MCMXXX. De nostro numerorum Romanorum usu hic legere potes. Ut de numero 1930 legas, vide 1930."},{"page_url":"https://es.wikipedia.org/wiki/Granard","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Market_Street%2C_Granard_-_geograph.org.uk_-_1796843.jpg","page_title":"Granard","context_page_description":"Granard es una localidad situada en el condado de Longford de la provincia de Leinster, con una población en 2016 de 816 habitantes.​\\nSe encuentra ubicada en el centro del país, a poca distancia del río Shannon."},{"page_url":"https://mr.wikipedia.org/wiki/%E0%A4%B5%E0%A5%8D%E0%A4%B9%E0%A4%B0%E0%A5%8D%E0%A4%A8%E0%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Pantheon_Varna.jpg","page_title":"व्हर्ना","context_page_description":"सोफिया हे बल्गेरिया देशामधील तिसर्‍या क्रमांकाचे मोठे शहर व दुसर्‍या क्रमांकाचे मोठे महानगर आहे. व्हर्ना शहर बल्गेरियाच्या पूर्व भागात काळ्या समुद्राच्या किनाऱ्यावर वसले आहे व बाल्कन प्रदेशातील एक लोकप्रिय पर्यटनस्थळ आहे."},{"page_url":"https://en.wikipedia.org/wiki/Blade_Runner_2049","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Birmingham_New_Street_Station_-_Blade_Runner_2049.jpg","page_title":"Blade Runner 2049","context_page_description":"Blade Runner 2049 is a 2017 American science fiction film directed by Denis Villeneuve and written by Hampton Fancher and Michael Green. A sequel to the 1982 film Blade Runner, the film stars Ryan Gosling and Harrison Ford, with Ana de Armas, Sylvia Hoeks, Robin Wright, Mackenzie Davis, Carla Juri, Lennie James, Dave Bautista, and Jared Leto in supporting roles. Ford and Edward James Olmos reprise their roles from the original. Gosling plays K, a Nexus-9 replicant \\"blade runner\\" who uncovers a secret that threatens to destabilize society and the course of civilization. Ridley Scott stepped down as the film's initial director and worked as an executive producer. Blade Runner 2049 was financed through an Alcon Entertainment–Sony Pictures partnership and a Hungarian government-funded tax rebate. Warner Bros., on behalf of Alcon, distributed the film in North America, while Sony handled distribution in international markets.\\nIdeas for a Blade Runner sequel were first proposed in the 1990s, but licensing issues stalled their development. Andrew Kosove and Broderick Johnson obtained the film rights from Bud Yorkin."},{"page_url":"https://vi.wikipedia.org/wiki/Botiza","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Botiza_monastery_01.JPG","page_title":"Botiza","context_page_description":"Botiza là một xã thuộc hạt Maramureș, România. Dân số thời điểm năm 2002 là 3000 người."},{"page_url":"https://eo.wikipedia.org/wiki/E%C5%ADropo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Flag_of_Europe.svg","page_title":"Eŭropo","context_page_description":"Eŭropo estas foje rigardita kiel kontinento, foje kiel duoninsulo de kontinento Eŭrazio, aŭ eĉ kiel parto de kontinento Afrik-Eŭrazio.\\nEŭropo estas kun 10 532 000 km² la dua malplej granda mondparto, sed tre dense loĝata - en la jaro 2016 ĝi havis 742.452.000 loĝantojn. Oni parolas ĉi tie per 209 diversaj lingvoj el 6 lingvaj familioj; sed absoluta plimulto de parolantoj uzas la hindoeŭropajn lingvojn. Historie kaj kulture Eŭropo havis principan influon al la monda civilizo kaj al la monda historio.\\nNorde limigas Eŭropon Norda Glacia Oceano, oriente montaro Uralo kaj rivero Uralo, sudoriente Kaspia Maro, riveroj Kuma kaj Maniĉ kaj Nigra Maro, sude Mediteraneo kaj okcidente Atlantiko. Kiel partoj de la sudorienta limo estas iam ankaŭ indikataj montaroj Kaŭkazio kaj rivero Emba."},{"page_url":"https://nl.wikipedia.org/wiki/Muruvik","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Muruvik_havn_01.jpg","page_title":"Muruvik","context_page_description":"Muruvik is een plaats in de Noorse gemeente Malvik, provincie Trøndelag. Muruvik telt 354 inwoners en heeft een oppervlakte van 0,41 km²."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_windmolens_in_Friesland","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Tjasker_Sanpoel_04.JPG","page_title":"Lijst van windmolens in Friesland","context_page_description":"Dit is een lijst van windmolens in Friesland. In Friesland staan ca. 150 complete windmolens en enkele tientallen windmotoren. Van de Nederlandse provincies heeft Friesland de meeste windmolens."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%99%8B%E6%9C%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Goddess_of_luo_shui_%28part%291.jpg","page_title":"晋朝","context_page_description":"晉朝是中國歷史的朝代之一，上承三國，下啟五胡十六國和南北朝，因晉朝皇室姓司馬，所以又稱司馬晉。晉朝又分為兩個時期，即西晉與東晉，合稱「兩晉」，共154年。西晉為晉武帝司馬炎所建立，首都為洛陽；東晉為晉元帝司馬睿所建立，首都為建康。兩晉的政治體制為世族政治，政治制度由漢代的三公、九卿制向隋唐的三省六部制過渡。\\n晉室先祖在三國時期為曹魏世族，司馬懿在高平陵之變後剷除曹氏皇親，自此司馬氏掌握曹魏實權形成霸府政治。266年，晉王司馬炎脅迫魏元帝曹奐禪讓帝位，改國號曰「晉」，定都洛陽，是為晉武帝，史稱西晉。280年，西晉滅孫吳而統一天下，但和平穩定的局面只維持了短短十幾年。晉惠帝繼位後，朝廷漸亂，領有軍權的諸候王紛紛動亂，史稱八王之亂。晉朝元氣大傷後，內遷中原的諸外民族乘機舉兵，造成五胡亂華的局面，大量百姓與世族開始南渡。316年，西晉滅亡，北方從此進入五胡十六國時期。\\n317年，晉室皇族司馬睿於建康稱帝，定都建康，是為晉元帝，史稱東晉，據有華南地區的領土。中原的世族及百姓陸續南遷，形成華北地區的僑民和南方土著共同聚居的局面。東晉初期，王導等人採取鎮之以靜策略，穩定局勢。東晉皇權衰落，朝廷大權主要由世族掌握，由於軍權外重內輕，朝廷控制力弱，不少藩鎮心懷野心，先後發生了王敦之亂、蘇峻之亂及桓溫專政。雖然部分士族當權者有恢復之心，前後發動幾次北伐，但是朝廷擔心野心家藉此擴張勢力，大多消極支持。383年，前秦出動舉國之師，意圖滅亡東晉。面對亡國之禍，東晉君臣一心，憑藉淝水之戰奠定勝局。謝玄等將領乘勝追擊，成功的收復大批失土，致使前秦崩解，引發了北方軍事和政治格局的變化。然而，東晉後期又發生朋黨相爭及桓玄作亂。平民負擔沉重，又發生孫盧之亂。譙縱亦據蜀地自立。最後劉裕崛起，平定諸亂，憑藉軍事力量奪得帝位，建國號「宋」，是為宋武帝，史稱劉宋，中國從此進入南北朝時期。\\n經濟方面，東晉莊園經濟的比例比西晉更大。由於農業技術提升等因素，在僑姓世族與吳姓世族密集開發下，江南獲得全面發展而繁榮興盛，中國的經濟重心也逐漸南移，後來才有大運河的出現。此外，手工業和商業方面也有長足進步。\\n晉朝雖為漢末以來中國文化中衰之時期，但在哲學、文學、藝術、史學、科技等等方面也有新的發展。漢代以前，政治主權完全在華夏，而他族則作為被統治者而同化，漢代以後，政治主權不全在華夏，而他族或以征服華夏者而同化，邊疆民族帶來的草原遊牧文化也融於中原文化。時天下大亂，士族文人多不以道義為重，儒學中衰。曠達之士，目擊衰亂，不甘隱避，則托為放逸，遂開清談之風。晉室之興，世亂未已，向秀之徒，益尚玄風。玄學與印度東傳之佛教交匯，中國文化逐漸轉變為儒釋道融合之狀況。"},{"page_url":"https://de.wikipedia.org/wiki/Verkehrsmuseum_Frankfurt_am_Main","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/F-Triebwagen_Schwanheim_01052009.JPG","page_title":"Verkehrsmuseum Frankfurt am Main","context_page_description":"Das Verkehrsmuseum Frankfurt am Main ist ein der Verkehrsgeschichte des städtischen Nahverkehrs in Frankfurt am Main und dem Rhein-Main-Gebiet gewidmetes Verkehrsmuseum im Frankfurter Stadtteil Schwanheim. Das Museum ist zugleich Firmenmuseum der Stadtwerke Frankfurt am Main und der Verkehrsgesellschaft Frankfurt. Es ist ein Bestandteil der Route der Industriekultur Rhein-Main."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D1%8B%D1%88%D0%BD%D0%B8%D0%B9_%D0%92%D0%BE%D0%BB%D0%BE%D1%87%D1%91%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/%D0%92%D1%8B%D1%88%D0%BD%D0%B8%D0%B9_%D0%92%D0%BE%D0%BB%D0%BE%D1%87%D1%91%D0%BA._%D0%A1%D1%82%D0%B0%D1%80%D0%B8%D0%BD%D0%BD%D0%BE%D0%B5_%D0%B7%D0%B4%D0%B0%D0%BD%D0%B8%D0%B5..jpg","page_title":"Вышний Волочёк","context_page_description":"Вы́шний Волочёк — город в Тверской области России. Административный центр муниципального образования Вышневолоцкий городской округ.\\nНаселение — 46 211 чел.\\nГород расположен на северо-восточной окраине Валдайской возвышенности, на реке Цне, в 119 км к северо-западу от Твери. В Вышнем Волочке берёт исток река Тверца.\\nВышний Волочёк находится на 297 км федеральной дороги «Россия», имеется железнодорожная станция."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B3%D8%A7%D8%B9%D8%AF_%D9%81%D9%8A_%D9%84%D9%88%D9%81%D8%AA%D9%81%D8%A7%D9%81%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Bundesarchiv_Bild_101I-633-3822-05A%2C_Flakhelfer_am_Horchger%C3%A4t.jpg","page_title":"مساعد في لوفتفافه","context_page_description":"لوفتڤافنهيلفر، المعروف أيضًا باسم Flakhelfer، أي عضو في فريق العمل المساعد في لوفتفافه الألمانية خلال الحرب العالمية الثانية. وغالبًا ما تتضمن هذه المصطلحات الطلاب الذين يتم تجنيدهم كجنود أطفال."},{"page_url":"https://la.wikipedia.org/wiki/Pontes_Coloniae_Agrippinae","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/K%C3%B6lner_Rhein.jpg","page_title":"Pontes Coloniae Agrippinae","context_page_description":"Hic habes index pontium Coloniae Agrippinae."},{"page_url":"https://es.wikipedia.org/wiki/Sat%C3%AD_(ritual)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d6/Hindu_Suttee.jpg","page_title":"Satí (ritual)","context_page_description":"La palabra sánscrita sati se refiere al rito o acto en el cual una mujer se inmola en la pira funeraria del recién fallecido marido, o al sujeto que ejecuta la acción de inmolarse.\\nDe acuerdo con algunos expertos, el origen de este rito se remonta siglos antes de Cristo. Si bien es cierto que no se tiene certeza de cuándo exactamente y quién originó el ritual, existe literatura histórica diversa que sitúa su apogeo a partir del siglo IV después de Cristo. Esta práctica fue común en las comunidades hindúes durante siglos.\\nLa palabra se origina en la leyenda de la diosa Sati, esposa del dios Shiva en la mitología hinduista.\\nLa práctica del sati en India estuvo vigente hasta su abolición en 1829 por lord William Bentinck durante la ocupación británica en el este de la península. No obstante, se han reportado casos de sati efectuados en la clandestinidad en la India moderna.\\nEn Nepal, Jung Bahadur Rana hizo la primera restricción en 1853 del ritual prohibiéndolo cuando la viuda era menor de 16 años o cuando tenían hijos menores de 9 años. En 1920 fue completamente abolida por el dictador Chandra Shamsher."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9C%D0%B5%D1%80%D1%86%D0%B5%D0%B4%D0%B5%D1%81-%D0%91%D0%B5%D0%BD%D1%86_GLS-%D0%BA%D0%BB%D0%B0%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Mercedes-Benz_GL_500_4MATIC_%28X_166%29_%E2%80%93_Frontansicht%2C_13._Juni_2014%2C_D%C3%BCsseldorf.jpg","page_title":"Мерцедес-Бенц GLS-класа","context_page_description":"„Мерцедес-Бенц GLS-класа“, наричан до 2016 година „GL-класа“, е модел големи автомобили с повишена проходимост на германската компания „Мерцедес-Бенц“, произвеждан в три поколения от 2006 година.\\nВъведен е като по-голям, седемместен вариант на „Мерцедес-Бенц ML-класа“ и е най-високият клас SUV автомобил на марката."},{"page_url":"https://pl.wikipedia.org/wiki/Dodge_Viper","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Dodge_Viper_RT-10_-_Flickr_-_Alexandre_Pr%C3%A9vot_%287%29.jpg","page_title":"Dodge Viper","context_page_description":"Dodge Viper – samochód sportowy klasy średniej produkowany pod amerykańską marką Dodge w latach 1991 – 2017."},{"page_url":"https://en.wikipedia.org/wiki/Cierva_C.6","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Bundesarchiv_Bild_102-09500%2C_Windm%C3%BChlen-Aeroplan_Cleaned%27n%27Cropped.jpg","page_title":"Cierva C.6","context_page_description":"The Cierva C.6 was the sixth autogyro designed by engineer Juan de la Cierva, and the first one to travel a \\"major\\" distance. Cierva, the engineer responsible for the invention of the autogyro, had spent all his funds on the research and creation of his first five prototypes. Therefore, in 1923, he turned to the Cuatro Vientos Aerodynamics Laboratory chief, Commander Emilio Herrera, who succeeded in persuading General Francisco Echagüe, the director of the Military Aviation Aeronautics Department, to take over the second stage in the research and development of Cierva's autogyros.\\nAfter several wind tunnel tests, Military Aviation built a Cierva C.6 autogyro in an Avro 504 frame. This machine, piloted by Captain Joaquín Loriga Taboada, made three flights, all of them in March 1924. One of those flights, the eight-minute trip from Cuatro Vientos airfield to Getafe airfield, was considered a giant step for Cierva's autogyros.\\nThe Cierva C.6 prototype was fitted with ailerons mounted on two small wings, also with elevators and a rudder. This complete three-axis control scheme was needed because the pilot had only limited control over the rotor."},{"page_url":"https://ca.wikipedia.org/wiki/Llista_de_monuments_del_districte_de_Sant_Andreu","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Can_Mazantini2.jpg","page_title":"Llista de monuments del districte de Sant Andreu","context_page_description":"Llista de monuments del districte de Sant Andreu inclosos en l'Inventari del Patrimoni Arquitectònic Català i en el catàleg de Patrimoni Arquitectònic de Barcelona."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%A6%8F%E7%94%B0COCO_Park","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/COCO_Park_Enterance.jpg","page_title":"福田COCO Park","context_page_description":"福田Coco Park鄰近深圳會展中心及深圳地鐵購物公園站，於2006年9月30日正式對外開放，是星河商置旗下第一個COCO Park品牌商場。商場樓高5層，面積達85,000平方米。商場設有百老匯院線，提供5個影院，合共774座位的戲院，為百老匯院線在中國內地首家影院。整個項目總投資達6.8億人民幣。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%91%D0%B5%D0%BB%D0%BE%D0%B3%D1%80%D0%B0%D0%B4%D1%87%D0%B8%D1%86%D1%8C%D0%BA%D1%96_%D1%81%D0%BA%D0%B5%D0%BB%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Belogradchik_Rocks3848.JPG","page_title":"Белоградчицькі скелі","context_page_description":"Белоградчицькі скелі — група скельних утворень незвичайної форми з пісковика і конгломерату, розташована на західному схилі гір Стара-Планіна недалеко від міста Белоградчика на північно-заході Болгарії. Скелі відрізняються по кольору від червоного до жовтого; висота деяких скель досягає 200 м. Багато скель мають химерні обриси і пов'язані з цікавими легендами. Найчастіше їх називали в честь людей або предметів, на які, як вважалося, вони походили. Белоградчицькі скелі оголошені болгарським урядом природною пам'яткою і є головною туристичною пам'яткою регіону. Вони є єдиним місцем проживання рослини, яка перебуває під загрозою зникнення, болгарського ендеміка Hieracium belogradcense."},{"page_url":"https://en.wikipedia.org/wiki/Eurazhdarcho","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Azhdarchid_map.png","page_title":"Eurazhdarcho","context_page_description":"Eurazhdarcho is a genus of pterodactyloid pterosaur from the Late Cretaceous period of what is now the Transylvanian Basin of Romania."},{"page_url":"https://eo.wikipedia.org/wiki/A%C5%ADstria_Societo_por_Interpopola_Kompreni%C4%9Do","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Diplomo-Urkunde.JPG","page_title":"Aŭstria Societo por Interpopola Kompreniĝo","context_page_description":"Aŭstria Societo por Interpopola Kompreniĝo fondiĝis la 19-an de marto 1990 en Klostronovburgo, nur kelkajn monatojn poste, kiam la Internacia Societo por Interpopola Kompreniĝo transdonis al la urbokomunumo Klostronovburgo la 21-an de oktobro 1989 la titolon Urbo de la Interpopola Kompreniĝo. Ekde la fondiĝo la Societo komune kun Paneŭropa Unio okazigis proksimume 70 prelegojn de pinteminentuloj el politiko, societo, ekonomio, religiaj komunumoj, arto kaj kulturo. La inaŭguran prelegon, la 19-an de marto 1990, parolis la tiama Ministro por Eksterlandoj Aferoj d-ro Alois MOCK pri la temo \\"La Aŭstria kontribuo al la Interpopola Kompreniĝo\\". Inter la parolantoj estis ne malpli ol 4 ŝtatestroj, 2 registaraj estroj, 25 registaraj membroj, 4 EU-komisionanoj, 2 kardinaloj, 3 episkopoj kaj pluraj plej altaj altranguloj de aliaj religiaj komunumoj, landestroj, prezidantoj de altjuĝejoj kaj kontrolinstancoj, sed ankaŭ multaj ambasadoroj, pintanstataŭantoj de en- kaj eksterlandaj politikaj kaj ekonomiaj instancoj krome art- kaj kulturkreantoj.\\nEsterordinara aranĝo okazis la 18-an de januaro 2011 en kiu parolis pri la temo \\"Interpopola Kompreniĝo en Aŭstrio\\" la 4 ambasadoroj:"},{"page_url":"https://es.wikipedia.org/wiki/Jarque_de_Moncayo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Bandera_de_Jarque.svg","page_title":"Jarque de Moncayo","context_page_description":"Jarque de Moncayo ​ es un municipio español, en la comarca del Aranda, provincia de Zaragoza, Aragón. Se halla en la denominada sierra de la Virgen —perteneciente al sistema Ibérico—, en el valle del río Aranda."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8A%D5%B8%D5%AC%D5%A1%D5%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Ayuntamiento_de_Pol%C3%A1n.jpg","page_title":"Պոլան","context_page_description":"Պոլան, մունիցիպալիտետ Իսպանիայում։ Գտնվում է Տոլեդո պրովինցիայի Կաստիլիա լա Մանչա ինքնավար համայնքի կազմում։ Մունիցիպալիտետը գտնվում է թվականի Մոնտես-դե-Տոլեդո շրջանում։ Տարածքը կազմում է 158 կմ², բնակչությունը՝ 4066 մարդ ։ Պրովինցիայի վարչական կենտրոնից գտնվում է 17 կմ հեռավորության վրա։"},{"page_url":"https://zh.wikipedia.org/zh-sg/%E9%87%91%E9%96%80%E7%B8%A3%E6%96%87%E5%8C%96%E8%B3%87%E7%94%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/%E6%B9%96%E4%B8%8B%E4%B8%89%E9%96%93%E6%A8%93%E4%BB%94.jpg","page_title":"金門縣文化資產","context_page_description":"金门县文化资产是位于中华民国金门县的古迹与历史建筑，以下的古迹与历史建筑均收录在中华民国行政院文化部文化资产局的网站里。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A5%D0%B0%D0%B6%D0%B8%D0%BA%D0%BE%D0%B2%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Charzykowy.jpg","page_title":"Хажикови","context_page_description":"Хажикови — село в Польщі, у гміні Хойніце Хойницького повіту Поморського воєводства.\\nНаселення — 1792 особи.\\nУ 1975-1998 роках село належало до Бидгощського воєводства."},{"page_url":"https://nl.wikipedia.org/wiki/Kalketrip","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Centaurea_calcitrapa_Sturm28.jpg","page_title":"Kalketrip","context_page_description":"De kalketrip is een eenjarige of tweejarige plant die behoort tot de composietenfamilie. Het is een plant van droge, voedsel- en kalkrijke grond. De plant komt van nature voor in Europa, maar heeft zich ook in Noord-Amerika verspreid. In Nederland komt de plant voor in Zuid-Limburg. De soort staat op de Nederlandse Rode lijst van planten als zeer zeldzaam en zeer sterk afgenomen. Deze plant is in Nederland wettelijk beschermd sinds 1 januari 2017 door de Wet Natuurbescherming.\\nDe plant wordt 15-60 cm hoog en vormt een bladrozet. De opstijgende en bochtige stengels zijn vrijwel kaal, gegroefd en struikachtig vertakt. De onderste bladeren zijn afgebroken veerdelig en de bovenste bladeren zijn lancet- of lijnvormig en hebben een stekelige punt. Tijdens de bloei zijn de onderste bladeren al afgestorven.\\nKalketrip bloeit van juli tot september met roze of purperen, soms witte bloemen. De bloeiwijze is een hoofdje. De bloemhoofdjes zijn 6-8 mm in doorsnee en 1,5-2 cm lang. De omwindselblaadjes hebben een rechte top, zijn boven de voet iets ingesnoerd en hebben daar boven een gestekeld aanhangsel. Aan de top van de buitenste omwindselblaadjes zit een 1-2,5 cm lange stekel."},{"page_url":"https://en.wikipedia.org/wiki/Southern_Patagonian_Ice_Field","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Southern_Patagonia_Ice_Field_from_ISS.jpg","page_title":"Southern Patagonian Ice Field","context_page_description":"The Southern Patagonian Ice Field, located at the Southern Patagonic Andes between Chile and Argentina, is the world's second largest contiguous extrapolar ice field. It is the bigger of two remnant parts of the Patagonian Ice Sheet, which covered all of southern Chile during the last glacial period, locally called the Llanquihue glaciation."},{"page_url":"https://ca.wikipedia.org/wiki/Logaritme_natural","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/NaturalLogarithmAll.png","page_title":"Logaritme natural","context_page_description":"El logaritme neperià, logaritme natural o logaritme hiperbòlic és el logaritme en base e, on e és un nombre irracional que val 2.718281828459045... En termes senzills, el logaritme natural d'un nombre x és la potència a què caldria elevar e perquè doni x — per exemple el logaritme natural de e és 1 perquè e¹ = e, mentre que el logaritme natural d'1 ha de ser 0, atès que e⁰ = 1. El logaritme natural es pot definir per a tots els nombres reals positius x com l’àrea compresa sota la corba y = 1/t des d'1 a x i també es pot definir per als nombres complexos diferents de zero tal com s'explicarà més avall.\\nLa funció logaritme natural també es pot definir com la funció inversa de la funció exponencial, portant a les següents identitats:\\nEn altres paraules, la funció logaritme és una bijecció del conjunt dels nombres reals positius al conjunt de tots els nombres reals. De forma més precisa, és un isomorfisme del grup que formen els nombres reals positius amb l'operació multiplicació en el grup que formen els nombres reals amb l'operació addició."},{"page_url":"https://de.wikipedia.org/wiki/Villa_Mosconi_Bertani","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f3/Early_1800s_barrels_at_Tenuta_Santa_Maria_di_Gaetano_Bertani.jpg","page_title":"Villa Mosconi Bertani","context_page_description":"Die Villa Mosconi Bertani ist eine neoklassizistische, venezianische Villa und Weinkellerei aus dem 18. Jahrhundert. Die Villa liegt in der Gemeinde Negrar di Valpolicella im Novare-Tal.\\nVilla und Weingut sind bekannt für ihre lange Geschichte der Produktion von Amarone Classico, einer bekannten Weinsorte aus dem Anbaugebiet Valpolicella. Das Anwesen entstand ursprünglich als Erweiterung eines früheren Komplexes aus dem 16. Jahrhundert und besteht heute aus einer Sommerresidenz, einem monumentalen Keller, einem 22 Hektar großen Weinberg, sowie weiterer Weinanbauflächen.\\nDie Villa Mosconi Bertani war zur Zeit der Romantik sowohl als wichtiger Treffpunkt für berühmte Dichter und Schriftsteller, als auch Geburtsort der Weinsorte „Amarone“ bekannt.\\nUrsprünglich war die Villa Produktionsstätte des Weines „Amarone della Cave. G.B. Bertani“. Seit 2012 werden hier die Reserveweine der Marke „Tenuta Santa Maria“ von der Familie Gaetano Bertani gekeltert. Villa, Park, Weingut und Weinberge sind für Führungen sowie für kulturelle und private Veranstaltungen geöffnet."},{"page_url":"https://es.wikipedia.org/wiki/Museo_Nacional_de_la_Construcci%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/NBM_Exterior_View_from_Police_Memorial.jpg","page_title":"Museo Nacional de la Construcción","context_page_description":"El museo nacional de la Construcción es un museo de «arquitectura, diseño, ingeniería, construcción y urbanismo» situado en el 401 F Street NW en Washington D. C., Estados Unidos. Fue creado por una ley del Congreso en 1980, y es una organización sin ánimo de lucro; está al lado del National Law Enforcement Officers Memorial y de la estación de Metro de Judiciary Square. El museo alberga varias exposiciones temporales en galerías alrededor del espacioso Great Hall.\\nEl edificio, completado en 1887, sirvió como el Pension Building, albergando el United States Pension Bureau, y allí se celebraron varios bailes inaugurales presidenciales. Es un importante y temprano ejemplo a gran escala de la arquitectura neorrenacentista, y fue designado Hito Histórico Nacional en 1985."},{"page_url":"https://en.wikipedia.org/wiki/Hermetia_illucens","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/Black-soldier-fly-depositing-eggs-in-wormfarm.jpg","page_title":"Hermetia illucens","context_page_description":"Hermetia illucens, the black soldier fly, is a common and widespread fly of the family Stratiomyidae."},{"page_url":"https://ca.wikipedia.org/wiki/Vilassar_de_Mar","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/79/Vilassar_de_Mar_-_Can_Bassa_i_Casa_Molino.jpg","page_title":"Vilassar de Mar","context_page_description":"Vilassar de Mar és un municipi de la comarca del Maresme a la província de Barcelona. Confronta amb el Mar Mediterrani, Premià de Mar, Premià de Dalt, Vilassar de Dalt, Cabrils i Cabrera de Mar. De relleu pla, la seva economia es basa en la floricultura i els serveis."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%A9%D8%A7%D8%AF%D9%88%D9%85%D8%A7%D8%AA%D8%B3%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/68/%E4%BD%8F%E5%90%89%E7%A5%9E%E7%A4%BE_%28%E7%A5%9E%E6%88%B8%E5%B8%82%E8%A5%BF%E5%8C%BA%292008%E5%88%9D%E8%A9%A3_%E7%A4%BE%E6%AE%BFP1010466.jpg","page_title":"کادوماتسو","context_page_description":"کادوماتسو به معنای دروازه کاج یک نوع تزئین در سال نوی ژاپنی است که در جلوی منازل و برای خوش آمدگویی برای ورود کامی یا ارواح اجداد است."},{"page_url":"https://vi.wikipedia.org/wiki/Mu_(gi%E1%BA%A3i_ph%E1%BA%ABu_c%C6%A1_th%E1%BB%83_ng%C6%B0%E1%BB%9Di)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Mons_Venus_with_Hair.jpg","page_title":"Mu (giải phẫu cơ thể người)","context_page_description":"Mu, hay mu lồn, là phần nhô cao bên ngoài bộ phận sinh dục nữ, nằm trên xương mu, là phần tích tụ của mô mỡ dưới da, phía bên trên của xương mu. Đến tuổi dậy thì, lông mu bắt đầu mọc và bao phủ phần mu."},{"page_url":"https://en.wikipedia.org/wiki/Supayagyi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Thibaw_Min_1885_crop.jpg","page_title":"Supayagyi","context_page_description":"Supayagyi, also spelt Suphayagyi, was the penultimate chief queen consort of the Konbaung dynasty, and was married to Thibaw Min, the last monarch in the dynasty."},{"page_url":"https://en.wikipedia.org/wiki/Frankfurt%E2%80%93Offenbach_Local_Railway","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Frankfurt_Lokalbahnhof_1900.jpg","page_title":"Frankfurt–Offenbach Local Railway","context_page_description":"The Frankfurt-Offenbach local railway was a former railway in the Frankfurt am Main area, which developed from the state-owned Frankfurt-Offenbach Railway. The line opened in 1848 and was one of the oldest railways in Germany. It was the first railway line between the Frankfurt and the nearby city of Offenbach and operated until 1955."},{"page_url":"https://nl.wikipedia.org/wiki/Nonduif","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Nonduif_rood.jpg","page_title":"Nonduif","context_page_description":"De nonduif is een duivenras dat door een groot aantal fokkers over de hele wereld gefokt wordt. De nonduif wordt al genoemd in de boeken van de schrijvers Aldrovandi omstreeks 1600 en van John Moore omstreeks 1750 waarin zelfs de eerste tekening van de nonduif staat afgebeeld. Deze duif is ingedeeld bij de sierduiven in de groep tuimelaarrassen. Hij stamt af van de rotsduif. Het is een middelgrote duif, met een kort en compact lichaam. Duivenkenner en keurmeester Cornelis Spruijt stelde in 1955 nog dat nonduiven goed broeden en hun jongen zorgzaam grootbrengen. Tegenwoordig broeden nonduiven niet zo goed doordat men gebruik is gaan maken van voedsterduiven, zoals postduiven, om zo meer jongen te kunnen fokken. De nonduiven hoefden zelf niet meer te broeden en zo is deze eigenschap uit het ras gefokt. De doffers zijn onderling erg agressief in de broedtijd en in deze strijd gaat nog al eens een ei verloren. Momenteel zijn er wel weer fokkers die de nonduiven hun eigen jongen laten grootbrengen en zo proberen deze eigenschap weer terug te brengen in het ras. De naam tuimelaar heeft deze duif gekregen om zijn bijzondere manier van vliegen."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%80%E3%83%8B%E3%82%A8%E3%83%AB%E3%83%BB%E3%83%95%E3%83%A9%E3%83%B3%E3%82%BD%E3%83%AF%E3%83%BB%E3%83%9E%E3%83%A9%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/DFMalanPortret.jpg","page_title":"ダニエル・フランソワ・マラン","context_page_description":"ダニエル・フランソワ・マランは、南アフリカの牧師、政治家。\\nアフリカーナー国家主義者の代表格で、国民党の指導者となる。1948年から1958年まで南アフリカ連邦の首相を務め、アパルトヘイトを確立した。"},{"page_url":"https://en.wikipedia.org/wiki/Orion_(spacecraft)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Orion_Service_Module.jpg","page_title":"Orion (spacecraft)","context_page_description":"Orion is a class of partially reusable space capsules to be used in NASA's human spaceflight programs. The spacecraft consists of a Crew Module manufactured by Lockheed Martin and the European Service Module manufactured by Airbus Defence and Space. Capable of supporting a crew of six beyond low Earth orbit, Orion can last up to 21 days undocked and up to six months docked. It is equipped with solar panels, an automated docking system, and glass cockpit interfaces modeled after those used in the Boeing 787 Dreamliner. A single AJ10 engine provides the spacecraft's primary propulsion, while eight R-4D-11 engines, and six pods of custom reaction control system engines developed by Airbus, provide the spacecraft's secondary propulsion. Although compatible with other launch vehicles, Orion is primarily designed to launch atop a Space Launch System rocket, with a tower launch escape system.\\nOrion was originally conceived by Lockheed Martin as a proposal for the Crew Exploration Vehicle to be used in NASA's Constellation program. Lockheed Martin's proposal defeated a competing proposal by Northrop Grumman, and was selected by NASA in 2006 to be the CEV."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_n%C3%A9cropoles_nationales_en_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Verdun_cimetiere_militaire_fran%C3%A7ais_faubourg_pave.JPG","page_title":"Liste de nécropoles nationales en France","context_page_description":"En France, une nécropole nationale est un cimetière militaire appartenant à l’État français.\\nIl existe en France 265 nécropoles nationales où reposent 740 000 corps de soldats, dont 240 000 en ossuaires.\\nSur l'ensemble des dépouilles des soldats, 88 % sont celles de combattants de la Première Guerre mondiale.\\nLes nécropoles nationales ont été créées par la loi du 29 décembre 1915 pour regrouper les corps des combattants « morts pour la France » avec des sépultures perpétuelles. Ces nécropoles sont la propriété de l’État français qui en assure la garde et l'entretien. Ces deux missions sont confiées au secrétariat d’État chargé des anciens combattants.\\nÀ ces nécropoles nationales s'ajoutent 2 000 carrés militaires dans les cimetières communaux répartis sur le territoire national. Dans ces carrés militaires reposent 115 000 corps. La garde et l'entretien des sépultures de ces carrés militaires sont principalement assurés par le Souvenir Français, très peu subventionné par le secrétariat d’État aux anciens combattants ou par les communes selon un accord entre les deux parties."},{"page_url":"https://de.wikipedia.org/wiki/Kieler_Wappen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Siegel_Stadt_Kiel_1906.jpg","page_title":"Kieler Wappen","context_page_description":"Das Kieler Wappen ist ein jahrhundertealtes Stadtwappen beziehungsweise Symbol der Stadt Kiel."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_rijksmonumenten_in_Mesch","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/96/Mesch-Klokkestraat_10.JPG","page_title":"Lijst van rijksmonumenten in Mesch","context_page_description":"De plaats Mesch telt 11 inschrijvingen in het rijksmonumentenregister. Hieronder een overzicht."},{"page_url":"https://pl.wikipedia.org/wiki/Augusta_(stacja_kolejowa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Stazione_di_augusta.jpg","page_title":"Augusta (stacja kolejowa)","context_page_description":"Augusta – stacja kolejowa w Augusta, w prowincji Syrakuzy, w regionie Sycylia, we Włoszech."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%AC%D8%B4%D9%86%D9%88%D8%A7%D8%B1%D9%87_%D8%B2%D9%85%D8%B3%D8%AA%D8%A7%D9%86%DB%8C_%DA%A9%D8%A8%DA%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Qu%C3%A9bec-Carnaval-Palais-_2011.JPG","page_title":"جشنواره زمستانی کبک","context_page_description":"جشنواره زمستانی کبک، که به‌طور معمول در انگلیسی و فرانسوی به عنوان کارناوال کبک شناخته می‌شود، یک جشنواره پیش از چله روزه در کبک است. از ۱۸۹۴ این جشنواره در دوره‌هایی به صورت متناوب برگزار می‌شد اما از سال ۱۹۵۵ کارناوال کبک هر ساله جشن گرفته می‌شود. در آن سال شمایل آدمک بونهوم به عنوان نماد جشنواره، برای اولین بار به نمایش گذاشته شد. در سال ۲۰۰۶، حدود یک میلیون نفر در سالن جشنواره زمستانی کبک حضور داشتند که بزرگترین جشنواره زمستانی در جهان در آن زمان را شکل می‌داد.\\nمعروف‌ترین جاذبه‌های این جشنواره زمستانی فعالیت‌های شبانه و روزانه به رهبری آدمک بونهوم است. بادکنک‌های بزرگ نمایشی که از بالای شهر می‌آیند، با چراغ‌ها و مجسمه‌های یخی تزئین شده‌اند.\\nتعداد زیادی از مهمانی‌ها و گردهم‌آیی‌های عمومی و خصوصی، نمایش‌ها و رقص‌ها در سراسر شهر برگزار می‌شوند، بعضی از آنها در هوای سرد جانسوز بیرون قرار دارند و افسانه کبکی شادی زندگی را بازگو می‌کنند."},{"page_url":"https://sv.wikipedia.org/wiki/Lista_%C3%B6ver_byggnadsminnen_i_%C3%96rebro_l%C3%A4n","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/%C3%96rebro_p%C3%A5_cykel_%2855%29.JPG","page_title":"Lista över byggnadsminnen i Örebro län","context_page_description":"Förteckning över byggnadsminnen i Örebro län."},{"page_url":"https://en.wikipedia.org/wiki/Secunderabad","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Secunderabad_Welcome_Sign.jpg","page_title":"Secunderabad","context_page_description":"Secunderabad is the twin city of Hyderabad in the Indian state of Telangana. Named after Sikandar Jah, the third Nizam of the Asaf Jahi dynasty, Secunderabad was established in 1806 as a British cantonment. Although both the cities are together referred to as the twin cities, Hyderabad and Secunderabad have different histories and cultures, with Secunderabad having developed directly under British rule until 1948, and Hyderabad as the capital of the Nizams' princely state of Hyderabad.\\nGeographically divided from Hyderabad by the Hussain Sagar lake, Secunderabad is no longer a separate municipal unit and has become part of Hyderabad's Greater Hyderabad Municipal Corporation. Both cities are collectively known as Hyderabad and together form the fifth-largest metropolis in India. Being one of the largest cantonments in India, Secunderabad has a large presence of army and air force personnel."},{"page_url":"https://ro.wikipedia.org/wiki/Tito_Jackson","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Tito_Jackson_2009-07-19.jpg","page_title":"Tito Jackson","context_page_description":"Tito Jackson este un cantautor american. Este al treilea copil al familiei Jackson."},{"page_url":"https://br.wikipedia.org/wiki/Laezh","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4d/The_little_milk-girl_mg_0109.jpg","page_title":"Laezh","context_page_description":"Krogit e-barzh!\\nUn danvez pennad eo ar pennad-mañ ha labour zo d'ober c'hoazh a-raok e beurechuiñ.\\nGallout a rit skoazellañ Wikipedia dre glokaat anezhañ.\\nAl laezh a zo un dourenn, pe ul liñvenn, gwenn he liv, a vez furmet e bronnoù ar bronnegezed e-keit ma vezont o tougen re vihan.\\nAr magadur gwellañ, hag an hini nemetañ a c'haller reiñ d'an darn vuiañ eus ar bronneged bihan eo: ennañ e kavont pezh zo ezhomm da greskiñ. D'ar vugale e c'haller reiñ pe laezh o mamm, o vezañ m'eo ur vronnegez ivez, pe hini ul loen bronnek bennak all, laezh-saout dreist-holl en hon bro."},{"page_url":"https://zh.wikipedia.org/wiki/EC-121%E5%87%BB%E8%90%BD%E4%BA%8B%E4%BB%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Lockheed_EC-121D_Thailand_1972.jpg","page_title":"EC-121击落事件","context_page_description":"1969年4月15日，美国海军一架洛克希德EC-121预警机在朝鲜咸镜北道的清津市东南方向的日本海上空，侦察飞行过程中被朝鲜两架米格-17战斗机击落，31名机组人员全部丧生，一度造成美国和朝鲜关系高度紧张，当时美国尼克森总统曾经考虑动用核武器报复朝鲜，但事后双方并未再进一步发生武装冲突。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%90%D0%BB%D0%B5%D1%84%D0%B5%D0%BB%D1%8C%D0%B4-%D0%91%D1%96%D1%81%D1%82%D0%B5%D0%BD%D0%B7%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/62/Ahlefeld-Bistensee_in_RD.png","page_title":"Алефельд-Бістензе","context_page_description":"Алефельд-Бістензе — громада в Німеччині, розташована в землі Шлезвіг-Гольштейн. Входить до складу району Рендсбург-Екернферде. Складова частина об'єднання громад Гюттенер-Берге.\\nПлоща — 10,04 км². Населення становить 496 ос."},{"page_url":"https://de.wikipedia.org/wiki/Krzysztof_Kowalewski","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Krzysztof_Kowalewski_%282018%29.jpg","page_title":"Krzysztof Kowalewski","context_page_description":"Krzysztof Kowalewski ist ein polnischer Schauspieler."},{"page_url":"https://cy.wikipedia.org/wiki/Sabich","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Sabich1.jpg","page_title":"Sabich","context_page_description":"Mae Sabich yn fwyd llyseiol Israeli-Iraci poblogaidd sy'n gyffredin ar draws Israel. Mae'r cynhwysion yn debyg i gynhwysion brecwast Iddewon Irac ar y Sabath. Mae'r Sabich Israeli cyfoes yn cyfuno'r holl gynhwysion mewn bara pita yn hytrach nag ar hambwrdd neu blât fawr."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E6%98%B4%E5%AE%BF%E5%85%AD","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e1/M45map.jpg","page_title":"昴宿六","context_page_description":"昴宿六西方星名為Alcyone，是一個在金牛座的聚星系統。距離太陽大約440光年，為昴宿星團中最明亮的一顆恆星，該星團很年輕，年齡大約1億年。還有數顆暗淡的恆星很靠近昴宿六，很可能都是星團的成員。"},{"page_url":"https://pl.wikipedia.org/wiki/Plac_%C5%9Awi%C4%99tej_Katarzyny_w_Toruniu","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Plac_%C5%9Bw._Katarzyny_w_Toruniu.jpg","page_title":"Plac Świętej Katarzyny w Toruniu","context_page_description":"Plac Świętej Katarzyny w Toruniu – plac położony w centrum Torunia."},{"page_url":"https://jv.wikipedia.org/wiki/Yadnya_(awatara)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/74/Gurudeva_at_homa_fire.jpg","page_title":"Yadnya (awatara)","context_page_description":"Cithakan:Hindu Déwa Infobox Yadnya utawi Yadnyeswara inggih punika salah satungaling awatara Wisnu wonten ing agama Hindhu. Piyambakipun minangka panguwasa sadaya upacara wonten ing agama Hindhu. Piyambakipun njabat minangka Indra wonten ing Manwantara kapisanan, éra Swayambu Manu."},{"page_url":"https://eo.wikipedia.org/wiki/P%C3%A9ter_H%C3%A9derv%C3%A1ri","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Hedervari_Peter_emlektabla_CRW_0264-1000.jpg","page_title":"Péter Hédervári","context_page_description":"Péter Hédervári, laŭ hungarlingve kutima sinsekvo Hédervári Péter estis hungara verkisto, ĵurnalisto, geologo, amatora astronomo.\\nPéter Hédervári naskiĝis la 29-an de aprilo 1931 en Budapeŝto. Li mortis la 27-an de junio 1984 en Budapeŝto."},{"page_url":"https://cs.wikipedia.org/wiki/Dronte_samot%C3%A1%C5%99sk%C3%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Pezophaps_solitaria.png","page_title":"Dronte samotářský","context_page_description":"Dronte samotářský nebo dodo samotář je vyhynulým ptákem z podčeledi drontovití a monotypického rodu Pezophaps.\\nDronte samotářský obýval suché lesy a křovinaté porosty na ostrově Rodrigues v Indickém oceánu. Druh popsal Johann Friedrich Gmelin jako Didus solitarius, toto starší pojmenování je v současnosti hodnoceno jako vědecké synonymum. Dronte samotářský byl nejbližší příbuzný dronta mauricijského. Podle analýzy DNA se od sebe linie obou druhů rozdělily před 25,6 miliony lety. Oba druhy se vyvíjely pravděpodobně nezávisle na sobě.\\nDronte samotářský byl vysoký podobně jako dronte mauricijský, měřil asi 1 m, ale vzhledem se od dronta mauricijského odlišoval méně vyvinutým zobákem a celkově více vypadal jako holub. Přesná podoba tohoto ptáka není jistá. Ptáka podrobně popsali Julien Tafforet nebo François Leguat, jedni z prvních osadníků na ostrově. Podle těchto zpráv pták vážil 40–50 liber, měl převážně světlešedé zbarvení a krátký ostrý zobák. Velmi rychle běhal, ale byl nelétavý. Pomocí třeskání křídly vytvářeli ptáci velmi hlasité zvuky, kterými si pravděpodobně vymezovali území. Křídla také sloužila jako zbraň."},{"page_url":"https://pt.wikipedia.org/wiki/Bapaume","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/Le_beffroi_de_bapaume.jpg","page_title":"Bapaume","context_page_description":"Bapaume é uma comuna no departamento de Pas-de-Calais, norte da França."},{"page_url":"https://en.wikipedia.org/wiki/Saint-Romain,_Charente","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Stromain_mairie.JPG","page_title":"Saint-Romain, Charente","context_page_description":"Saint-Romain is a commune in the Charente department in southwestern France."},{"page_url":"https://en.wikipedia.org/wiki/Rock-cut_tomb","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Gerdek_Rock_Tomb_front_detail%2C_Hellenistic_period%2C_2nd_century_BC%2C_district_of_%C3%87orum%2C_Turkey.jpg","page_title":"Rock-cut tomb","context_page_description":"A rock-cut tomb is a burial chamber that is cut into an existing, naturally occurring rock formation, so a type of rock-cut architecture. They are usually cut into a cliff or sloping rock face, but may go down from fairly flat ground. It was a common form of burial for the wealthy in ancient times in several parts of the world.\\nImportant examples are found in Egypt, most notably in the town of Deir el-Medina, located between the Valley of the Kings and the Valley of the Queens. Other notable clusters include numerous rock-cut tombs in modern Israel, at Naghsh-e Rostam necropolis in Iran, at Myra in Turkey, Petra in modern Jordan, Mada'in Saleh in Saudi Arabia, Sicily and Larnaca. Indian rock-cut architecture is very extensive, but does not feature tombs."},{"page_url":"https://en.wikipedia.org/wiki/Morton,_Derbyshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Morton_-_former_schoolroom.jpg","page_title":"Morton, Derbyshire","context_page_description":"Morton is a civil parish and village, three miles north of Alfreton in North East Derbyshire, Derbyshire, England. The civil parish population at the 2011 Census was 1,195."},{"page_url":"https://es.wikipedia.org/wiki/Idioma_me%C3%A4nkieli","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Me%C3%A4nkieli_puhujat.png","page_title":"Idioma meänkieli","context_page_description":"El meänkieli es una variante del finés que se habla en la región de Tornedalen en el norte de Suecia.\\nEl meänkieli está cercano al dialecto finés que se habla en la región finlandesa de Ylitornio en la frontera de Finlandia y Suecia. Desde 1999 está reconocido por el estado sueco como uno de los cinco idiomas minoritarios en Suecia. Escrito como dos palabras separadas meän kieli significa “nuestro idioma”. Hoy en día el número de habitantes suecos que habla o entiende meänkieli se estima en 150 000 personas de los 469 000 que hablan o entienden finés o meänkieli, o ambos, entre ellas muy pocos jóvenes."},{"page_url":"https://sk.wikipedia.org/wiki/1956","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/MG_Luxor_00_crop.jpg","page_title":"1956","context_page_description":"1. január – Sudán vyhlásil nezávislosť od Spojeného kráľovstva a Egypta\\n26. január až 5. február – Zimné olympijské hry, Cortina d'Ampezzo, Taliansko\\n16. február – Spojené štáty otvorili výskumnú stanicu McMurdo\\n2. marec – Maroko sa stalo nezávislé od Španielska\\n20. marec – Tunisko získalo nezávislosť od Francúzska\\n23. október – demonštrácia v Budapešti, začiatok maďarského protikomunistického povstania\\n3. november – v rámci bratislavského rozhlasu sa začalo slovenské televízne vysielanie\\n22. november až 8. december – Letné olympijské hry, Melbourne, Austrália"},{"page_url":"https://es.wikipedia.org/wiki/Lockheed_Constellation","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Lockheed_L-1049_G_Super_Constellation_%28D-ALEM%29.JPG","page_title":"Lockheed Constellation","context_page_description":"El Lockheed Constellation fue un avión comercial de cuatro hélices con motores a pistón, fabricado por Lockheed Corporation entre 1943 y 1958 en su planta de Burbank, California. Se produjeron un total de 856 aeronaves de diversos modelos, todos distinguidos por su empenaje de triple estabilizador vertical y fuselaje con forma de delfín, la mayor parte de ellos propulsados por cuatro motores radiales Wright R-3350 de 18 cilindros dispuestos en doble estrella. El Constellation fue usado como avión comercial de pasajeros, transporte militar, y de carga, incluyendo su participación en servicio durante el Puente Aéreo de Berlín y el de Biafra. Fue el avión presidencial del presidente estadounidense Dwight D. Eisenhower y el primero en ser designado como \\"Air Force One\\"."},{"page_url":"https://en.wikipedia.org/wiki/Economy_of_Peru","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Lima_-_Per%C3%BA.jpg","page_title":"Economy of Peru","context_page_description":"The economy of Peru is an upper middle income economy as classified by the World Bank and is the 47th largest in the world by total GDP. Peru was one of the world's fastest-growing economies in 2012, with a GDP growth rate of 6.3%. As of 2018 the GDP growth rate has slowed to 3.99%. It currently has a high human development index of 0.741 and per capita GDP above $12,000 by PPP.\\nNeo-classical economists would interpret Peru's sound economic performance as a combination of:\\nMacroeconomic stability\\nPrudent fiscal spending\\nHigh international reserve accumulation\\nExternal debt reduction\\nAchievement of investment grade status\\nFiscal surpluses\\nHowever, Post-Keynesian economists would argue that what neo-classical economics considers to be \\"prudent\\" fiscal spending is nothing more than a means to restrict government spending in order to make Peru dependent on export income and thus encourage it to open the Peruvian economy to free trade to the benefit of other western countries. Though growth has been significant, income inequality remains, and much of Peru's rain-forests have been damaged in the mining of gold and silver."},{"page_url":"https://en.wikipedia.org/wiki/Watts_Hall","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/The_courtyard_outside_Watts_Hall_%28cropped%29.jpg","page_title":"Watts Hall","context_page_description":"Watts Hall is a building on the Ohio State University campus, in Columbus, Ohio, United States. It houses the OSU Department of Materials Science and Engineering."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B8%D0%BC%D0%BF%D0%BE%D0%BF%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Limpopo.jpg","page_title":"Лимпопо","context_page_description":"Лимпо́по — река в Южной Африке на территории ЮАР, Ботсваны, Зимбабве и Мозамбика."},{"page_url":"https://sk.wikipedia.org/wiki/Fontenoy-le-Ch%C3%A2teau","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/Fontenoy-le-Ch%C3%A2teau_vu_des_Cocl%C3%A9s.jpg","page_title":"Fontenoy-le-Château","context_page_description":"Fontenoy-le-Château je francúzska obec, ktorá sa nachádza v departemente Vosges, v regióne Lotrinsko."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%BD%D0%B0%D0%BA%D0%B8_%D0%BF%D0%BE%D1%87%D1%82%D0%BE%D0%B2%D0%BE%D0%B9_%D0%BE%D0%BF%D0%BB%D0%B0%D1%82%D1%8B_%D0%A1%D0%A1%D0%A1%D0%A0_(1962)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Stamp_Soviet_Union_1962_CPA2697.jpg","page_title":"Знаки почтовой оплаты СССР (1962)","context_page_description":"Зна́ки почто́вой опла́ты СССР (1962) — перечень знаков почтовой оплаты, введённых в обращение дирекцией по изданию и экспедированию знаков почтовой оплаты Министерства связи СССР в 1962 году."},{"page_url":"https://en.wikipedia.org/wiki/Florina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Panorama_na_Lerin_od_1912.jpg","page_title":"Florina","context_page_description":"Florina is a town and municipality in the mountainous northwestern Macedonia, Greece. Its motto is, 'Where Greece begins'.\\nThe town of Florina is the capital of the Florina regional unit and also the seat of the eponymous municipality. It belongs to the administrative region of West Macedonia. The town's population is 17,686 people. It is in a wooded valley about 13 km south of the international border of Greece with the Republic of North Macedonia."},{"page_url":"https://de.wikipedia.org/wiki/Vieburger_Geh%C3%B6lz","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Varendorf%2821%29Ausschnitt-a.jpg","page_title":"Vieburger Gehölz","context_page_description":"Das Vieburger Gehölz ist ein knapp 70 Hektar großer Wald im Kieler Stadtteil Gaarden-Süd und Kronsburg, der auf der Endmoräne Hornheimer Riegel liegt.\\nDer nördlichste Teil des Waldes ist eine Hundefreilauffläche, an dessen Rande der Fernsehturm Kiel steht."},{"page_url":"https://eu.wikipedia.org/wiki/Bellaing","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Bellaing_%28Nord%2C_Fr%29_mairie.JPG","page_title":"Bellaing","context_page_description":"Bellaing Frantziako udalerria da, Nord departamenduan dagoena, Hauts-de-France eskualdean. 2013an 1.231 biztanle zituen."},{"page_url":"https://hu.wikipedia.org/wiki/Miskolc_t%C3%B6rt%C3%A9nete","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Miskolc_Sporthall_02.jpg","page_title":"Miskolc története","context_page_description":"Miskolc története 70 000 évre vezethető vissza, az ezt bizonyító leleteket az avasi Tűzkövesen tárták fel. A honfoglaló magyarság a népvándorlás második hullámában érkezett a Kárpát-medencébe. Miskolcot és Győr várát Böngér, a Miskolc nemzetség őse foglalta el. Miskolc a rokonság legfontosabb birtoka lett, de Diósgyőr a 11–13. század között királyi várbirtokká vált. Ezt követően a két település a Szinva völgyében elkülönülten, de folyamatos egymásra hatásban fejlődött.\\nA mohácsi csatavesztés után, amikor az ország három részre szakadt, Miskolc elvileg a királyi országrészhez tartozott, de a hódoltság szomszédságában, így mindkét hatalom jogot formált megadóztatására. A miskolciak eleinte nem akartak a töröknek fizetni, mire azok feldúlták a várost. Elpusztult a tapolcai bencés apátság is, ahol a Miskócok irattárát is tartották. Nem maradt fenn az adományozó oklevél sem, így – mivel nem ismert – Miskolc nem ünnepelheti alapítása évfordulóját. Miskolc a 18. század első harmadában súlyos pénzekért kivásárolta magát a Diósgyőr uradalma alól, és erős vármegyei székhellyé vált."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_F%C3%BCssen","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/F%C3%BCssen%2C_Ritterstra%C3%9Fe_25_%281%29.jpg","page_title":"Liste der Baudenkmäler in Füssen","context_page_description":"Auf dieser Seite sind die Baudenkmäler der schwäbischen Stadt Füssen zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%84%D9%8A%D9%88%D9%86_%D8%B1%D9%88%D8%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/LeonRochesCirca1865.JPG","page_title":"ليون روش","context_page_description":"ليون روش ‏، ولد في مدينة غرونوبل الفرنسية، كان سفير وممثل للحكومة الفرنسية في اليابان 1864-1868.\\nغادر ليون فرنسا في 30 يونيو 1832 للانضمام إلي والده الذي حصل على مزرعة في الجزائر. ومكث في القارة الأفريقية طيلة 32 سنة التالية. تعلم ليون اللغة العربية بسرعة كبيرة، وبعد عامين تم تجنيده كمترجم للجيش الفرنسي في أفريقيا. ثم أصبح في سلاح الفرسان في الحرس الوطني الجزائري، للفترة 1835-1839. طلب منه الجنرال بيجو، التفاوض مع الأمير عبد القادر الجزائري لوقف القتال مع الفرنسيين. وقد حظي روش باحترام كبير من قبل مشايخ العرب.\\nفي عام 1845، وبتوصية من الجنرال بيجو، انضم روش لوزارة الخارجية الفرنسية كمترجم. وفي عام 1846 أصبح مندوب رسمي في طنجة، وبعد ذلك تولى مسؤوليات البعثة الفرنسية في المغرب."},{"page_url":"https://sv.wikipedia.org/wiki/Kempten_(Allg%C3%A4u)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Sicht_auf_Kempten_Altstadt_Neustadt.jpg","page_title":"Kempten (Allgäu)","context_page_description":"Kempten är en stad i det tyska förbundslandet Bayern och har ungefär 62 000 invånare. Av överregional betydelse är stadens mjölkproduktion.\\nKempten ligger vid Alpernas norra gräns och är tillsammans med Trier, Worms och Augsburg en av Tysklands äldsta städer. Det antas att det fanns redan ett samhälle på platsen före romarnas ankomst. Säkert är att romarna cirka år 15 före Kristus skapade staden Cambodunum vid ett vadställe i floden Iller. Möjligtvis var Kempten huvudort i provinsen Raetia innan Augsburg övertog denna funktion. 740 bildades ett kloster i staden som hade ansvaret för den omliggande regionen. 1289 blev en del av Kempten en fri riksstad och på så sätt oberoende av klostret. Ur ekonomiskt hänseende var handeln med salt, linnetyg och smedjeprodukter av betydelse.\\nI samband med det tyska bondekriget kom reformationen till den självständiga delen av Kempten. Under det trettioåriga kriget hjälpte varje stadsdel dessa trupper som kämpade för den tillhörande religionen. Dessutom föll många invånare offer för pesten. Invånarantalet sjönk från cirka 6 000 före kriget till 900 personer år 1635.\\n1775 var Kempten skådeplats för Tysklands sista häxjakt."},{"page_url":"https://de.wikipedia.org/wiki/Alvensleben_(Adelsgeschlecht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Burg_Gardelegen.jpg","page_title":"Alvensleben (Adelsgeschlecht)","context_page_description":"Alvensleben ist der Name eines niederdeutschen Adelsgeschlechtes, dessen ältester bekannter Vertreter Wichard 1163, 1175, 1185 und 1187 als Ministerialer des Bistums Halberstadt in den Urkunden erscheint und sich spätestens seit 1175 nach der bischöflich-halberstädtischen Burg Alvensleben bei Haldensleben benennt, so dass anzunehmen ist, dass er dort als Burgvogt eingesetzt war."},{"page_url":"https://en.wikipedia.org/wiki/South_African_Tourism","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/Derek_Hanekom-IMG_1037.jpg","page_title":"South African Tourism","context_page_description":"South African Tourism is the official national marketing agency of the South African government, with the goal of promoting Tourism in South Africa both locally and globally."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A7%D0%B5_%D0%93%D0%B5%D0%B2%D0%B0%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Mantegna_Andrea_Dead_Christ.jpg","page_title":"Че Гевара","context_page_description":"Ернесто Гевара, известен най-вече с псевдонима си Че Гевара или просто Че, е аржентински и кубински революционер, политик, лекар, дипломат, лидер на партизански движения в Латинска Америка и Африка, сред ръководителите на Кубинската революция.\\nСлед завземане на властта в Куба през 1959 година е назначен за комендант на крепостта Ла Кабаня и провежда там революционен трибунал, който екзекутира стотици служители на предишния режим, обвинени във военни престъпления. Създава трудово-възпитателни лагери. Заема важни постове в правителството на Куба – министър на промишлеността, президент на националната банка, деец на революционните въоръжени сили на Куба, дипломат, като по същото време пише няколко теоретични труда за революцията и партизанската борба.\\nПрез 1965 година се отказва от кубинското си гражданство и всичките си постове в държавата и заминава най-напред за Конго, а след това за Боливия, където се опитва да развие партизанска война и да разпали нови социални революции. След 2 години там е заловен от боливийската армия с помощта на ЦРУ при специална военна операция и убит. Тленните му останки са открити едва след 30 години и са пренесени в Куба."},{"page_url":"https://pt.wikipedia.org/wiki/Emre_Aydin","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Emreaydin.jpg","page_title":"Emre Aydin","context_page_description":"Emre Aydin nasceu em Isparta no dia 2 de fevereiro de 1981.Formou-se no colegial na escola Antalya Anadolu Lisesi e graduou-se em Economia na Universidade Dokuz Eylül em İzmir. Ele ganhou o festival de música Sing Your Song com sua banda 6.Cadde, por onde iniciou uma carreira de sucesso na Turquia. Neste ano, sua música Dönersen foi selecionada pela Universal Music para uma coletânea.\\nEm 2003, seu primeiro álbum com o 6.Cadde foi publicado, e no mesmo ano Emre deixou a banda, se direcionando para uma carreira solo.\\nSeu primeiro álbum, lançado em 2006, Afili Yalnızlık foi gravado pela Sony BMG e GRGDN. A música que dá nome ao álbum, está no topo das paradas turcas."},{"page_url":"https://no.wikipedia.org/wiki/Junior-VM_i_orientering","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Jenny_L%C3%B6nnkvist_JWOC2007_MiddleFinal.JPG","page_title":"Junior-VM i orientering","context_page_description":"Juniorverdesmesterskapet i orientering er et internasjonalt orienteringsarrangement som arrangeres hvert år. Den første offisielle utgaven ble holdt i 1990. Påmeldingen er åpen for løpere som er 20 år eller yngre 31. desember året det aktuelle arrangementet arrangeres. Deltakende nasjoner må være medlemmer av Det internasjonale orienteringsforbundet."},{"page_url":"https://nn.wikipedia.org/wiki/Raidet_p%C3%A5_Grand_Pr%C3%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Colonel_Benjamin_Church.jpg","page_title":"Raidet på Grand Pré","context_page_description":"Raidet på Grand Pré var den største hendinga under ein ekspedisjon leia av oberst Benjamin Church frå Ny-England mot franske Acadia i juni 1704 under Dronning Anne-krigen. Ekspedisjonen var eit hemntokt for det franske og indianske raidet mot grensesamfunnet Deerfield i Massachusetts tidlegare det året.\\nDei la ut frå Boston den 25. mai 1704 med 500 militssoldatar frå provinsen og nokre indianske allierte. Ekspedisjonen nådde Minas Basin den 24. juni, etter å ha raida nokre mindre busetnader i Penobscot Bay og Passamaquoddy Bay. Sjølv om han mista overraskingsmomentet på grunn av det høge tidvatnet i Bay of Fundy, fekk Church raskt kontroll over Grand Pré, og brukte tre dagar på å øydeleggje byen, samt prøve å øydeleggje dike som verna den oppdyrka jorda. Saltvatnet strøymde inn over jordbruksmarkene, men dei lokale acadiarane var raske med å reparere dika så snart fienden var borte, og landet kunne nyttast vidare til jordbruk. Church heldt fram ekspedisjonen sin og slo til mot Beaubassin og andre samfunn før han vendte attende til Boston seint i juli."},{"page_url":"https://en.wikipedia.org/wiki/Spherocobaltite","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Spherocobaltite-260478.jpg","page_title":"Spherocobaltite","context_page_description":"Spherocobaltite or sphaerocobaltite is a cobalt carbonate mineral with chemical composition CoCO₃. In its pure form, it is typically a rose-red color, but impure specimens can be shades of pink to pale brown. It crystallizes in the trigonal crystal system."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D8%B3%D9%8A%D8%AD%D9%8A%D9%88_%D8%A7%D9%84%D8%AB%D9%82%D8%A7%D9%81%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Chartres_-_cath%C3%A9drale_-_rosace_nord.jpg","page_title":"مسيحيو الثقافة","context_page_description":"مسيحي الثقافة أو المسيحية الثقافية هو مصطلح واسع يستخدم لوصف أفراد غير ملتزمين دينيًا أو علمانيين أو ملحدين أو لادينيين ذوي خلفية تراثية وحضارية مسيحية؛ ويعود انتمائهم للمسيحية إلى الناحية الدينية أو العرقية أو الثقافية أو التعليمية أو بسبب الروابط العائلية وقد لا يؤمنون بالمعتقدات الدينية المسيحية، ولكن يعرّفون أنفسهم كمسيحيين لارتباطهم بالمسيحية وراثيًا وحضاريًا، وبسبب البيئة الاجتماعية والثقافية التي نشأوا فيها.\\nيمكن اعتبار عدد واسع من سكان في نصف الأرض الغربي بأنهم مسيحيين ثقافيًا، نظرًا لارتباط الإيمان المسيحي في الحضارة الغربية في كافة المجالات الأسرية والاجتماعية في الفن، الموسيقى، الأدب، الفلسفة، اللغة، العمارة، الإقتصاد، السياسة، القانون، الرعاية الصحية، التعليم، العلوم والطب، وكذلك الأعياد الدينية التي يحتفل بها على نطاق واسع مثل عيد الفصح وعيد الميلاد."},{"page_url":"https://nl.wikipedia.org/wiki/Nil_Volentibus_Arduum","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Familiewapen_Tak.jpg","page_title":"Nil Volentibus Arduum","context_page_description":"Nil Volentibus Arduum was het motto van een gezelschap van intellectuelen, opgericht in Amsterdam in 1669, naar het voorbeeld van de Académie Française. De leden, met als voormannen de advocaat Andries Pels en de arts Lodewijk Meyer kwamen wekelijks bijeen om te spreken over thema's als logica, ethiek, toneel en dichtkunst. Het gezelschap speelde tien jaar lang een belangrijke rol in de toneelwereld.\\nNil Volentibus Arduum was van mening dat in verband met de welvoeglijkheid godsdienst op het toneel zo veel mogelijk vermeden moest worden. Ook staatkundige zaken waren taboe.\\nVolgens Timmers trachtte dit genootschap in Holland de taak te vervullen en de invloed te krijgen, die de Académie Française in Frankrijk bezit. Het streeft naar dictatoriale macht in de Letterrepubliek, bevit, bedilt, verbetert en schrijft wetten voor... Volgens Knuvelder is de literaire inbreng van NVA een serieuze en oprechte poging aan de hand van de modernste interpretaties van Aristoteles en Horatius de poëzie te verbeteren. Gladheid en zoetvloeiendheid, het gladgepolijste vers, uiterlijke sierlijkheid en fijnheid van vorm ... wordt het summum van de dichtkunst."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BB%D0%B0%D0%B3_%D0%A1%D1%83%D0%BD%D1%82%D0%B0%D1%80%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D1%83%D0%BB%D1%83%D1%81%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Flag_of_Suntarsky_rayon_%28Yakutia%29_%28previous%29.png","page_title":"Флаг Сунтарского улуса","context_page_description":"Флаг муниципального района «Сунта́рский улус » Республики Саха Российской Федерации — официальный символ муниципального образования, обозначающий его конституционно-правовой статус, единство жителей Сунтарского улуса, культурное достояние жителей Сунтарского улуса, природные и исторические особенности.\\nНыне действующий флаг утверждён 28 марта 2012 года решением XXXVI очередной сессии Сунтарского совета депутатов.\\nФлаг муниципального района, наряду с гербом и гимном, является символом, отображающим единство его территории, воспитывающим патриотическое чувство его жителей и уважение к истории района.\\nЖители муниципального района, а также иные лица, находящиеся на территории муниципального района, обязаны уважать официальные символы муниципального района «Сунтарский улус »."},{"page_url":"https://en.wikipedia.org/wiki/Mita,_Minato,_Tokyo","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Yoshimi-zaka.jpg","page_title":"Mita, Minato, Tokyo","context_page_description":"Mita is a district of Minato, Tokyo, Japan, located near Akabanebashi Station on the Toei Ōedo Line, Tamachi Station on the Yamanote Line, and Mita Station on the Toei Mita Line.\\nMita is home to Keio University, Mita Hachiman Jinja, and the diplomatic missions of Kuwait, Italy, Hungary, Papua New Guinea and Australia."},{"page_url":"https://sv.wikipedia.org/wiki/Antoine_Coysevox","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Antoine_Coysevox.jpg","page_title":"Antoine Coysevox","context_page_description":"Antoine Coysevox, född 29 september 1640 i Lyon, död 10 oktober 1720 i Paris, var en fransk skulptör.\\nAntoine Coysevox utbildades i Paris och fick först uppdrag av kardinal Wilhelm Egon von Fürstenberg för dennes palats i Zabern. Han återvände därefter till Paris och fick genom Charles Le Brun beställningar till Versailles och Château de Marly. Hans mest betydande verk är de många porträttskulpturer han utförde. Många av dessa, bland annat den av Ludvig XIV, som varit hans store gynnare, förstördes under franska revolutionen. I Louvren förvaras flera av hans porträttbyster av betydande samtida, bland annat ett självporträtt och det ståtliga monumentet över Jules Mazarin.\\nCoysevox hör till den franska barockens främsta skulptörer. Han har en mycket plastisk stil, som i synnerhet ger hans porträttbyster en kraftig djupverkan."},{"page_url":"https://et.wikipedia.org/wiki/CeeLo_Green","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5b/Gnarls-Barkley.jpg","page_title":"CeeLo Green","context_page_description":"CeeLo Green on Ameerika Ühendriikide näitleja ja muusik."},{"page_url":"https://no.wikipedia.org/wiki/Norsk_forsvarshistorie","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Telemark_battalion_flag_guard.jpg","page_title":"Norsk forsvarshistorie","context_page_description":"Norsk forsvarhistorie omhandler historien til den organiserte forsvarsmakten i Norge. I dag er det Forsvaret som står for militær makt i landet."},{"page_url":"https://pl.wikipedia.org/wiki/Rotebro_(stacja_kolejowa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Rotebro_06.JPG","page_title":"Rotebro (stacja kolejowa)","context_page_description":"Rotebro – stacja kolejowa w Gminie Sollentuna, w regionie Sztokholm, w Szwecji. Znajduje się na Ostkustbanan, 19 km od Dworca Centralnego w Sztokholmie. Składa się jednego perony wyspowego i ma dwa hole kasowe. Stacja obsługuje dziennie około 3 700 pasażerów."},{"page_url":"https://en.wikipedia.org/wiki/Jaca","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/92/Detalle_del_Capitel_del_rey_David_con_m%C3%BAsicos.jpg","page_title":"Jaca","context_page_description":"Jaca is a city of northeastern Spain in the province of Huesca, located near the Pyrenees and the border with France. Jaca is an ancient fort on the Aragón River, situated at the crossing of two great early medieval routes, one from Pau to Zaragoza. Jaca was the city out of which the County and Kingdom of Aragon developed. It was the capital of Aragon until 1097 and also the capital of Jacetania."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BA%D0%BE%D0%BB%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%9E%D0%BB%D0%B5%D0%B3_%D0%9C%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/%D0%A1%D0%BE%D0%BA%D0%BE%D0%BB%D0%BE%D0%B2%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%9E%D0%BB%D0%B5%D0%B3_%D0%9C%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B9%D0%BE%D0%B2%D0%B8%D1%87.jpg","page_title":"Соколовський Олег Миколайович","context_page_description":"Соколовський Олег Миколайович — заслужений тренер України, суддя національної категорії з легкої атлетики, віце-президент Федерації легкої атлетики України"},{"page_url":"https://ceb.wikipedia.org/wiki/Darechok","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/50/Mugling%2C_Nepal.JPG","page_title":"Darechok","context_page_description":"Conseho sa kaayuhan sa balangay ang Darechok sa Nepal. Nahimutang ni sa dapit sa Nārāyanī Zone ug rehiyon sa kakayuhan sa Madhyamanchal, sa sentro nga bahin sa nasod, 70 km sa kasadpan sa Kathmandu ang ulohan sa nasod. Adunay 6,895 ka molupyo.\\nAng klima umogon ug subtropikal. Ang kasarangang giiniton 19 °C. Ang kinainitan nga bulan Mayo, sa 22 °C, ug ang kinabugnawan Enero, sa 12 °C. Ang kasarangang pag-ulan 2,111 milimetro matag tuig. Ang kinabasaan nga bulan Hulyo, sa 523 milimetro nga ulan, ug ang kinaugahan Nobiyembre, sa 3 milimetro."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D1%80%D0%90%D0%97-256%D0%91","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Museum_of_dfdc_016.jpg","page_title":"КрАЗ-256Б","context_page_description":"КрАЗ-256Б — советский тяжёлый карьерный самосвал, выпускавшийся Кременчугским автомобильным заводом. Предназначен для эксплуатации на дорогах первой и второй категорий, допускающих осевую нагрузку до 10 тонн, а также для работы в карьерах."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_onroerend_erfgoed_in_Gent/J","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Gent_Jan_Breydelstraat_2_-_114499_-_onroerenderfgoed.jpg","page_title":"Lijst van onroerend erfgoed in Gent/J","context_page_description":"Een overzicht van het onroerend erfgoed in Gent. Het onroerend erfgoed maakt deel uit van het cultureel erfgoed in België."},{"page_url":"https://sv.wikipedia.org/wiki/Svenska_arm%C3%A9n","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Robotsystem_90_eldenhet1.JPG","page_title":"Svenska armén","context_page_description":"Armén är en försvarsgren med uppgift att utveckla, organisera och utbilda markstrids- och luftvärnsförband. Armén består av en insats- och en grundorganisation. Armén är indelad i truppslag: infanteriet, kavalleriet, pansartrupperna, artilleriet, luftvärnet, ingenjörtrupperna, signaltrupperna och trängtrupperna. Armén är en av de tre försvarsgrenarna inom den svenska Försvarsmakten. Antalet soldater i armén har minskat avsevärt efter det kalla kriget."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%BE%A4%E9%A6%AC%E7%9C%8C%E3%81%AE%E5%B8%82%E7%94%BA%E6%9D%91%E7%AB%A0%E4%B8%80%E8%A6%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Myogi_Gunma_chapter.JPG","page_title":"群馬県の市町村章一覧","context_page_description":"群馬県の市町村章一覧は、群馬県内の市町村に制定されている、あるいは制定されていた市町村章の一覧である。なお、一覧の順序は全国地方公共団体コード順による。廃止された市町村章は廃止日から順に掲載している。"},{"page_url":"https://fr.wikipedia.org/wiki/Sphinx_nic%C3%A9a","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Hyles_nicaea_castissima_MHNT_CUT_2010_0_187_Tlemcen_Algerie_Female_dorsal.jpg","page_title":"Sphinx nicéa","context_page_description":"Le Sphinx nicéa est une espèce de lépidoptères appartenant à la famille des Sphingidae, à la sous-famille des Macroglossinae, tribu des Macroglossini, sous-tribu des Choerocampina."},{"page_url":"https://hu.wikipedia.org/wiki/Carsten_Nicolai","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/AlvaNotoGeneva2004.jpg","page_title":"Carsten Nicolai","context_page_description":"Carsten Nicolai német zenész, előadóművész, vizuál-akusztikus látványtervező. Ismert művésznevei Noto, Alva Noto, Aleph-1."},{"page_url":"https://de.wikipedia.org/wiki/Borsig_(Unternehmen)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Borsigwerke_B-Tegel_07-2017_img3.jpg","page_title":"Borsig (Unternehmen)","context_page_description":"Borsig ist ein deutsches Maschinenbau-Unternehmen mit Sitz in Berlin. Das Unternehmen stellte vor allem Dampflokomotiven her und war während der Ära der Dampflokomotiven in Europa der größte und weltweit der zweitgrößte Lokomotivenlieferant."},{"page_url":"https://hu.wikipedia.org/wiki/Szerbia_javasolt_vil%C3%A1g%C3%B6r%C3%B6ks%C3%A9gi_helysz%C3%ADnei","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Lake_of_Sharr_Mountains.JPG","page_title":"Szerbia javasolt világörökségi helyszínei","context_page_description":"Szerbia területéről 2019. évi állapot szerint öt helyszín került fel a világörökségi listára, valamint tizenkét további helyszín a javaslati listán várakozik a felvételre."},{"page_url":"https://en.wikipedia.org/wiki/South_Sudanese_Civil_War","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7a/SPLA_soldiers_near_Juba_%28April_2016%29_2.jpg","page_title":"South Sudanese Civil War","context_page_description":"The South Sudanese Civil War was a conflict in South Sudan between forces of the government and opposition forces. In December 2013, President Kiir accused his former deputy Riek Machar and ten others of attempting a coup d'état. Machar denied trying to start a coup and fled to lead the SPLM – in opposition. Fighting broke out between the Sudan People's Liberation Movement and SPLM-IO, igniting the civil war. Ugandan troops were deployed to fight alongside the South Sudanese government. The United Nations has peacekeepers in the country as part of the United Nations Mission in South Sudan.\\nIn January 2014 the first ceasefire agreement was reached. Fighting continued and would be followed by several more ceasefire agreements. Negotiations were mediated by \\"IGAD +\\". A peace agreement known as the \\"Compromise Peace Agreement\\" was signed in August 2015. Machar returned to Juba in 2016 and was appointed vice president. Following a second breakout of fighting within Juba, the SPLM-IO fled to the surrounding and previously peaceful Equatoria region."},{"page_url":"https://eu.wikipedia.org/wiki/Carimate","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Carimate_Castle.jpg","page_title":"Carimate","context_page_description":"Carimate Italiako udalerri bat da. Comoko probintzian kokatuta dago, Lombardia eskualdean. 4.530 biztanle ditu, 5,17 kilometro koadroko azaleran banatuta."},{"page_url":"https://vi.wikipedia.org/wiki/Quercus_spinosa","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Quercus_spinosa.jpg","page_title":"Quercus spinosa","context_page_description":"Quercus spinosa là một loài thực vật có hoa trong họ Cử. Loài này được David miêu tả khoa học đầu tiên năm 1884."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%96%D0%B0%D0%BA_%D0%91%D0%BE%D1%81%D1%8E%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Statue_Bossuet_Barrias_Sorbonne.jpg","page_title":"Жак Босюе","context_page_description":"Жак-Бенин Босюе е френски епископ, теолог и брилянтен оратор. Личен изповедник на крал Луи ХІV, Босюе е от тези, които защитават принципите на абсолютизма и на божествените права на владетелите. От друга страна е противник на всевластието на папата в духовните въпроси и един от инициаторите за формирането на Галиканската църква във Франция."},{"page_url":"https://nl.wikipedia.org/wiki/Sypna_diversa","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Sypna_diversa.jpg","page_title":"Sypna diversa","context_page_description":"Sypna diversa is een vlinder uit de familie van de spinneruilen. De wetenschappelijke naam van de soort is voor het eerst geldig gepubliceerd in 1917 door Wileman & South."},{"page_url":"https://en.wikipedia.org/wiki/Irish_Americans","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Irish_American2.png","page_title":"Irish Americans","context_page_description":"Irish Americans are Americans who have full or partial ancestry from Ireland. About 33 million Americans — 10.1% of the total population — identified as being Irish in the 2017 American Community Survey conducted by the U.S. Census Bureau. This compares with a population of 6.5 million people on the island of Ireland."},{"page_url":"https://lt.wikipedia.org/wiki/Pump%C4%97n%C5%B3_gimnazija","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/45/Pump%C4%97n%C5%B3_mokykla.JPG","page_title":"Pumpėnų gimnazija","context_page_description":"Pasvalio rajono Pumpėnų gimnazija – dieninė, savarankiško mokymosi bendrojo lavinimo mokykla Pasvalio raj., Pumpėnuose, Panevėžio g. 53, vykdanti priešmokyklinio, pradinio, pagrindinio, vidurinio ir neformaliojo ugdymo programas. Įstaigos kodas 190615485.\\nSkyriai:\\nPasvalio rajono Pumpėnų gimnazijos Kalno ikimokyklinio ugdymo skyrius;\\nPasvalio rajono Pumpėnų gimnazijos Rinkūnų pradinio ugdymo skyrius."},{"page_url":"https://az.wikipedia.org/wiki/Kristina_Perri","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Christina_Perri_2.jpg","page_title":"Kristina Perri","context_page_description":"Kristina Perri — amerikalı müğənni, bəstəkardır."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D9%8A%D9%82%D8%A8%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/Acer_pseudoplatanus_002.jpg","page_title":"قيقبية","context_page_description":"الفصيلة القيقبية فصيلة نباتية من رتبة الصابونيات. تضم جنسين أو أربعة أجناس. معظم النباتات التي تتبع هذه الفصيلة من الأشجار والشجيرات، وأهمها شجرة الإسفندان أو القيقب."},{"page_url":"https://de.wikipedia.org/wiki/Rifugio_Guglielmina","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Rifugio_Guglielmina%2C_March_2009.jpg","page_title":"Rifugio Guglielmina","context_page_description":"Das Rifugio Guglielmina war eine 2880 m s.l.m. hoch gelegene, privat bewirtschaftete alpine Berghütte an der Südseite des Monte-Rosa-Massivs mit einer Kapazität von 40 Zweibettzimmern. 1878 erbaut, wurde sie 2011 durch ein Feuer vollständig zerstört und anschließend nicht wieder aufgebaut."},{"page_url":"https://ro.wikipedia.org/wiki/Lista_faraonilor_egipteni","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Twosret.jpg","page_title":"Lista faraonilor egipteni","context_page_description":"Acest articol conține o listă a faraonilor Egiptului Antic, începând cu Perioada Dinastică Timpurie înainte de 3000 î.Hr. până la sfârșitul Dinastiei Ptolemeice, când Egiptul a devenit provincie a Imperiului Roman sub conducera lui Augustus Caesar în 30 î.Hr..\\nDatele din tabelele de mai jos sunt în marea lor majoritate aproximative. Există mai multe moduri de datare în funcție de modul cum sunt construite și pe ce informații se bazează sistemele de datare ale istoria Egiptului Antic. Mai jos este prezentat unul din acestea."},{"page_url":"https://sv.wikipedia.org/wiki/Trianon_(Frankfurt_am_Main)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Trianon_Frankfurt.jpg","page_title":"Trianon (Frankfurt am Main)","context_page_description":"Trianon på 186 meter, är den femte högsta byggnaden i Frankfurt, Tyskland. Den Trianon, som den vanligtvis kallas, är säte för DekaBank och många andra Hyresgäster. Byggnaden blev färdig 1993."},{"page_url":"https://fr.wikipedia.org/wiki/Dim%C3%A9thylmagn%C3%A9sium","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Me2Mg.png","page_title":"Diméthylmagnésium","context_page_description":"Le diméthylmagnésium est un composé chimique de formule (CH₃)₂Mg. Cet organomagnésien se présente sous la forme d'un solide blanc pyrophorique. Il s'agit d'un polymère dont la structure est semblable à celle du disulfure de silicium SiS₂. Sa structure a été déterminée par cristallographie aux rayons X et montre que les atomes de magnésium sont entourés par quatre groupes méthyle selon une géométrie tétraédrique, chacun de ces groupe méthyle jouant le rôle d'un ligand pontant entre deux atomes de magnésium. La liaison Mg–C a une longueur de 224 pm.\\nIl peut être obtenu en ajoutant un équivalent de dioxane à un réactif de Grignard, en l'occurrence une solution d'halogénure de méthylmagnésium CH₃MgX :\\n2 CH₃MgX + dioxane (CH₃)₂Mg + MgX₂↓\\nLe complexe MgX₂ forme un précipité qui déplace l'équilibre chimique vers la droite ; cette réaction est appelée équilibre de Schlenk.\\nOn peut également former du diméthylmagnésium par réaction de calcium, de magnésium et d'iodométhane CH₃I dans l'éther diéthylique ou par réaction de diméthylmercure (CH₃)₂Hg avec du magnésium."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A5%D1%80%D0%B0%D0%BC%D1%8B_%D0%9F%D1%81%D0%BA%D0%BE%D0%B2%D1%81%D0%BA%D0%BE%D0%B9_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/%D0%A6%D0%B5%D1%80%D0%BA%D0%BE%D0%B2%D1%8C_%D0%A0%D0%BE%D0%B6%D0%B4%D0%B5%D1%81%D1%82%D0%B2%D0%B0_%D0%91%D0%BE%D0%B3%D0%BE%D1%80%D0%BE%D0%B4%D0%B8%D1%86%D1%8B_%D0%98%D0%B7%D0%B1%D0%BE%D1%80%D1%81%D0%BA.JPG","page_title":"Храмы Псковской области","context_page_description":"Боровик. Церковь Покрова Богородицы.\\nВыбуты. Церковь Ильи Пророка. Погост у села Раздолье на левом берегу реки Великой в 16 км выше Пскова.\\nКусва. Церковь Мины, Виктора и Викентия. Погост на левом берегу Великой в 8 км ниже Пскова.\\nНёготь. Погост в Писковичах на правом берегу Великой в 8 км ниже Пскова. Церковь Апостола Матфея.\\nУстье. На левом берегу реки Великой в 18 км ниже Пскова. Церковь Николы с Устья. Реставрация проведена в 1956—1961 гг. по проекту арх. Скобельцына Б. С.\\nд. Остров имени Белова. Церковь Петра и Павла. XVI вв. Памятник истории и культуры.\\nд. Остров-Залит. Церковь Николы Чудотворца. XVI в.\\nКривовицы. Погост Кривовицы в 12 км от Пскова по Гдовской дороге. Церковь Ильи Пророка. Памятник истории и культуры.\\nЕлизарово. Спасо-Елеазаров монастырь. Действующий женский. Настоятельница: игуменья Елисавета 2000—2010 гг.\\nМаслогостицы Церковь Николая Чудотворца\\nКрыпецы. Крыпецкий монастырь. Действующий мужской. Подворье: Псков, собор Иоанна Предтечи Ивановского монастыря.\\nМелётово. Церковь Успения Пресвятой Богородицы. Памятник истории и культуры. Филиал Псковского государственного историко-архитектурного и художественного музея-заповедника."},{"page_url":"https://hu.wikipedia.org/wiki/Herlincourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Population_-_Municipality_code_62435.svg","page_title":"Herlincourt","context_page_description":"Herlincourt település Franciaországban, Pas-de-Calais megyében. Herlincourt Ramecourt, Croisette és Hautecloque községekkel határos."},{"page_url":"https://es.wikipedia.org/wiki/Intendente_de_la_regi%C3%B3n_de_Magallanes_y_de_la_Ant%C3%A1rtica_Chilena","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/Jos%C3%A9_Fern%C3%A1ndez_D%C3%BCbrock.jpg","page_title":"Intendente de la región de Magallanes y de la Antártica Chilena","context_page_description":"El Intendente de la Región de Magallanes y de la Antártica Chilena es la autoridad designada por el presidente de la República para ejercer el gobierno de la Región de Magallanes y de la Antártica Chilena, Chile, como su representante natural e inmediato en dicho territorio. Además participa en la administración de la región, como órgano que integra el Gobierno Regional de Magallanes y Antártica Chilena."},{"page_url":"https://nn.wikipedia.org/wiki/Vulkanen_Chait%C3%A9n","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Plume_from_eruption_of_Chaiten_volcano%2C_Chile.jpg","page_title":"Vulkanen Chaitén","context_page_description":"Chaitén er ein vulkansk kaldera med ein diameter på 3 km, som ligg 17 km vest for den isdekte vulkanen Michinmahuida og 10 km nordaust for byen Chaitén, nær Corcovadobukta sør i Chile. Det siste utbrotet starta 2. mai 2008 og enda i 2010. I følgje Global Volcanism Program har radiokarbondatering av eldre tefra vist at vulkanen hadde det førre utbrotet sitt kring 7420 fvt. ± 75 år.\\nKalderakanten ligg 1122 meter over havet. Før det noverande utbrotet var han stort sett fylt av ein lavadom av rhyolittis obsidian som nådde høgda 962 meter over havet og var delvis dekt av vegetasjon. To små innsjøar okkuperer botnen av kalderaen på vest- og nordsida av lavadomen.\\nDen gjennomsiktige grå obsidianen som hadde vorte kasta ut av vulkanen, vart nytta av førkolumbiske kulturar som råmaterial for lekamar, og er unnen opp til 400 km sør og nord for vulkanen, til dømes i Chan-Chan."},{"page_url":"https://en.wikipedia.org/wiki/Jubilee_Exhibition_Building","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/07/Jubilee_Exhibition_Building_Night_1920.jpg","page_title":"Jubilee Exhibition Building","context_page_description":"The Jubilee Exhibition Building in Adelaide, South Australia, was built to celebrate the 50th anniversary of Queen Victoria's accession to the throne on 20 June 1837. The jubilees of her Coronation on 28 June 1838, and of the Proclamation of South Australia on 28 December 1836, were also invoked on occasion.\\nThe building, increasingly referred to as the Exhibition Building, was located opposite the corner of North Terrace and Pulteney Street. on what is now the University of Adelaide's North Terrace campus, between Bonython Hall and the old School of Mines building on the Frome Road corner. It was opened on 20 June 1887 and was used until the mid 1920s. In 1929 the land and building were transferred to the University, and the building was demolished in 1962 to make way for the Napier building. There were two fountains in front of the building. One is now located in front of the Adelaide Arcade, the other in the Creswell Gardens."},{"page_url":"https://pl.wikipedia.org/wiki/Ojciec_Sergiusz_(opowiadanie)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Optina_Pustynia_and_Zhizdra_River%27s_flood.jpg","page_title":"Ojciec Sergiusz (opowiadanie)","context_page_description":"Ojciec Sergiusz – opowiadanie Lwa Tołstoja napisane między rokiem 1890 a 1898 i wydane pośmiertnie w 1912."},{"page_url":"https://es.wikipedia.org/wiki/Nikos_Kazantzakis","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Nikos_Kazantzakis.jpg","page_title":"Nikos Kazantzakis","context_page_description":"Nikos Kazantzakis fue un escritor griego, autor de poemas, novelas, ensayos, obras de teatro y libros de viaje. Posiblemente, es el escritor y filósofo griego más importante del siglo XX y el que ha sido traducido a más lenguas. No obstante, no fue muy conocido hasta el estreno de la película Zorba, el griego, de Michael Cacoyannis, basada en la novela homónima y obra más reconocida de Kazantzakis junto con La última tentación de Cristo."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_M%C3%B6dling","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Remise_M%C3%B6dling_0781.JPG","page_title":"Liste der denkmalgeschützten Objekte in Mödling","context_page_description":"Die Liste der denkmalgeschützten Objekte in Mödling enthält die 104 denkmalgeschützten, unbeweglichen Objekte der niederösterreichischen Stadtgemeinde Mödling."},{"page_url":"https://sl.wikipedia.org/wiki/Kamniti_napisi_v_Katmandujski_dolini","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Della_penna_epitaph.jpg","page_title":"Kamniti napisi v Katmandujski dolini","context_page_description":"Kamniti napisi v Katmandujski dolini so stare kamnite plošče, stebri in podstavki, na katerih je izrezljano besedilo. So najpomembnejši viri za zgodovino Nepala. Velika večina napisov, najdenih v Nepalu, izhaja iz Katmandujske doline, kjer so vseprisotni elementi na območjih dediščine. Sestavljajo jih kraljevi edikti in posvetne opombe o hindujskih in budističnih templjih, stupah, kipih, vodnih izlivih in drugih arhitekturnih strukturah.\\nZgodnji napisi so iz obdobja Licchavidov in segajo od 5. do 9. stoletje. Jih je več kot 170 in izklesani v sanskrtskem jeziku in Gupta pisavi. Napisi od 14. stoletja naprej, ki so najbolj številni, so v nepalskem jeziku in nepalski pisavi. Najzgodnejši napis v Nepal Bhasa je datiran iz obdobja Nepala 293."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%AD%A6%E9%BB%84%E5%9F%8E%E9%99%85%E9%93%81%E8%B7%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Wuhanmetroarearail_wuhuang-01.png","page_title":"武黄城际铁路","context_page_description":"武黃城際鐵路是武漢城市圈內兩條連通的城際客運專線——武石城際鐵路和武岡城際鐵路的合稱，連接武漢市和黃石市、黃岡市，是武漢城市圈城際鐵路交通網的重要組成部分。武漢至黃石為主線，武漢至黃岡的線路由葛店南站引出，是為支線。"},{"page_url":"https://nl.wikipedia.org/wiki/Martijanec","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3f/Flag_of_Martijanec.jpg","page_title":"Martijanec","context_page_description":"Martijanec is een gemeente in de Kroatische provincie Varaždin. Martijanec telt 4327 inwoners."},{"page_url":"https://fr.wikipedia.org/wiki/Navaridas","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Navaridas%2C_Rioja_Region%2C_Spain_%28by_%40taniazapata%29.jpg","page_title":"Navaridas","context_page_description":"Navaridas est une commune d'Alava, dans la communauté autonome du Pays basque en Espagne."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%87%D5%BF%D5%A1%D5%B8%D6%82%D6%86%D5%A5%D5%B6_%D5%AB%D5%B4_%D4%B2%D6%80%D5%A1%D5%B5%D5%BD%D5%A3%D5%A1%D5%B8%D6%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Staufen_im_Breisgau_Kirche_Sankt_Martin01_2009-08-01.jpg","page_title":"Շտաուֆեն իմ Բրայսգաու","context_page_description":"Շտաուֆեն իմ Բրայսգաու, կոմունա Գերմանիայի Բադեն-Վյուրթեմբերգ երկրամասում։\\nԵնթարկվում է Ֆրաիբուրգ շրջանին։ Մտնում է Բրայսգաու Վերին Շվարցվալդի շրջանի կազմի մեջ։ Բնակչությունը կազմում է 7628 մարդ ։ Տարածքը կազմում է 23,26 կմ²։ Պաշտոնական կոդ՝ 08 3 15 108։\\nՔաղաքն բաժանված է 3 քաղաքյին համայնքների։"},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%B1%90%E6%AD%A2%E6%BF%9F%E5%BE%B7%E5%AE%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/TW_THWtp29.png","page_title":"汐止濟德宮","context_page_description":"汐止济德宫，俗称汐止妈祖庙、水返脚妈祖庙，是位于台湾新北市汐止区礼门里的妈祖庙，为台湾电视剧《通灵少女》主要取景地点。"},{"page_url":"https://en.wikipedia.org/wiki/Gorsley","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/View_to_Gorsley_Common_-_geograph.org.uk_-_1763059.jpg","page_title":"Gorsley","context_page_description":"Gorsley is a small village in the Forest of Dean district of Gloucestershire, forming part of the civil parish of Gorsley and Kilcot in the South West England. Nearby Gorsley Common and Little Gorsley are both in Herefordshire."},{"page_url":"https://no.wikipedia.org/wiki/Schirmacheroasen","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Station_%C2%AB_Georg_Forster_%C2%BB_%28timbre_RDA%29.jpg","page_title":"Schirmacheroasen","context_page_description":"Schirmacheroasen er et 25 kilometer langt og opptil tre kilometer bredt isfritt platå i Vassfjellet i Dronning Maud Land som inneholder over 100 ferskvannsinnsjøer. Området ligger gjennomsnittlig 100 meter over havet og har en utstrekning på 34 km².\\nKlimaet og det skrinne jordsmonnet gir bare vekstforhold for enkelte arter mose og lav. Fuglelivet består av sørhavsjo, antarktispetrell, snøpetrell og oseanstormsvaler. Adeliepingviner også observeres tidvis."},{"page_url":"https://fi.wikipedia.org/wiki/Saksan_kaapparilaivat_maailmansodissa","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Komet_%28auxiliary_cruiser%29.jpg","page_title":"Saksan kaapparilaivat maailmansodissa","context_page_description":"Kaappari-nimitystä käytettiin 1900-luvun maailmansodissa, vaikka klassinen kaapparitoiminta oli päättynyt Napoleonin sotien myötä."},{"page_url":"https://de.wikipedia.org/wiki/Mannschaftskader_der_deutschen_Schachbundesliga_2012/13","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Mons%2CL%C3%A9on_2015_Wien.JPG","page_title":"Mannschaftskader der deutschen Schachbundesliga 2012/13","context_page_description":"Die Liste der Mannschaftskader der deutschen Schachbundesliga 2012/13 enthält alle Spieler, die für die deutsche Schachbundesliga 2012/13 gemeldet wurden mit deren Einzelergebnissen:"},{"page_url":"https://en.wikipedia.org/wiki/List_of_public_art_in_Philadelphia","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Steuben_calls_taxi_PMA.JPG","page_title":"List of public art in Philadelphia","context_page_description":"This is a list of public artworks in Philadelphia. The Association for Public Art estimates the city has thousands of public artworks; the Smithsonian lists more than 700. Since 1959 nearly 400 works of public art have been created as part of the city's Percent for Art program, the first such program in the U.S.\\nThis list contains only works of public art in outdoor public spaces, and not, for example, works inside museums. Most of the works mentioned are sculptures. Other kinds of art, i.e., sound installations, are marked as such next to their titles."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%9C%E0%B1%86%E0%B0%A8%E0%B1%8D%E0%B0%B7%E0%B0%BF%E0%B0%AF%E0%B0%A8%E0%B1%87%E0%B0%B2%E0%B0%BF%E0%B0%B8%E0%B1%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Gentiana_cruciata_2.jpg","page_title":"జెన్షియనేలిస్","context_page_description":"జెన్షియనేలిస్ వృక్ష శాస్త్రములోని ఒక క్రమము."},{"page_url":"https://no.wikipedia.org/wiki/Klistremerke","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/Bananas_on_countertop.JPG","page_title":"Klistremerke","context_page_description":"Et klistremerke er et stykke papir eller plast påtrykt bilder eller tekst og utstyrt med lim på baksida. Bak er det vanligvis også et beskyttelsesark for å hindre at limet blir ødelagt før bruk. Klistremerkene kan enkelt limes på forskjellige gjenstander for å dekorere eller merke dem.\\nNoen samler på klistremerker og bytter dem med andre samlere."},{"page_url":"https://ru.wikipedia.org/wiki/M19_(%D0%BA%D0%B8%D0%B1%D0%B5%D1%80%D1%81%D0%BF%D0%BE%D1%80%D1%82%D0%B8%D0%B2%D0%BD%D1%8B%D0%B9_%D0%BA%D0%BB%D1%83%D0%B1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Moskovsky_prospekt_SPb_2010_3205.jpg","page_title":"M19 (киберспортивный клуб)","context_page_description":"M19 — киберспортивный клуб, существовавший в Санкт-Петербурге с 1999 по 2006 годы. В 2002 году команда клуба M19 по компьютерной игре Counter-Strike стала чемпионом мира по версии WCG, а игрок в Quake Алексей Нестеров впервые в российской истории выиграл один из старейших турнир QuakeCon от id Software.\\nТриумфальное выступление команды M19 по Counter-Strike и российских игроков в Quake на чемпионате мира дало небывалый толчок к развитию и популяризации киберспорта в России, а 2002 год позже стал называться «золотым годом российского киберспорта»."},{"page_url":"https://fi.wikipedia.org/wiki/%C5%8Cmachi","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/%E5%86%AC%E3%81%AE%E9%9D%92%E6%9C%A8%E6%B9%9602.jpg","page_title":"Ōmachi","context_page_description":"Ōmachi on Japanin kaupunki Honshūn saarella Chūbun tai Kōshin’etsun alueella Naganon prefektuurissa. Se sijaitsee sisämaassa prefektuurin luoteisosassa Matsumoton altaan pohjoisreunalla. Kaupunkiin kuuluu laajoja alueita Hidavuorilta, muun muassa huomiotaherättävä Yarivuori. Kaupungin keskusta on rakentunut Takasejoen varrelle. Ōmachissa on 26 975 asukasta ja sen pinta-ala on 565,15 neliökilometriä.\\nKamakura-kaudella Ōmachiin syntyi kyläasutus Nishina-klaanin residenssin ympärille. Myöhemmin Edo-kaudella se kehittyi markkinapaikkana ja yhtenä Chikuni-kaidō-tiereitin postiasemista. 1930-luvulla sinne sijoittui vesivoimaa hyödyntävää alumiinin tuotantoa ja tekstiiliteollisuutta. Kaupunkioikeudet Ōmachille myönnettiin vuonna 1954, kun Ōmachin maaseutukaupunkiin liitettiin kolme muuta kuntaa. Sittemmin kaupungin teollisuus on taantunut ja merkittävimmäksi elinkeinoksi on noussut turismi. Ōmachi on tukikohta ympäröiville vuoristoalueille suuntautuvalle kiipeilylle. Kaupungissa toimii useita laskettelukeskuksia sekä Ōmachin, Kuzun ja Yutaman kuumat lähteet. Kaupunki laajeni huomattavasti vuonna 2006, kun siihen yhdistettiin Miasan ja Yasakan kyläkunnat."},{"page_url":"https://en.wikipedia.org/wiki/Kyoto_Animation_arson_attack","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/%E3%82%A2%E3%83%8B%E3%83%A1%E3%82%A4%E3%83%88%E7%A7%8B%E8%91%89%E5%8E%9F_%E4%BA%AC%E9%83%BD%E3%82%A2%E3%83%8B%E3%83%A1%E3%83%BC%E3%82%B7%E3%83%A7%E3%83%B3%E6%94%AF%E6%8F%B4%E5%8B%9F%E9%87%91_%2848333506016%29.jpg","page_title":"Kyoto Animation arson attack","context_page_description":"The Kyoto Animation arson attack occurred at Kyoto Animation's Studio 1 building in the Fushimi ward of Kyoto, Japan, on the morning of 18 July 2019. The arson killed at least 36 people, injured an additional 33, and destroyed most of the materials and computers in Studio 1. It is one of the deadliest massacres in Japan since the end of World War II and the deadliest building fire in Japan since the 2001 Myojo 56 building fire.\\nThe suspect Shinji Aoba, who did not work for the studio, entered the front door and doused the area and several employees with gasoline before igniting it. After setting himself on fire while lighting the gasoline, the suspect attempted to flee, but was apprehended by police about 100 metres from the building. Witnesses stated they heard him accusing the studio of plagiarism. The police arrested Aoba on suspicion of murder and other offenses on 27 May 2020, after awaiting his recovery from life-threatening burns for more than 10 months."},{"page_url":"https://ca.wikipedia.org/wiki/H%C3%A0mster_daurat","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Babyhamster-scottobear.jpg","page_title":"Hàmster daurat","context_page_description":"L'hàmster daurat és un petit rosegador originari de Síria i Turquia. Es tracta d'una espècie de cricetí molt estesa en captivitat, una mica arreu del món. Algunes races d'hàmster daurat, criades com a animals de companyia o de laboratori, fins i tot són considerades domèstiques per països com ara França."},{"page_url":"https://zh.wikipedia.org/zh-mo/%E9%98%BF%E6%9C%A8%E7%AB%99","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Akechi_railroad_Agi_station.jpg","page_title":"阿木站","context_page_description":"阿木站是一個位於岐阜縣中津川市阿木的明知鐵道明知線的鐵路車站。"},{"page_url":"https://pl.wikipedia.org/wiki/Lista_%C5%9Bwiatowego_dziedzictwa_UNESCO_w_Belgii","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Library_of_Plantin-Moretus_Museum_in_Antwerp.jpg","page_title":"Lista światowego dziedzictwa UNESCO w Belgii","context_page_description":"Lista światowego dziedzictwa UNESCO w Belgii – lista miejsc w Belgii wpisanych na listę światowego dziedzictwa UNESCO, ustanowioną na mocy Konwencji w sprawie ochrony światowego dziedzictwa kulturowego i naturalnego, przyjętą przez UNESCO na 17. sesji w Paryżu 16 listopada 1972 i ratyfikowaną przez Belgię 24 lipca 1996 roku.\\nObecnie na liście znajduje się 13 obiektów: 12 dziedzictwa kulturowego i jeden o charakterze przyrodniczym.\\nNa belgijskiej liście informacyjnej UNESCO – liście obiektów, które Belgia zamierza rozpatrzyć do zgłoszenia do wpisu na listę światowego dziedzictwa, znajduje się 16 obiektów."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BD%D0%B8%D1%81%D1%82%D0%B5%D1%80%D1%81%D1%82%D0%B2%D0%BE_%D0%BE%D0%B1%D1%80%D0%B0%D0%B7%D0%BE%D0%B2%D0%B0%D0%BD%D0%B8%D1%8F_%D0%B8_%D0%BD%D0%B0%D1%83%D0%BA%D0%B8_%D0%A0%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA%D0%BE%D0%B9_%D0%A4%D0%B5%D0%B4%D0%B5%D1%80%D0%B0%D1%86%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/2015-minobrnauki.jpg","page_title":"Министерство образования и науки Российской Федерации","context_page_description":"Министе́рство образования и нау́ки Росси́йской Федера́ции — федеральный орган исполнительной власти России, действовавший в 2004—2018 годах и осуществлявший функции по выработке государственной политики и нормативно-правовому регулированию в сфере образования, научной, научно-технической и инновационной деятельности, развития федеральных центров науки и высоких технологий, государственных научных центров и наукоградов, интеллектуальной собственности, а также в сфере молодёжной политики, воспитания, опеки и попечительства, социальной поддержки и социальной защиты обучающихся и воспитанников образовательных учреждений.\\nПрекратило существование в связи с разделением на два ведомства: Министерство просвещения Российской Федерации и Министерство науки и высшего образования Российской Федерации. Сокращение «Минобрнауки» после разделения стало относиться к Министерству науки и высшего образования."},{"page_url":"https://sh.wikipedia.org/wiki/Conway,_Washington","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Main_Street%2C_Conway%2C_Washington.jpg","page_title":"Conway, Washington","context_page_description":"Konvej je naseljeno mesto bez administrativnog statusa u američkoj saveznoj državi Vašington."},{"page_url":"https://en.wikipedia.org/wiki/Conductor%27s_Building","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/RTS_bus_in_Bennett_Alley%2C_July_2006.jpg","page_title":"Conductor's Building","context_page_description":"The Conductor's Building is a former Boston Elevated Railway administrative building, located on Bennett Alley between Mount Auburn Street and Bennett Street near Harvard Square in Cambridge, Massachusetts. Built in 1912 as the headquarters of BERy's 7th Division, it is the only original building surviving from the construction of the Cambridge Subway. After being renovated from 2014 to 2017 as part of an adjacent hotel project, the building was used as a restaurant from April 2017 to August 2018. Under the name Boston Elevated R.Y. Offices, it is a contributing property to the Harvard Square Historic District."},{"page_url":"https://mk.wikipedia.org/wiki/%D0%A1%D0%B2%D0%B5%D1%82%D0%BE_%D0%A0%D0%B8%D0%BC%D1%81%D0%BA%D0%BE_%D0%A6%D0%B0%D1%80%D1%81%D1%82%D0%B2%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Reichskarte1705.jpg","page_title":"Свето Римско Царство","context_page_description":"Свето Римско Царство — германско царство кое постоело од 962 до 1806 во Средна Европа. Со него владеел царот на Светото Римско Царство. Неговиот карактер се сменил за време на средниот век и Раниот нов век, кога моќта на царот постепено заслабнувала во корист на принцевите. Во своите последни векови, тоа било само унија од територии.\\nТериторијата на царството била со средиште во Кралството Германија, а ги вклучувало и соседните територии и во својот врв ги вклучувало и Кралството Италија и Кралството Бургундија. Во најголемиот дел од својата историја, тоа се состоело од стотици мали под-делови, принципати, кнежевства, војводства, слободни царски градови и други.\\nВо 962 година Отон I бил прогласен за цар на Светото Римско Царство, иако титулата цар на Светото Римско Царство според традиционалните преданија претходно му била доделена на Карло Велики во 800 година. Отон бил првиот цар на државата кој не и припагал на династијата Каролинзи. Последен цар на Светото Римско Царство бил Франц II, кој абдицирал и го растурил царството во 1806 за време на Наполеонските војни. По седницата во Келн во 1512 година, името било официјално сменето во Свето Римско Царство на германскиот народ.."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_Europas_fugler","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/SittaWhiteheadiKeulemans.jpg","page_title":"Liste over Europas fugler","context_page_description":"Denne listen over Europas fugler inkluderer 886 arter. Inkludert er 24 introdusert art.\\nRekkefølge er etter Clements-lista versjon v2015\\nDe norske navn er etter Norske navn på verdens fugler.\\nStatus på lista:\\nFA - Fremmed art. En art som forekommer utenfor sitt naturlige utbredelsesområde. Arten har blitt frakta dit av mennesker.\\nS - Europeisk sjeldenhet eller tilfeldig.\\nX - Lokalt utryddet\\nEX - Utryddet etter IUCNs rødliste\\nNT - Nær truet etter IUCNs rødliste\\nVU - Sårbar etter IUCNs rødliste\\nEN - Sterkt truet etter IUCNs rødliste\\nCR - Kritisk truet etter IUCNs rødliste"},{"page_url":"https://pt.wikipedia.org/wiki/Roberto_Iannuzzi","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Roberto-Iannuzzi.jpg","page_title":"Roberto Iannuzzi","context_page_description":"Roberto Iannuzzi é um paleontólogo e paleobotânico brasileiro. Formado em Biologia, professor da Universidade Federal do Rio Grande do Sul e especialista em flora do Carbonífero e evolução paleoflorística."},{"page_url":"https://en.wikipedia.org/wiki/Daimyo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5f/Toshisada_Maeda.jpg","page_title":"Daimyo","context_page_description":"Daimyo were powerful Japanese feudal lords who—until their decline in the early Meiji period—ruled most of Japan from their vast, hereditary land holdings. Subordinate to the shōgun and nominally to the emperor and the kuge, daimyo were powerful feudal rulers from the 10th century to the middle 19th century in Japan. In the term, dai means \\"large\\", and myō stands for myōden, meaning \\"private land\\".\\nFrom the shugo of the Muromachi period through the Sengoku to the daimyo of the Edo period, the rank had a long and varied history. The backgrounds of daimyo also varied considerably; while some daimyo clans, notably the Mōri, Shimazu and Hosokawa, were cadet branches of the Imperial family or were descended from the kuge, other daimyo were promoted from the ranks of the samurai, notably during the Edo period.\\nDaimyo often hired samurai to guard their land, and they paid the samurai in land or food as relatively few could afford to pay samurai in money. The daimyo era ended soon after the Meiji Restoration with the adoption of the prefecture system in 1871.\\nThe term \\"daimyo\\" sometimes refers to the leading figures of such clans, also called \\"lord\\"."},{"page_url":"https://sv.wikipedia.org/wiki/Neko_Case","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Neko_Case_-_Forecastle_Fest_2012_%28cropped%29.jpg","page_title":"Neko Case","context_page_description":"Neko Richelle Case, född 8 september 1970 i Alexandria, Virginia, är en amerikansk sångerska och låtskrivare. Hennes musik kallas ofta alternativ country. I början av sin musikkarriär gick hon under namnet Neko Case & Her Boyfriends men bytte senare till sitt vanliga namn, Neko Case.\\nHon flyttade hemifrån redan vid 15 års ålder och kom till Vancouver, British Columbia, Kanada år 1994 och spelade där i flera olika lokala punkband. Maow var ett av de största hon var med i. Hennes första countryskiva spelades in under tiden hon bodde i Kanada. Idag är hon med i bandet The New Pornographers där hon är sångerska. Till bandet skriver hon även en del låtar men gör även ibland covers på kända amerikanska band och artister som Bob Dylan, Loretta Lynn och Hank Williams.\\n2010 uppträdde hon i TV-programmet Elvis Costello med gäster med bland andra Sheryl Crow. Dessutom förekommer hon på Fran Healys skiva Wreckorder från hösten 2010."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B1%B1%E9%BA%A5%E5%86%AC%E5%B1%AC","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/LyriopeSpicata_wb.jpg","page_title":"山麥冬屬","context_page_description":"山麦冬属是天门冬科假叶树亚科中的一个属，它产于东亚，其植物类似草，开花。今天在温带一些种经常被用作园林植物。山麦冬属曾经被划为百合科，在被子植物APG II分类法中被划分为假叶树科。被子植物APG III分类法中并入天门冬科，成为假叶树亚科。山麦冬属又名土麦冬属、麦门冬属。\\n山麦冬属植物一般因为其常绿的叶子而被使用在园林中。一些种如山麦冬在条件良好的情况下会通过走茎繁殖非常快地蔓延。\\n山麦冬在中药中有使用。"},{"page_url":"https://de.wikipedia.org/wiki/Philibert_Le_Roy","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Chateau-de-versailles-cour.jpg","page_title":"Philibert Le Roy","context_page_description":"Philibert Le Roy war ein französischer Baumeister des klassizistischen Barocks und Hofbaumeister des Königs Ludwigs XIII.\\nAm 30. April 1631 unterzeichnete er, gemeinsam mit dem im Namen des Königs handelnden Oberbauintendanten Henri de Fourcy den Vertrag, der die Bedingungen festhielt, zu welchen der erste, 1623 in den Wäldern bei Versailles von dem Maurermeister Nicolas Huau für Ludwig XIII. errichtete Jagdpavillon in den Jahren von 1631 bis 1634 zu einer größeren dreiflügeligen Schlossanlage umgebaut wurde.\\nDie Dreiflügelanlage von Le Roy bildete den Kern des unter Ludwig XIV. hauptsächlich durch Louis Le Vau und Jules Hardouin-Mansart errichteten Schlosses Versailles. Ihre typischen, aus Backstein und behauenen Standsteinquadern zusammengesetzten Fassaden umgeben noch heute den zur Stadt gekehrten, im Zentrum des Schlosses von Versailles gelegenen sogenannten Marmorhof.\\nDer von Le Roy ausgeführte Entwurf wurde unter anderem in Großbritannien, welches im 17. Jahrhundert vom französischen Baustil besonders fasziniert war, in mehreren Büchern abgebildet. So auch im von Robert Pricke 1670 veröffentlichten The Art of Fair Building von Pierre Le Muet."},{"page_url":"https://de.wikipedia.org/wiki/Preah_Pithu","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d8/Preah_Pithu34.JPG","page_title":"Preah Pithu","context_page_description":"Preah Pithu ist ein aus fünf weitgehend zerstörten Tempeln bestehender Komplex in Angkor Thom. Er liegt nordöstlich des Khmer-Königspalastes Phimeanakas, nördlich der Stadt Siem Reap, Kambodscha. Die einzelnen, in Teilen unvollendet gebliebenen Bauten wurden wahrscheinlich mehrheitlich in der ersten Hälfte des 12. Jahrhunderts unter Suryavarman II. errichtet. Bis auf ein später erbautes buddhistisches Heiligtum handelt es sich bei Preah Pithu um eine hinduistische Tempelanlage. Preah Pithu wurde zu Anfang des 20. Jahrhunderts von der École française d’Extrême-Orient vom Baumbewuchs befreit und ist heute Teil der UNESCO-Welterbestätte von Angkor."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A8%D9%8A%D9%84_%D8%B1%D8%A7%D8%B3%D9%8A%D9%84_(%D9%84%D8%A7%D8%B9%D8%A8_%D9%83%D8%B1%D8%A9_%D9%82%D8%A7%D8%B9%D8%AF%D8%A9)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/1971_Ticketron_Bill_Russell.jpg","page_title":"بيل راسيل (لاعب كرة قاعدة)","context_page_description":"بيل راسيل ‏ هو لاعب كرة قاعدة أمريكي، ولد في 21 أكتوبر 1948 في مقاطعة كراوفورد في الولايات المتحدة."},{"page_url":"https://de.wikipedia.org/wiki/Baedeker-Reisef%C3%BChrer","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/F_3_Le_Rhin_2._IIa_TB_WP.jpg","page_title":"Baedeker-Reiseführer","context_page_description":"Als Baedeker wird ein Reiseführer für Reiseziele im In- und Ausland bezeichnet. Er erschien erstmals 1832 in dem vom Namensgeber Karl Baedeker 1827 gegründeten Verlag in Koblenz, der ab 1872 in Leipzig und ab 1956 in Freiburg im Breisgau arbeitete. Seit 1997 gehört der Verlag zur MairDumont-Gruppe mit Sitz in Ostfildern.\\nDurch seinen prägnanten Sprachstil, die Genauigkeit der Reiseinformationen und die großzügige kartographische und sonstige Ausstattung wurde er im 19. Jahrhundert vor allem im deutschsprachigen Raum mit seinem roten Leineneinband und der goldfarbenen Beschriftung im Prägedruck zum Synonym des Reiseführers schlechthin. Die frühzeitige Aufnahme fremdsprachiger Ausgaben in das Reiseführerprogramm verschaffte dem Baedeker auch einen weltweiten Ruf.\\nNeben der 2010 eingestellten Reihe Baedekers Stadtführer erschienen von 1979 bis 2012 die Baedeker unter dem Titel Baedeker Allianz Reiseführer in den Kennfarben der beteiligten beiden Unternehmen „Rot/Blau“. Seit 2013 tragen sie wieder den alleinigen Namen Baedeker."},{"page_url":"https://de.wikipedia.org/wiki/Liste_Wuppertaler_Sakralbauten","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7d/Wuppertal_N%C3%A4chstebreck_Neuapostolisch.jpg","page_title":"Liste Wuppertaler Sakralbauten","context_page_description":"Die Bewohner der Stadt Wuppertal gehören über 50 unterschiedlichen Religionen und Konfessionen an. Der explosionsartige Bevölkerungszuwachs im 19. Jahrhundert begünstigte auch den Bau vieler Sakralgebäude, insbesondere für die in der Stadt besonders stark vertretenen protestantischen Freikirchen. Durch die Tatsache, dass die Gemeinden der Evangelischen Kirche im Rheinland erst in den 1980er Jahren uniert wurden, steht praktisch in jedem Stadtteil eine katholische und je eine ursprünglich lutherische und reformierte Kirche, von denen mittlerweile viele angesichts des Bevölkerungsrückgangs in der Stadt profaniert wurden. Zum Ende des 20. Jahrhunderts kamen vor allem muslimische Gebäude hinzu. Eine weitere Besonderheit der Stadt sind die rund fünfzig, fast ausschließlich konfessionellen Friedhöfe Wuppertals, die ebenfalls zahlreiche Sakralgebäude beherbergen.\\nDiese Liste versammelt die historischen und aktuellen Gottesdienst- und Versammlungsgebäude der verschiedenen Religionen und Konfessionen in Wuppertal, dazu gehören aktuell knapp 130 Bauten. Einige dieser Bauten sind werden nicht mehr als Kirchen genutzt, so sind in den letzten Jahren bis 2015 30 Kirchen zur Entwidmung gelangt."},{"page_url":"https://en.wikipedia.org/wiki/81st_Fighter-Bomber_Group","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/78th_Fighter-Bomber_Squadron_-_North_American_F-86F-25-NH_Sabre_-_51-13234.jpg","page_title":"81st Fighter-Bomber Group","context_page_description":"The 81st Fighter-Bomber Group is an inactive United States Air Force unit. It was last assigned to the 81st Fighter-Bomber Wing at RAF Bentwaters, England. It was inactivated on 8 February 1955."},{"page_url":"https://de.wikipedia.org/wiki/Semera","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Semera.jpg","page_title":"Semera","context_page_description":"Semera ist eine Retortenstadt am Rande der Danakil-Wüste im Nordosten Äthiopiens. Sie ist seit 2007 Hauptstadt der Region Afar. Vorher hatte das ca. 100 km südöstlich gelegene Asaita diese Funktion. Zusammen mit der 7 km südöstlich gelegenen und größeren Stadt Logiya leben hier rund 94.000 Menschen."},{"page_url":"https://fr.wikipedia.org/wiki/Cath%C3%A9drale_de_Citt%C3%A0_di_Castello","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Cath%C3%A9drale-D%C3%A9tail_caisson_plafond.jpg","page_title":"Cathédrale de Città di Castello","context_page_description":"Le dôme de Città di Castello est le dôme de la ville de Città di Castello, dans la province de Pérouse."},{"page_url":"https://it.wikipedia.org/wiki/NGC_3132","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/NGC_3132.jpg","page_title":"NGC 3132","context_page_description":"NGC 3132 è una nebulosa planetaria visibile nella costellazione delle Vele; è talvolta chiamata Nebulosa Anello del sud, in contrapposizione con la ben nota Nebulosa Anello.\\nSi trova nella parte settentrionale della costellazione, 2 gradi a nord-ovest della stella q Velorum. Le foto della nebulosa rivelano due stelle molto vicine, una di decima e l'altra di sedicesima magnitudine apparente. La vera stella centrale, responsabile della formazione della nebulosa, è la più debole delle due; questa stella centrale possiede una superficie molto calda, di circa 100.000 K, ed emette intensa radiazione ultravioletta, che illumina i gas della nebulosa. Questo guscio gassoso si espande alla velocità di circa 24 km/s. La distanza è stimata sui 2000 anni luce."},{"page_url":"https://en.wikipedia.org/wiki/British_railway_rolling_stock","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/68010_Chiltern_Railways_Hatton_Bank_19-08-15_%2820628237900%29.jpg","page_title":"British railway rolling stock","context_page_description":"British railway rolling stock refers to the trains used in Britain."},{"page_url":"https://he.wikipedia.org/wiki/%D7%93%D7%99%D7%A0%D7%94_%D7%A4%D7%90%D7%95%D7%95%D7%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/President_Donald_Trump_receives_a_briefing_on_a_military_strike.jpg","page_title":"דינה פאוול","context_page_description":"דינה חביב פאוול היא מנהלת ויועצת אמריקאית, כיהנה כמשנה לענייני אסטרטגיה של היועץ לביטחון לאומי והיועצת לענייני יוזמות כלכליות לנשיא דונלד טראמפ, ממרץ 2017 לינואר 2018."},{"page_url":"https://bs.wikipedia.org/wiki/Prisilno_raseljavanje_u_Sovjetskom_Savezu","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/CroppedStalin1943.jpg","page_title":"Prisilno raseljavanje u Sovjetskom Savezu","context_page_description":"Prisilno raseljavanje u Sovjetskom Savezu, poznato jednostavno i kao Sovjetske deportacije odnosi se na razdoblje tokom vladavine Josifa Staljina, od 1930-ih do 1952, kada je SSSR vršio praksu prisilnog raseljavanja i razmjene stanovništva koji se mogu razvrstati u sljedeće kategorije: deportacije \\"anti-sovjetskih\\" grupa, tzv. \\"neprijatelja radnika\\"; etničko čišćenje cijelih naroda i narodnosti, kako ne bi činili homogenu cjelinu u svojoj republici te tako ni prijetnju stabilnosti SSSR-a; transfer radne snage te organizirane migracije, povremeno čak i kolonizacije, u suprotne smjerove, kako bi se \\"izmiješale\\" razne republike i time pojačao njihov \\"sovjetski\\" karakter. NKVD-ove procedure prilikom deportacija su uglavnom bile standardne: naoružani agenti opkolili bi rano ujutro ili usred noći neko selo, dali porodici 15-20 minuta da se pakira, ukrcali ih na kamione odakle bi bili ih odvezli do obližnje željezničke stanice gdje su ukrcani u vagone za stoku odakle su poslani u centralnu Aziju ili Sibir, ovisno o svakoj grupi.\\nU većini slučajeva, njihova odredišta su bila udaljena, nenastanjena mjesta ili gulag."},{"page_url":"https://pl.wikipedia.org/wiki/Tkanina_z_Bayeux","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/BayeuxTapestryScene05.jpg","page_title":"Tkanina z Bayeux","context_page_description":"Tkanina z Bayeux – ręcznie haftowane płótno przedstawiające podbój Anglii przez Wilhelma I Zdobywcę i bitwę pod Hastings w 1066 roku; dzieło sztuki świeckiej; cenne ikonograficzne źródło historyczne.\\nW roku 2007 została wpisana na listę UNESCO Pamięć Świata."},{"page_url":"https://he.wikipedia.org/wiki/%D7%98%D7%98%D7%A8%D7%A4%D7%99%D7%9C%D7%95%D7%9F","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Leptis_Magna_Arch_of_Septimus_Severus.jpg","page_title":"טטרפילון","context_page_description":"טטרפילון הוא מבנה מונומנטלי שבו ארבעה שערים או פתחים.\\nהטטרפילון רווח באדריכלות הקלאסית, בעיקר באדריכלות הרומית, ובייחוד בחלקו המזרחי של הים התיכון. המבנה התאפיין לעיתים קרובות בצורת קובייה שבכל אחד מצדדיה נקבע שער, ובין השערים נצבו עמודים או פילסטרים אשר תחמו אותם ונשאו את הגג. הטטרפילון עשוי להיבנות ממבנה בודד או ממספר מבנים נפרדים, כדוגמת ה\\"טטרקיאוניון\\", מעבר לא מקורה התחום על ידי ארבעה עמודים או מבנים נפרדים.\\nהטטרפיליה הוקמו בדרך כלל בצמתים חשובים או בנקודות בעלות חשיבות גאוגרפית יוצאת דופן, דוגמת שערי ניצחון, או כמבנים דקורטיביים בעלי ערך אסתטי. לטטרפיליה שניצבו בצמתים חשובים נודע קשר לאל יאנוס, אל השערים וההתחלות, הצמתים והמעברים במיתולוגיה הרומית."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%85%DB%8C%D8%B1%DB%8C%D9%86_%DA%A9%D9%88%D8%B1_%D8%A7%DB%8C%D8%A6%D8%B1%D8%A7%D8%B3%D9%B9%DB%8C%D8%B4%D9%86_%D8%A8%DB%8C%D9%88%D9%81%D9%88%D8%B1%D9%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Mcasbeaufort.jpg","page_title":"میرین کور ایئراسٹیشن بیوفورٹ","context_page_description":"میرین کور ایئراسٹیشن بیوفورٹ ریاستہائے متحدہ امریکا کا ایک ہوائی اڈا جو جنوبی کیرولائنا میں واقع ہے۔"},{"page_url":"https://en.wikipedia.org/wiki/United_Daily_News","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/United_Daily_News_Group_Building_in_Xizhi_in_the_evening.JPG","page_title":"United Daily News","context_page_description":"United Daily News is a newspaper published in Taiwan in Chinese. It is considered to support the Pan-Blue Coalition in its editorials."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%B3%D1%80%D0%B0%D0%BC%D1%8F%D0%BD_(%D0%90%D1%80%D0%B0%D1%80%D0%B0%D1%82%D1%81%D0%BA%D0%B0%D1%8F_%D0%BE%D0%B1%D0%BB%D0%B0%D1%81%D1%82%D1%8C)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/%D4%B2%D5%A1%D5%B2%D6%80%D5%A1%D5%B4%D5%B5%D5%A1%D5%B6_%D5%A3%D5%B5%D5%B8%D6%82%D5%B2%2C_2015.jpg","page_title":"Баграмян (Араратская область)","context_page_description":"Баграмян — село в области Арарат в Армении.\\nГлавой сельской общины является Гагик Галстян."},{"page_url":"https://it.wikipedia.org/wiki/Kassian_Lauterer","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4b/Fuerst3_Ochsenhausen_2014_09_06.JPG","page_title":"Kassian Lauterer","context_page_description":"Kassian Lauterer è un abate austriaco, dal 29 gennaio 2009 abate ordinario emerito di Wettingen-Mehrerau."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_Ios%C4%83%C8%99el","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e3/IosaselAR_%2828%29.JPG","page_title":"Biserica de lemn din Iosășel","context_page_description":"Biserica de lemn din Iosășel, Gurahonț, județul Arad a fost construită în anul 1898. Are hramul „Nașterea Domnului”."},{"page_url":"https://de.wikipedia.org/wiki/Gerlef_Meins","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/GerlefMeins12.jpg","page_title":"Gerlef Meins","context_page_description":"Gerlef Meins ist ein deutscher Schachspieler."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%82%D8%A7%D8%A6%D9%85%D8%A9_%D9%85%D8%B9%D8%AA%D9%82%D9%84%D9%8A_%D8%BA%D9%88%D8%A7%D9%86%D8%AA%D8%A7%D9%86%D8%A7%D9%85%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/ISN_01461%2C_Mohammed_Ahmad_Rabbani.jpg","page_title":"قائمة معتقلي غوانتانامو","context_page_description":"اعتقلت الولايات المتحدة الأمريكية أكثر من 779 معتقلاً إدارياً خارج نطاق القضاء في معتقل غوانتانامو الأمريكي في كوبا منذ فتح معسكرات الاعتقال في 11 يناير 2002، وانخفض العدد إلى 160 تقريبًا في ديسمبر 2013. وفي 17 يناير 2017 أعلنت الحكومة الأمريكية أنها ما زالت تعتقل 41 معتقلًا في غوانتانامو. وفي مايو 2018 تم إعادة المعتقل هزاع الدربي إلى السعودية ليصبح العدد 40 معتقلًا.\\nيقع معتقل غوانتانامو في خليج غوانتانامو، وهو سجن سيء السمعة، بدأت السلطات الأمريكية باستعماله في سنة 2002، ويعتبر السجن سلطة مطلقة لوجوده خارج الحدود الأمريكية في أقصى جنوب شرق كوبا، ولا ينطبق عليه أي من قوانين حقوق الإنسان إلى الحد الذي جعل منظمة العفو الدولية تقول أن معتقل غوانتانامو الأمريكي يمثل همجية هذا العصر\\nيلبس المعتقلون عادةً زيًا برتقاليًا أو أبيض، البرتقالي يلبسه المعتقلون الذين تسميهم الإدارة الأمريكية \\"غير مطاوعين\\" أي لا يستجيبون للأوامر أو اشتبكوا مع الحراس من قبل، والزي الأبيض للمعتقلين الذين تسميهم الإدارة الأمريكية \\"مطاوعون\\"، بينما يعتبر الزي البرتقالي هو الأشهر إعلاميًا.\\nلم يكن هناك معلومات عن المعتقلين في غوانتانامو حتى بدأ موقع ويكيليكس والعديد من المنظمات الإخبارية المستقلة بنشر 779 وثيقة كانت سرية سابقًا تتعلق بالمعتقلين في 25 أبريل 2011."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%95%AC%E9%A0%86%E7%8E%8B","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0c/King_Kyungsoon_of_Silla.jpg","page_title":"敬順王","context_page_description":"敬順王，姓金名傅，是新羅國君主，伊飡金孝宗之子，文聖王的裔孫，母桂娥太后金氏是憲康王之女。927年甄萱攻陷新羅金城，景哀王被捉後自盡，甄萱扶持金氏王族後裔的金傅為新羅國王，金傅在位八年，935年讓國於高麗，新羅國被除爲慶州。高麗太祖王建將長女樂浪公主許給金傅為妻，封爲觀光順化衛國功臣上柱國樂浪王政丞，食邑八千戶，位在太子之上，居於神鸞宮，仍以新羅舊都慶州交其治理。高麗景宗三年四月四日薨，諡為敬順，葬於長湍府南八里聖居山癸坐丁向原。"},{"page_url":"https://es.wikipedia.org/wiki/Moerdijk","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5c/Fort_Sabina_100MLT11-PICT0038.jpg","page_title":"Moerdijk","context_page_description":"Moerdijk es un municipio de la provincia de Brabante Septentrional en los Países Bajos. Sobre un área de 184,03 km², de los que 24,79 km² cubiertos por el agua, es el segundo mayor municipio de la provincia, solo por detrás de Meierijstad. El 30 de abril de 2017 contaba con una población de 36.988 habitantes, ​ con una densidad de 232 h/km².\\nEl municipio se creó con la reordenación municipal de Brabante Septentrional el 1 de enero de 1997 por la fusión de Fijnaart en Heijningen, Klundert, Standdaarbuiten y Willemstad con el municipio de Zevenbergen, que inicialmente dio nombre al nuevo municipio y en donde se sitúa la capital.​ Zevenbergen es, además, el núcleo mayor del municipio y el único con derechos de ciudad, otorgados por Juan III de Brabante."},{"page_url":"https://hu.wikipedia.org/wiki/Leg%C3%A9ny-barlang","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Leg%C3%A9ny-barlang_bej%C3%A1rata.jpg","page_title":"Legény-barlang","context_page_description":"A Legény-barlang különálló barlang volt a Pilis hegységben. Jelenleg a fokozottan védett Ariadne-barlangrendszer része, amely az ország harmadik leghosszabb barlangja. Jelentős, régészeti lelőhely."},{"page_url":"https://fr.wikipedia.org/wiki/Carter_the_Unstoppable_Sex_Machine","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Carter_the_Unstoppable_Sex_Machine_%281989%29.jpg","page_title":"Carter the Unstoppable Sex Machine","context_page_description":"Carter the Unstoppable Sex Machine, souvent abrégé en Carter USM, est un groupe de rock indépendant britannique, originaire de Londres, en Angleterre. Il est formé en 1988 par le chanteur Jim Morrison et le guitariste Lès Carter.\\nIls ont fait leur réputation avec un style de power pop, en fusionnant les échantillons, les boîtes à rythme, les guitares et des paroles truffées de jeux de mots. Ils ont atteint le sommet de la gloire en 1992. Au fil des années, le groupe a intégré de nouveaux membres, jusqu’à atteindre une formation de six membres, malgré ces changements, ils ont lutté pour retrouver leur popularité des premières années. Le groupe a commencé à se diviser à partir de 1998. Ils avaient alors sept albums à leur compteur.\\nLes concerts du groupe sont devenus réputés pour la rangée de projecteurs qui produisait une chaleur étouffante et contribuait à l’atmosphère énergique et en sueur où les spectateurs montaient sur la scène pour se jeter dans la foule. De telles scènes sont représentées dans la vidéo In Bed With Carter, qui a été filmée à la Brixton Academy."},{"page_url":"https://sk.wikipedia.org/wiki/Thury_(Yonne)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Map_commune_FR_insee_code_89416.png","page_title":"Thury (Yonne)","context_page_description":"Thury je francúzska obec, ktorá sa nachádza v departemente Yonne, v regióne Burgundsko."},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_Dorset","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Portesham%2C_parish_church_of_St._Peter_-_geograph.org.uk_-_456559.jpg","page_title":"Grade I listed buildings in Dorset","context_page_description":"There are over 9,000 Grade I listed buildings in England. This is a list of these buildings and structures in the county of Dorset, grouped first by the two unitary authority areas: first Bournemouth, Christchurch and Poole, then Dorset."},{"page_url":"https://fr.wikipedia.org/wiki/Carcassonne","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/France_carcassonne_canal_du_midi.jpg","page_title":"Carcassonne","context_page_description":"Carcassonne est une commune française, préfecture du département de l'Aude dans la région Occitanie.\\nAu dernier recensement de 2017, la commune comptait 46 031 habitants appelés les Carcassonnais. Carcassonne est la ville principale de la Carcassonne Agglo 111 452 habitants, de l'aire urbaine de Carcassonne 98 318 habitants et de son unité urbaine qui compte 49 257 habitants.\\nOccupée depuis le Néolithique, Carcassonne se trouve dans la plaine de l'Aude entre deux grands axes de circulation reliant l'Atlantique à la mer Méditerranée et le Massif central aux Pyrénées.\\nLa ville est connue pour la Cité de Carcassonne, ensemble architectural médiéval restauré par Viollet-le-Duc au XIXᵉ siècle et inscrit au patrimoine mondial de l'UNESCO depuis 1997."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Hamburg-Altona-Altstadt","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/16876_Wohlers_Allee_2.JPG","page_title":"Liste der Kulturdenkmäler in Hamburg-Altona-Altstadt","context_page_description":"Die Liste der Kulturdenkmäler in Hamburg-Altona-Altstadt enthält die in der Denkmalliste ausgewiesenen Denkmäler auf dem Gebiet des Stadtteils Altona-Altstadt der Freien und Hansestadt Hamburg.\\nBasis ist der Datensatz Denkmalliste Hamburg auf dem Transparenzportal Hamburg. Dieser enthält alle Objekte, die rechtskräftig nach dem Hamburger Denkmalschutzgesetz vom 5. April 2013 unter Denkmalschutz stehen oder zumindest zeitweise standen. Die Denkmalliste steht auch als PDF-Dokument zur Verfügung. Alle Denkmäler in Altona-Altstadt, die schon nach dem Denkmalschutzgesetz vom 3. Dezember 1973, zuletzt geändert am 27. November 2007, unter Denkmalschutz standen, sind auch auf der Liste der Kulturdenkmäler im Hamburger Bezirk Altona zu finden."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%8F%D0%BE%D0%BD_%D0%9F%D0%B8%D1%82%D0%B5%D1%80%D1%81_%D0%A5%D0%B0%D0%BC%D1%84%D1%80%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/John_Peters_Humphrey_%28United_Nation_Photo_Library_124931%29_%28cropped_and_adjusted%29.jpg","page_title":"Џон Питерс Хамфри","context_page_description":"Џон Питерс Хамфри био је канадски правник и адвокат за људска права. Најпознатији је као аутор првог нацрта Универзалне декларације о људским правима."},{"page_url":"https://fr.wikipedia.org/wiki/El_Canto_del_Loco","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/ECDLoviedo.JPG","page_title":"El Canto del Loco","context_page_description":"El Canto del Loco est un groupe de pop rock espagnol, originaire d'Algete, à Madrid. Il est plus précisément catégorisé power pop. En 2005, le groupe gagne le prix de la meilleure représentation espagnole pour le MTV Europe Music Awards. Le groupe est formé en 1994 par Dani Martín et Iván Ganchegui et compte cinq albums studio, et un million d'exemplaires vendus ; il est l'un des groupes espagnols les plus importants de sa catégorie.\\nEn février 2010, le groupe annonce sa séparation."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%91%D1%80%D0%BE%D0%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/LOA-LWL.svg","page_title":"Брод","context_page_description":"Брод је пловно средство које служи за превоз робе и путника, за војне операције на водама, за риболов, за обављање специјалних послова на мору и рекама и за обављање различитих задатака у вези с пловидбом Бродом се сматрају само већи пловни објекти, док се мањи називају чамцима. За разлику од сплавова, брод, као и чамац, има коритаст облик који му даје узгон потребан како би плутао на води.\\nБродови су били важни чиниоци у људској миграцији и трговини. Они су омогућили ширење колонизације и трговине робљем, али су исто тако служили за научне, културне и хуманитарне сврхе. Након 16. века, нови усеви који су доспели из Америка помоћу Европских помораца знатно су допринели расту светске популације. Бродски транспорт је одговоран за највећи део светске трговине.\\nГодине 2016. је било више од 49.000 трговачких бродова, са тоталним товарним капацитетом од скоро 1,8 милијарди тона. Од тога 28% су били танкери за превоз нафте, 43% балкери, и 13% су били контејнерски бродови. Војне снаге располажу бродовима ратне морнарице и за транспорт и подршку копнених снага."},{"page_url":"https://simple.wikipedia.org/wiki/Chromium(III)_oxide","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Chromium%28III%29-oxide_pigment.jpg","page_title":"Chromium(III) oxide","context_page_description":"Chromium(III) oxide is a dark green chemical that has a formula of Cr₂O₃. It is composed of chromium in its +3 oxidation state and oxide ions. It can react with other metal oxides in basic conditions to make chromates. It is made from chromium ore and is part of the process for making chromium metal. It was used as a pigment. It dissolves in acid to produce chromium(III) salts, such as chromium(III) chloride. Stainless steel's corrosion resistance is based on this compound. A thin layer of this compound forms on the surface of the stainless steel. It prevents the rest of the steel from oxidizing."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%A3%D0%B9%D2%93%D1%8B%D1%80%D2%99%D0%B0%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Hoja-Niyaz.jpg","page_title":"Уйғырҙар","context_page_description":"Уйғырҙар — Көнсығыш Төркөстандың, хәҙерге ҠР Синьцзян автоном районының, төп халҡы. Дин буйынса — мосолман-сөнниҙәр. Уйғыр теле төрки телдәр төркөмөнә ҡарай. Уйғырҙар — күп өлөшө Ҡытай көнсығышы сигендә урынлашҡан Синьцзян регионында йәшәүсе төрки телле халыҡ.."},{"page_url":"https://nl.wikipedia.org/wiki/Foz_do_Igua%C3%A7u_(stad)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/MesquitaFozDoIgua%C3%A7uParanaBrasil.JPG","page_title":"Foz do Iguaçu (stad)","context_page_description":"Foz do Iguaçu, of kortweg Foz, is een Braziliaanse stad en gemeente gelegen in de zuidwestelijke deelstaat Paraná. Vanwege het nabijgelegen Parque Nacional do Iguaçu, die over 's werelds omvangrijkste watervallen beschikt, is het de tweede meest bezochte plaats van Brazilië door zowel binnenlandse- als buitenlandse toeristen. Volgens het Braziliaans Instituut voor Geografie en Statistiek telde stad in 2017 naar schatting 264.044 inwoners. De oppervlakte van het gebied bestrijkt 617,701 km², waarvan 61,290 km² behoort tot het stedelijk gebied.\\nFoz is de meest westelijk gelegen stad van de deelstaat Paraná en ligt aan de rio Paraná; een rivier die de natuurlijke grens vormt tussen Brazilië en Paraguay. De stad is via de Ponte Internacional da Amizade verbonden met het aan de overkant gelegen Ciudad del Este; de meest oostelijk gelegen stad van Paraguay. Verder ligt ten zuiden van Foz do Iguaçu de rio Iguaçu. Deze mondt uit in de rio Paraná en vormt de natuurlijke grens met Argentinië. Hierbij bevindt zich dan ook het drielandenpunt: Marco das Três Fronteiras, dat ten noorden ligt van de rio Iguaçu, ten oosten van de rio Paraná en daarmee officieel staat op Braziliaans grondgebied."},{"page_url":"https://en.wikipedia.org/wiki/Akira_Uchiyama","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Akira_Uchiyama_20110420.jpg","page_title":"Akira Uchiyama","context_page_description":"Akira Uchiyama born March 3, 1954, is a Japanese politician, a member of the House of Representatives in the Diet national legislature."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BE%D0%BA%D0%B8%D1%80%D0%BA%D0%B8_%D0%BF%D0%BE%D0%BB%D1%8C%D0%BE%D0%B2%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Consolida_regalis_030705.jpg","page_title":"Сокирки польові","context_page_description":"Сокирки польові — вид квіткових рослин родини Жовтецеві."},{"page_url":"https://en.wikipedia.org/wiki/April_9_(Eastern_Orthodox_liturgics)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Minster_Church_DSC_9374.jpg","page_title":"April 9 (Eastern Orthodox liturgics)","context_page_description":"April 8 - Eastern Orthodox liturgical calendar - April 10\\nAll fixed commemorations below are observed on April 22 by Eastern Orthodox Churches on the Old Calendar.\\nFor April 9th, Orthodox Churches on the Old Calendar commemorate the Saints listed on March 27."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A3%AB%E5%85%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/Russiansoldiers-StP2.jpg","page_title":"士兵","context_page_description":"士兵或兵，在其最一般的意義上說，是自願或義務兵役制根據招募到的人以保衛國家的主權，接受培訓和裝備，以保衛國家和它的利益。作為這些武裝部隊的一員，他成為軍隊中的有組織的軍人。在戰士的軍隊中鴻溝群體通常在裝備或武器不同區分不同的兵種，如步兵，海軍陸戰隊，砲兵，騎兵等。"},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%BE%BE%E5%A4%AB%E5%8F%8D%E5%BA%94","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Duff_reaction2.png","page_title":"达夫反应","context_page_description":"Duff反應，又稱「六亞甲基四胺甲醯化反應」\\n用六亞甲基四胺對芳香族化合物進行甲醯化。\\n此反應為親電芳香取代，其中親電試劑為烏洛托品衍生出的亞胺離子 CH₂⁺NR₂。 一碳的甲醯基來源於六亞甲基四胺中甲醛單位的亞甲基。 反應最初產物為另一亞胺離子，經水解得到芳醛。\\n反應需要在芳環上有強活化基，如酚羥基。 醛基進入酚羥基的鄰位或對位。\\n反應產率較低，但操作簡便，產物也較純淨。\\n例如用此反應合成3,5-二叔丁基水楊醛：\\n以及合成丁香醛："},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%96%D1%81%D0%BA%D0%BE%D0%B2%D1%96_%D1%84%D1%80%D0%B0%D0%BA%D1%86%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/CoralPinkSandDunesSand.JPG","page_title":"Піскові фракції","context_page_description":"Піскові фракції — у мінералогії, геології, збагаченні корисних копалин — частинки розміром більше 0,14 мм. За іншими джерелами — фракції 0,1-1 мм."},{"page_url":"https://en.wikipedia.org/wiki/Roland_System_100","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/C360_2010-06-20_12-57-26.jpg","page_title":"Roland System 100","context_page_description":"The Roland System 100 was an analog semi-modular synthesizer manufactured by Japan's Roland Corporation, released in 1975 and manufactured until 1979. It consisted of the following products:\\nSynthesizer 101 A monophonic synthesizer with built-in keyboard, oscillator, filter, ADSR envelope generator and attenuator.\\nExpander 102 The same synthesizer again, without the keyboard, to be stood up behind the 101 and patched into it in order to double its features. In addition, a ring modulator and sample and hold are included.\\nMixer 103 A four-channel stereo mixer with built-in spring reverb, stereo panning, and mono FX send/return.\\nSequencer 104 A two-channel, 12-step sequencer to automate playing looped bars of notes.\\nMonitor speaker 109 A pair of 16cm speakers.\\nPCS-10 20cm, 40cm, 60cm, 80cm and 1m patch cables.\\nWhile the System 100 was not fully modular, unlike the later Roland System-100M and the Roland System 700, a complete system nevertheless formed an expandable two-oscillator monosynth with sequencing, monitoring and effects capabilities. Each unit was independently powered, so complex patches wouldn't cause either oscillator to drop in pitch."},{"page_url":"https://en.wikipedia.org/wiki/Smith_Road_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/PAT_Smith_Road.jpg","page_title":"Smith Road station","context_page_description":"Smith Road is a station on the Port Authority of Allegheny County's light rail network, located in Castle Shannon, Pennsylvania. The street level stop is designed as a small commuter stop, serving area residents who walk to the train so they can be taken toward Downtown Pittsburgh."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%8D%A1%E5%A5%87%E6%B9%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Gujarat_Gulfs.jpg","page_title":"卡奇湾","context_page_description":"刻赤灣為阿拉伯海於印度古吉拉特邦西海岸的海灣，以每日的潮汐聞名。\\n刻赤灣海域最深深度為401英尺，長99英里，位於刻赤半島與卡提亞瓦半島之間。"},{"page_url":"https://eo.wikipedia.org/wiki/Arkeologia_loko_de_Alesia","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Alise-Sainte-Reine_-_Fouilles_10.jpg","page_title":"Arkeologia loko de Alesia","context_page_description":"La arkeologia loko de Alesia estas la arkeologia loko de la mandubia gaŭla opidumo de Alesia, de batalo de Alesia en 52 a.K. kaj de la gaŭla-romia urbo Alesia apud Alise-Sainte-Reine en departemento Côte-d'Or en regiono Burgonjo. La monumentoj de la loko estis parte registritaj kaj parte klasitaj kiel historia monumentoj inter 1908 kaj 1992. Ĝi estos integrita en 2016 en MuséoParc Alésia sur 7 000 hektaroj."},{"page_url":"https://zh.wikipedia.org/zh-my/%E6%89%8B%E8%A1%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/GS-1000J.JPG","page_title":"手表","context_page_description":"手表，或称为腕表，是指戴在手腕上、用以计时及显示时间的仪器。几乎是利用皮革、橡胶、尼龙布、不锈钢等材料，制成表带，将显示时间的“表头”束在手腕上。本来作为仪器的“錶”应该带金字旁，但过去也多直接写成“表”，并非后来汉字简化影响。"},{"page_url":"https://en.wikipedia.org/wiki/1919","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Hermann_Emil_Fischer_c1895.jpg","page_title":"1919","context_page_description":"1919 was a common year starting on Wednesday of the Gregorian calendar and a common year starting on Tuesday of the Julian calendar, the 1919th year of the Common Era and Anno Domini designations, the 919th year of the 2nd millennium, the 19th year of the 20th century, and the 10th and last year of the 1910s decade. As of the start of 1919, the Gregorian calendar was 13 days ahead of the Julian calendar, which remained in localized use until 1923."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_Buna_Vestire_din_Ro%C8%99cani","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/RoscaniHD_%2827%29.JPG","page_title":"Biserica Buna Vestire din Roșcani","context_page_description":"Biserica de zid cu hramul „Buna Vestire” din Roșcani, comuna Dobra, județul Hunedoara, este un vechi monument românesc zidit în piatră în secolul al XV-lea de către cnezii din familia Caba. Biserica se află pe noua listă a monumentelor istorice sub codul LMI: HD-II-m-A-03434."},{"page_url":"https://fr.wikipedia.org/wiki/Santiago","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/AvenidaApoquindo.jpg","page_title":"Santiago","context_page_description":"Santiago ou Santiago du Chili [sɑ̃.tja.ɡo.dy.ʃi.li] est la capitale du Chili, pays d'Amérique latine. Elle est située dans la Vallée Centrale. Ses habitants s’appellent les Santiagois.\\nD’après le recensement de l'Instituto Nacional de Estadísticas, l'agglomération de Santiago comptait en 2009 plus de 5,1 millions d'habitants. La région Métropolitaine de Santiago s’est largement développée au cours du XXᵉ siècle, rassemblant plus de 7 millions d'habitants en 2009.\\nFondée en 1541, Santiago est la capitale chilienne depuis l'époque coloniale. La ville se vante d'un centre-ville à l'architecture néoclassique et aux rues sinueuses, parsemées notamment de styles Art déco et néogothique. Le paysage urbain de Santiago est formé par des collines indépendantes et la ville est traversée par la rivière Mapocho, jalonnée par d'élégants parcs tels le Parque Forestal. L'imposante cordillère des Andes est visible depuis de nombreux endroits de la ville. L'activité urbaine a causé le développement de nuages de pollution, particulièrement durant les mois d'hiver. La ville est entourée par des vignobles et Santiago reste à quelques heures des montagnes et de l'océan Pacifique."},{"page_url":"https://hr.wikipedia.org/wiki/IrfanView","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/60/Iview-effects.jpg","page_title":"IrfanView","context_page_description":"IrfanView je besplatni preglednik slika za operacijski sustav Microsoft Windows. Osnovna mu je namjena pregled slika, ali posjeduje i mnoštvo mogućnosti za uređivanje i pretvorbu grafičkih datoteka, kao i za pregled audio i video datoteka. Vrlo je cijenjen zbog svoje brzine, lakoće korištenja i mogućnosti rukovanja mnogim formatima grafičkih datoteka."},{"page_url":"https://cs.wikipedia.org/wiki/Projekt_10750","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/69/RT-57_in_Kronstadt_2014-06-09.jpg","page_title":"Projekt 10750","context_page_description":"Projekt 10750 Sapfir je třída malých pobřežních minolovek sovětského námořnictva z doby studené války. Po rozpadu SSSR plavidla převzalo ruské námořnictvo, přičemž bylo postaveno devět lodí a další nebyly dokončeny. Dvě jednotky hluboce modernizované verze projekt 10750E objednalo námořnictvo Kazachstánu."},{"page_url":"https://it.wikipedia.org/wiki/Guerra_in_Iraq","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Flag_of_PUK.png","page_title":"Invasione dell'Iraq del 2003","context_page_description":"L'invasione dell'Iraq, avvenuta tra il 20 marzo e il 1º maggio 2003, è stata condotta da una coalizione di paesi, guidata dagli Stati Uniti insieme a Regno Unito, Australia e Polonia. Altri paesi sono stati coinvolti nella fase di occupazione. L'invasione segnò l'inizio della guerra in Iraq.\\nSecondo l'allora presidente degli Stati Uniti, George W. Bush, le ragioni dell'invasione erano \\"di disarmare l'Iraq dalle armi di distruzione di massa - che non furono mai trovate, né fu provata la loro esistenza -, porre fine al sostegno di Saddam Hussein al terrorismo e raggiungere la \\"libertà\\" per il popolo iracheno. I principali detrattori della guerra indicano queste ragioni come scuse per realizzare l'invasione, motivate da interessi economici e politici.\\nL'invasione dell'Iraq causò una divisione politica tra le grandi potenze, che furono divise tra quelle che si opposero attivamente all'invasione, come Francia, Belgio, Germania, Russia, Cina, e quelli sostennero pubblicamente gli Stati Uniti, come il Regno Unito, la Spagna, la Polonia, il Portogallo e altre nazioni che costituirono la coalizione."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%AC%E1%83%98%E1%83%AC%E1%83%90%E1%83%99%E1%83%90","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Thai_peppers.jpg","page_title":"წიწაკა","context_page_description":"წიწაკა — მცენარეთა გვარი ძაღლყურძენასებრთა ოჯახისა. მრავალწლოვანი ბუჩქბალახი, კულტურაში ერთწლოვანი ბოსტნის მცენარეა. აქვს განტოტვილი, 30-130 სმ სიმაღლის ღერო.\\nმარტივი მოგრძო ან მოკლეყუნწიანი ფოთოლი. ნაყოფი ცრუ კენკრაა. კულტურაში გვხვდება წიწაკის 4 სახეობა, რომელთაგან ევრაზიაში ფართოდაა გავრცელებული მექსიკური წიწაკა.\\nგანასხვავებენ წიწაკის მწარე და ტკბილ ჯიშებს. მწარეს იყენებენ საკაზმ-სანელებლად, ტკბილს — საკონსერვო და კულინარულ წარმოებაში. საქართველოში გვხვდება ქუთაისური და სხვა ადგილობრივი ჯიშები."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%A2%E0%A6%BE%E0%A6%95%E0%A6%BE_%E0%A6%9F%E0%A6%BF%E0%A6%9A%E0%A6%BE%E0%A6%B0%E0%A7%8D%E0%A6%B8_%E0%A6%9F%E0%A7%8D%E0%A6%B0%E0%A7%87%E0%A6%A8%E0%A6%BF%E0%A6%82_%E0%A6%95%E0%A6%B2%E0%A7%87%E0%A6%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Government_Teachers_Training_College.jpg","page_title":"ঢাকা টিচার্স ট্রেনিং কলেজ","context_page_description":"ঢাকা টিচার্স ট্রেনিং কলেজ বাংলাদেশের প্রথম শিক্ষক প্রশিক্ষণ মহাবিদ্যালয়। উপযুক্ত প্রশিক্ষণের মাধ্যমে দক্ষ শিক্ষক তৈরির উদ্দেশ্যকে সামনে রেখে ১৯০৯ খ্রীস্টাব্দে ঢাকা টিচার্স ট্রেনিং কলেজ প্রতিষ্ঠিত হয়। বেঙ্গল গভর্নমেন্টের আদেশ নং-৫৩, শিক্ষা, তারিখ ৬ জানুয়ারি ১৯০৯-এর মাধ্যমে ঢাকার আরমানিটোলায় ১৯০৯ খ্রীস্টাব্দে টিচার্স ট্রেনিং কলেজ স্থাপন করা হয়। ১৯৫৬ খ্রীস্টাব্দ পর্যন্ত কলেজটি আরমানিটোলাতেই ছিল। পরবর্তীকালে এটি ধানমন্ডিতে স্থানান্তর করা হয়। কলেজের প্রথম প্রিন্সিপাল নিযুক্ত হন ইভান ই. বিস। ১৯০৯-১৯১০ শিক্ষাবর্ষে সর্বমোট ১২ জন প্রশিক্ষণার্থী নিয়ে কলেজের বি. এড. কোর্স চালু হয়। ১৯০৬ খ্রীস্টাব্দে অবিভক্ত বাংলায় এনট্রান্স পরীক্ষায় ভয়াবহ ফলাফল বিপর্যয় দেখা দিলে এ অঞ্চলে শিক্ষক প্রশিক্ষণ কলেজ প্রতিষ্ঠার প্রয়োজনীয়তা অনুভূত হয়। এমতাবস্থায় বাংলায় দু’টি শিক্ষক প্রশিক্ষণ কলেজ প্রতিষ্ঠার সিদ্ধান্ত নেয়া হয়ঃ একটি ঢাকায়, অন্যটি কলকাতায়। ১৯০৮ খ্রীস্টাব্দে কলকাতায় প্রতিষ্ঠিত হয় \\"ডেভিড হেয়ার ট্রেনিং কলেজ\\"।"},{"page_url":"https://lv.wikipedia.org/wiki/Islandie%C5%A1u_m%C5%ABzika","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/36/Samaris_podczas_Iceland_Airwaves_Music_Festival_2012.jpg","page_title":"Islandiešu mūzika","context_page_description":"Islandiešu mūzikai ir raksturīga dinamiska, tautas un popmūzikas sintēze. Slavenākā Islandes izpildītāja, komponiste, producente un aktrise ir Bjorka, bet starptautisku atzinību guvuši arī tādi mākslinieki kā elektroniskās mūzikas grupa GusGus un postroka pārstāvji Sigur Rós. No islandiešu klasiskās mūzikas pārstāvjiem komponists un pianists, Jons Leifs tiek uzskatīts par vienu no ievērojamākajiem māksliniekiem."},{"page_url":"https://pl.wikipedia.org/wiki/Ko%C5%9Bci%C3%B3%C5%82_Naj%C5%9Bwi%C4%99tszego_Serca_Pana_Jezusa_w_Opolu","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Ko%C5%9Bci%C3%B3%C5%82_Naj%C5%9Bwi%C4%99tszego_Serca_Pana_Jezusa_w_Opolu.jpg","page_title":"Kościół Najświętszego Serca Pana Jezusa w Opolu","context_page_description":"Kościół Najświętszego Serca Pana Jezusa – rzymskokatolicki kościół parafialny położony przy ulicy Czaplaka 1 w Opolu. Kościół należy do parafii Najświętszego Serca Pana Jezusa w Opolu w dekanacie Opole, diecezji opolskiej."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%85%D9%84%D8%AC_%D8%AD%D9%85%D8%B6%D9%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Phyll_acid_071008-0393_F_brb.jpg","page_title":"أملج حمضي","context_page_description":"أملج حمضي هو نوع من النباتات يتبع جنس الأملج من الفصيلة الأملجية."},{"page_url":"https://de.wikipedia.org/wiki/Zum_Blauen_Bock","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Bembel_Zum_blauen_Bock_1978.jpg","page_title":"Zum Blauen Bock","context_page_description":"Zum Blauen Bock war eine Unterhaltungsshow des Hessischen Rundfunks im Deutschen Fernsehen, von der zwischen 1957 und 1987 insgesamt 208 Folgen produziert wurden. Otto Höpfner leitete sie bis Ende 1965, anschließend Heinz Schenk und Lia Wöhr."},{"page_url":"https://tt.wikipedia.org/wiki/%D0%AD%D1%81%D0%BA%D0%B0%D0%BB%D0%B0%D0%BD%D1%82%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Escalante2.jpg","page_title":"Эскаланте","context_page_description":"Эскаланте — Филипиннең Негрос-Оксиденталь пpаʙинсəсендә урнашкан шәһәр."},{"page_url":"https://pl.wikipedia.org/wiki/Biurowiec_Skalar_Office_Center_w_Poznaniu","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Skalar_Office_Building_Poznan_%282%29.jpg","page_title":"Biurowiec Skalar Office Center w Poznaniu","context_page_description":"Biurowiec Skalar Office Center, także Biurowiec Hydrobudowa-9 – budynek biurowy usytuowany przy ul. Góreckiej 1, róg ul. Hetmańskiej na Łazarzu na osiedlu administracyjnym św. Łazarz w Poznaniu."},{"page_url":"https://ca.wikipedia.org/wiki/Futbol_a_Isl%C3%A0ndia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/KR-v%C3%B6llur_Main_Stand.jpg","page_title":"Futbol a Islàndia","context_page_description":"El futbol és l'esport més popular a Islàndia. Hi ha 20.000 futbolistes afiliats."},{"page_url":"https://en.wikipedia.org/wiki/STS-42","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a9/Sts-42.jpg","page_title":"STS-42","context_page_description":"STS-42 was a Space Shuttle Discovery mission with the Spacelab module. Liftoff was originally scheduled for 8:45 EST 22 January 1992, but the launch was delayed due to weather constraints. Discovery successfully lifted off an hour later at 9:52 EST. The main goal of the mission was to study the effects of microgravity on a variety of organisms. The shuttle landed at 8:07 PST on 30 January 1992 on Runway 22, Edwards Air Force Base, California.\\nSTS-42 was the first of two flights in 1992 of Discovery, the second of which occurred during STS-53, which launched on 2 December 1992. The mission was also the last mission of the Space Shuttle Discovery to have a seven-member crew until STS-82, which was launched on 11 February 1997."},{"page_url":"https://pl.wikipedia.org/wiki/Lista_ameryka%C5%84skich_senator%C3%B3w_ze_stanu_Kalifornia","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/David_C._Broderick_%28US_Senator_from_California%29.jpg","page_title":"Lista amerykańskich senatorów ze stanu Kalifornia","context_page_description":"Lista amerykańskich senatorów ze stanu Kalifornia – senatorzy wybrani ze stanu Kalifornia.\\nStan Kalifornia został włączony do Unii 9 września 1850 roku. Posiada prawo do mandatów senatorskich 1. i 3. klasy. Do 8 kwietnia 1913 roku senatorowie byli wybierani przez stanowy parlament. Od tego czasu wybierani są w wyborach powszechnych."},{"page_url":"https://en.wikipedia.org/wiki/Listed_buildings_in_Mirfield","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Hopton_United_Reformed_Church.jpg","page_title":"Listed buildings in Mirfield","context_page_description":"Mirfield is a civil parish in the metropolitan borough of Kirklees, West Yorkshire, England. It contains 47 listed buildings that are recorded in the National Heritage List for England. Of these, two are listed at Grade II*, the middle of the three grades, and the others are at Grade II, the lowest grade. The list also includes two listed buildings outside the parish but in Mirfield ward; both of these are at Grade II. The parish contains the town of Mirfield and the surrounding area. Most of the listed buildings are houses and associated structures, cottages, farmhouses and farm buildings. The Calder and Hebble Navigation and the River Calder pass through the parish, and the listed buildings associated with them are two locks, two lock keeper's cottages, a road bridge, and two railway bridges. The other listed buildings include churches and items in or near churchyards, a railway underbridge, and a war memorial."},{"page_url":"https://es.wikipedia.org/wiki/Chico_(Washington)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Wikivoyage_page_banner_sea_shells_NW_6.jpg","page_title":"Chico (Washington)","context_page_description":"Chico es un área no incorporada ubicada en el condado de Kitsap en el estado estadounidense de Washington."},{"page_url":"https://hr.wikipedia.org/wiki/Dan_Aykroyd","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Greatoutdoors_aykroyd.jpg","page_title":"Dan Aykroyd","context_page_description":"Daniel Edward Aykroyd, kanadski glumac, scenarist i glazbenik. Najveći uspjeh je ostvario u 1980-ima. Među njegovim značajnijim filmovima su \\"Istjerivači duhova\\", \\"Braća Blues\\", \\"Vozeći gospođicu Daisy\\" i \\"Kolo sreće\\"."},{"page_url":"https://ast.wikipedia.org/wiki/Montse_Mart%C3%ADn","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Centro_Deportivo_Municipal_Gimnasio_Moscard%C3%B3.JPG","page_title":"Montse Martín","context_page_description":"Montserrat Martín López, más conocida como Montse Martín, ye una ex ximnasta rítmica española que foi campeona del mundu en modalidá de conxuntos y bicampeona d'Europa, amás de llograr otres numberoses preseas cola selección nacional de ximnasia rítmica d'España. Darréu trabayó como diseñadora gráfica, pintora, ilustradora, actriz y baillarina. Ye ilustradora de los llibros de Olympia y Pincelaes de rítmica, del que ye amás coautora."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%A2%D0%B0%D1%82%D1%80%D0%B5%D0%BD%D1%81%D0%BA%D0%B8_%D0%BD%D0%B0%D1%86%D0%B8%D0%BE%D0%BD%D0%B0%D0%BB%D0%B5%D0%BD_%D0%BF%D0%B0%D1%80%D0%BA_(%D0%9F%D0%BE%D0%BB%D1%88%D0%B0)","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a1/Czarny_Staw_G%C4%85sienicowy_a2.jpg","page_title":"Татренски национален парк (Полша)","context_page_description":"Татренският национален парк е един от 23-те национални парка в Полша. Разположен е в планинската верига Татри, на територията на Малополско войводство. Парковата администрация се намира в Закопане.\\nСъздаден е на 1 януари 1955 година, с наредба на Министерския съвет от 30 октомври 1954 година. През 2003 година площта му е определена на 21 164 хектара. Около 70 % от територията на парка е заета от гори, а останалите 30 % от планински ливади, скали и езера."},{"page_url":"https://ca.wikipedia.org/wiki/Resoluci%C3%B3_752_del_Consell_de_Seguretat_de_les_Nacions_Unides","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Bsa_controlled.png","page_title":"Resolució 752 del Consell de Seguretat de les Nacions Unides","context_page_description":"La Resolució 752 del Consell de Seguretat de les Nacions Unides, fou adoptada per unanimitat el 15 de maig de 1992. Reafirmant les resolucions 713, 721, 724, 727, 740 743 i 749, el Consell de Seguretat va manifestar la seva preocupació en relació als combats en Bòsnia i Hercegovina, exigint que totes les parts finalitzessin els combats i respectessin l'alto el foc signat el 12 d'abril d'aquest any.\\nLa resolució va fer una crida a totes les parts per cooperar amb els esforços de la Comunitat Europea per aconseguir una solució negociada, intentant demostrar que el canvi de fronteres mitjançant la força és inacceptable. També va exigir que les unitats de l'exèrcit iugoslau i els elements de l'exèrcit croat es retiressin o es posessin sota l'autoritat del govern de Bòsnia i Hercegovina. Així mateix, la resolució va exigir respecte a la integritat territorial de Bòsnia i Hercegovina. Les forces irregulars presents al territori haurien de ser desmantellades i desarmades.\\nA més, la resolució també va fer èmfasi en la importància de l'ajuda humanitària a la regió, cridant les parts a permetre l'accés humanitari."},{"page_url":"https://de.wikipedia.org/wiki/Kleinwasserkraftwerk_Gletsch","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Locator_Map_Kanton_Wallis.png","page_title":"Kleinwasserkraftwerk Gletsch","context_page_description":"Das Kleinwasserkraftwerk Gletsch war ein im Jahre 1942 in Dienst gestelltes Kleinwasserkraftwerk in der Remise des Hotels Glacier du Rhône in Gletsch."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D1%83%D1%82%D0%B8%D0%B2%D0%BB%D1%8C%D1%81%D1%8C%D0%BA%D0%B0_%D0%B7%D0%B0%D0%B3%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D0%BE%D1%81%D0%B2%D1%96%D1%82%D0%BD%D1%8F_%D1%88%D0%BA%D0%BE%D0%BB%D0%B0-%D1%96%D0%BD%D1%82%D0%B5%D1%80%D0%BD%D0%B0%D1%82","image_url":"https://upload.wikimedia.org/wikipedia/uk/9/92/Putivlinter4.JPG","page_title":"Путивльська загальноосвітня школа-інтернат","context_page_description":"Комунальний заклад Сумської обласної ради — Путивльська загальноосвітня школа-інтернат І-ІІ ступенів"},{"page_url":"https://cs.wikipedia.org/wiki/Kostel_svat%C3%A9ho_Prokopa_(%C5%BD%C4%8F%C3%A1r_nad_S%C3%A1zavou)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Kostel_sv._Prokop_p%C5%AFdorys.jpg","page_title":"Kostel svatého Prokopa (Žďár nad Sázavou)","context_page_description":"Kostel svatého Prokopa je římskokatolický chrám ve Žďáru nad Sázavou. Je chráněn jako kulturní památka České republiky.\\nGotický kostel se tyčí na ostrohu u řeky Sázava, nedaleko Náměstí Republiky a v bezprostředním sousedství Tvrze. Jedná se o jednu z významných památek města Žďáru nad Sázavou a jeho širokého okolí."},{"page_url":"https://de.wikipedia.org/wiki/Nicola_Philippaerts","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Nicola_Philippaerts.JPG","page_title":"Nicola Philippaerts","context_page_description":"Nicola Philippaerts ist ein belgischer Springreiter. Im März 2019 befand er sich auf Platz 13 der Weltrangliste."},{"page_url":"https://id.wikipedia.org/wiki/Provinsi_di_Swiss","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Karte_Lage_Kanton_Appenzell_Ausserrhoden_2015.png","page_title":"Provinsi di Swiss","context_page_description":"Dalam undang-undang dasar Swiss, setiap kanton memiliki hak untuk menentukan pembagian administratif masing-masing. Oleh karena itu terdapat berbagai struktur dan istilah untuk pembagian administratif antara kanton dan wilayah, secara longgar disebut provinsi.\\nSebagian besar kanton-kanton di Swiss terbagi ke dalam beberapa Bezirke atau Ämter, Amtsbezirke, distrik atau distretto. Bezirke biasanya hanya melayani urusan-urusan administratif dan kehakiman lokal. Akan tetapi, karena alasan sejarah, di kanton Graubünden dan Schwyz Bezirke juga menangani hukum warga dalam urusan pajak dan bahkan beberapa dari Bezirke memiliki setengah dari Ldansgemeinde.\\nTujuh dari 26 kanton – Uri, Obwalden, Nidwalden, Glarus, Zug, Basel-City dan Geneva – tidak memiliki provinsi.\\nBeberapa kanton lainnya sedang mempertimbangkan peniadaan provinsi dalam kanton mereka: Appenzell Ausserrhoden, Schaffhausen, Lucerne, St. Gallen, Schwyz pada 2006, namun tetap menjaga pembagian administratif lainnya. Kanton Bern pada 2006 memutuskan untuk mengurangi 26 provinsi menjadi hanya lima saja. Vaud memutuskan untuk mengurangi jumlah provinsi dari 19 menjadi 10."},{"page_url":"https://de.wikipedia.org/wiki/Kepplerburg","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Kepplerburg.JPG","page_title":"Kepplerburg","context_page_description":"Kepplerburg ist ein Ortsteil von Vilkerath in der Stadt Overath im Rheinisch-Bergischen Kreis in Nordrhein-Westfalen, Deutschland. Der Ort liegt oberhalb des Baches Lennefe im nördlichen Teil von Overath an der Grenze zu Lindlar. Kepplerburg gehörte bis 31. Dezember 1974 zur Gemeinde Hohkeppel."},{"page_url":"https://es.wikipedia.org/wiki/Hueso_pisiforme","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/01/Gray224.png","page_title":"Hueso pisiforme","context_page_description":"El hueso pisiforme es un hueso sesamoideo de la muñeca, par, corto, esponjoso, cuboideo, con cuatro caras de las cuales una es articular, y dos extremos, superior e inferior.\\nEs el cuarto hueso de la primera fila del carpo.\\nSus cuatro caras son: Externa, interna, anterior y posterior.\\nEn la cara externa va a presentar un canal longitudinal para dar paso a la arteria cubital y un ramo profundo del nervio cubital.\\nEn la cara interna va a dar inserción al ligamento lateral interno de la articulación de la muñeca.\\nEn la cara anterior va a prestar inserción al músculo aductor del meñique y al músculo cubital anterior.\\nY por último en la cara posterior se va articular con el hueso piramidal."},{"page_url":"https://es.wikipedia.org/wiki/Desarrollo_de_fractales_mediante_el_m%C3%A9todo_de_Mandelbrot","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/MANDEL_Z2%2BC%2B1_C2_medium.jpg","page_title":"Desarrollo de fractales mediante el método de Mandelbrot","context_page_description":"El método de Mandelbrot: este método para desarrollar \\"objetos fractales\\" fue creado por Benoît Mandelbrot en la década de los años 70, mientras trabajaba en IBM. Consiste en construir, para cada punto c del plano complejo, una sucesión de números complejos zₙ. Partiendo del punto z₀ = 0, se calcula la sucesión de forma iterativa mediante la fórmula zₙ₊₁=F+c, donde F es una función arbitraria previamente elegida. Cuando la sucesión iterativa está acotada, se asigna al punto c del plano complejo un color sólido. Si la sucesión diverge entonces se asigna al punto c un color progresivamente distinto, dependiendo de cuántas iteraciones hayan sido necesarias para detectar la divergencia de la sucesión.\\nEl fractal derivado por este método cuando se toma la función F=z² se llama conjunto de Mandelbrot.\\nEn lo que sigue, en lugar de zₙ₊₁=F+c se utilizará la notación Z=F+C, como si se tratara de una asignación en algún lenguaje de programación."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D1%80%D0%B0%D0%B3%D0%BE%D1%99%D1%83%D0%B1_%D0%9C%D0%B8%D1%85%D0%B0%D0%B8%D0%BB%D0%BE%D0%B2%D0%B8%D1%9B","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a6/Virtuti_Militari_Cross_from_November_Uprising_1831.png","page_title":"Драгољуб Михаиловић","context_page_description":"Драгољуб Дража Михаиловић, међу присталицама познат и као Чича Дража, био је армијски генерал и начелник Штаба Врховне команде Југословенске војске у Отаџбини, као и министар војске, морнарице и ваздухопловства Краљевине Југославије, у првој и другој влади Слободана Јовановића, у међувлади Милоша Трифуновића и влади Божидара Пурића, у току Другог светског рата.\\nТоком балканских ратова и Првог светског рата Дража је био официр Српске војске у Краљевини Србији. После Априлског рата, Михаиловић је одбио да призна капитулацију Југословенске војске и склонио се на Равну гору, где је основао покрет отпора против окупатора. Међутим, већ крајем 1941. већину својих активности усмерио је на уништење партизана, одустајући од отворене борбе против Сила Осовине.\\nЗатражио је примирје од представника Вермахта и понудио им заједничку борбу против комунизма, што су они одбили. Бројни команданти ЈВуО су уз Михаиловићево знање временом ипак постигли споразуме са окупационим снагама о заједничкој борби против партизана, нарочито у италијанској окупационој зони."},{"page_url":"https://sk.wikipedia.org/wiki/Rimavsk%C3%A1_Ba%C5%88a","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Rimavsk%C3%A1Ba%C5%88a5.jpg","page_title":"Rimavská Baňa","context_page_description":"Rimavská Baňa je obec na Slovensku v okrese Rimavská Sobota. Nachádza sa tu hodnotný gotický evanjelický kostol z konca 13. storočia so stredovekými freskami."},{"page_url":"https://ko.wikipedia.org/wiki/%EC%83%AC%EB%9F%BF_%EC%8A%A4%ED%8A%9C%EC%96%B4%ED%8A%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Charlotte_Stewart_at_WonderCon_2009.JPG","page_title":"샬럿 스튜어트","context_page_description":"샬럿 스튜어트는 미국의 배우이다.\\n유바 시티에서 태어났다."},{"page_url":"https://fr.wikipedia.org/wiki/Renzo_Rosso_(entrepreneur)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/OTB_LOGO.jpg","page_title":"Renzo Rosso (entrepreneur)","context_page_description":"Renzo Rosso, né le 15 septembre 1955 à Brugine, dans la province de Padoue, en Vénétie, est un styliste et un homme d'affaires italien, fondateur de la marque de vêtements Diesel. Surnommé \\"le génie du jean\\" par Suzy Menkes, il est le président du groupe OTB, compagnie mère des marques Maison Margiela, Marni, Viktor & Rolf, Diesel, Staff International, et Brave Kid. Il est aussi le fondateur de la Fondation Only The Brave, une association à but non lucratif. Rosso est également le président de Red Circle Investments, de la Diesel Farm à Marostica en Vénétie, du Pelican Hotel à Miami et de Bassano Virtus 55 Soccer Team, l’équipe de football professionnelle de sa ville d’origine, Bassano del Grappa en Vénétie."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%B3%D9%86%D8%AA%D8%A7_%D9%85%D8%A7%D8%B1%DB%8C%DB%81_%D9%84%D8%A7_%D8%B1%DB%92_%D8%A2%D9%84_%D8%AF%DB%92_%D9%84%D8%A7%D8%B3_%DB%81%D9%88%D8%A6%DB%92_%D9%84%DA%AF%D8%A7%D8%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Burgos_-_Las_Huelgas_10.jpg","page_title":"سنتا ماریہ لا رے آل دے لاس ہوئے لگاس","context_page_description":"سنتا ماریہ لا رے آل دے لاس ہوئے لگاس ایک مسیحی کیتھولک مٹھ ہے۔ یہ سسٹرشین نن کا مٹھ ہے جو برگوس کے شہر کے لگ بھگ 1ء 5 کلومیٹر پچھم میں اسپین میں موجود ہے۔ عام طور پر جدید اسپینش زبان میں مزدور ہڑتال کرنے کے لیے \\"huelgas\\" لفظ کا استعمال کیا جاتا ہے حالانکہ یہ لفظ اصالتًآ کھیتی کرنے سے چھٹی رہنے والی زمین کے لیے استعمال ہوتا ہے۔ تاریخی وقائع کے روپ سے یہ مٹھ انگلینڈ کے ایڈورڈ اوّل سے لے کر کاستیلے کی ایلینور کی 1254ء میں کئی راج شاہی شادی بیاہ کا گواہ رہا ہے۔ ایبے کا دفاعی نوعیت کا حامل ٹاور بھی کاستیلے کے راجا پیٹراوّل کا مقام پیدائش رہا ہے۔"},{"page_url":"https://nl.wikipedia.org/wiki/Koninkrijk_Zweden_(970-1397)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/84/Sweden_1250.png","page_title":"Koninkrijk Zweden (970-1397)","context_page_description":"Het Koninkrijk Zweden ontstond rond 970 en bleef zelfstandig tot 1397 toen het toetrad tot de Unie van Kalmar. Staatsrechtelijk kan gesteld worden dat het koninkrijk, hoewel in vaak gewijzigde vorm, vandaag de dag nog steeds bestaat, maar dit artikel is bestemd om de eerste periode van de 10e tot de 14e eeuw te behandelen."},{"page_url":"https://fr.wikipedia.org/wiki/Vill%C3%A1ny_(vignoble)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/Villany%2C_wine.jpg","page_title":"Villány (vignoble)","context_page_description":"Villány est une région viticole hongroise située dans le comitat de Baranya."},{"page_url":"https://es.wikipedia.org/wiki/Lophoictinia_isura","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Sqki_kobble_sep08.JPG","page_title":"Lophoictinia isura","context_page_description":"El milano colicuadrado​ es una especie de ave accipitriforme monotípica que pertenece a la familia Accipitridae.​ Es endémico de Australia.​"},{"page_url":"https://de.wikipedia.org/wiki/Malakal_(Insel)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Boatyard_koror20050906.jpg","page_title":"Malakal (Insel)","context_page_description":"Malakal, auch Ngemelachel genannt, ist eine kleine Insel im westlichen Pazifischen Ozean; sie gehört geographisch zu den Palauinseln, politisch zum Verwaltungsgebiet Koror der Inselrepublik Palau.\\nDie etwa 1,1 km² große Insel liegt etwa 700 Meter südwestlich der Insel Koror, mit der sie über einen Fahrdamm und kleine Brücken verbunden ist. Am höchsten Punkt der Insel steht ein Sendemast. Auf Malakal finden sich mehrere Bootsanlegestellen, kleinere Werften und Hotelanlagen. An der Südostküste liegt der Haupthafen von Koror."},{"page_url":"https://pt.wikipedia.org/wiki/Cartagena_das_%C3%8Dndias","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/62_-_Carthag%C3%A8ne_-_D%C3%A9cembre_2008.jpg","page_title":"Cartagena das Índias","context_page_description":"Cartagena das Índias ou Cartagena é a capital do departamento de Bolívar, na Colômbia. É a quinta maior cidade do país, e a segunda maior da região, depois de Barranquilha; e sua região metropolitana é a quinta maior concentração urbana da Colômbia. Suas mais significantes atividades econômicas são os complexos marítimos, pesqueiros, petroquímicos e o turístico.\\nA cidade foi fundada em 1 de junho de 1533, e foi batizada em homenagem a Cartagena, na Espanha. No entanto, o assentamento de vários povos indígenas na região da Baía de Cartagena data de 4000 a.C.. Durante o período colonial, a cidade teve um papel fundamental na administração e na expansão do Império Espanhol nas Américas, sendo sede de governo e moradia dos vice-reis espanhóis. O centro histórico de Cartagena, conhecido como a cidade fortificada, foi declarado Patrimônio Nacional da Colômbia, em 1959, e posteriormente Patrimônio Mundial pela Unesco, em 1984. Em 2007, suas fortificações e planejamento arquitetônico militar foram declarados como a quarta maravilha da Colômbia."},{"page_url":"https://sl.wikipedia.org/wiki/Karl_Holmstr%C3%B6m","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Karl_Holmstr%C3%B6m_SOK.jpg","page_title":"Karl Holmström","context_page_description":"Karl Holmström, švedski smučarski skakalec, * 12. marec 1925, Bjurholm, Švedska, † 22. junij 1974, Kiruna, Švedska.\\nHolmström je nastopil na Zimskih olimpijskih igrah 1952 v Oslu, kjer je osvojil bronasto medaljo na veliki skakalnici."},{"page_url":"https://ca.wikipedia.org/wiki/Jocs_Ol%C3%ADmpics_d%27hivern_de_1980","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/57/Olympic_rings_in_the_fron%2C_MacKenzie_Intervale_Ski_Jumping_Complex_in_the_back.jpg","page_title":"Jocs Olímpics d'hivern de 1980","context_page_description":"Els Jocs Olímpics d'hivern de 1980, oficialment anomenats XIII Jocs Olímpics d'hivern, es van celebrar a la ciutat de Lake Placid entre el 13 i 24 de febrer de 1980. Hi participaren un total de 1.072 esportistes de 37 comitès nacionals que competiren en 8 esports i 38 especialitats.\\nAquesta fou la segona vegada que la ciutat de Lake Placid acollí els Jocs Olímpics d'hivern després de la realització dels Jocs Olímpics d'hivern de 1932."},{"page_url":"https://eo.wikipedia.org/wiki/Fendotamburo","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Pate_Drum.JPG","page_title":"Fendotamburo","context_page_description":"La fendotamburo, ankaŭ tomtomo, estas tradicia idiofona frapinstrumento, kiu estas uzata kiel komunikotamburo, en rita muziko kaj kiel signalinstrumento. En muzikistaro ĝi precipe fiksas la takton por la ceteraj ritmaj instrumentoj."},{"page_url":"https://sk.wikipedia.org/wiki/Zoznam_kult%C3%BArnych_pamiatok_v_Ko%C5%A1iciach_%E2%80%93_mestskej_%C4%8Dasti_Star%C3%A9_Mesto_(Stredn%C3%A9_Mesto,_H)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Ko%C5%A1ice_-_Hlavn%C3%A1_ul._72.jpg","page_title":"Zoznam kultúrnych pamiatok v Košiciach – mestskej časti Staré Mesto (Stredné Mesto, H)","context_page_description":"Toto je zoznam kultúrnych pamiatok v Košiciach, mestskej časti Staré Mesto, katastrálnom území Stredné Mesto v okrese Košice I.\\nZoznam je z technických dôvodov rozdelený na viac častí, táto časť zahŕňa ulice začínajúce na písmená H.\\nZoznam bol vytvorený na základe zoznamu, ktorý bol zverejnený na webe Pamiatkového úradu Slovenskej republiky.\\nV súčasnosti je na webovej stránke PÚSR dostupné vyhľadávanie podľa jednotlivých obcí."},{"page_url":"https://de.wikipedia.org/wiki/G%C3%BCnter_Wendland","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Bundesarchiv_Bild_183-1989-1118-005%2C_G%C3%BCnter_Wendland.jpg","page_title":"Günter Wendland","context_page_description":"Günter Wendland war ein deutscher Jurist. Er war von 1986 bis 1989 Generalstaatsanwalt der DDR."},{"page_url":"https://ca.wikipedia.org/wiki/G%C3%B2tia","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Califato_de_C%C3%B3rdoba-1000.png","page_title":"Gòtia","context_page_description":"El ducat de Gòtia o marquesat de Gòtia és el nom que els francs donaren als territoris conquerits als musulmans entre el 759 i el 801 i que anteriorment havien estat províncies del regne dels Visigots. La Gòtia la formaven tota l'antiga Septimània visigòtica i la part nord de la Tarraconense visigòtica, mentre que la part sud de l'antiga província va romandre sota domini islàmic. La campanya de conquesta s'inicià amb el Setge de Narbona, prosseguí a l'altra banda dels Pirineus amb el setge de Girona, continuà amb el Setge de Barcelona, però no pogué culminar-se amb la presa de Tortosa, consolidant-se d'aquesta manera la frontera del Llobregat. El ducat no estava sota la jurisdicció única d'un duc sinó que d'entre els diversos comtes nomenats pels reis francs aquell que tenia major poder rebia el títol honorífic de Dux."},{"page_url":"https://sv.wikipedia.org/wiki/Stora_Skuggan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/Stora_skuggan_husnr_65.jpg","page_title":"Stora Skuggan","context_page_description":"Stora Skuggan är ett historiskt område i Nationalstadsparken på Norra Djurgården i Stockholm. Här finns några kulturhistorik värdefulla byggnader, bland annat Engelska villan och Åttkanten som båda är byggnadsminnen sedan 1935."},{"page_url":"https://en.wikipedia.org/wiki/Waikino","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/1981_Waikino_town_washed_away.jpg","page_title":"Waikino","context_page_description":"Waikino is a small town at the southern end of a gorge in the North Island of New Zealand alongside the Ohinemuri River, between Waihi and the Karangahake Gorge. The Waikino district lies at the base of the ecologically sensitive Coromandel Peninsula with its subtropical rainforests, steep ravines and fast moving rivers and streams. The cascades f the Owharoa Falls lie just to the north of the settlement.\\nThe New Zealand Ministry for Culture and Heritage gives a translation of \\"harmful waters\\" for Waikino.\\nThe population of Waikino was 213 people in 90 households in the 2013 New Zealand census."},{"page_url":"https://de.wikipedia.org/wiki/Ihme-Zentrum","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/12/Lageplan_Ihmezentrum.jpg","page_title":"Ihme-Zentrum","context_page_description":"Das Ihme-Zentrum ist ein großes Wohn-, Büro- und ehemaliges Einkaufszentrum in Hannover im Stadtteil Linden-Mitte. Es liegt am westlichen Ufer des namensgebenden Flusses Ihme gegenüber der Calenberger Neustadt. Im Norden ist es durch die Spinnereistraße und den Platz Am Küchengarten begrenzt, im Westen durch die Blumenauer Straße. Die Südseite ist in unmittelbarer Nähe des Platzes Schwarzer Bär und des Veranstaltungszentrums Capitol."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A7%D0%BC%D1%83%D1%82%D0%B8%D0%BD%D0%B0,_%D0%9D%D0%B0%D1%82%D0%B0%D0%BB%D1%8C%D1%8F_%D0%91%D0%BE%D1%80%D0%B8%D1%81%D0%BE%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Nataliia_Chmutina_Signature.png","page_title":"Чмутина, Наталья Борисовна","context_page_description":"Ната́лья Бори́совна Чму́тина — советский архитектор и педагог, Народный архитектор УССР, почётный академик Украинской академии архитектуры."},{"page_url":"https://war.wikipedia.org/wiki/Talipariti_hastatum","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Hibiscus_hastatus_flower_%26_leaf.jpg","page_title":"Talipariti hastatum","context_page_description":"An Talipariti hastatum in uska species han Magnoliopsida nga syahan ginhulagway ni Carl von Linné d.y., ngan ginhatag han pagkayana nga asya nga ngaran ni Paul Arnold Fryxell. An Talipariti hastatum in nahilalakip ha genus nga Talipariti, ngan familia nga Malvaceae. Waray hini subspecies nga nakalista."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E9%A9%AC%E9%9B%B7%E5%85%B9","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0f/Map_commune_FR_insee_code_59382.png","page_title":"马雷兹","context_page_description":"馬雷茲是法國北部-加來海峽大區諾爾省的一個市鎮，屬於康布雷區克拉里縣。該市鎮2009年時的人口為1,457人。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%98%D0%B2,_%D0%90%D0%BB%D1%91%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b4/Alena_Yiv_2012.jpg","page_title":"Ив, Алёна","context_page_description":"Алёна Ив — израильская актриса и режиссёр. Снимается в телесериалах на израильском ТВ. Режиссёр короткометражных фильмов и видео."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BA%95%E4%B8%8A%E5%AD%9D%E7%BE%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Kogiinoue.jpg","page_title":"井上孝義","context_page_description":"井上 孝義は、日本山口県出身の俳優・スタントマン・ダンサー。身長170cm。"},{"page_url":"https://fr.wikipedia.org/wiki/Pretoria","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Pretoria_City_Hall.jpg","page_title":"Pretoria","context_page_description":"Pretoria ou Prétoria est une ville d'Afrique australe et la capitale administrative de l'Afrique du Sud. Elle fut également de 1860 à 1902 la capitale de la république sud-africaine du Transvaal, de 1902 à 1910 celle de la colonie du Transvaal puis, de 1910 à 1994, le chef-lieu de la province du Transvaal. Elle est située aujourd'hui dans la province du Gauteng.\\nSon surnom est la « ville des Jacarandas » en référence aux centaines de milliers d'arbres qui fleurissent au printemps austral et donnent une teinte mauve à la ville.\\nPretoria est une ville gérée par la municipalité de Tshwane, une conurbation qui englobe treize anciennes structures administratives dont les villes anciennement blanches de Centurion et Pretoria, ainsi que les anciens townships de Mamelodi, Temba et Hammanskraal."},{"page_url":"https://simple.wikipedia.org/wiki/Rain,_Switzerland","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/2012-08-28_Regiono_Seetal_%28Foto_Dietrich_Michael_Weidmann%29_234.JPG","page_title":"Rain, Switzerland","context_page_description":"Rain is a municipality of the district of Hochdorf in the canton of Lucerne in Switzerland."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9A%D1%80%D0%B0%D1%99%D0%B5%D0%B2%D0%B8%D0%BD%D0%B0_%D0%98%D1%82%D0%B0%D0%BB%D0%B8%D1%98%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Benito_Mussolini_and_Adolf_Hitler.jpg","page_title":"Краљевина Италија","context_page_description":"Краљевина Италија се односи на Италију којом је владала краљевска династија Савоја од уједињења Италије 1860. до референдума о укидању монархије и успостављању републике 1946. године. Од 1922. до 1943. била је под диктатуром фашистичког лидера Бенита Мусолинија.\\nИако победница у Првом светском рату, Италија је била захваћена економском кризом и незадовољством због изостанка награде за учешће у рату обећане Лондонским споразумом. Национализам захвата широке слојеве становништва. Бенито Мусолини, раније ангажован у радничком покрету, почиње да оснива фашистичке одреде назване према латинском facsio, што значи сноп и представља симбол слоге. У почетку на зборовима фашиста Мусолини је говорио и о демократским слободама и радничким правима. Касније су фашисти прешли на физичке обрачуне са социјалистима и комунистима. На изборима 1919. године добили су само 4000 гласова, али две године касније имали су 36 посланика од могућих 500. У наредним годинама овај покрет постаје масован. Припадници су носили црне кошуље, а метода рада биле су уличне манифестације, зборови, пребијања, па чак и убиства политичких противника. Године 1921. фашисти су уједињени у Националну фашистичку странку."},{"page_url":"https://eo.wikipedia.org/wiki/Turo_Sacyr_Vallehermoso","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Torre_Sacyr_Vallehermoso_%28Madrid%29_05a.jpg","page_title":"Turo Sacyr Vallehermoso","context_page_description":"La Turo Sacyr Vallehermoso estas la tria nubskrapulo plej alta de Madrido kaj de Hispanio. Ĝi havas 236 metrojn alte, 52 etaĝojn kaj ĝia konstruado komenciĝis en 2004 kaj finiĝis en la jaro 2008.\\nLa konstruaĵo troviĝas en la madrida kvartalo de Fuencarral-El Pardo, en la nubskrapula komplekso Kvar Turoj Negoc-Areo, kie ankaŭ troviĝas la Turo Ŝparkaso Madrido, la plej alta de Hispanio. La arkitektoj de la projekto dekomence planis altecon de 215 metroj. Ĝia etaĝo estas egal-latera triangulo kies flankoj estas kurvaj.\\nLa Turo Sacyr Vallehermoso gastigas la kvinstelan hotelon EuroStars Madrid Tower, kiu okupas 31 etaĝojn kaj ĝi ankaŭ disponigas manĝejon kiu ofertas unikan vidon de la tuta urbo. Probable la turo gastigos oficejojn de entreprenoj kiel Sacyr Vallehermoso kaj Testa Inmuebles."},{"page_url":"https://en.wikipedia.org/wiki/Painter_of_the_Wind","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/eb/Hyewon-Gyebeon.gahwa.jpg","page_title":"Painter of the Wind","context_page_description":"Painter of the Wind is a 2008 South Korean historical television series starring Moon Geun-young and Park Shin-yang. Based on the bestselling historical fiction novel by Lee Jung-myung that took artistic license with the premise that perhaps the Joseon painter Shin Yun-bok had really been a woman, it centers on Yun-bok, a talented young painter who disguises herself as a boy to search for her father's murderer. She meets Kim Hong-do, a master painter who guides her into becoming a great artist, and they develop a strong friendship of mentor and disciple.\\nProduced for SBS by JoongAng Media Network's Drama House, the series aired on SBS TV and its regional affiliates from September 24 to December 4, 2008. It had 20 episodes.\\nThe drama has won numerous awards, including the Asian TV Series Special Award at the 2010 Shanghai Television Festival, while actress Moon Geun-young received the grand prize at the 2008 SBS Drama Awards, as well as Best TV Actress at the 2009 Baeksang Arts Awards and 2008 Grimae Awards for her role."},{"page_url":"https://es.wikipedia.org/wiki/Schwarzenborn_(Renania-Palatinado)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/03/Schwarzenborn_%28Eifel%29_St._Martin_82.JPG","page_title":"Schwarzenborn (Renania-Palatinado)","context_page_description":"Schwarzenborn es un municipio situado en el distrito de Bernkastel-Wittlich, en el estado federado de Renania-Palatinado. Su población estimada a finales de 2016 era de 52 habitantes.​\\nSe encuentra ubicado en el centro-norte del estado, al este de la ciudad de Tréveris y cerca de la orilla del río Mosela, un afluente del Rin por la izquierda."},{"page_url":"https://ca.wikipedia.org/wiki/Sort","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Sort._La_Noguera_Pallaresa.JPG","page_title":"Sort","context_page_description":"Sort és una vila i municipi de la comarca del Pallars Sobirà, on fa de cap de comarca. És, juntament amb el Pont de Suert, un dels caps de comarca menys poblats de Catalunya. El 2011 té 2.360 habitants\\nL'actual municipi de Sort és fruit de l'agregació al vell terme de Sort dels d'Enviny i Llessui, el 1970, i d'Altron, el 1976. Amb aquestes agregacions, el terme municipal de Sort ha assolit una extensió de 105,05 km², que multiplica per vuit el seu terme original de 13,9 km². Enviny n'hi va aportar 31,7, Llessui, 53, i Altron, més petit, 6,5.\\nEl terme antic s'estenia per la ribera de la Noguera Pallaresa, a tots dos costats, mentre que la vila era a la dreta del riu. Modernament s'ha estès també per la riba esquerra. A més de la Ribera, el terme actual comprèn la vall del Barranc de Montardit i pràcticament tota la Vall d'Àssua, que en part comparteix amb Rialb."},{"page_url":"https://es.wikipedia.org/wiki/Viaje_de_Anson_alrededor_del_mundo","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Anson-Mason-1748-06.jpg","page_title":"Viaje de Anson alrededor del mundo","context_page_description":"El viaje de Anson alrededor del mundo es el viaje que dirigió el comodoro George Anson al frente de una escuadra de ocho barcos de la Royal Navy que tenía por misión desorganizar o capturar las posesiones de España en el Pacífico, mientras Gran Bretaña estaba en guerra con España en 1740. De regreso en Inglaterra en 1744, vía China y tras haber completado una circunnavegación, el viaje se caracterizó por la captura del galeón de Acapulco y también por las terribles pérdidas por enfermedad sufridas, con solo 188 supervivientes de los 1.854 tripulantes que habían partido."},{"page_url":"https://he.wikipedia.org/wiki/%D7%94%D7%91%D7%97%D7%99%D7%A8%D7%95%D7%AA_%D7%9C%D7%A0%D7%A9%D7%99%D7%90%D7%95%D7%AA_%D7%94%D7%95%D7%93%D7%95_2017","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Meira_Kumar.jpg","page_title":"הבחירות לנשיאות הודו 2017","context_page_description":"הבחירות לנשיאות הודו נערכו בהודו ביום שני, 17 ביולי 2017, חמישה ימים לפני פקיעת כהונתו של נשיא הודו המכהן פרנב מוקהרג'י. הנשיא המכהן זכאי להתמודד מחדש, משום שאין מגבלה על מספר הקדנציות של נשיא הודו, אך הוא הודיע בינואר 2017 כי לא יתמודד בבחירות אלה. ספירת הקולות הסתיימה ביום חמישי, 20 ביולי 2017 והמנצח בבחירות ראם נאת' קובינד הושבע ונכנס לתפקיד ב-25 ביולי."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%B0%D0%BC%D1%8E%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9c/Panorama_of_Saumur.JPG","page_title":"Самюр","context_page_description":"Самюр — горад у французскім дэпартаменце Мен і Луара, на левым беразе Луары, пры ўпадзенні ў яе ракі Туэ. Супрефектура акругі Самюр.\\nЗамак XI—XVI стст. Цэрквы: Сен-П’ер, Нотр-Дам-дэ-Нанцільі, Сен-Нікаля, Нотр-Дам-дэз-Ардыльер. Ратуша ў гатычным стылі, Каледж, музей. Гарадская бібліятэка.\\nКаменны мост злучае горад праз востраў на Луары з прадмесцем Круа-Верт. Жыхароў каля 29 850. Вінаградарства і вінаробства, выраб лікёраў, маслабойная вытворчасць. Дзяржаўная школа верхавой язды, створаная па загаду Людовіка XVIII.\\nУ гэтым горадзе нарадзілася знакамітая Како Шанэль."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%94%D0%BE%D1%81%D1%82%D0%BE%D0%BF%D1%80%D0%B8%D0%BC%D0%B5%D1%87%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%BE%D1%81%D1%82%D0%B8_%D0%91%D1%83%D1%85%D0%B0%D1%80%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Zindon_Prison_%288145368631%29.jpg","page_title":"Достопримечательности Бухары","context_page_description":"Бухара — город-музей, на территории которого сохранилось немало памятников среднеазиатского зодчества, относящихся к различным историческим периодам.\\nЗаселение Бухары началось в первых веках до нашей эры, но бурное развитие города, носившего в то время название Нумиджкет, произошло в VI—VII веках нашей эры. В IX веке Бухара провозглашена столицей государства Саманидов, а при Караханидах она становится крупнейшим политическим и экономическим центром Средней Азии. Во время опустошительного монгольского нашествия город был полностью разрушен. Сохранившиеся памятники домонгольского периода в Бухаре немногочисленны. Это, прежде всего, мавзолей Саманидов и минарет Калян, а также фасад мечети Магоки-Аттари и уцелевшая в пригородной зоне старой Бухары Намазгох.\\nПосле разрушительных набегов Чингисхана и ильхана Абаки Бухара постепенно восстанавливается и в XIV веке становится одним из самых значительных городов Мавераннахра. При Тимуридах в городе происходят грандиозные градостроительные и фортификационные преобразования, вновь появляются монументальные здания, преимущественно культовые. От этого периода сохранились мечеть Калян, Чашма-Аюб, медресе Улугбека."},{"page_url":"https://pl.wikipedia.org/wiki/Jackalope","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Unlucky_Jackalope_4891624513.jpg","page_title":"Jackalope","context_page_description":"Jackalope – mityczne zwierzę północnoamerykańskiego folkloru opisywane jako zając z rogami antylopy widłorogiej lub porożem jelenia. Jackalope to zbitka wyrazowa słów jackrabbit i antelope. Wiele trofeów myśliwskich takich hybryd w postaci ściennych dekoracji wykonano z poroża jelenia.\\nKażdego roku turyści w Stanach Zjednoczonych nabywają tysiące egzemplarzy wypchanych jackalope’ów. W stanie Wyoming umieszczone są znaki drogowe ostrzegające kierowców, aby uważali na jackalope’y. Przed 1982 rokiem izba handlowa miasta Douglas wydawała tysiące licencji na polowanie na jackalope’y rocznie."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%BA%D0%B0%D0%BB%D0%B0%D0%BF%D0%B5%D0%BD%D0%B4%D1%80%D0%B0%D0%B2%D1%8B%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Scolopendra_gigantea_%282%29.jpg","page_title":"Скалапендравыя","context_page_description":"Скалапендравыя — атрад беспазваночных жывёл класа губаногіх.\\nПадзяляюцца на 2 сямействы: крыптапіды і скалапендры; каля 900 відаў. Большасць пашыраны ў тропіках і субтропіках, глебавыя скалапендравыя трапляюцца ў стэпавай і лясной зонах Усходняй Еўропы. Жывуць пад камянямі, бярвёнамі, у расколінах скал, глебы і інш. Кормяцца ў асноўным беспазваночнымі, буйныя — і дробнымі пазваночнымі.\\nДаўжыня да 30 см. Цела пляскатае ў спінна-брушным напрамку, складаецца з членікаў, на большасці якіх ёсць дыхальцы. Спіна скурыстая, звычайна цямнейшая за брушка. Скалапендры па баках галавы маюць вочы, якія складаюцца са скопішчаў простых вочак, крыптапіды — сляпыя. Развіццё з эпімарфозам.\\nМногія ядавітыя, ядомыя."},{"page_url":"https://id.wikipedia.org/wiki/Xi_Wangmu","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/XiWangMu-Dresden.JPG","page_title":"Xi Wangmu","context_page_description":"Xi Wangmu adalah sesosok dewi masyarakat Tiongkok yang telah dikenal semenjak masa lampau. Informasi sejarah mengenai dirinya telah ada dalam inskripsi tulang orakel pada abad ke-15 SM yang mencatat sebuah persembahan untuk \\"Ibu Barat\\". Meskipun inskripsi-inskripsi tersebut menunjukkan bahwa penyembahan kepadanya jauh sebelum Taoisme terorganisasi, ia sering kali diasosiasikan dengan Taoisme. Dari namanya saja, beberapa karakter pentingnya ditunjukkan: ia adalah keluarga kerajaan, wanita, dan diasosiasikan dengan arah Barat.\\nIa dikenal dalam mitologi Tiongkok sebagai Dewi yang mengatur Surga bagian Barat dan juga dikenal sebagai Ratu para Dewi yang menjaga dan mengatur para dewi. Ada anggapan yang menyatakan ia adalah permaisuri Yu Huang Da Di. Ia adalah salah satu dewata penting dalam legenda kuno Tiongkok dan dibawa para imigran hingga ke Asia Tenggara bahkan Amerika. Meningkatnya popularitas Ibu Ratu dari Barat, serta kepercayaan bahwa dirinya adalah pemberi kekayaan, umur panjang, dan kebahagiaan abadi dimulai semenjak sekitar abad ke dua SM, saat wilayah Tiongkok bagian Utara dan Barat dikenal lebih baik karena dibukanya Jalur Sutra."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_esp%C3%A8ces_du_genre_Panicum","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Panicum_maximum_BotGardBln07122011B.JPG","page_title":"Liste des espèces du genre Panicum","context_page_description":"La liste des espèces du genre Panicum comprend près de 450 espèces acceptées.\\nSelon la base de données de The Plant List, 1787 espèces de Panicum ont été décrites, dont 442 sont des espèces acceptées, 1147 des synonymes et 198 sont en attente d'évaluation."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B0%D0%BB%D0%B8%D1%85%D0%BE%D0%B2%D1%81%D0%BA%D0%B8%D0%B9_%D0%BF%D0%B5%D1%80%D0%B5%D1%83%D0%BB%D0%BE%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Odesa_Valihovsky_SAM_4982_51-101-0097.JPG","page_title":"Валиховский переулок","context_page_description":"Валиховский переулок — улица в Одессе, в историческом центре города, связывает спуск Маринеско с улицей Пастера."},{"page_url":"https://ca.wikipedia.org/wiki/Parc_Natural_del_Ca%C3%B1%C3%B3n_del_R%C3%ADo_Lobos","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Ermita_de_San_Bartolom%C3%A9_en_Ucero.JPG","page_title":"Parc Natural del Cañón del Río Lobos","context_page_description":"El Parc Natural del Cañón del Río Lobos és un espai natural protegit de la comunitat autònoma de Castella i Lleó, Espanya. Aproximadament un terç de la seva superfície s'ubica en la província de Burgos i dos terços a la de Sòria."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Mitglieder_der_Deutschen_Akademie_der_Naturforscher_Leopoldina/2011","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Markus_Gross_at_Eurographics%272010.jpg","page_title":"Liste der Mitglieder der Deutschen Akademie der Naturforscher Leopoldina/2011","context_page_description":"Die Liste der Mitglieder der Deutschen Akademie der Naturforscher Leopoldina für 2011 enthält alle Personen, die im Jahr 2011 zum Mitglied ernannt wurden. Insgesamt gab es 75 neu gewählte Mitglieder."},{"page_url":"https://nl.wikipedia.org/wiki/Kathedraal_van_Lucca","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Dome_Lucques_Duomo_San_Martino_Lucca.jpg","page_title":"Kathedraal van Lucca","context_page_description":"De Duomo di San Martino is de kathedraal aan de Piazza San Martino van de Italiaanse stad Lucca. Dit is de hoofdkerk van het aartsbisdom Lucca. Hij is gewijd aan de heilige Martinus van Tours.\\nDe bouw van de kathedraal begon in 1060, maar het werk aan de versierde gevels werd pas in 1241 voltooid. De westgevel is ontworpen door Guido Bigarelli, ook bekend onder de naam Guidetto da Como. De campanile dateert uit de 13e eeuw.\\nDe kathedraal is van wit en grijs marmer. De voorgevel heeft diverse kolommen en bogen, en een standbeeld van Martinus van Tours op zijn paard.\\nQua symmetrie klopt het gebouw niet helemaal. De rechtse boog is kleiner dan de anderen, omdat er te weinig ruimte over was tussen deze kathedraal en de campanile die er reeds stond. Deze architecturale fout komt door een meetfout in het ontwerp.\\nDe kathedraal is nooit helemaal voltooid. Er hoort eigenlijk nog een top op, maar die is er nooit gekomen."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AF%E3%83%AB%E3%82%B7%E3%83%A3%E3%83%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Warsaw_Metro_Plac_Wilsona_2.jpg","page_title":"ワルシャワ","context_page_description":"ワルシャワは、ポーランドの首都でかつ同国最大の都市。人口約180万人。マゾフシェ県の県都。ポーランドの政治、経済、交通の要衝でもある。"},{"page_url":"https://fr.wikipedia.org/wiki/Bouteille_de_vin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Hotel_duc_Bourgogne_Beaune_44.jpg","page_title":"Bouteille de vin","context_page_description":"Une bouteille de vin est une bouteille, généralement en verre, qui est spécialement destinée à contenir du vin. En général, elle porte une étiquette présentant le vin contenu."},{"page_url":"https://en.wikipedia.org/wiki/Eridania_quadrangle","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/67/2509mantlelayers.jpg","page_title":"Eridania quadrangle","context_page_description":"The Eridania quadrangle is one of a series of 30 quadrangle maps of Mars used by the United States Geological Survey Astrogeology Research Program. The Eridania quadrangle is also referred to as MC-29.\\nThe Eridania quadrangle lies between 30° and 65° south latitude and 180° and 240° west longitude on the planet Mars. Most of the classic region named Terra Cimmeria is found within this quadrangle. Part of the Electris deposits, a 100–200 meters thick, light-toned deposit covers the Eridania quadrangle. Many slopes in Eridania contain gullies, which are believed to be caused by flowing water."},{"page_url":"https://pl.wikipedia.org/wiki/Bitwa_pod_Balikpapan_(1942)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/USS_Pope_%28DD-225%29_steaming_at_high_speed_off_Luzon_on_15_January_1924_%28NH_90123%29.jpg","page_title":"Bitwa pod Balikpapan (1942)","context_page_description":"Bitwa pod Balikpapan – bitwa morska pomiędzy flotą amerykańską a japońską, stoczona podczas II wojny światowej w Cieśninie Makasarskiej u wybrzeży Borneo. W nocy z 23 na 24 stycznia 1942 niewielki zespół amerykańskich niszczycieli dokonał ataku na japoński konwój przeprowadzający desant w pobliżu centrum przemysłu naftowego w Balikpapan. Wykorzystując element zaskoczenia wynikający z ich błędnej identyfikacji przez dowódców japońskiej eskorty, amerykańskie okręty bez strat własnych zatopiły co najmniej 4 japońskie statki transportowe oraz okręt patrolowy. Była to pierwsza operacja bojowa amerykańskiej floty nawodnej w drugiej wojnie światowej i na jej pacyficznym teatrze, a także jej pierwsza walka od czasów wojny hiszpańsko-amerykańskiej pod koniec XIX wieku. Bitwa ta nie miała jednak większego wpływu na losy kampanii w Holenderskich Indiach Wschodnich."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%A4%A9%E7%8E%8B%E6%98%9F%E3%81%AE%E6%B0%97%E5%80%99","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Seasonal_change_on_Uranus.jpg","page_title":"天王星の気候","context_page_description":"天王星の気候は、惑星内部からの熱供給の欠如と激しい季節変化を引き起こす著しい自転軸の傾きによって、大きな影響を受けている。他の木星型惑星と比べて天王星の大気はよく似ているが、気候は著く穏やかである。1986年にボイジャー2号が天王星の航過観測を行った際、惑星全体に合計10個の雲を観測した。1990年代から2000年代に行われた地上の天文台やハッブル宇宙望遠鏡からの観測によって、惑星の北半球の冬に明るい雲があることが分かった。2006年には、海王星の大暗斑に似た暗斑が発見された。"},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%95%E3%81%84%E3%81%9F%E3%81%BE%E5%B8%82%E7%AB%8B%E4%BB%B2%E6%9C%AC%E5%B0%8F%E5%AD%A6%E6%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/3WkuqINz.jpg","page_title":"さいたま市立仲本小学校","context_page_description":"さいたま市立仲本小学校は、埼玉県さいたま市浦和区にある公立小学校。"},{"page_url":"https://he.wikipedia.org/wiki/%D7%9E%D7%A2%D7%91%D7%A8_%D7%95%D7%99%D7%A0%D7%93%D7%95%D7%95%D7%A8%D7%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Windwardpassagemap.JPG","page_title":"מעבר וינדוורד","context_page_description":"מעבר וינדוורד הוא מצר ים בים הקריבי, המפריד בין האיים קובה והיספניולה, והמחבר בין האוקיינוס האטלנטי לים הקריבי.\\nרוחבו של המעבר הוא כ-80 קילומטרים והנקודה העמוקה ביותר בו היא כ-1,700 מטרים מתחת לפני הים. בחלקו המערבי ממוקם מחוז גואנטנמו בקובה, מדרום מזרח לו שוכן המחוז הצפון מערבי בהאיטי, מדרום ממוקם האי נבאסה ומצפון האי אינגואה שבאיי הבהאמה.\\nהמעבר הוא הנתיב הימי הישיר בין תעלת פנמה לבין מזרחה של ארצות הברית."},{"page_url":"https://vi.wikipedia.org/wiki/Acronicta","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Acronicta.psi.7153.jpg","page_title":"Acronicta","context_page_description":"Acronicta là một chi bướm đêm thuộc họ noctuidae, gồm khoảng 150 loài, phân bố chủ yếu ở miền Toàn bắc ôn hòa, và một số ở các khu vực cận nhiệt đới. Sâu của đa số các loài không thể nhầm lẫn vì chúng có các gai lông màu sáng, và thường dễ nhận thấy trên các cây có nhiều lá. Ấu trùng của Smeared Dagger Moth không phải lúc nào cũng có lông. Các loài của Acronicta có một hoặc hình dạng giống dấu thập màu đen trên mặt trên của cánh trước. Nhưng một số loài thì lại có một vòng tròn màu tối rất rõ."},{"page_url":"https://el.wikipedia.org/wiki/%CE%9C%CE%B9%CF%83%CE%B9%CF%83%CE%AC%CE%BF%CF%85%CE%B3%CE%BA%CE%B1","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/55/Location_of_Mississauga.PNG","page_title":"Μισισάουγκα","context_page_description":"Η Μισισάουγκα είναι μια πόλη στην καναδική περιφέρεια του Οντάριο και προάστιο του Τορόντο. Βρίσκεται στις όχθες της Λίμνη Οντάριο"},{"page_url":"https://it.wikipedia.org/wiki/Jonava","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/The_church_of_Jonava.jpg","page_title":"Jonava","context_page_description":"Jonava è una città della Lituania, la 9ª per popolazione con circa 35.000 abitanti. Collocata al centro del paese, appartiene alla Contea di Kaunas."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%90%D1%80%D1%82%D0%B8%D0%B3%D0%BB%D1%83%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Artiguelouve_%28Pyr-Atl%2C_Fr%29_Mairie.JPG","page_title":"Артиглув","context_page_description":"Артиглув — Францин гӀала-коммуна, лаьтта Керла Аквитани регионехь. Коммунан департамент — Атлантикан Пиренейш департамент. По гуон юкъа йогӀу. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%85%E0%A4%9C%E0%A5%80%E0%A4%A4_%E0%A4%85%E0%A4%82%E0%A4%9C%E0%A5%81%E0%A4%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Journalist_Ajit_Anjum.jpg","page_title":"अजीत अंजुम","context_page_description":"अजीत अंजुम वरिष्ठ पत्रकार एवं लेखक हैं। अजीत अंजुम न्यूज़ 24 और इंडिया टीवी समाचार चैनलों के प्रबंध संपादक का दायित्व संभाल चुके हैं।पत्रकारिता के क्षेत्र में उनके महत्वपूर्ण योगदान को लेकर उन्हें रामनाथ गोयनका पुरस्कार से सम्मानित किया जा चुका है।"},{"page_url":"https://pl.wikipedia.org/wiki/Szcze%C5%BCuja_wielka","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Anodonta_cygnea1.jpg","page_title":"Szczeżuja wielka","context_page_description":"Szczeżuja wielka – palearktyczny gatunek małża z rodziny skójkowatych. Największy spośród rodzimych małży występujących w Polsce. W wielu krajach Środkowej Europy, w związku ze spadkiem liczebności jego populacji, jest wpisany do czerwonych list gatunków zagrożonych i, m.in. w Polsce, prawnie chroniony."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%BC%A2%E6%96%AF-%E7%B4%84%E9%98%BF%E5%B8%8C%C2%B7%E9%A6%AC%E8%A5%BF%E9%87%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Bf109F-4_Gelbe14_Ma_JG27_kl96.jpg","page_title":"漢斯-約阿希·馬西里","context_page_description":"漢斯·約阿希·馬爾塞，全名漢斯-約阿希·懷特·魯道夫·齊格菲·馬爾塞，是第二次世界大戰時期「德國空軍」的一位王牌飛行員，常被稱為「非洲之星」。馬爾塞一共參加了三百八十二次任務，擊落了一百五十八架敵機，其中的一百五十一架均在「北非戰場」中獲得。大部分的二戰德國空戰英雄主要的擊落紀錄大多來自東線蘇聯，他的全部戰績都是英美的西方國，因此他也是「德國空軍」中擊落西方飛機最多的駕駛員，同時也榮獲了「鑽石橡葉帶劍鐵十字勳章」。\\n馬爾塞利用了他傑出的觀察能力，操控和高角度偏差射擊戰術使他的攻擊常常擁有非常大的殺傷率，在良好的環境下他的每次攻擊都能夠擊傷或擊落敵機，令他成為空戰歷史上最傑出的偏差射擊飛行員之一。他也曾創造了在十分鐘內擊落八架敵機，一天裡擊落十七架敵機，一個月擊落五十四架敵機等記錄。據有些學者的計算，他擊落一架飛機平均只須十五發子彈。馬爾塞所屬的「第二十七戰鬥機聯隊」的「第一大隊」所取得的五百八十八架戰績裡，馬爾塞占了一百五十一架，達到了百分之二十六。"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Weikersheim","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Weikersheim_Rathaus.jpg","page_title":"Liste der Kulturdenkmale in Weikersheim","context_page_description":"In der Liste der Kulturdenkmale in Weikersheim sind Bau- und Kunstdenkmale der Stadt Weikersheim verzeichnet, die im „Verzeichnis der unbeweglichen Bau- und Kunstdenkmale und der zu prüfenden Objekte“ des Landesamts für Denkmalpflege Baden-Württemberg verzeichnet sind. Dieses Verzeichnis ist nicht öffentlich und kann nur bei „berechtigtem Interesse“ eingesehen werden. Die folgende Liste ist daher nicht vollständig. Sie beruht im Wesentlichen auf dem veröffentlichten Denkmalpflegerischen Werteplan. Der Artikel ist Teil der übergeordneten Liste der Kulturdenkmale im Main-Tauber-Kreis. Eine rechtsverbindliche Auskunft ist lediglich auf Anfrage bei der Unteren Denkmalschutzbehörde der Stadt Weikersheim erhältlich.\\nKleindenkmale wie beispielsweise Bildstöcke, Statuen und Wegkreuze blieben im Stadtgebiet zahlreich erhalten. Der Grund liegt in der seit dem Mittelalter durchgehend landwirtschaftlichen Struktur. Es kam in der Neuzeit zu keiner Verdichtung von Siedlung und Industrie wie in den Ballungsgebieten, so dass diese Kulturdenkmale im Freiland weitgehend erhalten blieben."},{"page_url":"https://ne.wikipedia.org/wiki/%E0%A4%B9%E0%A4%BF%E0%A4%89%E0%A4%81_%E0%A4%9A%E0%A4%BF%E0%A4%A4%E0%A5%81%E0%A4%B5%E0%A4%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Snow_leopard_range.png","page_title":"हिउँ चितुवा","context_page_description":"हिउँ चितुवा ठूलो बिरालो प्रजातिको मांसाहारी जनावर हो, जुन दक्षिण एसिया तथा मध्य एसियाका हिमाली क्षेत्रमा पाइन्छ। हिउँ चितुवा समुन्द्री सतहबाट ३, ००० देखि ५, ५०० मिटर उचाई बीचका चट्टानी हिमाली क्षेत्रमा बसोबास गर्छन। लुकेर रहने स्वभाबको कारण यिनिहरूको सही संख्या थाहा हुन सकेको छैन, तापनि खुला जंगली क्षेत्रमा ३, ५०० देखि ७, ००० को संख्यामा तथा बिश्वका चिडियाघरहरूमा ६०० देखि ७०० को संख्यामा हिउँ चितुवाहरू रहेको अनुमान गरिएको छ।\\nहिउँ चितुवा अन्य ठूला बिरालो प्रजातिका जनावर भन्दा सानो हुन्छ, तर उनीहरू कै आकारमा देखिन्छ, सामान्यतया यिनीहरूको तौल २७ देखि ५४ किलोग्राम तथा लम्बाई ७५ देखि १३० सेन्टिमिटरको हाराहारीमा हुन्छ भने पुच्छर सहितको लम्बाई यो लम्बाईको ७५ देखि ९० प्रतिशत बढी हुने गर्छ।"},{"page_url":"https://en.wikipedia.org/wiki/Proserpinus_clarkiae","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Proserpinus_clarkiae_MHNT_CUT_2010_0_11_Lime_Kiln_Canyon_San_Benito_Co._female_ventral.jpg","page_title":"Proserpinus clarkiae","context_page_description":"Proserpinus clarkiae, or Clark's sphinx, is a moth of the family Sphingidae. The species was first described by Jean Baptiste Boisduval in 1852. It is known from British Columbia and Washington south through California to Baja California, east to Idaho, Wyoming and Utah. The habitat consists of oak woodland and pine-oak woodland in foothills."},{"page_url":"https://nl.wikipedia.org/wiki/Saul_en_David","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Rembrandt_Harmensz._van_Rijn_030_%28detail%29.jpg","page_title":"Saul en David","context_page_description":"Saul en David is een schilderij van Rembrandt en/of zijn atelier in het Mauritshuis in Den Haag."},{"page_url":"https://en.wikipedia.org/wiki/History_of_baseball_in_Allentown,_Pennsylvania","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/1924_Allentown_Dukes_Baseball_Team_-_Allentown_PA.jpg","page_title":"History of baseball in Allentown, Pennsylvania","context_page_description":"Allentown's association with the national pastime spans more than 125 years, from the formation of the Allentown Dukes in the late 19th century to the startup of the Lehigh Valley IronPigs in the early 21st century."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A0%88%EB%B9%88_%EC%99%B8%EC%A6%88%ED%88%AC%EB%82%A0%EB%A5%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Levin-Oeztunali.jpg","page_title":"레빈 외즈투날르","context_page_description":"레빈 메테 외즈투날르는 독일의 축구 선수이다. 독일 축구의 전설인 우베 젤러의 외손자이다."},{"page_url":"https://lv.wikipedia.org/wiki/J%C4%93kabpils","image_url":"https://upload.wikimedia.org/wikipedia/lv/5/5c/Tautas_nams.jpg","page_title":"Jēkabpils","context_page_description":"Jēkabpils ir viena no deviņām Latvijas republikas nozīmes pilsētām, viena no 119 administratīvajām teritorijām Latvijas dienvidaustrumos, Zemgales plānošanas reģionā.\\nJēkabpils kā apdzīvota vieta izveidojusies līdzās Daugavas labajā krastā 1237. gadā uzceltajai Krustpils pilij. Apbūve Daugavas kreisajā pusē attīstījusies, pateicoties plostnieku un strūdzinieku darbībai, un 1670. gadā hercogs Jēkabs šai apmetnei piešķīra pilsētas tiesības un nosaukumu Jēkabmiests.\\nJēkabpilī krustojas valsts galvenās tranzīta dzelzceļa līnijas, kurām ir starptautiska nozīme. Latvijas ietvaros šīs līnijas savieno Jēkabpili ar Rīgu, Jelgavu, Rēzekni un Daugavpili. Krustpils stacija uz šīm maģistrālēm ir svarīgs transporta mezgls, kas apstrādā kravas un sadala transporta plūsmas pirms galamērķiem.\\nPilsētas kopējā platība ir 2553 ha un pilsētā dzīvo 23 656 iedzīvotāji. Pēc platības Jēkabpils ir astotā lielākā Latvijas pilsēta, pēc iedzīvotāju skaita – mazākā no republikas nozīmes pilsētām. Jēkabpilī dzīvo aptuveni 9% no Zemgales plānošanas reģiona iedzīvotāju skaita. Jēkabpili šķērsojošās dzelzceļa līnijas Rīga-Daugavpils un Krustpils-Rēzekne-Zilupe ir iekļautas Eiropas Transporta tīkla pamattīklā."},{"page_url":"https://nl.wikipedia.org/wiki/Alcantara_(Romblon)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Ph_locator_romblon_alcantara.png","page_title":"Alcantara (Romblon)","context_page_description":"Alcantara is een gemeente in de Filipijnse provincie Romblon op het eiland Tablas. Bij de laatste census in 2007 had de gemeente ruim 15 duizend inwoners."},{"page_url":"https://vo.wikipedia.org/wiki/Long_Beach_(Minnesota)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Pope_County_Minnesota_Incorporated_and_Unincorporated_areas_Long_Beach_Highlighted.svg","page_title":"Long Beach (Minnesota)","context_page_description":"Long Beach binon zif in komot: Pope, in tat: Minnesota, in Lamerikän."},{"page_url":"https://nl.wikipedia.org/wiki/Musikmuseum_(Bazel)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/Basel_2012-09-28_Mattes_%28129%29.JPG","page_title":"Musikmuseum (Bazel)","context_page_description":"Het Musikmuseum, ook wel Museum für Musik, is een museum in Bazel. Het is een van de vier vestigingen van het Bazelse Historische Museum."},{"page_url":"https://eo.wikipedia.org/wiki/Pf%C3%A4lzerwald-Verein","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ea/2011_Pf%C3%A4lzerwald_053_Edenkobener_H%C3%BCtte.jpg","page_title":"Pfälzerwald-Verein","context_page_description":"La Pfälzerwald-Verein estas migrosocieto en la iama bavara Palatinato, respektive en la suda parto de la germana federacia lando Rejnlando-Palatinato kaj sarlanda distrikto Saarpfalz. Fine de 2016 la societo havis 206 lokajn grupojn kun pli ol 20.000 membroj. Ĝi estas registrita asocio."},{"page_url":"https://lt.wikipedia.org/wiki/Ordesos_ir_Perdido_kalno_nacionalinis_parkas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Circo_de_Soaso.JPG","page_title":"Ordesos ir Perdido kalno nacionalinis parkas","context_page_description":"Ordesos ir Perdido kalno nacionalinis parkas – Ispanijos valstybinis parkas esantis, šiaurės rytų Ispanijoje, Pirėnų kalnuose, Hueskos provincijoje, Aragono regione. Įkurtas 1918 m. rugpjūčio 16 d."},{"page_url":"https://en.wikipedia.org/wiki/Second_Valls_government","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/Salon_du_livre_2015_-_Cazeneuve_01.jpg","page_title":"Second Valls government","context_page_description":"The Second Valls government was the thirty-eighth government in the French Fifth Republic.\\nIt was led by Manuel Valls, who was appointed Prime Minister of France on 27 August 2014; it consisted of 15 ministers from the Socialist Party and 2 from the Radical Party of the Left.\\nFollowing Valls's decision to focus on his campaign for the Socialist Party presidential primary, he resigned from his functions on 6 December 2016. The government was succeeded by the Cazeneuve government."},{"page_url":"https://es.wikipedia.org/wiki/Drago_de_Icod_de_los_Vinos","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Drago_milenario%2C_Icod_de_los_Vinos%2C_Tenerife%2C_Espa%C3%B1a%2C_2012-12-13%2C_DD_02.jpg","page_title":"Drago de Icod de los Vinos","context_page_description":"El conocido como Drago Milenario de Icod de los Vinos, al norte de la isla de Tenerife, es un enorme ejemplar de drago declarado Monumento Nacional en 1917. El drago es una planta de porte arbóreo perteneciente al grupo de las Monocotiledóneas que posee un crecimiento secundario anómalo. Es por tanto una herbácea leñosa, más que estrictamente “árbol”. En la actualidad es el más grande y longevo que se conoce en el mundo en su especie. Mide unos 18 metros de altura y tienen un perímetro en la base de tronco de veinte metros y más de trescientas ramas principales. Las flores son pequeñas y numerosas tienen 6 pétalos y otros tantos estambres de tono verde cremoso o amarillo muy pálido y se arraciman en llamativas inflorescencias que sobresalen del conjunto de hoja. Se estima que en años de buena floración puede llegar a producir hasta mil quinientos ramos de flores. El tronco tiene una enorme cavidad que se eleva hasta los 6 m. de altura, a la que se accede por una puerta. En 1985 se procedió a un profundo saneamiento y se instaló en el interior del tronco un ventilador para facilitar la circulación del aire y evitar la proliferación de hongos."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%92%D0%BE%D0%BB%D0%B8%D0%BD%D1%81%D1%8C%D0%BA%D0%B8%D0%B9_%D0%BD%D0%B0%D1%86%D1%96%D0%BE%D0%BD%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D1%83%D0%BD%D1%96%D0%B2%D0%B5%D1%80%D1%81%D0%B8%D1%82%D0%B5%D1%82_%D1%96%D0%BC%D0%B5%D0%BD%D1%96_%D0%9B%D0%B5%D1%81%D1%96_%D0%A3%D0%BA%D1%80%D0%B0%D1%97%D0%BD%D0%BA%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/%D0%91%D1%83%D0%B4%D1%96%D0%B2%D0%BB%D1%8F_%D0%BE%D0%B1%D0%BA%D0%BE%D0%BC%D1%83_04718.jpg","page_title":"Волинський національний університет імені Лесі Українки","context_page_description":"Волинський національний університе́т і́мені Ле́сі Украї́нки — державний вищий навчальний заклад IV рівня акредитації у місті Луцьк, Україна. Заснований у 1940 році, впродовж історії змінював назви: Луцький державний учительський інститут, Луцький державний педагогічний інститут; у статусі університету носив назви Волинського державного, Волинського національного і Східноєвропейського національного. З 2020 року повернув назву Волинський національний університет. Названий на честь письменниці Лесі Українки."},{"page_url":"https://fr.wikipedia.org/wiki/Sacramento_(fleuve)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2e/Sacramento_watershed.png","page_title":"Sacramento (fleuve)","context_page_description":"Le Sacramento est un fleuve d'environ 615 km qui coule dans l'État de Californie, dans l'ouest des États-Unis."},{"page_url":"https://es.wikipedia.org/wiki/Escola_de_gaitas_de_Ortigueira","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Maxresol_%2835916083985%29_%282%29.jpg","page_title":"Escola de gaitas de Ortigueira","context_page_description":"La banda de gaitas de Santa Marta de Ortigueira, más conocida como la Escola de gaitas de Ortigueira, es un agrupación folclórica de la localidad gallega de Ortigueira, en España. Fundada en 1975, fue la primera banda de gaitas grupal creada en Galicia y la precursora de las bandas de gaitas modernas.​ Fue también la creadora en 1978 del Festival internacional del mundo celta de Ortigueira y la responsable única de su organización hasta el año 1987."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%95%D0%BB%D0%B5%D0%BA%D1%82%D1%80%D0%B8%D1%87%D0%BD%D0%B8%D0%B9_%D0%B2%D0%B5%D0%BB%D0%BE%D1%81%D0%B8%D0%BF%D0%B5%D0%B4","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c5/E-Bike%2C_Schloss_Fuschl_Resort_%26_Spa.jpeg","page_title":"Електричний велосипед","context_page_description":"Електричний велосипед — один із видів механічних транспортних засобів, що схожий на велосипед, та приводиться у рух за допомогою електродвигуна а також силою м'язів; електричний привід може частково або повністю забезпечувати рух електричного велосипеда.\\nВід звичайного велосипеда відрізняється наявністю трьох додаткових компонентів: електродвигуна, акумулятору та мікроконтролера. На відміну від мотоцикла або моторолера, електровелосипед можна також зрушити педалями.\\nКласичний електричний велосипед оснащений електродвигуном і акумулятором можна перевозити в поїздах, автобусах, або міському громадському транспорті.\\n2010 року в Європі продано 700 тисяч електрифікованих велосипедів. У Китаї 2010 року на дорогах було 120 млн електричних велосипедів.\\nЗавдяки маневреності, екологічності, малій вазі і дешевизні електровелосипеди дуже поширені у службах доставки. Маневреність дозволяє їм не зважати на дорожні затори. Однією з подібних українських розробок є електровелосипед «Delfast Ebike», що має запас ходу у 380 км."},{"page_url":"https://fr.wikipedia.org/wiki/E._W._Kemble","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a7/Dancing_in_Congo_Square_-_Edward_Winsor_Kemble%2C_1886.jpg","page_title":"E. W. Kemble","context_page_description":"Edward Winsor Kemble, né le 18 janvier 1861 à Sacramento en Californie et mort le 19 septembre 1933, est un dessinateur et illustrateur américain."},{"page_url":"https://fr.wikipedia.org/wiki/Bigophone","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/90/Bigotphones_1890.jpg","page_title":"Bigophone","context_page_description":"Le bigophone ou bigotphone est un instrument de musique carnavalesque, d'aspect décoratif, très bruyant, populaire, bon marché et facile à fabriquer.\\nEn octobre 2011, le coût de fabrication d'un bigophone artisanal est d'environ 4 euros, dont l'achat d'un kazoo à 3 euros.\\nLe bigophone tire son nom de Romain François Bigot, « marchand de trompes à bouquins sur les champs de foire ». Nom auquel est ajouté le suffixe grec -phone, voix.\\nLe bigophone est aujourd'hui tombé dans l'oubli. Le mot n'évoquant plus qu'une désignation familière du téléphone. On remarque que le son nasillard des voix dans les premiers téléphones rappelle le son des bigophones musicaux. Ce qui fait que le mot bigophone commence très tôt à être utilisé familièrement pour désigner le téléphone. Selon un ouvrage de Jean Damien Lesay paru en 2004, cette pratique remonte à l'année 1918. Le bigophone d'origine étant aujourd'hui tombé en désuétude, le terme a fini par désigner pour la plupart des gens exclusivement le téléphone. Bigophoner signifiant téléphoner. Bigophonique prenant le sens de téléphonique. Le mot bigophone étant même contracté en bigo."},{"page_url":"https://eu.wikipedia.org/wiki/Parisii_(Britainia)","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/04-Britania-79DC.png","page_title":"Parisii (Britainia)","context_page_description":"Parisiiak Britainiako ipar-mendebaldeako herri zelta bat zen, gaur egungo Yorkshiren konderrian kokatua. Brigantes eta kritaniekin mugatzen zuten."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Seen_im_Kanton_Graub%C3%BCnden","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Panixersee_-_1_von_27_%2812%29.jpg","page_title":"Liste der Seen im Kanton Graubünden","context_page_description":"Die folgende Liste enthält benannte Seen und andere Stillgewässer im Kanton Graubünden.\\nSiehe auch: Liste der grössten Seen in der Schweiz"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B8%D0%B3%D0%BE%D1%80%D0%B5%D1%81%D0%BA%D1%83,_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Nicolae_Grigorescu_-_Ferma_la_Barbizon.jpg","page_title":"Григореску, Николае","context_page_description":"Никола́е Григоре́ску — крупнейший румынский художник."},{"page_url":"https://nl.wikipedia.org/wiki/Michael_Johnson","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/Michael_Johnson_Sydney2000.jpg","page_title":"Michael Johnson","context_page_description":"Michael Duane Johnson is een voormalige Amerikaanse atleet, die in het bezit is van het wereldrecord op de 4 x 400 m estafette als lid van het team van de Verenigde Staten. Hij is voormalig wereldrecordhouder op de 200 m en de 400 m. Hij liep tweeëntwintig 400 meterwedstrijden onder de 44 seconden en zeventien 200 meterwedstrijden onder de 20 seconden."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%9F%AF%E5%88%A9%E6%96%AF%C2%B7%E5%A8%81%E5%BB%89%E5%A7%86%E6%A3%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Corliss_Williamson_Sixers.jpg","page_title":"柯利斯·威廉姆森","context_page_description":"柯利斯·威廉姆森，美國NBA聯盟前職業籃球運動員。"},{"page_url":"https://fr.wikipedia.org/wiki/Zemun","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Posta_Zemun.jpg","page_title":"Zemun","context_page_description":"Zemun est une municipalité de Serbie située sur le territoire de la Ville de Belgrade. Elle fait partie des 10 municipalités urbaines de la ville de Belgrade proprement dite. Au recensement de 2011, Zemun intra muros comptait 151 811 habitants et la municipalité dont elle est le centre 166 292.\\nZemun est l'ancienne ville romaine de Taurunum, qui se développa du Iᵉʳ au IVᵉ siècle. Autrefois ville à part entière, Zemun conserve un centre ancien classé remontant aux XVIIIᵉ et XIXᵉ siècles, à l'époque où elle était située dans l'Empire d'Autriche. La municipalité de Zemun fait aujourd'hui partie de la ville de Belgrade intra muros et constitue l'un des pôles économique et culturel de la capitale serbe."},{"page_url":"https://zh.wikipedia.org/zh-my/%E4%B9%9D%E9%BE%8D%E7%81%A3%E5%9C%8B%E9%9A%9B%E5%B1%95%E8%B2%BF%E4%B8%AD%E5%BF%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/EMax_Main_Atrium_201406.jpg","page_title":"九龍灣國際展貿中心","context_page_description":"九龙湾国际展贸中心，前称香港国际展贸中心，位于香港九龙湾展贸径一号，于1995年启用，是香港一所举行展览及会议场地，为合和实业之投资物业。中心内设有陈列办公室和活动场地租用设施，可用作不同类型的商务活动及宴会，亦设有购物中心EMax及其他服务设备。中心总楼面面积为176万平方呎，用途广泛，为办公室租户及活动筹办者提供服务，为2009年东亚运动会赛场之一。\\n九龙湾国际展贸中心位于工业区西垂，邻近启德发展区，目前交通不甚发达，不过有穿梭巴士往返中心正门和港铁九龙湾站，车程约5至10分钟。\\n2006年，合和实业宣布翻新国际展贸中心的商场部分，并将之命名为EMax。"},{"page_url":"https://en.wikipedia.org/wiki/Alberto_Michelini","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Alberto_Michelini_deputato.jpg","page_title":"Alberto Michelini","context_page_description":"Alberto Michelini is an Italian journalist and politician, former Deputy and Member of the European Parliament."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D1%80%D0%B0%D0%B4%D0%BE%D1%81%D1%82%D1%80%D0%BE%D0%B8%D1%82%D0%B5%D0%BB%D1%8C%D1%81%D1%82%D0%B2%D0%BE_%D0%94%D1%80%D0%B5%D0%B2%D0%BD%D0%B5%D0%B3%D0%BE_%D0%A0%D0%B8%D0%BC%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Pantheon_-_Rome%2C_Italy_-_panoramio.jpg","page_title":"Градостроительство Древнего Рима","context_page_description":"Градостроительство Древнего Рима — планировка, застройка и благоустройство города Рим с древнейших времён до падения Западной Римской империи. Большое влияние на застройку Рима оказывало положение дел в государстве: в периоды расцвета и экспансии город активно обновлялся и расширялся, в периоды ослабления или внутренних конфликтов Рим подвергался осадам и разграблениям. Немалую роль в планировке и застройке города играли частые пожары, а также регулярные выходы из берегов Тибра.\\nХарактерной особенностью римских зодчих была способность усваивать и приспосабливать под свои традиции и потребности градостроительные принципы, композиционные приёмы и архитектурные формы, выработанные греками, этрусками, жителями эллинистических государств и другими народами. Римским архитекторам и строителям были присущи высокое инженерное мастерство и рационализм, они учитывали и максимально использовали все особенности участка — от рельефа и микроклимата до инсоляции и наличия водных ресурсов. Большую роль римляне отводили умению включить архитектуру в ландшафт.\\nРимляне научились строить огромные объекты, такие как амфитеатры, портики или акведуки, в довольно короткие сроки."},{"page_url":"https://ca.wikipedia.org/wiki/Sant_Paulet","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5e/St_Paulet.JPG","page_title":"Sant Paulet","context_page_description":"Sant Paulet és un municipi del departament de l'Aude a la regió francesa d'Occitània."},{"page_url":"https://en.wikipedia.org/wiki/Happiness_Realization_Party","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/42/Japan_Kyoto_Happiness_Realisation_Party.jpg","page_title":"Happiness Realization Party","context_page_description":"The Happiness Realization Party, abbreviated as 幸福, is a Japanese political party founded by Ryuho Okawa on 23 May 2009 \\"in order to offer the Japanese people a third option\\" for the elections of August 2009. The HRP is the political wing of the conservative and anti-communist Happy Science religious movement.\\nOkawa is the current president of the party."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%B5%A3%E5%B7%9E%E5%B8%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Gannan_1940s_4.jpg","page_title":"赣州市","context_page_description":"赣州市，简称虔，古称虔州、南康，通称赣南，是中华人民共和国江西省下辖的地级市，位于江西省南部。市境北连吉安市、抚州市，东接福建省三明市、龙岩市，南临广东省梅州市、河源市，西南达广东省韶关市，西靠湖南省郴州市。地处赣南山地丘陵区，境内群山环绕。东有武夷山，南有九连山，西有大庾岭、诸广山，北有雩山，中部有多个盆地分布。赣江正源贡水发源于东部武夷山黄竹岭，西源章水发源于西部聂都山，章、贡二水于八境台汇合后始称赣江。境内还有湘水、濂水、梅江、平江、桃江、上犹江等赣江支流，东南隅有寻乌水、九曲河往南注入东江。全市总面积39,363平方公里，人口858.87万，是江西省面积最大，人口最多的地级市，市人民政府驻章贡区。赣州是国家历史文化名城、中国优秀旅游城市、全国文明城市，也是客家人主要聚居地之一，客家文化浓厚。\\n赣州是江西省域副中心城市，全国稀有金属产业基地和先进制造业基地、原中央苏区振兴发展示范区、红色文化传承创新区和旅游目的地、区域性综合交通枢纽、赣粤闽湘四省通衢的区域性现代化中心城市，有着千里赣江第一城、江南宋城、客家摇篮、红色故都、世界橙乡、世界钨都等美誉。赣州都市区是江西省重点培育和发展的三大都市区之一。"},{"page_url":"https://en.wikipedia.org/wiki/St_Dominic%27s_School","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Hambledon_Heath_-_geograph.org.uk_-_171755.jpg","page_title":"St Dominic's School","context_page_description":"St. Dominic's School in Hambledon, Surrey, England is a co-educational day school, one of the oldest special schools in the United Kingdom. It specialises in the education of children with various disabilities, such as autism whilst integrating specialised support, including an onsite speech and language, Occupational and physio therapy team. While currently independent, it is supported by local government funding as a centre of excellence in an area of disability for which public funding is to a certain extent is variously provided throughout the country. Currently pupils are admitted from over 35 different LEAs. It admits and educates pupils ages 8–19."},{"page_url":"https://ce.wikipedia.org/wiki/%D0%91%D1%80%D1%8E%D0%B9-%D0%A1%D0%B5%D0%BD%D1%82-%D0%90%D0%BC%D0%B0%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Moulin2009.jpg","page_title":"Брюй-Сент-Аман","context_page_description":"Брюй-Сент-Аман — Францин гӀала-коммуна, лаьтта О-де-Франс регионехь. Коммунан департамент — Нор. Кхузахь климат барамехь ю, аьхка йовха хуьлу, ткъа Ӏа барамехь-шийла хуьлу. ГӀалин бахархой французаш бу. Официалан Французийн мотт бу."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%B3%D0%BB%D0%B0%D0%B2%D0%BD%D1%8B%D1%85_%D1%82%D1%80%D0%B5%D0%BD%D0%B5%D1%80%D0%BE%D0%B2_%D0%A4%D0%9A_%C2%AB%D0%90%D1%81%D1%82%D0%BE%D0%BD_%D0%92%D0%B8%D0%BB%D0%BB%D0%B0%C2%BB","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/79/Roberto_Di_Matteo.jpg","page_title":"Список главных тренеров ФК «Астон Вилла»","context_page_description":"Ниже представлен список главных тренеров футбольного клуба «Астон Вилла» и их главных достижений с 1874 года и по настоящее время.\\nС 1874 по 1934 год клуб избирал специальный комитет, секретарь которого обладал полномочиями главного тренера команды. В этот период у клуба было два секретаря: Джордж Рэмзи и Ви Джей Смит. Под руководством Рэмзи, который был секретарём «Астон Виллы» на протяжении 42 лет, клуб 6 раз становился чемпионом Англии, а также 6 раз выигрывал Кубок Англии. Первым главным тренером клуба после отмены звания секретаря стал Джимми Макмаллан в 1934 году. В 1990 году «Астон Вилла» стала первым клубом из высшего дивизиона, назначившим на должность главного тренера специалиста из-за пределов Британских островов: им стал Йозеф Венглош."},{"page_url":"https://no.wikipedia.org/wiki/Narsarsuaq","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/47/Greenland_big.png","page_title":"Narsarsuaq","context_page_description":"Narsarsuaq er den yngste bygda i Narsaq kommune, syd på Grønland. Den ble etablert i 1941, og er mest kjent for sin flyplass, Narsarsuaq Airport."},{"page_url":"https://an.wikipedia.org/wiki/Idioma_ruso","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Af_nik_za_3_mor_fax.JPG","page_title":"Idioma ruso","context_page_description":"O ruso ye una luenga eslava d'o grupo oriental parlada por 285 millons de personas prencipalment en Rusia y países de l'antiga URSS.\\nYe a luenga eslava mas parlada, perteneixindo por tanto a o grupo d'as luengas indoeuropeas. A partir d'o sieglo X en trobamos as primeras restas d'escritura. Encara que conserva a majoria d'a estructura comuna d'as parolas eslavas, o ruso modern contiene una gran cantidat de vocabulario d'orichen internacional por a politica, a sciencia y a tecnolochía. Estió una luenga d'importancia politica en o sieglo XX, estando un d'os idiomas oficials d'as Nacions Unidas.\\nO ruso ye o idioma mas estenso cheograficament d'Eurasia, asinas como o idioma nativo mas gran d'Europa, con una estimación d'entre 150 y 180 millons de parlants nativos, que lo sitúan como o sieteno idioma mas parlau en o mundo por numero de parlants nativos. Asinas mesmo sería o quarto idioma por numero total de parlants.\\nO ruso s'escribe con una versión moderna de l'alfabeto cirilico, que ye composau por 33 caracters. Iste alfabet fue ideyau entre os sieglos IX y X a partir de l'alfabeto griego. Actualment, ye l'alfabeto común d'as luengas eslavas y tamién lo utilizan atras luengas."},{"page_url":"https://fa.wikipedia.org/wiki/%DA%86%D9%88%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Border_town_Chui.jpg","page_title":"چوی","context_page_description":"چوی یک منطقهٔ مسکونی در اروگوئه است که در بخش روچا واقع شده‌است. چوی ۹٬۶۷۵ نفر جمعیت دارد و ۱۳ متر بالاتر از سطح دریا واقع شده‌است."},{"page_url":"https://vi.wikipedia.org/wiki/Xanthesma_merredensis","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c0/Xanthesma_merredensis_m.jpg","page_title":"Xanthesma merredensis","context_page_description":"Xanthesma merredensis là một loài Hymenoptera trong họ Colletidae. Loài này được Exley mô tả khoa học năm 1974."},{"page_url":"https://lt.wikipedia.org/wiki/%C5%A0%C4%8Dorsai","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/%D0%A4%D1%80%D0%B0%D0%B3%D0%BC%D1%8D%D0%BD%D1%82%D1%8B_%D1%84%D0%B0%D0%BB%D1%8C%D0%B2%D0%B0%D1%80%D0%BA%D0%B0_%22%D0%9C%D1%83%D1%80%D0%B0%D0%B2%D0%B0%D0%BD%D0%BA%D0%B0%22_%D0%A5%D1%80%D0%B0%D0%BF%D1%82%D0%BE%D0%B2%D1%96%D1%87%D0%B0%D1%9E.JPG","page_title":"Ščorsai","context_page_description":"Ščorsai – kaimas Baltarusijoje, Gardino srityje, Naugarduko rajone, 24 km į pieryčius nuo Naugarduko, prie Nemuno. Selsovieto centras. Yra XVIII a. Chreptavičių dvaro sodyba su biblioteka, cerkvė."},{"page_url":"https://es.wikipedia.org/wiki/Pan_and_scan","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/The_Wizard_of_Oz_1955_Lobby_Card.jpg","page_title":"Pan and scan","context_page_description":"Pan and scan es un método cinematográfico que se basa en ajustar una imagen de pantalla panorámica, para poder mostrarla con las proporciones de la SDTV 4:3 de la relación de aspecto del formato televisivo. Para conseguirlo, se recortan partes de la imagen intentando dejar visibles los aspectos que se consideran más importantes del fotograma.​ Este fue el método más común durante la época del VHS, antes de que llegaran los DVD o el Blu-Rays con la widescreen.\\nAlgunos directores estuvieron en contra de utilizar este método de ajustamiento de formato porque se perdía un 45% de la imagen real de una película de 2.35:1 y un 35% de una de 2.55:1, cambiando la visión original del director. Los tres ejemplos más notables de la historia del cine fueron las películas épicas Ben-Hur, Rey de reyes y Lawrence de Arabia, que perdieron el 75% de su imagen original respecto la primera proyección en el cine.​\\nTambién existió otro método llamado \\"center cut\\", muy similar al pan and scan, con la diferencia que en este último sólo se realizaba un corte directo del centro del fotograma, sin ningún tipo de reajuste para intentar mostrar lo más importante de la imagen."},{"page_url":"https://en.wikipedia.org/wiki/Louis_Lougen","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/O.Louis_Lougen.jpg","page_title":"Louis Lougen","context_page_description":"Louis Lougen has been the Superior General of the Missionary Oblates of Mary Immaculate since 2010. He made his perpetual vows in Newburgh, New York in 1976 and was ordained in 1979. He went on to spend almost 17 years in the Roman Catholic Archdiocese of São Paulo."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A4%E3%83%88%E3%83%BC%E3%83%A8%E3%83%BC%E3%82%AB%E5%A0%82","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/Itoyokado_taira.JPG","page_title":"イトーヨーカ堂","context_page_description":"株式会社イトーヨーカ堂は、関東地方を中心に20都道府県に店舗をもつゼネラルマーチャンダイズストア 「イトーヨーカドー」を運営する会社。セブン&アイ・ホールディングス の子会社であり中核企業である。"},{"page_url":"https://id.wikipedia.org/wiki/Ngengat_tentara","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Daphnis_nerii_MHNT_CUT_2010_0_290_Aurangabad_Maharashtra_India_male.jpg","page_title":"Ngengat tentara","context_page_description":"Daphnis nerii, ngengat tentara atau oleander hawk-moth adalah ngengat dari famili Sphingidae seperti yang dijelaskan oleh Carl Linnaeus dalam edisi ke-10 Systema Naturae pada tahun 1758."},{"page_url":"https://ceb.wikipedia.org/wiki/Mezzane_di_Sotto_(munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Torre_Mezzane_di_Sotto.JPG","page_title":"Mezzane di Sotto (munisipyo)","context_page_description":"Munisipyo ang Mezzane di Sotto sa Italya. Nahimutang ni sa lalawigan sa Provincia di Verona ug rehiyon sa Regione Veneto, sa amihanang bahin sa nasod, 400 km sa amihanan sa Rome ang ulohan sa nasod. Adunay 2,463 ka molupyo. Naglangkob kin og 19.6 ka kilometro kwadrado. Mezzane di Sotto mopakigbahin sa usa ka utlanan sa Illasi, San Martino Buon Albergo, Tregnago, Lavagno, ug Verona.\\nAng yuta sa Mezzane di Sotto kay kasagaran kabungtoran, apan sa habagatang-sidlakan nga kini mao ang patag.\\nAng klima umogon ug subtropikal. Ang kasarangang giiniton 14 °C. Ang kinainitan nga bulan Hulyo, sa 26 °C, ug ang kinabugnawan Enero, sa 0 °C. Ang kasarangang pag-ulan 1,393 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 181 milimetro nga ulan, ug ang kinaugahan Hunyo, sa 75 milimetro."},{"page_url":"https://ja.wikipedia.org/wiki/%E8%B6%B3%E6%9F%84%E5%B3%A0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/Ashigara_no_seki.jpg","page_title":"足柄峠","context_page_description":"足柄峠は静岡県駿東郡小山町と神奈川県南足柄市の間にある峠。箱根外輪山から北に伸びた尾根上に位置し、箱根峠とともに東海道を構成する。標高 759m。"},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A8%D9%84%D9%8A%D9%83_%D9%83%D9%88%D9%85%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/73/Blake_Comeau_Flames.png","page_title":"بليك كومو","context_page_description":"الصفحه دى يتيمه, حاول تضيفلها لينك فى صفحات تانيه متعلقه بيها.\\nبليك كومو لاعب هوكى الجليد من كندا."},{"page_url":"https://de.wikipedia.org/wiki/Bernhard_P._Wirth","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/Bernhard_P._Wirth.jpg","page_title":"Bernhard P. Wirth","context_page_description":"Bernhard P. Wirth ist ein deutscher Mystiker, Autor, Übersetzer, Graphologe, Speaker und Coach.\\nEr absolvierte nach eigenen Angaben seit 1986 Trainerausbildungen für Körpersprache, Kommunikation, Neuro-Linguistisches Programmieren, medizinische Hypnose, Engpasskonzentrierte Strategie und Zeitmanagement. Seit 1989 behandelt er diese Themen in Vorträgen, Seminaren, Büchern, Audio-CDs, Video Online Kursen und DVDs."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%AD%94%E5%BE%B7%E8%B2%B4","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/Kong_Deok_Kui_1928%27s.jpg","page_title":"孔德貴","context_page_description":"孔德貴是朝鮮日治時期和韓國的女性神學家，政治家，社會活動家，大學教授。反日本，反朴正熙活動家。韓國獨立活動家和政治家韓國的第4任總統，尹潽善的第二任夫人， 孔德貴本貫是韓國的曲阜孔氏，孔子的79代孫。"},{"page_url":"https://hu.wikipedia.org/wiki/Ch%C3%A2teaugay","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/44/Ville_de_Ch%C3%A2teaugay.JPG","page_title":"Châteaugay","context_page_description":"Châteaugay település Franciaországban, Puy-de-Dôme megyében. Châteaugay Marsat, Blanzat, Cébazat, Gerzat, Malauzat, Ménétrol és Riom községekkel határos."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AD%E3%82%B7%E3%83%8A%E3%82%A6","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/Chisinau_Opera_Teatr060709_1.jpg","page_title":"キシナウ","context_page_description":"キシナウは、モルドバの首都。キシニョフ、キシニョーフ、キシネウといった表記が用いられることもある。人口は647,513人。\\n地名はルーマニア語の \\"chişla\\" と \\"nouă\\" に由来する。この泉は今もプーシキン通りにあり、ここから町が形成された。\\n国土の中央に位置し、市街はドニエストル川の支流ビク川の右岸に広がる。約565平方キロメートルの市内は5つの地区に分けられている。地勢は大部分が平地で、中世より葡萄栽培が盛んである。電気工業、機械工業、繊維産業、ゴムやプラスチック製造などが盛んな工業都市。\\nモルドバ国立大学をはじめ、36の大学と科学アカデミー、キシナウ国際空港などがある。"},{"page_url":"https://ca.wikipedia.org/wiki/Lanneuffret","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/19/Map_commune_FR_insee_code_29116.png","page_title":"Lanneuffret","context_page_description":"Lanneuffret és un municipi francès, situat a la regió de Bretanya, al departament de Finisterre. L'any 2006 tenia 103 habitants."},{"page_url":"https://pl.wikipedia.org/wiki/Piasecki_X-49","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Piasecki_X-49-3.jpg","page_title":"Piasecki X-49","context_page_description":"Piasecki X-49 \\"SpeedHawk\\" – amerykański śmigłowiec eksperymentalny powstały na bazie konstrukcji Sikorsky SH-60 Seahawk. Maszyna jest demonstratorem technologii mającej umożliwić śmigłowcom osiągania dużych prędkości w locie poziomym oraz zwiększać ich pułap i zasięg."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%B8%D0%BD%D0%BE%D0%B4%D0%B5%D0%BB%D0%B8%D0%B5_%D0%B2_%D0%A3%D0%B7%D0%B1%D0%B5%D0%BA%D0%B8%D1%81%D1%82%D0%B0%D0%BD%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Samarcande-Siyob_Bazaar_%282%29.jpg","page_title":"Виноделие в Узбекистане","context_page_description":"Виноделие в Узбекистане — производство вина и выращивание винограда на территории Узбекистана."},{"page_url":"https://it.wikipedia.org/wiki/Cultura_della_ceramica_lineare","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1c/Oder_Fluss.jpg","page_title":"Cultura della ceramica lineare","context_page_description":"La cultura della ceramica lineare è un importante orizzonte archeologico del neolitico europeo.\\nFiorì nel periodo 5500–4500 a.C. circa, con una maggiore densità di siti nell'area del Danubio centrale e lungo il corso centrale e superiore dell'Elba e del Reno.\\nRappresenta un importante fase nell'ambito della prima diffusione dell'agricoltura in Europa. La ceramica da cui deriva il nome è costituita di semplici coppe, ciotole, vasi e brocche senza manici, a cui si aggiunsero in una fase successiva con lug semplici o perforati, basi e colli. Questi oggetti erano usati come ceramica da cucina o per il trasporto locale di cibo e liquidi.\\nI siti più importanti comprendono:\\nNitra in Slovacchia;\\nBylany nella Repubblica Ceca;\\nLangweiler e Zwenkau in Germania;\\nBrunn am Gebirge in Austria;\\nElsloo, Sittard, Köln-Lindenthal, Aldenhoven, Flomborn e Rixheim sul Reno;\\nLautereck e Hienheim lungo il corso superiore del Danubio;\\nRössen e Sonderhausen nella zona centrale dell'Elba.\\nNella fase più antica della cultura della ceramica lineare sono state riconosciute due varianti:"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9F%D0%B0%D0%BB%D0%B0%D1%86-%D0%A1%D0%B0%D0%B4%D0%B8%D0%B1%D0%B0_%D0%9A%D1%83%D1%80%D1%96%D1%81%D1%96%D0%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/%D0%A4%D0%B0%D0%BC%D1%96%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%B3%D0%B5%D1%80%D0%B1_%D1%80%D0%BE%D0%B4%D1%83_%D0%9A%D1%83%D1%80%D1%96%D1%81%D1%96%D0%B2.jpg","page_title":"Палац-Садиба Курісів","context_page_description":"Палац-Садиба Курісів, Маєток Покровське, або Замок Куріса — архітектурна пам'ятка, що знаходиться у селі Курісове Лиманського району Одеської області."},{"page_url":"https://de.wikipedia.org/wiki/Parlamentswahl_in_Belgien_2019","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Wilm%C3%A8s_II.png","page_title":"Parlamentswahl in Belgien 2019","context_page_description":"Die Wahl zur belgischen Abgeordnetenkammer fand am 26. Mai 2019 und damit am selben Tag wie die Europawahl statt. Gleichzeitig wurden auch das Flämische Parlament sowie die Parlamente Walloniens, der Region Brüssel-Hauptstadt und der Deutschsprachigen Gemeinschaft neu gewählt."},{"page_url":"https://it.wikipedia.org/wiki/Makemake_(astronomia)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fe/TheKuiperBelt_Orbits_2003EL61_2005FY9.svg","page_title":"Makemake (astronomia)","context_page_description":"Makemake, ufficialmente designato Makemake, precedentemente noto con la designazione provvisoria di 2005 FY₉) è il terzo pianeta nano per dimensioni del sistema solare ed è appartenente alla classe dei plutoidi. Il suo diametro è pari all'incirca a 3/4 di quello di Plutone. La sua orbita è per intero situata esternamente rispetto all'orbita di Nettuno, pertanto è corretto definirlo un oggetto transnettuniano, appartenente al gruppo dei cubewani.\\nHa un satellite conosciuto, S/2015 1, la cui scoperta è stata resa nota nell'aprile del 2016. La temperatura estremamente bassa che si registra sulla sua superficie fa sì che essa sia ricoperta da ghiacci di metano, etano e probabilmente azoto. Il suo nome richiama la figura di Makemake, divinità della creazione secondo la mitologia pasquense."},{"page_url":"https://sv.wikipedia.org/wiki/Dagbrott","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Baiyunebo_ast_2006181.jpg","page_title":"Dagbrott","context_page_description":"I ett dagbrott bryts malm, industrimineral, torv, brunkol eller byggnadssten direkt vid jordytan istället för att tunnlar grävs under jord. Genom att man i dagbrott undviker besvärliga transporter och dåliga arbetsförhållanden är det mycket ekonomiskt jämfört med att bryta i orter.\\nViktiga dagbrott finns bland annat i Sydamerika med förekomster av järn och bauxit. Uran bryts ofta i dagbrott."},{"page_url":"https://be.wikipedia.org/wiki/%D0%9A%D0%B0%D0%BC%D1%81%D0%B0%D0%BC%D0%BE%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D1%83%D0%BB%D1%96%D1%86%D0%B0_(%D0%91%D1%80%D1%8D%D1%81%D1%82)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Brest_Barry_Kent.JPG","page_title":"Камсамольская вуліца (Брэст)","context_page_description":"Вуліца Камсамольская — вуліца ў Ленінскім раёне Брэста, у гістарычным цэнтры горада."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BE%D1%84%D0%B8%D1%8F_%D0%91%D0%B0%D0%B2%D0%B0%D1%80%D1%81%D0%BA%D0%B0%D1%8F_(1376%E2%80%941425)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/21/ZofieBav2.jpg","page_title":"София Баварская (1376—1425)","context_page_description":"София Баварская — королева-консорт Чехии, супруга короля Вацлава IV."},{"page_url":"https://cs.wikipedia.org/wiki/Seznam_kulturn%C3%ADch_pam%C3%A1tek_v_okrese_Jind%C5%99ich%C5%AFv_Hradec","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Kapli%C4%8Dka_Ratibo%C5%99.jpg","page_title":"Seznam kulturních památek v okrese Jindřichův Hradec","context_page_description":"Tento seznam nemovitých kulturních památek v okrese Jindřichův Hradec vychází z Ústředního seznamu kulturních památek ČR, který na základě zákona č. 20/1987 Sb., o státní památkové péči, vede Národní památkový ústav jako ústřední organizace státní památkové péče. Údaje jsou průběžně upřesňovány, přesto mohou obsahovat i řadu věcných a formálních chyb a nepřesností či být neaktuální.\\nPokud byly některé části dotčeného území vyčleněny do samostatných seznamů, měly by být odkazy na tyto dílčí seznamy uvedeny v úvodu tohoto seznamu nebo v úvodu příslušné sekce seznamu.\\nSeznam kulturních památek v Cizkrajově včetně částí Dolní Bolíkov, Holešice a Mutná\\nSeznam kulturních památek v Červeném Hrádku\\nSeznam kulturních památek v Českém Rudolci včetně částí Markvarec, Matějovec a Nová Ves\\nSeznam kulturních památek v Dačicích včetně částí Bílkov, Borek, Dolní Němčice, Hradišťko, Chlumec, Lipolec a Malý Pěčín\\nSeznam kulturních památek v Dešné včetně částí Dančovice, Plačovice a Rancířov\\nSeznam kulturních památek v Deštné\\nSeznam kulturních památek v Chlumu u Třeboně včetně částí Lutová, Mirochov a Žíteč"},{"page_url":"https://de.wikipedia.org/wiki/R%C3%BCderswil","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/2016-Ruederswil-Dorf.jpg","page_title":"Rüderswil","context_page_description":"Rüderswil ist eine politische Gemeinde im Verwaltungskreis Emmental des Kantons Bern in der Schweiz.\\nUnter dem Namen existieren eine Einwohnergemeinde sowie eine Kirchgemeinde der Reformierten Kirchen Bern-Jura-Solothurn. Eine Burgergemeinde gibt es nicht."},{"page_url":"https://en.wikipedia.org/wiki/Utuado,_Puerto_Rico","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/UtuadoPuebloFeb2008.jpg","page_title":"Utuado, Puerto Rico","context_page_description":"Utuado is a municipality of Puerto Rico located in the central mountainous region of the island known as La Cordillera Central. It is located north of Adjuntas and Ponce; south of Hatillo and Arecibo; east of Lares; and west of Ciales and Jayuya. In land area it is the third-largest municipality in Puerto Rico. According to the 2000 US Census, the city has a population of 35,336 spread over 24 wards and Utuado Pueblo. The name Utuado derives from the Taíno word Otoao, meaning \\"between mountains\\". The municipality is known as La Ciudad del Viví meaning \\"The City of the Viví\\", derived from the Viví River which runs through Utuado: one river branch comes from Adjuntas and the other from Jayuya. These two rivers then meet near the Fernando L. Ribas Dominicci Avenue and continue the journey to Lago Dos Bocas.\\nUtuado is the main city of the Utuado micropolitan statistical area and is part of the San Juan-Caguas-Fajardo Combined Statistical Area."},{"page_url":"https://eu.wikipedia.org/wiki/Lieucourt","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Lieucourt.JPG","page_title":"Lieucourt","context_page_description":"Lieucourt Frantziako udalerria da, Haute-Saône departamenduan dagoena, Franche-Comté eskualdean. 2013an 74 biztanle zituen."},{"page_url":"https://nl.wikipedia.org/wiki/Weeley_Heath","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/White_Hart_-_geograph.org.uk_-_124757.jpg","page_title":"Weeley Heath","context_page_description":"Weeley Heath is een gehucht in het bestuurlijke gebied Tendring, in het Engelse graafschap Essex. Het maakt deel van de civil parish Weeley."},{"page_url":"https://ja.wikipedia.org/wiki/F-86_(%E6%88%A6%E9%97%98%E6%A9%9F)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Canadair_CL-13B_Sabre_Mk.VI_%E2%80%98U._S._Air_Force_-_FU-472%E2%80%99_%28N3842H%29_%2826095875101%29.jpg","page_title":"F-86 (戦闘機)","context_page_description":"F-86 セイバーは、アメリカ合衆国のノースアメリカン社が開発し、世界各地で運用されたジェット戦闘機。\\n愛称の「セイバー 」は、サーベルの意。CL-13、CA-27、FJ-2、FJ-3については#派生型節を参照。"},{"page_url":"https://hu.wikipedia.org/wiki/Az_%C3%A1llatok_vil%C3%A1ga","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Bezo%C3%A1rkecske.jpg","page_title":"Az állatok világa","context_page_description":"Az állatok világa, Alfred Brehm német természettudós zoológiai témakörű nagy terjedelmű, enciklopedikus munkája, mely először 1863–1869-ben német nyelven jelent meg. Később sok nyelven kiadták, a tudományos ismeretek gazdagodásának megfelelően tartalmát korszerűsítették, bővítették."},{"page_url":"https://en.wikipedia.org/wiki/Star_Ferry","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/HK_Central_Piers_interior_exhibition_of_Star_Ferry_history_1889-1898_1st_Generation_Morning_Star.JPG","page_title":"Star Ferry","context_page_description":"The Star Ferry is a passenger ferry service operator and tourist attraction in Hong Kong. Its principal routes carry passengers across Victoria Harbour, between Hong Kong Island, and Kowloon. The service is operated by the Star Ferry Company, which was founded in 1888 as the Kowloon Ferry Company, and adopted its present name in 1898.\\nWith a fleet of twelve ferries, the company operates two routes across the harbour, carrying over 70,000 passengers per day, or 26 million per year. Even though the harbour is crossed by railway and road tunnels, the Star Ferry continues to provide an inexpensive mode of harbour crossing. The company's main route runs between Central and Tsim Sha Tsui.\\nIt has been rated first in the \\"Top 10 Most Exciting Ferry Rides\\" poll by the Society of American Travel Writers in February 2009."},{"page_url":"https://en.wikipedia.org/wiki/Dwarka_Sector_12_metro_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/20/Dwarka_Sector_12_Metro_Station.jpg","page_title":"Dwarka Sector 12 metro station","context_page_description":"The Dwarka Sector 12 Metro Station is located on the Blue Line of the Delhi Metro."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A1%E3%83%B3%E3%83%95%E3%82%A3%E3%82%B9%E3%83%BB%E3%83%99%E3%83%AB_(1990%E5%B9%B4%E3%81%AE%E6%98%A0%E7%94%BB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/Memphis_Belle_crew.jpg","page_title":"メンフィス・ベル (1990年の映画)","context_page_description":"『メンフィス・ベル』は、1990年制作のイギリス映画。マイケル・ケイトン＝ジョーンズ監督。\\n第二次世界大戦中、イギリスに駐留しドイツに対する昼間爆撃を任務としていたアメリカ第8空軍所属の爆撃機B-17F、愛称\\"メンフィス・ベル\\"の若き乗組員たちを描いた作品。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A5%D8%B9%D8%B5%D8%A7%D8%B1_%D9%84%D9%8A%D8%B3%D9%84%D9%8A_(2018)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Leslie_2018-10-11_1515Z.jpg","page_title":"إعصار ليسلي (2018)","context_page_description":"إعصار ليسلي كان هو الإعصار الاستوائي الأقوى الذي يضربُ شبهَ الجزيرةِ الإيبيرية منذُ العام 1842. كان ليسلي عنيفاً، طويلَ الأمدِ، وغيرَ منتظمٍ أيضا. يُعتبر ليسلي هو العاصفة الثانية عشرة من بينِ العواصفِ وسادس إعصار في موسمِ أعاصير المحيط الأطلسي للعام 2018, حيثُ كانت هذه العاصفة غيرُ استوائية المنشأ، من ثَمَ تعاظمت بواسطةِ نظام الضغط المنخفض والكبير فوق المُحيطِ الأطلسي الشمالي في الثاني والعشرين من سبتمبر، حيثُ أن ذلكَ الانخفاض أكسبَ هذا الإعصار .. بسرعة..خصائصِ العواصفِ الشبه استوائية، وكان سبباً في تصنيفها ضمن العواصف الفرعية لاحقاً .. فقد انحرفت العاصفة فوقَ شمالِ المحيط الأطلسي وضَعُفت تدريجياً، وذلك قبل اندماجها أمامياً في 25 أيلول / سبتمبر، ثم تركزت لاحقاً على نحوٍ شديدِ الانخفاضِ من قوةِ الإعصارِ فوقَ شمالِ المحيط الأطلسي."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Gelves","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c1/Puerto_Deportivo_de_Gelves.jpg","page_title":"Gelves","context_page_description":"Gelves sī tī Se-pan-gâ Andalucía siā-lí Sevilla séng ê chi̍t ê municipio."},{"page_url":"https://az.wikipedia.org/wiki/%C5%9Eah_%C4%B0smay%C4%B1l_X%C9%99tai_metrostansiyas%C4%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/%C4%B0lham_%C6%8Fliyev_Bak%C4%B1_Metropoliteninin_%E2%80%9CX%C9%99tai%E2%80%9D_stansiyas%C4%B1nda_g%C3%B6r%C3%BCl%C9%99n_i%C5%9Fl%C9%99rl%C9%99_tan%C4%B1%C5%9F_olub.jpg","page_title":"Şah İsmayıl Xətai metrostansiyası","context_page_description":"Şah İsmayıl Xətai metrostansiyası — Bakı Metropolitenində stansiyadır. 1968-ci il 22 fevral tarixində fəaliyyətə başlayıb. Bakı Metropoliteninin ən dərin stansiyasıdır. Buradan qatarlar yalnız Cəfər Cabbarlı stansiyasına hərəkət edir. Gələcəkdə Yaşıl xəttin tamamlanması nəticəsində bu stansiya Dərnəgül stansiyasına birləşdiriləcək."},{"page_url":"https://en.wikipedia.org/wiki/Jesse_James","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a7/Jesse_James.jpg","page_title":"Jesse James","context_page_description":"Jesse Woodson James was an American outlaw, bank and train robber, guerrilla, and leader of the James–Younger Gang. Raised in the \\"Little Dixie\\" area of western Missouri, James and his family maintained strong Southern sympathies. He and his brother Frank James joined pro-Confederate guerrillas known as \\"bushwhackers\\" operating in Missouri and Kansas during the American Civil War. As followers of William Quantrill and \\"Bloody Bill\\" Anderson, they were accused of committing atrocities against Union soldiers and civilian abolitionists, including the Centralia Massacre in 1864.\\nAfter the war, as members of various gangs of outlaws, Jesse and Frank robbed banks, stagecoaches, and trains across the Midwest, gaining national fame and often popular sympathy despite the brutality of their crimes. The James brothers were most active as members of their own gang from about 1866 until 1876, when as a result of their attempted robbery of a bank in Northfield, Minnesota, several members of the gang were captured or killed. They continued in crime for several years afterward, recruiting new members, but came under increasing pressure from law enforcement seeking to bring them to justice."},{"page_url":"https://fr.wikipedia.org/wiki/Madoryx_oiclus","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Madoryx_oiclus_MHNT_CUT_2010_0_37_Santa_Caterina_Brasil_male_ventral.jpg","page_title":"Madoryx oiclus","context_page_description":"Madoryx oiclus est une espèce d'insectes lépidoptères de la famille des Sphingidae, de la sous-famille des Macroglossinae, de la tribu des Dilophonotini et du genre Madoryx."},{"page_url":"https://en.wikipedia.org/wiki/LaserDisc_player","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/86/Magnavox_Laserdisc_player.jpg","page_title":"LaserDisc player","context_page_description":"A LaserDisc player is a device designed to play video and audio stored on LaserDisc. LaserDisc was the first optical disc format marketed to consumers; it was introduced by MCA DiscoVision in 1978.\\nFrom 1978 until 1984, all LaserDisc player models read discs by using a helium–neon laser. In 1984, Pioneer Corporation introduced the first consumer player with a solid-state laser diode. This model, the Pioneer LD-700, was also the first LaserDisc player with a front-loading disc bay instead of a top-loading one. Pioneer became the market leader in LaserDisc technology.\\nIn the 1990s, Pioneer and others produced a small number of a high-definition video player models, which employed multiple sub-Nyquist sampling encoding technology.\\nIn 1996, Pioneer distributed their first DVD player in Japan, a combination Laserdisc/DVD player, model DVL-9.\\nPioneer announced the end of LaserDisc player production in January 2009. The last models Pioneer produced were the DVL-919, CLD-R5, DVK-900, and DVL-K88."},{"page_url":"https://fr.wikipedia.org/wiki/Site_d%27essais_du_Nevada","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Nevada_Test_Site_craters.jpg","page_title":"Site d'essais du Nevada","context_page_description":"Le site d'essais du Nevada, renommé depuis août 2010 site de sécurité nationale du Nevada NNSS, est une région des États-Unis dépendant du Département de l'Énergie des États-Unis ayant servi de 1951 à 1992 pour 928 essais nucléaires, le record mondial d'essais nucléaires sur un même site.\\nD'une superficie de 3 500 km², il se situe dans le Comté de Nye au Nevada. Il est divisé en 30 zones de test.\\nLa plupart des images emblématiques d'essais nucléaires ont été prises sur le site. Les impacts des essais sont nettement visibles au moyen du logiciel Google Earth, de plus les dates, la puissance et le nom des essais sont mentionnés pour chacun."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Ebern","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Ebern%2C_Hetschingsm%C3%BChle-001.jpg","page_title":"Liste der Baudenkmäler in Ebern","context_page_description":"Auf dieser Seite sind die Baudenkmäler der unterfränkischen Stadt Ebern zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 16. April 2020 wieder und enthält 169 Baudenkmäler."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_geboren_in_1962","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Flickr_-_Government_Press_Office_%28GPO%29_-_Shahar_Perkiss.jpg","page_title":"Lijst van personen geboren in 1962","context_page_description":"Dit is een lijst van personen die geboren zijn in 1962.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://nl.wikipedia.org/wiki/Pantolabus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Fringefin_trevally.jpeg","page_title":"Pantolabus","context_page_description":"Pantolabus is een monotypisch geslacht van straalvinnige vissen uit de familie van horsmakrelen."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%9B%BD%E4%BC%9A%E5%A4%A7%E5%8E%A6_(%E5%93%88%E7%93%A6%E9%82%A3)","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/El_Capitolio_de_La_Habana.jpg","page_title":"国会大厦 (哈瓦那)","context_page_description":"国会大厦是古巴哈瓦那的一座新古典主义建筑，风格类似美国华盛顿的美国国会大厦。1929年5月20日建成开幕，为当时哈瓦那最高建筑。建成后为古巴众参两院所在地。1959年古巴革命后改为古巴科学院所在地。2018年后又改为古巴人民代表大会所在地。\\n该建筑内有世界第三大室内雕塑La Estatua de la República。"},{"page_url":"https://pl.wikipedia.org/wiki/Magdel%C3%ADn_Mart%C3%ADnez","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/81/Rovereto_2010.jpg","page_title":"Magdelín Martínez","context_page_description":"Magdelín Martínez – włoska lekkoatletka pochodzenia kubańskiego specjalizująca się w trójskoku, brązowa medalistka mistrzostw świata w Paryżu w 2003 roku. W 2005 roku na Halowych Mistrzostwach Europy rozegranych w Madrycie zdobyła srebrny medal."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A1%D0%B0%D0%B4%D1%8B_%D0%A8%D0%B0%D0%BB%D1%96%D0%BC%D0%B0%D1%80%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2f/Shalamar_Garden_July_14_2005-South_wall_pavilion_with_fountains.jpg","page_title":"Сады Шалімара","context_page_description":"Сады Шалімара — аб'ект Сусветнай спадчыны ЮНЕСКА, які быў пабудаваны імператарам Вялікіх Маголаў, Шах-Джаханам, у Лахоры. Будаўніцтва пачалося ў 1641 годзе нашай эры і было завершана ўжо ў наступным годзе. У форце прысутнічаюць мармуровыя палацы і мячэці, упрыгожаныя мазаікай і пазалотай. Сады пабудаваны на трох тэрасах з ложам, ёсць таксама вадаспады і вялікія дэкаратыўныя сажалкі."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%BC%A0%E8%99%B9_(%E8%BF%90%E5%8A%A8%E5%91%98)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/2013_WSDC_Sochi_-_Hong_Zhang.JPG","page_title":"张虹 (运动员)","context_page_description":"张虹，出生于中国黑龙江省，是速度滑冰运动员。她最初是学习短道速滑，后改为速度滑冰。2011年，她在亚洲锦标赛取得两面铜牌。2013年，她在同一赛事获得一金一银。2014年，她在世界速度滑冰短距离锦标赛得亚军。同年，她获得参与冬季奥运会的资格。在500米决赛中，她以0.1秒之差无缘奖牌，排名第4。而在其后进行的女子1000米赢得金牌，这是中国自参与冬季奥运会以后第一个的速度滑冰冠军。\\n2018年2月25日，经国际奥委会主席巴赫提名，张虹当选为国际奥委会运动员委员会委员。"},{"page_url":"https://it.wikipedia.org/wiki/Phyllis_Francis","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/FrancisRio2016.jpg","page_title":"Phyllis Francis","context_page_description":"Phyllis Chanez Francis è una velocista statunitense, specializzata nei 400 metri piani, disciplina di cui è stata campionessa mondiale a Londra 2017."},{"page_url":"https://be.wikipedia.org/wiki/%D0%A5%D0%B0%D1%80%D0%BA%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a3/Estonia_relief_map_%282005-2017%29.png","page_title":"Харку","context_page_description":"Возера Харку знаходзіцца на захадзе Таліна, у раёне Хааберсці, у 3 км ад мора. Плошча возера — 1,638 км², глыбіня да 2,5 метраў.\\nДа нашай эры на месцы возера Харку было Балтыйскае мора, але ў сувязі з пад'ёмам зямной паверхні мора адступіла, і ўтварылася возера. Вада ў возеры багатая кіслародам, на дне возера двух-трохметровы слой глею. Возера Харку прыцягвае рыбакоў, бо ў возеры водзіцца лешч, плотка, акунь, шчупак, лінь і іншыя віды рыб. Возера таксама прыцягвае аматараў купання і заняцця водным спортам. Калі возера пакрыта тоўстым слоем лёду, людзі прыходзяць сюды катацца на каньках ці лавіць рыбу."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%AA%A8%EC%8A%A4%ED%81%AC%EB%B0%94%EC%9D%98_%EB%A7%88%EC%B2%9C%EB%A3%A8_%EB%AA%A9%EB%A1%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/%D0%91%D0%B8%D0%B7%D0%BD%D0%B5%D1%81-%D1%86%D0%B5%D0%BD%D1%82%D1%80_Nordstar_Tower.jpg","page_title":"모스크바의 마천루 목록","context_page_description":"모스크바의 마천루 목록에는 높이가 100미터 이상인 건물이 포함되어 있다.\\n건물 아래에 있는 건물은 규칙적인 간격으로 레벨로 나누어진 건물이나 사람들의 체류를 목적으로 하는 건물을 의미한다. 급수탑, 돛대, 굴뚝 및 기타 기술 건물은 구조이므로이 범주에 속하지 않는다). 건물의 이름에 «타워»라는 단어가 있는 경우 비유적 의미로 사용된다."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%A7%D8%AD%D9%85%D8%AF_%D8%B4%D8%A7%DB%81_%D8%A7%D9%88%D9%84","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/fe/Jama_Masjid%2C_Ahmedabad_02.jpg","page_title":"احمد شاہ اول","context_page_description":"مظفر شاہ اولاحمد شاہ اول\\nاحمد شاہ اول، مظفری خاندان کا حکمران تھا، جس نے سن 1411 میں اپنی موت تک 1411 سے گجرات سلطنت پر حکومت کی۔ اس نے 1411 میں احمد آباد شہر کی بنیاد رکھی۔"},{"page_url":"https://pt.wikipedia.org/wiki/Fam%C3%ADlia_Cal%C3%A9rges","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Kallergis_Brothers_flag.svg","page_title":"Família Calérges","context_page_description":"A família Calérges foi uma família cretense dita como descendente do imperador bizantino Nicéforo II Focas e foram, em certo porto, governantes de Creta."},{"page_url":"https://fr.wikipedia.org/wiki/Caf%C3%A9_Brant_de_Strasbourg","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9a/Strasbourg_11_place_de_l%27Universit%C3%A9_f%C3%A9vrier_2015-1.jpg","page_title":"Café Brant de Strasbourg","context_page_description":"Le café Brant est un monument historique situé à Strasbourg, dans le département français du Bas-Rhin. Comme la place, il doit son nom à l'humaniste de la Renaissance, Sébastien Brant."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_fara%C3%B3s","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/af/Payankh_stele_Mariette.jpg","page_title":"Lista de faraós","context_page_description":"A palavra Faraó vem da versão grega da Bíblia, onde aparece sob a forma pharâo. Esta palavra grega deriva por sua vez da expressão egípcia per-aá, \\"a grande casa\\", que se referia ao palácio real, sede do poder. Os antigos Egípcios não usaram per-aá para se referirem ao soberano durante a maior parte da sua história, usando em vez disso termos como nesu ou neb. Contudo, a tradição consagrou o uso da palavra faraó para se referir aos reis do Antigo Egito.\\nEsta é uma lista de faraós organizada cronologicamente e por dinastias, oriunda de diversas fontes e sujeita a discussão, sobretudo no que diz respeito aos períodos históricos mais obscuros. Não existe uma concordância em torno da cronologia correspondente a cada reinado pelo que se optou por apresentar diferentes datas propostas por diversos especialistas."},{"page_url":"https://vi.wikipedia.org/wiki/S%E1%BB%B1_ti%E1%BA%BFn_h%C3%B3a_l%C3%A3nh_th%E1%BB%95_c%E1%BB%A7a_Hoa_K%E1%BB%B3","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/61/United_States_1824-1828.png","page_title":"Sự tiến hóa lãnh thổ của Hoa Kỳ","context_page_description":"Đây là danh sách liệt kê về Sự tiến hóa biên cương của Hoa Kỳ. Danh sách này liệt kê mọi sự thay đổi về biên cương của Hoa Kỳ cũng như sự thay đổi về tên và tình trạng chính trị. Danh sách này cũng biểu thị các khu vực xung quanh mà sau đó dần dần trở thành một phần lãnh thổ của Hoa Kỳ. Mỗi giai đoạn có một bản đồ để biểu thị những thành phần chi tiết nào hình thành nên Hoa Kỳ trong một thời gian nhất định nào đó.\\nSau khi giành được độc lập bằng Hiệp định Paris năm 1783, Hoa Kỳ bành trướng lãnh thổ của mình về phía tây, mở rộng biên cương 7 lần trong đó có 2 lần điều chỉnh biên cương lớn, 1 lần với các thuộc địa của Vương quốc Anh, 1 lần với các thuộc địa của Tây Ban Nha và một số tranh chấp nhỏ. 13 thuộc địa ban đầu phát triển thành 50 tiểu bang, đa số các tiểu bang khởi nguồn từ các lãnh thổ hợp nhất. Mô hình tổng quát được thấy trong danh sách này là từ sự mở rộng lãnh thổ, lập ra các lãnh tổ có tổ chức từ những vùng đất mới thu được, chiếm được, hay mua được, điều chỉnh ranh giới của các lãnh thổ này, và sau đó cho phép chúng gia nhập liên bang để trở thành tiểu bang. Chỉ có hai tiểu bang là Nevada và Missouri phát triển đáng kể sau khi trở thành tiểu bang."},{"page_url":"https://sv.wikipedia.org/wiki/Hochplettspitz","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/H%C3%B6henzug_%E2%80%9EHochplett%E2%80%9C.JPG","page_title":"Hochplettspitz","context_page_description":"Hochplettspitz är ett berg i Österrike. Det ligger i distriktet Politischer Bezirk Vöcklabruck och förbundslandet Oberösterreich, i den centrala delen av landet, 220 km väster om huvudstaden Wien. Toppen på Hochplettspitz är 1 134 meter över havet.\\nTerrängen runt Hochplettspitz är kuperad åt nordväst, men åt sydost är den bergig. Den högsta punkten i närheten är Schafberg, 1 782 meter över havet, 5,7 km sydväst om Hochplettspitz. Närmaste större samhälle är Bad Ischl, 16,6 km sydost om Hochplettspitz.\\nI omgivningarna runt Hochplettspitz växer i huvudsak blandskog. Runt Hochplettspitz är det ganska tätbefolkat, med 72 invånare per kvadratkilometer. Trakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 7 °C. Den varmaste månaden är juli, då medeltemperaturen är 18 °C, och den kallaste är december, med -6 °C. Genomsnittlig årsnederbörd är 1 801 millimeter. Den regnigaste månaden är augusti, med i genomsnitt 213 mm nederbörd, och den torraste är mars, med 89 mm nederbörd."},{"page_url":"https://en.wikipedia.org/wiki/Culture_in_Stockholm","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/96/Stockholms-stadsbibliotek-2003-04-14.jpg","page_title":"Culture in Stockholm","context_page_description":"Apart from being a large city with an active cultural life, Stockholm, the capital of Sweden, houses many national cultural institutions. There are two UNESCO World Heritage sites in the Stockholm County area: the Royal Palace Drottningholm and the Skogskyrkogården.\\nStockholm was the 1998 European City of Culture."},{"page_url":"https://fr.wikipedia.org/wiki/Miaouss_et_ses_%C3%A9volutions","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/78/Maneki_neko_586.jpg","page_title":"Miaouss et ses évolutions","context_page_description":"Miaouss et son évolution, Persian, sont deux espèces de Pokémon de première génération. Berserkatt est un Pokémon de la huitième génération exclusive à la région de Galar.\\nIssus de la célèbre franchise de médias créée par Satoshi Tajiri, ils apparaissent dans une collection de jeux vidéo et de cartes, dans une série d'animation, plusieurs films, et d'autres produits dérivés, ils sont imaginés par l'équipe de Game Freak et dessinés par Ken Sugimori. Leur première apparition a lieu au Japon en 1996, dans le jeu vidéo Pokémon Vert exclusivement. Ces deux Pokémon sont tous du type normal et occupent respectivement les 52ᵉ et 53ᵉ emplacements du Pokédex, l'encyclopédie fictive recensant les différentes espèces de Pokémon.\\nBerserkatt est de type acier et il est le 863ᵉ du Pokédex.\\nComme Pikachu, Miaouss est un des personnages principaux de la série télévisée Pokémon et apparaît dans la quasi-totalité des épisodes."},{"page_url":"https://nl.wikipedia.org/wiki/Hilara","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/Hilara_litorea.jpg","page_title":"Hilara","context_page_description":"Hilara is een geslacht van vliegen uit de familie van de dansvliegen."},{"page_url":"https://no.wikipedia.org/wiki/Godesberg-programmet","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/SPD_Plakat_Godesberger_Programm_1959.jpg","page_title":"Godesberg-programmet","context_page_description":"Godesberg-programmet er navnet på SPDs partiprogram mellom 1959 og 1989. Det ble vedtatt med 324 stemmer for og 16 mot på en ekstraordinær partikongress den 15. november 1959 i Bad Godesberg, som i dag er en bydel i Bonn.\\nProgrammet markerte omdannelsen av SPD fra et sosialistisk arbeiderparti til et pragmatisk folkeparti.\\nProgrammets grunnprinsipper er fremdeles bestemmende for SPD, selv om programmet i 1989 ble avløst av Berlin-programmet. Godesberg-programmets forløper var Heidelberg-programmet fra 1925, som likevel ble betydelig modifisert allerede gjennom de politiske grunnprinsippene SPD vedtok i 1946.\\nProgrammet var preget av liberal-demokratiske grunnprinsipper, og SPD tok avstand fra marxistiske begreper som klassekamp og fra idéer om planøkonomi. Partiet slo fast at det stod for sosial markedsøkonomi, rettsstat og «menneskers frie utfoldelse»."},{"page_url":"https://ka.wikipedia.org/wiki/%E1%83%9D%E1%83%91%E1%83%95%E1%83%90%E1%83%9A%E1%83%93%E1%83%94%E1%83%9C%E1%83%98%E1%83%A1_%E1%83%99%E1%83%90%E1%83%9C%E1%83%A2%E1%83%9D%E1%83%9C%E1%83%98","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Sarnen-See.jpg","page_title":"ობვალდენის კანტონი","context_page_description":"ობვალდენი — კანტონი შვეიცარიაში. მდებარეობს ქვეყნის ცენტრალურ ნაწილში. დედაქალაქია ზარნენი. მოიცავს შვეიცარიის გეოგრაფიულ ცენტრს. 2010 წლის მონაცემებით, მოსახლეობა 35 585 ადამიანს შეადგენს, რომლის ძირითადი ნაძილი გერმანულენოვანია.\\nმეზობელ ნიდვალდენის კანტონთან ერთად ობვალდენი შვეიცარიის კონფედერაციას 1291 წელს შეუერთდა.\\nკანტონის ფართობი 490,5 კმ²-ია, რომლის 40,2% ტყითაა დაფარული. უმაღლესი წერტილია ურნერის ალპებში მდებარე მწვერვალი ტიტლისი.\\nშვეიცარიის კონფედერაციაში ობვალდენს ნახევრად კანტონის სტატუსი აქვს, რაც იმას ნიშნავს, რომ სრული კანტონის ყველა უფლება და მოვალეობა აქვს, მაგრამ შვეიცარიის ეროვნულ საბჭოში მხოლოდ ერთი დეპუტატის წარგზავნის უფლება გააჩნია.\\nკანტონის ეკონომიკაში დომინირებს პატარა და საშუალო ზომის ბიზნესი. ბევრი მათგანი სპეციალიზდება მინიატურულ ძრავებზე, ხელოვნურ ბოჭკოზე, სამედიცინო აღჭურვილობასა და ნანოტექნოლოგიებზე. ასევე მნიშვნელოვანია მეტყევეობა, მასთან დაკავშირებული ბიზნესი და სოფლის მეურნეობა.\\nთუმცა, ეკონომიკის მთავარი დარგია ტურიზმი, რაც უპირველესად განპირობებულია შვეიცარიის ალპებში ცენტრალური მდებარეობით."},{"page_url":"https://fi.wikipedia.org/wiki/R%C3%ADo_de_las_Vueltas","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/ElChalten1.jpg","page_title":"Río de las Vueltas","context_page_description":"Río de las Vueltas on Argentiinan Patagoniassa, Los Glaciaresin kansallispuiston alueella sijaitseva joki. Se laskee Laguna del Desierto -järvestä kohti etelämpänä sijaitsevaa suurta Lago Viedma -järveä. Joen varrella sijaitsee El Chalténin kylä."},{"page_url":"https://fr.wikipedia.org/wiki/Grotte_des_Trois-Visiteurs","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c4/Sanyoudong2.jpg","page_title":"Grotte des Trois-Visiteurs","context_page_description":"La grotte des Trois-Visiteurs est une grotte située sur la rive gauche du Yangzi Jiang, sur le territoire de la ville-préfecture de Yichang, province de Hubei en République populaire de Chine.\\nElle tient son nom de trois poètes célèbres ayant visité les lieux Bai Juyi 、Bai Xingjian et Yuan Zhen et ayant inscrit des poèmes sur les parois de la grotte."},{"page_url":"https://mg.wikipedia.org/wiki/Ingvild_Stensland","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/Ingvild_Stensland.jpg","page_title":"Ingvild Stensland","context_page_description":"Ingvild Stensland dia mpilalao baolina kitra mizaka ny zom-pirenen'i Norvezy teraka ny 3 Aogositra 1981"},{"page_url":"https://zh.wikipedia.org/zh-tw/Taew","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cd/Nattaporn_Tameeruks.png","page_title":"Taew","context_page_description":"道Taew，是一個泰國藝人。"},{"page_url":"https://es.wikipedia.org/wiki/Pueblo_Espa%C3%B1ol_de_Barcelona","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Poble_Espanyol_-_Monestir_de_Sant_Miquel.jpg","page_title":"Pueblo Español de Barcelona","context_page_description":"El Pueblo Español es un museo arquitectónico al aire libre ubicado en la montaña de Montjuic en la ciudad de Barcelona, a pocos metros de las Fuentes Mágicas de Montjuic. Es un museo que ofrece arte contemporáneo, arquitectura, artesanía y gastronomía.\\nEl recinto está integrado por 117 edificios a escala real, que componen un pueblo típicamente español con sus calles, casas, plazas, teatro, escuela, restaurantes y talleres artesanos."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%BB%84%E5%86%88%E5%B8%82%E4%BA%BA%E6%B0%91%E6%94%BF%E5%BA%9C","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/View_of_Huanggang_City_Office.jpg","page_title":"黄冈市人民政府","context_page_description":"黃岡市人民政府，是中華人民共和國湖北省黃岡市的行政管理機關。"},{"page_url":"https://sr.wikipedia.org/wiki/%D0%94%D0%B2%D0%BE%D0%B3%D0%BE%D0%B4%D0%B8%D1%88%D1%9A%D0%B0_%D0%B1%D0%B8%D1%99%D0%BA%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Erysimum_cheiri_%28L.%29_Crantz%2C_biennial_plant.jpg","page_title":"Двогодишња биљка","context_page_description":"Према дужини живота зељасте биљке се деле на: једногодишње, двогодишње и вишегодишње, док су дрвенасте искључиво вишегодишње.\\nКод двогодишњих биљака вегетативни органи: корен и изданци са листовима развијају се током једне вегетације, биљке презиме, а наредне вегетације цветају и формирају плод. Означавају се кругом са две тачке распоређене хоризонтално. Ова група је прилагођена зимским условима тако да не може да цвета и формира плод док не прође кроз период ниских температура – период јаровизације, мада има и оних које цветају пре зимског периода као што је дан и ноћ.\\nПоред ових „правих“ двогодишњих биљака једна група једногодишњих може успешно да презими у јувенилном облику, и при касној сетви развије цветове у рано пролеће, што је одлика двогодишњих биљака. Ако се оне посеју у рано пролеће формирају цвет и плод до краја вегетације. Са друге стране двогодишње лиснодекоративне биљке, као украсни купус, користе се у првој вегетацији због декоративног листа, а не у другој када формирају неугледне цветове.\\nЈедногодишње и двогодишње украсне биљке се једним именом зову и сезонске јер се међусобно смењују на истој површини."},{"page_url":"https://en.wikipedia.org/wiki/Grimoire","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Sixthandseventhbooks_frontpiece_1880.png","page_title":"Grimoire","context_page_description":"A grimoire is a textbook of magic, typically including instructions on how to create magical objects like talismans and amulets, how to perform magical spells, charms and divination, and how to summon or invoke supernatural entities such as angels, spirits, deities and demons. In many cases, the books themselves are believed to be imbued with magical powers, although in many cultures, other sacred texts that are not grimoires have been believed to have supernatural properties intrinsically. The only contents found in a grimoire would be information on spells, rituals, the preparation of magical tools, and lists of ingredients and their magical correspondence. In this manner, while all books on magic could be thought of as grimoires, not all magical books should be thought of as grimoires.\\nWhile the term grimoire is originally European and many Europeans throughout history, particularly ceremonial magicians and cunning folk, have used grimoires, the historian Owen Davies noted that similar books can be found all across the world, ranging from Jamaica to Sumatra. He also noted that in this sense, the world's first grimoires were created in Europe and the Ancient Near East."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%B9%D0%B4%D0%B7%D1%83%D0%B1%D0%B0%D0%BD%D0%B3%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Aizubange_town_office.jpg","page_title":"Айдзубанге","context_page_description":"Айдзубанге — посёлок в Японии, находящийся в уезде Каванума префектуры Фукусима. Площадь посёлка составляет 91,65 км², население — 16 473 человека, плотность населения — 179,74 чел./км²."},{"page_url":"https://da.wikipedia.org/wiki/Teested","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Teeing_off_at_the_14th_hole_at_The_Woll_golf_course_near_Ashkirk_-_geograph.org.uk_-_235759.jpg","page_title":"Teested","context_page_description":"Teestedet i golf er startpositionen for det enkelte hul, hvor golfspilleren placerer sin bold på en lille pløk, den såkaldte tee. Hvis bolden går direkte i hul i første slag, kaldes det hole-in-one.\\nEt Teested omfatter et rektangulært areal i en dybde af to køllelængder målt fra frontlinien. Frontlinien og sidderne afgrænses af ydersiderne at to teestedsmarkeringer."},{"page_url":"https://it.wikipedia.org/wiki/Canapville_(Calvados)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Manoir_des_%C3%89v%C3%AAques_de_Lisieux.jpg","page_title":"Canapville (Calvados)","context_page_description":"Canapville è un comune francese di 231 abitanti situato nel dipartimento del Calvados nella regione della Normandia."},{"page_url":"https://az.wikipedia.org/wiki/Ritsu_Doan","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Ritsu_Doan%2C_2019_AFC_Asian_Cup_1.jpg","page_title":"Ritsu Doan","context_page_description":"Ritsu Doan — Yaponiyalı futbolçu. Hal-hazırda Cey Liqa Diviziya 1 təmsilçilərindən olan Qamba Osaka klubunda yarımmüdafiəçi kimi çıxış edir."},{"page_url":"https://de.wikipedia.org/wiki/Platen_(pommersches_Adelsgeschlecht)","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/15/August_von_Platen_by_Moritz_Rugendas.jpg","page_title":"Platen (pommersches Adelsgeschlecht)","context_page_description":"Die Herren und Grafen von Platen sind ein altes pommersches Adelsgeschlecht von Rügen, das 1252 erstmals urkundlich mit dominus Otto, advocatus, Vogt des Fürsten Jaromar II. von Rügen erscheint, der 1255 auch als Otto cum plata erwähnt wird. Die Stammreihe beginnt um 1396 mit Hennig von Platen.\\nVerschiedene Linien bestehen bis heute. Die ältere Linie ist in Schweden ansässig; es gibt auch einen dänischen Zweig.\\nDie jüngere Linie, die Grafen von Platen-Hallermund, wurde 1689 in den Reichsgrafenstand erhoben, erwarb 1704 die Grafschaft Hallermund und zählte daher seit 1709 zum Hohen Adel. Sie trägt den Namen Platen, ist aber tatsächlich eine Bastardlinie des Welfenhauses.\\nDie Familie von Platen ist nicht zu verwechseln mit der mit ihr nicht verwandten Familie von Platen anderen Wappens."},{"page_url":"https://de.wikipedia.org/wiki/1532","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Transylvania1532Map.jpg","page_title":"1532","context_page_description":"Im Januar wird der Bremer Rat gezwungen, den bisherigen Bürgerweideausschuss von 40 auf 104 gewählte Männer, jeweils 26 Vertreter aus jedem der vier Kirchspiele, zu erweitern. Der Rat der 104 gilt als die erste Bürgerschaft in Bremen.\\n15. April: Der Tiroler Bauernführer Michael Gaismair wird auf seinem Anwesen in Padua von gedungenen Mördern überfallen und erstochen.\\n23. Juli: Kaiser Karl V. und die Protestanten vereinbaren im Nürnberger Religionsfrieden zum ersten Mal eine gegenseitige Rechts- und Friedensgarantie für die gegenwärtigen „konfessionellen Besitzstände“.\\n27. Juli: Auf dem Reichstag zu Regensburg erlässt Kaiser Karl V. mit der Constitutio Criminalis Carolina das erste Strafgesetz mit einer Strafprozessordnung in Deutschland. Basis des Gesetzes ist die 1507 unter Leitung von Johann Freiherr von Schwarzenberg verfasste Bambergische Peinliche Halsgerichtsordnung.\\n16. August: Nach dem Tod von Johann dem Beständigen wird sein Sohn Johann Friedrich I. Kurfürst von Sachsen.\\n2. Dezember: Nachdem der Aufstand der 104 Männer in Bremen an der Uneinigkeit in der Stadt gescheitert ist, werden die wichtigsten Repräsentanten der 104 hingerichtet.\\n13."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_clochers-murs_de_l%27Allier","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/La_Chapelle-aux-Chasses.jpg","page_title":"Liste des clochers-murs de l'Allier","context_page_description":"Cet article recense les édifices religieux de l'Allier, en France, munis d'un clocher-mur."},{"page_url":"https://pl.wikipedia.org/wiki/Babka_(ro%C5%9Blina)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Plantago_arenaria_%28habitus%29.jpg","page_title":"Babka (roślina)","context_page_description":"Babka – rodzaj roślin z rodziny babkowatych. Obejmuje około 200–270 gatunków. Występują one na całym świecie. Rośliny te zasiedlają siedliska otwarte, bezdrzewne przystosowane są do wiatropylności"},{"page_url":"https://fr.wikipedia.org/wiki/Argentine","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e4/Pampas.jpg","page_title":"Argentine","context_page_description":"L’Argentine, en forme longue la République argentine, est un pays d’Amérique du Sud partageant ses frontières avec le Chili à l’ouest, la Bolivie et le Paraguay au nord, le Brésil et l’Uruguay au nord-est, enfin l’océan Atlantique à l'est et au sud. Son territoire américain continental couvre une grande partie du Cône Sud.\\nLe 25 mai 1810, lors de la révolution de Mai, le pays n'accepte plus d'être gouverné par un vice-roi et crée un gouvernement local qui jure allégeance au roi d'Espagne. L'indépendance vis à vis de l'Espagne est définitivement déclaréee le 9 juillet 1816 lors du Congrès de Tucumán.\\nLa capitale est Buenos Aires, la langue prédominante est l'espagnol dans sa variante rioplatense et la monnaie est le peso argentin. D'une superficie de 2 791 810 km², l'Argentine a une densité de population de 16 habitants par km².\\nLa religion nationale est le catholicisme.\\nL'Argentine fait partie des pays dits du Cône Sud et parmi les pays d'Amérique latine, il est avec l'Uruguay et le Chili celui où la culture européenne est la plus affirmée. L'Argentine est l'un des pays les plus développés du continent latino-américain."},{"page_url":"https://lmo.wikipedia.org/wiki/Titano_(corp_celest)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/Huygens_surface_color.jpg","page_title":"Titano (corp celest)","context_page_description":"Titano l'è la piö grànda de le lüne del pianeta Saturno e l'è giü dei còrp ruciùs piö masés de töt el Sistema Solar; el pàsa fò en dimensiù el pianeta Mercurio, e l'è el segónt piö grant entra i satèliti natürài dei pianeti del nòst sistéma solar, sorpasàt apéna de Ganimede, la piö grànde de le lüne de Giove.\\nTitano l'è stat scuprìt del astrònomo olandés Christian Huygens endel 1655, alùra l'ìa stàda la prìma de le lüne de Saturno a éser scuprìda e la quinta de töt el Sistema Solar.\\nL'è l'ünich satèlite del sistema solar a ìga 'na atmosféra en pó spèsa.\\nL'è furmàt perlopiö de gias de àiva e material ruciùs. Del spès che l'è la sò atmosféra l'è mìa stat pusìbol oservà la sò superfìce enfìna a che gh'è stat mandàt la sónda spasiàla Cassini-Huygens endel 2004, co la quàla l'è stat pusìbol adiritüra fà aterà en lander sö la sò superfìce.\\nL'esplorasiù de la sonda Cassini-Huygens la g'ha minàt a scuprì dei lach de idrocarbùri lìquicc endèle regiù polàre del satèlite. Del pónt de vìsta geològich la superfìce l'è zùina; gh'è dei mucc e fórse dei criovulcani, ma l'è perlopiö piàta e lìza con póch crater de 'mpàt."},{"page_url":"https://he.wikipedia.org/wiki/%D7%99%D7%97%D7%A1%D7%99_%D7%90%D7%95%D7%A1%D7%98%D7%A8%D7%99%D7%94%E2%80%93%D7%95%D7%99%D7%99%D7%98%D7%A0%D7%90%D7%9D","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Austrian_embassy_and_Monaco_consulate_in_Hanoi.jpg","page_title":"יחסי אוסטריה–וייטנאם","context_page_description":"יחסי אוסטריה-וייטנאם הם יחסי החוץ בין אוסטריה לווייטנאם. יחסים דיפלומטיים כוננו בשנת 1972."},{"page_url":"https://it.wikipedia.org/wiki/Jesse_Winchester","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ac/Jesse_Winchester_Smile_JazzFest_2011.jpg","page_title":"Jesse Winchester","context_page_description":"James Ridout \\"Jesse\\" Winchester è stato un cantautore e musicista statunitense."},{"page_url":"https://pl.wikipedia.org/wiki/Pofajdok","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Pofajdok_obie%C5%BCy%C5%9Bwiat.jpg","page_title":"Pofajdok","context_page_description":"Pofajdok – ludowa, potoczna nazwa używana na Warmii i Mazurach, oznaczająca młodzieńca o nieodpowiedzialnym, kpiarskim i niedojrzałym podejściu do życia. Postać była uosobieniem ludowego humoru, ale także prostej mądrości ludzkiej. Chodził on własnymi drogami, ale mimo to był skory do pomocy i życzliwy. Mazurski pofajdok jest utożsamiany ze znaną w innych regionach postacią Sowizdrzała."},{"page_url":"https://it.wikipedia.org/wiki/Passo_(equitazione)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Muybridge_horse_walking_animated.gif","page_title":"Passo (equitazione)","context_page_description":"Il passo è l'andatura più lenta del cavallo, naturale, camminata e basculata, dove il cavallo poggia gli arti uno per volta, uno dopo l'altro. È un'andatura poco faticosa con velocità che varia da 5 a 7 km/h.\\nQuesto tipo di andatura viene definito simmetrico perché l'appoggio delle due zampe anteriori avviene secondo intervalli di tempo regolari, e basculato perché il cavallo compie un movimento in verticale con il collo per darsi la spinta necessaria a portarsi avanti anche con il resto del corpo.\\nIl cavallo poggia gli arti uno per volta, uno dopo l'altro, pertanto si riconoscono quattro tempi: anteriore destro, posteriore sinistro, anteriore sinistro e posteriore destro.\\nA seconda della lunghezza del passo, si distinguono un passo corto, un passo medio e un passo lungo."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B1%D8%A7%D9%86%DB%8C%D8%AA%DB%8C%D8%AF%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Ranitidine-A-3D-balls.png","page_title":"رانیتیدین","context_page_description":"رانیتیدین دارویی است که کاربرد اصلی آن در درمان زخم معده و گاستریت است. این دارو در درمان کوتاه مدت زخم‌های فعال دوازدهه یا زخمهای فعال و خوش‌خیم معده، حالات مرضی ترشح بیش از حد اسید معده مانند نشانگان زولینگر-الیسون، برگشت محتویات معده به مری نیز مورد استفاده قرار می‌گیرد.طبق تحقیقات دانشمندان آمریکا این دارو سرطان زا است اما اثبات نشده است. در آپریل ۲۰۲۰ این دارو به دلیل نگرانی هایی پیرامون سرطان زا بودن آن، از بازار آمریکا جمع آوری شده‌است. در تاریخ ۲۵ فروردین ۱۳۹۹ سازمان غدا و داروی ایران با انتشار خبری در وب سایت خود ضمن اعلام حذف فرآورده های رانیتیدین از بازار دارویی کشور، از بیماران خواست مصرف رانیتیدین را متوقف و با پزشک معالج خود برای داروهای جایگزین مشورت کنند."},{"page_url":"https://th.wikipedia.org/wiki/%E0%B8%81%E0%B8%B2%E0%B8%A3%E0%B9%80%E0%B8%9B%E0%B8%A3%E0%B8%B5%E0%B8%A2%E0%B8%9A%E0%B9%80%E0%B8%97%E0%B8%B5%E0%B8%A2%E0%B8%9A%E0%B8%A2%E0%B8%A8%E0%B8%97%E0%B8%AB%E0%B8%B2%E0%B8%A3%E0%B9%81%E0%B8%AD%E0%B8%9F%E0%B8%A3%E0%B8%B4%E0%B8%81%E0%B8%B2%E0%B9%83%E0%B8%95%E0%B9%89%E0%B9%83%E0%B8%99%E0%B8%A2%E0%B8%B8%E0%B8%84%E0%B8%81%E0%B8%B2%E0%B8%A3%E0%B8%96%E0%B8%B7%E0%B8%AD%E0%B8%9C%E0%B8%B4%E0%B8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/BDF_Rank_Sergeant_Brassard.jpg","page_title":"การเปรียบเทียบยศทหารแอฟริกาใต้ในยุคการถือผิว","context_page_description":"ตารางนี้แสดง การเปรียบเทียบยศทหารแอฟริกาใต้ ในยุคการถือผิว ระหว่าง ค.ศ. 1948 ถึง ค.ศ. 1994. โครงสร้างชั้นยศได้รับแบบธรรมเนียมมาจากกองทัพบกสหราชอาณาจักร"},{"page_url":"https://en.wikipedia.org/wiki/Project_Mercury","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Mercury-splash-down.png","page_title":"Project Mercury","context_page_description":"Project Mercury was the first human spaceflight program of the United States, running from 1958 through 1963. An early highlight of the Space Race, its goal was to put a man into Earth orbit and return him safely, ideally before the Soviet Union. Taken over from the US Air Force by the newly created civilian space agency NASA, it conducted twenty uncrewed developmental flights, and six successful flights by astronauts. The program, which took its name from Roman mythology, cost $2.25 billion adjusted for inflation. The astronauts were collectively known as the \\"Mercury Seven\\", and each spacecraft was given a name ending with a \\"7\\" by its pilot.\\nThe Space Race began with the 1957 launch of the Soviet satellite Sputnik 1. This came as a shock to the American public, and led to the creation of NASA to expedite existing US space exploration efforts, and place most of them under civilian control. After the successful launch of the Explorer 1 satellite in 1958, crewed spaceflight became the next goal. The Soviet Union put the first human, cosmonaut Yuri Gagarin, into a single orbit aboard Vostok 1 on April 12, 1961."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Rus_(S%C4%83laj)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Rus_jud_Salaj.png","page_title":"Rus (Sălaj)","context_page_description":"Rus sī Romania Sălaj Koān ê chi̍t ê chū-tī-thé."},{"page_url":"https://de.wikipedia.org/wiki/Friedrich_Junge_(P%C3%A4dagoge)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d9/Junge_Friedrich.JPG","page_title":"Friedrich Junge (Pädagoge)","context_page_description":"Friedrich Junge war ein deutscher Lehrer und Biologe."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A2%D0%BE%D1%80%D0%BE%D0%BD%D1%82%D0%BE_%D0%A0%D1%8D%D0%BF%D1%82%D0%BE%D1%80%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Raptors_0607.JPG","page_title":"Торонто Рэпторс","context_page_description":"«Торо́нто Рэ́пторс» — профессиональный баскетбольный клуб из канадского города Торонто. Выступает в Атлантическом дивизионе Восточной конференции Национальной баскетбольной ассоциации. Клуб присоединился к лиге в 1995 году, одновременно с «Ванкувер Гриззлис», в результате расширения НБА в Канаду. После того, как «Гриззлис» в 2001 году переехали в Мемфис, штат Теннесси, «Рэпторс» стали единственной командой, представляющей Канаду в НБА. Изначально баскетболисты проводили домашние матчи на стадионе «SkyDome», но в 1999 году переехали в новый «Air Canada Centre». Владельцем является корпорация Maple Leaf Sports & Entertainment, которой кроме этого принадлежат хоккейные клубы «Торонто Мейпл Лифс» и «Торонто Марлис», а также футбольный клуб «Торонто».\\nКак и большинство других новых команд лиги, «Рэпторс» в первые годы выступали довольно слабо, и лишь после приобретения Винса Картера на драфте 1998 года смогли улучшить свою игру и три года подряд, с 2000 по 2002, играли в плей-офф НБА. Картер в это время был ведущим игроком команды, во многом благодаря ему в 2001 году «Рэпторс» дошли в плей-офф до полуфинала Восточной конференции."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%8A%D9%88%D9%84%D9%8A%D9%88%D8%B3_%D9%85%D9%8A%D9%84%D8%B1","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/Julius_Miller.jpg","page_title":"يوليوس ميلر","context_page_description":"يوليوس ميلر ‏ هو قاضي ومحامي وسياسي أمريكي، ولد في 12 يناير 1880، وتوفي في 3 فبراير 1955. حزبياً، نشط في الحزب الديمقراطي. وقد انتخب عضو مجلس ولاية نيويورك."},{"page_url":"https://eo.wikipedia.org/wiki/L%C3%A1szl%C3%B3_Borb%C3%A9ly_(politikisto)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Ministrul_mediului_pictand_tricouri_%28cropped%29.jpg","page_title":"László Borbély (politikisto)","context_page_description":"BORBÉLY László [borbe:j] estas rumanuja hungara ekonomikisto, politikisto de RMDSZ naskita la 26-a de marto 1954 en Târgu Mureş."},{"page_url":"https://en.wikipedia.org/wiki/Are_Castle","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Burgruine-Are-Altenahr-044.JPG","page_title":"Are Castle","context_page_description":"Are Castle is the ruin of a hill castle that stands at a height of 240 m above sea level above the village of Altenahr in the German state of Rhineland-Palatinate. It was built around 1100 by Count Dietrich I of Are and is first recorded in 1121.\\nSince 1965 the Are Gymnasium – a local grammar school – in Bad Neuenahr-Ahrweiler has borne the name which is derived from the castle and its eponymous noble family."},{"page_url":"https://fr.wikipedia.org/wiki/Prunus_hortulana","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0b/Prunus_hortulana_range_map_1.png","page_title":"Prunus hortulana","context_page_description":"Prunus hortulana, le prunier hortulan, est un arbuste fruitier de la famille des Rosaceae. On le trouve en Amérique du Nord."},{"page_url":"https://pt.wikipedia.org/wiki/Guilherme_I_da_Normandia","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/William_longsword_statue_in_falaise.JPG","page_title":"Guilherme I da Normandia","context_page_description":"Guilherme I da Normandia, dito \\"Guilherme Espada Longa\\", foi o filho de Rollo e de Poppa de Bayeux, senhora de Bayeux."},{"page_url":"https://fr.wikipedia.org/wiki/%C3%8Eles_Australes","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/L%27%C3%AEle_de_Raivavae.jpg","page_title":"Îles Australes","context_page_description":"Les îles Australes constituent un archipel d'une superficie totale d'environ 152 km² situé dans la partie la plus méridionale de la Polynésie française dans le nord-ouest de l'océan Pacifique sud. S'étendant sur une longueur de 1 317 km, l'archipel est distant de Papeete de 573 km pour l'île la plus proche et de 1 301 km pour la plus éloignée. Les plus occidentales des îles sont au sud de Tahiti, les plus orientales au sud-sud-est. L'archipel est parfois nommé îles Tubuai du nom de son île la plus étendue."},{"page_url":"https://tr.wikipedia.org/wiki/Eurovision_%C5%9Eark%C4%B1_Yar%C4%B1%C5%9Fmas%C4%B1%27nda_Kuzey_Makedonya","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/ESC2014_-_Macedonia_01.jpg","page_title":"Eurovision Şarkı Yarışması'nda Kuzey Makedonya","context_page_description":"Kuzey Makedonya, adını değiştirene dek Birleşmiş Milletler'e kabul edildiği \\"Eski Yugoslav Makedonya Cumhuriyeti\\" adıyla Eurovision Şarkı Yarışması'n yer alan ülkenin resmî ilk katılımı 1998'de gerçekleşti. 1996 Eurovision Şarkı Yarışması'na yoğun katılım talebi nedeniyle Avrupa Yayın Birliği tarafından bir ön eleme düzenlenmiştir. Makedonya'nın temsilcisi Kaliopi'nin seslendirmiş olduğu \\"Samo ti\\" elemeyi geçemeyerek yarışma dışı kalmıştır.\\nYarışmadaki en iyi sonucunu 2019 yılında Tamara Todevska'nın seslendirdiği \\"Proud\\" adlı şarkıyla alan ülke, yedinci olmuştur."},{"page_url":"https://sv.wikipedia.org/wiki/Islam_i_Sverige","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Stockholms_moske_okt_2012a.jpg","page_title":"Islam i Sverige","context_page_description":"Islam är den näst största religionen i Sverige efter kristendomen. 1953 fanns uppskattningsvis 500 muslimer i Sverige. År 2014 hade cirka 5 procent av alla svenskar sina rötter i muslimska länder och en tredjedel av den halv miljon människor som kommit från länder och miljöer med stora muslimska inslag beräknas som i någon mån utövande muslimer. Den främsta drivkraften av islams tillväxt i Sverige är invandring.\\nI Sverige finns sex islamiska riksorganisationer som mottar stöd ifrån Nämnden för statligt stöd till trossamfund: Förenade islamiska föreningar i Sverige, Sveriges muslimska förbund, Islamiska kulturcenterunionen i Sverige, Svenska islamiska församlingarna, Islamiska shiasamfunden i Sverige och Bosniakiska islamiska samfundet. Alla ingår i Islamiska samarbetsrådet. De beräknades organisera 170 915 regelbundna besökare och medlemmar år 2017."},{"page_url":"https://sv.wikipedia.org/wiki/Valutaunion","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Currency_sign.svg","page_title":"Valutaunion","context_page_description":"Valutaunion, tidigare även kallad myntkonvention, är ett överstatligt samarbete där flera nationer beslutar sig för att ha en gemensam valuta och penningpolitik. Valutan kan antingen bestå av ett lands valuta som de övriga använder eller en gemensam valuta."},{"page_url":"https://eu.wikipedia.org/wiki/Fran%C3%A7oise_de_Maintenon","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Mme_de_Maintenon.jpg","page_title":"Françoise de Maintenon","context_page_description":"Françoise de Maintenon, Madame de Maintenon, jaiotzez Françoise d'Aubigné edo, gutxiagotan, d'Aubigny Frantziako emakume noble bat izan zen Paul Scarronen emazte eta alarguna izan zena. Horren ondorioz, \\"Maintenongo markesa\\" ere deitu zitzaion.\\nHasiera batean isilpean eta ondoren agerian, Louis XIV.a Frantziakoaren eta haren maitale Madame de Montespanen seme-alaben zaindari izendatu zuten. Erregearen emaztea, Maria Teresa Austriakoa, 1683an hil zenean, haren isilpeko emaztea izatera pasatu zen. Jakina da erregearengan eragin handia izan zuela nahiz eta gaur egun zenbatekoan izan zen ezin den zehaztu."},{"page_url":"https://da.wikipedia.org/wiki/Kasjubere","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Kashubian_embroidery_of_Zukowo_school.jpg","page_title":"Kasjubere","context_page_description":"Kasjubere er et vestslavisk folkeslag i den nordlige del af Polen.\\nKasjuberne taler kasjubisk, som er et vestslavisk sprog. De nedstammer fra de vestslaviske pomoranere i Pommern. Store dele af folket er efterhånden blevet assimileret til enten den tyske eller polske kultur. Mange kasjubere opgiver som nationalitet polsk og som etnicitet kasjubisk.\\nKendte kasjubere er den tidligere polske premierminister og nuværende formand for Det Europæiske Råd Donald Tusk, og den tyske forfatter Günter Grass, hvis mor var af kasjubisk oprindelse.\\nRegionen Kasjubi hører under det polske voivodskab Województwo pomorskie."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Sites_of_Community_Importance_in_the_Canary_Islands","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/WIKI_559_MmoramoraleS.JPG","page_title":"List of Sites of Community Importance in the Canary Islands","context_page_description":"This is a list of Sites of Community Importance in the Canary Islands."},{"page_url":"https://ht.wikipedia.org/wiki/McClelland,_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/Ellison_Gardens_McClelland%2C_Iowa.jpg","page_title":"McClelland, Iowa","context_page_description":"McClelland, Iowa se yon vil Etazini. Li sitye nan leta Iowa.\\nChèf-lye li se?."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E8%8A%B1%E5%8F%89%E6%9F%B1%E5%85%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Cheirostylis_griffithii_-_The_Orchids_of_the_Sikkim-Himalaya_pl_397_%281889%29_-_contrast.jpg","page_title":"大花叉柱兰","context_page_description":"大花叉柱兰为兰科叉柱兰属下的一个种。"},{"page_url":"https://ja.wikipedia.org/wiki/%E9%B7%B9%E5%B7%A3%E9%83%B5%E4%BE%BF%E5%B1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Post_Office_Takanosu.jpg","page_title":"鷹巣郵便局","context_page_description":"鷹巣郵便局は秋田県北秋田市にある郵便局である。民営化前の分類では集配普通郵便局であった。"},{"page_url":"https://eo.wikipedia.org/wiki/Schwechat","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Schwechat_Pfarrkirche_Hl._Jakob.jpg","page_title":"Schwechat","context_page_description":"Schwechat estas komunumo de Aŭstrio, kiu konsidereblas antaŭurbo de Vieno. Ĝi apartenas al la federacia lando Malsupra Aŭstrio. Ĝis la fino de 2016 temis pri parto de la tiutempa distrikto Vieno, ekde januaro 2017 ĝi apartenas al la distrikto Bruck. Krome ĝi apartenas al la historia regiono Industrieviertel [IndusTRI:firtl]. Komence de 2016 en la komunumo vivis 17 674 loĝantoj."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%95%E0%AF%86%E0%AE%9F%E0%AF%8D%E0%AE%9F%E0%AE%BF_%E0%AE%AE%E0%AF%88%E0%AE%AF%E0%AE%AE%E0%AF%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Getty_USGS.jpg","page_title":"கெட்டி மையம்","context_page_description":"கெட்டி மையம், ஐக்கிய அமெரிக்காவின் கலிபோர்னியா மாநிலத்தில் உள்ள லாஸ் ஏஞ்சலீஸ் நகரத்தின அருகில் அமைந்துள்ளது. கெட்டி மைய வளாகத்தில் ஜீன் பால் கெட்டி அருங்காட்சியகம் மற்றும் கெட்டி வில்லா எனும் இரண்டு அருங்காட்சியகங்கள் உள்ளது. இது ஜீன் பால் கெட்டி அறக்கட்டளையால் நிர்வகிக்கப்படுகிறது. 1.3 பில்லியன் அமெரிக்க டாலர் மதிப்பு கொண்ட இம்மையம் 16 டிசம்பர் 1997 முதல் பொதுமக்கள் பார்வைக்கு திறந்து வைக்கப்பட்டது. இம்மையம் கட்டிடக் கலை மற்றும் அழகிய தோட்டங்களால் நன்கறியப்பட்டுள்ளது.\\nசிறு மலை மீது அமைந்த கெட்டி மையத்திற்கு செல்ல, மலையடிவாரத்தில் கார்கள் வைக்குமிடத்திலிருந்து ஒற்றைத் தண்டூர்தி சேவைகள் உள்ளது.\\nலாஸ் ஏஞ்சலீஸ் நகரத்தின் பிரண்ட்வுட் பகுதியில் அமைந்த கெட்டி மையத்திலுள்ள ஜீன் பால் கெட்டி அருங்காட்சியகம் மற்றும் கெட்டி வில்லாவை பார்வையிட ஆண்டிற்கு 1.8 மில்லியன் பார்வையாளர்கள் வருகை தருகின்றனர்.\\nகெட்டி மையத்தின் ஜீன் கெட்டி அருங்காட்சியகத்தில் இருபதாம் நூற்றாண்டிற்கு முந்தைய ஐரோப்பிய மற்றும் உலகின் பல பகுதிகளிலிருந்து கிடைத்த ஓவியங்கள், கல் சிற்பங்கள், உலோகச் சிற்பங்கள், அழகிய கலைப் பொருட்கள் மற்றும் 1830க்கு முந்தைய புகைப்படங்கள் காட்சிக்கு வைக்கப்பட்டுள்ளது. மேலும் கெட்டி மையத்தின் வெளிபுறங்களில் பழங்கால சிற்பஙகளாலும், சிலைகளாலும் அழகூட்டப்பட்டுள்ளது."},{"page_url":"https://sv.wikipedia.org/wiki/Auzon,_Haute-Loire","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2f/Map_commune_FR_insee_code_43016.png","page_title":"Auzon, Haute-Loire","context_page_description":"Auzon är en kommun i departementet Haute-Loire i regionen Auvergne-Rhône-Alpes i centrala Frankrike. Kommunen ligger i kantonen Auzon som tillhör arrondissementet Brioude. År 2009 hade Auzon 944 invånare."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%8D%97%E4%BA%AC%E4%B8%9C%E8%B7%AF%E8%A1%97%E9%81%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Shanghai_-_Nanjing_Road.jpeg","page_title":"南京东路街道","context_page_description":"南京东路街道，是中国上海市黄浦区下属的一个街道，面积2.41平方公里，户籍人口102003人，实有人口70527人。\\n南京东路街道东到福建中路，与同属黄浦区的外滩街道相邻；南至延安东路-西藏南路-金陵中路-延安东路一线，与同属黄浦区的外滩街道、淮海中路街道、瑞金二路街道相邻；西至成都北路，毗邻静安区的石门二路街道、南京西路街道；北以苏州河为界与2015年被静安区合并的闸北区北站街道相望。街道办事处位于大沽路123号。\\n南京东路街道原为上海县城北郊田野，清道光二十八年，境地全部划入英租界范围。1953年建制为老闸区第四办事处。1956年老闸区并入黄浦区，改名黄浦区南京东路办事处。1960年，并入贵州路办事处，建立黄浦区南京东路街道办事处。1988年8月撤销南京东路、长沙路街道，建立南京东路街道。2007年3月由原人民广场街道、原南京东路街道及原金陵东路街道所辖的三个居委会合并设立南京东路街道办事处。\\n上海市政府大楼位于南京东路街道内。南京路步行街主要也位于南京东路街道内，使得本街道成为上海市中心主要商业区之一。上海市的坐标原点位于本辖区内的国际饭店。"},{"page_url":"https://pl.wikipedia.org/wiki/Flaga_Gujany","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Guyana_Prison_Service_Flag.png","page_title":"Flaga Gujany","context_page_description":"Flaga Gujany – symbol Gujany zatwierdzony 26 maja 1966 roku."},{"page_url":"https://hu.wikipedia.org/wiki/Istres","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ef/Population_-_Municipality_code_13047.svg","page_title":"Istres","context_page_description":"Istres település Franciaországban, Bouches-du-Rhône megyében. Istres Fos-sur-Mer, Miramas, Saint-Martin-de-Crau, Saint-Mitre-les-Remparts és Berre-l'Étang községekkel határos."},{"page_url":"https://pt.wikipedia.org/wiki/Academismo_no_Brasil","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/MarcFerrez-AIBA-1891.jpg","page_title":"Academismo no Brasil","context_page_description":"O Academismo no Brasil foi a expressão institucionalizada de todo o sistema de arte que prevaleceu no Brasil do início do século XIX até o início do século XX, baseado nos princípios das academias de arte europeias. Nasceu com a Escola Real de Ciências, Artes e Ofícios fundada por Dom João VI em 1816 por incentivo da Missão Artística Francesa, floresceu com a Academia Imperial de Belas Artes e o mecenato de Dom Pedro II e encerrou-se com a incorporação de sua sucessora republicana, a Escola Nacional de Belas Artes, pela Universidade Federal do Rio de Janeiro, em 1931.\\nAntes que um estilo específico, o Academismo é, estritamente falando, um método de ensino artístico profissionalizante de nível superior, equivalente ao ensino universitário moderno. No Brasil tal sistema foi introduzido no período de vigência do Neoclassicismo, estilo do qual foi um dos principais motores de difusão, e depois absorveu estéticas românticas, realistas, simbolistas e outras que deram o tom à virada do século XIX para o XX, expurgando delas o que não se enquadrasse na formalidade da Academia."},{"page_url":"https://tr.wikipedia.org/wiki/Nekropol","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Cerveteri%2C_necropoli_della_banditaccia%2C_via_sepolcrale_principale%2C_01.jpg","page_title":"Nekropol","context_page_description":"Nekropol arkeolojik şehirlerde mezarlıkların ve toplu mezar yerlerinin bulunduğu bölgeye verilen isimdir. Yunanca nekros-polis ölü şehri demektir. Antik çağdaki şehirlerde mezar yerlerinin günümüz şehirlerinden farkı, günümüzde daha çok yerleşim yerlerine uzakta ve şehrin dışında olan mezarların, o dönemlerde şehirle iç içe olmasıdır."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%96%8B%E5%8D%A1%E7%B1%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/21/Amherst_27.JPG","page_title":"斋卡米","context_page_description":"斋卡米，又译吉坎眉，是缅甸孟邦的一个度假小镇。\\n在大城王国期间，该镇可能是大城府的附庸国，在泰语中被称作“เชียงกราน”或“เชียงตราน”。在第一次英缅战争期间，英国成功占领了该镇之后，将其改名为“奄哈士”，以纪念时任印度总督威廉·阿美士德。\\n该镇位于毛淡棉以南约48 km的半岛上，是当地朝圣者和游客的热门目的地。\\n2012年1月14日降雨量达到75毫米，是过去30年1月24小时内降雨量最大的一次。"},{"page_url":"https://no.wikipedia.org/wiki/Lars_Tvinde","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8a/Medmenneske-TM.T03571.jpg","page_title":"Lars Tvinde","context_page_description":"Lars Knutsen Tvinde var en norsk skuespiller.\\nTvinde debuterte i 1912 under Det Norske Teatrets åpningssesong og var under hele sin bane én av hovedkreftene ved denne scenen til han trakk seg tilbake i 1958. Tvinde behersket både komedie og tragedi og både det klassiske og det moderne repertoaret. Til hans fremste roller hører tittelrollen i Ludvig Holbergs Jeppe paa Bierget og Den politiske kannestøper, tittelrollen i Hans E. Kincks Agilulf den vise, Didrik i Olav Duuns Medmenneske, Teiresias i Sofokles' Antigone og kapteinen i August Strindbergs Dødsdansen.\\nHan gjorde sin filmdebut i 1920 i Fante-Anne og spilte deretter i flere stum- og lydfilmer. Tvinde huskes kanskje best for rollen som Sebaldus i Tancred Ibsens Fant."},{"page_url":"https://en.wikipedia.org/wiki/Pensby","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Pensby_High_School_for_boys_%282%29.JPG","page_title":"Pensby","context_page_description":"Pensby is a large village on the Wirral Peninsula in Merseyside, England. It is located 2 km to the north of the town of Heswall and approximately 2 km to the south west of Thingwall. Historically part of Cheshire, the area is part of the Pensby and Thingwall Ward of the Metropolitan Borough of Wirral and the parliamentary constituency of Wirral West.\\nAt the 2001 census the village of Pensby had 6,900 inhabitants. The 2011 census measured the population of the Pensby and Thingwall ward at 13,007."},{"page_url":"https://en.wikipedia.org/wiki/Scenic_Rim_Region","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/StateLibQld_2_232926_Upper_Logan_Terminal_Station_on_the_Beaudesert_Tramway%2C_1903.jpg","page_title":"Scenic Rim Region","context_page_description":"The Scenic Rim Region is a local government area in West Moreton region of South East Queensland, Australia. Established in 2008, it was preceded by several previous local government areas with histories extending back to the early 1900s and beyond. The main town of the region is Beaudesert.\\nIt has an estimated operating budget of A$33 million."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%AA%E3%82%A6%E3%83%AC%E3%83%B3%E3%82%B7%E3%83%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Dennstaedtia_wilfordii_ourensd03.jpg","page_title":"オウレンシダ","context_page_description":"オウレンシダ はシダ植物の1種。コバノイシカグマ科に属し、その姿がオウレンに似ると言われる。"},{"page_url":"https://de.wikipedia.org/wiki/Marshfield_(Vermont)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6f/Martin_Covered_Bridge.JPG","page_title":"Marshfield (Vermont)","context_page_description":"Marshfield ist eine Town im Washington County des Bundesstaates Vermont in den Vereinigten Staaten. Im Jahr 2010 lebten dort 1588 Einwohner in 729 Haushalten auf einer Fläche von 112,4 km²."},{"page_url":"https://en.wikipedia.org/wiki/Bert_Adams_Scout_Reservation","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Bert_Adams_Scout_Camp_Logo.png","page_title":"Bert Adams Scout Reservation","context_page_description":"Bert Adams Scout Reservation is a long-term overnight camp owned and operated by the Atlanta Area Council of the Boy Scouts of America. Bert Adams is located south of Covington, Georgia, situated on Lake Bulow Campbell; the camp is one of three major BSA summer camps in the Atlanta Area Council. The reservation is named after Albert S. \\"Bert\\" Adams, a \\"beloved leader in the city of Atlanta\\", and the president of what was then called the \\"Atlanta Council of the Boy Scouts\\", during the 1920s.\\nBert Adams has consistently been listed as one of the best scout camps in the United States by Boys Life and Scouting Magazines."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D1%83%D1%85_(%D0%BF%D0%BE%D1%81%D1%91%D0%BB%D0%BE%D0%BA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Lukh_River.jpg","page_title":"Лух (посёлок)","context_page_description":"Лух — посёлок городского типа, административный центр Лухского района Ивановской области Российской Федерации. Административный центр Лухского городского поселения в составе Лухского муниципального района."},{"page_url":"https://ro.wikipedia.org/wiki/Biserica_de_lemn_din_Ioanice%C8%99ti-G%C4%83brieni","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Ioanicesti_Gabriesti_AG.bislemn_persp_V.jpg","page_title":"Biserica de lemn din Ioanicești-Găbrieni","context_page_description":"Biserica de lemn din Ioanicești-Găbrieni, se află în cătunul Găbrieni din localitatea Ioanicești, comuna Poienarii de Argeș, județul Argeș, și poartă hramul „Cuvioasa Paraschiva”. În izvoare scrise a fost datată din anii 1742-1743, însă naosul și altarul sugerează o vechime mult mai mare. Tradiția indică aducerea ei din preajma Cotmenei, semnele de mutare confirmând atributul ei de biserică călătoare. Structura de lemn este bine conservată. În interior se distinge iconostasul de bună calitate și valoare artistică, datat la 1849 și semnat de zugravul Ghiță. Se disting elementele sculptate decorativ la intrare și la stâlpii pridvorului. Biserica este înscrisă pe noua listă a monumentelor istorice, LMI 2004: AG-II-m-A-13705. Biserica formează împreună cu troița de la 1911, din fața bisericii, și cimitirul din jur un ansamblu valoros, așezat într-un cadru natural pitoresc."},{"page_url":"https://cs.wikipedia.org/wiki/Litomy%C5%A1l","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Litomysl_sv_Krize_kaple_DSCN0630.JPG","page_title":"Litomyšl","context_page_description":"Litomyšl je město v okrese Svitavy v Pardubickém kraji na české straně bývalé zemské hranice s Moravou. Je vzdálené 17 km severozápadně od okresního města Svitavy a 13 km jihozápadně od Ústí nad Orlicí. Litomyšl se rozkládá na ploše necelých 34 kilometrů čtverečních v centrální části Svitavské pahorkatiny na řece Loučné v nadmořské výšce 330 metrů. Do katastrální výměry Litomyšle spadají územně samostatné části Kornice, Nová Ves u Litomyšle, Pazucha, Pohodlí a Suchá. Žije zde přibližně 10 tisíc obyvatel.\\nNázev města pochází ze staročeského osobního jména Ľutomysl. Litomyšl získala městská privilegia v roce 1259 od krále Přemysla Otakara II. jako poddanské město místního premonstrátského kláštera, jehož symbol lilie přejalo město do svého znaku. Vývoj města je úzce svázán s jeho vrchností – nejprve církevní, později světskou. Ve městě se narodila nebo působila řada předních osobností, mj. Bedřich Smetana, Alois Jirásek, Božena Němcová, Josef Váchal nebo Olbram Zoubek.\\nZámecké návrší i samo město nabízí spojení historické architektury s moderními uměleckými směry. Ve městě se celoročně koná řada akcí a festivalů. Litomyšl je proto často označována jako „moderní historické město“."},{"page_url":"https://vi.wikipedia.org/wiki/Tragus_berteronianus","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Starr_040120-0034_Tragus_berteronianus.jpg","page_title":"Tragus berteronianus","context_page_description":"Tragus berteronianus là một loài thực vật có hoa trong họ Hòa thảo. Loài này được Schult. miêu tả khoa học đầu tiên năm 1824."},{"page_url":"https://en.wikipedia.org/wiki/Roberta_Alexander","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Roberta_Alexander_%281976%29.jpg","page_title":"Roberta Alexander","context_page_description":"Roberta Alexander is an American operatic soprano. She began her career as a leading soprano in 1975 and spent the next three decades performing principal roles with opera houses internationally. More recently she has performed secondary character roles on stage, including performances at the Grand Théâtre de Provence in 2013, La Scala in 2014, and La Monnaie in 2015. She performed the 5th maid in Strauss's Elektra at the Metropolitan Opera in 2016 and Curra in Verdi's La forza del destino at the Royal Opera House, Covent Garden, in 2019."},{"page_url":"https://cs.wikipedia.org/wiki/Pcheng_%C5%BDuej-lin","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/70/Lu_Yule_in_uniform_of_Shinchiku_Girls%27_High_School.jpg","page_title":"Pcheng Žuej-lin","context_page_description":"Pcheng Žuej-lin byl tchajwanský fotograf a doktor čínské medicíny. Fotografii vystudoval v Japonsku a byl členem Japonské krajinářské asociace."},{"page_url":"https://de.wikipedia.org/wiki/Kostelec_u_He%C5%99manova_M%C4%9Bstce","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Kostelec_u_He%C5%99manova_M%C4%9Bstce_kostel_sv.Petra_a_Pavla.JPG","page_title":"Kostelec u Heřmanova Městce","context_page_description":"Kostelec u Heřmanova Městce ist eine Gemeinde in Tschechien. Sie liegt drei Kilometer südlich von Heřmanův Městec und gehört zum Okres Chrudim."},{"page_url":"https://fr.wikipedia.org/wiki/Melanne_Verveer","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Melanne_Verveer_at_the_India_Economic_Summit_2009.jpg","page_title":"Melanne Verveer","context_page_description":"Melanne S. Verveer est une femme politique américaine, née le 24 juin 1944.\\nElle est l'une des fondatrices et présidente de Vital Voices Global Partnership, une ONG qui promeut les femmes dirigeantes dans des pays en développement. Elle a été la chef de cabinet de l'ex-Première dame Hillary Clinton à la Maison-Blanche.\\nLe 7 mars 2009, elle a été désignée par le président Barack Obama ambassadrice itinérante, dépendant du département d'État, pour occuper le nouveau poste consacré aux problèmes que rencontrent les femmes dans le monde."},{"page_url":"https://fr.wikipedia.org/wiki/Volkswagen_Karmann_Ghia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Volkswagen_Karmann_Ghia_%28Typ_14%29%2C_Schaffen_Diest_Fly-Drive_2013.JPG","page_title":"Volkswagen Karmann Ghia","context_page_description":"La Volkswagen Karmann Ghia est une voiture de sport à 2+2 places. En Allemagne, le coupé fut produit entre 1955 et 1974 et le cabriolet entre 1957 et 1974. Au Brésil, la voiture fut construite entre 1962 et 1975. Dessinée par Luigi Segre, de la Carrozzeria Ghia, et assemblée à la main par le fabricant automobile indépendant Karmann, la Karmann Ghia reprit le châssis et le moteur de la VW Coccinelle. La dénomination officielle de la Karmann Ghia est Volkswagen Type 14. Dès 1961, Volkswagen en produisit une variante, la Volkswagen Type 34, dont la carrosserie anguleuse était basée sur la plateforme de la Volkswagen Type 3."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%91%D0%B0%D0%B3%D1%80%D1%8F%D0%BD%D0%B0,_%D0%95%D0%BB%D0%B8%D1%81%D0%B0%D0%B2%D0%B5%D1%82%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/BASA-65K-2-1498-1-Elisaveta_Bagryana.jpg","page_title":"Багряна, Елисавета","context_page_description":"Елисавета Багряна — болгарская поэтесса, переводчик, автор произведений для детей и юношества. Герой Народной Республики Болгария.\\nЛауреат Димитровской премии."},{"page_url":"https://ceb.wikipedia.org/wiki/Dobova","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/51/Dobova.jpg","page_title":"Dobova","context_page_description":"Lungsod ang Dobova sa Esklobeniya. Nahimutang ni sa munisipyo sa Občina Brežice, sa sidlakang bahin sa nasod, 90 km sa sidlakan sa Ljubljana ang ulohan sa nasod. 142 metros ibabaw sa dagat kahaboga ang nahimutangan sa Dobova, ug adunay 744 ka molupyo.\\nAng yuta palibot sa Dobova kay patag sa amihang-sidlakan, apan sa habagatang-kasadpan nga kini mao ang kabungtoran. Ang kinahabogang dapit sa palibot dunay gihabogon nga 624 ka metro ug 5.8 km sa habagatan-kasadpan sa Dobova. Dunay mga 43 ka tawo kada kilometro kwadrado sa palibot sa Dobova medyo gamay nga populasyon. Ang kinadul-ang mas dakong lungsod mao ang Brežice, 5.7 km sa kasadpan sa Dobova. Hapit nalukop sa kaumahan ang palibot sa Dobova.\\nAng klima klima sa kontinente. Ang kasarangang giiniton 11 °C. Ang kinainitan nga bulan Hulyo, sa 22 °C, ug ang kinabugnawan Disyembre, sa -4 °C. Ang kasarangang pag-ulan 1,757 milimetro matag tuig. Ang kinabasaan nga bulan Septiyembre, sa 239 milimetro nga ulan, ug ang kinaugahan Marso, sa 94 milimetro."},{"page_url":"https://eu.wikipedia.org/wiki/Vald%C3%A9s_penintsula","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Orcas_in_Punta_Norte_Valdes_Peninsula_-_panoramio.jpg","page_title":"Valdés penintsula","context_page_description":"Valdés penintsula Argentinan dagoen penintsula ezaguna da, 1999 urtean UNESCOk Gizateriaren Ondare izendatu zuena. Puerto Pirámides herriak baleak ikusteko turismoa garatu du.\\nPuerto Pirámides da penintsulako herri bakarra eta gainerako eremuak 30 ardi estancia inguruk hartzen dute."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Fliesteden","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Am_Platz_4%2C_Bergheim-Fliesteden_2.jpg","page_title":"Liste der Baudenkmäler in Fliesteden","context_page_description":"Die Liste der Baudenkmäler in Fliesteden enthält die denkmalgeschützten Bauwerke auf dem Gebiet von Bergheim-Fliesteden in Nordrhein-Westfalen. Diese Baudenkmäler sind in der Denkmalliste der Stadt Bergheim eingetragen; Grundlage für die Aufnahme ist das Denkmalschutzgesetz Nordrhein-Westfalen."},{"page_url":"https://de.wikipedia.org/wiki/Schloss_Favorite_(Ludwigsburg)","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Park_Allee_von_Schloss_Favorite.jpg","page_title":"Schloss Favorite (Ludwigsburg)","context_page_description":"Schloss Favorite ist ein barockes Lust- und Jagdschlösschen in Ludwigsburg in Baden-Württemberg. Es liegt auf einer Anhöhe im Favoritepark in direkter Achse nördlich des Residenzschlosses Ludwigsburg."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B1%DB%8C%D9%85%D9%88%D9%86%D8%AF_%D8%A7%D8%B3%DA%A9%D8%A7%D8%AA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Raymond_scott.jpg","page_title":"ریموند اسکات","context_page_description":"ریموند اسکات آمریکالی آلبوم یاپیمجیسی، بسته‌چی و موسیقیچی - جاز موسیقی ژانرلاریندا اثرلر یارادیب. ریموند اسکات ۱۰ سپتامبر ۱۹۰۸ تاریخینده حیاتا گؤز آچیب و ۸ فوریه ۱۹۹۴ میلادی تاریخینده North Hills شهرینده وفات ائدیب."},{"page_url":"https://pt.wikipedia.org/wiki/Paus_(Resende)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/63/Resende_30.PNG","page_title":"Paus (Resende)","context_page_description":"São Pedro de Paus é uma freguesia portuguesa do concelho de Resende, com 13,16 km² de área e 528 habitantes. A sua densidade populacional é 40,1 hab/km². Vila extinta e freguesia, Paus pertence à comarca e concelho de Resende, diocese de Lamego e distrito de Viseu. É atravessada pelo ribeiro Bestança que desagua no Douro, na localidade de Porto de Rei da freguesia de São João de Fontoura."},{"page_url":"https://sl.wikipedia.org/wiki/Evergreen_Marine","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/Ever_Unicorn_-_IMO_9196967_%28181718466%29.jpg","page_title":"Evergreen Marine","context_page_description":"Evergreen Marine Corporation je tajvansko podjetje, ki se ukvarja z ladijskim transportom. Podjetje je 1. septmebra 1968 ustanovil milijarder Jung-Fa Čang. Sedež podjetja je v mestu Taoyuan. V floti ima več kot 180 kontejnerskih ladij, družba pluje v 240 pristaniščih v 80 državah. Ladje družbe se zlahka prepozna po zimzeleni barvi."},{"page_url":"https://es.wikipedia.org/wiki/Kojak_(veh%C3%ADculo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/29/Veh%C3%ADculo_Kojak.jpg","page_title":"Kojak (vehículo)","context_page_description":"El Kojak, es un vehículo militar multipropósito.\\nEstos vehículos son fabricados en Bolivia con varias versiones desde caza tanques con misiles guiados, así también como portados de plataforma de misiles tierra-aire y de apoyo a la infantería con lanzacohetes múltiples de 70 mm aproximadamente, de fabricación boliviana.\\nSe empezaron a fabricar en 1995 y 1997 varios prototipos para comprobar su rendimiento y experimentar con ellos en ejercicios tácticos, oficialmente salieron mejorados en octubre de 2005. Todo comenzó con la iniciativa de un Coronel Cornejo mientras comandaba un Batallón Logístico, posteriormente se pasó a la División de Ciencias y Tecnología del Ejército, cabe señalar que Bolivia tiene otros proyectos, entre ellos la fabricación de cohetes y misiles.\\nTambién se usan como vehículos de inserción y extracción de operarios de fuerzas especiales, y en las siguientes funciones: en exploración y vigilancia, dirección y corrección de tiro de artillería, comunicaciones y enlaces.\\nHan demostrado ser unos excelentes vehículos, tanto por su funcionamiento como por la gran variabilidad de armamento que son capaces de adoptar."},{"page_url":"https://ko.wikipedia.org/wiki/%ED%95%9C%EA%B5%AD%EC%BD%98%ED%85%90%EC%B8%A0%EC%A7%84%ED%9D%A5%EC%9B%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/KOCCA_lobby_2.jpg","page_title":"한국콘텐츠진흥원","context_page_description":"한국콘텐츠진흥원은 콘텐츠 전 분야를 아우르는 총괄 진흥기관으로서 콘텐츠산업 육성을 위한 종합지원체제를 구축하여 콘텐츠강국 실현을 위해 2009년 5월 17일 설립된 문화체육관광부 산하 특수법인이며, 위탁집행형 준정부기관으로 지정되어 있다. 정부의 공공기관 지방이전 정책에 따라 2014년 5월에 본원이 광주전남공동혁신도시로 이전했으며, 역삼, 광화문, 대학로, 홍릉, 상암, 판교, 일산, 대전에 분원을 두고 있다."},{"page_url":"https://es.wikipedia.org/wiki/K_League_1_2018","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b2/Munsu_20121110_204310_5.jpg","page_title":"K League 1 2018","context_page_description":"La K League 1 2018 es la 36ᵃ temporada de la división más alta del fútbol en Corea del Sur desde el establecimiento en 1983 como K-League, y la cuarta temporada con su actual nombre, la K League 1.\\nParticipan 12 equipos: 11 de la edición anterior, y 1 ascendido de la K League Challenge 2017. El Jeonbuk Hyundai Motors es el campeón defensor, habiendo ganado su sexto título."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%B0%BC%E5%BE%B7%E5%85%B0%E7%AE%B4%E8%A8%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/NP-61.jpg","page_title":"尼德兰箴言","context_page_description":"《尼德兰箴言》又译作“尼德兰谚语”、“荷兰谚语”，是法兰德斯画家老布勒哲尔1559年创作的一幅油彩画，画中描绘了大量的当时在尼德兰地区流行的谚语，很多现在仍然在使用。\\n老布勒哲尔的画作一向以人类的荒谬愚蠢为题材，而这幅画的原题是“蓝色披风” 或“世界的愚蠢”，表明画家的用意不只是歌颂荷兰谚语文化，还想籍此描写人类的愚蠢。原画以油彩绘画在橡木板上，画中描绘了112个可识别的成语或谚语，当中有些谚语不能确定是否真是画家原本想表达的。\\n他的儿子小彼得·布勒哲尔专门为他父亲的作品制作复制品，并绘画了至少16 幅“尼德兰箴言”。 而父亲与儿子绘画的版本并非完全一样，在细节上或描绘的谚语各有少许不同。"},{"page_url":"https://cs.wikipedia.org/wiki/Dvouna%C5%BEka","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Samara_maple.jpg","page_title":"Dvounažka","context_page_description":"Dvounažka patří mezi pravé suché poltivé vícesemenné plody vzniklé z cenokarpického gynecea. Je to dvouplodolistový plod, který se skládá ze dvou jednosemenných merikarpií spojených karpoforem a obalených blanitým oplodím. Po dozrání oplodí praskne a plod se rozdělí na merikarpia, která zůstanou obalena osemením až do doby klíčení.\\nDvounažky se podle místa vzniku a tvaru oplodí rozdělují na:"},{"page_url":"https://bg.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D1%82%D0%B5%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/02/Fried_egg%2C_sunny_side_up.jpg","page_title":"Протеин","context_page_description":"Протеинът, още белтък или белтъчина, е събирателен термин за биологически важни макромолекули, изградени чрез поликондензирането на отделни аминокиселини.\\nБелтъците са един от основните градивни компоненти на живите клетки, както и на вирусните частици. Притежават сложна пространствена структура и изпълняват разнообразни биологични функции – от типично структурни, защитни, транспортни и съкратителни до каталитични и регулаторни.\\nЦялата информация, необходима за изграждането на белтъчната молекула, е кодирана в ДНК. Посредством процес на точно презаписване на информацията в РНК и превеждане от полинуклеотидна в аминокиселинна последователност е възможно синтезирането на определен белтък, притежаващ конкретна биологична роля."},{"page_url":"https://hu.wikipedia.org/wiki/Myennes","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Population_-_Municipality_code_58187.svg","page_title":"Myennes","context_page_description":"Myennes település Franciaországban, Nièvre megyében. Myennes Boulleret, La Celle-sur-Loire és Cosne-Cours-sur-Loire községekkel határos."},{"page_url":"https://fr.wikipedia.org/wiki/Margareth_Mad%C3%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Margareth_Made_Venice09.jpg","page_title":"Margareth Madè","context_page_description":"Margareth Tamara Maccarrone, connue sous les noms de scène de Margareth Madé est une actrice italienne."},{"page_url":"https://bn.wikipedia.org/wiki/%E0%A6%AE%E0%A6%B9%E0%A6%BF%E0%A6%B2%E0%A6%BE_%E0%A6%B8%E0%A6%AE%E0%A6%BF%E0%A6%A4%E0%A6%BF_%E0%A6%AE%E0%A6%9E%E0%A7%8D%E0%A6%9A","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Bangladesh_Mahila_Samity%2C_Dhaka.jpg","page_title":"মহিলা সমিতি মঞ্চ","context_page_description":"মহিলা সমিতি মঞ্চ বাংলাদেশের ঢাকার বেইলী রোডস্থ বাংলাদেশ মহিলা সমিতির ভবনের মধ্যে অবস্থিত মঞ্চ প্রযোজনার জন্য একটি মিলানায়তন। এটি স্বাধীনতা-উত্তর বাংলাদেশের নাট্যচর্চায় গুরুত্বপূর্ণ ভূমিকা পালন করছে।"},{"page_url":"https://ro.wikipedia.org/wiki/Comitatul_Pike,_Illinois","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Courthouse%2C_Pike_County%2C_Illinois.jpg","page_title":"Comitatul Pike, Illinois","context_page_description":"Comitatul Pike este un comitat din statul Illinois, Statele Unite ale Americii."},{"page_url":"https://pl.wikipedia.org/wiki/Cornelio_Caprara","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Cornelio_Caprara.jpg","page_title":"Cornelio Caprara","context_page_description":"Cornelio Caprara – włoski kardynał."},{"page_url":"https://nl.wikipedia.org/wiki/Archibald_Alexander_Gordon","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Culled_from_a_diary_aa_gordon.jpg","page_title":"Archibald Alexander Gordon","context_page_description":"De opmaak van dit artikel is nog niet in overeenstemming met de conventies van Wikipedia. Mogelijk is ook de spelling of het taalgebruik niet in orde. Men wordt uitgenodigd deze pagina aan te passen.\\nOpgegeven reden: Mist interne links en nog erg letterlijk vertaald vanuit het Engels.\\nMajoor Archibald Alexander Gordon CBE, MVO, was een Schots officier die tijdens de Eerste Wereldoorlog de militaire attaché was van koning Albert I van België, waarbij hij de titel van Kings Messenger kreeg. Hij was de jongere broer van William Eagleson Gordon V.C., wie tijdens de Tweede-Boerenoorlog de Victoria Cross werd toegekend."},{"page_url":"https://azb.wikipedia.org/wiki/%DA%A9%D8%A7%D9%BE%D8%B1%D8%A7%D9%88%DB%8C%D8%B1%DB%8C%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/eb/Capravirine.png","page_title":"کاپراویرین","context_page_description":"کاپراویرین بیر اورقانیک بیلشیک."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E6%9D%B1%E5%8D%80%E5%B0%A4%E5%BE%B7%E5%A4%AB%E4%BA%BA%E9%82%A3%E6%89%93%E7%B4%A0%E9%86%AB%E9%99%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Pamela_Youde_Nethersole_Eastern_Hospital.jpg","page_title":"東區尤德夫人那打素醫院","context_page_description":"東區尤德夫人那打素醫院（Pamela Youde Nethersole Eastern Hospital），簡稱東區醫院，係香港一間大型公立醫院，喺1993年10月15號成立，為港島東居民提供全面嘅專科服務，係醫院管理局港島東聯網轄下嘅六間醫院之一，地址係港島柴灣樂民道3號，個名係紀念港督尤德嘅夫人同雅麗氏何妙齡那打素醫院。"},{"page_url":"https://cy.wikipedia.org/wiki/Gorsaf_reilffordd_Pen-sarn","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Pensarn_railway_station_1.jpg","page_title":"Gorsaf reilffordd Pen-sarn","context_page_description":"Mae gorsaf reilffordd Pen-sarn yn gwasanaethu pentref bychan Pen-sarn yn ardal Ardudwy yng Ngwynedd, Cymru. Mae'r orsaf ar y Rheilffordd Arfordir y Cambrian gyda gwasanaethau teithwyr yn cael eu darparu gan Trafnidiaeth Cymru."},{"page_url":"https://en.wikipedia.org/wiki/Pinnacle_Peak_(King_County,_Washington)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Pinnacle_Peak_Enumclaw.jpg","page_title":"Pinnacle Peak (King County, Washington)","context_page_description":"Pinnacle Peak, also known as Mount Peak, is a 1,801 ft forest-covered summit located in King County of Washington state. It is part of the Cascade Range and is set at the western edge of the range, immediately south of Enumclaw, Washington and 25 miles northwest of Mount Rainier. There is also another summit named Pinnacle Peak in the Tatoosh Range to the south of Mount Rainier."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%B5%D1%80%D1%80%D0%B8,_%D0%9F%D0%B8%D1%82%D0%B5%D1%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Pieter_Serry.JPG","page_title":"Серри, Питер","context_page_description":"Питер Серри — бельгийский профессиональный шоссейный велогонщик, выступающий за команду мирового тура «Deceuninck-Quick Step»."},{"page_url":"https://kk.wikipedia.org/wiki/%D0%AD%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/69/Human_evolution.svg","page_title":"Эволюция","context_page_description":"Эволюция, биологияда – тірі организмдердің орта мен жағдайға бейімделіп, өзін өзгертетіні, ортаға үйлескендері жасап, үйлеспегендері жойылып отыратыны туралы идея болып, осы өзгеріс себепті олардың қабілеті үздіксіз артып, төмен деңгейден жоғары деңгейге көтеріледі деп есептейтін теория. Эволюциялық ілімінің негізін қалауда Чарльз Дарвинның еңбегі зор. Ол ашқан ең маңызды жаңалыққа дейін көптеген ғалымдардың еңбегі болды. Эволюциялық үдерістер зандылығы өте күрделі және ғалымдар күні бүгінге дейін толық анықтай алған жоқ. Алайда эволюцияның неге жүретіні бізге нақтылы белгілі.\\nЭволюция терминін алғашқы рет швейцарлық табиғаттанушы және философы Шарль Бонне 1762 жылы эмбриологияға арналған еңбектерінде пайдаланды. Эволюция құбылысы тіршілік деңгейлерінің барлық сатыларында байқалып, үнемі құрылысы мен атқаратын қызметтерінде бұрын болмаған жаңа құрылымдар мен олардың жаңа қызметімен ерекшеленеді. Эволюцияның ең қарапайым деңгейі – мутациялық өзгерістер болып есептелінеді. Табиғи сұрыпталу кезінде мутация арқылы пайда болған жаңа белгілер мен қасиеттер организмдердің жаңа орта жағдайларына бейімделуіне жағдай жасайды."},{"page_url":"https://fr.wikipedia.org/wiki/Aedes_japonicus","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8b/CDC_7887_Ochlerotatus_japonicus.jpg","page_title":"Aedes japonicus","context_page_description":"Aedes japonicus est une espèce de moustique hématophage initialement décrit en 1901, à Tokyo sur l'île de Honshu. Il est devenu une espèce invasive.\\nIl peut être confondu avec le moustique tigre.\\nSynonymes\\nHulecoeteomyia japonica\\nOchlerotatus japonicus\\nAedes japonicus\\nDû à la mondialisation des transports de personnes, biens et marchandises, il a été dispersé par l'Homme dans plusieurs régions du monde."},{"page_url":"https://da.wikipedia.org/wiki/Slaget_om_Fallujah","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Fallujah11092004-11-09.jpg","page_title":"Slaget om Fallujah","context_page_description":"Slaget om Fallujah var et slag der udspillede sig i den irakiske by Fallujah, hvor en amerikansk-irakisk styrke ledet af det amerikanske marinekorps ryddede byen for irakiske oprørere. Slaget kaldes også nogle gange for Det andet slag om Fallujah med henvisning til den tidligere Operation Vigilant Resolve, der er mindre kendt i offentligheden.\\nDet amerikanske militær kaldte operationen for \\"de voldsomste bykampe siden slaget om Hue under Vietnamkrigen.\\"\\nDen tidligere Operation Vigilant Resolve var blevet afbrudt inden byen blev erobret, fordi lokale ledere lovede at stoppe oprørerne."},{"page_url":"https://de.wikipedia.org/wiki/Bild_(Zeitung)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Eva_Herman_Portrait_2.jpg","page_title":"Bild (Zeitung)","context_page_description":"Bild ist die auflagenstärkste Tageszeitung in Deutschland.\\nDie seit dem 24. Juni 1952 im Axel-Springer-Verlag erscheinende überregionale Boulevardzeitung war lange Zeit die auflagenstärkste Tageszeitung Europas. Die verkaufte Auflage beträgt 1.241.142 Exemplare, ein Minus von 71,9 Prozent seit 1998.\\nIm Januar 2020 nutzten 458.942 Leser das kostenpflichtige Digitalangebot Bild plus. Nach Abonnentenzahlen ist es das größte in Europa und das fünftgrößte weltweit.\\nDas digitale Gesamtangebot der Bild-Zeitung ist die am meisten besuchte Nachrichtenseite Deutschlands und hatte laut einer Erhebung der Arbeitsgemeinschaft Online Forschung im März 2019 rund 25 Millionen Besucher.\\nIm März 2020 gab es 21 Bild-Redaktionen. Die bundesweite und 20 regionale, die zusätzlich zur Bundesausgabe 25 unterschiedliche regionale Ausgaben produzieren.\\nDie Berichterstattung der Bild ist seit Jahrzehnten Gegenstand zahlreicher öffentlicher Diskussionen und Kritik."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D1%80%D0%B0%D0%BB%D1%8C%D1%81%D0%BA%D0%BE%D0%B5_%D0%BC%D0%BE%D1%80%D0%B5","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8d/Kos-aral.jpg","page_title":"Аральское море","context_page_description":"Ара́льское море — бывшее бессточное солёное озеро в Средней Азии, на границе Казахстана и Узбекистана. С 1960-х годов уровень моря стал быстро снижаться, в том числе и вследствие забора воды из основных питающих рек Амударьи и Сырдарьи с целью орошения, в 1989 году море распалось на два изолированных водоёма — Северное и Южное Аральское море.\\nВ 2014 году восточная часть Южного Аральского моря полностью высохла, достигнув в тот год исторического минимума площади всего моря в 7297 км². Временно разлившись весной 2015 года, к осени 2015 года его водная поверхность вновь уменьшилась до 8303 км².\\nДо начала обмеления Аральское море было четвёртым по величине озером в мире."},{"page_url":"https://ceb.wikipedia.org/wiki/Waterstock","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/StLeonardsWaterstock.jpg","page_title":"Waterstock","context_page_description":"Parokya ang Waterstock sa Hiniusang Gingharian. Nahimutang ni sa kondado sa Oxfordshire ug apil sa nasod sa Inglatera, sa habagatang bahin sa nasod, 70 km sa kasadpan sa London ang ulohan sa nasod.\\nAng klima baybayon. Ang kasarangang giiniton 9 °C. Ang kinainitan nga bulan Agosto, sa 18 °C, ug ang kinabugnawan Enero, sa 1 °C."},{"page_url":"https://cs.wikipedia.org/wiki/Farn%C3%AD_sbor_%C4%8Ceskobratrsk%C3%A9_c%C3%ADrkve_evangelick%C3%A9_v_Praze_4_%E2%80%93_Mod%C5%99any","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Praha%2C_sbor_%C4%8CCE_v_Mod%C5%99anech_%282%29.jpg","page_title":"Farní sbor Českobratrské církve evangelické v Praze 4 – Modřany","context_page_description":"Farní sbor Českobratrské církve evangelické v Praze 4 - Modřany je sborem Českobratrské církve evangelické v Praze. Sbor spadá pod Pražský seniorát.\\nDuchovním sboru je farář Zvonimír Šorm, kurátorem sboru Tomáš Mikolášek.\\nRoku 2006 proběhla rekonstrukce sborového domu v provedení známého architekta a herce Davida Vávry."},{"page_url":"https://ja.wikipedia.org/wiki/%E7%AC%AC%E4%B8%80%E6%AC%A1%E3%82%B7%E3%83%A5%E3%83%AC%E3%83%BC%E3%82%B8%E3%82%A8%E3%83%B3%E6%88%A6%E4%BA%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/03/Crown_of_Bohemia_1648.png","page_title":"第一次シュレージエン戦争","context_page_description":"第一次シュレージエン戦争は、1740年から1742年にかけてシュレージエンの帰属を巡って行われたプロイセンとオーストリアの戦争。オーストリア継承戦争を構成する戦役の一つで、18世紀中期に戦われた一連のシュレージエン戦争の始まりである。訳の違いからシレジア戦争とも呼ばれるが、本項では「シレジア」は「シュレージエン」に統一している。\\n主戦場はシュレージエンのほか、モラヴィアとボヘミアも含まれる。プロイセンは開戦事由に数世紀前からのシュレージエンの一部への領土主張を挙げたが、戦争勃発にはレアルポリティークと地政戦略上の影響もみられる。女性であるマリア・テレジアがハプスブルク帝国を継承することに異議を唱えられたため、プロイセンがザクセン選帝侯領やバイエルン選帝侯領を出し抜いて勢力を増す機会となった。\\n戦争は1740年末にプロイセンがオーストリア領シュレージエンに侵攻したことで始まり、1742年のベルリン条約で終結を告げた。ベルリン条約により、プロイセンはシュレージエンの大半とボヘミアの一部を奪取したが、一方でオーストリア継承戦争は終結せず、わずか2年後にはプロイセン・オーストリア間の紛争が再発し第二次シュレージエン戦争が勃発した。大国オーストリアと比べて小国であるプロイセンがオーストリアに打ち勝ったことにより普墺角逐が始まり、以降1世紀以上のドイツ史に大きな影響を与えることとなった。"},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B1%D9%8A_%D9%85%D9%8A%D8%B3%D8%AA%D9%8A%D8%B1%D9%8A%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fc/Rey_Mysterio_October_2015.jpg","page_title":"ري ميستيريو","context_page_description":"ري ميستيريو جونير مصارع أمريكي من جذور لاتينية خاله الاسطورة المكسيكي ري ميستيريو سينير واسم ري ميستيريو في الاتينية يعني الملك الغامض وظهر على حلبات عالم المصارعة الحرة مبكرا وهوا في عمر 15 عام. يعتبر ري ميستيريو اسطورة فئة الكروزرويت التاريخي حين كان من مؤسسي هذه الفئة في الولايات المتحدة بمنتصف التسعينيات أوسكار جوتيرريز ‏ وهو مصارع محترف مشترك في اتحاد المصارعة للمحترفين ‏\\nبدأ حياته المهنية بالمصارعة حيث كان تلميذ عمه المعروف بري ميستريو الأب، وتعلم منه كل فنون المصارعة للوزن الخفيف، وفي عام 1989 عندما كان عمره 15 سنة بدأ مسيرته في تانجانا بالمكسيك حيث مُنع من المصارعة في الولايات المتحدة بسبب عمره الصغير. وصارع بإسم Colibri والتي تعني بالإسبانية عصفور الحلبة الطائر. وعندما وصل عمره 18 غير اسمه اقتدائاً بعمه وصار ري ميستريو وأُضيف له Jr. لكي يفرق بين الاثنين والتي تعني ري مسيتريو الابن. حيث انضم عام 1995 إلى اتحاد ECW وهناك حدثت معه عداوة بينه وبين بيكسوس مواطنه واستطاع التغلب عليه وتحقيق أول فوز على الصعيد الأمريكي. وفي نوفمبر عام 1995 وفي ولاية فيلادلفيا بعرض ECW One Night Stand استطاع ري ميستريو أن يفوز على بيكسوس في مباراة عنوانها Mexican Death Match."},{"page_url":"https://ceb.wikipedia.org/wiki/Heleophrynidae","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Heleophryne_orientalis.jpg","page_title":"Heleophrynidae","context_page_description":"Pamilya sa mga baki ang Heleophrynidae. Ang Heleophrynidae sakop sa kahanay nga baki, klase nga mananap nga baki, ka-ulo nga mananap nga adunay kord ang likod, ug kaginharian nga mananap. Ang kabanay nga Heleophrynidae pagsakop 6 espesye, segun Catalogue of Life.\\nMao ni ang iyang kladogram matod sa Catalogue of Life:"},{"page_url":"https://sv.wikipedia.org/wiki/Megastraea","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/31/Astraea_undosa.jpg","page_title":"Megastraea","context_page_description":"Megastraea är ett släkte av snäckor. Megastraea ingår i familjen turbinsnäckor.\\nKladogram enligt Catalogue of Life:"},{"page_url":"https://es.wikipedia.org/wiki/Mercu%C3%A8s","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/66/Map_commune_FR_insee_code_46191.png","page_title":"Mercuès","context_page_description":"Mercuès es una población y comuna francesa, situada en la región de Mediodía-Pirineos, departamento de Lot, en el distrito de Cahors y cantón de Cahors-Nord-Ouest."},{"page_url":"https://no.wikipedia.org/wiki/Hopperstad_stavkirke","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/Hopperstad_drawing.jpg","page_title":"Hopperstad stavkirke","context_page_description":"Hopperstad stavkirke er en stavkirke med hevet midtrom som står på gården Hopperstad nær Vikøyri i Vik kommune, Sogn og Fjordane fylke i Norge. Stavkirken skal være bygd omkring år 1130, og den står på sin originale tuft. Kirken, som også har vært kalt Hoprekstad eies av Fortidsminneforeningen. Dendrokronologiske prøver tatt i 1997 på syv forskjellige steder i kirken gav dateringer mellom 1034 og 1116, men ingen endelig datering. I 1982 ble det ved en reparasjon i nordre korsval avdekket et stolpehull, noe som kan indikere at det tidligere har stått en stolpekirke på stedet."},{"page_url":"https://he.wikipedia.org/wiki/%D7%98%D7%A8%D7%90%D7%95%D7%95%D7%A0%D7%99%D7%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Flag_of_Travnik.jpg","page_title":"טראווניק","context_page_description":"טראווניק היא עיר במרכז בוסניה והרצגובינה, בירת קנטון מרכז בוסניה השוכנת 90 קילומטרים מערבית לבירת המדינה סרייבו."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%97%E3%83%AC%E3%83%B3%E3%83%86%E3%82%A3%E3%82%B9","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1e/Donald_Trump_2006-09-27.jpg","page_title":"アプレンティス","context_page_description":"『アプレンティス』は、アメリカで制作・放送され、ブラジル、イギリスなどで現地版として制作・放送されているリアリティ番組。Apprenticeは、「見習い」を意味する英語。"},{"page_url":"https://en.wikipedia.org/wiki/Brymbo_Steelworks","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/Site_%28probable%29_of_Brymbo_%28GC%29_Station_by_Brymbo_Steelworks_-_geograph.org.uk_-_1928452.jpg","page_title":"Brymbo Steelworks","context_page_description":"The Brymbo Steel Works was a former large steelworks in the village of Brymbo near Wrexham, Wales. In operation between 1796 and 1990, it was significant on account of its founder, one of whose original blast furnace stacks remains on the site."},{"page_url":"https://ga.wikipedia.org/wiki/T%C3%ADr_na_mBascach_Theas","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Done_Bidendiko_Dorreak.jpg","page_title":"Tír na mBascach Theas","context_page_description":"Is comhphobal féinrialaitheach í Tír na mBascach Theas atá suite i ndeisceart Thír na mBascach. Is í Vitoria-Gasteiz an phríomhchathair.\\nSa bhliain 1978 tugadh stadas mar náisiún do Tír na mBascach. Tá a chuid cumhachtaí leagtha amach i Reacht Féinriail Tír na mBascach a thugann creatlach i gcomhair forbairt na mBascaigh sa Spáinn cé go raibh Navarre fágtha amach lena chomhophobal féinrialaitheach féin. Go hoifigiúil níl aon príomhchathair ag an réigiúin ach tá Parlaimint an chomhphobail agus teach an uachtaráin suite i Vitoria-Gasteiz agus mar sin is í sin an príomhchathair de facto. Is é Vitoria-Gasteiz, Álava, an Bardas is mó de réir achar le 277 cm2 de ach is í Bilbao na Bioscáine an chathair is mó de réir daonra de le 353,187 daoine ina gcónaí inti le ceirtleán uirbeach 75,500 daoine. Déanann Tír na mBascach tagairt ar ndóigh don réigiúin iomláin culturtha Bascach."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9E%D0%B1%D1%96%D0%B3%D0%BE%D0%B2%D1%96_%D0%BC%D0%BE%D0%BD%D0%B5%D1%82%D0%B8_%D0%86%D1%81%D0%BF%D0%B0%D0%BD%D1%96%D1%97_1869%E2%80%942001_%D1%80%D0%BE%D0%BA%D1%96%D0%B2_(%D0%BF%D0%B5%D1%81%D0%B5%D1%82%D0%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/1995_200_Pesetas.jpg","page_title":"Обігові монети Іспанії 1869—2001 років (песета)","context_page_description":"Песе́та — іспанська монета і грошова одиниця, яка була в обігу з 1869 по 2002 рік. Песета ділилася на 100 сентімо. Монети Іспанії карбувалися на Королівському монетному дворі в Мадриді. В списку вказані стандартні, ювілейні, пам'ятні та тематичні монети, які перебували в грошовому обігу Іспанії."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A3%D9%83%D8%B3%D9%88%D9%86%D9%8A%D9%88%D9%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Oxonium_Ions_V.1.svg","page_title":"أكسونيوم","context_page_description":"أيون الأوكسونيوم أو أوكسونيوم في الكيمياء هو تسمية أدخلت عام 2005 في الكيمياء للتعبير عن جزيء ماء اكتسب أيون الهيدروجين وأصبح في الهيئة\\n، وله شحنة موجبة واحدة. وبصفة عامة تسمى الأيونات التي اكتسبت أيون هيدروجين مثل:"},{"page_url":"https://tr.wikipedia.org/wiki/Lecco_ili","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/33/Lago_di_Olginate_e_Calolzio.JPG","page_title":"Lecco ili","context_page_description":"Lecco ili kuzeybati İtalya'da Lombardiya bölgesinin ili olup merkezi ismini aldığı Lecco şehridir. İlin alanı 1.772 km² olup bu ile bağlı olan 90 komün bulunur."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E8%88%92%E9%81%A9%E5%A0%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Physical_tuen_mun_branch.JPG","page_title":"舒適堡","context_page_description":"舒适堡美容健美中心是由陆毅强、何玉华夫妇于1986年创办的连锁式健身美容中心，代言人为郭富城，目前是香港分店规模第二大的健身公司，仅次于24/7 Fitness。舒适堡是当地最早创立之连锁健身中心，业务遍及香港及中国内地。其销售手法多年来备受争议，不时有市民投诉被骗。\\n公司注册处资料显示，以“舒适堡”名义注册的公司有20间，其中3间已解散，余下17间公司中，有14间公司董事都只有陆毅强及其妻何玉华两人，另有3间公司董事只有陆毅强一人。现时健身部拥有77间分店，美容部则有20间。初期健身部在美孚新邨，只招待女宾，并将健身美容集于一分店内，90年代末增设男女宾会所及开始将健身与美容业务分拆，直至2016年最后一间女宾健身店已改为男女宾。现时集团占地总面积约90万平方呎，拥有逾50万名客户。公司办公室位于北角电气道183号友邦广场23楼。"},{"page_url":"https://fr.wikipedia.org/wiki/Cath%C3%A9drale_Saint-Pierre_d%27Exeter","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Exeter_Cathedral_9578.jpg","page_title":"Cathédrale Saint-Pierre d'Exeter","context_page_description":"La cathédrale Saint-Pierre d'Exeter est la cathédrale du diocèse d'Exeter dans la ville d'Exeter dans le comté du Devon, dans le sud-ouest de l'Angleterre. Construite à partir du XIIᵉ siècle en architecture normande puis gothique à partir du milieu du XIIIᵉ siècle, en style decorated et achevée pour l'essentiel vers 1400; elle est dédiée à l'apôtre Pierre.\\nElle possède plusieurs caractéristiques notables dont un premier ensemble de miséricordes, des plafonds décorés, une horloge astronomique, une galerie de ménestrels, une bibliothèque de livres médiévaux, des reliques, des sépultures et la plus longue voûte ininterrompue d'Angleterre."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%A2%E3%83%91%E3%83%A9%E3%83%81%E3%82%A2%E3%83%B3_(%E6%8F%9A%E9%99%B8%E6%8C%87%E6%8F%AE%E8%89%A6)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/USS_Appalachian_%28AGC-1%29_underway_off_New_York_on_18_October_1943.jpg","page_title":"アパラチアン (揚陸指揮艦)","context_page_description":"アパラチアンは、アメリカ海軍の揚陸指揮艦。アパラチアン級揚陸指揮艦の1番艦であり、1942年11月4日にニュージャージー州カーニーのフェデラル・シップビルディング・アンド・ドライドック社で建造され、翌年1月29日にジョン・フランク・マクルニス夫人に命名され進水。同年2月27日に海軍に引き渡され、ニューヨーク州ブルックリンのトッド・パシフィック造船所で揚陸指揮艦に転換された。10月2日にジェームズ・M・ファーナンド大佐指揮下で就役した。"},{"page_url":"https://sv.wikipedia.org/wiki/Ledsk%C3%A4r","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/Ledsk%C3%A4rs_b%C3%A5k.jpg","page_title":"Ledskär","context_page_description":"Ledskär är ett skär i Lemlands kommun, Åland. Ledskär ligger cirka 600 meter sydväst om fasta Ålands sydligaste udde Herröskatan och utgör ett viktigt riktmärke för navigation i farvattnen söder om Åland."},{"page_url":"https://en.wikipedia.org/wiki/Legnano","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/07/Map_of_comune_of_Legnano_%28province_of_Milan%2C_region_Lombardy%2C_Italy%29.svg","page_title":"Legnano","context_page_description":"Legnano is an Italian town and comune in the north-westernmost part of the Province of Milan, about 20 kilometres from central Milan. With 60,259, it is the thirteenth-most populous township in Lombardy. Legnano is located in the Alto Milanese and is crossed by the Olona river.\\nThe history of Legnano and its municipal area has been traced back to the 1st millennium BC via archaeological evidence. Already in remote times, in fact, the hills that line the Olona proved to be habitable places. The town was established in 1261.\\nBecause of the historic victory of the Lombard League over Frederick Barbarossa at Legnano, it is the only town other than Rome named in the Italian national anthem. Every year the people of Legnano commemorate the battle with Palio di Legnano. In the institutional sphere, on 29 May, the date of the battle of Legnano, it was chosen as the regional holiday of Lombardy."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%86%D9%87%D8%A7%D9%84_%D8%A7%D9%88%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Nahal_Oz.jpg","page_title":"نهال اوز","context_page_description":"نهال اوز یک منطقهٔ مسکونی در اسرائیل است که در شورای منطقه ای شعار هاگنف واقع شده‌است."},{"page_url":"https://es.wikipedia.org/wiki/Shunga","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4f/Chonin_area_nihonbashi_1379.JPG","page_title":"Shunga","context_page_description":"El shunga es un género de estampas japonés que tiene como tema principal la representación del sexo. Está vinculado, principalmente, con la producción gráfica conocida como «estampas del mundo flotante», o xilografía ukiyo-e, del período Edo, a partir de imágenes de álbumes o de ilustraciones de textos de la literatura popular de entonces, así como con la producción pictórica de la época. A pesar de que su producción estuvo marcada por regulaciones y prohibiciones por parte del gobierno, la realización de este tipo de obras continuó prácticamente hasta finales de la era Meiji, con la prohibición de material «obsceno» en el Código penal japonés del año 1907.\\nLa traducción literal del vocablo japonés shunga significa «imágenes de primavera», ya que «primavera» es una metáfora común para el acto sexual. Las escenas describían relaciones sexuales de todo tipo, incorporando en ellas a los más variados actores de la sociedad japonesa de entonces, como a los miembros de la clase comerciante, samuráis, monjes budistas e inclusive seres fantásticos y mitológicos."},{"page_url":"https://zh.wikipedia.org/zh-hk/%E9%98%BF%E5%A4%AB%E5%85%B0%E5%BA%93%E5%B0%94","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/83/Map_commune_FR_insee_code_62421.png","page_title":"阿夫兰库尔","context_page_description":"阿夫蘭庫爾是法國北部-加來海峽大區加來海峽省的一個市鎮，屬於阿拉斯區貝當古縣。該市鎮2009年時的人口為403人。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%A6%CF%81%CE%B5%CE%B9%CE%B4%CE%B5%CF%81%CE%AF%CE%BA%CE%BF%CF%82_%CE%94%CE%84_%CF%84%CE%B7%CF%82_%CE%A3%CE%B1%CE%BE%CE%BF%CE%BD%CE%AF%CE%B1%CF%82-%CE%93%CE%BA%CF%8C%CF%84%CE%B1-%CE%86%CE%BB%CF%84%CE%B5%CE%BD%CE%BC%CF%80%CE%BF%CF%85%CF%81%CE%B3%CE%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/FrederikIVSGA.jpg","page_title":"Φρειδερίκος Δ΄ της Σαξονίας-Γκότα-Άλτενμπουργκ","context_page_description":"Ο Φρειδερίκος Δ΄, γερμ. Friedrich IV από τον Οίκο των Βέττιν ήταν δούκας της Σαξονίας-Γκότα-Άλτενμπουργκ."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E4%B8%AD%E5%9C%8B%E9%A2%A8%E4%BF%97%E7%95%AB","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Doucha.jpg","page_title":"中國風俗畫","context_page_description":"中国风俗画的起源可回溯至汉代。在辽阳、望都等墓地出土的墓葬艺术中，许多壁画、帛画、画像砖等作品上，常可以看见以“民间风俗、社会实况”为主题的绘画题材。但是“风俗画”一词最早却是出现在唐代，在朱景玄《唐朝名画录》一书中：“韩滉能图田家风俗、人物、水牛，曲尽其妙”，而由此书可知“风俗画”被定义为画作的题材之一。\\n风俗画题材多样，以下依据不同主题列举名作以供参考：\\n以历史事件呈现为主者，例如唐代李昭道的《明皇幸蜀图》即记录唐明皇车马抵达蜀地避乱之事；以娱乐休闲为题材者，例如北宋苏汉臣的《秋庭戏婴图》呈现儿童游玩等画面；以医药病理为主题者，例如宋代李唐的《炙艾图》；以床笫交合为题材者，例如明代唐寅《鸳鸯秘谱》，描绘男女性事欢愉；以生产活动为主者，例如明代吕文英《货郎图》一类记录货郎、打草鞋、农业生产、唱戏等等职业；以岁时节令为主题者，例如清代丁观鹏的《太平春市图》，呈现新春、灯节等民俗活动与欢庆场面；或是集合各点而成者，如北宋张择端的《清明上河图》。\\n以上主题举凡人间百态，皆系风俗画系统之题材范围。"},{"page_url":"https://en.wikipedia.org/wiki/Scioto_Country_Club","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Golf_Tournament_at_Scioto_Country_Club%2C_1918.jpg","page_title":"Scioto Country Club","context_page_description":"Scioto Country Club, is a private country club and golf course in the central United States, located in Upper Arlington, Ohio, a suburb northwest of Columbus. It hosted the U.S. Senior Open in August 2016."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%8A%D8%B1%D8%A7%D9%84%D8%AF_%D8%A8%D8%A7%D8%AA%D8%B1%D8%B3%D9%88%D9%86","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/ed/Gerald_Patterson.jpg","page_title":"جيرالد باترسون","context_page_description":"جيرالد باترسون ‏ مواليد 17 ديسمبر 1895 في فيتش، أستراليا - الوفاة 13 يونيو 1967 في ملبورن، كان لاعب كرة مضرب أسترالي بدأ مسيرته كمحترف سنة 1914 وكان يلعب باليد اليمنى، اعتزل اللعب في 1928. سبق أن كان المصنف الأول عالمياً. كما أنه أحد أبطال الجراند سلام."},{"page_url":"https://de.wikipedia.org/wiki/Raboisen_(Adelsgeschlecht)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Seal_Marquardus_de_Raboyze_1359.jpg","page_title":"Raboisen (Adelsgeschlecht)","context_page_description":"Raboisen war der Name eines alten holsteinischen Adelsgeschlechts."},{"page_url":"https://sq.wikipedia.org/wiki/Arkitektura_Badami_Chalukya","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/15/Badami_1.jpg","page_title":"Arkitektura Badami Chalukya","context_page_description":"Arkitektura Badami Chalukya është një stil ndërtimi tempujsh i evoluar gjatë periudhës nga shekulli i V deri në të VIII-in në zonën e Basenit Malaprabha, në distriktin modern të Bagalkotit në shtetin indian Karnataka, shpesh herë i quajtur stili Vesara ose stili Chalukya. Tempujt më të hershëm datojnë që nga viti 450 në Aihole kur Dinastia Badami Chalukya ishte vasale e asaj Kadamba të Banavasit dhe që janë po ashtu të reflektuar gjatë kësaj periudhe. Sipas historianit K.V. Sounder Rajan, kontributi Badami Chalukya në ndërtimin tempullor është i krahasueshëm me vlerën e arritjeve të tyre në beteja. Stili i tyre përfshinte dy tipe monumentesh, përkatësisht sallat e skalitura në shkëmbinj ose tempujt shpellor si dhe monumentet strukturore në sipërfaqe.\\nDinastia Badami Chalukya e quajtur edhe Dinastia e Hershme Chalukya, sundoi nga Badami Karnatakan në periudhën midis viteve 543 – 753 të e.s.. Shembujt më të përsosur të artit të tyre shihen në Pattadakal, Aihole dhe Badami në Karnatakan veriore. Trashëgimia më qëndrueshme e Dinastisë Chalukya është arkitektura dhe arti që ata lanë mbrapa."},{"page_url":"https://de.wikipedia.org/wiki/Peter,_Paul_and_Mary","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Peter%2C_Paul_and_Mary_2006.jpg","page_title":"Peter, Paul and Mary","context_page_description":"Peter, Paul and Mary war eine der erfolgreichsten US-amerikanischen Folk-Gruppen der 1960er Jahre. Das Trio bestand aus Peter Yarrow, Noel „Paul“ Stookey und Mary Travers."},{"page_url":"https://eu.wikipedia.org/wiki/Bayon","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Bayon_006.JPG","page_title":"Bayon","context_page_description":"Bayon tenplua, Kanbodiako Angkor hirian, Angkor Thomen erdian dagoen gurtza multzo bat da.\\nXII. mendearen amaieran eraikitzen hasi ziren eta Jayavarman VII.aren erregealdian amaitu, estilo budistan. Ezaguna da, batez ere, haren 54 dorre eta 200 misteriozko aurpegi irribarretsuengatik."},{"page_url":"https://sv.wikipedia.org/wiki/R%C3%B4nai","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b3/Map_commune_FR_insee_code_61352.png","page_title":"Rônai","context_page_description":"Rônai är en kommun i departementet Orne i regionen Normandie i nordvästra Frankrike. Kommunen ligger i kantonen Putanges-Pont-Écrepin som tillhör arrondissementet Argentan. År 2009 hade Rônai 163 invånare."},{"page_url":"https://en.wikipedia.org/wiki/Governor_of_Jakarta","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Soewahjo%2C_Republik_Indonesia%2C_Kotapradja_Djakarta-Raja%2C_p190_%28cropped%29.jpg","page_title":"Governor of Jakarta","context_page_description":"The Jakarta Special Capital Region is administratively equal to a province with special status as the capital of Indonesia., Instead of a mayor, the executive head of Jakarta is a governor. The governor of Jakarta is an elected politician who, along with the vice governor and 106 members of the Regional People's Representative Council, is accountable for the strategic government of the city of Jakarta."},{"page_url":"https://zh.wikipedia.org/wiki/2011%EF%BC%8D2012%E5%B9%B4%E5%8D%97%E5%A4%AA%E5%B9%B3%E6%B4%8B%E7%86%B1%E5%B8%B6%E6%B0%A3%E6%97%8B%E5%AD%A3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d3/20F_Apr_10_2012_0235Z.jpg","page_title":"2011－2012年南太平洋熱帶氣旋季","context_page_description":"2011－12年南太平洋熱帶氣旋季，泛指在2011年7月至2012年6月內的任何時間，於南太平洋所產生的熱帶氣旋。大部份於南太平洋的熱帶氣旋通常都會於11月至4月期間形成。\\n本條目的範圍僅侷限於赤道以南，東經160度以東的南太平洋水域。在南太平洋產生的熱帶氣旋是由斐濟和紐西蘭命名，而美國聯合颱風警報中心會把在該地區的熱帶低氣壓的編號以P字母作結。\\n以下各熱帶氣旋資訊以熱帶氣旋存在期間的最強形態為準。"},{"page_url":"https://el.wikipedia.org/wiki/%CE%9D%CF%84%CE%AD%CE%B9%CE%B2%CE%B9%CE%BD%CF%84_%CE%9C%CF%8C%CE%B9%CE%B6","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/David_Moyes_%28201551591%29.jpg","page_title":"Ντέιβιντ Μόιζ","context_page_description":"Ο Ντέιβιντ Μόιζ είναι σκωτσέζος προπονητής και πρώην ποδοσφαιριστής. Γεννήθηκε στις 25 Απριλίου 1963 στο Μπίρσντεν, προάστιο της Γλασκώβης και έκανε αξιόλογη καριέρα ως αμυντικός, παίζοντας μεταξύ άλλων στη Μπρίστολ Σίτι, την Ντανφέρμλιν και την Πρέστον, προτού ασχοληθεί επίσης επιτυχημένα με την προπονητική."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8E%9F%E9%A7%92%E5%AD%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/HaraKomako.jpg","page_title":"原駒子","context_page_description":"原 駒子は、日本の女優である。本名は倉形 駒子、妖婦・毒婦役で知られ「姐御女優」と呼ばれた。"},{"page_url":"https://pl.wikipedia.org/wiki/Mary_Landrieu","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e4/Mary_Landrieu%2C_official_photo_portrait%2C_2007.jpg","page_title":"Mary Landrieu","context_page_description":"Mary Loretta Landrieu – amerykańska polityk, działaczka Partii Demokratycznej. W latach 1997-2015 piastowała mandat senatora ze stanu Luizjana.\\nJest córką byłego burmistrza Nowego Orleanu Moona Landrieu i siostrą obecnego wicegubernatora stanu Mitcha Landrieu. Urodziła się w Arlington w Wirginii. Ukończyła stanowy uniwersytet Luizjany w roku 1977. Była członkinią Louisiana House of Representatives w latach 1980-1988. W roku 1995 bezskutecznie ubiegała się o stanowisko gubernatora stanu.\\nZostała wybrana w skład izby wyższej amerykańskiego Kongresu w roku 1996, ponownie wybrano ją w roku 2002 i 2008 roku. Należy do centrowego skrzydła swej partii.\\nW czasie kataklizmu spowodowanego huraganem Katrina ostro skrytykowała prezydenta George’a W. Busha i rząd federalny za niedostateczne przeciwdziałanie i spowodowane tym szkody.\\nMary L. Landrieu w roku 2004 była typowana na kandydata na wiceprezydenta u boku Johna Kerry’ego. Ostatecznie ten zdecydował się na start z Johnem Edwardsem. Landrieu brała aktywny udział w kampanii Kerry’ego."},{"page_url":"https://pt.wikipedia.org/wiki/Corticeiro_de_Cima","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Cantanhede_28.PNG","page_title":"Corticeiro de Cima","context_page_description":"Corticeiro de Cima foi uma freguesia portuguesa do concelho de Cantanhede, com 5,39 km² de área e 721 habitantes. A sua densidade populacional era 133,8 hab/km².\\nFoi extinta em 2013, no âmbito de uma reforma administrativa nacional, tendo sido agregada à freguesia de Vilamar, para formar uma nova freguesia denominada União das Freguesias de Vilamar e Corticeiro de Cima com a sede em Vilamar.\\nA sede dista cerca de doze quilómetros da cidade de Cantanhede, e a localidade fica situada no extremo norte do concelho. Confronta com Carapelhos e Fonte de Angeão, a norte, Vilamar, a nascente, Mira, a poente, e São Caetano, a sul.\\nA povoação é atravessada pela vala Velha que tem água quase todo o ano. Outrora alimentou os moinhos a que o povo chamava azenhas.\\nA actividade económica é maioritariamente baseada na agricultura, ourivesaria e mercado de electrodomésticos. O povoado possui ainda um grupo e Centro Sócio-Caritativo, local para desporto e um grupo Etnográfico. A sua população distribui-se por 4 lugares: Corticeiro de Cima, Vale do Corticeiro, Quinta e Cabeço Redondo."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D1%80%D0%BE%D0%B4%D1%81%D0%BA%D0%BE%D0%B9_%D1%82%D0%B5%D0%B0%D1%82%D1%80_%D0%A0%D0%B8%D0%BE-%D0%B4%D0%B5-%D0%96%D0%B0%D0%BD%D0%B5%D0%B9%D1%80%D0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b0/Teatro_Municipal_do_Rio_de_Janeiro061.JPG","page_title":"Городской театр Рио-де-Жанейро","context_page_description":"Муниципальный театр Рио-де-Жанейро — театр оперы и балета в Рио-де-Жанейро. Построен в 1907 году, прошел реконструкцию в 1975—1978 годах. Построенный в неоренессансном стиле театр украшают скульптуры Энрике Бернарделли и живописные работы Родолфо Амоэду и Элисеу Висконти. Вмещает 2357 зрителей."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%DB%8C%D8%A7%D9%87%D8%B1%DA%AF","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Venous_system_en.svg","page_title":"سیاهرگ","context_page_description":"سیاهرگ یا وَرید در دستگاه گردش خون بدن، رگی است که خون را از اندام‌ها به قلب بازمی‌گرداند. دیواره سیاهرگ نازک‌تر از سرخرگ است اما قطر بیشتری داشته و خاصیت ارتجاعی کمتری دارد. در سیاهرگ‌ها دریچه‌هایی به نام لانه کبوتری وجود دارد که این دریچه‌ها کمک می‌کنند تا خون از اندام پایینی مانند دست‌ها و پاها بهتر به سمت قلب حرکت کنند. به‌طور کلی خون تمامی قسمت‌های بدن توسط دو ورید به نام‌های اجوف فوقانی و تحتانی به دهلیز راست قلب برمی‌گردد.\\nهمه سیاهرگ‌ها خون تیره را منتقل می‌کنند به غیر از سیاهرگ‌های ششی و سیاهرگ نافی که خون روشن را منتقل می‌کنند."},{"page_url":"https://en.wikipedia.org/wiki/All_Saints_Church,_Crondall","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/All_saints_crondall_nave.JPG","page_title":"All Saints Church, Crondall","context_page_description":"All Saints Church is an Anglican parish church in the village of Crondall, Hampshire, England. It is a Grade I listed building and stands at the highest point in the village. Much of the church dates from the Norman period, although the original central tower was replaced by a brick one at the north-east corner in 1659 and some alterations, particularly to the fenestration, the nave arcades and transepts, and the north porch, were made in two stages during the 19th century.\\nAccording to Pevsner it is \\"a puzzle church and an extremely powerful one\\", while it has also been called \\"one of the finest parish churches in the country\\" and the \\"cathedral of North Hampshire\\". Of the 19th-century restoration of the building, Simon Jenkins states that \\"for once the Victorian does not emerge the winner, especially in the chancel\\", which latter Betjeman terms \\"splendid\\"."},{"page_url":"https://ceb.wikipedia.org/wiki/Municipio_Sucre_(munisipyo_sa_Miranda)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Bandera_del_Municipio_Sucre%2C_Miranda.jpg","page_title":"Municipio Sucre (munisipyo sa Miranda)","context_page_description":"Munisipyo ang Municipio Sucre sa Venezuela. Nahimutang ni sa estado sa Miranda, sa amihanang bahin sa nasod, 9 km sa sidlakan sa Caracas ang ulohan sa nasod. Adunay 665,203 ka molupyo. Naglangkob kin og 164 ka kilometro kwadrado.\\nAng yuta sa Municipio Sucre kay kabungtoran sa habagatan, apan sa amihanan nga kini mao ang kabukiran.\\nMga lungsod sa Municipio Sucre:\\nPetare\\nAng klima nga savanna. Ang kasarangang giiniton 21 °C. Ang kinainitan nga bulan Abril, sa 22 °C, ug ang kinabugnawan Enero, sa 20 °C. Ang kasarangang pag-ulan 1,500 milimetro matag tuig. Ang kinabasaan nga bulan Agosto, sa 243 milimetro nga ulan, ug ang kinaugahan Pebrero, sa 29 milimetro."},{"page_url":"https://es.wikipedia.org/wiki/Geometr%C3%ADa_egipcia","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Louvres-antiquites-egyptiennes-img_2748.jpg","page_title":"Geometría egipcia","context_page_description":"La geometría egipcia es la geometría desarrollada en el Antiguo Egipto. La geometría egipcia estaba muy desarrollada, como admitieron Heródoto, Estrabón y Diodoro, que aceptaban que los egipcios habían «inventado» la geometría y la habían enseñado a los griegos; aunque lo único que ha perdurado son algunas fórmulas –o, mejor dicho, algoritmos expresados en forma de «receta»– para calcular volúmenes, áreas y longitudes, cuya finalidad era práctica. Con ellas se pretendía, por ejemplo, calcular la dimensión de las parcelas de tierra, para reconstruirlas después de las inundaciones anuales. De allí el nombre γεωμετρία, geometría: «medición de la tierra».\\nAl igual que la aritmética, la geometría era una ciencia eminentemente práctica que ofrecía soluciones concretas a diversos problemas. Gran parte fue desarrollada por los escribas, funcionarios instruidos y cultos del antiguo Egipto que recibían lecciones de cálculo y escritura. Registraban el nivel del río Nilo, la producción de las cosechas, su almacenamiento, realizaban censos de población y ganado, registros de importación y exportación, etc."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%D9%84%D9%88%D8%A7%DA%AF%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/Allouagne.jpg","page_title":"الواگنی","context_page_description":"الواگنی یک کمون در فرانسه است که در پا-دو-کاله واقع شده‌است."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Colditz","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b9/Colditz_Tiergartenstrasse_3_Tiergartentorhaus.jpg","page_title":"Liste der Kulturdenkmale in Colditz","context_page_description":"Die Liste der Kulturdenkmale in Colditz enthält die Kulturdenkmale in Colditz.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://et.wikipedia.org/wiki/Kapten_(jalgpall)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Captainarmbandfifa.jpg","page_title":"Kapten (jalgpall)","context_page_description":"Jalgpallimeeskonna kapten on meeskonna liige, kes on valitud meeskonna juhiks väljakul: enamasti on selleks üks vanemaid või suuremate kogemustega mängija meeskonnas või mängija, kes suudab tugevalt mängu mõjutada. Meeskonna kaptenit saab tavaliselt tuvastada selle järgi, et ta kannab mängu ajal kaptenipaela. Kui kapten välja vahetatakse, annab ta oma kaptenipaela üle mängus olevale mängijale, kes kannab kapteni kohustusi mängu lõpuni."},{"page_url":"https://de.wikipedia.org/wiki/%C3%81rp%C3%A1d","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c9/Thebener_Burg_%28Dev%C3%ADn%29.jpg","page_title":"Árpád","context_page_description":"Árpád, Sohn des Fürsten Álmos und Großfürst der vereinten Magyarenstämme, war die führende Gestalt nach der ungarischen Landnahme und Begründer der Árpáden-Dynastie."},{"page_url":"https://ca.wikipedia.org/wiki/Hondures","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Izaguirre_Nov2010.jpg","page_title":"Hondures","context_page_description":"Hondures és una república de l'Amèrica Central que afronta a l'oest amb Guatemala i El Salvador, al sud amb Nicaragua i l'oceà Pacífic i al nord amb el golf d'Hondures i el mar Carib. Belize és solament a 75km enllà del golf d'Hondures.\\nTé una extensió de 112.090km² i una població estimada de 6.500.000 habitants. La capital és Tegucigalpa, amb 850.000 habitants i una aglomeració urbana d'un milió i mig, seguida de San Pedro Sula, que dins la seva aglomeració urbana conté la ciutat de Choloma; també passen dels cent mil habitants La Ceiba i El Progreso.\\nAdministrativament el país s'organitza en 18 departaments.\\nEl territori hondureny és muntanyós, amb estretes planes costaneres i un litoral accidentat: a la costa caribenya s'obre el golf d'Hondures i la llacuna de Caratasca, i a la costa del Pacífic hi ha el golf de Fonseca. Pertanyen també a Hondures les anomenades Islas de la Bahía. El clima varia de subtropical a les terres baixes fins a temperat a les muntanyes.\\nEl gentilici d'Honduras és hondurenc."},{"page_url":"https://de.wikipedia.org/wiki/Wasserpest","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/ElodeaNuttallii_Flowering.jpg","page_title":"Wasserpest","context_page_description":"Die Pflanzengattung Wasserpest gehört zur Familie der Froschbissgewächse. Die etwa sechs submersen Wasserpflanzen-Arten sind ursprünglich in der Neuen Welt weitverbreitet; drei davon sind in vielen Gebieten der Welt Neophyten."},{"page_url":"https://nl.wikipedia.org/wiki/Condom","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Condom_Gers_le_port.jpg","page_title":"Condom","context_page_description":"Condom is een gemeente in het Franse departement Gers en telt 7251 inwoners. De plaats maakt deel uit van het arrondissement Condom.\\nDe naam van de stad heeft niets te maken met het voorbehoedsmiddel condoom. Het is afgeleid van een oud woord voor \\"samenvloeiing\\". Het stadje ligt inderdaad aan de samenvloeiing van twee riviertjes."},{"page_url":"https://en.wikipedia.org/wiki/Ford_Popular","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Stonehouse%2C_Gloucestershire_..._Popular._-_Flickr_-_BazzaDaRambler.jpg","page_title":"Ford Popular","context_page_description":"The Ford Popular, often called the Ford Pop, is a car from Ford UK that was built in England between 1953 and 1962. When launched, it was Britain's lowest priced car.\\nThe name Popular was also used by Ford to describe its 1930s Y Type model. The Popular name was also later used on basic models of the Escort and Fiesta cars."},{"page_url":"https://fr.wikipedia.org/wiki/Mistail","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Mistail_aussen.jpg","page_title":"Mistail","context_page_description":"Mistail est un ensemble monastique de la commune d'Alvaschein, dans le canton suisse des Grisons. Il comprend l'église Saint-Pierre, datant de l'époque carolingienne, et un couvent de femmes, aujourd'hui disparu."},{"page_url":"https://id.wikipedia.org/wiki/Raymond_Massey","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1a/Raymond_Massey_1961_%28cropped%29.JPG","page_title":"Raymond Massey","context_page_description":"Raymond Hart Massey adalah seorang bintang film dan sandiwara berkebangsaan Amerika Serikat.\\nSelain di Amerika Serikat, Raymond Massey juga sudah memiliki pengalaman di panggung sandiwara Inggris. Ia menyelesaikan studi perguruan tinggi di Universitas Toronto dan juga Balliol College di Oxford. Ketika Perang Dunia I pecah, ia bergabung dalam Artileri Lapangan Kanada dan melakukan tugasnya di Prancis. Penampilan pertamanya sebagai seorang pemain sandiwara dilakukan kala itu, ketika ia berada di Siberia melakukan kewajibannya sebagai Tentara Amerika. Setelah Perang Dunia I usai, ia kembali ke Kanada dan mulai membuka bisnis tetapi tidak berhasil. Akhirnya ia bergabung dengan Teater Everyman di London pada tahun 1922. Semenjak itu, karier aktingnya semakin moncer, ditandai dengan penandatanganan kontrak 5 tahun dirinya dengan Alexander Korda. Karier aktingnya yang semakin gemilang ini juga membuat pangkat militer dalam Angkatan Militer Kanada hangus pada tahun 1943. Beberapa film terkenal yang dibintanginya antara lain serial televisi Dr."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%AC%D8%A8%D9%84_%D8%AA%D8%B4%D9%8A%D8%B3%D8%AA%D9%86%D9%88%D8%AA_(%D8%A7%D9%85%D8%B1%D9%8A%D9%83%D8%A7)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Western_side_of_Chestnut_Mountain%2C_North_Carolina.jpg","page_title":"جبل تشيستنوت (امريكا)","context_page_description":"تشيستنوت هوا جبل فى امريكا."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%A7%D0%B8%D0%BD%D0%BE%D0%B2%D0%B8_%D1%83_%D0%9E%D1%80%D1%83%D0%B6%D0%B0%D0%BD%D0%B8%D0%BC_%D1%81%D0%BD%D0%B0%D0%B3%D0%B0%D0%BC%D0%B0_%D0%A1%D0%A4%D0%A0%D0%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/4a/R46-yo0349-Podmornicka_znacka.png","page_title":"Чинови у Оружаним снагама СФРЈ","context_page_description":"Чинови у Оружаним снагама СФРЈ означавали су степен старешинства међу војницима, морнарима, питомцима војних школа, млађим и старијим официрима, генералима који су као војници, морнари, питомци војних школа, активних војних лица, резервни састав, грађанске особе на служби у оружаним снагама и остали припадници оружаних снага чинили систем оружаних снага Социјалистичке Федеративне Републике Југославије.\\nСистем оружаних снага СФРЈ чинили су Југословенска народна армија, Територијална одбрана, Савез резервних војних старешина и друге организације које је одредио савезни секретар за народну одбрану, структуре општенародне одбране и друштвене самозаштите, милиција у које је грађанин могао добити ратни распоред."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkm%C3%A4ler_in_Merkelbach","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e7/Zum_Dornbach_14_Mbach.jpg","page_title":"Liste der Kulturdenkmäler in Merkelbach","context_page_description":"In der Liste der Kulturdenkmäler in Merkelbach sind alle Kulturdenkmäler der rheinland-pfälzischen Ortsgemeinde Merkelbach aufgeführt. Grundlage ist die Denkmalliste des Landes Rheinland-Pfalz."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%90%D0%BC%D1%82%D1%86%D0%B5%D0%BB%D0%BB%D1%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/54/Sonnenuhr_Amtzell.jpg","page_title":"Амтцелль","context_page_description":"Амтцелль — коммуна в Германии, в земле Баден-Вюртемберг.\\nПодчиняется административному округу Тюбинген. Входит в состав района Равенсбург. Население составляет 3829 человек. Занимает площадь 30,56 км². Официальный код — 08 4 36 006."},{"page_url":"https://hu.wikipedia.org/wiki/Jap%C3%A1n_k%C3%B6z%C3%A9pkori_fegyverek","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Wakizashi_2.JPG","page_title":"Japán középkori fegyverek","context_page_description":"A japán kardoknak külön korszakai vannak, így a Japán középkor a Koto korszakba sorolandó. Japánban a középkorban nem hordhatott bárki fegyvert, ez a jog ugyanis a szamurájokat illette meg. Bár mellettük ott voltak a nindzsák is, mint fegyverhasználók. A japán középkorban kezdtek először megjelenni a modern lőfegyverek elődei is, például a portugál származású Teppó."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Lichtenfels_(Oberfranken)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Seubelsdorf-Hoftor-281.jpg","page_title":"Liste der Baudenkmäler in Lichtenfels (Oberfranken)","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberfränkischen Stadt Lichtenfels zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde.\\nDiese Liste gibt den Fortschreibungsstand vom 26. August 2014 wieder und enthält 317 Baudenkmäler."},{"page_url":"https://en.wikipedia.org/wiki/Danube","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/Belgrade_Panorama.jpg","page_title":"Danube","context_page_description":"The Danube is Europe's second-longest river, after the Volga. It is located in Central and Eastern Europe.\\nThe Danube was once a long-standing frontier of the Roman Empire and today flows through 10 countries. The river runs through the 2nd largest number of countries in the world with the Nile running through 11 countries. Originating in Germany, the Danube flows southeast for 2,850 km, passing through or bordering Austria, Slovakia, Hungary, Croatia, Serbia, Romania, Bulgaria, Moldova and Ukraine before draining into the Black Sea. Its drainage basin extends into nine more countries.\\nThe Danube river basin is home to fish species such as pike, zander, huchen, Wels catfish, burbot and tench. It is also home to a large diversity of carp and sturgeon, as well as salmon and trout. A few species of euryhaline fish, such as European seabass, mullet, and eel, inhabit the Danube Delta and the lower portion of the river.\\nSince ancient times, the Danube has become a traditional trade route in Europe. Today, 2,415 km of its total length are navigable. The river is also an important source of hydropower and drinking water."},{"page_url":"https://hr.wikipedia.org/wiki/MDNA_Tour","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/MDNATourTelAvivExpressYourselfGiveMeAllYourLuvin.jpg","page_title":"MDNA Tour","context_page_description":"MDNA Tour je deveta koncertna turneja američke pjevačice Madonne kojom je promovirala dvanaesti studijski album MDNA. Turneja je posjetila Aziju, Europu i obje Amerike. Na turneji su se po prvi puta našle neke nove postaje poput one u Ujedinjenim Arapskim Emiratima, Ukrajini te nekim u Sjedinjenim Državama, Kanadi te Kolumbiji. Iako je Madonna trebala posjetiti Zagreb 11. lipnja 2012. u sklopu ove turneje, koncert je 9. ožujka 2012. otkazan zbog logističkih poteškoća. Također je bilo predviđeno da će turneja posjetiti Australiju, te su bili zakazani datumi za siječanj 2013. godine, ali koncerti su otkazani pa je Madonna objavila i video ispriku na svoj službeni YouTube kanal.\\nMadonna je turneju opisala kao \\"putovanje iz tame u svjetlost\\". Koncert je podijeljen u četiri dijela: Transgression gdje su glavna tema oružje i nasilje, Prophecy koji je spoj veselih pjesama kaoje okupljaju ljude, Masculine/Feminine kao kombinacija senzualnosti i mode s nekoliko Madonninih pjesama otjpevanih u cabaret stilu, te Redemption kao završni dio kojeg je Madonna opisala kao \\"veliki tulum i slavlje\\"."},{"page_url":"https://ms.wikipedia.org/wiki/Kota_Kupang","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c2/Lambang_Kota_Kupang.jpg","page_title":"Kota Kupang","context_page_description":"Kota Kupang merupakan ibu kota provinsi Nusa Tenggara Timur, Indonesia. Keluasan wilayah adalah 180.27 km² dengan jumlah pendududuk sekitar ±450,000 orang. Daerah ini terbagi menjadi 4 kecamatan dan 45 desa."},{"page_url":"https://fa.wikipedia.org/wiki/%DB%8C%D9%88%D8%A7%D8%B3%E2%80%8C%D8%A7%D8%B3_%D9%85%D8%A7%D9%87%D8%A7%D9%86_(%D8%AF%DB%8C%E2%80%8C%D8%AF%DB%8C%E2%80%8C%D8%AC%DB%8C-%DB%B7%DB%B2)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/USS_Mahan_DDG-72_Crest.png","page_title":"یواس‌اس ماهان (دی‌دی‌جی-۷۲)","context_page_description":"یواس‌اس ماهان (دی‌دی‌جی-۷۲) یک کشتی است که طول آن ۵۰۵ فوت می‌باشد. این کشتی در سال ۱۹۹۶ ساخته شد."},{"page_url":"https://da.wikipedia.org/wiki/Etosha_nationalpark","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/Twee_Palms_Etosha.JPG","page_title":"Etosha nationalpark","context_page_description":"Etosha nationalpark ligger i det nordvestlige Namibia."},{"page_url":"https://vi.wikipedia.org/wiki/Syst%C3%A8me_universitaire_de_documentation","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/SUDOC_screenshot_2013.png","page_title":"Système universitaire de documentation","context_page_description":"Système universitaire de documentation là một hệ thống biên mục được dùng bởi các cơ sở đào tạo đại học của Pháp nhằm định danh, theo dõi và quản trị tài liệu thuộc sở hữu các cơ sở này. Cơ sở dữ liệu này gồm hơn 10 triệu mục tham chiếu, tạo điều kiện cho học viên và nhà nghiên cứu tìm kiếm nguồn tài liệu tham khảo ở hơn 3.400 trung tâm lưu trữ. Cơ quan chủ quản là Cơ quan Tài liệu tham khảo đại học của Pháp."},{"page_url":"https://de.wikipedia.org/wiki/Manerov","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Manerov.jpg","page_title":"Manerov","context_page_description":"Manerov ist ein Ortsteil der Gemeinde Bohdalice-Pavlovice in Tschechien. Sie liegt sechs Kilometer südlich von Vyškov und gehört zum Okres Vyškov."},{"page_url":"https://nl.wikipedia.org/wiki/Dar_M%C5%82odzie%C5%BCy_(schip,_1982)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Polish_tallship_Dar_Mlodziezy.png","page_title":"Dar Młodzieży (schip, 1982)","context_page_description":"De Dar Młodzieży is een Pools zeilschip. Het schip, ontworpen door Zygmunt Choreń, werd gebouwd op de scheepswerf van Gdansk, waar het in 1981 te water werd gelaten.\\nDe Dar Młodzieży is eigendom van de Hogere Zeevaartschool van Gdynia, die het schip inzet als opleidingsschip. Aan boord is plaats voor 120 + 30 cadetten en een vaste bemanning van 44 personen. De \\"Dar\\" is volledig uitgerust voor de opleiding van studenten in de maritieme wereld. Zo is er, onder de hoofd-navigatiebrug een extra brug uitgerust met dezelfde instrumenten en verschillende kaartentafels. Ook beschikt het schip over een apart klaslokaal.\\nZusterschepen van de Dar Młodzieży zijn Druzhba, Khersones, Mir, Pallada en Nasheba."},{"page_url":"https://en.wikipedia.org/wiki/Utility_bicycle","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Gazelle_Omafahrrad_series_-1.jpg","page_title":"Utility bicycle","context_page_description":"A utility bicycle, city bicycle, urban bicycle, European City Bike, classic bike or simply city-bike, is a bicycle designed for frequent short, moderately paced rides through relatively flat urban areas. It is a form of utility bicycle commonly seen around the world, built to facilitate everyday riding in normal clothes in a variety of weather conditions. It is therefore a bicycle designed for practical transportation, as opposed to those primarily for recreation and competition, such as touring bicycles, racing bicycles, and mountain bicycles. Utility bicycles are the most common form globally, and comprise the vast majority found in the developing world. City bikes may be individually owned or operated as part of a public bike sharing scheme.\\nGenerally as they are more suitable for urban environments, they focus more on comfort and practicality instead of speed or efficiency. They normally have a slightly curved, roughly planar aligned and elevated handlebar, providing users an upright sitting position. They have fewer gears and they often are heavier than road bicycles."},{"page_url":"https://en.wikipedia.org/wiki/Keri,_Greece","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/The_biggest_greek_flag_%E2%80%93_Keri_-_Zakynthos%2C_Greece_01.jpg","page_title":"Keri, Greece","context_page_description":"Keri is a village and a community in the southern part of the island of Zakynthos. It is situated on a hillside, close to the Ionian Sea coast. Its population in 2011 was 469 for the village and 788 for the community, which includes the villages Apelati, Limni Keriou and Marathias. The community includes the island's southernmost point, Cape Marathia. Keri is 6 km south of Lithakia and 15 km southwest of Zakynthos. The village suffered great damage from the 1953 Ionian earthquake.\\nKeri is also famous for nearby Keri cliffs, rising over 300 m from the Ionian Sea. This location is famous for its sunset. A 9-metre tall lighthouse, built in 1925, sits atop the cliffs."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D9%86%E2%80%8C%D8%B2%D8%A7%D8%B1_%D8%A8%D8%B2%D8%B1%DA%AF_%D8%AE%D8%A7%D9%88%D8%B1%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Les_monts_Atlas.png","page_title":"شن‌زار بزرگ خاوری","context_page_description":"شن‌زار بزرگ خاوری یک صحرای شنی در صحرای بزرگ آفریقا است. این بیابان در شمال شرقی الجزایر قرار دارد. این صحرا ابعادی در حدود ۶۰۰ در ۲۰۰ کیلومتر دارد. شن‌زار بزرگ خاوری از شمال شرقی به تونس راه پیدا می‌کند."},{"page_url":"https://de.wikipedia.org/wiki/Przerwanki","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7e/Przerwanki_Sapina_004.JPG","page_title":"Przerwanki","context_page_description":"Przerwanki ist ein Ort in der polnischen Woiwodschaft Ermland-Masuren, der zur Landgemeinde Pozezdrze im Powiat Węgorzewski gehört."},{"page_url":"https://de.wikipedia.org/wiki/M%C3%B6mpelgarder_Altar","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/180_W%C3%BCrttemberg_und_M%C3%B6mpelgard_M%C3%B6mpelgarder_Altar_Berufung_Matth%C3%A4us.jpg","page_title":"Mömpelgarder Altar","context_page_description":"Der Mömpelgarder Altar ist eine Bilderpredigt über das Leben und Wirken von Jesus Christus. Der um 1540 entstandene Altar besteht aus einem Mittelschrein sowie drei beweglichen Flügelpaaren mit insgesamt 157 Bildern, die wie ein Buch gelesen werden können. Gestaltet wurden die Bilder nach Entwürfen des Theologen Kaspar Gräter vom Herrenberger Renaissance-Maler Heinrich Füllmaurer auf Basis der Bibelübersetzung des Reformators Martin Luther aus dem Jahr 1522. Anhand der Daten, die in den vier Evangelien über Jesus Christus überliefert werden, entstand so eine Evangelienharmonie.\\nDas Original des Altars befindet sich gegenwärtig in der Kunstkammer des Kunsthistorischen Museums in Wien. Anlässlich des 500. Reformationsjubiläums ließ die Evangelische Kirchengemeinde Herrenberg 2015 im Rahmen des Themenjahrs „Bild und Bibel“ einen transportablen Nachbau anfertigen, der in der Stiftskirche Herrenberg auf der Turmempore beheimatet ist."},{"page_url":"https://de.wikipedia.org/wiki/Weerswilen","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/98/Weerswilen_TG.jpg","page_title":"Weerswilen","context_page_description":"Weerswilen ist eine frühere Ortsgemeinde und eine Siedlung im Kanton Thurgau in der Schweiz.\\nDie Ortsgemeinde Weerswilen war von 1803 bis 1994 Teil der Munizipalgemeinde Berg. Die Ortsgemeinde Weerswilen trennte sich 1995 – allerdings ohne die Ortschaft Beckelswilen – im Rahmen der Thurgauer Gemeindereform von der Munizipalgemeinde Berg ab und schloss sich der Einheitsgemeinde Weinfelden an."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AA%D8%B4%D9%8A%D8%AA%D8%A7_%D8%AF%D9%8A%D9%84%D8%A7_%D8%A8%D9%8A%D9%81%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Citt%C3%A0dellapieve03.jpg","page_title":"تشيتا ديلا بيفي","context_page_description":"تشيتا ديلا بيفي هي بلدية في مقاطعة بيرودجا في إقليم أومبريا في إيطاليا."},{"page_url":"https://pt.wikipedia.org/wiki/Apeadeiro_de_Senhora_das_Neves","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/71/Linha_do_Minho.svg","page_title":"Apeadeiro de Senhora das Neves","context_page_description":"O Apeadeiro de Senhora das Neves é uma gare da Linha do Minho, que serve Neves e Vila de Punhe, no concelho de Viana do Castelo, em Portugal."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%97%A9%E9%A4%90","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/Full_day_breakfast_in_fast_food_close_up.jpg","page_title":"早餐","context_page_description":"早餐是在早上享用的餐，通常是廣義上可以理解為睡醒後的第一餐。「早餐」一詞，字面之解釋為「打破禁食」。故在英語世界中，會出現如前述的理解，又或代表一種由傳統早餐食品所組成，全日均可食用的餐膳。\\n世界各地的早餐食品均有不同，惟通常都會包括一種具豐富碳水化合物的食品，如穀類、麥片、蔬果等，配上一種含高蛋白質的食品，再加上一種飲料。咖啡、茶、果汁、穀類、熱香餅、香腸、煙肉、麵包、新鮮蔬果、雞蛋、蘑菇、焗豆、鬆餅、蛋糕或配上牛油/植物牛油/果醬的土司，皆為常見的早餐食物。\\n營養專家指出，人從前一天的晚餐到早上起床前，至少有約10小時未進食，因此早餐為一天最重要的餐膳。種種研究亦發現，不吃早餐的人擁有新陳代謝及體重問題的比例遠較常人為高。"},{"page_url":"https://en.wikipedia.org/wiki/Pitambar_Deva_Goswami","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Pitambar_copy.jpg","page_title":"Pitambar Deva Goswami","context_page_description":"Pitambar Deva Goswami was a spiritual leader and social reformer in the Indian state of Assam. At age six, he was accepted into the monastic order of the Garamur Satra. Goswami was schooled in Sanskrit by Nityanandadeva Bhagawati Vidyavagish in the satra. When he was 21, he was appointed Satradhikar of the Garamur Satra after the death of Jogachandra Deva Satradhikar Goswami.\\nIn addition to studying Sanskrit grammar, literature, philosophy, religion and theology, Goswami taught himself English and modern Assamese literature. He learned Ayurveda, took lessons in vocal and instrumental classical music and invited experts from Calcutta to the satra."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%B9%D8%AF%D9%86%D8%A7%D9%86_%D8%A7%D9%84%D9%82%D9%8A%D8%B3%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Al-Kassie_with_Saddam.jpg","page_title":"عدنان القيسى","context_page_description":"عدنان القيسى انجليزى: Adnan Al-Kaissie، اسمه الحقيقى عدنان عبدالكريم احمد القيسى الفرضى، اتولد 1 مارس 1939، ده اسطوره المصارعه العراقى، وليه القاب عده واللى منها الذيب الابيض والجنرال عدنان، اشتهر شخصيه الشيخ عدنان القيسى، واللى هو ولد اخو مفتى العراق السابق قاسم القيسى، وده من الطايفه السنيه العراقيه."},{"page_url":"https://nl.wikipedia.org/wiki/Toepolev_Tu-154","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0c/Tupolev_Tu-154.svg","page_title":"Toepolev Tu-154","context_page_description":"De Toepolev Tu-154 is een driemotorig passagiersvliegtuig van de Russische vliegtuigontwerper Toepolev. Het toestel maakte zijn eerste vlucht op 4 oktober 1968 en was bedoeld ter vervanging van de verouderde Toepolev Tu-104, Antonov An-10 en Ilyushin Il-18. Het toestel is zo gebouwd dat het geschikt is om te starten en te landen op een onverharde landingsbaan. Tot begin 21e eeuw was dit het belangrijkste verkeersvliegtuig van Rusland. In 2005 maakte Toepolev bekend de productie te zullen staken. Een jaar later werd het laatste toestel afgeleverd aan de maatschappij Kuban Airlines met als registratie RA-85123. Het vliegtuig is 37 jaar in productie geweest, het is daarmee een van de langst gebouwde toestellen."},{"page_url":"https://es.wikipedia.org/wiki/Shari_Lewis","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6e/Shari_lewis_1960.JPG","page_title":"Shari Lewis","context_page_description":"Shari Lewis fue una ventrílocua, titiritera y presentadora televisiva de programas infantiles de nacionalidad estadounidense, popular entre el público en las décadas de 1960 y 1990. Fue sobre todo conocida por ser la primera marionetista en trabajar con el muñeco Lamb Chop actuando en Hi Mom, un show matinal emitido por la WNBC de la ciudad de Nueva York."},{"page_url":"https://nl.wikipedia.org/wiki/Renneval","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f6/Het_chateau_van_Renneval.jpeg","page_title":"Renneval","context_page_description":"Renneval is een gemeente in het Franse departement Aisne en telt 133 inwoners. De plaats maakt deel uit van het arrondissement Laon."},{"page_url":"https://cs.wikipedia.org/wiki/Salicylaldehyd","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/93/Salicylaldehyde-3D-balls-B.png","page_title":"Salicylaldehyd","context_page_description":"Salicylaldehyd je organická sloučenina patřící mezi aromatické aldehydy, je společně s 3-hydroxybenzaldehydem a 4-hydroxybenzaldehydem jedním z izomerů hydroxybenzaldehydu. Jedná se o olejovitou bezbarvou kapalinu, která má ve vyšších koncentracích zápach připomínající hořké mandle. Používá se na přípravu chelatačních činidel, z nichž některá jsou průmyslově významná."},{"page_url":"https://no.wikipedia.org/wiki/Liste_over_Ungarns_statsministre","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Istv%C3%A1n_Friedrich_Hungarian_Prime_Minister.jpg","page_title":"Liste over Ungarns statsministre","context_page_description":"Under følger en liste over Ungarns statsministre fra den første statsminister, Lajos Batthyány, tiltrådte embetet under Den ungarske revolusjonen i 1848 og fram til i dag. Statsministeren er sjef for Ungarns regjering."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D1%80%D0%BE%D1%82%D0%B8%D0%B2%D0%BE%D0%BF%D0%BE%D0%B6%D0%B0%D1%80%D0%BD%D1%8B%D0%B9_%D0%B7%D0%B0%D0%BD%D0%B0%D0%B2%D0%B5%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Semperoper_interior_2008_P01.jpg","page_title":"Противопожарный занавес","context_page_description":"Противопожарный занавес — огнеупорная дымонепроницаемая конструкция с нормируемым пределом огнестойкости, выполненная из негорючих материалов и опускаемая при пожаре для отделения сцены от зрительного зала. Служит для предотвращения распространения пожара и продуктов горения в течение нормируемого времени."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_de_personnalit%C3%A9s_n%C3%A9es_%C3%A0_Chicago","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/88/Hugh_Hefner_2007.jpg","page_title":"Liste de personnalités nées à Chicago","context_page_description":"Ci-dessous se dresse par ordre alphabétique une liste de personnalités nées dans la ville de Chicago aux États-Unis, avec année de naissance et profession:"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9C%D1%96%D0%B9%D0%BE%D1%81%D1%96_%D0%99%D0%BE%D1%81%D1%96%D1%86%D1%83%D0%B3%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Miyoshi_Yoshitugu.jpg","page_title":"Мійосі Йосіцугу","context_page_description":"Мійосі Йосіцугу — даймьо провінції Каваті у 1564—1573 роках."},{"page_url":"https://nl.wikipedia.org/wiki/Onweer","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/da/Rolling-thunder-cloud.jpg","page_title":"Onweer","context_page_description":"Onweer is een bui of cumulonimbus die gepaard gaat met elektrische ontladingen. Deze ontladingen zijn waarneembaar als een lichtflits – de bliksem – gevolgd door een scherp of dof rommelend geluid – de donder. Onweersbuien zijn wolken waarin een potentiaalverschil is opgebouwd door ladingscheiding. Over het ontstaan daarvan bestaan meerdere theorieën, waarin vooral vaste neerslag een belangrijke rol speelt. Bij droog onweer is de neerslag verdampt voordat deze het aardoppervlak bereikt.\\nOnweer is waarschijnlijk de generator die de atmosferische elektriciteit in gang houdt.\\nOnweer komt vrijwel overal ter wereld voor, behalve in de poolstreken. Boven de poolcirkels komt onweer vrij zelden voor. Het meest frequent doet dit weersverschijnsel zich voor in de tropen. In het klimaat van Centraal-Afrika komt onweer meer dan 200 dagen per jaar voor, in Oeganda zelfs op 240 dagen. In Nederland onweert het gemiddeld 21 tot 34 dagen per jaar.\\nDe activiteit van de onweersbuien kan van plaats tot plaats sterk uiteenlopen. Op de ene plaats kunnen tientallen millimeters regen vallen, terwijl het op enkele kilometers daarvandaan droog blijft. Ook windstoten en hagel kunnen heel lokaal optreden."},{"page_url":"https://vi.wikipedia.org/wiki/T%E1%BA%BFt_Nguy%C3%AAn_%C4%90%C3%A1n","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3b/Cay_quat.jpg","page_title":"Tết Nguyên Đán","context_page_description":"Tết Nguyên Đán là dịp lễ đầu năm âm lịch quan trọng và có ý nghĩa bậc nhất ở Việt Nam, cùng với văn hóa Tết Âm lịch của các nước Đông Á. Trước ngày Tết, người Việt có các phong tục như \\"cúng Táo Quân\\" và \\"cúng Tất Niên\\"\\nVì Tết tính theo Âm lịch nên Tết Nguyên Đán của Việt Nam muộn hơn Tết Dương lịch. Do quy luật 3 năm nhuận một tháng của âm lịch nên ngày đầu năm của dịp Tết Nguyên đán không bao giờ trước ngày 21 tháng 1 Dương lịch và sau ngày 19 tháng 2 Dương lịch mà rơi vào giữa những ngày này. Toàn bộ dịp Tết Nguyên đán hàng năm thường kéo dài trong khoảng 7 đến 8 ngày cuối năm cũ và 7 ngày đầu năm mới.\\nHàng năm, Tết được tổ chức vào ngày mồng 1 tháng Giêng âm lịch trên đất nước Việt Nam và ở một vài nước khác có cộng đồng người Việt sinh sống. Sắm đào và quất ở miền Bắc, miền Trung hay mai ở Miền Nam được coi là sự chuẩn bị không thể thiếu trong những ngày giáp Tết. Sau đó, trong những ngày Tết, các gia đình sum họp bên nhau, cùng thăm hỏi người thân, dành những lời chúc mừng tốt đẹp, mừng tuổi và thờ cúng tổ tiên... Theo phong tục tập quán, Tết thường có những điều kiêng kỵ."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E8%80%83%E6%BA%AA_(%E8%92%99%E5%A4%A7%E6%8B%BF%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/56/BullBottoms-11.22_09.JPG","page_title":"考溪 (蒙大拿州)","context_page_description":"考溪，又稱母牛溪。它是密蘇里河的一條支流。它長約35英里，位置在美國蒙大拿州中北部。考溪發源於布萊恩縣西部的貝爾波群山南部的山麓丘陵之中，先向東流，之後向南流，注入了密蘇里河。考溪是在一個峽谷中向下流入密蘇里河的。這個峽谷穿過了密蘇里斷裂處。密蘇里斷裂處是被嚴重侵蝕了的惡地。它在密蘇里河的兩側伸出。考溪峽谷的底下是一條可供旅行的路徑。從考溪北部的蒙大拿平原，經過這條路徑可以向下到達密蘇里河。考溪溪口的考島使得從密蘇里河涉水而過更加輕鬆。密蘇里河南岸，即是考溪相對於密蘇里河的另一邊。這裡有一條大起大落但很短的小道。這條小道和考溪峽谷的路徑一同組成了一條道路。這條道路連通了蒙大拿平原北部到其中部和南部。遷徙的北美野牛和遊牧的美洲原住民們幾個世紀以來都在使用這條考溪峽谷路徑。在密蘇里河的汽船時代期間，當水位較低以至於內河輪船無法逆水航行到本頓堡時，考溪溪口就會成為輪船的乘客登陸處和貨站，而考島小道至此開始。貨物繼續通過這條小道，先逆著考溪向北而行，之後向西，一直被運輸到本頓堡。在1877年，逃往加拿大的內茲珀斯印第安人部落在考溪沿岸有過幾場小規模戰鬥，其中包括「考島戰鬥」。而幾天後，當內茲珀斯人在考溪旁紮營時，他們認為他們此時已經到了美國陸軍的可及範圍之外，於是他們決定慢下來，而不堅持奔向加拿大邊境。這一決定也同時決定了他們失敗的命運。今天，有現代的公路從考溪旁經過，而野牛和遊牧的印第安人則已經消失了。在名為「蒙大拿州密蘇里斷裂處」的這一廣大區域中，考溪位於其中位置最偏僻的偏遠地區之一。這裡的活動已經暫停了。"},{"page_url":"https://fr.wikipedia.org/wiki/Hans-Peter_Friedrich","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/2020-02-13_Hans-Peter_Friedrich_%28Bundestagsprojekt_2020%29_by_Sandro_Halank%E2%80%932.jpg","page_title":"Hans-Peter Friedrich","context_page_description":"Hans-Peter Friedrich, né le 10 mars 1957 à Naila, est un homme politique allemand, membre de l'Union chrétienne-sociale en Bavière."},{"page_url":"https://it.wikipedia.org/wiki/Battaglia_di_fiori","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/Battle_of_Flowers_2007_Jersey_Optimists_Vikings.jpg","page_title":"Battaglia di fiori","context_page_description":"La battaglia di fiori o anche, popolarmente, battaglia dei fiori era una sfilata di carri fioriti che si svolgeva annualmente a Ventimiglia nella seconda metà del mese di Giugno."},{"page_url":"https://en.wikipedia.org/wiki/Kim_Sung-cheol","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/aa/Kim_Seong-cheol%2C_2016_%28cropped%29.jpg","page_title":"Kim Sung-cheol","context_page_description":"Kim Sung-cheol is a South Korean actor under Story J Company. He is best known for playing Kim Young-cheol in the drama Prison Playbook."},{"page_url":"https://es.wikipedia.org/wiki/Evelio_Vadillo","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Evelio_y_Anselmo_2.JPG","page_title":"Evelio Vadillo","context_page_description":"Evelio Vadillo Martínez fue un abogado, militante de las juventudes del Partido Comunista Mexicano. Conocido por ser el único mexicano encarcelado durante la llamada Gran Purga, en la que Josif Stalin envió a prisión a miles de militantes comunistas y ejecutó a decenas dirigentes de la Unión de Repúblicas Socialistas Soviéticas.​"},{"page_url":"https://pl.wikipedia.org/wiki/Blizan%C3%B3w_(gmina)","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/db/Blizan%C3%B3w_%28gmina%29_location_map.png","page_title":"Blizanów (gmina)","context_page_description":"Blizanów – gmina wiejska w województwie wielkopolskim, w powiecie kaliskim. W latach 1975–1998 gmina położona była w województwie kaliskim.\\nSiedziba gminy to Blizanów.\\nWedług danych z 31 grudnia 2016 gminę zamieszkiwało 9856 osób."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B4%D9%87%D8%B1%D8%B3%D8%AA%D8%A7%D9%86_%D9%88%D9%84%D8%B2%D8%8C_%D8%A7%DB%8C%D9%86%D8%AF%DB%8C%D8%A7%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/47/Wells_County_Courthouse_P4020318.jpg","page_title":"شهرستان ولز، ایندیانا","context_page_description":"شهرستان ولز، ایندیانا شهرستانی در ایالات متحده آمریکا است که در ایندیانا واقع شده‌است."},{"page_url":"https://cs.wikipedia.org/wiki/Stupe%C5%88_B1036_Falconu_9","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/Second-generation_titanium_grid_fins%2C_Iridium-2_Mission_%2835533873795%29.jpg","page_title":"Stupeň B1036 Falconu 9","context_page_description":"Stupeň B1036 Falconu 9 je první stupeň rakety Falcon 9 vyráběné společností SpaceX. Poprvé tento první stupeň letěl v červnu 2017 při misi Iridium NEXT 11-20, kdy úspěšně přistál na plošině Just Read the Instructions. Poprvé byla použita nová titanová kormidla, která lépe odolávají teplotě při návratu. Následně byl stupeň zrenovován a použit v prosinci 2017 při misi Iridium NEXT 31-40. To byl také jeho poslední let, protože nebyl učiněn pokus o jeho záchranu."},{"page_url":"https://hu.wikipedia.org/wiki/2008-as_szerbiai_eln%C3%B6kv%C3%A1laszt%C3%A1s","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Istvan_Pastor_MP.jpg","page_title":"2008-as szerbiai elnökválasztás","context_page_description":"A 2008-as szerbiai elnökválasztás volt az első elnökválasztás Szerbiában Szerbia és Montenegró szétválása óta. Az első fordulót 2008. január 20-án, a másodikat február 3-án rendezték meg.\\nAz elnökválasztás két legesélyesebb jelöltje a korábbi államfő, Boris Tadić és a radikális párti Tomislav Nikolić volt. Végül szoros versenyben Tadić nyert, ismét ő lett az államfő.\\nKoszovóban az albánok bojkottálták a szavazást, csak a szerbek által lakott vidékeken tartották meg."},{"page_url":"https://eo.wikipedia.org/wiki/IEEE_1394","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/FireWire_gniazdo.jpg","page_title":"IEEE 1394","context_page_description":"IEEE 1394 – estas normo de rapidega seria buso oficialigita de IEEE.\\nEkde komence la buson prezentis firmao Apple en 1986 kaj nomis ĝin FireWire. La firmao intencis, ke la buso anstataŭu la multekostan interfacon SCSI por komuti flankaparataron. Firmao Sony nomas la buson iLink. IEEE 1394 estas rapidega seria buso funkcianta malsinkrone kaj realtempe, kio tre gravas por transdono de ciferecaj videoaj kaj sonaj datenoj. La buso estas vaste uzata por komuti neĉekomputilan aparataron.\\nNormo IEEE 1394 priskribas du kategoriojn de busoj: kabloj kaj regiloj. Buso de regilo estas paralela buso arboforma, konsistanta el pontoj kaj nodoj. 64-bita adreso konsistas el:\\n6-bita adreso nod_ID.\\n10-bita bus_ID.\\n48-bita adreso.\\nEblas kunkomuti ĝis 16 kablojn po 4,5 m, kio sume estas 72 m – maksimuma longeco de kablo. La buso permesas «varman» al-forkonektadon kaj tujan aŭtomatan sindeĉifron de komutanta aparato. IEEE 1394 permesas elektronutron de komutataj aparatoj. Laŭ varianto de la normo IEEE 1394a-2000 rapideco de la buso povas esti 100, 200 kaj 400 Mb dum sekundo."},{"page_url":"https://it.wikipedia.org/wiki/Mebeverina","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Mebeverine3.png","page_title":"Mebeverina","context_page_description":"La mebeverina è un antispastico utilizzato nella sindrome del colon irritabile. A differenza di altri farmaci d'uso comune, la mebeverina non ha un'azione anticolinergica. Gli studi dimostrano che la sua azione si esplica direttamente sulle fibre muscolari lisce, riducendo la permeabilità al sodio e al calcio in modo tale da ridurne la contrazione. Viene somministrato come mebeverina cloridrato con numero CAS 2753-45-9."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9F%D0%BE%D0%BA%D0%BE%D1%82%D0%B8%D0%BB%D0%BE,_%D0%92%D0%B0%D1%81%D0%B8%D0%BB%D0%B8%D0%B9_%D0%98%D0%B2%D0%B0%D0%BD%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/ru/c/cf/Pokotilo_V.I..jpg","page_title":"Покотило, Василий Иванович","context_page_description":"Васи́лий Ива́нович Покоти́ло — российский военный деятель, генерал от кавалерии. Военный губернатор и наказной атаман Семиреченского, Уральского казачьих войск, Всевеликого Войска Донского, участник Русско-турецкой войны 1877—1878 годов, Первой мировой войны и Гражданской войны на стороне Белого движения."},{"page_url":"https://en.wikipedia.org/wiki/Jerusalem","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Ben_Zakai.jpg","page_title":"Jerusalem","context_page_description":"Jerusalem is a city in the Middle East, located on a plateau in the Judaean Mountains between the Mediterranean and the Dead Sea. It is one of the oldest cities in the world, and is considered holy to the three major Abrahamic religions—Judaism, Christianity, and Islam. Both Israel and the Palestinian Authority claim Jerusalem as their capital, as Israel maintains its primary governmental institutions there and the State of Palestine ultimately foresees it as its seat of power; however, neither claim is widely recognized internationally.\\nDuring its long history, Jerusalem has been destroyed at least twice, besieged 23 times, captured and recaptured 44 times, and attacked 52 times. The part of Jerusalem called the City of David shows first signs of settlement in the 4th millennium BCE, in the shape of encampments of nomadic shepherds. Jerusalem was named as Urusalim on ancient Egyptian tablets, probably meaning \\"City of Shalem\\" after a Canaanite deity, during the Canaanite period."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E6%A2%85%E9%87%8C%E5%A5%87%E8%90%8A%E9%87%8C","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/38/Merichleri_location_in_Bulgaria.png","page_title":"梅里奇萊里","context_page_description":"梅里奇萊里是保加利亞的城鎮，位於該國南部馬里查河畔，毗鄰奇爾潘，由哈斯科沃州負責管轄，面積46.22平方公里，海拔高度150米，2010年人口1,908。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D1%82%D0%B5%D0%BF%D0%B0%D0%BD%D0%BE%D0%B2%D0%B0,_%D0%90%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%B0_%D0%9D%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a5/20180119_Euros_-_Stepanova_%26_Bukin_-_11197.jpg","page_title":"Степанова, Александра Николаевна","context_page_description":"Александра Николаевна Степанова — российская фигуристка, выступающая в танцах на льду в паре с Иваном Букиным. Они — серебряные призёры чемпионата Европы, бронзовые призёры чемпионатов Европы, чемпионы мира среди юниоров, победители юниорского финала Гран-при, трёхкратные серебряные призёры чемпионата России, бронзовые призёры чемпионата России, трёхкратные победители турнира серии «Челленджер» Finlandia Trophy. Мастер спорта России международного класса.\\nПо состоянию на 8 августа 2019 года пара занимает 4-е место в рейтинге Международного союза конькобежцев."},{"page_url":"https://el.wikipedia.org/wiki/%CE%91%CE%B3%CF%81%CE%B9%CF%8C%CE%B3%CE%B1%CF%84%CE%B1_%CF%84%CE%B7%CF%82_%CE%AC%CE%BC%CE%BC%CE%BF%CF%85","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e9/Persian_sand_CAT.jpg","page_title":"Αγριόγατα της άμμου","context_page_description":"Η Αγριόγατα της άμμου, επίσης γνωστή ως Αγριόγατα των αμμολόφων, είναι ένα Αιλουροειδές, που ανήκει στο γένος Φέλις, της οικογένειας των Αιλουρίδων. Η αγριόγατα της άμμου, είναι το μοναδικό είδος των Αιλουρίδων που ζει πρωτίστως σε πραγματικές ερήμους. Αυτή η μικρή αγριόγατα είναι ευρέως διαδεδομένη στις ερήμους της Βορείου Αφρικής και της Νοτιοδυτικής και Κεντρικής Ασίας. Από το 2002, έχει χαρακτηρισθεί ως Προ Απειλής από την IUCN επειδή ο πληθυσμός θεωρείται κατακερματισμένος και μικρός με μια τάση μείωσης.\\nΟι αγριόγατες της ερήμου απαντούν τόσο σε αμμώδεις όσο και σε πετρώδεις ερήμους, ζώντας σε περιοχές μακριά από νερό. Έχοντας πόδια με παχύ τρίχωμα, είναι καλά προσαρμοσμένες στις ακραίες συνθήκες ενός ερημικού περιβάλλοντος και ανθεκτική σε εξαιρετικά υψηλές ή χαμηλές θερμοκρασίες.\\nΟ Βικτόρ Λος ήταν ο πρώτος Ευρωπαίος που περιέγραψε την αγριόγατα της άμμου το 1858 βασιζόμενος σε ένα δείγμα που βρέθηκε στην αλγερινή Σαχάρα. Πρότεινε να ονομαστεί το είδος Felis margarita προς τιμήν του Ζαν Ωγκύστ Μαργκερίτ, που ήταν επικεφαλής της αποστολής."},{"page_url":"https://fr.wikipedia.org/wiki/Hazel_Dickens","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/Hazel_Dickens.jpg","page_title":"Hazel Dickens","context_page_description":"Hazel Dickens, née le 1ᵉʳ juin 1935 à Montcalm, dans le comté de Mercer et morte le 22 avril 2011 à Washington, est une chanteuse de bluegrass, auteur-compositeur, contrebassiste et guitariste américaine."},{"page_url":"https://cs.wikipedia.org/wiki/Johann_Joseph_Fux","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Johann_Joseph_Fux.jpg","page_title":"Johann Joseph Fux","context_page_description":"Johann Joseph Fux byl rakouský barokní hudební skladatel a osobnost barokní Evropy.\\nZ jeho učebnice kontrapunktu, kterou dokončil v roce 1725 pod názvem Gradus ad Parnassum, se učila komponovat řada skladatelů 18. století, včetně Wolfganga A. Mozarta či Ludwiga van Beethovena. Jan Dismas Zelenka, čelní osobnost českého hudebního baroka, nabyl kompozičních zkušeností především od Johanna Josepha Fuxe, svého učitele."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_gemeentelijke_monumenten_in_Rotterdam_Noord","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Rotterdam_van_aerssen_brug.jpg","page_title":"Lijst van gemeentelijke monumenten in Rotterdam Noord","context_page_description":"Het stadsdeel Rotterdam-Noord kent 51 gemeentelijke monumenten:"},{"page_url":"https://sv.wikipedia.org/wiki/USA:s_justitieminister","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/0e/Roger_Taney.jpg","page_title":"USA:s justitieminister","context_page_description":"USA:s justitieminister leder USA:s justitiedepartement, vars huvudkontor ligger i Robert F. Kennedy Department of Justice Building i Washington, D.C. Justitieministern nomineras av USA:s president och godkänns av senaten. Justitieminister anses vara en av de mer prestigefyllda ministerposterna i USA:s kabinett och är den nummer sju i presidentämbetets succesionsordning.\\nMinisterns närmaste medarbetare är Deputy Attorney General och Associate Attorney General, samt Solicitor General, vilken företräder den federala statsmakten inför USA:s högsta domstol."},{"page_url":"https://en.wikipedia.org/wiki/Shuocheng_District","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/55/ChinaShuozhouShuocheng.png","page_title":"Shuocheng District","context_page_description":"Shuocheng District, formerly Shuo County, is the main urban district of the prefecture-level city of Shuozhou in Shanxi province, China."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D0%BE%D0%BD%D1%82%D0%B0%D1%80%D0%BA%D0%B0%D0%B4%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/48/Fontarcada_igreja.JPG","page_title":"Фонтаркада","context_page_description":"Фонтаркада — район в Португалии, входит в округ Брага. Является составной частью муниципалитета Повуа-де-Ланьозу. Находится в составе крупной городской агломерации Большое Минью. По старому административному делению входил в провинцию Минью. Входит в экономико-статистический субрегион Аве, который входит в Северный регион. Население составляет 1362 человека на 2001 год. Занимает площадь 5,60 км².\\nПокровителем района считается Иисус Христос."},{"page_url":"https://de.wikipedia.org/wiki/Bertsdorfer_Wasser","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/BertsdorfWasser.jpg","page_title":"Bertsdorfer Wasser","context_page_description":"Das Bertsdorfer Wasser, auch die Bertse genannt, ist ein 5,2 km langer Bach in der südostsächsischen Gemeinde Bertsdorf-Hörnitz im Landkreis Görlitz, der in Hörnitz von rechts in die untere Mandau mündet, hier Grenzgewässer zur Stadt Zittau."},{"page_url":"https://de.wikipedia.org/wiki/Bremgarten-Dietikon-Bahn","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Ce22_9b.jpg","page_title":"Bremgarten-Dietikon-Bahn","context_page_description":"Die Bremgarten-Dietikon-Bahn ist eine ehemalige Privatbahngesellschaft in der Schweiz, die eine schmalspurige Strecke von Bremgarten im Kanton Aargau nach Dietikon im Kanton Zürich erbaute. Später hat sie die normalspurige Strecke von Bremgarten nach Wohlen der ehemaligen Wohlen-Bremgarten-Bahn gepachtet und mit einem Dreischienengleis versehen. Dadurch entstand ein durchgehender Betrieb von Wohlen nach Dietikon.\\nDie BD fusionierte im Jahr 2000 mit der Wohlen-Meisterschwanden-Bahn zur BDWM Transport AG welche wiederum am 19. Juni 2018 mit der Wynental- und Suhrentalbahn zur Aargau Verkehr AG fusionierte. Die Strecke ist als S 17 seit 1990 in die S-Bahn Zürich und seit 2008 auch in die S-Bahn Aargau eingebunden. Die Normalspur des Dreischienengleises Wohlen und Bremgarten West wurde im Sommer 2016 abgebaut."},{"page_url":"https://en.wikipedia.org/wiki/Maximilien_Luce","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Maximilien_Luce_Sc%C3%A8ne_de_Rue_%C3%A0_Paris_1896.jpg","page_title":"Maximilien Luce","context_page_description":"Maximilien Luce was a prolific French Neo-impressionist artist, known for his paintings, illustrations, engravings, and graphic art, and also for his anarchist activism. Starting as an engraver, he then concentrated on painting, first as an Impressionist, then as a Pointillist, and finally returning to Impressionism."},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_Cambridgeshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f8/Leighton_Bromswold_Church_-_geograph.org.uk_-_1467609.jpg","page_title":"Grade I listed buildings in Cambridgeshire","context_page_description":"There are approximately 372,905 listed buildings in England and 2.5% of these are Grade I. This page is a list of these buildings in the county of Cambridgeshire, by district."},{"page_url":"https://fr.wikipedia.org/wiki/Liste_des_tableaux_de_Rembrandt","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/Rembrandt_Portrait_of_the_Dyke_Reeve_Dirck_van_Os.jpg","page_title":"Liste des tableaux de Rembrandt","context_page_description":null},{"page_url":"https://no.wikipedia.org/wiki/James_Blake","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Blake_Estoril_Open_2009_3.jpg","page_title":"James Blake","context_page_description":"James Blake er en amerikansk profesjonell tennisspiller.\\nHan har vunnet ti singeltitler på ATP-touren og hans beste i Grand Slam-turneringer er to kvartfinaler i US Open.\\nJames Blake er kjent for harde slag. Han tar ofte ballen tidlig for å sette press på motstanderen eller få en ren vinner. James Blake er best på raske underlag.\\n14. august 2008 slo Blake Roger Federer ut av kvartfinalen i sommer-OL 2008i to strake sett."},{"page_url":"https://it.wikipedia.org/wiki/The_Stranger_(film_1910)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c3/The_Stranger_%28Kalem%29.jpg","page_title":"The Stranger (film 1910)","context_page_description":"The Stranger è un cortometraggio del 1910 diretto da Sidney Olcott interpretato da Gene Gauntier e da Robert G. Vignola."},{"page_url":"https://de.wikipedia.org/wiki/Jean-Baptiste_Regnault","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Jean-Baptiste_Regnault_001.jpg","page_title":"Jean-Baptiste Regnault","context_page_description":"Baron Jean-Baptiste Regnault war ein französischer Maler des Klassizismus."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%B9%8C%ED%8A%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Auflage_Bild_%281998-2011%29.png","page_title":"빌트","context_page_description":"빌트는 악셀 스프링거 AG에 의해 출간되는 독일 타블로이드식의 신문이다. 월요일부터 토요일까지 발행되며, 일요일은 빌트 암 존탁이 대신해서 발행된다. 빌트 암 존탁은 각각 다른 편집자가 다른 스타일로 편집한다. 빌트는 타블로이드 신문임에도 불구하고 보통 사이즈의 신문으로 나온다. 또한 빌트는 유럽에서 가장 잘 팔리는 신문이고 전 세계적으로 6번째로 큰 유통을 가지고 있다. 신문 로고 밑에 있는 슬로건 “독립적, 초당적”은 지지하는 정당이 없다는 뜻이다. 광고에서 자주 쓰이는 다른 슬로건은 ”Bild dir deine Meinung”이다. 이는 중의적 의미를 가지며, 해석인 ”네 의견을 만들어라”와 신문 빌트의 이름을 합한 것이다.\\n빌트는 보통 ‘가십들과 저질적인 언어, 감정적인 표현들의 악덕높은 집합체’로 표현되고 독일 정치가들에게 엄청난 영향력을 가진다. 이런 스타일과 비슷한 신문으로 영국의 선이라는 신문이 있다. 선은 유럽에서 두 번째로 잘 팔리는 타블로이드식의 신문이다.\\n슈피겔지에 의하면 빌트는 영국과 미국의 타블로이드식의 중간쯤이라고 생각된다고 한다. 몇몇의 독일 사람들에게 빌트는 약한 수준의 고해상도 포르노이기도 하다.\\n가디언 신문에 따르면, 28년동안, 빌트는 5000명이 넘는 상체탈의한 여성들의 모습을 표지로 써왔다고 한다.\\n하지만 2012년 3월 9일 빌트는 지난 1984년부터 지면 1면에 여성의 누드 사진을 게재해오던 관행을 깨고 앞으로는 게재하지 않겠다고 선언해 화제가 되었다. 빌트는 '시대에 맞은 지면 구성'을 위해서 자신들의 '전통'을 깨겠다고 선언했다. 그러나 앞으로 계속 섹시한 신문으로 남을 것이라고 말해 여성의 누드사진 자체를 1면에만 게재하지 않을 뿐 다른 면에는 게재할 수 도 있음을 내비쳤다. 섹시와 발행부수의 관계를 떼어 놓을 수는 없는 모습을 보였다."},{"page_url":"https://af.wikipedia.org/wiki/Vulkaan-Eifel","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/87/Maare.jpg","page_title":"Vulkaan-Eifel","context_page_description":"Die Vulkaan-Eifel is 'n bergstreek op 'n maksimale hoogte van 698,8 meter bo seevlak in die Eifel-bergreeks, 'n middelgebergte in die Duitse deelstaat Rynland-Palts wat deur vulkaniese aktiwiteit gevorm is. Hierdie aktiwiteit duur steeds voort en lei in sommige mere tot uitbarstings van vulkaniese gasse.\\nKraters, lavaformasies en sogenaamde maare - mere wat ná vulkaniese uitbarstings in kraters gevorm het - getuig van die geologiese verlede van die gebied. So het die vulkaniese aktiwiteit vanaf die Tersiêr aansienlik toegeneem en het vulkane so onlangs soos 10 000 jaar gelede uitgebars. Die Vulkaan-Eifel is bo-oor 'n sogenaamde hot-spot geleë wat steeds aktief is en die landmassa in die gebied jaarliks met 1 tot 2 millimeter laat styg."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D0%BF%D1%82%D0%B0%D1%85%D1%96%D0%B2_%D0%93%D1%80%D0%B5%D1%86%D1%96%D1%97","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Centro_provinciale_%282%29.jpg","page_title":"Список птахів Греції","context_page_description":"Цей список є списком видів птахів, записаних на території Греції.\\nСписок включє близько 442 види, з яких 13 перебувають під загрозою зникнення, а 2 були інтродуковані людиною.\\n4 види птахів не спостерігались у Греції після 1950 року.\\nТеги, що використовуються для виділення охоронного статусу кожного виду за оцінками МСОП:"},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturg%C3%BCter_in_Zug","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Zug_Rosenkranz.JPG","page_title":"Liste der Kulturgüter in Zug","context_page_description":"Die Liste der Kulturgüter in Zug enthält alle Objekte in der Gemeinde Zug im Kanton Zug, die gemäss der Haager Konvention zum Schutz von Kulturgut bei bewaffneten Konflikten, dem Bundesgesetz vom 20. Juni 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten sowie der Verordnung vom 29. Oktober 2014 über den Schutz der Kulturgüter bei bewaffneten Konflikten unter Schutz stehen.\\nObjekte der Kategorien A und B sind vollständig in der Liste enthalten, Objekte der Kategorie C fehlen zurzeit. Unter übrige Baudenkmäler sind zusätzliche Objekte zu finden, die gemäss Angaben des kantonalen Denkmalschutzes als geschützte Denkmäler eingestuft wurden und nicht bereits in der Liste der Kulturgüter enthalten sind."},{"page_url":"https://en.wikipedia.org/wiki/Lake_Poorrarecup","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Lake_Poorrarecup3.jpg","page_title":"Lake Poorrarecup","context_page_description":"Lake Poorrarecup, also known as Poorarecup Lagoon, is an ephemeral salt lake located in the Great Southern region of Western Australia, approximately 34 km south west of Cranbrook and 65 km north west of Mount Barker. It is located in a watershed between the Kent River and Frankland River catchments and the Gordon River, a tributary of the Frankland."},{"page_url":"https://en.wikipedia.org/wiki/Steve_Buxton_(footballer,_born_1888)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/38/Steve_Buxton_-_1909.jpg","page_title":"Steve Buxton (footballer, born 1888)","context_page_description":"Stephen Buxton was an English professional football left back who played in the Football League for Oldham Athletic and Ashington. He made over 100 Southern League appearances for Brentford."},{"page_url":"https://en.wikipedia.org/wiki/Flotte_du_Ponant","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c7/Fran%C3%A7ois_Cornil_Bart.jpg","page_title":"Flotte du Ponant","context_page_description":"The Flotte du Ponant was the designation under the Ancien Regime for the naval vessels of the Royal French Navy in the English Channel, Atlantic Ocean and Americas, the latter principally in the French West Indies and New France. The fleet carried out operations such as asserting naval supremacy and protecting convoys. Its counterpart was the Levant Fleet, based in the Mediterranean Sea."},{"page_url":"https://en.wikipedia.org/wiki/Olympic_Stadium_(Montreal)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/Le_Stade_Olympique_de_Montr%C3%A9al_Nuit_Arriere_Edit_1.jpg","page_title":"Olympic Stadium (Montreal)","context_page_description":"Olympic Stadium is a multi-purpose stadium in Montreal, Canada, located at Olympic Park in the Hochelaga-Maisonneuve district of the city. Built in the mid-1970s as the main venue for the 1976 Summer Olympics, it is nicknamed \\"The Big O\\", a reference to both its name and to the doughnut-shape of the permanent component of the stadium's roof. The tower standing next to the stadium, The Montreal Tower, is the tallest inclined tower in the world with an angle elevation of 45 degrees. It is also called \\"The Big Owe\\" to reference the astronomical cost of the stadium and the 1976 Olympics as a whole.\\nThe stadium is the largest by seating capacity in Canada. After the Olympics, artificial turf was installed and it became the home of Montreal's professional baseball and football teams. The Montreal Alouettes of the CFL returned to their previous home of Molson Stadium in 1998 for regular season games, but continued to use Olympic Stadium for playoff and Grey Cup games until 2014 when they returned to Molson Stadium for all of their games. Following the 2004 baseball season, the Expos relocated to Washington, D.C., to become the Washington Nationals."},{"page_url":"https://simple.wikipedia.org/wiki/Vimaladharmasuriya_I","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/King_Vimaladharmasuriya_I.jpg","page_title":"Vimaladharmasuriya I","context_page_description":"Vimaladharmasuriya I, also known as Konappu Bandara, Dom Joan of Austria or Don Jhon Appuhamy, was a king of Sri Lanka. He ruled the country from 1590 to 1604. He was a late 16th-century to early 17th-century King of the Kandyan Kingdom, which was located in the central hills of the island of Sri Lanka. He successfully defeated the Portuguese in two major battles: in 1594, the battle of Danture and in 1602 the Battle of Balana."},{"page_url":"https://pl.wikipedia.org/wiki/Niemcy","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Schwerin_Palace_Park_Garden_Mecklenburg_Germany_Schweriner_Schloss_Garten_BUGA_2009.jpg","page_title":"Niemcy","context_page_description":"Niemcy; Republika Federalna Niemiec, RFN – państwo federacyjne położone w zachodniej i środkowej Europie. Składa się z 16 krajów związkowych, a jego stolicą i największym miastem jest Berlin. Państwo ma powierzchnię 357 578 km² i panuje w nim klimat umiarkowany. Z około 83 milionami mieszkańców jest najludniejszym państwem Unii Europejskiej. Stanowi czołowe pod względem gospodarczym i politycznym państwo Europy. Stanowi część strefy Schengen i strefy euro, jest członkiem ONZ, OECD, G7, G20. Po Stanach Zjednoczonych Niemcy są drugim krajem docelowym migracji na świecie.\\nW starożytności tereny obecnych Niemiec zamieszkiwały plemiona Celtów. Germanie zamieszkiwali południowo-zachodnią Skandynawię i Jutlandię. Zanim zostali po raz pierwszy wzmiankowani w źródle historycznym, zaczęli migrować wzdłuż wybrzeży Bałtyku i na południe. W początkach średniowiecza, na przełomie VI i VII wieku, w zapisach kronikarzy pojawiła się nazwa Sklawinowie. Na terenie współczesnych Niemiec skolonizowali oni przede wszystkim ziemie nad Łabą i na wschód od niej. Słowiańskie osadnictwo miało też miejsce na terenie dzisiejszej Bawarii. W późniejszych wiekach Słowianie ulegli germanizacji."},{"page_url":"https://pl.wikipedia.org/wiki/Michelle_Carter","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2c/Michelle_Carter_Istanbul_2012.jpg","page_title":"Michelle Carter","context_page_description":"Michelle Denee Carter – amerykańska lekkoatletka specjalizująca się w pchnięciu kulą. Córka kulomiota i futbolisty Michaela Cartera.\\nW 2001 zdobyła srebrny medal mistrzostw świata juniorów młodszych. Trzy lata później sięgnęła po złoto mistrzostw świata juniorów. Wicemistrzyni strefy NACAC w gronie młodzieżowców z Santo Domingo. W 2008 reprezentowała USA podczas igrzysk olimpijskich w Pekinie, gdzie zajęła 15. miejsce w finałowym konkursie pchnięcia kulą. Szósta zawodniczka mistrzostw świata. Brązowa medalistka igrzysk panamerykańskich i halowych mistrzostw świata. Zajęła 5. miejsce w finale igrzysk olimpijskich w Londynie w 2012 roku. W 2013 była czwarta na mistrzostwach świata w Moskwie. W 2015 zdobyła brązowy medal na mistrzostwach świata w Pekinie. Halowa mistrzyni świata z Portland. Mistrzyni olimpijska z Rio de Janeiro i trzecia kulomiotka z mistrzostw świata z Londynu."},{"page_url":"https://hu.wikipedia.org/wiki/Barie","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cf/Barie_Vue_Garonne.jpg","page_title":"Barie","context_page_description":"Barie egy francia település Gironde megyében az Aquitania régióban. Lakóit Bariauds-nak nevezik."},{"page_url":"https://sv.wikipedia.org/wiki/Saint-Christo-en-Jarez","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Map_commune_FR_insee_code_42208.png","page_title":"Saint-Christo-en-Jarez","context_page_description":"Saint-Christo-en-Jarez är en kommun i departementet Loire i regionen Auvergne-Rhône-Alpes i centrala Frankrike. Kommunen ligger i kantonen Saint-Héand som tillhör arrondissementet Saint-Étienne. År 2009 hade Saint-Christo-en-Jarez 1 794 invånare."},{"page_url":"https://en.wikipedia.org/wiki/California%27s_4th_congressional_district","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/43/Thomas_Rolph_%28California_Congressman%29.jpg","page_title":"California's 4th congressional district","context_page_description":"California's 4th congressional district is a congressional district in the U.S. state of California.\\nTom McClintock, a Republican, has represented the district since January 2009. Currently, the 4th district encompasses the Sierras from Truckee to the Sequoia National Forest, as well as a largely suburban area on the edge of the Sacramento Valley in southwestern Placer County. It consists of Alpine, Amador, Calaveras, El Dorado, Mariposa, and Tuolumne counties plus most of Placer County and portions of Fresno, Madera, and Nevada counties. Prior to redistricting by the California Citizens Redistricting Commission of 2011, the 4th district encompassed the northeast corner of the state, stretching from the eastern suburbs of Sacramento north to the Oregon border. It consisted of El Dorado, Lassen, Modoc, Nevada, Placer, Plumas, and Sierra counties plus portions of Butte and Sacramento counties."},{"page_url":"https://es.wikipedia.org/wiki/Arboreto_de_investigaci%C3%B3n_Orland_E._White","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Virginia_Locator_Map_with_US.PNG","page_title":"Arboreto de investigación Orland E. White","context_page_description":"El Arboreto de investigación Orland E. White anteriormente conocido como Orland E. White Arboretum, es un arboreto y jardín botánico de 172 acres de extensión que se encuentra en Boyce, Virginia.\\nEste arboreto forma parte de la Blandy Experimental Farm de 700 acres de extensión, y está administrado por la Universidad de Virginia."},{"page_url":"https://ca.wikipedia.org/wiki/Ernst_Pistulla","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/WP_Ernst_Pistulla.jpg","page_title":"Ernst Pistulla","context_page_description":"Ernst Pistulla va ser un boxejador alemany que va competir durant les dècades de 1920 i 1930. Va morir lluitant a Rússia durant la Segona Guerra Mundial.\\nEl 1928 va prendre part als Jocs Olímpics d'Amsterdam, on guanyà la medalla de plata de la categoria del pes semipesant, en perdre la final contra Víctor Avendaño.\\nCom a professional, entre 1929 i 1935, va disputar 41 combats, amb un balanç de 28 victòries, 7 derrotes i 6 combats nuls."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%8B%AC%EA%BC%B4_(%EA%B8%B0%ED%95%98%ED%95%99)","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c9/Luno_ebena_geom_4.png","page_title":"달꼴 (기하학)","context_page_description":"달꼴은 두개의 원호를 경계로 하는 오목하고 볼록한 영역이다. 하나의 원에서 그 원과 교차하는 다른 원을 뺀 영역이다."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B0%E3%83%A9%E3%83%B3%E3%83%89%E3%83%95%E3%82%A9%E3%83%BC%E3%82%AF%E3%82%B9_(%E3%83%8E%E3%83%BC%E3%82%B9%E3%83%80%E3%82%B3%E3%82%BF%E5%B7%9E)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/65/Chester_Fritz_Library_summer.jpg","page_title":"グランドフォークス (ノースダコタ州)","context_page_description":"グランドフォークスは、アメリカ合衆国ノースダコタ州北東部に位置する都市。ミネソタ州との州境になっている北のレッド川西岸、州の最大都市ファーゴの北約130km、カナダ・マニトバ州ウィニペグの南約230kmに位置する。人口は52,838人で、ファーゴ、州都ビスマークに次ぐ州第3の都市である。グランドフォークスに郡庁を置くグランドフォークス郡、およびレッド川対岸のミネソタ州ポーク郡の2郡から成る都市圏は98,461人の人口を抱えている。\\nグランドフォークスはレッド・リバー・バレーと呼ばれる、ノースダコタ・ミネソタ両州、およびマニトバ州にまたがる、南から北へと流れるレッド川流域に広がる平原にあり、洪水に見舞われやすい。1997年に起きたレッド川の大洪水では、市は壊滅的な被害を受けたが、その後復興した。\\nもともとはカナダからやってきたフランス系の猟師や毛皮商たちがこの地に毛皮の交易所を設け、ル・グランド・フルシュと呼んでいた。蒸気船の船長であったアレクサンダー・グリッグスは、この地で越冬せざるを得なくなった後、この交易所を町へと発展させ、これが今日のグランドフォークスの基となった。やがて1881年、グランドフォークスは市政を施行した。このグランドフォークスという名は、レッドレイク川がレッド川に合流する地点であることからつけられた。\\nグランドフォークスの地域経済は長らく農業に依存してきたが、21世紀に入ってからは、高等教育、防衛産業、保健産業、製造業、食品加工業、科学調査など多角化してきている。グランドフォークス国際空港を玄関口とし、グランドフォークス空軍基地も置かれている。グランドフォークスは州最古の高等教育機関であるノースダコタ大学の大学町でもある。市内に立地するアレラス・センターおよびラルフ・エンゲルスタッド・アリーナではスポーツやその他のイベントが行われる。市内の大規模な文化施設としては、エンパイア芸術センターおよびチェスター・フリッツ講堂が挙げられる。"},{"page_url":"https://sh.wikipedia.org/wiki/Dick_Purcell","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/King_of_the_Zombies_%281941%29_1.jpg","page_title":"Dick Purcell","context_page_description":"Richard Gerald \\"Dick\\" Purcell Jr. je bio američki glumac, najpoznatiji po ulozi superheroja Kapetana Amerike u istoimenom filmu u nastavcima. Purcellu, koji je prije toga uglavnom nastupao u B-filmovima klasičnog Hollywooda to je bila posljednja uloga, s obzirom da je nekoliko mjeseci nakon završetka snimanja preminuo od srčanog udara."},{"page_url":"https://en.wikipedia.org/wiki/Torino_F.C.","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/06/LuigiMeroni1.jpg","page_title":"Torino F.C.","context_page_description":"Torino Football Club, commonly referred to as Torino or simply Toro, is an Italian professional football club based in Turin, Piedmont. It currently plays in Serie A.\\nFounded as Foot-Ball Club Torino in 1906, Torino are among the most successful clubs in Italy with seven league titles, including five consecutive league titles during the 1940s. The Grande Torino, as the team was known, was widely recognised as one of the strongest footballing sides of the period, until the entire team was killed in the 1949 Superga air disaster. They have also won the Coppa Italia five times, the last of which was in the 1992–93 season. Internationally, Torino won the Mitropa Cup in 1991 and were finalists in the UEFA Cup in 1991–92.\\nTorino plays all of its home games at the Stadio Olimpico Grande Torino. The club's traditional colour is maroon, and its symbol is a rampant bull, the traditional symbol of the city of Turin, from which the club's nickname is derived, \\"Il Toro\\"."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%B7%D9%8A%D8%B1%D8%A7%D9%86_%D8%A7%D9%84%D8%B5%D9%8A%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7b/B-2485_-_Air_China_-_Boeing_747-89L_-_PEK_%2817038275979%29.jpg","page_title":"طيران الصين","context_page_description":"طيران الصين هي شركة الطيران الوطنية الصينية، تأسست سنة 1988، وهي شركة تابعة لشركة الصين الوطنية القابضة للطيران. يقع المقر الرئيسي للشركة في العاصمة الصينية بكين، وتتخذ من مطار بكين الدولي ومطار شانغهاي الدولي مركزين لعملياتها، وتعد الشركة رابع أكبر شركة طيران في آسيا، تقدم طيران الصين خدماتها لأكثر من 180 وجهة في آسيا، أوروبا، أستراليا والولايات المتحدة، وخدمت الشركة عام 2006 ما يقارب 33.97 مليون، وتعتبر الشركة عضو في تحالف ستار."},{"page_url":"https://en.wikipedia.org/wiki/Kathmandu_Durbar_Square","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/Lord_Narasimha_killing_demon_hiranakashyap_in_his_lap.jpg","page_title":"Kathmandu Durbar Square","context_page_description":"Kathmandu Durbar Square in front of the old royal palace of the former Kathmandu Kingdom is one of three Durbar Squares in the Kathmandu Valley in Nepal, all of which are UNESCO World Heritage Sites.\\nSeveral buildings in the Square collapsed due to a major earthquake on 25 April 2015. Durbar Square was surrounded with spectacular architecture and vividly showcases the skills of the Newar artists and craftsmen over several centuries. The Royal Palace was originally at Dattaraya square and was later moved to the Durbar square.\\nThe Kathmandu Durbar Square held the palaces of the Malla and Shah kings who ruled over the city. Along with these palaces, the square surrounds quadrangles, revealing courtyards and temples. It is known as Hanuman Dhoka Durbar Square, a name derived from a statue of Hanuman, the monkey devotee of Lord Ram, at the entrance of the palace."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E7%AE%97%E7%8D%A8","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/91/Kendoku_ans.jpg","page_title":"算獨","context_page_description":"算独\\n算独或贤独是花式数独的一支，原型于2004年日本人宫本哲也所改良发行，其主要理念为启发性的自学式的数学益智游戏。\\n算独的基本规则是:行行列列数字不可相同，粗线算组符合运算提示。\\n算独的大小从3×3至9×9。此外，算独包括好几组算组-而且这些算组内的数字必须符合运算提示，利用指定的数学运算。例如，3X3简单的算独范例, 包括123三个数字。相同数字不可重复在同一行或列中。粗线算组内的数字必须符合数学运算的提示。"},{"page_url":"https://en.wikipedia.org/wiki/Stanis%C5%82aw_Szmajzner","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/62/StanislawSzmajzner.jpg","page_title":"Stanisław Szmajzner","context_page_description":"Stanisław \\"Szlomo\\" Szmajzner was one of 58 known survivors of the Sobibór extermination camp in German-occupied Poland and participated in the 1943 camp-wide revolt and escape from Sobibór."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%93%D0%BE%D0%BC%D0%BE%D1%81%D0%B5%D0%BA%D1%81%D1%83%D0%B0%D0%BB%D1%8C%D0%BD%D0%BE%D1%81%D1%82%D1%8C_%D0%B2_%D1%81%D0%BF%D0%BE%D1%80%D1%82%D0%B5","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bc/IanRoberts1997.jpg","page_title":"Гомосексуальность в спорте","context_page_description":"Гомосексуальность в спорте остаётся по сей день табуизированной темой. В профессиональном спорте на сегодняшний день практически нет открытых гомосексуалов или бисексуалов. Многие из них заявляют о своей сексуальной ориентации лишь после завершения спортивной карьеры."},{"page_url":"https://ur.wikipedia.org/wiki/%D8%A7%DB%8C%D8%A8%D9%86%DA%AF%D9%B9%D9%86%D8%8C_%D8%A7%D9%86%DA%88%DB%8C%D8%A7%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Central_Abington%2C_Indiana.jpg","page_title":"ایبنگٹن، انڈیانا","context_page_description":"ایبنگٹن، انڈیانا ریاستہائے متحدہ امریکا کا ایک انانکارپوریٹڈ کمیونٹی جو وین کاؤنٹی، انڈیانا میں واقع ہے۔"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E7%A8%BB%E5%9F%95","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/%E8%A1%8C%E6%94%BF%E9%99%A2%E4%B8%AD%E5%A4%AE%E5%A4%A7%E6%A8%93.jpg","page_title":"大稻埕","context_page_description":"大稻埕，雅稱稻江、稻津，是臺北市大同區西南部的一個傳統地域名稱，因具有大片曬稻穀的空地而得名。咸豐元年泉州府同安縣人林藍田為躲避海盜洗劫，自雞籠遷至大稻埕經商並開設店鋪，開始大稻埕的商業活動。三年三邑人與同安人為艋舺碼頭的泊船權利，發生頂下郊拚分類械鬥事件，下郊的同安人無力抵抗，於是帶著自身信仰的霞海城隍敗逃至大稻埕，大稻埕旁淡水河的碼頭交易逐漸興起。十年淡水開港後，大稻埕成為臺北最繁華的物資集散中心，以茶葉與布料的貿易為主。大稻埕的茶葉貿易在洋行的帶領下，不僅市場擴大，更造就驚人的財富與繁榮。進入日治時期後日商抵制洋行勢力，轉而以日本與東南亞為主要市場。戰後大稻埕因淡水河淤淺逐漸失去河港功能，且臺產茶葉不敵錫蘭紅茶的競爭而逐漸沒落。之後臺北市區向東發展、人口大量外移，大稻埕成為臺北市外圍的老舊市區。"},{"page_url":"https://hu.wikipedia.org/wiki/Kisk%C3%B6re-Tiszah%C3%ADd_meg%C3%A1ll%C3%B3hely","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/BZMOT_at_Kisk%C3%B6re_Tisza_Bridge.jpg","page_title":"Kisköre-Tiszahíd megállóhely","context_page_description":"Kisköre-Tiszahíd megállóhely egy Heves megyei vasútállomás, Kisköre településen, melyet a MÁV üzemeltet."},{"page_url":"https://vi.wikipedia.org/wiki/Danh_s%C3%A1ch_s%C3%BAng_ng%E1%BA%AFn_%E1%BB%95_xoay","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/Model_36_38_calibre_Smith_%26_Wesson_which_was_issued_to_women_in_the_NSW_Police.jpg","page_title":"Danh sách súng ngắn ổ xoay","context_page_description":"Đây là danh sách của cách loại súng ngắn ổ xoay sử dụng cơ chế hoạt động đơn và hoạt động kép từng được chế tạo trên thế giới."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%86%D9%87%D8%B1_%D8%A8%D8%A7%D8%B4%D9%8A%D9%84%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Abbay_OSM.png","page_title":"نهر باشيلو","context_page_description":"نهر باشيلو يقع في إثيوبيا، ويشتهر لتلعته التي توصف بأنّها تناهز تلعة مصبّ نهر الباشيلو - وهو النيل الأزرق - في ضخامتها. يبدأ مسار نهر الباشيلو عند نقطة تقع إلى غرب «كوتابر» الواقعة بمنطقة «أمهرة»، ويجري نحو الشمال الغربي حيث يصبّ فيه نهر اسمه «ترجيا»، ثمّ نحو الجنوب الغربي حيث مقرنه مع النيل الأزرق.\\nتبلغ مساحة المستجمع المائي لنهر الباشيلو قرابة 13 ألف كم مربع، ويتضمّن أجزاءً من مناطق «شمال جوندار» و«شمال ولو» و«جنوب ولو» الإثيوبية. ومن منابع الباشيلو أنهار «تشيتشيهو» و«والانو».\\nكان نهر الباشيلو مهمًا لترسيم حدود الأقاليم الإثيوبية. ففي القرن السابع عشر، كان يفصل بين «بجمدر» و«أمهرة».، وفي أواخر القرن الثامن عشر، أصبح يشكّل الحدّ الشمالي لشاوا، وكان ذلك وراء رفض الإمبراطور تكلة جيورجيس الأول لأن يعبر النهر حتّى لا يدخل ذلك الإقليم. ظلّ النهر يشكّل الحدّ الشمال لشاوا حتّى 1870 في عهد النجاشي منليك الثاني الشاوي في خطاب أرسله إلى رجل بريطاني آنذاك."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A4%D1%8E%D0%BC%D0%B0%D0%BD,_%D0%A4%D1%80%D0%B0%D0%BD%D1%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Franz_F%C3%BChmann_Kisk%C5%91r%C3%B6s.JPG","page_title":"Фюман, Франц","context_page_description":"Франц Фюман — немецкий писатель, прозаик. Лауреат премии Генриха Манна. Лауреат Национальной премии ГДР."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%97%D0%B0%D0%BF%D0%B0%D0%B4%D0%BD%D1%8B%D0%B9_%D0%9A%D0%BE%D1%83%D0%BB%D1%83%D0%BD_(%D0%B2%D0%BE%D0%BA%D0%B7%D0%B0%D0%BB)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/West_Kowloon_Station_B1_Ticket_Machine_201809.jpg","page_title":"Западный Коулун (вокзал)","context_page_description":"Вокзал Западный Коулун — конечная станция гонконгского участка скоростной железной дороги Гуанчжоу — Шэньчжэнь — Гонконг. Расположен в районе Джордан, в южной части полуострова Цзюлун.\\nПолуподземный вокзал Западный Коулун является единственной станцией на гонконгской участке дороги. С материковым участком дороги вокзал соединён специальным тоннелем. Подрядчиком и оператором вокзала является гонконгская транспортная компания MTR Corporation."},{"page_url":"https://es.wikipedia.org/wiki/Revoluci%C3%B3n_del_Parque","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/Palacio_Mir%C3%B3_-_Demolido_1937.jpg","page_title":"Revolución del Parque","context_page_description":"La Revolución del Parque, también conocida como Revolución de 1890, fue una insurrección cívico-militar producida en la Argentina el 26 de julio de 1890 dirigida por la recién formada Unión Cívica, liderada por Leandro Alem, Bartolomé Mitre, Aristóbulo del Valle, Bernardo de Irigoyen y Francisco Barroetaveña, entre otros. La revolución fue derrotada por el gobierno, pero de todos modos llevó a la renuncia del presidente Miguel Juárez Celman, y su reemplazo por el vicepresidente Carlos Pellegrini."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%87%D9%85%D9%8A%D8%AF_%D8%A7%D8%AF%D9%86%D8%A7%D9%86_%D8%B3%D8%A7%D9%8A%D8%AC%D9%88%D9%86","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Adnan_Saygun.jpg","page_title":"اهميد ادنان سايجون","context_page_description":"اهميد ادنان سايجون كان ملحن مزيكا من توركيا."},{"page_url":"https://de.wikipedia.org/wiki/TransMilenio","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/B54.png","page_title":"TransMilenio","context_page_description":"TransMilenio ist das Bussystem von Kolumbiens Hauptstadt Bogotá und mit mehr als acht Millionen Einwohnern in der Agglomeration eine der größten Metropolregionen Südamerikas. Nach dem Vorbild des Rede Integrada de Transporte der brasilianischen Stadt Curitiba wurde im November 2000 ein System von Gelenkbussen eingeführt, nachdem 30 Jahre ergebnisloser Planung einer U-Bahn verstrichen waren."},{"page_url":"https://ca.wikipedia.org/wiki/Victor_Moritz_Goldschmidt","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/99/1915-Goldschmit-VM.jpg","page_title":"Victor Moritz Goldschmidt","context_page_description":"Victor Moritz Goldschmidt fou un mineralogista noruec considerat, juntament amb Vladimir Vernadsky, com el fundador de la moderna geoquímica i de la química cristal·logràfica. Desenvolupà la classificació de Goldschmidt dels elements químics."},{"page_url":"https://sv.wikipedia.org/wiki/F%C3%B6rstakammarvalet_i_Sverige_1941","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e3/Gustaf_Andersson_i_Rasj%C3%B6n.jpg","page_title":"Förstakammarvalet i Sverige 1941","context_page_description":"Förstakammarvalet i Sverige 1941 var ett val i Sverige till Sveriges riksdags första kammare. Valet hölls i den femte valkretsgruppen i september månad 1941 för mandatperioden 1942-1949.\\nTre valkretsar utgjorde den femte valkretsgruppen: Jönköpings läns valkrets, Göteborgs och Bohus läns valkrets och Värmlands läns valkrets. Ledamöterna utsågs av valmän från det landsting som valkretsarna motsvarade.\\nOrdinarie val till den femte valkretsgruppen hade senast ägt rum 1933."},{"page_url":"https://ru.wikipedia.org/wiki/Fulvetta_vinipectus","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b6/White-browed_Fulvetta_Pangolakha_Wildlife_Sanctuary_Eest_Sikkim_India_12.02.2016.jpg","page_title":"Fulvetta vinipectus","context_page_description":"Fulvetta vinipectus — вид птиц из семейства славковых. Как и других представителей рода, его долгое время относили к роду Alcippe. Выделяют восемь подвидов."},{"page_url":"https://nl.wikipedia.org/wiki/Vlag_van_Moordrecht","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e2/Flag_of_Moordrecht.svg","page_title":"Vlag van Moordrecht","context_page_description":"De vlag van Moordrecht is nimmer officieel vastgesteld als de gemeentevlag van de Zuid-Hollandse gemeente Moordrecht, maar werd wel als zodanig gebruikt. De vlag kan als volgt worden beschreven:\\nDe vlag is gebaseerd op de defileervlag die in 1938 door vertegenwoordigers van de gemeente werd gedragen tijdens het defilé in Amsterdam ter gelegenheid van het veertigjarig regeringsjubileum van koningin Wilhelmina. De vlag bestaat uit twee banen van rood en geel, met op het kanton het beeld van het gemeentelijk wapenschild. Omdat in het geval van Moordrecht het veld in het wapen dezelfde kleur had als de bovenste baan, viel het kanton weg en was uitsluitend de ster zichtbaar. Deze ster is afkomstig uit het familiewapen van het geslacht Van Kralingen.\\nIn 2010 is Moordrecht opgegaan in de gemeente Zuidplas. De vlag van Moordrecht is daardoor als gemeentevlag komen te vervallen."},{"page_url":"https://tr.wikipedia.org/wiki/Ejnar_Hertzsprung","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/75/Karl_Schwarzschild_and_Ejnar_Hertzsprung_%281909%29.jpg","page_title":"Ejnar Hertzsprung","context_page_description":"Ejnar Hertzsprung Danimarkalı astronom ve kimyager. Hertzsprung-Russell diyagramı keşfi ile tanınmaktadır."},{"page_url":"https://en.wikipedia.org/wiki/K%C4%97dainiai_railway_station","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/The_train_station_of_K%C4%97dainiai.jpg","page_title":"Kėdainiai railway station","context_page_description":"Kėdainiai railway station is a Lithuanian Railways station in Kėdainiai serving passenger trains."},{"page_url":"https://zh.wikipedia.org/wiki/%E8%91%9B%E9%BA%97%E7%B5%B2%C2%B7%E9%9C%8D%E6%99%AE","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Commodore_Grace_M._Hopper%2C_USN_%28covered%29.jpg","page_title":"葛麗絲·霍普","context_page_description":"葛麗絲·穆雷·霍普，本名葛麗絲·布魯斯特·穆雷，霍普為夫姓，生於美國紐約州紐約市，美國海軍准將及電腦科學家，世界最早一批的程式設計師之一，也是最早的女性程式設計師之一。她是Harvard Mark I上第一個專職程式設計師，創造了現代第一個編譯器A-0 系統，以及第一個進階商用電腦程式語言「COBOL」，被譽為「COBOL 之母」。著名的電腦術語「Debug」便是她在受到從電腦中驅除蛾子的啟發而開始使用的，於是她也被冠以「Debug 之母」的稱號。她也是Y2K危機的創造者。她培育出許多程式語言專家，被人稱為「不可思議的葛麗絲」。\\n她是美軍第一個獲得准將頭銜的女性，美國海軍驅逐艦霍珀號驅逐艦以她來命名。組態於國家能源研究科學技術機中心的超級電腦Cray XE6，便是以Hopper命名，以表彰她的貢獻。耶魯大學也有霍普學院以紀念之。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A2%D1%80%D0%B5%D0%B9_%D0%93%D0%B0%D1%83%D0%B4%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Trey_Gowdy%2C_Official_Portrait%2C_112th_Congress.jpg","page_title":"Трей Гауді","context_page_description":"Гарольд Вотсон «Трей» Ґауді — американський політик, представляє 4-й округ Південної Кароліни в Палаті представників США з 2011 року. Член Республіканської партії.\\nУ 1986 році закінчив Бейлорський університет, отримав юридичну освіту у 1989 в Університеті Південної Кароліни. Потім він працював юристом."},{"page_url":"https://en.wikipedia.org/wiki/Dakar_Region","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/bd/Logo_council_region_dakar.png","page_title":"Dakar Region","context_page_description":"Dakar Region is the smallest and most populated Region of Senegal, encompassing the capital city of the country, Dakar, and all its suburbs along the Cap–Vert Peninsula, Africa's most westerly point."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%92%D0%BE%D0%B8%D0%BD%D1%81%D0%BA%D0%BE%D0%B5_%D0%BA%D0%BB%D0%B0%D0%B4%D0%B1%D0%B8%D1%89%D0%B5_%E2%84%96_12_(%D0%A6%D0%B5%D0%BA%D0%BB%D0%B8%D0%BD-%D0%94%D0%BE%D0%B1%D1%80%D1%8B%D0%BD%D1%8F)","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e8/Nr12_Cieklin1a.JPG","page_title":"Воинское кладбище № 12 (Цеклин-Добрыня)","context_page_description":"Воинское кладбище № 14 — Цеклин — воинское кладбище, расположенное в окрестностях села Цеклин, гмины Дембовец, Подкарпатское воеводство. Кладбище входит в группу Западногалицийских воинских захоронений времён Первой мировой войны. На кладбище похоронены военнослужащие Российской армий, погибшие во время Первой мировой войны."},{"page_url":"https://fa.wikipedia.org/wiki/%D9%BE%D9%84%DB%8C%D8%B2%D9%86%D8%AA_%D9%87%DB%8C%D9%84%D8%8C_%DA%A9%D8%A7%D9%84%DB%8C%D9%81%D8%B1%D9%86%DB%8C%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/53/Pleasant_Hill_CA_City_Hall.jpg","page_title":"پلیزنت هیل، کالیفرنیا","context_page_description":"پلیزنت هیل شهری در شهرستان کنترا کوستا ایالت کالیفرنیا است که در سرشماری سال ۲۰۱۰ میلادی، ۳۳۱۵۲ نفر جمعیت داشته است."},{"page_url":"https://hu.wikipedia.org/wiki/Rowan_Atkinson","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Rowan_Atkinson%2C_2011.jpg","page_title":"Rowan Atkinson","context_page_description":"Rowan Sebastian Atkinson CBE angol színész, humorista és forgatókönyvíró. Végzettsége szerint villamosmérnök. Legismertebb televíziós alakításai a Fekete Vipera és a Mr. Bean című szituációs komédiákban voltak. Elsőként a BBC Not the Nine O'Clock News című szkeccssorozatában kapott jelentősebb szerepet, mellyel 1981-ben BAFTA-díj-at nyert. 1990-ben a Fekete Viperával egy második BAFTA-díjat is szerzett.\\nFontosabb filmjei közé tartozik a Soha ne mondd, hogy soha, a Négy esküvő és egy temetés, az Igazából szerelem és Az eltakarítónő. Szinkronszínészként hangját kölcsönözte Az oroszlánkirály című animációs filmben. Mr. Bean szerepében feltűnt a Bean – Az igazi katasztrófafilm és a Mr. Bean nyaral című vígjátékokban is, továbbá címszereplőként egy kétballábas titkosügynököt alakított a Johnny English-trilógiában."},{"page_url":"https://es.wikipedia.org/wiki/Saint-Quay-Portrieux","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/St_Quay_S%C3%A9maphore.jpg","page_title":"Saint-Quay-Portrieux","context_page_description":"Saint-Quay-Portrieux es una población y comuna francesa, situada en la región de Bretaña, departamento de Côtes-d'Armor, en el distrito de Saint-Brieuc y cantón de Étables-sur-Mer."},{"page_url":"https://tr.wikipedia.org/wiki/Stenocereus_thurberi","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Stenocereus_thurberi.JPG","page_title":"Stenocereus thurberi","context_page_description":"Stenocereus thurberi, Meksika ve ABD'de bulunan Stenocereus cinsinden bir kaktüs türüdür. Kayalık çöllerde bulunur. İki tanede dağılımı ve yüksekliğinden ayırt edilebilecek alt türü bulunmaktadır. O kadar ünlü bir kaktüs türüdür ki ABD'de Arizona eyaleti Sonora çölünde bu türden kaktüsleri Org Borulu Kaktüs Ulusal Anıtı olarak ilan etmiştir, UNESCO tarafından miras olarak kabul edilmiştir..\\nDiğer taraftan meyveleri sebebiyle her ne kadar daha çok, bu türün yaşadığı kurak yörede iyi şekilde yetişemeyen Hylocereus türündeki kaktüslere bu ad atfedilmişse de, halk tarafından bu kaktüs türünün meyvelerine de 'pitaya' denmekte ve tatlı pitaya olarak bu türün meyveleri adlandırılmaktadır."},{"page_url":"https://es.wikipedia.org/wiki/Delias_caroli","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8e/FiguresRhopaloceraNewGuinea2.jpg","page_title":"Delias caroli","context_page_description":"Delias caroli es una especie de mariposa, de la familia de las piérides, que fue descrita por Kenrick, en 1909, a partir de ejemplares procedentes de Irian Jaya.​​"},{"page_url":"https://es.wikipedia.org/wiki/Castelld%C3%A1ns","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/2005.03.27_-_064_-_Castelldans_-_Pasqua_Florida_-_Passejada_fins_a_l%27Hermita.jpg","page_title":"Castelldáns","context_page_description":"Castelldáns​ es un municipio español de la provincia de Lérida, Cataluña, en la comarca de Las Garrigas, situado en la parte occidental de ésta, en el límite con la del Segriá."},{"page_url":"https://ja.wikipedia.org/wiki/%E5%8B%95%E7%89%A9%E3%81%AE%E5%A3%B2%E6%98%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Monkey_batu.jpg","page_title":"動物の売春","context_page_description":"動物の売春が存在するという考えを広めるものとして少ないながらもいくつかの研究が存在する。その対象となる動物はアデリーペンギン、チンパンジー、カニクイザルなどである。例えばペンギンは自分たちの巣をつくるために石を使用するが、1998年のある調査をきっかけに、石が不足するとメスのアデリーペンギンは石とセックスをトレードするという言い方がされるようになった。その調査によれば、つがいのメスのなかには自分のパートナーではないオスと交尾をおこない、自分の巣に小石を持ち帰ったものがいたのである。\\n食事を分けてもらう対価としてセックスを提供しているようにみえるチンパンジーも、売春に従事しているといわれることがある。"},{"page_url":"https://en.wikipedia.org/wiki/Sart-Dames-Avelines","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/2d/Sart-Dames-Avelines_Maison_Communale.jpg","page_title":"Sart-Dames-Avelines","context_page_description":"Sart-Dames-Avelines is a Belgian village in the municipality of Villers-la-Ville, in the south of the province of Walloon Brabant."},{"page_url":"https://pl.wikipedia.org/wiki/Tuner","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0e/2018_Tuner_Akai_AT-2200_2.jpg","page_title":"Tuner","context_page_description":"Tuner – urządzenie elektroniczne, które ze złożonego sygnału wejściowego wybiera ten jeden, na podstawie którego konstruowany jest obraz lub dźwięk w telewizorze bądź radio.\\nCzęsto poprzez słowo tuner rozumie się kartę telewizyjną albo inne urządzenie, które potrafi przekształcać sygnał analogowy na sygnał cyfrowy, zrozumiały dla komputera i jego podzespołów."},{"page_url":"https://pt.wikipedia.org/wiki/Horoatu_Crasnei","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bd/Crasna_jud_Salaj.png","page_title":"Horoatu Crasnei","context_page_description":"Horoatu Crasnei é uma comuna romena localizada no distrito de Sălaj, na região histórica da Crișana. A comuna possui uma área de 84.39 km² e sua população era de 2735 habitantes segundo o censo de 2007."},{"page_url":"https://sk.wikipedia.org/wiki/William_Herschel","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/HerschelTelescope.jpg","page_title":"William Herschel","context_page_description":"Frederick William Herschel bol britský astronóm nemeckého pôvodu. Vyrobil zrkadlové ďalekohľady a objavil planétu Urán."},{"page_url":"https://nl.wikipedia.org/wiki/Museum_Vlaardingen","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/WLANL_-_Quistnix%21_-_Vlaardingen_-_Visserijmuseum%2C_Balder_en_kraan.jpg","page_title":"Museum Vlaardingen","context_page_description":"Het Museum Vlaardingen is een museum in de Zuid-Hollandse stad Vlaardingen dat zich richt op de visserij en de geschiedenis van de stad Vlaardingen, die nauw met de Noordzeevisserij is verbonden. In verband met de verbouwing van het museum en de uitbreiding van de collectie heeft het museum de naam gewijzigd in Museum Vlaardingen."},{"page_url":"https://en.wikipedia.org/wiki/%C5%A0ardice","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/%C5%A0ardice_-_biskupsk%C3%A1_rezidence.JPG","page_title":"Šardice","context_page_description":"Šardice is a village and municipality in Hodonín District in the South Moravian Region of the Czech Republic.\\nThe municipality covers an area of 17.30 square kilometres, and has a population of 2,209.\\nŠardice lies approximately 15 kilometres north-west of Hodonín, 40 km south-east of Brno, and 226 km south-east of Prague."},{"page_url":"https://es.wikipedia.org/wiki/Compa%C3%B1%C3%ADa_Anglo-Belga_del_Caucho_y_la_Exploraci%C3%B3n","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/ABIR_company_posts.svg","page_title":"Compañía Anglo-Belga del Caucho y la Exploración","context_page_description":"La Compañía Anglo-Belga del Caucho y la Exploración fue una compañía que explotaba el caucho natural en el Estado Libre del Congo, propiedad privada del rey Leopoldo II de Bélgica. La compañía fue fundada con capital británico y belga y tenía su sede en Bélgica. Para 1898 ya no había accionistas británicos y la Anglo-Belgian India Rubber Company cambió su nombre a Abir Congo Company cambiando su residencia a efectos fiscales al Estado Libre del Congo. La empresa obtuvo una gran concesión en el norte del país y el derecho a gravar a los habitantes. Este impuesto se pagaba en forma de caucho obtenido de una enredadera de caucho relativamente rara. El sistema de recolección giraba en torno a una serie de puestos comerciales a lo largo de los dos principales ríos de la concesión. Cada puesto estaba comandado por un agente europeo y dotado de centinelas armados para hacer cumplir los impuestos y castigar a los rebeldes.\\nLa empresa disfrutó de un auge hasta finales de la década de 1890, vendiendo un kilogramo de caucho en Europa por hasta 10 francos, lo que les había costado 1,35 francos."},{"page_url":"https://en.wikipedia.org/wiki/Great_Western_Railway_(train_operating_company)","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4a/Laira_-_GWR_43198_and_08641.JPG","page_title":"Great Western Railway (train operating company)","context_page_description":"Great Western Railway is a British train operating company owned by FirstGroup that operates the Greater Western railway franchise. It manages 197 stations and its trains call at over 270. GWR operates long-distance inter-city services along the Great Western Main Line to and from the West of England and South Wales, inter-city services from London to the West Country via the Reading–Taunton line and the Night Riviera sleeper service between London and Penzance. It also provides commuter and outer-suburban services from its London terminus at Paddington to West London, the Thames Valley region including parts of Berkshire, parts of Buckinghamshire and Oxfordshire; and regional services throughout the West of England and South Wales to the South coast of England. GWR will also be providing and maintaining the new fleet for Heathrow Express from May 2020.\\nThe company began operating in February 1996 as Great Western Trains, as part of the privatisation of British Rail. In December 1998 it became First Great Western after FirstGroup bought out its partners' shares in Great Western Holdings."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_edif%C3%ADcios_religiosos_em_Portugal_classificados_como_Monumento_Nacional","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/01/Igreja_Cete_by_Henrique_Matos_02.jpg","page_title":"Lista de edifícios religiosos em Portugal classificados como Monumento Nacional","context_page_description":"Esta é uma lista de edifícios religiosos em Portugal classificados como Monumento Nacional, lista não exaustiva de basílicas, capelas, catedrais, conventos, ermidas, igrejas, mosteiros, santuários, sés e sinagogas que em Portugal estão classificados oficialmente como Monumento Nacional, mas tão só dos que como tal se encontram registados e classificados na Wikidata. De referir que a Mesquita Central de Lisboa não se encontra ainda classificada oficialmente em termos de património arquitetónico.\\nOs monumentos estão ordenados pela sua designação. Na primeira coluna, a designação do monumento em itálico significa que não existe artigo na Wikipédia sobre esse monumento, existindo apenas a ficha Wikidata.\\nNo âmbito da Direção-Geral do Património Cultural do estado português, e para além da base de dados que transitou do IGESPAR, existe a base de dados SIPA onde estão registados os imóveis que em Portugal foram objecto de classificação. Na última coluna desta lista está inserida a hiperligação para a ficha SIPA do respectivo monumento.\\nEsta lista é gerada a partir dos dados do Wikidata e é atualizada periodicamente por um robô."},{"page_url":"https://en.wikipedia.org/wiki/Marquetry","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b9/Marquetry-TwoLovers.JPG","page_title":"Marquetry","context_page_description":"Marquetry is the art and craft of applying pieces of veneer to a structure to form decorative patterns, designs or pictures. The technique may be applied to case furniture or even seat furniture, to decorative small objects with smooth, veneerable surfaces or to freestanding pictorial panels appreciated in their own right.\\nMarquetry differs from the more ancient craft of inlay, or intarsia, in which a solid body of one material is cut out to receive sections of another to form the surface pattern. The word derives from a Middle French word meaning \\"inlaid work\\"."},{"page_url":"https://en.wikipedia.org/wiki/Massena,_Iowa","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fa/Cass_County_Iowa_Incorporated_and_Unincorporated_areas_Massena_Highlighted.svg","page_title":"Massena, Iowa","context_page_description":"Massena is a city in Cass County, Iowa, United States. The population was 355 at the 2010 census. Massena's motto is: \\"The Home of Friendly People\\". Massena's sister community is Cumberland, Iowa. Massena is named after Massena, New York."},{"page_url":"https://en.wikipedia.org/wiki/Nyah_West","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ed/Nyah_West_Grand_Hotel_006.JPG","page_title":"Nyah West","context_page_description":"Nyah West is a town in Victoria, Australia near the Murray River, the border with New South Wales. It is near the Murray Valley Highway, 371 kilometres north-west of Melbourne and 27 kilometres north-west of Swan Hill.\\nThe town was established when the railway line was extended from Swan Hill to Piangil in 1915 passing some distance to the west of the established township of Nyah. A full Post Office opened here on 1 December 1917. Nyah West Magistrates' Court was formally closed on 1 September 1982, having used a local hall rather than its own courthouse and not having sat for many years.\\nAt the 2011 census, Nyah West had a population of 552. It is the business and commercial centre of a prosperous irrigation district which produces wine and dried fruit, as well as vegetables and wool.\\nThe town in conjunction with neighbouring township Nyah has an Australian Rules football team competing in the Central Murray Football League known as Nyah-Nyah West United.\\nGolfers play at the course of the Nyah West Golf Club on Yarraby Road."},{"page_url":"https://en.wikipedia.org/wiki/Public_toilet","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Old_school_toilet_aside_%286915214053%29.jpg","page_title":"Public toilet","context_page_description":"A public toilet is a room or small building with toilets and sinks that does not belong to a particular household. Rather, the toilet is available for use by the general public, customers, travellers, employees of a business, school pupils, prisoners etc. Public toilets are commonly separated into male and female facilities, although some are unisex, especially for small or single-occupancy public toilets. Increasingly, public toilets are accessible to people with disabilities. Public toilets are known by many other names depending on the country. Examples are: restroom, bathroom, men's room, women's room in the US, washroom in Canada, and toilets, lavatories, water closet, ladies and gents in Europe. In some parts of the world, they are referred to as the loo.\\nSome public toilets are free of charge while others charge a fee. In the latter case they are also called pay toilets and sometimes have a charging turnstile.\\nLocal authorities or commercial businesses may provide public toilet facilities. Some are unattended while others are staffed by an attendant."},{"page_url":"https://fr.wikipedia.org/wiki/EuroSprinter","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/12/%C3%96BB_Railjet_1116-236_on_Krauselklause-Viaduct.jpg","page_title":"EuroSprinter","context_page_description":"EuroSprinter est le nom d'une famille de locomotives électriques déclinant un principe modulaire adapté au marché européen par Siemens. Le nom de produit interne à Siemens est ES 64, où ES est l'abréviation de EuroSprinter et le nombre 64 indique la puissance de 6 400 kW.\\nUne information complémentaire est donnée dans le nom sur l'utilisation et le nombre de systèmes d'alimentation électriques."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%A7%DA%86%E2%80%8C%D8%A7%D9%85%E2%80%8C%D8%A7%DB%8C%E2%80%8C%D8%A7%D8%B3_%D8%A7%D8%B3%D8%AA%D9%88%D8%A7%D8%B1%D8%AA_(%D8%AF%DB%8C%DB%B0%DB%B0)","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/05/HMAS_Stuart_%28AWM_P01593-002%29.jpg","page_title":"اچ‌ام‌ای‌اس استوارت (دی۰۰)","context_page_description":"اچ‌ام‌ای‌اس استوارت (دی۰۰) یک کشتی بود که طول آن ۳۳۲ فوت ۷٫۵ اینچ بود. این کشتی در سال ۱۹۱۸ ساخته شد."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A3%D0%B7%D0%B5%D0%BD%D1%8C-%D0%91%D0%B0%D1%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/18/%D0%A3%D0%B7%D0%B5%D0%BD%D1%8C-%D0%91%D0%B0%D1%88.JPG","page_title":"Узень-Баш","context_page_description":"Узень-Баш — река на Южном берегу Крыма, в ущелье Яман-Дере, на территории городского округа Алушта.\\nУзень-Баш берёт начало из родника Бер-Бер-Богаз-Чокрак на северном склоне Бабуган-яйлы на высоте около 600 м. Долину реки занимают дубово-буковые леса. Имеет ряд притоков: Ахта-Шлар, Ахта-Шлар восточный, Хайрахташ-Дере. На реке расположен водопад Головкинского. Слияние рек Узень-Баш и Софун-Узень образует реку Улу-Узень, которая впадает в Чёрное море. Высота устья — 208 м над уровнем моря."},{"page_url":"https://es.wikipedia.org/wiki/Persea_indica","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Persea_indica_-_Berlin.jpg","page_title":"Persea indica","context_page_description":"Persea indica, llamada comúnmente viñátigo, es una especie de la familia Lauraceae. Se halla en los archipiélagos de la Macaronesia: Azores, Madeira y Canarias.\\nEsta especie se considera, según una ley del Gobierno de Canarias, el símbolo natural de la isla de La Gomera, conjuntamente con la Paloma rabiche.​\\nEstá amenazada por la pérdida de hábitat. Por ejemplo, en la isla de La Palma sufre la competición invasora del castaño, mientras en Las Azores, su antiguo hábitat corresponde a las zonas que, hoy en día, son las más urbanizadas y cultivadas.\\nAl ser del género Persea es compatible como porta-injertos del aguacate."},{"page_url":"https://ko.wikipedia.org/wiki/R_66%EA%B3%BC_R_126","image_url":"http://upload.wikimedia.org/wikipedia/commons/4/49/R_66_and_R_126_disc_illustration.png","page_title":"R 66과 R 126","context_page_description":"R 66과 R 126은 미국 항공우주국의 스피처 우주 망원경이 대마젤란 성운 내에서 발견한 항성계이다. R66은 HDE 268835로도 표기하며 R 126은 HD 37974로도 표기한다. R 66과 R 126의 질량은 각각 태양의 30배와 70배이며, 둘은 먼지 원반에 둘러싸여 있다. 이 먼지 원반은 행성이 태어나는 요람이 될 것으로 추측된다."},{"page_url":"https://pl.wikipedia.org/wiki/Neoglaziovia_variegata","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Neoglaziovia_concolor_CBM.png","page_title":"Neoglaziovia variegata","context_page_description":"Neoglaziovia variegata – gatunek rośliny włóknodajnej z rodziny bromeliowatych uprawianej w Brazylii."},{"page_url":"https://cv.wikipedia.org/wiki/%D0%92%D0%B8%D1%88%D0%B5%D1%80%D0%B0_(%D0%A7%D1%83%D0%BB%D0%BC%D0%B0%D0%BD_%D0%90%D1%82%C4%83%D0%BB_%D1%8E%D0%BF%D0%BF%D0%B8)","image_url":"http://upload.wikimedia.org/wikipedia/commons/2/25/Vishera.jpg","page_title":"Вишера (Чулман Атăл юппи)","context_page_description":"Ви́шера — Пермь Енĕнчи юханшыв, Чулман Атăлăн сулахай юппи.\\nТăршшĕ — 415 çм, бассейн лаптăкĕ — 31 200 çм². Шыв тултарăвĕн вăтам çӳллĕшĕ 317 метр. Юханшывăн вăтам тайлăкĕ — 0,2 метр 1 километр çине.\\nПермь Енĕнче вăрăммăшĕпе пиллĕккĕмĕш, Уралти хитре юханшывсенчен пĕрри. Енĕн çурçĕр-тухăçĕнче, Коми Республикипе тата Свердловск облаçĕпе юнашар пуçланать. Ытларах Урал тăвĕн умĕпе юхать, вичкĕн ту юханшывĕ; нумай ăшăх тата юханшыв пусми.\\nВишерăн сылтăм çăлкуçĕ — Кĕçĕн Вишера — Яна-Емта ту хысакĕнче, сулахаййи — Мăн Вишера — Поримонгит-Ур отрогĕсенчен, Пиçиххи Чулĕ ту хысакĕн пĕр тăрринчен, Коми Республикин, Свердловск облаçĕн тата Перĕм Енĕн чиккисенче пуçланать. Çăлкуçĕсене Вишера Чулĕ уйăрать, юпăсем Çар тăвĕн çурçĕр тăвĕ умĕнче пĕрлешеççĕ.\\nПуçламăшĕнчен Улс вăррине çити Вишера — кĕрлесе юхакан ту шывĕ, тăршшĕпе чылай шарлак. Унăн анлăшĕ 70 метăра таран пулать.\\nВăтам Вишера — Улсăн вăрринчен Колвăн вăррине çити — 150 метр саралакăшлĕ, чылай шарлаклă тата çыран çумĕнчи ăшăхлă юханшыв. Юханшыв айлăмĕ кунта чылаях саркаланать, анчах çыран хĕрри çав тери чуллă.\\nАнат Вишера — айлăмри вырăн-вырăнĕпе 900 метра çити саркаланса юхакан шыв."},{"page_url":"https://eu.wikipedia.org/wiki/Oviedo_-_La_Espina_Autobia","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f7/A-63Spain.png","page_title":"Oviedo - La Espina Autobia","context_page_description":"A-63 edo Oviedo - La Espinako Autobia Oviedo eta La Espina lotuko dituen autobia izango da."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Clo%C3%AEtre-Saint-Th%C3%A9gonnec","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/34/Cassini_carte_Clo%C3%AEtre-Saint-Th%C3%A9gonnec.jpg","page_title":"Le Cloître-Saint-Thégonnec","context_page_description":"Le Cloître-Saint-Thégonnec [lə klwatʁ sɛ̃ tegɔnɛk], est une commune du département du Finistère, dans la région Bretagne, en France."},{"page_url":"https://de.wikipedia.org/wiki/J%C3%A4gerhof_(Leipzig)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a6/Lzg._Hainstra%C3%9Fe_17%2C_19_%281895%29.jpg","page_title":"Jägerhof (Leipzig)","context_page_description":"Der Jägerhof in Leipzig ist ein Gebäudekomplex zwischen Hainstraße und Großer Fleischergasse, durch den die gleichnamige Passage verläuft. Er steht unter Denkmalschutz."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Kulturdenkmale_in_Pirna_(s%C3%BCdliche_Stadtteile)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3a/Breite_Stra%C3%9Fe_4_Pirna.JPG","page_title":"Liste der Kulturdenkmale in Pirna (südliche Stadtteile)","context_page_description":"In der Liste der Kulturdenkmale in Pirna (südliche Stadtteile) sind sämtliche Kulturdenkmale der sächsischen Stadt Pirna verzeichnet, die bis 2017 vom Landesamt für Denkmalpflege Sachsen erfasst wurden und die in den südlich der Altstadt gelegenen Stadtteilen von Pirna liegen. Dabei handelt es sich zum einen um die südlichen Teile der Gemarkung Pirna, die den historischen Stadtteilen Dohnaische Vorstadt, Hausberg und Obertorvorstadt entsprechen. Zum anderen betrifft dies die südlichen Gemarkungen Krietzschwitz, Neundorf, Rottwerndorf, Zehista und Zuschendorf. Die Südvorstadt, die sich über Teile der Gemarkungen Pirna und Rottwerndorf erstreckt, wurde aufgrund der Bedeutung dieses Stadtteils in der heutigen Stadtentwicklung gesondert erfasst. Die Anmerkungen sind zu beachten.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Pirna.\\nDiese Liste ist eine Teilliste der Liste der Kulturdenkmale in Sachsen."},{"page_url":"https://et.wikipedia.org/wiki/Aruk%C3%BCla_hiidrahn","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Arukyla-hiidrandrahn.JPG","page_title":"Aruküla hiidrahn","context_page_description":"Aruküla hiidrahn ehk Hellama kivi on looduskaitsealune kivi Harju maakonnas Raasiku vallas Aruküla alevikus ning on üks Eesti suurimatest rändrahnudest. Mahult kuues maapealne hiidrahn Eestis.\\nRändrahnu ümbermõõt on 35,2 meetrit ja kõrgus 6,2 meetrit."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D9%86_%D9%BE%DB%8C%D8%AA%D8%B1%D9%88_%D8%A7%DB%8C%D9%86_%DA%A9%D8%A7%D8%B1%DB%8C%D8%A7%D9%86%D9%88","image_url":"http://upload.wikimedia.org/wikipedia/commons/9/9c/Chiesa_di_Castelrotto_-_San_Pietro_in_Cariano_-_in_restauro.jpg","page_title":"سن پیترو این کاریانو","context_page_description":"سن پیترو این کاریانو یک کومونه در ایتالیا است که در استان ورونا واقع شده‌است."},{"page_url":"https://en.wikipedia.org/wiki/Logan_Stenberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Logan_Stenberg.jpg","page_title":"Logan Stenberg","context_page_description":"Logan Stenberg is an American football offensive guard for the Detroit Lions of the National Football League. He played college football at Kentucky."},{"page_url":"https://eo.wikipedia.org/wiki/Jugoslavaj_Partizanoj","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0a/Ustanak_u_Jugoslaviji_1941.png","page_title":"Jugoslavaj Partizanoj","context_page_description":"La Jugoslavaj Partizanoj, aŭ Naciliberiga Armeo, oficiale la Naciliberiga Armeo kaj Partizanaj Taĉmentoj de Jugoslavio, estis la rezistada movado, ĉefe de komunistoj, kontraŭ la ŝtatoj de la Akso en okupaciita Jugoslavio dum la Dua Mondmilito.\\nĜi estis konsiderata la plej efika en Eŭropo el la kontraŭ-Aksaj rezistomovadoj dum la Dua Mondmilito, ofte kompare kun la Pola Rezistomovado, kvankam tiu lasta estis ĉefe ne-komunisma sendependa movado. La Jugoslava Rezistomovado estis estrita de la Komunisma Partio de Jugoslavio dum la Dua Mondmilito. Ties komandanto estis la marŝalo Josip Broz Tito."},{"page_url":"https://zh-yue.wikipedia.org/wiki/%E9%AB%98%E7%BE%8E%E5%B0%BC","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/45/Portrait_of_Ruhollah_Khomeini_By_Mohammad_Sayyad.jpg","page_title":"高美尼","context_page_description":"高美尼（波斯文：سید روح‌الله موسوی خمینی\\n，1902年9月22號—1989年6月3號）係伊朗頭一位最高領袖，1979年到1989年在位。\\n佢本嚟係位回教什葉派宗教學者，1979年領導伊朗革命，最後成功將巴列維王朝落台，建立伊朗伊斯蘭共和國。\\n1989年，高美尼因病去世。"},{"page_url":"https://fi.wikipedia.org/wiki/Juri_Gidzenko","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5d/YGidzenko_Exp4.jpg","page_title":"Juri Gidzenko","context_page_description":"Juri Gidzenko on ukrainalais-venäläinen kosmonautti. Hän on Venäjän ilmavoimien eversti ja kaukokartoitustutkija ja avaruuslentäjä. Hän on myös laskuvarjohyppykouluttaja. Hän on naimisissa Olga Vladimirovna Shapovalovan kanssa. Perheessä on kaksi poikaa, Sergei ja Aleksandr.\\nGidzenko on saanut Venäjän federaation sankari -mitalin.\\nGidzenko oli Euro-Mir-94-lennon varamiehistössä. Hän oli avaruudessa Mir-avaruusasemalla 3. syyskuuta 1995 – 29. helmikuuta 1996. Hän oli 3. lokakuuta 2000 – 31. maaliskuuta 2001 ISS-avaruusaseman ensimmäisessä miehistössä. Hän oli 25. huhtikuuta 2002 alkaneen 9-päiväisen Sojuz TM-34 -lennon päällikkö."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%82%B1%E3%83%97%E3%83%A9%E3%83%BC452b","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a9/Kepler-452b_with_Earth.png","page_title":"ケプラー452b","context_page_description":"ケプラー452b とは地球から見てはくちょう座の方向に約1400光年離れた位置にあるG型主系列星、ケプラー452を公転している太陽系外惑星である。ケプラー宇宙望遠鏡による観測のもと、Jon M. Jenkinsらのチームにより発見され、2015年7月23日にNASAより公表された。しかし、2018年に公表されたMullallyらの論文では完全には存在が確定していないことを指摘しており、候補に留まると考える説もある。質量は最大でも3.3 M⊕のスーパーアースで太陽に似た恒星のハビタブルゾーンを公転していると考えられている。もしニュー・ホライズンズが59,000km/hでこの惑星系に到達したとしても約2580万年ほどかかる。"},{"page_url":"https://de.wikipedia.org/wiki/Charco_Azul_(San_Andr%C3%A9s_y_Sauces)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/La_Palma_-_San_Andres_y_Sauces_-_San_Andres_-_Paseo_Mar%C3%ADtimo_Charco_Azul_01_ies.jpg","page_title":"Charco Azul (San Andrés y Sauces)","context_page_description":"Charco Azul ist eine Bucht mit einem Meeresschwimmbecken an der felsigen Nordostküste der Kanarischen Insel La Palma und befindet sich in der Gemeinde San Andrés y Sauces. Die Bucht liegt nördlich des Dorfes San Andrés und südlich des Fischerhafens Puerto Espíndola. In ihr gibt es drei kleine Tümpel, die durch Meereswasser gespeist sind und ein Bad erlauben: den namensgebenden Charco Azul, den Charco de los Guardias und den Charco de las Damas, die über Treppen und Wege erschlossen sind."},{"page_url":"https://vi.wikipedia.org/wiki/Ti%E1%BA%BFng_Tri%E1%BB%81u_Ch%C3%A2u","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/24/Banlamgu.svg","page_title":"Tiếng Triều Châu","context_page_description":"Tiếng Triều Châu là một ngôn ngữ thuộc ngữ hệ Hán-Tạng được nói như tiếng mẹ đẻ tại là vùng Triều Sán, phía Đông tỉnh Quảng Đông, bao gồm Triều Châu, Sán Đầu và Yết Dương ngày nay. Tiếng Triều Châu cùng với tiếng Tuyền Chương, và có thể cả tiếng Lôi Châu và tiếng Hải Nam, đều thuộc nhóm Mân Nam.\\nNgười Triều Châu, như cách gọi hàng ngàn năm nay ở khu vực đông bắc tỉnh Quảng Đông Trung Quốc, vốn là dân gốc Mân Nam kết hợp với dân tộc Bách Việt cổ.\\nTiếng Triều Châu hiện nay là ngôn ngữ chính của vùng Triều Sán. Được sử dụng như tiếng mẹ đẻ ở Triều Nam, Triều Dương, Triều An, Trừng Hải, Sán Đầu, Yết Dương, Huệ Lai, Phổ Ninh, Nhiêu Bình. Một số nước Đông Nam Á như: Việt Nam, Campuchia, Thái Lan, Singapore, Malaysia, Indonesia. Một số nước khác như: Mỹ, Canada, Úc....\\nỞ Việt Nam, người ta sử dụng tiếng Tiều nhiều ở Thành phố Hồ Chí Minh, các tỉnh miền Tây như Cần Thơ, Sóc Trăng, Bạc Liêu, Kiên Giang, Cà Mau, Vĩnh Long, Tiền Giang, Đồng Tháp..."},{"page_url":"https://sk.wikipedia.org/wiki/Varambon","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Map_commune_FR_insee_code_01430.png","page_title":"Varambon","context_page_description":"Varambon je francúzska obec, ktorá sa nachádza v departemente Ain, v regióne Rhône-Alpes."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%A7%D9%84%D9%82%D9%88%D8%A7%D8%AA_%D8%A7%D9%84%D8%AC%D9%88%D9%8A%D8%A9_%D8%A7%D9%84%D8%AA%D8%A7%D9%8A%D9%88%D8%A7%D9%86%D9%8A%D8%A9","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/12SQ.png","page_title":"القوات الجوية التايوانية","context_page_description":"سلاح الجو لجمهورية الصين ‏ هو فرع الطيران في القوات المسلحة لجمهورية الصين. المهمة الرئيسية لسلاح الجو لجمهورية الصين هو الدفاع عن المجال الجوي فوق وحول تايوان."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Sankt_Jakob_im_Rosental","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Sankt_Jakob_im_Rosental_Rosenbach_Filialkirche_Christkoenig_27092011_777.jpg","page_title":"Liste der denkmalgeschützten Objekte in Sankt Jakob im Rosental","context_page_description":"Die Liste der denkmalgeschützten Objekte in Sankt Jakob im Rosental enthält die 19 denkmalgeschützten, unbeweglichen Objekte der Gemeinde Sankt Jakob im Rosental."},{"page_url":"https://ceb.wikipedia.org/wiki/Goito_(munisipyo)","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/Stanislao_Grimaldi_Dal_Poggetto_-_primo_combattimento_di_Goito_-litografia_-ca.1860.JPG","page_title":"Goito (munisipyo)","context_page_description":"Munisipyo ang Goito sa Italya. Nahimutang ni sa lalawigan sa Provincia di Mantova ug rehiyon sa Lombardia, sa amihanan-kasadpang bahin sa nasod, 400 km sa amihanan sa Rome ang ulohan sa nasod. Adunay 10,289 ka molupyo. Naglangkob kin og 78 ka kilometro kwadrado. Goito mopakigbahin sa usa ka utlanan sa Cavriana, Guidizzolo, Porto Mantovano, Volta Mantovana, Ceresara, Marmirolo, ug Rodigo.\\nAng yuta sa Goito kay patag.\\nAng klima umogon ug subtropikal. Ang kasarangang giiniton 13 °C. Ang kinainitan nga bulan Hulyo, sa 24 °C, ug ang kinabugnawan Enero, sa 0 °C. Ang kasarangang pag-ulan 1,448 milimetro matag tuig. Ang kinabasaan nga bulan Nobiyembre, sa 195 milimetro nga ulan, ug ang kinaugahan Hunyo, sa 74 milimetro."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A1%E3%83%87%E3%83%BC%E3%82%A2","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/86/Medea_go_ara_pacis_mundi_2.jpg","page_title":"メデーア","context_page_description":"メデーアは、イタリア共和国フリウリ＝ヴェネツィア・ジュリア州ゴリツィア県にある、人口約1000人の基礎自治体。"},{"page_url":"https://vi.wikipedia.org/wiki/Isabella_I_c%E1%BB%A7a_Castilla","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/de/Album_Rejio%2C_Francisco_de_Paula_van_Halen%2C_batalla_de_Toro_%28cropped%29.jpg","page_title":"Isabella I của Castilla","context_page_description":"Isabella I của Castilla, còn được gọi là Isabel the Catholic, là Nữ vương của Vương quốc Castilla và León và là một trong những quân chủ vĩ đại nhất của lịch sử Tây Ban Nha. Cùng với chồng, Fernando II của Aragon, bà đã có công trong việc mang lại sự ổn định cho các vương quốc này, làm cơ sở cho việc thống nhất Tây Ban Nha bởi người cháu ngoại của họ, Karl V của đế quốc La Mã Thần thánh.\\nSau khi giành được quyền kế vị, bà đã cải tổ lại bộ máy hành chính của Castilla, đem tỉ lệ tệ nạn xuống mức thấp nhất trong nhiều năm qua. Bà cũng cố gắng xoay trở xóa đi số nợ quốc gia khổng lồ mà người anh của bà, Henry IV của Castilla, đã để lại khi qua đời. Sự cải cách của bà cùng chồng mình, Fernando II xứ Aragon, đã giúp sự liên minh giữa Castilla và Aragon thêm lớn mạnh, mở rộng thêm tầm ảnh hưởng ra bên ngoài. Bà cùng chồng mình được biết đến nhiều vì công cuộc khép tội những người Do Thái và người Hồi giáo trên liên bang 2 vương quốc, buộc tội họ trước Tòa án dị giáo hoặc là phải cải đạo Cơ-đốc, hoặc là bị trục xuất khỏi vùng đất này."},{"page_url":"https://en.wikipedia.org/wiki/Riverside_Theatre_(Iowa)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Riverside_Theatre_House.png","page_title":"Riverside Theatre (Iowa)","context_page_description":"Riverside Theatre is a theatre located in Iowa City, Iowa. As one of few professional theatres in the area, Riverside allows a platform for artists to work professionally. The theatre is currently being led by Artistic Director Adam Knight as of 2018. Riverside Theatre is proudly affiliated with Actors' Equity Association and is a member of the Theatre Communications Group, the National New Play Network, the Shakespeare Association of America, and the Institute of Outdoor Drama.\\nRiverside Theatre produces a broad range of work from classics to contemporaries to regional or state premieres. The Gilbert Street season includes a large variety of genres to fit the theatre's intimate space and production style."},{"page_url":"https://nl.wikipedia.org/wiki/Steeneik","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Quercus_ilex%2C_Steeneik_closeup_lengtedoorsnede.jpg","page_title":"Steeneik","context_page_description":"De steeneik is een boom uit de napjesdragersfamilie. Deze van nature in Zuid-Europa voorkomende, groenblijvende eik wordt veel aangeplant als sierboom en ter beschutting, vooral in kuststreken. De boom is bestand tegen de zilte zeewind en de luchtvervuiling in de stad. In Nederland en Vlaanderen is de boom matig winterhard. De boom kan dertig meter hoog worden, maar blijft meestal veel lager. In rotsachtige gebieden blijft de eik vaak struikvormig."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D9%8A%D9%84%D9%8A%D8%A7%D9%85_%D8%AC%D9%88%D8%B1%D8%AC_%D8%B3%D8%AA%D9%8A%D9%81%D9%86%D8%B2","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b5/MG_W_G_Stevens.jpg","page_title":"ويليام جورج ستيفنز","context_page_description":"ويليام جورج ستيفنز ‏ هو دبلوماسي نيوزلندي، ولد في 11 ديسمبر 1893 في لندن في المملكة المتحدة، وتوفي في 7 أغسطس 1975 في نيلسون في نيوزيلندا."},{"page_url":"https://fy.wikipedia.org/wiki/Iepenbier_akwarium","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Male_whale_shark_at_Georgia_Aquarium.jpg","page_title":"Iepenbier akwarium","context_page_description":"In iepenbier akwarium of publyk akwarium is in type dieretún dat spesjalisearre is yn it toanen fan bisten en planten dy't ûnder wetter libje. Dêrta is sa'n bedriuw tarist mei teminsten ien, mar ornaris in stikmannich akwaria: grutte bakken mei wetter wêryn't de bisten en planten libje, mei teminsten ien trochsichtige kant, dêr't it publyk troch nei binnen sjen kin. Yn iepenbiere akwaria wurde oer it algemien gruttere bisten holden as men by minsken thús yn in privee-akwarium sjocht. Dêrby giet it om fisken, mar ek om wringeleazen, amfibyen, akwatyske reptilen, otters, pinguïns en seesûchdieren. In iepenbier akwarium wêryn't dolfinen of oare walfiskeftigen holden wurde, hjit in dolfinarium.\\nIt earste iepenbiere akwarium fan 'e wrâld wie it saneamde Fish House, dat yn maaie 1853 troch de Ingelske biolooch Philip Henry Gosse iepene waard 'e London Zoo yn 'e Britske haadstêd Londen. Yn 1856 rjochte sirkusdirekteur en ûndernimmer P.T. Barnum oan Broadway yn New York Barnum's American Museum op, dat it earste iepenbier akwarium fan 'e Nije Wrâld omfieme foar't it yn 1865 ôfbaarnde."},{"page_url":"https://de.wikipedia.org/wiki/Mikasuki","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Miccosukee_Tribe_Information_Center_Everglades.jpg","page_title":"Mikasuki","context_page_description":"Die Mikasuki, auch Miccosukee oder offiziell Miccosukee Tribe of Indians of Florida, sind eine der drei von der US-Regierung auf Bundesebene anerkannten Stämme der amerikanischen Ureinwohner, die in Florida leben."},{"page_url":"https://sv.wikipedia.org/wiki/Amsterdam_Centraal","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Amsterdam_CS.jpg","page_title":"Amsterdam Centraal","context_page_description":"Järnvägsstationen Amsterdam Centraal är Amsterdams centralstation. Amsterdam Centraal är ritad av arkitekterna Pierre Cuypers och Al Van Gendt, och öppnades år 1889. Den är byggd på tre öar i vattnet IJ framför det som innan dess var stadens \\"framsida\\". Byggnaden liknar Rijksmuseum, som öppnades år 1885, även det ritat av Cuypers.\\nStationen har 15 spår och de sex perrongerna nås av de resande via gångar underifrån. Stationen är uppbyggd på vanligt 1800-talssätt, med en pampig fasadbyggnad innehållande väntsalar, biljettkontor m.m. och bakom den en tåghall i stål och glas. Men den har också en ovanlig layout eftersom spåren inte bara ligger bredvid varandra på vanligt sätt, utan också efter varandra: I östra delen ligger alltså \\"Spår 2a\\" och i västra delen \\"Spår 2b\\". De flesta tåg som stannar på stationen har inte Amsterdam Centraal som ändpunkt, utan kör vidare till en annan station i Amsterdam eller till en annan del av landet. Anledningen till detta är att det inte finns plats på någon av stadens tre rangerbangårdar."},{"page_url":"https://pt.wikipedia.org/wiki/Reino_de_Jafanapat%C3%A3o","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/17/Mantri_Manai.JPG","page_title":"Reino de Jafanapatão","context_page_description":"O Reino de Jafanapatão, também conhecido por Reino de Aryacakravarti, foi uma monarquia histórica do Seri Lanca, centrada na cidade de Jafanapatão, na península homónima no norte da ilha. O reino foi fundado na sequência invasão da região pelo guerreiro Calinga Maga, oriundo de Calinga, na Índia. Tendo inicialmente estabelecido um novo centro de poder a norte, noroeste e ocidente da ilha, em 1258 o reino tornou-se um feudo tributário do Império Pândia, situado na atual Índia do Sul. Com o declínio do domínio de Pândia, o reino obteve a independência em 1323, após a derrota e expulsão do último governador por Malik Kafur, general do exército do Sultanato de Déli. Durante um breve período de tempo na primeira metade do século XIV, o reino tornou-se a entidade política dominante na ilha quando todos os restantes reinos da região aceitaram ser seus subordinados. No entanto, em 1450 Jafanapatão passou a ser dominado pelo rival reino de Cota, na sequência de uma invasão por um exército tâmil liderado por Chempaha Perumal sob as ordens de Cota.\\nO reino libertou-se do domínio Cota em 1467."},{"page_url":"https://es.wikipedia.org/wiki/Neues_Museum","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Berlin_Neues_Museum_001.JPG","page_title":"Neues Museum","context_page_description":"El Neues Museum está situado al norte del Altes Museum, en la Isla de los Museos de Berlín. Fue construido entre 1843 y 1855 según los planos de Friedrich August Stüler, un discípulo de Karl Friedrich Schinkel.​ El museo fue gravemente dañado durante la Segunda Guerra Mundial, pero ha sido reconstruido y en octubre de 2009 se organizó su reapertura.\\nEl Neues Museum fue el segundo museo en construirse en la “Isla de los Museos” y fue pensado como una ampliación para albergar las colecciones que no podían ser exhibidas en el Altes Museum. Entre éstas se encontraban las colecciones de modelos en yeso, objetos del Antiguo Egipto, colecciones históricas y prehistóricas, la colección etnográfica y la de grabados.\\nLa exhibición incluye una sala sobre el Antiguo Egipto y colecciones de Prehistoria e Historia, igual que lo hizo antes de la guerra. Entre los objetos que se exponen, destaca la famosa escultura de la reina egipcia Nefertiti.\\nComo parte del complejo de Museos de la Isla, o como edificio individual, el museo es un fiel exponente de la arquitectura neoclásica del siglo XIX."},{"page_url":"https://ro.wikipedia.org/wiki/Beauchamps-sur-Huillard","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d2/Map_commune_FR_insee_code_45027.png","page_title":"Beauchamps-sur-Huillard","context_page_description":"Beauchamps-sur-Huillard este o comună în departamentul Loiret din centrul Franței. În 2009 avea o populație de 414 de locuitori."},{"page_url":"https://es.wikipedia.org/wiki/Campa%C3%B1a_del_Desierto_Sirio_(mayo%E2%80%93julio_2017)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Qasem_Soleimani_in_Syrian_Desert_%28June_2017%29.jpg","page_title":"Campaña del Desierto Sirio (mayo–julio 2017)","context_page_description":"La Campaña del Desierto Sirio fue una operación militar del ejército sirio que inicialmente comenzó a lo largo de la carretera de Damasco a la frontera con Irak contra las fuerzas rebeldes durante la Guerra Civil siria. Su primer objetivo era capturar tanto la carretera como el cruce fronterizo de al-Tanf, asegurando así el campo de Damasco de un posible ataque rebelde.​​ Más tarde, se abrieron muchos otros frentes como parte de la operación en todo el desierto, así como la operación \\"Grand Dawn\\" contra EIIL con el objetivo de reabrir la carretera Damasco-Palmira y prepararse para una ofensiva hacia Deir ez-Zor.​​\\nDesde 2016, los Estados Unidos y el Reino Unido operaron y tripularon una instalación de entrenamiento en al-Tanf, con sus tropas de operaciones especiales asesorando a un grupo rebelde sirio conocido como el Ejército Revolucionario de Comando. La guarnición se reforzó en mayo y luego se expandió en junio de 2017, con armas ofensivas más avanzadas de EE. UU., incluidos los lanzadores de cohetes múltiples HIMARS."},{"page_url":"https://es.wikipedia.org/wiki/Iglesia_de_Sant_Miquel_de_Vilageriu","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/10/Spain%2C_Catalonia%2C_Tona%2C_Sant_Miquel_de_Vilageliu_%282%29.JPG","page_title":"Iglesia de Sant Miquel de Vilageriu","context_page_description":"La iglesia de Sant Miquel de Vilageriu está situada a 500 metros de la ciudad de Tona en la comarca catalana de Osona. La iglesia se menciona como Sant Miquel de Vilageliu en los mapas por el Institut Cartogràfic de Catalunya, pero se llama Sant Miquel de Vilageriu de señales locales.\\nSe hace mención de ella en el año 958 como situada in Villa Gerile, ya que dependía de los señores de Rocafort que también eran señores de Vilageriu."},{"page_url":"https://de.wikipedia.org/wiki/Kinder-_und_Jugenddorf_Ben_Shemen","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/59/Members_of_Israeli_Delegation_to_Armistice_talks_in_Rhodes%2C_January_1949.jpg","page_title":"Kinder- und Jugenddorf Ben Shemen","context_page_description":"Das Kinder- und Jugenddorf Ben Shemen ist eine 1927 von dem deutsch-israelischen Arzt und Pädagogen Siegfried Lehmann gegründete und lange Jahre geleitete Kinder- und Jugendrepublik auf dem Gelände von Ben Shemen. Als Ben Shemen Youth Village konnte es 2017 sein neunzigjähriges Jubiläum feiern."},{"page_url":"https://de.wikipedia.org/wiki/Geschichte_der_Stra%C3%9Fenbahnfahrzeuge_in_Deutschland","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/J30_069_Bf_Burgst%C3%A4dt%2C_0690_439.jpg","page_title":"Geschichte der Straßenbahnfahrzeuge in Deutschland","context_page_description":"Während in den anderen großen westlichen Staaten Europas die meisten Straßenbahnnetze in der zweiten Hälfte des 20. Jahrhunderts stillgelegt wurden, in Großbritannien außer in ein paar Seebädern, in Frankreich außer in Lille, Marseille und Saint-Étienne, in Italien außer in Mailand, Rom und Neapel, behielten die meisten bundesdeutschen Großstädte ihre Straßenbahn. In der DDR wurden nur wenige Straßenbahnnetze stillgelegt. Daher wurde in Deutschland der Fuhrpark einer großen Zahl von Straßenbahnbetrieben kontinuierlich weiterentwickelt.\\nDiese Galerie enthält bewusst nur eine recht knappe Auswahl, nicht mehr als erforderlich, um die zeitliche Entwicklung der Gestalt der Straßenbahnen zu verdeutlichen.\\nStraßenbahnfahrzeuge fahren üblicherweise 30 Jahre lang im Liniendienst, einzelne 50 Jahre und länger. Daher sind einige Wagen nicht in der Lackierung ihrer Epoche abgebildet, sondern in einer späteren. Bei etlichen hat man auch den ursprünglichen Stromabnehmer durch einen technisch moderneren ersetzt. So erfolgte bei der Berliner Straßenbahn die Umstellung von Stangen- auf Scherenstromabnehmer erst ab 1948. Einholmstromabnehmer werden auf Straßenbahnen erst seit etwa 1980 verwendet."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E4%BB%A5%E8%89%B2%E5%88%97%E7%8C%B6%E5%A4%AA%E5%A4%A7%E5%B1%A0%E6%AE%BA%E7%B4%80%E5%BF%B5%E9%A4%A8","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/14/Yad_Vashem_%28Facade%29_2008_02.jpg","page_title":"以色列猶太大屠殺紀念館","context_page_description":"以色列猶太屠殺紀念館或以色列猶太屠殺遇難同胞紀念館是以色列官方設立的猶太人大屠殺紀念館，位於以色列耶路撒冷城西的赫茨爾山，是世界最大、最有影響力的大屠殺紀念館。1953年根據以色列國會通過的《猶太大屠殺紀念法》成立，為紀念600餘萬被納粹屠殺的猶太人。大屠殺紀念館自奠基起逐步擴建，目前包含紀念禮堂、歷史博物館、藝術館、「名字堂」、兒童紀念堂、檔案館、外邦義人花園、「被毀滅社區山谷」、猶太會堂、及教育中心等。此外，紀念館同時紀念在大屠殺期間承擔巨大的個人風險，援救猶太人的非猶太人——稱為「外邦義人」。大屠殺紀念館目前是以色列僅次於西牆，遊客數量第二多的景點，外國領導人訪問以色列一般都會參觀大屠殺紀念館。參觀大屠殺紀念館完全免費，依靠自願捐款維持，每年有將近100萬遊客參觀。"},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%9C%E8%A6%96%E9%8F%A1","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/91st_MSFS_airmen_tone_skills_in_night-ops_training_120815-F-RB551-042.jpg","page_title":"夜視鏡","context_page_description":"夜视仪，也称夜视镜，是透过光学科技强化黑暗中光源的科技装置，通常用于军事用途。目前在民用安防上也有广泛的用途。"},{"page_url":"https://cs.wikipedia.org/wiki/Tenisov%C3%A1_sez%C3%B3na_Rogera_Federera_2014","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ea/Match_Federer-Gasquet_%28Coupe_Davis_2014%29.JPG","page_title":"Tenisová sezóna Rogera Federera 2014","context_page_description":"Tenisová sezóna Rogera Federera 2014 začala oficiálně 30. prosince 2013, kdy byl rozehrán australský turnaj Brisbane International. Švýcarský tenista na něm postoupil do 114. kariérního finále, v němž nestačil na Australana Lleytona Hewitta. Na úvodním Grand Slamu Australian Open zopakoval výsledek z předchozích dvou let, když vypadl v semifinále. Jeho přemožitelem se stala španělská světová jednička Rafael Nadal. Na antukovém French Open zaznamenal nejhorší výsledek od sezóny 2004, když vypadl ve čtvrtém kole s Lotyšem Ernestsem Gulbisem po pětisetové bitvě. Podeváté se probojoval do finále Wimbledonu. Po pětisetovém dramatu podlehl světové dvojce Novaku Djokovićovi a podruhé v All England Clubu skončil jako poražený finalista. Podruhé v roce si zahrál semifinále grandslamu na US Open, kde skončil na raketě téměř bezchybně hrajícího Chorvata Marina Čiliće.\\nV březnu slavil svůj šestý titul z Dubai Duty Free Tennis Championships, když ve finále zdolal Tomáše Berdycha. Jako první tenista historie tak na celkových odměnách vydělal více než 80 miliónů dolarů. Na následném Indian Wells Masters prohrál ve finále se Srbem Novakem Djokovićem."},{"page_url":"https://fr.wikipedia.org/wiki/Ugnouas","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/Lavoir_d%27Ugnouas_%28Hautes-Pyr%C3%A9n%C3%A9es%29_1.jpg","page_title":"Ugnouas","context_page_description":"Ugnouas est une commune française située dans le département des Hautes-Pyrénées, en région Occitanie.\\nSes habitants sont appelés les Ugnouasais."},{"page_url":"https://eu.wikipedia.org/wiki/Urticaceae","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/PileaCadierei.jpg","page_title":"Urticaceae","context_page_description":"Urikazeoak landare loredunen baitako familia da. Familiaren izena Urtica generotik dator. 54-79 genero eta 2.600 espezie ditu. Asunak eta Ramia landare urtikazeoak dira. Familia hau kosmopolita da.\\nZuhaitz, zuhaixka eta belar egitura izan dezakete. Gehienak, hala ere, belar egiturakoak dira. Hostoak txandaka edo aurka antolatuak izan ditzakete. Urtikazeoen familiako landare mota gehienek oinaren puntan edo hostoen oinetan dituzte loreak; sexubakarrak izaten dira horiek."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%97%D0%B0%D0%BA%D0%BE%D0%BD_%D0%BD%D0%B0_%D0%93%D0%BE%D0%B4%D1%83%D0%B8%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Mike_Godwin_at_Wikimedia_2010.jpg","page_title":"Закон на Годуин","context_page_description":"Законът на Годуин е хумористично наблюдение, направено от Майк Годуин през 1989 – 1990 година, станало пословично за Интернет през годините. То гласи: „Колкото по-дълга става една онлайн дискусия, толкова по-близка до 1 става вероятността в нея да се появи сравнение, свързано с нацистите или Хитлер“. С други думи, Годуин прави саркастичното наблюдение, че за достатъчно дълъг период от време всяка дискусия, без значение от темата и обхвата си, неминуемо завършва с Хитлер и нацистите.\\nЗаконът на Годуин често се цитира в онлайн обсъждания като своеобразна спирачка срещу употребата на аргументи от разпространената форма Reductio ad Hitlerum. Правилото не прави уговорки относно това дали всяка конкретна референция или сравнение, свързано с нацизма и Хитлер ще бъде уместно, а само подчертава, че вероятността за поява на такава референция или сравнение се повишава с нарастването на дискусията. Въпреки че в една от ранните си формулировки законът на Годуин се отнася конкретно до дискусиите в новинарските групи на Usenet, той често е приложим и към всякакви платформи за онлайн дискусии като чат стаите, форумите, коментарните секции в блоговете."},{"page_url":"https://it.wikipedia.org/wiki/William_Godwin","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0d/GodwinJournal.jpg","page_title":"William Godwin","context_page_description":"William Godwin è stato un filosofo, scrittore e politico libertario britannico.\\nPensatore del tardo Illuminismo nonché ispiratore di parte del Romanticismo inglese, specialmente la \\"seconda generazione romantica\\" comprendente John Keats, il suo genero Percy Bysshe Shelley e George Gordon Byron, radicale e repubblicano, è considerato uno dei primi teorizzatori anarchici moderni. L'opera più celebre di Godwin è il saggio Inchiesta sulla giustizia politica\\nin cui esprime un ideale di anarchismo filosofico.\\nSua moglie fu la scrittrice Mary Wollstonecraft, antesignana del femminismo di tipo liberale e dei diritti delle donne nonché autrice di Rivendicazione dei diritti della donna. Dalla loro unione nacque Mary Godwin, nota, dopo il matrimonio con il poeta Percy Bysshe Shelley, come Mary Shelley, autrice del celebre romanzo Frankenstein."},{"page_url":"https://fr.wikipedia.org/wiki/Moutier-d%27Ahun","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Moutier_d%27Ahun_-5.jpg","page_title":"Moutier-d'Ahun","context_page_description":"Moutier-d'Ahun est une commune française située dans le département de la Creuse, en région Nouvelle-Aquitaine."},{"page_url":"https://fr.wikipedia.org/wiki/Bas_les_pattes_!","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2a/Patch_of_the_Chicago_Police_Department.png","page_title":"Bas les pattes !","context_page_description":"Bas les pattes ! est un roman publié en septembre 1954 par Frédéric Dard sous le nom de plume de San-Antonio, il est le 12ᵉ de la série policière San-Antonio.\\nChez l’éditeur Fleuve noir, il porte d’abord le numéro 59 de la collection « Spécial Police », puis en 1975 le numéro 51 de la collection « San-Antonio »."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_Baudenkm%C3%A4ler_in_Ebersberg","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fd/Rinding_16_Kapelle_Ebersberg-2.jpg","page_title":"Liste der Baudenkmäler in Ebersberg","context_page_description":"Auf dieser Seite sind die Baudenkmäler der oberbayerischen Stadt Ebersberg zusammengestellt. Diese Tabelle ist eine Teilliste der Liste der Baudenkmäler in Bayern. Grundlage ist die Bayerische Denkmalliste, die auf Basis des Bayerischen Denkmalschutzgesetzes vom 1. Oktober 1973 erstmals erstellt wurde und seither durch das Bayerische Landesamt für Denkmalpflege geführt wird. Die folgenden Angaben ersetzen nicht die rechtsverbindliche Auskunft der Denkmalschutzbehörde."},{"page_url":"https://it.wikipedia.org/wiki/Eur_(zona_di_Roma)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/72/20110307_Roma_Palazzo_della_Civilt%C3%A0_Italiana_lato_sx.jpg","page_title":"Eur (zona di Roma)","context_page_description":"Eur è la zona urbanistica 12A del Municipio Roma IX di Roma Capitale.\\nSi estende in gran parte sul quartiere Q. XXXII Europa e parzialmente, nella parte nord, sul quartiere Q. X Ostiense."},{"page_url":"https://hy.wikipedia.org/wiki/%D4%BC%D5%A5%D5%A2%D6%80%D5%AB%D5%AD%D5%A1_(%D4%BB%D5%BD%D5%BA%D5%A1%D5%B6%D5%AB%D5%A1)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/85/Ayto_Lebrija.jpg","page_title":"Լեբրիխա (Իսպանիա)","context_page_description":"Լեբրիխա, քաղաք և մունիցիպալիտետ Իսպանիայում։ Մտնում է Սևիլյա պրովինցիայի կազմում և Անդալուզիա ինքնավար մարզի կազմի մեջ։\\nԶբաղեցնում է 372 քառ. կիլոմետր տարածք։ Բնակչությունը կազմում է 26 783 միլիոն ։ Գավառական մայրաքաղաքի տեղամասից գտնվում է 78 կիլոմետր հեռավորության վրա։"},{"page_url":"https://pt.wikipedia.org/wiki/Edwin_P._Morrow","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d1/Lockett_mob.jpg","page_title":"Edwin P. Morrow","context_page_description":"Edwin Porch Morrow foi um político americano que serviu como o 40° governador de Kentucky entre 1919 e 1923. Foi o único republicano eleito para esse cargo entre 1907 e 1927. Defendeu as típicas causas republicanos de sua época, ou seja, direitos iguais para afro-americanos e o uso da força para conter a violência. Morrow fora educado nos princípios de seu partido por seu pai, Thomas Z. Morrow, que era o seu candidato a governador em 1883, e seu tio, William O'Connell Bradley, que foi eleito governador em 1895. Os dois foram membros fundadores do Partido Republicano em Kentucky.\\nDepois de prestar serviços de não-combate na Guerra Hispano-Americana, Morrow graduou-se na Escola de Direito da Universidade de Cincinnati, em 1902 e abriu sua prática em Lexington, Kentucky. Fez um nome para si mesmo, quase imediatamente, garantindo a absolvição de um homem negro que tinha sido acusado de assassinato com base em uma confissão extorquida e testemunho perjuro. Ele foi nomeado procurador dos Estados Unidos para o Distrito Leste de Kentucky pelo presidente William Howard Taft em 1910 e serviu até que ele foi afastado do cargo em 1913 pelo presidente Woodrow Wilson."},{"page_url":"https://sv.wikipedia.org/wiki/Stenbockska_huset","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Stenbock_House_2015.JPG","page_title":"Stenbockska huset","context_page_description":"Stenbockska huset, estniska: Stenbocki maja, är en nyklassicistisk byggnad i Tallinn, uppförd 1787–1792. Huset är beläget på adressen Rahukohtu tänav 3 på Domberget i Gamla staden. Byggnaden fungerar sedan år 2000, då en större renovering avslutades, som regeringskansli för Estlands regering och premiärminister."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%80%E3%82%A4%E3%83%8F%E3%83%84%E3%83%BB%E3%82%BF%E3%83%B3%E3%83%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d7/2nd_generation_Daihatsu_Tanto_interior.jpg","page_title":"ダイハツ・タント","context_page_description":"タントは、ダイハツ工業が生産・販売している軽トールワゴンのブランド、車名。生産はダイハツ滋賀工場で行われていた。"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9B%D0%B8%D1%84%D1%83","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4e/Loyalty_islands_Lifou_map.png","page_title":"Лифу","context_page_description":"Лифу — крупнейший остров в группе Луайоте в Тихом океане. Является частью Новой Каледонии. Административно входит в состав коммуны Лифу провинции Луайоте."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9A%D0%BE%D1%80%D1%82-%D1%81%D1%82%D1%80%D0%B8%D1%82_/_%D0%91%D0%BE%D1%80%D0%BE-%D1%85%D0%BE%D0%BB%D0%BB_(%D0%9D%D1%8C%D1%8E-%D0%99%D0%BE%D1%80%D0%BA%D1%81%D0%BA%D0%BE%D0%B5_%D0%BC%D0%B5%D1%82%D1%80%D0%BE)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Borohallirtstairjeh.JPG","page_title":"Корт-стрит / Боро-холл (Нью-Йоркское метро)","context_page_description":"Корт-стрит / Боро-холл — пересадочный узел Нью-Йоркского метро. Главные выходы идут к Корт-стрит, Джоралимон-стрит и Монтегью-стрит.\\nВ пересадочный узел входят станции следующих линий:\\nлиния Бродвея и Седьмой авеню, Ай-ар-ти,\\nлиния Истерн-Паркуэй, Ай-ар-ти,\\nлиния Четвёртой авеню, Би-эм-ти.\\nНа станциях пересадочного узла останавливаются маршруты:\\n2, 4, R,\\n3,\\n5,\\nN,\\nW."},{"page_url":"https://pt.wikipedia.org/wiki/Gojira_(banda)","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Metal_band_Gojira_live_at_Tuska_%28Finland%29_2006.jpg","page_title":"Gojira (banda)","context_page_description":"Gojira é uma banda de Death Metal Progressivo francesa formada em 1996 em Baiona, França. Formado inicialmente com o nome de Godzilla, a banda alterou o nome em 2001. Gojira é composto pelo vocalista, guitarrista e compositor Joe Duplantier, seu irmão mais novo e baterista Mario Duplantier, Christian Andreu como segundo guitarrista, e Jean-Michel Labadie como baixista. A banda é conhecida por ter letras que tratam do meio ambiente, espiritualidade, vida e morte. Atualmente o Gojira é considerado uma das promessas do heavy metal ao lado de nomes como Trivium, Killswitch Engage, Lamb of God e Mastodon.\\nDesde sua formação o grupo lançou 6 álbuns de estúdio, 3 álbuns ao vivo e 9 videoclipes musicais."},{"page_url":"https://ja.wikipedia.org/wiki/%E4%BA%95%E4%B8%8A%E8%A7%92%E4%BA%94%E9%83%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3c/Kakugoro_Inoue.jpg","page_title":"井上角五郎","context_page_description":"井上 角五郎は、日本の実業家、政治家。東京府平民。\\n壬午事変後に朝鮮政府の顧問となり、朝鮮初の近代新聞「漢城旬報」を発刊。また初めて漢文・ハングル混合文体を実用化した「漢城周報」を創刊。甲申政変に深く関与し、金玉均・朴泳孝と関係を持った。第1回の帝国議会衆議院議員に当選以来連続当選14回、第47回まで14回代議士を務める。北海道炭礦鉄道社長、日本製鋼所設立者、会長、国民工業学院理事長、慶應義塾評議員等を歴任し、大正9年緑綬褒章下賜。京釜鉄道、南満州鉄道の設立にも関わった。号は閔妃の実甥・閔泳翊から贈られた琢園。"},{"page_url":"https://it.wikipedia.org/wiki/Corvo_(isola)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/LocalCorvo.PNG","page_title":"Corvo (isola)","context_page_description":"Corvo è una isola e comune portoghese di 430 abitanti situato nella Regione Autonoma delle Azzorre.\\nL'isola del Corvo è la più piccola delle isole Azzorre; situata nel settore occidentale dell'arcipelago, a nord dell'Isola di Flores e corrisponde territorialmente al comune di Corvo. Ai sensi dell'articolo 132, legge 2/2009 del 12 gennaio 2009 le funzioni della parrocchia sono assunte dei competenti uffici comunali"},{"page_url":"https://bs.wikipedia.org/wiki/Dendroflora_Bosne_i_Hercegovine","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/82/Acacia_dealbata-1.jpg","page_title":"Dendroflora Bosne i Hercegovine","context_page_description":"Ovaj spisak dendroflore Bosne i Hercegovine – skupa sa uvedenim vrstama i bosanskohercegovačkim endemima – je nepotpuna inventarizacija spermatofitnih biljnih vrsta koje se navode u raspoloživoj literaturi na bosanskom hrvatskom, srpskom i srpskohrvatskom jeziku. Nisu uključene kulturne i povremeno unošene.\\nNapomene:\\nU ovu inventarizaciju dendroflore uključene su i zeljaste višegodišnje biljke sa drvenastim stablikama i/ili izdancima i granama, uključujući i drvenaste lijane i loze.\\nZbog višekratnih promjena u biološkoj klasifikaciji i/ili taksonomskih rangova i naziva obuhvaćenih taksona, neki od njih se u priloženom spisku pojavljuju i po dva puta. To se posebno odnosi na one nazive binomne nomenklature koji su i danas u širokoj upotrebi.\\nNajčešće je promijenjeno ime roda i porodice, a ponekad i pripadajućih vrsta.\\nPonavljanje slika infraspecijskih taksona i u navodu vrste, prikazano je samo u sličajevima kada data podvrsta ili varijetet najprikladnije predstavljaju pripadajuću vrstu."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%A9%AC%E5%B2%9B%E6%A3%95%E4%BA%9A%E6%97%8F","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3e/Starr_060922-9129_Chrysalidocarpus_lutescens.jpg","page_title":"马岛棕亚族","context_page_description":"馬島棕亞族又名散尾葵亞族，是棕櫚目棕櫚科的一個演化支，包含4個屬。"},{"page_url":"https://en.wikipedia.org/wiki/Gustave_Deloye","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e9/Garibaldi_Niza.jpg","page_title":"Gustave Deloye","context_page_description":"Jean-Baptiste Gustave Deloye was a French sculptor and medallist in the Neo-Baroque style."},{"page_url":"https://uz.wikipedia.org/wiki/Chevrolet_Spark","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/20110402_chevrolet_spark_001.jpg","page_title":"Chevrolet Spark","context_page_description":"Chevolet Spark - Oʻzbekistonda ham ishlab chiqariladigan yengil avtomobil rusumi. UzDaewoo Avtokorxonasi, Andijon."},{"page_url":"https://lt.wikipedia.org/wiki/Huankavelika","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/04/385612788_94ecd970ef.jpg","page_title":"Huankavelika","context_page_description":"Huankavelika – miestas centrinėje Peru dalyje, Vakarų Kordiljeros rytinėje pašlaitėje, tarpukalnių slėnyje, daugiau nei 3600 m aukštyje, prie Iču upės; departamento centras. Yra geležinkelis į Huankajų, plentai į Huankajų, Ajakučą, Činča Altą. Žemės ūkio regiono prekybinis centras. Maisto, odos apdirbimo, tekstilės pramonė, gaminami vario dirbiniai. Veikia Huankavelikos valstybinis universitetas. Yra XVII–XVIII a. architektūros paminklų. Netoli miesto yra Santa Barbaros gyvsidabrio kasykla, sidabro telkiniai."},{"page_url":"https://fr.wikipedia.org/wiki/The_Doo-Wops_%26_Hooligans_Tour","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Let%27s_take_a_photo_to_Bruno_Mars.jpg","page_title":"The Doo-Wops & Hooligans Tour","context_page_description":"Bruno Mars Live: The Doo-Wops & Hooligans Tour est la première tournée internationale du chanteur, auteur et compositeur Bruno Mars. Elle débute le 16 novembre 2010 à San Francisco et se termine le 28 janvier 2012 au Brésil à Florianópolis. Elle passe par l'Amérique du Nord, l'Europe, l'Asie, l'Océanie, et l'Amérique du Sud ; en France, elle inclut des prestations à La Cigale, à l'Olympia, au Zénith de Paris et à Nantes. Elle promeut son premier album Doo-Wops & Hooligans sorti le 4 octobre 2010."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%88_%D8%B1%D9%88%D8%B3%D9%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Joe_Russo_2006.jpg","page_title":"جو روسو","context_page_description":"جو روسو ‏ هو ملحن أمريكي، ولد في 18 ديسمبر 1976 في بروكلين في الولايات المتحدة."},{"page_url":"https://en.wikipedia.org/wiki/List_of_Vietnamese_ingredients","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/58/Rice_Paddy_Herb.jpg","page_title":"List of Vietnamese ingredients","context_page_description":"This is a list of ingredients found in Vietnamese cuisine."},{"page_url":"https://pt.wikipedia.org/wiki/Ant%C3%B4nio_Carlos_Cintra_do_Amaral","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b3/Cintradoamaral.jpg","page_title":"Antônio Carlos Cintra do Amaral","context_page_description":"Antônio Carlos Cintra do Amaral foi um jurista, parecerista, doutrinador, professor e escritor brasileiro."},{"page_url":"https://ms.wikipedia.org/wiki/Fakulti_Pertanian,_Universiti_Putra_Malaysia","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/Fakulti_Pertanian_Agrobio.JPG","page_title":"Fakulti Pertanian, Universiti Putra Malaysia","context_page_description":"Fakulti Pertanian adalah satu daripada tiga fakulti pengasas dalam penubuhan Universiti Pertanian Malaysia pada 1971. Sejarahnya bermula dengan tujuh jabatan di bawahnya, kebanyakan jabatan dalam fakulti ini kemudiannya dibangunkan menjadi beberapa fakulti lain."},{"page_url":"https://fr.wikipedia.org/wiki/Mausol%C3%A9e_vert","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/Ye%C5%9Fil_T%C3%BCrbe_-_02.jpg","page_title":"Mausolée vert","context_page_description":"Le Mausolée vert est le mausolée du cinquième Sultan ottoman,\\nMehmed Ier, à Bursa, en Turquie. Il fut érigé par le fils et successeur de Mehmed,\\nMourad II, peu de temps après son décès en 1421. L'architecte, Hacı Ivaz Pacha conçut les plans de la\\ntombe ainsi que ceux de la Mosquée verte, qui lui fait face."},{"page_url":"https://it.wikipedia.org/wiki/Georges_Passerieu","image_url":"http://upload.wikimedia.org/wikipedia/commons/1/1a/Passerieu.jpg","page_title":"Georges Passerieu","context_page_description":"Georges Passerieu è stato un ciclista su strada e pistard francese.\\nProfessionista dal 1906 al 1914, colse due podi al Tour de France, corsa in cui vinse anche sette tappe, e si aggiudicò nel 1907 sia la Parigi-Roubaix che la Parigi-Tours."},{"page_url":"https://en.wikipedia.org/wiki/The_Historical_Museum_of_Northern_Jutland","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b8/Havn%C3%B8_vindm%C3%B8lle.jpg","page_title":"The Historical Museum of Northern Jutland","context_page_description":"The Historical Museum of Northern Jutland is the product of the fusion of Aalborg Historical Museum, The Museum Society for Hals, The Museum Society of Hadsund, The South Himmerland Museum, and others, in 2004. The museum system in this umbrella organization is administered by a 12-member committee, with members from the participating organizations. The administrative headquarters is in Algade 48, Aalborg.\\nThe Historical Museum of Northern Jutland works with research, collection, documentation, conservation, and promotion of local and cultural history in Aalborg, Mariagerfjord, Rebild, and Jammerbugt Municipality.\\nThe museum's mission is: \\"Attentive history\\". According to their website, a more elaborate description reads:\\nWith a firm professional anchor and an unassuming appeal, The Historical Museum of Northern Jutland should in its approach create and maintain the foundation for the understanding of history. Within a horizon of 5 to 10 years, the museum should be among the 5 best museums in Denmark, gauged by the five pillars of all museums: collecting, conservation, registering, research and educational outreach."},{"page_url":"https://sv.wikipedia.org/wiki/Primula_bulleyana","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/85/Primula_bulleyana_1.jpg","page_title":"Primula bulleyana","context_page_description":"Primula bulleyana är en viveväxtart. Primula bulleyana ingår i släktet vivor, och familjen viveväxter."},{"page_url":"https://pl.wikipedia.org/wiki/%C5%9Al%C4%99%C5%BCa%C5%84ski_Park_Krajobrazowy","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/40/2005-08-07_Bielawa02.JPG","page_title":"Ślężański Park Krajobrazowy","context_page_description":"Ślężański Park Krajobrazowy – park krajobrazowy znajdujący się na terenie województwa dolnośląskiego. Obejmuje Masyw Góry Ślęży, Masyw Góry Raduni, pasma Wzgórz Oleszeńskich i Wzgórz Kiełczyńskich oraz Jańską Górę. Znajduje się na terenie gmin: Dzierżoniów, Jordanów, Łagiewniki, Sobótka, Marcinowice, Świdnica. Utworzony został w celu ochrony i zachowania środowiska przyrodniczo-krajobrazowego Masywu Ślęży, jego wartości kulturowych i historycznych. W Parku lasy zajmują ok. 5500 ha, w otulinie przeważają pola uprawne. Lasy w obrębie Ślężańskiego PK należą do Nadleśnictwa Miękinia. Udział wód to zaledwie 20 ha.\\nPowierzchnia: 15 640 ha\\nUtworzony: 8 czerwca 1988 r."},{"page_url":"https://zh.wikipedia.org/wiki/%E5%A4%A7%E5%8D%97%E6%B1%BD%E8%BB%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5e/YUTONG_-_ZK6128GH_-_KKA-0185.jpg","page_title":"大南汽車","context_page_description":"大南汽車股份有限公司，簡稱：大南汽車，主要經營臺北市聯營公車與新北市公車，1969年8月由裕隆汽車集團集資成立，目前與欣欣客運同屬行政院國軍退除役官兵輔導委員會管理的客運公司，大南汽車於2009年初取得ISO 9001國際認證，是繼首都客運後第二間取得該認證的臺北公車業者。2013年6月參加臺北市政府舉辦之第6屆金省能獎比賽，獲選交通運輸組最優公司。主要服務據點為臺北市北部為主，新北市板橋區、土城區及新店區為輔。\\n大南汽車在新北市的營運範圍曾擴展到中和、永和地區，但皆因路線規劃不當而撤出，目前則另外往新北市淡水區及新店區、臺北市內湖區及南港區發展。"},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A4%D0%B0%D1%83-1","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d5/Fieseler_Fi103_debajo_de_un_Heinkel_111.jpg","page_title":"Фау-1","context_page_description":"«Фау-1», V-1 — літак-снаряд, що знаходився на озброєнні армії Німеччини в кінці Другої світової війни виробництва компанії Fieseler. Ця назва походить від нім. Vergeltungswaffe-1.\\nФау-1 була оснащена пульсуючим повітряно-реактивним двигуном і несла бойову частину масою 750—1000 кг. Дальність польоту — 250 км, Пізніше була доведена до 400 км."},{"page_url":"https://te.wikipedia.org/wiki/%E0%B0%9C%E0%B0%9F%E0%B1%8D%E0%B0%B0%E0%B1%8B%E0%B0%AB%E0%B0%BE","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/46/Bellyache_Bush_%28Jatropha_gossipifolia%29_in_Hyderabad%2C_AP_W_IMG_9219.jpg","page_title":"జట్రోఫా","context_page_description":"జట్రోఫా పుష్పించే మొక్కలలో యుఫోర్బియేసి కుటుంబానికి చెందిన ఒక ప్రజాతి. ఇందులో సుమారు 175 జాతుల మొక్కలు ఉన్నాయి. జట్రోఫా పదం గ్రీకు పదాలైన ἰατρός, అనగా \\"physician,\\", τροφή, అనగా \\"nutrition,\\" మూలంగా వచ్చింది. వీనిలో అతి విషపూరితమైన పదార్దాలు ఉంటాయి."},{"page_url":"https://it.wikipedia.org/wiki/Valiants_Memorial","image_url":"http://upload.wikimedia.org/wikipedia/commons/b/b2/John_Wallace_Thomas.jpg","page_title":"Valiants Memorial","context_page_description":"Il Valiants Memorial, o Monument aux Valeureux in francese, è un monumento militare situato ad Ottawa, capitale del Canada, per commemorare quattordici figure della storia militare del paese.\\nConsiste in nove busti e cinque statue, tutte a grandezza naturale, scolpite da Marlene Hilton Moore e John McEwen. Si trova attorno a Sappers Staircase, un passaggio sotterraneo nell'angolo nordorientale di Confederation Square; è adiacente al National War Memorial. Il muro del passaggio è decorata con una citazione dall'Eneide di Virgilio: Nulla dies umquam memori vos eximet aevo, ovvero \\"Nessun giorno potrà cancellarvi dalla memoria del tempo\\". Il monumento è stato inaugurato dal governatore generale Michaëlle Jean il 5 novembre 2006."},{"page_url":"https://zh.wikipedia.org/wiki/%E6%84%8F%E5%A4%A7%E5%88%A9%E7%8E%8B%E5%9B%BD_(%E4%B8%AD%E4%B8%96%E7%BA%AA)","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ab/Carolingian_empire_843.svg","page_title":"意大利王国 (中世纪)","context_page_description":"意大利王国是位于意大利半岛北部的政治和地理实体，继承了于774年被查理曼大帝攻占后的伦巴底王国。\\n意大利王国见证了其统治者法兰克王国的加洛林王朝因封建主义的发展而解体，萨拉森人和马扎尔人的入侵，以及由于控制王国可以使得其控制者得以被教皇加冕，而围绕王权引发一系列斗争。从950年起德国君主将意大利王国纳入自己领地，意味着其成为神圣罗马帝国的一部分。"},{"page_url":"https://sv.wikipedia.org/wiki/Sala%C5%A1_(ort_i_Tjeckien)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Sala%C5%A1_%28UH%29%2C_celkov%C3%BD_pohled.jpg","page_title":"Salaš (ort i Tjeckien)","context_page_description":"Salaš är en ort i Tjeckien. Den ligger i kommunen Okres Uherské Hradiště och länet Zlín, i den östra delen av landet, 240 km sydost om huvudstaden Prag. Salaš ligger 267 meter över havet och antalet invånare är 367.\\nTerrängen runt Salaš är huvudsakligen kuperad, men åt sydost är den platt. Den högsta punkten i närheten är 441 meter över havet, 1,0 km sydväst om Salaš. Runt Salaš är det ganska tätbefolkat, med 179 invånare per kvadratkilometer. Närmaste större samhälle är Kroměříž, 17,8 km norr om Salaš. Trakten runt Salaš består till största delen av jordbruksmark.\\nTrakten ingår i den hemiboreala klimatzonen. Årsmedeltemperaturen i trakten är 9 °C. Den varmaste månaden är juli, då medeltemperaturen är 22 °C, och den kallaste är januari, med -6 °C. Genomsnittlig årsnederbörd är 904 millimeter. Den regnigaste månaden är juni, med i genomsnitt 118 mm nederbörd, och den torraste är mars, med 41 mm nederbörd."},{"page_url":"https://lt.wikipedia.org/wiki/Palanga","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/c8/Palngos_tiltas.JPG","page_title":"Palanga","context_page_description":"Palanga – miestas Žemaitijoje, prie Baltijos jūros, 25 km į šiaurę nuo Klaipėdos, klimatinis ir balneologinis kurortas. Administraciškai priklauso Palangos miesto savivaldybei, kuri apima Palangos, Šventosios ir Būtingės gyvenvietes. Yra 3 pašto skyriai."},{"page_url":"https://en.wikipedia.org/wiki/Stephen_Fife","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d6/Stephen_Fife_on_April_21%2C_2013.jpg","page_title":"Stephen Fife","context_page_description":"Stephen J. Fife is an American former professional baseball pitcher. He played for the Major League Baseball for the Los Angeles Dodgers and Saitama Seibu Lions of Nippon Professional Baseball."},{"page_url":"https://ro.wikipedia.org/wiki/Burt_Reynolds","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c0/Burt_Reynolds_1991_portrait_crop.jpg","page_title":"Burt Reynolds","context_page_description":"Burton Leon \\"Burt\\" Reynolds, Jr. a fost un actor și regizor american, cunoscut pentru rolurile Bo 'Bandit' Darville în Smokey și Banditul, Lewis Medlock în Eliberarea, Bobby \\"Gator\\" McCluskey în Fulger alb și următorul film din serie Gator, Paul \\"Wrecking\\" Crewe în The Longest Yard, Charlie B. Barkin în Toți câinii merg în rai, și în rolul regizorului de filme pentru adulți Jack Horner din Boogie Nights pentru care a câștigat Premiul Globul de Aur pentru cel mai bun actor în rol secundar și a fost nominalizat la Premiul Oscar pentru cel mai bun actor în rol secundar.\\nBurt Reynolds a murit pe 6 septembrie, dimineața, în urma unui atac de cord. În ultimii ani, actorul se luptase cu mai multe probleme de sănătate. În 2013, el a fost internat la terapie intensivă pentru tratamentul simptomelor gripei."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E9%98%BF%E6%99%AE256","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/13/Crash_in_progress_Arp_256.jpg","page_title":"阿普256","context_page_description":"阿普256是一對交互作用中的螺旋星系，在天球上位於鯨魚座。該系統的成員星系分別稱為阿普256南和阿普256北"},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9E%D0%BB%D0%BB%D1%81%D0%BE%D0%BD,_%D0%A2%D0%BE%D0%BC%D0%B0%D1%81","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/PassionExtreme4.jpg","page_title":"Оллсон, Томас","context_page_description":"Томас Кеннет Олссон — шведский авантюрист, альпинист и экстремальный лыжник."},{"page_url":"https://en.wikipedia.org/wiki/Hurricane_Erick_(2013)","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/39/Hurricane_Erick_2013-07-06_2030Z.jpg","page_title":"Hurricane Erick (2013)","context_page_description":"Hurricane Erick brought minor impacts to the western coastline of Mexico in July 2013, and was the last of a succession of four Category 1 hurricanes within 30 days. The fifth tropical cyclone and named storm, as well as the fourth hurricane of the annual hurricane season, Erick originated from a tropical wave that moved off the western coast of Africa on June 18. The wave tracked swiftly westward with little development, emerging into the eastern Pacific on July 1. As a result of favorable environmental conditions, the wave developed into a tropical depression on July 4, and further into Tropical Storm Erick at 0000 UTC on July 5. Steered generally west-northwest, Erick intensified into a Category 1 hurricane and reached its peak intensity with winds of 80 mph on July 6. Its proximity to land and track over increasingly cooler waters caused the storm to deteriorate into a tropical storm the following day, though it remained at such intensity until degenerating into a remnant low early on July 9. The remnant circulation dissipated a few hours later, southwest of Baja California Sur."},{"page_url":"https://no.wikipedia.org/wiki/Norgesveldet","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/Sweden_1250_cropped.png","page_title":"Norgesveldet","context_page_description":"Norgesveldet er en betegnelse som kom i bruk på 1800-tallet i forbindelse med nasjonalromantiske forestillinger om at Norge hadde en fortid som stormakt, og var en betegnelse på de besittelsene som var underlagt den norske kongen i høymiddelalderen, etter at det hadde blitt landefred på fastlandet etter borgerkrigene, altså etter 1227.\\nDa Norgesveldet var på sitt største, omfattet det øyene i Vesterhavet hvor folk fra Norge hadde slått seg ned i landnåmstiden, i tillegg til dagens Norge og landskap i dagens Sverige. Norgesveldet var oftest et løst sammenbundet rike av moderlandet og de oversjøiske besittelsene som i samtiden ble benevnt som skattland, og ikke oppfattet som en del av det norske riket. I middelalderen ble skattlandene mer en betegnelse på norske biland enn egentlige deler av et norsk statsterritorium. Den verdslige makten var på sitt sterkeste mot slutten av kong Håkon Håkonssons regjeringstid. Et viktig element i hele den perioden man senere omtalte som «Norgesveldet», var den kirkelige overhøyheten til erkebispesetet i Nidaros fra 1152/3. Det er ikke sikre kilder for når Jemtland ble lagt under erkebiskopen i Uppsala."},{"page_url":"https://nl.wikipedia.org/wiki/Fort_de_la_Chartreuse","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Chartreuse_Paart_3._Genie.jpg","page_title":"Fort de la Chartreuse","context_page_description":"Fort La Chartreuse is een fort opgericht voor de verdediging van de Belgische stad Luik. Het werd in 1817 door de Nederlanders gebouwd op de Mont Cornillon en kwam na de Belgische Revolutie in 1830 in handen van de Belgen."},{"page_url":"https://bg.wikipedia.org/wiki/%D0%93%D0%B8%D0%B1%D1%81%D1%8A%D0%BD_%D0%9A%D0%BE%D1%80%D0%BF%D0%BE%D1%80%D0%B5%D0%B9%D1%88%D1%8A%D0%BD","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/26/Gibsonshowcase.jpg","page_title":"Гибсън Корпорейшън","context_page_description":"Гибсън Корпорейшън е американска фирма, специализирана в производството на акустични и електрически китари и други струнни музикални инструменти.\\nКомпанията е основана през 1902 г. от Орвил Гибсън. Централният офис е базиран в град Нашвил, щат Тенеси. Освен под собственото си име фирмата произвежда китари и с марките: „Епифон“, „Крамър“, „Вали Артс“, „Тобиас“, „Стейнбъргър“ и „Каламазо“. В добавка към китарите компанията разширява обхвата на производството и с клавишни инструменти под марката „Болдуин пиано къмпани“, барабани под марката „Слингърланд“, както и най-различни аксесоари за музикалната индустрия.\\nВсички китари с марката „Гибсън“ са произведени в САЩ."},{"page_url":"https://fr.wikipedia.org/wiki/Sovata","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Sovata%2C_Transylvanie.jpg","page_title":"Sovata","context_page_description":"Sovata ou Szováta en hongrois est une ville roumaine du județ de Mureș, dans la région historique de Transylvanie et dans la région de développement du Centre. Sovata est une station thermale et de villégiature très renommée qui attire de nombreux touristes grâce à ses lacs salés."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%81%8A%E8%B5%B0%E3%82%8A%E3%81%95%E3%82%93","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bb/%E3%81%8A%E8%B5%B0%E3%82%8A%E3%81%95%E3%82%93.JPG","page_title":"お走りさん","context_page_description":"お走りさんは毎年4月中旬に兵庫県養父市で行われる養父神社の年中行事。約1800年前から伝わる無形文化財である。お走り祭り。愛称は、お走りさん。"},{"page_url":"https://ja.wikipedia.org/wiki/%E9%BB%94%E8%A5%BF%E5%8D%97%E3%83%97%E3%82%A4%E6%97%8F%E3%83%9F%E3%83%A3%E3%82%AA%E6%97%8F%E8%87%AA%E6%B2%BB%E5%B7%9E","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Wan_Feng_Lin_River.jpg","page_title":"黔西南プイ族ミャオ族自治州","context_page_description":"黔西南プイ族ミャオ族自治州は中華人民共和国貴州省西南部に位置する少数民族自治州。"},{"page_url":"https://it.wikipedia.org/wiki/Ordine_pro_merito_melitensi","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/ba/Order_pro_merito_Melitensi_-_Grand_Cross_-_Badge_01.jpg","page_title":"Ordine pro merito melitensi","context_page_description":"L'Ordine pro merito melitensi è un ordine cavalleresco istituito nel 1920 per ricompensare benemerenze verso il Sovrano Militare Ordine di Malta, riservato principalmente ai non membri dell'Ordine.\\nLa concessione di questa onorificenza avviene indipendentemente dalla religione professata. I decorati dell'Ordine pro merito melitensi non diventano membri del Sovrano Militare Ordine di Malta e per questo motivo è loro proibito utilizzare il titolo di \\"cavaliere dell'Ordine di Malta\\". Tuttavia, come ogni distinzione onorifica, è possibile di utilizzare il semplice titolo di \\"cavaliere\\".\\nL'onorificenza può essere concessa a singoli cittadini, a comunità o a reparti militari. È suddivisa in due classi cui si affianca l'Ordine pro piis meritis melitensi, riservato agli ecclesiastici."},{"page_url":"https://es.wikipedia.org/wiki/Becerril_del_Carpio","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/92/Iglesia_de_San_Pedro_001_Barrio_de_San_Pedro_%28Becerril_del_Carpio%29.JPG","page_title":"Becerril del Carpio","context_page_description":"Becerril del Carpio es una entidad singular de población del municipio español de Alar del Rey, en la provincia de Palencia."},{"page_url":"https://sk.wikipedia.org/wiki/%C4%8Cadca","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Cadca.jpg","page_title":"Čadca","context_page_description":"Čadca, je okresné mesto v Žilinskom kraji."},{"page_url":"https://an.wikipedia.org/wiki/Prencipato_d%27Asturias","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/Esla55.JPG","page_title":"Prencipato d'Asturias","context_page_description":"O Prencipato d'Asturias ye una comunidat autonoma espanyola uniprovincial. Tien a forma d'un prencipato a on o Prencipe d'Asturias ye o hereu d'a Chefatura d'o Estato en o Reino d'Espanya.\\nO suyo territorio ye de bells diez mil kilometros cuadratos, y bi ha una población, en retacule, que blinca licherament d'o millón de habitants. O idioma oficial y d'emplego mayoritario ye o castellán, pero alto u baixo a tercera parti d'os suyos ciudadans charran tamién asturiano u eonaviego, bien por estar bilingües, bien por tener-la como primera luenga.\\nA suya capital ye a ciudat d'Oviedo, y Xixón ye a población más habitata."},{"page_url":"https://fr.wikipedia.org/wiki/Francolin_%C3%A0_double_%C3%A9peron","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Francolinus_bicalcaratus_%28cropped%29.jpg","page_title":"Francolin à double éperon","context_page_description":"Le Francolin à double éperon est une espèce d'oiseaux de la famille des Phasianidae."},{"page_url":"https://fr.wikipedia.org/wiki/Jean-Marie_Pfaff","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Jean-Marie_Pfaff_at_Runa_Ralley_2007_cropped.jpg","page_title":"Jean-Marie Pfaff","context_page_description":"Jean-Marie Pfaff, né le 4 décembre 1953 à Lebbeke, est un gardien de but international et entraîneur de football belge."},{"page_url":"https://it.wikipedia.org/wiki/Volstroff","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c4/Eglise_Volstroff.jpg","page_title":"Volstroff","context_page_description":"Volstroff è un comune francese di 1.466 abitanti situato nel dipartimento della Mosella nella regione del Grand Est."},{"page_url":"https://lmo.wikipedia.org/wiki/Montecchia_di_Crosara","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/33/Montecchiacalvarina.jpg","page_title":"Montecchia di Crosara","context_page_description":"Montecchia di Crosara l’è ‘n cümü italià, de la regiù del Vèneto, en Pruvìncia de Verùna.\\nEl g’ha presapóch 4.189 abitàncc e ‘l g’ha ‘na superfìce de 21,1 km², per ‘na densità de 199 ab./km².\\nL' se tröa a 40 chilòmeter de Verùna e l'è in de la basa Al Alpone; el cunfìna coi cümü de Cazzano di Tramigna, Gambellara (VI), Monteforte d'Alpone, Roncà, San Giovanni Ilarione, Soave."},{"page_url":"https://fr.wikipedia.org/wiki/Xian_autonome_yi_de_Ninglang","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/0f/%E6%B0%B8%E5%AE%81%E4%B9%A1-%E6%A1%82%E7%A9%BF%E8%B6%8A_-_panoramio_%285%29.jpg","page_title":"Xian autonome yi de Ninglang","context_page_description":"Le xian autonome yi de Ninglang est un district administratif de la province du Yunnan en Chine. Il est placé sous la juridiction de la ville-préfecture de Lijiang."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_2006","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e0/Richard_Bright_%28actor%29.jpg","page_title":"Lijst van personen overleden in 2006","context_page_description":"Dit is een lijst van personen die zijn overleden in 2006."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Yagodina_(Smolyan_Chiu)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5a/Yagodina_Village_Center.jpg","page_title":"Yagodina (Smolyan Chiu)","context_page_description":"Yagodina sī chi̍t ê tī Bulgaria Kiōng-hô-kok Smolyan Chiu Borino Koān ê chng-thâu. Chit-ê chng-thâu ū 431 ê lâng tòa."},{"page_url":"https://id.wikipedia.org/wiki/Hardcore_punk","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/Youth_of_Today_at_SO36_%282010%29.jpg","page_title":"Hardcore punk","context_page_description":"Hardcore punk adalah genre punk rock serta subbudaya yang lahir pada akhir dekade 1970-an. Hardcore punk lebih cepat, lebih keras, dan lebih agresif daripada bentuk punk rock lainnya. Asal usulnya dapat dilacak hingga pergerakan punk terdahulu di San Francisco dan California Selatan yang muncul sebagai tanggapan terhadap kebudayaan hippie yang masih dominan kala itu. Hardcore punk juga terinspirasi dari punk rock New York dan proto-punk. Suara punk New York lebih keras daripada saudaranya di San Francisco, menampilkan ekspresi anti-seni dari kemarahan, energi, dan humor subversif yang jantan. Hardcore punk juga menolak komersialisme, kemajuan industri musik, serta \\"apa pun yang menyerupai rock arus utama\\" dan sering membahas topik sosial dan politik dengan \\"lirik konfrontatif dan bermuatan politis.\\"\\nHardcore punk juga menjadi penyumbang dari gerakan bawah tanah Amerika Serikat pada awal 1980-an, khususnya di Washington DC, New York, New Jersey, Philadelphia, dan Boston—serta di Australia, Kanada, dan Britania Raya. Musik ini juga menelurkan gerakan straight edge dan subgerakan terkait, hardliner dan youth crew."},{"page_url":"https://pl.wikipedia.org/wiki/Przewodnicz%C4%85cy_Komisji_Europejskiej","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4b/Ioannes_Claudius_Juncker_die_7_Martis_2014.jpg","page_title":"Przewodniczący Komisji Europejskiej","context_page_description":"Przewodniczący Komisji Europejskiej – stanowisko w Unii Europejskiej. Nominuje on komisarzy spośród członków Komisji, może też w razie potrzeby zmieniać ich stanowiska, bądź ich zwalniać. Determinuje porządek obrad KE, tylko on jest również upoważniony do zgłoszenia nowego prawa wspólnotowego.\\nStanowisko to powstało w roku 1957 na mocy traktatów rzymskich. Obecne prawo przewiduje pięcioletnią kadencję z możliwością jednorazowego powtórzenia. Z dniem 1 grudnia 2019 skończył kadencję Jean-Claude Juncker, członek Europejskiej Partii Ludowej i były premier Luksemburga. 1 grudnia 2019 rozpoczęła się kadencja aktualnej przewodniczącej - Ursuli von der Leyen, członkini Europejskiej Partii Ludowej i minister w rządzie Angeli Merkel w latach 2005-2019.\\nJak dotąd przewodniczącymi byli: trzej Luksemburczyków, dwóch Włochów, dwóch Francuzów, dwójka Niemców, Belg, Holender, Brytyjczyk, Hiszpan i Portugalczyk."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A0%D1%8E%D0%BB%D1%8C%D1%86%D0%B3%D0%B0%D0%B9%D0%BC","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/59/Ruelzheim_Ansicht_Mittlere_Ortsstra%C3%9Fe.JPG","page_title":"Рюльцгайм","context_page_description":"Рюльцгайм — громада в Німеччині, розташована в землі Рейнланд-Пфальц. Входить до складу району Гермерсгайм. Центр об'єднання громад Рюльцгайм.\\nПлоща — 16,66 км². Населення становить 7833 ос."},{"page_url":"https://id.wikipedia.org/wiki/Kesultanan_Mughal","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Mughal_Empire_%28orthographic_projection%29.svg","page_title":"Kesultanan Mughal","context_page_description":"Kesultanan Mughal adalah sebuah negara yang pada masa jayanya memerintah Afganistan, Balochistan, dan sebagian besar anak benua India antara 1526 dan 1857. Kata mughal adalah versi Indo-Aryan dari Mongol, karena leluhurnya merupakan Dinasti Timuriyah yang berasal dari Asia Tengah. Agama resmi rakyat Mughal adalah Islam, dengan mayoritas penduduknya beragama Hindu. Selama sekitar dua abad, kesultanan membentang dari pinggiran luar lembah Indus di barat, Afghanistan utara di barat laut, Kashmir di utara, hingga dataran tinggi Assam, Bangladesh masa kini di timur, dan dataran tinggi Dekkan di India Selatan. Pada puncak kekuasaan terbesarnya, merupakan salah satu monarki terbesar dalam sejarah Asia Selatan. Dan menyatukan kembali hampir seluruh wilayah di anak benua India setelah Kekaisaran Maurya, 16 abad yang lalu. Nama lain untuk dalam bentuk kekaisaran adalah Hindustan, seperti yang tampak pada penggunaan gelar penguasa Badhishah-i-Hindustani."},{"page_url":"https://de.wikipedia.org/wiki/Tord%C3%B3mar","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/VistaDeTord%C3%B3mar-rectangular.jpg","page_title":"Tordómar","context_page_description":"Tordómar ist eine nordspanische Kleinstadt und eine Gemeinde mit insgesamt 346 Einwohnern im Westen der Provinz Burgos in der Autonomen Gemeinschaft Kastilien-León."},{"page_url":"https://ca.wikipedia.org/wiki/Mandolina_(estri)","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Cooking_Mandolin_with_Carrot.jpg","page_title":"Mandolina (estri)","context_page_description":"La mandolina és un estri de cuina emprat per llescar verdures, formatge, pernil, etcètera fàcilment a rodanxes uniformes de gruix. Hi ha diferents models capaços de tallar fina juliana o fins i tot primes llesques de ceba, nap, api, etcètera. Se li dóna aquest nom perquè el moviment del canell d'un usuari especialitzat recorda com es mou el canell en un intèrpret de mandolina."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%AC%E3%83%8D","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/77/Bornholm_Denmark_-_Roenne_railway_station_model_in_Museum_of_Bornholm.jpg","page_title":"レネ","context_page_description":"レネは、デンマークのボーンホルム島にある町。人口は1万3730人。以前は町だけでひとつの基礎自治体をなしたが、いまはボーンホルム市の行政の中心である。\\n天然の良港とバルト海における戦略的位置のため、ニシン漁で発展するかたわら、たえずドイツとスウェーデンの影響にさらされてきた。丸石の石畳や外面真壁づくりの家々、数々の博物館は今日、デンマーク本土のみならずドイツ、スウェーデン、ポーランドから多くの観光客を惹きつけている。"},{"page_url":"https://tr.wikipedia.org/wiki/Gemikaya_Petroglifleri","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b1/Gemigaya_1.JPG","page_title":"Gemikaya Petroglifleri","context_page_description":"Gemikaya kaya oymaları - Azerbaycan'ın Ermenistan sınırına yakın bir konumda, Ordubad Rayonu topraklarındaki Nesirvaz Köyü sınırları içinde yer alan ve Bronz ve Erken Demir Çağları dahil olmak üzere M.Ö. 4. bin yıllara tarihlenen bir dizi kaya resmidir.\\nGemikaya, Küçük Kafkasya'nın zirvelerinden biri olan Gapyjiq Zirvesi'nin adıdır. Yerel bir efsaneye göre Tufan sırasında Nuh'un Gemisi buraya çekildi ve akıntı yüzünden bir taşa döndü. Bölgede geyik, keçi, boğa, köpek, yılan, kuş, fantastik varlıklar ve ayrıca insanlar, arabalar ve çeşitli sembollerden oluşan yaklaşık 1500 kaya resmi bulunmuştur. Dans eden insanların düzensizce çizilmiş görüntüleri de bulunan şekiller arasında yer almaktadır.\\nBu şekillerin birçoğu Garangush Platosu bölgesinde yer almaktadır ve kaynaklara yakın bir konumdadır. İnsanların görüntüleri şematik olarak oyulmuştur. Burada tek, çift ve grup görüntüleri de görülmektedir. At yanında yer alan bir inşa şekli eşsiz olanlardan biri olarak kabul edilir.\\nKeçilere dair şekiller yerli halkın sığır yetiştiriciliğinin yanı sıra keçi yetiştiriciliği yaptığını da göstermektedir. Kayalardan birinde çizici bir leopar tasvir etmiştir."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D0%BA%D1%80%D1%83%D0%B3_%D0%91%D0%B5%D1%80%D0%BA%D1%88%D0%B8%D1%80_(%D0%9C%D0%B0%D1%81%D0%B0%D1%87%D1%83%D1%81%D0%B5%D1%82%D1%81)","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Map_of_Massachusetts_highlighting_Berkshire_County.svg","page_title":"Округ Беркшир (Масачусетс)","context_page_description":"Беркшир је округ у америчкој савезној држави Масачусетс."},{"page_url":"https://nl.wikipedia.org/wiki/Lijst_van_personen_overleden_in_2007/Voorstel","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2e/Tom_Poston_1965.JPG","page_title":"Lijst van personen overleden in 2007/Voorstel","context_page_description":"Dit is een lijst van personen die overleden zijn in 2007.\\nDe inhoud van deze pagina is gebaseerd op gegevens in Wikidata. Als er onvolkomenheden in deze lijst zitten, gelieve dan aldaar de gegevens aan te passen. Achter iedere persoon is hiervoor een link aanwezig met de aanduiding bewerken.\\nWijzigingen in Wikidata worden met enige regelmatigheid geautomatiseerd overgenomen naar deze pagina."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E7%B4%AB%E8%8A%B1%E9%85%A2%E6%BC%BF%E8%8D%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Oxalis_corymbosa_2.jpg","page_title":"紫花酢漿草","context_page_description":"紫花酢漿草為酢漿草科酢漿草屬下的一個種，又名紅花酢漿草、銅錘草。"},{"page_url":"https://sv.wikipedia.org/wiki/Am%C3%A9d%C3%A9e_Masclef","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/41/204_Calluna_vulgaris_Salisb.jpg","page_title":"Amédée Masclef","context_page_description":"Amédée Masclef, född 1858, död 1901, var en fransk botaniker och illustratör. Han har illustrerat bland annat Atlas des plantes de France, ett bokverk om Frankrikes flora, med 400 bilder."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%AA%E0%AE%95%E0%AF%81%E0%AE%A4%E0%AE%BE%E0%AE%B0%E0%AE%BF","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/ff/%E0%AE%AA%E0%AE%95%E0%AF%81%E0%AE%A4%E0%AE%BE%E0%AE%B0%E0%AE%BF_%E0%AE%85%E0%AE%B5%E0%AE%B0%E0%AF%8B%E0%AE%95%E0%AE%A3%E0%AE%AE%E0%AF%8D.svg","page_title":"பகுதாரி","context_page_description":"பகுதாரி இருபத்தெட்டாவது மேளகர்த்தா இராகமும், \\"பாண\\" என்று அழைக்கப்படும் ஐந்தாவது சக்கரத்தின் நான்காவது இராகமுமாகிய அரிகாம்போதியின் ஜன்னிய இராகம் ஆகும்."},{"page_url":"https://ga.wikipedia.org/wiki/Ciorracumalas","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ad/Cirrocumulus_20040830.jpg","page_title":"Ciorracumalas","context_page_description":"Scamaill ardleibhéil, níos airde ná timpeall 5,000 m, cumtha as criostail oighir. Bíonn siad bán, i leatháin nó cisil thanaí, ach le dealramh cruinn na scamaill cumalais. Cosúil leis an marcáil a bhíonn ar éisc, i gcaoi go dtugtar spéir ronnach orthu."},{"page_url":"https://nl.wikipedia.org/wiki/Centrale_Bibliotheek_Rotterdam","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/66/Chess_in_the_Library_-_panoramio.jpg","page_title":"Centrale Bibliotheek Rotterdam","context_page_description":"De Centrale Bibliotheek Rotterdam is de centrale openbare bibliotheek van Rotterdam, en hoofdkantoor van de Bibliotheek Rotterdam organisatie. Het is ontworpen door Jaap Bakema en Hans Boot, en in 1983 in gebruik genomen."},{"page_url":"https://nl.wikipedia.org/wiki/Donator","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Donator_prototype.JPG","page_title":"Donator","context_page_description":"Een donator is een overbrengingsmechanisme met een grote overbrengingsverhouding.\\nHet kenmerk van de donator is dat grote vertragingen mogelijk zijn. Vertragingen van 800 tot 20.000 zijn mogelijk. Omdat de vertragingoverbrenging zeer groot zijn is de aandrijfstijfheid van de donator zeer groot. De aandrijving is zeer compact, robuust, spelingsvrij en onderhoudsvrij."},{"page_url":"https://sv.wikipedia.org/wiki/%C5%BDelenice_(ort_i_Tjeckien,_%C3%9Ast%C3%AD_nad_Labem)","image_url":"http://upload.wikimedia.org/wikipedia/commons/5/5b/%C5%BDelenice_1.JPG","page_title":"Želenice (ort i Tjeckien, Ústí nad Labem)","context_page_description":"Želenice är en ort i Tjeckien. Den ligger i länet Ústí nad Labem, i den nordvästra delen av landet, 70 km nordväst om huvudstaden Prag. Želenice ligger 211 meter över havet och antalet invånare är 427.\\nTerrängen runt Želenice är kuperad österut, men västerut är den platt. Den högsta punkten i närheten är Zlatnik, 521 meter över havet, 1,5 km sydväst om Želenice. Runt Želenice är det ganska glesbefolkat, med 22 invånare per kvadratkilometer. Närmaste större samhälle är Most, 6,9 km väster om Želenice. Trakten runt Želenice består till största delen av jordbruksmark.\\nInlandsklimat råder i trakten. Årsmedeltemperaturen i trakten är 8 °C. Den varmaste månaden är juli, då medeltemperaturen är 20 °C, och den kallaste är januari, med -7 °C."},{"page_url":"https://tr.wikipedia.org/wiki/JaJuan_Johnson","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7a/Jajuan_Johnson.jpg","page_title":"JaJuan Johnson","context_page_description":"JaJuan Johnson, Amerikan basketbolcu. Uzun forvet pozisyonunda görev almaktadır."},{"page_url":"https://en.wikipedia.org/wiki/Ford_Model_T","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Ford_Model_T_1X7A7914.jpg","page_title":"Ford Model T","context_page_description":"The Ford Model T is an automobile produced by Ford Motor Company from October 1, 1908, to May 26, 1927. It is generally regarded as the first affordable automobile, which made car travel available to middle-class Americans. The relatively low price was partly the result of Ford's efficient fabrication, including assembly line production instead of individual hand crafting.\\nThe Ford Model T was named the most influential car of the 20th century in the 1999 Car of the Century competition, ahead of the BMC Mini, Citroën DS, and Volkswagen Type 1. Ford's Model T was successful not only because it provided inexpensive transportation on a massive scale, but also because the car signified innovation for the rising middle class and became a powerful symbol of the United States' age of modernization. With 16.5 million sold, it stood eighth on the top-ten list of most sold cars of all time, as of 2012."},{"page_url":"https://azb.wikipedia.org/wiki/%D8%B3%D8%A7%D9%86_%D8%AC%DB%8C%D9%88%D8%B3%D8%AA%D9%88_%DA%A9%D8%A7%D9%86%D8%A7%D9%88%D8%B2%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a8/SanGiustoCanavese_ChiesaParrocchiale_2008-06-18.jpg","page_title":"سان جیوستو کاناوزه","context_page_description":"سان جیوستو کاناوزه ایتالیا اؤلکه‌سینده بیر یاشاییش منطقه‌سی‌دیر. سوْن نۆفوس ساییمی اساسيندا ۳۳۸۳ نفر ایمیش. دنیز سوُلاری سَویه‌سیندن ۲۶۴ متر یۇکسک‏لیکده یئر آلیب. و پیمونت اوستانیندا یئرلشیب."},{"page_url":"https://en.wikipedia.org/wiki/James_Shaffer","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/49/James_Munky_Shaffer_of_Korn.jpg","page_title":"James Shaffer","context_page_description":"James Christian Shaffer, also known by his stage name \\"Munky\\", is an American musician best known as co-founder and guitarist of the nu metal band Korn.\\nShaffer set up the side-project band Fear and the Nervous System in 2008 and is also the founder of Emotional Syphon Recordings, who have signed acts like Monster in the Machine and Droid.\\nShaffer was ranked at No. 26 of Guitar World's 100 Greatest Heavy Metal Guitarists of All Time. Shaffer's work with Korn has resulted in over 35 million albums sold."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%9A%D1%80%D0%B8%D1%88%D1%82%D0%B0%D0%BB%D1%8C_%D0%9E%D0%BB%D0%B5%D0%B3_%D0%9E%D0%BB%D0%B5%D0%BA%D1%81%D0%B0%D0%BD%D0%B4%D1%80%D0%BE%D0%B2%D0%B8%D1%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f1/Oleh_Kryshtal.JPG","page_title":"Кришталь Олег Олександрович","context_page_description":"Олег Олександрович Кришталь — вчений у галузі біофізики, академік Національної академії наук України, доктор біологічних наук, професор, лауреат Державної премії СРСР і України в галузі науки і техніки, один із найчастіше цитованих українських вчених у світі."},{"page_url":"https://en.wikipedia.org/wiki/SOMUA_S35","image_url":"http://upload.wikimedia.org/wikipedia/commons/0/01/Char_1935_S_Somua_1.jpg","page_title":"SOMUA S35","context_page_description":"The SOMUA S35 was a French Cavalry tank of the Second World War. Built from 1936 until 1940 to equip the armoured divisions of the Cavalry, it was for its time a relatively agile medium-weight tank, superior in armour and armament to its French and foreign competitors, such as the contemporary versions of the German Panzerkampfwagen III. It was constructed from well-sloped, mainly cast, armour sections, that however made it expensive to produce and time-consuming to maintain.\\nDuring the German invasion of May 1940, the SOMUA S35 proved itself to be a tactically effective type, but this was negated by the French command's strategic mistakes in deploying the Cavalry armoured divisions. After the defeat of France in June 1940, limiting production to a number of about 440, captured SOMUA S35s were used by the Axis powers, some of them on the Eastern Front. A derived type, the SOMUA S40, with an improved suspension, lowered hull cast and welded turret armour, had been planned to replace the original version on the production lines in July 1940. Agreements to produce this improved type for the benefit of Vichy France, Germany and Japan, ultimately did not lead to any manufacture."},{"page_url":"https://eu.wikipedia.org/wiki/Tonga","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Tonga.jpg","page_title":"Tonga","context_page_description":"Tongako Erreinua Ozeano Barean dagoen uhartedia da. 169 uhartek osatzen dute eta horietatik 36tan jendea bizi da. 800 kilometroko luzera du iparralde-hegoalde norantzan. Samoaren hegoaldean dago, Australiaren ekialdean eta Zeelanda Berriaren iparmendebaldean. Tonga hitzak tongeraz hegoalde esan nahi du, Polinesia osoan hegoaldeen dauden uharteak baitira.\\nTonga Ozeaniako uharte-nazioen artean monarkia duen bakarra da eta mota horretako herrialdeen artean formalki kolonizatua izan ez zen herrialde bakarra ere bada.\\nUharteei beste izen batzuk ere eman izan zaizkie, adibidez Uharte Adiskidetsuak, Cook Kapitaina bertara 1773an iritsi zenean emandako ongietorri adiskidetsua dela eta. 'inasi jaiaren garaian iritsi zelako gertatzen da hori, uharteko nagusiari fruituak oparitzen zaizkiolako eta gonbidapena jaso zuelako. Willian Mariner idazlearen arabera nagusiek Cook erail nahi zuten baina ez zuten adostu hau nola egin."},{"page_url":"https://lv.wikipedia.org/wiki/Ri%C4%8Dards_K%C4%ABls","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/52/Richard_Kiel_2014_%28cropped%29.jpg","page_title":"Ričards Kīls","context_page_description":"Rīčards Dosons Kīls bija amerikāņu aktieris, plašāk pazīstams ar tērauda zobu Žokļa lomu Džeimsa Bonda filmās The Spy Who Loved Me un Moonraker. Ričards Kīls filmējies arī filmās The Longest Yard, Force 10 from Navarone, Pale Rider, Happy Gilmore un daudzās citās. Tāpat filmējies vairākos televīzijas seriālos. Ričards Kīls bija gara auguma aktieris."},{"page_url":"https://eo.wikipedia.org/wiki/Provinco_Erzincan","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9d/Erzincan_districts.png","page_title":"Provinco Erzincan","context_page_description":"Provinco Erzincan estas provinco en la regiono Orienta Anatolio en Turkio.\\n39°40′N 39°19′O\\nĜia ĉefurbo estas Erzincan, urbo kiu estis detruita kaj rekonstruita post tertremo de grandeco 7,9 en la 27-a de decembro 1939."},{"page_url":"https://fr.wikipedia.org/wiki/Ford_Ka","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/2007_Ford_KA_Studio_1.3_Rear.jpg","page_title":"Ford Ka","context_page_description":"La Ford Ka est un modèle d'automobile produit par le constructeur américain Ford. C'est une citadine trois portes, sortie en 1996. La première série était construite à Valence. La deuxième série était assemblée à Tychy en Pologne. La troisième version de ce modèle intitulée Ka+, dotée de portes arrière, est sortie en 2016 en Europe et est fabriquée à Sanand en Inde."},{"page_url":"https://fr.wikipedia.org/wiki/Julia_Osterloh","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/c6/Wiesbaden_Stadtfest_2013_VC_Wiesbaden_Julia_Osterloh.JPG","page_title":"Julia Osterloh","context_page_description":"Julia Osterloh est une ancienne joueuse allemande de volley-ball née le 9 avril 1986 à Darmstadt. Elle mesure 1,90 m et jouait au poste de centrale. Elle a mis un terme à sa carrière de volleyeuse professionnelle."},{"page_url":"https://de.wikipedia.org/wiki/Refuge_du_Go%C3%BBter","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f9/Le-Grand-Couloir.jpg","page_title":"Refuge du Goûter","context_page_description":"Das Refuge du Goûter ist eine Schutzhütte des Club Alpin Français in den Savoyer Alpen auf 3835 m Höhe an der Kante der Aiguille du Goûter. Es ist das höchstgelegene französische bewirtschaftete Schutzhaus und der höchstgelegene bewirtschaftete Stützpunkt zur Besteigung des Mont Blanc. Die viel besuchte Hütte ist zwischen Juni und Ende September bewirtschaftet. In der übrigen Zeit ist das Winterlager geöffnet. Der Normalweg auf den Mont Blanc führt von der Hütte in südöstlicher Richtung über den Dôme du Goûter und den Bossesgrat."},{"page_url":"https://ca.wikipedia.org/wiki/Al%C3%A7ament_de_Pasqua","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/23/Garden_of_Remembrance_Children_of_Lir.jpg","page_title":"Alçament de Pasqua","context_page_description":"L'Alçament de Pasqua, també conegut com a Revolta de Pasqua, fou una rebel·lió succeïda a Irlanda en el transcurs de la setmana de Pasqua del 1916. L'alçament va ser organitzat per part d'alguns republicans irlandesos amb l'objectiu d'acabar amb el domini britànic a l'illa i establir una república irlandesa, aprofitant que el Regne Unit es trobava immers en la Primera Guerra Mundial. Aquesta acció va ser l'alçament més important a Irlanda des de la rebel·lió de 1798.\\nOrganitzat per set membres del consell militar de la Germandat Republicana Irlandesa, l'alçament va començar el dilluns de Pasqua, és a dir, el 24 d'abril de 1916, i s'allargà durant sis dies. Membres dels Voluntaris Irlandesos, liderats pel mestre i activista per la llengua irlandesa Patrick Pearse, secundats pel petit Exèrcit Ciutadà Irlandès de James Connolly i 200 membres del Cumann na mBan, van ocupar diversos emplaçaments al centre de Dublín i van proclamar la República Irlandesa."},{"page_url":"https://cs.wikipedia.org/wiki/Farn%C3%AD_sbor_%C4%8Ceskobratrsk%C3%A9_c%C3%ADrkve_evangelick%C3%A9_ve_Volyni","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ec/Volyn%C4%9B%2C_Lidick%C3%A1%2C_modlitebna_%C4%8Ceskobratrsk%C3%A9_c%C3%ADrkve_evangelick%C3%A9_%283%29.jpg","page_title":"Farní sbor Českobratrské církve evangelické ve Volyni","context_page_description":"Farní sbor Českobratrské církve evangelické ve Volyni je sborem Českobratrské církve evangelické ve Volyni. Sbor spadá pod Jihočeský seniorát.\\nFarářkou sboru je od 1. srpna 2017 Daniela Zapletalová Grollová, kurátorem sboru je Petr Kučera."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%88%D9%8A%D9%86%D9%8A%D8%A8%D9%8A%D8%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e5/Winnipeg%2C_Manitoba_Location.png","page_title":"وينيبيغ","context_page_description":"وينيبيغ عاصمة وكبرى مدن مقاطعة مانيتوبا الكندية. وهي تقع بالقرب من المركز الطولي في أميركا الشمالية عند التقاء نهر اسينبوين و النهر الأحمر.\\nيسكن في وينيبيغ الكبرى حوالي 783 ألف نسمة مشكلين ستين بالمائة من سكان المقاطعة و من المقدر ان يصل عدد السكان إلى مليون نسمة بحلول سنة 2033. تعد مدينة وينيبيغ الكبرى سابع أكبر مدينة في كندا.\\nو اتت كلمة وينيبغ والتي تعني \\"المياه الموحلة\\" من لغة كري و هي أحد لغات السكان الاصليين لكندا.\\nالمنطقة كانت مركزاَ تجاريا للسكان الاصليين قبل قدوم المستوطنين الأوروبيين.\\nالتجار من المستوطنين الفرنسيين بنوا أول قلعة لهم في هذه المنطقة سنة 1738.\\nوقد تم التوصل في وقت لاحق مع المستوطنين في ما تعرف بتسوية سيليكرك سنة 1812, لتأسيس النواة التي بموجبها تأسست مدينة وينيبيغ لاحقا في سنة 1873 اي بعد ست سنوات من قيام كندا."},{"page_url":"https://hu.wikipedia.org/wiki/%C3%9At_(k%C3%B6zleked%C3%A9s)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Road_Yercaud.jpg","page_title":"Út (közlekedés)","context_page_description":"Út a forgalom lebonyolítására szolgáló, különböző tömegbírással rendelkező, lineáris, épített létesítmény. Lehet földút, amit gyalogos- vagy járműforgalom „taposott ki”, vagy burkolattal rendelkező műút, ami építőipari technológiával készült."},{"page_url":"https://fi.wikipedia.org/wiki/Sandy_Koufax","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d0/Sandy_Koufax.jpg","page_title":"Sandy Koufax","context_page_description":"Sanford ”Sandy” Koufax on yhdysvaltalainen baseballpelaaja. Hän aloitti Los Angeles Dodgersissa aikana, jolloin se vielä tunnettiin Brooklyn Dodgersina, ja pelasi siinä koko MLB-uransa.\\nKoufax syntyi New Yorkin Brooklynissä ja koki 3-vuotiaana vanhempiensa avioeron. Hän on juutalainen ja hallitsi high school -vuosinaan erinomaisesti sekä baseballin että koripallon, mutta baseball osoittautui lajiksi, jolla hän myöhemmin nousisi kansainväliseen kuuluisuuteen.\\nKoufax jätti uransa kesken, kun hänellä todettu niveltulehdus eteni pelaamisen estäväksi. Hänet valittiin Baseball Hall of Fameen vuonna 1972."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%9C%D0%B8%D0%BA%D0%BE%D0%BB%D0%B0%D0%B5%D0%B2%D1%89%D0%B8%D0%BD%D0%B0","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Kolas_Museum_in_Mikalayeushchyna.jpg","page_title":"Миколаевщина","context_page_description":"Миколаевщина или Николаевщина — деревня Столбцовского района Минской области Республики Беларусь. Административный центр Миколаевщинского сельского Совета.\\nРасположена на реке Неман.\\nНаселение — 652 жителя."},{"page_url":"https://ba.wikipedia.org/wiki/%D0%91%D0%B0%D1%88%D2%A1%D0%BE%D1%80%D1%82%D0%BE%D1%81%D1%82%D0%B0%D0%BD_%D0%A0%D0%B5%D1%81%D0%BF%D1%83%D0%B1%D0%BB%D0%B8%D0%BA%D0%B0%D2%BB%D1%8B%D0%BD%D1%8B%D2%A3_%D0%9C%D0%B8%D0%BB%D0%BB%D0%B8_%D0%BC%D1%83%D0%B7%D0%B5%D0%B9%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Bashkortostan_National_Museum_17.jpg","page_title":"Башҡортостан Республикаһының Милли музейы","context_page_description":"Башҡортостан Республикаһының Милли музейы — Башҡортостан Республикаһының 50-нән артыҡ крайҙы өйрәнеү музейҙарын берләштергән фәнни-тикшеренеү музейы. 1864 йылда губерна статистика комитеты ҡарары менән Өфө губернаһы музейы буларак ойошторола. Бөгөнгө көнгә тиклем был музей туғыҙ исем алмаштыра. 1993 йылдан алып Башҡортостан Республикаһының Милли музейы тип атала.\\nГуберна музейын ойоштороуҙа Н. А. Гурвич. А. Б. Иваницкий, В. И. Власов, К. А. Бух, А. А. Пекер ҡатнаша. Музей коллекцияларының төп өлөшөн урындағы сәнәғәт өлгөләре, нумизматика, энтомология, ботаника, зоология, тарих-археология экспонаттары тәшкил итә.\\nМузейҙы тулыландырыуҙа төрлө йылдарҙа 3. Ш. Шакиров, Г. В. Вахрушев, Ғ. Ф. Уйылданов, К. С. Никифорук, М. И. Касьянов, Д. Ғ. Йыһановтар күп көс һала.\\nХәҙерге көндә музей 50-нән артыҡ филиалдарҙы берләштерә. 1991 йылда музей яңы бинаға күсә.\\nБашҡортостан Республикаһының Милли музейында 100 меңдән ашыу экспонат менән танышырға мөмкин.\\nВ. Потаниндын хәйриә фондының музейҙарға ярҙам итеү программаларында ҡатнашҡаны юҡ."},{"page_url":"https://de.wikipedia.org/wiki/Liste_der_denkmalgesch%C3%BCtzten_Objekte_in_Graz/Gries","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Graz-Grand-Hotel-Wiesler-%281909%29.jpg","page_title":"Liste der denkmalgeschützten Objekte in Graz/Gries","context_page_description":"Die Liste der denkmalgeschützten Objekte in Graz/Gries enthält die 78 denkmalgeschützten, unbeweglichen Objekte des V. Grazer Stadtbezirks Gries."},{"page_url":"https://en.wikipedia.org/wiki/Grade_I_listed_buildings_in_Monmouthshire","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/11/Garrison_Tower_and_sundial%2C_Usk_Castle_-_geograph.org.uk_-_1425960.jpg","page_title":"Grade I listed buildings in Monmouthshire","context_page_description":"Monmouthshire is a county and principal area of Wales. It borders Torfaen and Newport to the west; Herefordshire and Gloucestershire to the east; and Powys to the north. The largest town is Abergavenny, with other large towns comprising Chepstow, Monmouth, and Usk. The present county was formed under the Local Government Act 1994, and comprises some sixty percent of the historic county. Between 1974 and 1996, the county was known by the ancient title of Gwent, recalling the medieval Welsh kingdom. The county is 850 km² in extent, with a population of 93,600.\\nIn the United Kingdom, the term \\"listed building\\" refers to a building or other structure officially designated as being of special architectural, historical or cultural significance. Listing was begun by a provision in the Town and Country Planning Act 1947. Once a building is listed, strict limitations are imposed on the modifications allowed to its structure or fittings. In Wales, authority for listing under the Planning Act 1990 lies with Cadw. Listed buildings are categorised into three grades:\\nGrade I – buildings of exceptional interest, only 2.5% of listed buildings in England and Wales are Grade I;"},{"page_url":"https://nl.wikipedia.org/wiki/Courchelettes","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Courchellettes_-_1615_-_Album_de_Cro%C3%BF_-_Adrien_de_Montigny.jpg","page_title":"Courchelettes","context_page_description":"Courchelettes is een gemeente in het Franse Noorderdepartement. De gemeente heeft een totale oppervlakte van 1,7 km² en telde 2851 inwoners op 1 januari 1999.\\nIn maart 2015 werden de kantons van Douai opgeheven en werd uit een deel van de gemeenten het kanton Douai gevormd, waar ook Courchelettes deel van ging uitmaken."},{"page_url":"https://vi.wikipedia.org/wiki/Rubus_ellipticus","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/CN_Aiselu.jpg","page_title":"Rubus ellipticus","context_page_description":"Rubus ellipticus là loài thực vật có hoa trong họ Hoa hồng. Loài này được Sm. miêu tả khoa học đầu tiên năm 1819."},{"page_url":"https://es.wikipedia.org/wiki/Hochdorf-Assenheim","image_url":"http://upload.wikimedia.org/wikipedia/commons/f/f7/Historisches_Rathaus_Assenheim.jpg","page_title":"Hochdorf-Assenheim","context_page_description":"Hochdorf-Assenheim es un municipio situado en el distrito de Rin-Palatinado, en el estado federado de Renania-Palatinado. Su población estimada a finales de 2016 era de 3195 habitantes.​\\nSe encuentra ubicado al sureste del estado, cerca de las ciudades de Ludwigshafen, Espira y Worms, y del río Rin, que lo separa de los estados de Hesse y Baden-Wurtemberg."},{"page_url":"https://es.wikipedia.org/wiki/%C3%9Cbersee","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4c/DEU_%C3%9Cbersee_COA.svg","page_title":"Übersee","context_page_description":"Übersee es un municipio situado en el distrito de Traunstein, en el estado federado de Baviera, con una población a finales de 2016 de unos 5026 habitantes.​\\nSe encuentra ubicado al sureste del estado, en la región de Alta Baviera, en la ladera de los Alpes cerca de la orilla del lago Chiem, y de la frontera con Austria."},{"page_url":"https://zh-min-nan.wikipedia.org/wiki/Leninsky_Ko%C4%81n_(Tula_Chiu)","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/16/Coat_of_Arms_of_Leninsky_rayon_%28Tula_oblast%29.png","page_title":"Leninsky Koān (Tula Chiu)","context_page_description":"Leninsky Koān sī Lō͘-se-a Tula Chiu ê chi̍t ê koān.\\nPang-bô͘:Tula Chiu"},{"page_url":"https://fr.wikipedia.org/wiki/Saint-P%C3%A9tersbourg","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/32/Pantserkruiser_Aurora.jpg","page_title":"Saint-Pétersbourg","context_page_description":"Saint-Pétersbourg /sɛ̃.pe.tɛʁs.buʁ/ est la deuxième plus grande ville de Russie par sa population, avec 5 281 579 habitants en 2017, après la capitale Moscou. Saint-Pétersbourg a le statut de ville d'importance fédérale. La ville est enclavée dans l'oblast de Léningrad, mais en est administrativement indépendante. Elle est située dans le Nord-Ouest du pays sur le delta de la Neva, au fond du golfe de Finlande, un espace maritime de la mer Baltique. Capitale de l'Empire russe de 1712 jusqu'en mars 1917, ainsi que de la Russie dirigée par les deux gouvernements provisoires entre mars et octobre 1917, Saint-Pétersbourg a conservé de cette époque un ensemble architectural unique. Deuxième port russe sur la mer Baltique après Primorsk, c'est aussi un centre majeur de l'industrie, de la recherche et de l'enseignement russe ainsi qu'un important centre culturel européen. Saint-Pétersbourg est la deuxième ville d'Europe par sa superficie et la cinquième par sa population.\\nSaint-Pétersbourg a été fondée en 1703 par le tsar Pierre le Grand dans une région disputée depuis longtemps au royaume de Suède."},{"page_url":"https://it.wikipedia.org/wiki/Gran_maestri_di_Rodi","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6d/Rhodos439.JPG","page_title":"Gran maestri di Rodi","context_page_description":"Il seguente è l'elenco dei Gran maestri di Rodi, quando i Cavalieri Ospitalieri presero possesso dell'isola, appartenente all'Impero bizantino, provenienti dalla Terra santa e da Cipro, e vi rimasero, con piena sovranità, per 217 anni, dal 1305 al 1522. Furono venti, di cui uno usurpatore e quattro italiani. Il loro luogo di sepoltura era nella chiesa di San Giovanni: diciannove sarcofaghi si trovano nel chiostro della cattedrale dell'Annunciazione e alcune pietre tombali nel museo parigino di Cluny. Il primo gennaio 1523 i cavalieri abbandonarono Rodi, occupata dagli ottomani, e si diressero verso Malta, dove rimarranno fino al dominio napoleonico."},{"page_url":"https://en.wikipedia.org/wiki/Oxford_High_School_(Massachusetts)","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f2/Oxford_High_School%2C_Oxford_MA.jpg","page_title":"Oxford High School (Massachusetts)","context_page_description":"Oxford High School is in Oxford, Massachusetts, United States."},{"page_url":"https://pt.wikipedia.org/wiki/Vladimir_Ivashko","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/ee/Plaque_to_Volodymyr_Ivashko_%28Kharkiv%2C_Lenina_av.%2C_14%29.JPG","page_title":"Vladimir Ivashko","context_page_description":"Vladimir Antonovitch Ivashko foi um político soviético.\\nVladimir Ivashko destacou-se primeiramente como Secretário Geral do Partido Comunista de Ucrânia entre 1989 e 1990. Posteriormente, foi promovido a Secretário Geral do Partido Comunista entre 24 e 29 de agosto de 1991, entre a demissão de Mikhail Gorbatchev e a suspensão do Soviete Supremo da URSS, que certificou o afundamento da União Soviética. Após a dissolução da URSS, foi nomeado presidente da Verchovna Rada, o parlamento da recém instituída república de Ucrânia de 4 de junho até 9 de julho de 1990, quando foi substituído por Ivan Pliushch.\\nRetirou-se para vida privada em 1992 e morreu em 1994 após uma indeterminada \\"longa enfermidade\\"."},{"page_url":"https://sk.wikipedia.org/wiki/Rembercourt-Sommaisne","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/7b/Map_commune_FR_insee_code_55423.png","page_title":"Rembercourt-Sommaisne","context_page_description":"Rembercourt-Sommaisne je francúzska obec, ktorá sa nachádza v departemente Meuse, v regióne Lotrinsko."},{"page_url":"https://ar.wikipedia.org/wiki/%D9%85%D9%87%D8%B1%D8%AC%D8%A7%D9%86_%D8%BA%D8%A7%D9%86%D9%8A%D8%B4_%D8%AA%D8%B4%D8%A7%D8%AA%D9%88%D8%B1%D8%AB%D9%8A","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cb/Anant_Chaturdashi.jpg","page_title":"مهرجان غانيش تشاتورثي","context_page_description":"مهرجان غانيش تشاتورثي هو مهرجان هندوسي يقام تكريماً للآلهة غانيشا. وتقام احتفالات المهرجان عادة في رابع يوم من أول اسبوعين من شهر بادرابادا في التقويم الهندوسي، ويوافق عادة شهر أغسطس أو سبتمبر في التقويم الميلادي، وتستمر الاحتفالات لمدة 10 أيام.\\nويتم الاحتفال بهذا المهرجان في الأماكن العامة والمنازل. ويشمل الاحتفال في الأماكن العامة نصب تماثيل من الطين للآلهة غانيشا للعبادة الجماعية، وفي المنازل أيضاً يتم وضع تمثال من الطين لهذه الآلهة لعبادتها مع الأهل والأصدقاء. وفي نهاية المهرجان، يتم غمر هذه التماثيل في الماء كالبحيرات والبرك.\\nيتم الاحتفال بهذا المهرجان في جميع أنحاء الهند وخاصة في ولاية ماهاراشترا، حيث يقام احتفال مهيب لهذا المهرجان، ويستخدمون أدوات موسيقية تقليدية للاحتفال تسمي دهول وتاشا."},{"page_url":"https://en.wikipedia.org/wiki/Torre_Monumental","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/ae/Torre_Monumental-Plano-1910.jpg","page_title":"Torre Monumental","context_page_description":"Torre Monumental, formerly known as Torre de los Ingleses is a clock tower located in the barrio of Retiro in Buenos Aires, Argentina. It is situated in the Plaza Fuerza Aérea Argentina by San Martín Street and Avenida del Libertador. It was a gift from the local British community to the city in commemoration of the centennial of the May Revolution of 1810.\\nAfter the Falklands War in 1982, the tower's original name was dropped, though some still call it Torre de los Ingleses."},{"page_url":"https://lb.wikipedia.org/wiki/Dompcevrin","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/32/FR-55-Dompcevrin.JPG","page_title":"Dompcevrin","context_page_description":"Dompcevrin ass eng franséisch Gemeng an der Meuse an der Regioun Grand Est."},{"page_url":"https://fr.wikipedia.org/wiki/Taeniura_grabata","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Taeniura_grabata_tenerife2.jpg","page_title":"Taeniura grabata","context_page_description":"Taeniura grabata, communément appelé Pastenague africaine ou Pastenague ronde, est une espèce de raies de la famille Dasyatidae. Elle occupe des habitats sableux, vaseux ou rocheux situés à proximité des côtes du sud de l'océan Atlantique et du sud la mer Méditerranée. Cette raie de couleur sombre atteint généralement une envergure d'un mètre ; elle est reconnaissable au disque quasi circulaire que forme sa nageoire pectorale, à sa courte queue ainsi qu'à sa peau principalement lisse. La pastenague africaine chasse des poissons et des crustacés sur le fond marin. Son mode de reproduction est l'ovoviviparité. L'Union internationale pour la conservation de la nature ne dispose pas d'assez de données pour évaluer le statut de conservation de l'espèce au sein de sa liste rouge."},{"page_url":"https://eo.wikipedia.org/wiki/Aranka_Hegyi","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3a/Hegyi_Aranka_1900-ban.jpg","page_title":"Aranka Hegyi","context_page_description":"Aranka Hegyi [hedji], laŭ hungarlingve kutima sinsekvo Hegyi Aranka estis hungara-cigana operetkantisto, primadono.\\nAranka Hegyi naskiĝis la 25-an de majo 1855 en Szabadka, ŝi mortis la 9-an de junio 1906 en Budapeŝto."},{"page_url":"https://eu.wikipedia.org/wiki/Mandrevillars","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Mandrevillars%2C_Mairie.jpg","page_title":"Mandrevillars","context_page_description":"Mandrevillars Frantziako udalerria da, Haute-Saône departamenduan dagoena, Franche-Comté eskualdean. 2013an 211 biztanle zituen."},{"page_url":"https://fr.wikipedia.org/wiki/2009_en_a%C3%A9ronautique","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/cc/Lockheed_C-130_Hercules.jpg","page_title":"2009 en aéronautique","context_page_description":"2007 en astronautique - 2008 en astronautique - 2009 en astronautique - 2010 en astronautique - 2011 en astronautique\\n2007 en astronomie - 2008 en astronomie - 2009 en astronomie - 2010 en astronomie - 2011 en astronomie"},{"page_url":"https://de.wikipedia.org/wiki/Vossloh","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/22/SKL-14_rendszer%C5%B1_s%C3%ADnleer%C5%91s%C3%ADt%C3%A9s.jpg","page_title":"Vossloh","context_page_description":"Die Vossloh Aktiengesellschaft mit Sitz im sauerländischen Werdohl ist ein weltweit führender Anbieter im Bereich der Bahninfrastruktur. Das Unternehmen bietet Schienenbefestigungssysteme, Betonschwellen, Weichensysteme sowie Dienstleistungen rund um Schienen und Weichen an."},{"page_url":"https://es.wikipedia.org/wiki/Rebeli%C3%B3n_malgache","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/29_Mars_1947_Monument.jpg","page_title":"Rebelión malgache","context_page_description":"La Rebelión malgache o la revuelta de Madagascar fue una rebelión colonial contra la presencia francesa en la isla por nacionalistas locales entre 1947-1948. El gobierno francés, encabezado por Paul Ramadier, le sometió violentamente, costando una gran cantidad de vidas, fuentes de las autoridades francesas del momento las estimaron en 40.000 a 80.000​ muertos más 80.000 desplazados de la zona de combate, ​ mientras que un informe de Pierre de Chevigné concluyó que los desplazados no pudieron de hecho huir y murieron 80.000 a 90.000 locales.​ Las estimaciones modernas son más moderadas, entre 30.000 y 40.000 víctimas.​ La isla lograría ser autónoma en 1958.​ Posteriormente en 1960 se independizó, teniendo que enfrentar la rebelión del MNIM, ​ una organización izquierdista que llegó a agrupar 1.000 a 6.000 guerrilleros que operaron en el sur del país durante 1971.​"},{"page_url":"https://no.wikipedia.org/wiki/Adam_Mickiewicz-universitetet","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Wydzia%C5%82_Nauk_Politycznych_i_Dziennikarstwa_UAM.jpg","page_title":"Adam Mickiewicz-universitetet","context_page_description":"Adam Mickiewicz-universitetet er en av 26 høyskoler i Poznań, og et av Polens viktigste og største universiteter. Det åpnet i sin nåværende form i 1919, skjønt dets forløper ble grunnlagt i 1611 som et av Polens eldste universiteter. Universitetet er oppkalt etter en av Polens mest berømte diktere, Adam Mickiewicz.\\nUniversitetet i Poznań består av tretten fakulteter, og har over 40 000 studenter. Universitetet har en arktisk forskningshytte på Svalbard, ved navn Skottehytta i Petuniabukta.\\nI 2009 universitetet fristiller norske bøker for repatriering."},{"page_url":"https://zh.wikipedia.org/zh-tw/%E5%96%80%E6%96%AF%E7%89%B9%E5%9C%B0%E5%BD%A2","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/Mexico_Cenotes.jpg","page_title":"喀斯特地形","context_page_description":"喀斯特地形，又稱溶蝕地形、石灰岩地形，是具有溶蝕力的水對可溶性岩石進行溶蝕等作用所形成的地表和地下形態的總稱。又稱岩溶地貌。水對可溶性岩石所進行的作用，統稱為喀斯特作用。一般指碳酸鹽岩分布地區或存在流經石灰岩的地下水所特有的地貌現象。當雨水或者地下水與地面碳酸鹽類岩石接觸時，就會有少量碳酸鹽溶於水中。經過長時期的溶解侵蝕，形成了以地表岩層千溝萬壑為標誌的地表特徵。在喀斯特地貌下往往存在地下河、溶洞等景象。\\n喀斯特地形的地表崎嶇、土壤十分貧瘠，不利農業發展，因此在雲貴高原有「地無三里平，天無三日晴，人無三両銀」的俗諺。但其千溝萬壑的特色卻十分受到觀光客青睞。目前巴爾幹半島及中國重慶、廣西、貴州、雲南一帶均有喀斯特地形的存在。2016年11月24日，陝西省政府在新聞發布會上宣布在漢中發現世界級的超級天坑1個，大型天坑17個，常規天坑31個。\\n該種地形得名自克羅埃西亞的喀斯特高原，地理學家最早在該地做有系統的岩溶地貌研究。喀斯特是位於斯洛維尼亞西南部河谷以南，並延伸到義大利東北角大城鄰近狹長地帶的一片高地。因為該地區絕大部份位於斯洛維尼亞境內，所以簡述為位於斯洛維尼亞是可以接受的。"},{"page_url":"https://en.wikipedia.org/wiki/Lepiota_nirupama","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Thiruvananthapuramdistrict.png","page_title":"Lepiota nirupama","context_page_description":"Lepiota nirupama is a species of agaric fungus of the genus Lepiota in the order Agaricales. Known only from Kerala State in India, it was described as new to science in 2009."},{"page_url":"https://azb.wikipedia.org/wiki/%D9%87%D8%A7%D9%88%D8%A7%D9%86%D8%A7","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8c/CollageHavana.jpg","page_title":"هاوانا","context_page_description":"هاوانا کوبا اؤلکه سینین پایتختی و ان بؤیوک شهری و بندری و ایقتصادی مرکزیدیر.2.1 میلیون باش جمعیتی و 728 کیلومتر مساحتی واردیر."},{"page_url":"https://nl.wikipedia.org/wiki/Mottalciata","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/3d/Mottalciata_chiesa_di_san_vincenzo.jpg","page_title":"Mottalciata","context_page_description":"Mottalciata is een gemeente in de Italiaanse provincie Biella en telt 1445 inwoners. De oppervlakte bedraagt 18,5 km², de bevolkingsdichtheid is 78 inwoners per km²."},{"page_url":"https://it.wikipedia.org/wiki/Il_Sodoma","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/25/Giovanni_Antonio_Bazzi.jpg","page_title":"Il Sodoma","context_page_description":"Giovanni Antonio Bazzi, detto il Sodoma, è stato un pittore italiano del Rinascimento."},{"page_url":"https://ast.wikipedia.org/wiki/Centru_hist%C3%B3ricu_de_C%C3%B3rdoba","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/Palacio_Episcopal_de_C%C3%B3rdoba.JPG","page_title":"Centru históricu de Córdoba","context_page_description":"El centru históricu de Córdoba ye unu de los cascos antiguos más grandes d'Europa. En 1984, la Unesco declaró a la mezquita-catedral de Córdoba como Patrimoniu de la Humanidá. Más tarde, en 1994, la Unesco espandió esta denominación a gran parte del cascu antiguu. El centru históricu tien una gran riqueza monumental calteniendo grandes muertes de la dómina romana, árabe y cristiana.\\nLos elementos de cantu que definen la delimitación del conxuntu históricu de Córdoba tán formaos peles víes de comunicación que coinciden cola antigua muralla, lo qu'en gran midida salvaguardó'l centru históricu d'enanchar urbanísticos de finales del sieglu XIX y principios del XX, pos éstos trescurren pol perímetru del mesmu, creándose asina un aniellu d'espacios llibres que protexe al Conxuntu Históricu de Córdoba."},{"page_url":"https://ar.wikipedia.org/wiki/%D8%AC%D9%88%D8%B2%D9%81%D9%8A%D9%86_%D9%85%D9%86_%D9%84%D9%8A%D9%88%D8%AA%D8%B4%D8%AA%D9%86%D8%A8%D9%88%D8%B1%D8%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/fb/Josephine_of_Sweden_%26_Norway_c_1858_by_Axel_Nordgren.jpg","page_title":"جوزفين من ليوتشتنبورغ","context_page_description":"جوزفين من ليوتشتنبورغ ‏ كانت ملكة القرينة لـ السويد والنرويج بزواجها من أوسكار الأول، هي أبنة الكبرى لـ يوجين دو بوارنيه ربيب نابليون بونابرت وأميرة أوغستا من بافاريا أبنة ماكسيمليان يوزف الأول ملك بافاريا، وأيضا هي ووالدة الملكيين كارل الخامس عشر ملك السويد والنرويج وأوسكار الثاني ملك السويد والنرويج."},{"page_url":"https://war.wikipedia.org/wiki/Aerangis_citrata","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/35/Aerangis_citrata.jpg","page_title":"Aerangis citrata","context_page_description":"An Aerangis citrata in uska species han Liliopsida nga syahan ginhulagway ni Louis Marie Aubert Du Petit-Thouars, ngan ginhatag han pagkayana nga asya nga ngaran ni Schltr.. An Aerangis citrata in nahilalakip ha genus nga Aerangis, ngan familia nga Orchidaceae.\\nMabibilngan ini ha Madagascar. Waray hini subspecies nga nakalista."},{"page_url":"https://sl.wikipedia.org/wiki/Atene","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/83/Athens_Tram_Peace_and_Friendship_terminal.jpg","page_title":"Atene","context_page_description":"Atene so grško glavno mesto, ki leži na polotoku Atika na jugovzhodnem delu celinske Grčije. Leta 2011 je imelo mesto 655.780 prebivalcev. Mesto je znano predvsem po številnih zgradbah in drugih ostankih antične Grčije, ko so bile Atene močan polis in središče umetnosti, učenosti ter filozofije. Atene prevladujejo na območju Atike in spadajo med najstarejša mesta na svetu, saj zgodovinski zapisi o njem segajo okoli 3400 let v preteklost, najstarejši dokazani znaki človeške prisotnosti pa so iz 11. do 7. tisočletja pred našim štetjem. Antične Atene so sčasoma postale močna mestna država skupaj z razvojem pristanišča v sosednjem Pireju. Postale so središče umetnosti, učenja in filozofije, dom Platonovi akademiji in Aristotelovemu liceju in splošno priznane kot zibelka zahodne civilizacije in rojstni kraj demokracije, predvsem zaradi svojega vpliva na ostanek tedaj znane Evrope v 5. in 6. stoletju pred našim štetjem. Atene so danes svetovljanska metropola in središče gospodarskega, finančnega, industrijskega, političnega in kulturnega življenja Grčije."},{"page_url":"https://fr.wikipedia.org/wiki/La_Fausse_Suivante","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8d/FausseSuivante.jpg","page_title":"La Fausse Suivante","context_page_description":"La Fausse Suivante, ou le Fourbe puni est le titre d’une pièce de théâtre de Marivaux écrite en 1724 et représentée, pour la première fois, par les Comédiens italiens ordinaires du Roi le samedi 8 juillet 1724 au théâtre de l’Hôtel de Bourgogne.\\nSéduction, argent, pouvoir, travestissement sont les thèmes principaux de cette pièce où le principal personnage masculin s’avère être un libertin calculateur qui entretient par intérêt financier une riche comtesse dans l’illusion d’un mariage à venir et où l’héroïne, travestie en chevalier, punit l’un par la duperie et inflige une leçon exemplaire à l’autre pour sa frivolité."},{"page_url":"https://pl.wikipedia.org/wiki/Kamienica_%C5%81yszkiewicza_w_Warszawie","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/57/Warszawa%2C_ul._Freta_16_20170516_002.jpg","page_title":"Kamienica Łyszkiewicza w Warszawie","context_page_description":"Kamienica Łyszkiewicza – zabytkowa kamienica znajdująca się przy ul. Freta 16 w Warszawie."},{"page_url":"https://ta.wikipedia.org/wiki/%E0%AE%85%E0%AE%9A%E0%AE%BE-%E0%AE%9F%E0%AF%88%E0%AE%AF%E0%AF%80%E0%AE%B2%E0%AF%8D%E0%AE%9A%E0%AF%81-%E0%AE%86%E0%AE%B2%E0%AF%8D%E0%AE%9F%E0%AE%B0%E0%AF%8D_%E0%AE%B5%E0%AE%BF%E0%AE%A9%E0%AF%88","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/28/Aza_DA_mechanism.png","page_title":"அசா-டையீல்சு-ஆல்டர் வினை","context_page_description":"அசா-டையீல்சு-ஆல்டர் வினை என்பது இமைன்கள் மற்றும் டையீன்களை டெட்ராஐதரோபிரிடின்களாக மாற்றக்கூடிய ஒரு வினையாகும். சிறு திறுத்தங்களுடன் மேற்கொள்ளப்படும் டையீசு-ஆல்டர் வினையே இந்தக் கரிம வினையாகும். இவ்வினையில் டையீன் அல்லது டையீனோபைலின் ஒரு பகுதியாக நைட்ரசன் அணு அமைகிறது.\\nஅமீன் மற்றும் பார்மால்டிகைடைப் பயன்படுத்தி இமைன் பெரும்பாலும் வினைத்தளத்தில் உருவாக்கப்படுகிறது. சைக்ளோபென்டாடையீன் உடன் பென்சைலமீன் வினைபுரிந்து அசா நார்போர்னீன் என்ற சேர்மம் உருவாதலை இதற்கு உதாரணமாகக் கூறலாம்\\n.\\nஆடியெதிர்தெரிவு டையீல்சு-ஆல்டர் வினையில் ஓர் அனிலீன், பார்மால்டிகைடு மற்றும் வளையயெக்சினோன் ஆகியனவற்றின் வினையில் டையீனின் வினை மட்டுப்படுத்தப்பட்டாலும் கூட -புரோலினால் வினையூக்கம் செய்யப்படுகிறது\\n.\\nஅரோமாட்டிக் அமீனுடன் பார்மால்டிகைடு வினைபுரிந்து இமைன் மற்றும் கீட்டோனுடன் புரோலின் வினை புரிந்து டையீன் உருவாதலுடன் இந்த வினையூக்கச் சுழற்சி வினை தொடங்குகிறது. இரண்டாவது படிநிலையில் ஓர் என்டோ டிரிக் வளையமாதல் வினை நிகழ்ந்து சாத்தியமுள்ள இரண்டு ஆடியெதிர் உருக்களில் ஒன்று உருவாகிறது. ஏனெனில் அதிலுள்ள இமைன் நைட்ரசன் அணு எசுஐ- முகத்தின் மேலுள்ள கார்பாக்சிலிக் அமிலத் தொகுதியுடன் இணைந்து ஐதரசன் பிணைப்பை உருவாக்குகிறது."},{"page_url":"https://vi.wikipedia.org/wiki/Chi_%C4%90%E1%BA%ADu_dao","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/91/Canavalia_gladiata_Blanco2.449-cropped.jpg","page_title":"Chi Đậu dao","context_page_description":"Canavalia là một chi thực vật có hoa trong họ Đậu."},{"page_url":"https://zh.wikipedia.org/zh-cn/%E4%B8%83%E9%9A%8E%E4%B8%89%E8%A7%92%E5%BD%A2%E9%91%B2%E5%B5%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/H2_tiling_237-4.png","page_title":"七階三角形鑲嵌","context_page_description":"在几何学中，七阶三角形镶嵌是一种由正三角形拼合，并且以七个三角形为单位，重复排列组合，并让图形完全拼合，而且没有空隙或重叠的几何构造。\\n七阶三角形镶嵌每个顶点有七个正三角形，因此每个顶点的角度为60×7=420度，超过360度，因此无法在平面构造，是一种双曲正镶嵌，在施莱夫利符号中用{3,7}来表示。"},{"page_url":"https://fr.wikipedia.org/wiki/Pullman_Hotels_and_Resorts","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6a/The_Park_Lane_Hong_Kong.jpg","page_title":"Pullman Hotels and Resorts","context_page_description":"Pullman Hotels and Resorts est une marque d'hôtels de luxe basée à Paris en France, et détenue par le groupe AccorHotels. Tirant son nom des wagons Pullman, l’enseigne Pullman Hotels apparaît à la fin des années 1980, disparaît progressivement dans les années 1990 après son rachat par le groupe Accor, puis est réactivée en 2007 et orientée vers le tourisme d'affaires. Pullman compte 117 hôtels dans 33 pays."},{"page_url":"https://hy.wikipedia.org/wiki/%D5%8E%D5%A1%D5%AC%D5%B4%D5%A1%D6%80","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/64/%D5%8E%D5%B8%D5%AC%D5%B8%D5%A4%D5%B5%D5%A1_%D5%84%D5%A1%D6%80%D5%A3%D5%A1%D6%80%D5%B5%D5%A1%D5%B6_1.jpg","page_title":"Վալմար","context_page_description":"Վլադիմիր Մամիկոնի Մարգարյան, հայտնի է որպես Վալմար, հայ գեղանկարիչ, ՀՀ վաստակավոր նկարիչ, ՀՀ ժողովրդական նկարիչ ։\\nԴուստրը նկարիչ-ձևավորող Հռիփսիմե Մարգարյանն է։"},{"page_url":"https://fr.wikipedia.org/wiki/Parlement_des_Salomon","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6b/Solomon_Islands_House_of_Parliament_%28inside%29.jpg","page_title":"Parlement des Salomon","context_page_description":"Le Parlement national est le corps législatif monocaméral des Salomon.\\nLes Salomon sont un royaume du Commonwealth, dont les institutions politiques sont fondées sur le système de Westminster. Le Parlement est établi par la Constitution de 1978, adoptée en vue de l'indépendance du pays. Les députés sont élus pour quatre ans au suffrage universel direct, lors d'un scrutin uninominal majoritaire à un tour dans chacune des cinquante circonscriptions.\\nL'article 59 de la Constitution dispose qu'un projet de loi adopté par le Parlement est soumis au Gouverneur général, « qui lui accorde immédiatement son assentiment » au nom de la Reine, promulguant la loi. La Constitution ne prévoit pas que le Gouverneur général ou la reine puissent refuser d'accorder leur assentiment à une loi. La promulgation est ainsi automatique - disposition qui reflète une convention constitutionnelle britannique.\\nLe Premier ministre est élu par le Parlement parmi ses membres. Il nomme ses ministres parmi les députés. Il peut être démis par une motion de confiance au Parlement."},{"page_url":"https://et.wikipedia.org/wiki/Leonid_Kravt%C5%A1uk","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1d/Freedom_order.jpg","page_title":"Leonid Kravtšuk","context_page_description":"Leonid Makarovõtš Kravtšuk on Ukraina poliitik, Ukraina kangelane.\\nTa oli Ukraina esimene president.\\nKravtšuk sündis Żytyń Wielki külas Rovno maakonnas Volõõnia vojevoodkonnas Poolas."},{"page_url":"https://en.wikipedia.org/wiki/Civil_parishes_in_Lancashire","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/37/Lathom_Chapel%2C_Ormskirk_-_geograph.org.uk_-_12630.jpg","page_title":"Civil parishes in Lancashire","context_page_description":"A civil parish is a subnational entity, forming the lowest unit of local government in England. There are 219 civil parishes in the ceremonial county of Lancashire; Blackpool is completely unparished; Pendle and Ribble Valley are entirely parished. At the 2001 census, there were 587,074 people living in the 219 parishes, accounting for 41.5 per cent of the county's population."},{"page_url":"https://pt.wikipedia.org/wiki/Drochtersen","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/8f/Krautsand_harbor_1951.jpg","page_title":"Drochtersen","context_page_description":"Drochtersen é um município da Alemanha localizado no distrito de Stade, estado da Baixa Saxônia."},{"page_url":"https://be.wikipedia.org/wiki/%D0%92%D0%BE%D1%9E%D1%87%D0%BD%D1%96%D0%BA_%D0%B1%D0%B0%D1%80%D0%B0%D0%B2%D1%8B","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/df/Daphne_cneorum_2.jpg","page_title":"Воўчнік баравы","context_page_description":"Воўчнік баравы, ваўчаягада пахучая, ваўчаягада баравік — расліна роду Daphne сямейства Thymelaeaceae."},{"page_url":"https://fr.wikipedia.org/wiki/Richard_Travers","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1b/Richard_Travers_002.jpg","page_title":"Richard Travers","context_page_description":"Richard Travers est un acteur et réalisateur canadien, né le 15 avril 1885 au poste de traite de la baie d'Hudson, mort le 20 avril 1935 à San Pedro."},{"page_url":"https://fi.wikipedia.org/wiki/Daimler_Company","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9b/R.A.F._1A_at_National_Museum_of_the_United_States_Air_Force.jpg","page_title":"Daimler Company","context_page_description":"Daimler Company Ltd, vuoteen 1910 asti Daimler Motor Company Ltd, oli brittiläinen ajoneuvoja valmistanut yhtiö. Liikemies Harry J. Lawson perusti yhtiön Lontooseen vuonna 1896. Myöhemmin pääkonttori ja ajoneuvojen valmistus siirtyivät Coventryyn, luoteis-Englantiin. Lawson hankki oikeudet Daimler-nimen käyttöön sekä Gottlieb Daimleriilta että Daimler-Motoren-Gesellschaftilta.\\nVuonna 1960 Jaguar Cars osti kaikki Daimlerin osakkeet niiden silloiselta haltijalta Birmingham Small Arms Company Ltd:ltä. Vuonna 1961 esitelty Daimler DR450 oli viimeinen yhtiön omaa suunnittelua ollut malli, sen jälkeen mallit olivat Daimlerin ulkoisilla tunnuksilla varustettuja Jaguareja. Daimler on merkkinä edelleen Jaguar Land Rover Ltd:n omistuksessa. Sen emoyhtiö on Jaguar Land Rover Automotive PLC, jonka omistaa intialainen Tata Group.\\nJaguar jakaa oikeudet \\"Daimler\\"-nimen käyttöön saksalaisen ajoneuvojen valmistajan Daimler AG:n kanssa. Jaguar teki vuonna 2007 sopimuksen, jonka mukaan saksalaisella sopimuskumppanilla on oikeus käyttää nimeä \\"Daimler\\" yhtiön ja sen tuotteiden yhteydessä. Näitä oikeuksia ei saksalaisilla aiemmin ollut."},{"page_url":"https://hi.wikipedia.org/wiki/%E0%A4%B2%E0%A4%96%E0%A4%A8%E0%A4%8A_%E0%A4%95%E0%A5%80_%E0%A4%B8%E0%A4%82%E0%A4%B8%E0%A5%8D%E0%A4%95%E0%A5%83%E0%A4%A4%E0%A4%BF","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cc/Kathak_mast.jpg","page_title":"लखनऊ की संस्कृति","context_page_description":"लखनऊ अपनी विरासत में मिली संस्कृति को आधुनिक जीवनशैली के संग बड़ी सुंदरता के साथ संजोये हुए है। भारत के उत्कृष्टतम शहरों में गिने जाने वाले लखनऊ की संस्कृति में भावनाओं की गर्माहट के साथ उच्च श्रेणी का सौजन्य एवं प्रेम भी है। लखनऊ के समाज में नवाबों के समय से ही पहले आप वाली शैली समायी हुई है। हालांकि स्वार्थी आधुनिक शैली की पदचाप सुनायी देती है, किंतु फिर भी शहर की जनसंख्या का एक भाग इस तहजीब को संभाले हुए है। यह तहजीब यहां दो विशाल धर्मों के लोगों को एक समान संस्कृति से बांधती है। ये संस्कृति यहां के नवाबों के समय से चली आ रही है।"},{"page_url":"https://en.wikipedia.org/wiki/Ohio_State_Route_430","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/19/Charles_Mill_Lake.jpg","page_title":"Ohio State Route 430","context_page_description":"State Route 430 is an east–west state highway in the northern portion of Ohio. The western terminus of State Route 430 is at an interchange with State Route 309 in Ontario. Its eastern terminus is at a T-intersection with State Route 603 just outside Mifflin."},{"page_url":"https://zh.wikipedia.org/zh-sg/%E5%9C%8B%E6%B3%B0%E5%9F%8E","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/6c/Cathay_City.JPG","page_title":"國泰城","context_page_description":"国泰城是国泰航空的总部，位于香港赤鱲角香港国际机场观景路8号，由香港宝嘉建筑负责兴建\\n，于1998年7月落成，于同年10月启用，占地4公顷，楼面面积逾130,000平方米，耗资49亿港元兴建，是全亚洲最大的企业总部。国泰城由多座建筑物所组成；设有楼高10层的办公室大楼、飞行培训中心、餐厅、超级市场、理发店及美容院等。此外，兴建有楼高23层的酒店──逸泰居，另外亦有一座仓库大楼。香港国际机场以外，国泰航空亦于九龙尖沙咀的港威大厦设有办公室。国泰的制服洗濯有关的部门则设于新界屯门区南丰工业城。\\n国泰城启用前，国泰航空的总部位于香港岛中环太古大厦，于启德机场亦有办公室等设施。"},{"page_url":"https://de.wikipedia.org/wiki/Ligne_de_Cerdagne","image_url":"http://upload.wikimedia.org/wikipedia/commons/c/cb/SNCF_Z_150.jpg","page_title":"Ligne de Cerdagne","context_page_description":"Die Ligne de Cerdagne ist eine elektrisch betriebene Schmalspurbahn in Meterspur, die als Gebirgsbahn einen Teil der französisch-katalanischen Pyrenäen erschließt. Sie wird von der TER, einer Untergesellschaft der französischen Eisenbahngesellschaft SNCF betrieben.\\nWährend die Bahn im Französischen wegen ihres auffälligen gelben Anstrichs Canari oder Petit train jaune, bzw. auf Katalanisch Tren groc, genannt wird, ist sie im deutschen Sprachraum auch als „Pyrenäenmetro“ bekannt. Diesen Namen erhielt sie zweifellos wegen ihrer in Kontinentaleuropa auf dem offenen Land seltenen Betriebsform: Die Traktionsspannung von 850 V Gleichstrom wird mittels einer von oben bestrichenen Seitenstromschiene zugeführt.\\nDie Bahn und ihre Strecke stehen seit 2002 auf der Warteliste zum Weltkulturerbe der UNESCO."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A1%9C%EC%96%84_%EB%8B%A4%EB%85%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/bf/Royal_Dano_in_The_Trouble_with_Harry_trailer.jpg","page_title":"로얄 다노","context_page_description":"로얄 다노는 미국의 배우, 영화배우, 텔레비전 배우이다.\\n뉴욕에서 태어났으며 로스앤젤레스에서 사망하였다."},{"page_url":"https://pt.wikipedia.org/wiki/Lepidium","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e1/Lepidium_flavum_form.jpg","page_title":"Lepidium","context_page_description":"O género botânico Lepidium faz parte da família das Brassicaceae, a que também pertencem as couves, a mostarda e os nabos. Lepidium, apesar de ser em latim, provém do grego, e significa \\"pequena escama\\", em referência ao tamanho e forma dos frutos."},{"page_url":"https://es.wikipedia.org/wiki/FC_Schalke_04_II","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/97/FC_Schalke_04_Logo.png","page_title":"FC Schalke 04 II","context_page_description":"El FC Schalke 04 II es un equipo de fútbol de Alemania que juega en la Regionalliga West, una de las ligas regionales que conforman la cuarta división de fútbol en el país."},{"page_url":"https://fr.wikipedia.org/wiki/Gare_de_Schaan-Forst-Hilti","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e8/H-Forst_Hilti.jpg","page_title":"Gare de Schaan-Forst-Hilti","context_page_description":"La gare de Schaan-Forst-Hilti est une gare ferroviaire Liechtensteinoise de la ligne de Feldkirch à Buchs, située à Forst Hilti, sur le territoire de la commune de Schaan dans la Principauté du Liechtenstein. Elle dessert principalement l'usine de l'entreprise Hilti.\\nC'est une halte voyageurs Österreichische Bundesbahnen desservie par des trains régionaux."},{"page_url":"https://sv.wikipedia.org/wiki/Garphyttans_nationalpark","image_url":"https://upload.wikimedia.org/wikipedia/commons/e/e2/Garphyttans_nationalpark_1.JPG","page_title":"Garphyttans nationalpark","context_page_description":"Garphyttan är en nationalpark vid Kilsbergens östra sluttning i Lekebergs kommun. Nationalparkens areal är 111 hektar och den inrättades 1909.\\nSevärdheter: De blomsterrika gamla odlingsmarkerna, det rika fågellivet och utsikten från Svensbodaberget."},{"page_url":"https://pt.wikipedia.org/wiki/Ocelo","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/00/Oriental_Wasp_-_Head.jpg","page_title":"Ocelo","context_page_description":"Ocelo, ou mancha ocular, é o olho primitivo das hidromedusas, platelmintos e alguns insetos, constituído pelo agrupamento de células fotorreceptoras. São estruturas pequenas e isoladas, constituídas por células sensoriais, revestidas por células pigmentadas, conectadas ao nervo óptico. Os ocelos detectam a intensidade e direção da luz, mas não são capazes de formar imagens.\\nTambém pode se referir a manchas semelhantes a olhos, um tipo de mimetismo.\\nAlgumas medusas, estrelas-do-mar e planárias têm os olhos mais simples, que possuem pigmento distribuído aleatoriamente e que não possuem estruturas adicionais, como córnea e cristalino. A aparente cor dos olhos nesses animais é, portanto, vermelha ou preta. No entanto, outros cnidaria têm olhos mais complexos, incluindo as Cubomedusae que possuem retina distinta, lente e córnea.\\nMuitos caracóis e moluscos gastrópodes também têm \\"ocelli\\", seja nas pontas ou nas bases dos tentáculos. No entanto, alguns outros gastrópodes, como os Strombidae, têm olhos muito mais sofisticados. Amêijoas gigantes têm ocelos que permitem que a luz penetre no manto."},{"page_url":"https://tg.wikipedia.org/wiki/FMA_AeC.2","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d4/FMA_Ae._C.2_%28Ae._M.E.1%29.jpg","page_title":"FMA AeC.2","context_page_description":"FMA AeC.2 — як ҳавогарди сохтаи FMA аст. Ин ҳавогард дар Апрел 18, 1932 нахустин парвози худро анҷом дод."},{"page_url":"https://es.wikipedia.org/wiki/Quesada_(Ja%C3%A9n)","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7e/Quesada_24J_01.jpg","page_title":"Quesada (Jaén)","context_page_description":"Quesada es un municipio español de la provincia de Jaén, en Andalucía. Se ubica en la comarca del Alto Guadalquivir y sus habitantes se llaman quesadenses o quesadeños."},{"page_url":"https://fr.wikipedia.org/wiki/Ambassade_de_la_R%C3%A9publique_d%C3%A9mocratique_du_Congo_en_France","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a2/Ambassade_de_la_R%C3%A9publique_d%C3%A9mocratique_du_Congo_en_France%2C_32_cours_Albert-Ier%2C_Paris_8e.jpg","page_title":"Ambassade de la République démocratique du Congo en France","context_page_description":"L'ambassade de la République démocratique du Congo en France est la représentation diplomatique de la République démocratique du Congo près la République française. Elle est située à Paris et son chef de Mission est, depuis septembre 2018, Jean Tambu Mikuma."},{"page_url":"https://pt.wikipedia.org/wiki/Bandeira_de_Marrocos","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/7f/Pentagram_green.svg","page_title":"Bandeira de Marrocos","context_page_description":"A bandeira de Marrocos é vermelha com uma estrela verde ao centro. Até 1915, a bandeira era toda vermelha, assim como a de muitas bandeiras de países árabes na época. Por sugestão dos colonizadores franceses, com o objetivo de diferenciá-la das demais, o pentagrama foi incluído.\\nO pentagrama é um símbolo ancestral de vida, saúde, sabedoria e paz. O verde é usado na estrela porque é a cor do Islamismo."},{"page_url":"https://nl.wikipedia.org/wiki/Zuurstofdifluoride","image_url":"http://upload.wikimedia.org/wikipedia/commons/7/76/Zuurstofdifluoride.png","page_title":"Zuurstofdifluoride","context_page_description":"Zuurstofdifluoride is een anorganische verbinding met als brutoformule OF₂. Zoals voorspeld door de VSEPR-theorie neemt de molecule een gebogen geometrie aan, vergelijkbaar met water. Zuurstofdifluoride komt voor als een kleurloos gas en is een sterke oxidator."},{"page_url":"https://pl.wikipedia.org/wiki/Gary_Harris","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9f/Gary_Harris.jpg","page_title":"Gary Harris","context_page_description":"Gary Harris – amerykański koszykarz, obrońca, aktualnie zawodnik zespołu Denver Nuggets.\\nW 2012 wystąpił w meczu wschodzących gwiazd - Nike Hoop Summit oraz McDonald’s All-American."},{"page_url":"https://en.wikipedia.org/wiki/Lavandula_angustifolia","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d8/Lavandula_angustifolia_lavender_Lavendel_04.jpg","page_title":"Lavandula angustifolia","context_page_description":"Lavandula angustifolia, formerly L. officinalis, is a flowering plant in the family Lamiaceae, native to the Mediterranean."},{"page_url":"https://ja.wikipedia.org/wiki/%E9%89%84%E9%81%93%E8%BB%8A%E4%B8%A1%E3%81%AE%E5%8F%B0%E8%BB%8A","image_url":"http://upload.wikimedia.org/wikipedia/commons/e/e7/JR_East_E531_series_EMU_006.JPG","page_title":"鉄道車両の台車","context_page_description":"鉄道車両の台車とは、鉄道車両において、車体に直結されていない、自由度のある走り装置のことである。"},{"page_url":"https://en.wikipedia.org/wiki/Benjamin_Holmes_House","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/94/Holmesland_Salem_Co_NJ.JPG","page_title":"Benjamin Holmes House","context_page_description":"Benjamin Holme House also known as \\"Holmeland\\" is located in Elsinboro Township in Salem, Salem County, New Jersey, United States. The house was built in 1729 and was added to the National Register of Historic Places on August 31, 1978. The original property expanded over 1,600 acres, with a ferry running to New Castle, DE. The house was looted and burned by the British during The American Revolution, and was later rebuilt, adding the East section of the house in the 1780s."},{"page_url":"https://fr.wikipedia.org/wiki/Le_Voyage_de_Chihiro","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a4/Alice_par_John_Tenniel_21.png","page_title":"Le Voyage de Chihiro","context_page_description":"Le Voyage de Chihiro est un film d'animation japonais écrit et réalisé par Hayao Miyazaki et produit par le studio Ghibli, sorti en 2001.\\nLe film raconte l'histoire de Chihiro, une fillette de dix ans qui, alors qu'elle se rend en famille vers sa nouvelle maison, entre dans le monde des esprits. Après la transformation de ses parents en porcs par la sorcière Yubaba, Chihiro prend un emploi dans l'établissement de bains de Yubaba pour retrouver ses parents et le monde humain.\\nMiyazaki écrit le scénario en s'inspirant de la fille de son producteur associé Seiji Okuda qui vient lui rendre visite chaque été. Il y développe plusieurs thèmes qui lui sont chers, dont l'intégration par le travail collectif, le voyage initiatique, le renouement avec les valeurs ancestrales et le danger de la société moderne pour la nature et les traditions. La production de Chihiro débute en 2000 avec un budget de 19 millions de dollars. La composition de la bande originale du film est confiée à Joe Hisaishi.\\nLe Voyage de Chihiro fut le plus grand succès de l'histoire du cinéma japonais, avec 23 millions de spectateurs au Japon et 274 millions de dollars de recettes dans le monde."},{"page_url":"https://ast.wikipedia.org/wiki/Cestrum_diurnum","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/b7/Cestrum_diurnum_%28China_Berry%29_fruit_in_Hyderabad_W_IMG_7109.jpg","page_title":"Cestrum diurnum","context_page_description":"Cestrum diurnum ye una especie de parrotal del xéneru Cestrum perteneciente a la familia de les solanacees. Ye orixinaria de les Indies occidentales."},{"page_url":"https://ru.wikipedia.org/wiki/%D0%A1%D0%BF%D0%B8%D1%81%D0%BE%D0%BA_%D1%81%D0%B0%D0%BC%D1%8B%D1%85_%D0%B2%D1%8B%D1%81%D0%BE%D0%BA%D0%B8%D1%85_%D0%B7%D0%B4%D0%B0%D0%BD%D0%B8%D0%B9_%D0%90%D0%BB%D0%B1%D0%B0%D0%BD%D0%B8%D0%B8","image_url":"https://upload.wikimedia.org/wikipedia/commons/f/f0/Sky_Tower_Tirana_%28Oct_2016%29.jpg","page_title":"Список самых высоких зданий Албании","context_page_description":"Список самых высоких зданий Албании — перечень самых высоких зданий страны."},{"page_url":"https://en.wikipedia.org/wiki/Soling_European_Championship_results_(1980%E2%80%9384)","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/Progress_EC_Soling_1980.png","page_title":"Soling European Championship results (1980–84)","context_page_description":"Unfortunately not all crew names are documented in the major sources: United States Soling Association bulletin \\"Leading Edge\\" and International Soling Association magazine \\"Soling Sailing\\"."},{"page_url":"https://arz.wikipedia.org/wiki/%D8%A7%D9%85%D9%88%D8%AF%D9%87%D8%A7%D9%86_%D8%A2%D8%B1_%D9%BE%D9%89","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ce/Amudhan_rp.jpg","page_title":"امودهان آر پى","context_page_description":"امودهان آر پى مخرج افلام من الهند."},{"page_url":"https://nl.wikipedia.org/wiki/Louis_Didier_Jousselin","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2d/Jousselintour_effeil.JPG","page_title":"Louis Didier Jousselin","context_page_description":"Louis Didier Jousselin was een Franse ingenieur. Tijdens de Zesde Coalitieoorlog bouwde hij een drie kilometer lange brug in minder dan drie maanden tijdens de belegering van Hamburg. Hij is een van de 72 Fransen wier namen in reliëf op de Eiffeltoren zijn aangebracht."},{"page_url":"https://ko.wikipedia.org/wiki/%EB%A7%88%EB%A5%B4%EB%A7%88%EB%A6%AC%EC%8A%A4","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/4f/Mu%C4%9Fla_districts.png","page_title":"마르마리스","context_page_description":"마르마리스는 터키 남서부에 위치한 물라 주의 도시로, 면적은 295km², 인구는 36,180명이다. 주요 산업은 관광업이며 그리스 로도스 섬을 연결하는 페리가 운행된다."},{"page_url":"https://pt.wikipedia.org/wiki/Lista_de_personagens_de_Star_Trek:_Discovery","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Jason_Isaacs_2014.jpg","page_title":"Lista de personagens de Star Trek: Discovery","context_page_description":"Star Trek: Discovery é uma série televisiva estadunidense criada por Bryan Fuller e Alex Kurtzman e transmitida pela CBS desde 25 de setembro de 2017. O enredo da série ocorre uma década antes dos eventos da série original, sendo distinto da linha cronológica dos filmes concomitantes. Discovery explora a guerra fria entre os Klingon e a Federação dos Planetas Unidos enquanto narra as aventuras da tripulação da USS Discovery.\\nA série é estrelada por Sonequa Martin-Green como Michael Burnham, líder de um motim na Frota Estelar realocada como especialista de ciência a bordo da USS Discovery, sendo ainda irmã adotiva de Spock. Doug Jones, Shazad Latif, Anthony Rapp, Mary Wiseman e Jason Isaacs também estrelam a série. Alguns personagens visto na série original também fazem participações em Discovery, incluindo Sarek e Harry Mudd."},{"page_url":"https://zh.wikipedia.org/wiki/%E4%BA%A4%E9%80%9A%E5%AF%A7%E9%9D%9C%E5%8C%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/6/61/Traffic-calmed_neighbourhood.jpg","page_title":"交通寧靜化","context_page_description":"交通寧靜化，又稱交通穩靜化、交通靜穩化、交通安定化、交通鎮靜化或交通穩化等，是採用物理設計和其他措施來提高駕駛者、行人和騎行者安全的技術領域。它旨在鼓勵更安全、更負責任的駕駛，並可減少交通流量。都市計畫技師和交通工程師有各種交通寧靜化的策略，包括道路縮窄和減速丘。這類措施在澳大利亞和歐洲很常見，在北美則不然。交通寧靜化常被運用在住宅區的出入道路以確保社區居民使用道路的交通安全。\\n「交通寧靜化」的英文「traffic calming」譯自德語單詞Verkehrsberuhigung，該詞首先在1985年由卡門·哈斯-克勞發表。\\n實現交通寧靜化的區域稱為交通寧靜區。"},{"page_url":"https://es.wikipedia.org/wiki/Baltasar_Corrada_del_R%C3%ADo","image_url":"https://upload.wikimedia.org/wikipedia/commons/1/1f/Corrada.jpg","page_title":"Baltasar Corrada del Río","context_page_description":"Baltasar Corrada del Río fue un servidor público, político y jurista puertorriqueño. Fungió como abogado, juez del Tribunal Supremo de Puerto Rico, secretario de Estado de Puerto Rico, comisionado residente en Washington D. C., y fue presidente de la Comisión de Derechos Civiles al principio de los años 1970. Era hijo de Ana del Río y de Rómulo Corrada."},{"page_url":"https://la.wikipedia.org/wiki/Andromeda_(Euripides)","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/80/1869_Edward_Poynter_-_Andromeda.jpg","page_title":"Andromeda (Euripides)","context_page_description":"Vide etiam paginam discretivam: Andromeda\\nAndromeda est tragoedia quam Euripides anno 412 a.C.n. docuit.\\nNarratiuncula romantica Andromedae magna in gratia erat per totam antiquitatem. Quisnam enim non cupiat virginem catenis vinctam ab heroe liberari? Ante Euripidem iam Sophocles fabulam docuerat eodem nomine. Quamquam Andromeda Euripidea fragmentis tantum in aetatem nostram defluxit, argumentum fabulae admodum bene cognovimus. Si fidem scriptis Nicobule attributis reponimus, Alexander Magnus in novissima cena episodium ex Euripidis Andromeda quod memoria tenebat declamitavit."},{"page_url":"https://uk.wikipedia.org/wiki/%D0%A1%D1%82%D1%96%D0%B2%D0%B5%D0%BD_%D0%9A%D0%B0%D1%80%D0%BD%D1%96","image_url":"https://upload.wikimedia.org/wikipedia/commons/7/76/Stephen_W._Kearny.jpg","page_title":"Стівен Карні","context_page_description":"Сті́вен Ка́рні — офіцер армії США, відомий за командуваня силами США у військових діях протягом Американо-мексиканської війни, зокрема на території Каліфорнії. Він був знаменитий протягом свого життя як «отець американської кінноти». Код Карні, закон, який регулював урядову політику у відношенні до каліфорнійського населення мексиканського походження, був названий на його честь."},{"page_url":"https://ceb.wikipedia.org/wiki/Sheridan_County_(kondado_sa_Tinipong_Bansa,_Montana)","image_url":"https://upload.wikimedia.org/wikipedia/commons/5/5a/Sheridan_county_courthouse.jpg","page_title":"Sheridan County (kondado sa Tinipong Bansa, Montana)","context_page_description":"Kondado ang Sheridan County sa Tinipong Bansa. Nahimutang ni sa estado sa Montana, sa sentro nga bahin sa nasod, 2,400 km sa kasadpan sa Washington, D.C. Adunay 3,384 ka molupyo. Naglangkob kin og 1,706 ka kilometro kwadrado. Sheridan County mopakigbahin sa usa ka utlanan sa Divide County, Daniels County, ug Roosevelt County ang ulohan sa nasod.\\nAng yuta sa Sheridan County kay kasagaran patag, apan sa kasadpan nga kini mao ang kabungtoran.\\nSheridan County may sa mosunod nga mga subdibisyon:\\nPlentywood\\nMga lungsod sa Sheridan County:\\nPlentywood\\nMedicine Lake\\nWestby\\nSa mosunod nga mga natural nga mga bahin makita sa Sheridan County:\\nMga suba:\\nAntelope Creek\\nAtor Creek\\nBeaver Creek\\nBoxelder Creek\\nBrush Mountain Creek\\nCottonwood Creek\\nCrazy Horse Creek\\nEagle Creek\\nEast Fork Brush Mountain Creek\\nEast Fork Wolf Creek\\nFord Creek\\nGive Out Morgan Creek\\nHarrys Creek\\nLake Creek\\nLittle Beaver Creek\\nLost Creek\\nMarron Creek\\nMcCabe Creek\\nMcCoy Creek\\nMcLaughlin Creek\\nMiddle Fork Eagle Creek\\nNeiser Creek\\nNorth Fork Eagle Creek\\nOtter Creek\\nPlentywood Creek\\nRedstone Creek\\nReserve Creek\\nSand Creek\\nSouth Fork Antelope Creek\\nWhitetail Creek\\nWolf Creek\\nMga kanal:\\nDiversion Ditch Number One\\nMga tubud:"},{"page_url":"https://hu.wikipedia.org/wiki/Luca_Urbani","image_url":"https://upload.wikimedia.org/wikipedia/commons/2/2b/Luca_Urbani_portrait.jpg","page_title":"Luca Urbani","context_page_description":"Luca Urbani dr. olasz orvos, űrhajós, alezredes."},{"page_url":"https://zh.wikipedia.org/wiki/%E7%93%A6%E5%A4%AB%E5%85%B0","image_url":"http://upload.wikimedia.org/wikipedia/commons/6/64/Wavrin_hotel_de_ville.JPG","page_title":"瓦夫兰","context_page_description":"瓦夫兰是法国上法兰西大区诺尔省的一个市镇，位于该省中部偏西南，属于里尔区。该市镇2009年时的人口为7,676人。"},{"page_url":"https://en.wikipedia.org/wiki/Karel_Janou%C5%A1ek","image_url":"https://upload.wikimedia.org/wikipedia/commons/8/89/Czechoslovak_War_Cross_1914-1918.PNG","page_title":"Karel Janoušek","context_page_description":"Dr Karel Janoušek, KCB was a senior Czechoslovak Air Force officer. He began his career as a soldier, serving in the Austrian Imperial-Royal Landwehr 1915–16, Czechoslovak Legion 1916–20 and Czechoslovak Army 1920–24.\\nIn 1924 Janoušek transferred to the Czechoslovak Air Force and in 1926 he qualified as an aircraft pilot. In 1930 he co-wrote a textbook on aerial warfare tactics. In the 1930s he was a staff officer. From 1936 he studied meteorology and geophysics at the Charles University and in 1939 he was awarded a doctorate in natural sciences.\\nIn the Second World War Janoušek escaped first to France and then the United Kingdom. In the UK he commanded the RAF's Czechoslovak squadrons, was knighted by HM King George VI and ultimately promoted to Air Marshal. In occupied Czechoslovakia the Nazis retaliated against Janoušek's Free Czechoslovak service by jailing his wife and much of their family.\\nIn 1945 Janoušek returned to Czechoslovakia, where he found his wife and several of their relatives had died in imprisonment. He was sidelined by the increasingly pro-Communist commanders of the Czechoslovak Air Force."},{"page_url":"https://la.wikipedia.org/wiki/Mons_Crucis","image_url":"http://upload.wikimedia.org/wikipedia/commons/8/8a/Kreuzberg.png","page_title":"Mons Crucis","context_page_description":"Kreuzberg, quod Latine Mons Crucis, Kreuzberga sive Crucimontium reddatur, est pars urbis in regione Lucu Fridericiano et Monte Crucis Berolini. Antequam reformatione rerum administrativarum anno 2001 facta Mons Crucis coniunctus est cum regione nomine Lucu Fridericiano, regio sui iuris fuit in parte urbis quae occidentem solem spectat.\\nAlia pars regionis \\"Lucus Fridericiani et Montis Crucis\\" est Lucus Fridericianus, quae regio trans flumen Spreham sita est.\\nOlim Montis Crucis regio erat divisa in duos districtus publici cursus \\"SO36\\" et \\"SW61\\". SO dicit Südost seu \\"australis et orientalis\\" et SW dicit Südwest seu \\"australis et occidentalis\\". Districtus SO36 est violenta regio ubi autocineta Die Laboris cumburebantur, cum SW61 fuerit regio nobilior."},{"page_url":"https://fa.wikipedia.org/wiki/%D8%B3%D8%B3%DA%A9_%D8%B3%D8%B1%D8%B3%DB%8C%D8%A7%D9%87","image_url":"https://upload.wikimedia.org/wikipedia/commons/3/30/Sylvia_atricapilla_male_2.jpg","page_title":"سسک سرسیاه","context_page_description":"سسک سرسیاه نام یک گونه از سرده سسک تیپیکال است."},{"page_url":"https://de.wikipedia.org/wiki/Innere_Kanalstra%C3%9Fe","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/d1/Pano-unikoeln-magnusplatz.jpg","page_title":"Innere Kanalstraße","context_page_description":"Die Innere Kanalstraße ist eine 4,7 km lange Ringstraße am äußeren Rande des inneren Grüngürtels in Köln, die historisch an der Luxemburger Straße beginnt und an der Rampe zur Zoobrücke am Rhein endet."},{"page_url":"https://de.wikipedia.org/wiki/John_McDowell_(Philosoph)","image_url":"https://upload.wikimedia.org/wikipedia/commons/c/ca/John_McDowell.JPG","page_title":"John McDowell (Philosoph)","context_page_description":"John Henry McDowell ist ein südafrikanischer Philosoph der Gegenwart."},{"page_url":"https://ja.wikipedia.org/wiki/%E3%83%A4%E3%83%B3%E3%83%BB%E3%83%AD%E3%82%BB%E3%83%B3","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/dd/Battle_of_Stoczek_1831_1.png","page_title":"ヤン・ロセン","context_page_description":"ヤン・ボグミウ・ロセン は、ユダヤ系ポーランド人の画家。戦争画の作品で知られている。息子に、壁画家・モザイク画家のヤン・ヘンリク・デ・ロセンがいる。"},{"page_url":"https://en.wikipedia.org/wiki/Orion_Nebula","image_url":"https://upload.wikimedia.org/wikipedia/commons/4/44/Greeat_Nebula_in_Orion_core.jpg","page_title":"Orion Nebula","context_page_description":"The Orion Nebula is a diffuse nebula situated in the Milky Way, being south of Orion's Belt in the constellation of Orion. It is one of the brightest nebulae, and is visible to the naked eye in the night sky. M42 is located at a distance of 1,344 ± 20 light years and is the closest region of massive star formation to Earth. The M42 nebula is estimated to be 24 light years across. It has a mass of about 2,000 times that of the Sun. Older texts frequently refer to the Orion Nebula as the Great Nebula in Orion or the Great Orion Nebula.\\nThe Orion Nebula is one of the most scrutinized and photographed objects in the night sky, and is among the most intensely studied celestial features. The nebula has revealed much about the process of how stars and planetary systems are formed from collapsing clouds of gas and dust. Astronomers have directly observed protoplanetary disks, brown dwarfs, intense and turbulent motions of the gas, and the photo-ionizing effects of massive nearby stars in the nebula."},{"page_url":"https://war.wikipedia.org/wiki/Spiraea_cantoniensis","image_url":"http://upload.wikimedia.org/wikipedia/commons/a/a2/Spiraea_cantoniensis3.jpg","page_title":"Spiraea cantoniensis","context_page_description":"An Spiraea cantoniensis in uska species han Magnoliopsida nga ginhulagway ni João de Loureiro. An Spiraea cantoniensis in nahilalakip ha genus nga Spiraea, ngan familia nga Rosaceae."},{"page_url":"https://pl.wikipedia.org/wiki/%C5%BDera%C4%91e","image_url":"https://upload.wikimedia.org/wikipedia/commons/0/09/%D0%A7%D0%B5%D1%81%D0%BC%D0%B0_0572.jpg","page_title":"Žerađe","context_page_description":"Žerađe – wieś w Serbii, w okręgu raskim, w gminie Raška. W 2011 roku liczyła 120 mieszkańców."},{"page_url":"https://sv.wikipedia.org/wiki/Graz","image_url":"http://upload.wikimedia.org/wikipedia/commons/d/d5/Graz_Hauptplatz.jpg","page_title":"Graz","context_page_description":"Graz är huvudstad i det österrikiska förbundslandet Steiermark. Staden ligger 140 km sydväst om landets huvudstad Wien.\\nGraz ligger 363 meter över havet och har 320 587 invånare. Staden är därmed Österrikes näst största stad. Graz har fyra universitet och fyra högskolor. Stadens historiska kärna och slottet Eggenberg är upptagna i Unescos världsarvslista, och 2003 var Graz europeisk kulturhuvudstad. Sedan 1786 är Graz stiftsstad i Graz-Seckaus stift."},{"page_url":"https://sr.wikipedia.org/wiki/%D0%9E%D1%99%D0%BE%D0%BA%D0%BC%D0%B8%D0%BD%D1%81%D0%BA","image_url":"https://upload.wikimedia.org/wikipedia/commons/a/a1/Aerial_view_towards_Ol%C3%ABkminsk_in_afternoon_-_panoramio.jpg","page_title":"Ољокминск","context_page_description":"Ољокминск - село и административни центар истоимног Ољокминског рејона у западном делу Јакутије.\\nИма укупно 9.338 становника"},{"page_url":"https://cy.wikipedia.org/wiki/Cigydd-big_gyddfddu","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Vanikoroflycatcher.jpg","page_title":"Cigydd-big gyddfddu","context_page_description":"Aderyn a rhywogaeth o adar yw Cigydd-big gyddfddu a adnabyddir hefyd gyda'i enw gwyddonol Clytorhynchus nigrogularis; yr enw Saesneg arno yw Black-throated shrikebill. Mae'n perthyn i deulu'r Brenhinoedd sydd yn urdd y Passeriformes.\\nTalfyrir yr enw Lladin yn aml yn C. nigrogularis, sef enw'r rhywogaeth."},{"page_url":"https://zh.wikipedia.org/zh-my/%E5%9C%A3%E6%AF%8D%E9%A2%86%E6%8A%A5","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9e/Paolo_de_Matteis_-_The_Annunciation.jpg","page_title":"圣母领报","context_page_description":"圣母领报在基督教，指天使加百列向圣母玛利亚告知她将受圣神降孕而诞下圣子耶稣。\\n圣经记载这一事件发生于圣母玛利亚的亲戚依撒伯尔怀孕六个月之际。圣诞节以及其他节日，也以圣母领报节为根据，3月25日为圣子降孕节，如此推算40周之后的前后一段时间应该就是圣诞节。不过因为历法不同，东正教及其他东方教会中这一日子相当于公历的4月6日或7日。\\n由于3月25日接近春分，因而包括英国在内世界的许多地方将这一天当作新年，称为Lady Day。罗马天主教会与东方正教会都同意这一事件发生在纳匝肋，但对具体地点则有分歧。前者以纳匝肋的圣母领报堂所在位置为准，后者则以希腊东正教圣母领报堂为准。\\n圣母领报节的起源可以追溯至431年正式宣布玛利亚为天主之母的厄弗所大公会议时代。在基督教艺术与描绘圣母玛利亚的艺术作品，这是非常重要的主题，特别是在中世纪与文艺复兴时期。"},{"page_url":"https://cy.wikipedia.org/wiki/Borger,_Texas","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/34/Mike_Conaway%2C_official_109th_Congress_photo.jpg","page_title":"Borger, Texas","context_page_description":"Dinas yn Hutchinson County, yn nhalaith Texas, Unol Daleithiau America yw Borger, Texas. ac fe'i sefydlwyd ym 1926."},{"page_url":"https://ur.wikipedia.org/wiki/%D9%B9%D8%B1%D9%86%D9%88_%D8%B1%D9%88%DB%8C%D9%86%DB%8C","image_url":"https://upload.wikimedia.org/wikipedia/commons/b/be/Turnu_Ruieni_jud_Caras-Severin.png","page_title":"ٹرنو روینی","context_page_description":"ٹرنو روینی رومانیہ کا ایک گاؤں جو کاراش-سیویرین کاؤنٹی میں واقع ہے۔"},{"page_url":"https://gl.wikipedia.org/wiki/Pernambuco","image_url":"http://upload.wikimedia.org/wikipedia/commons/3/3b/Sert%C3%A2nia.png","page_title":"Pernambuco","context_page_description":"Pernambuco é un estado brasileiro localizado no centro-leste da rexión Nordeste. Ten como límites os Estados de Paraíba e Ceará ao noroeste, o Océano Atlántico ao leste, Alagoas e Baía ao sur e Piauí ao oeste. Ocupa unha área de 98 281 km².\\nA súa capital e cidade máis poboada é Recife. Outras importantes cidades pernambucanas son Jaboatão dos Guararapes, Olinda, Caruaru, Paulista, Petrolina, Cabo Vitória de Santo Antão e Santa Cruz do Capibaribe. A illa de Fernando de Noronha forma parte administrativa do estado de Pernambuco."},{"page_url":"https://en.wikipedia.org/wiki/Intracytoplasmic_sperm_injection","image_url":"https://upload.wikimedia.org/wikipedia/commons/d/db/Blausen_0060_AssistedReproductiveTechnology.png","page_title":"Intracytoplasmic sperm injection","context_page_description":"Intracytoplasmic sperm injection is an in vitro fertilization procedure in which a single sperm cell is injected directly into the cytoplasm of an egg. This technique is used in order to prepare the gametes for the obtention of embryos that may be transferred to a maternal uterus. With this method acrosome reaction is skipped.\\nThere are several differences within classic IVF and ICSI. However, the steps to be followed before and after insemination are the same. In terms of insemination, ICSI needs one only sperm cell per oocyte, meanwhile IVF needs between 50 and 100 thousands. This is because acrosome reaction has to take place and thousands of sperm cells have to be involved in IVF. Once fertilized, the egg is transformed into a proembryo and it has to be transferred to the uterus to continue its development.\\nThe first human pregnancy generated by ICSI was carried out in 1991 by Gianpiero Palermo and his team."},{"page_url":"https://tr.wikipedia.org/wiki/NGC_7834","image_url":"https://upload.wikimedia.org/wikipedia/commons/9/9a/NGC7834_-_SDSS_DR14.jpg","page_title":"NGC 7834","context_page_description":"NGC 7834, Yeni Genel Katalog'da yer alan bir galaksidir. Gökyüzünde Balıklar takımyıldızı yönünde bulunur. Sc tipi bir sarmal galaksidir. Alman astronom Albert Marth tarafından 1864 yılında 121,92 cm çaplı aynalı tip bir teleskopla keşfedilmiştir."}]`),L={name:"App",components:{PoemCard:M},data(){return{searchQuery:"",visibleCount:4,poemsData:P,isLoading:!1}},computed:{filteredPoems(){const i=this.searchQuery.trim().toLowerCase();return i?this.poemsData.filter(e=>e.page_title&&e.page_title.toLowerCase().includes(i)||e.context_page_description&&e.context_page_description.toLowerCase().includes(i)):this.poemsData},displayedPoems(){return this.searchQuery.trim()?this.filteredPoems:this.filteredPoems.slice(0,this.visibleCount)},hasMorePoems(){return!this.searchQuery.trim()&&this.visibleCount<this.poemsData.length}},methods:{async loadMore(){this.isLoading=!0,await new Promise(i=>setTimeout(i,1e3)),this.visibleCount+=4,this.isLoading=!1}}},T={class:"search-container"},F={class:"card-container"},G={key:0,class:"empty-state"},I=["disabled"],R={key:0},H={key:1};funct